    LU(i,906) = LU(i,906) + rate_constant(i,156) * number_density(i,137)

    !  k_HMPROPO2_HO2_1: HMPROPO2 + HO2 -> 0.4*OH + 0.4*HO2 + 0.4*CH3COCH3 + 0.4*CO2
    LU(i,906) = LU(i,906) + 0.4*rate_constant(i,289) * number_density(i,192)

    ! df_HO2/d(HMPROPO2)
    !  k_HMPROPO2_NO_1: HMPROPO2 + NO -> 1*NO2 + 1*CO2 + 1*HO2 + 1*CH3COCH3
    LU(i,951) = LU(i,951) + rate_constant(i,156) * number_density(i,137)

    !  k_HMPROPO2_HO2_1: HMPROPO2 + HO2 -> 0.4*OH + 0.4*HO2 + 0.4*CH3COCH3 + 0.4*CO2
    LU(i,951) = LU(i,951) - 0.6*rate_constant(i,289) * number_density(i,192)

    ! df_OH/d(HMPROPO2)
    !  k_HMPROPO2_HO2_1: HMPROPO2 + HO2 -> 0.4*OH + 0.4*HO2 + 0.4*CH3COCH3 + 0.4*CO2
    LU(i,931) = LU(i,931) + 0.4*rate_constant(i,289) * number_density(i,192)

    ! df_MVK/d(MVK)
    !  k_MVK_1: MVK -> 0.7*C3H6 + 0.7*CO + 0.3*CH3O2 + 0.3*CH3CO3
    LU(i,92) = LU(i,92) - rate_constant(i,15)

    !  k_MVK_OH_1: MVK + OH -> 1*MACRO2
    LU(i,92) = LU(i,92) - rate_constant(i,336) * number_density(i,166)

    !  k_MVK_O3_1: MVK + O3 -> 0.6*CH2O + 0.56*CO + 0.1*CH3CHO + 0.1*CO2 + 0.28*CH3CO3 + 0.5*CH3COCHO + 0.28*HO2 + 0.36*OH + 0.12*HCOOH
    LU(i,92) = LU(i,92) - rate_constant(i,420) * number_density(i,171)

    ! df_CH3CO3/d(MVK)
    !  k_MVK_1: MVK -> 0.7*C3H6 + 0.7*CO + 0.3*CH3O2 + 0.3*CH3CO3
    LU(i,93) = LU(i,93) + 0.3*rate_constant(i,15)

    !  k_MVK_O3_1: MVK + O3 -> 0.6*CH2O + 0.56*CO + 0.1*CH3CHO + 0.1*CO2 + 0.28*CH3CO3 + 0.5*CH3COCHO + 0.28*HO2 + 0.36*OH + 0.12*HCOOH
    LU(i,93) = LU(i,93) + 0.28*rate_constant(i,420) * number_density(i,171)

    ! df_CO2/d(MVK)
    !  k_MVK_O3_1: MVK + O3 -> 0.6*CH2O + 0.56*CO + 0.1*CH3CHO + 0.1*CO2 + 0.28*CH3CO3 + 0.5*CH3COCHO + 0.28*HO2 + 0.36*OH + 0.12*HCOOH
    LU(i,94) = LU(i,94) + 0.1*rate_constant(i,420) * number_density(i,171)

    ! df_HCOOH/d(MVK)
    !  k_MVK_O3_1: MVK + O3 -> 0.6*CH2O + 0.56*CO + 0.1*CH3CHO + 0.1*CO2 + 0.28*CH3CO3 + 0.5*CH3COCHO + 0.28*HO2 + 0.36*OH + 0.12*HCOOH
    LU(i,96) = LU(i,96) + 0.12*rate_constant(i,420) * number_density(i,171)

    ! df_CH3COCHO/d(MVK)
    !  k_MVK_O3_1: MVK + O3 -> 0.6*CH2O + 0.56*CO + 0.1*CH3CHO + 0.1*CO2 + 0.28*CH3CO3 + 0.5*CH3COCHO + 0.28*HO2 + 0.36*OH + 0.12*HCOOH
    LU(i,95) = LU(i,95) + 0.5*rate_constant(i,420) * number_density(i,171)

    ! df_CH3O2/d(MVK)
    !  k_MVK_1: MVK -> 0.7*C3H6 + 0.7*CO + 0.3*CH3O2 + 0.3*CH3CO3
    LU(i,104) = LU(i,104) + 0.3*rate_constant(i,15)

    ! df_C3H6/d(MVK)
    !  k_MVK_1: MVK -> 0.7*C3H6 + 0.7*CO + 0.3*CH3O2 + 0.3*CH3CO3
    LU(i,97) = LU(i,97) + 0.7*rate_constant(i,15)

    ! df_CH2O/d(MVK)
    !  k_MVK_O3_1: MVK + O3 -> 0.6*CH2O + 0.56*CO + 0.1*CH3CHO + 0.1*CO2 + 0.28*CH3CO3 + 0.5*CH3COCHO + 0.28*HO2 + 0.36*OH + 0.12*HCOOH
    LU(i,98) = LU(i,98) + 0.6*rate_constant(i,420) * number_density(i,171)

    ! df_MACRO2/d(MVK)
    !  k_MVK_OH_1: MVK + OH -> 1*MACRO2
    LU(i,103) = LU(i,103) + rate_constant(i,336) * number_density(i,166)

    ! df_HO2/d(MVK)
    !  k_MVK_O3_1: MVK + O3 -> 0.6*CH2O + 0.56*CO + 0.1*CH3CHO + 0.1*CO2 + 0.28*CH3CO3 + 0.5*CH3COCHO + 0.28*HO2 + 0.36*OH + 0.12*HCOOH
    LU(i,105) = LU(i,105) + 0.28*rate_constant(i,420) * number_density(i,171)

    ! df_OH/d(MVK)
    !  k_MVK_OH_1: MVK + OH -> 1*MACRO2
    LU(i,99) = LU(i,99) - rate_constant(i,336) * number_density(i,166)

    !  k_MVK_O3_1: MVK + O3 -> 0.6*CH2O + 0.56*CO + 0.1*CH3CHO + 0.1*CO2 + 0.28*CH3CO3 + 0.5*CH3COCHO + 0.28*HO2 + 0.36*OH + 0.12*HCOOH
    LU(i,99) = LU(i,99) + 0.36*rate_constant(i,420) * number_density(i,171)

    ! df_O3/d(MVK)
    !  k_MVK_O3_1: MVK + O3 -> 0.6*CH2O + 0.56*CO + 0.1*CH3CHO + 0.1*CO2 + 0.28*CH3CO3 + 0.5*CH3COCHO + 0.28*HO2 + 0.36*OH + 0.12*HCOOH
    LU(i,100) = LU(i,100) - rate_constant(i,420) * number_density(i,171)

    ! df_CO/d(MVK)
    !  k_MVK_1: MVK -> 0.7*C3H6 + 0.7*CO + 0.3*CH3O2 + 0.3*CH3CO3
    LU(i,101) = LU(i,101) + 0.7*rate_constant(i,15)

    !  k_MVK_O3_1: MVK + O3 -> 0.6*CH2O + 0.56*CO + 0.1*CH3CHO + 0.1*CO2 + 0.28*CH3CO3 + 0.5*CH3COCHO + 0.28*HO2 + 0.36*OH + 0.12*HCOOH
    LU(i,101) = LU(i,101) + 0.56*rate_constant(i,420) * number_density(i,171)

    ! df_CH3CHO/d(MVK)
    !  k_MVK_O3_1: MVK + O3 -> 0.6*CH2O + 0.56*CO + 0.1*CH3CHO + 0.1*CO2 + 0.28*CH3CO3 + 0.5*CH3COCHO + 0.28*HO2 + 0.36*OH + 0.12*HCOOH
    LU(i,102) = LU(i,102) + 0.1*rate_constant(i,420) * number_density(i,171)

    ! df_MACROOH/d(MACROOH)
    !  k_MACROOH_OH_1: MACROOH + OH -> 0.5*MCO3 + 0.2*MACRO2 + 0.1*OH + 0.2*HO2
    LU(i,257) = LU(i,257) - rate_constant(i,136) * number_density(i,166)
  end do
  !$acc end parallel

end subroutine dforce_dy4

subroutine dforce_dy5(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! df_MACRO2/d(MACROOH)
    !  k_MACROOH_OH_1: MACROOH + OH -> 0.5*MCO3 + 0.2*MACRO2 + 0.1*OH + 0.2*HO2
    LU(i,260) = LU(i,260) + 0.2*rate_constant(i,136) * number_density(i,166)

    ! df_MCO3/d(MACROOH)
    !  k_MACROOH_OH_1: MACROOH + OH -> 0.5*MCO3 + 0.2*MACRO2 + 0.1*OH + 0.2*HO2
    LU(i,259) = LU(i,259) + 0.5*rate_constant(i,136) * number_density(i,166)

    ! df_HO2/d(MACROOH)
    !  k_MACROOH_OH_1: MACROOH + OH -> 0.5*MCO3 + 0.2*MACRO2 + 0.1*OH + 0.2*HO2
    LU(i,261) = LU(i,261) + 0.2*rate_constant(i,136) * number_density(i,166)

    ! df_OH/d(MACROOH)
    !  k_MACROOH_OH_1: MACROOH + OH -> 0.5*MCO3 + 0.2*MACRO2 + 0.1*OH + 0.2*HO2
    LU(i,258) = LU(i,258) - 0.9*rate_constant(i,136) * number_density(i,166)

    ! df_ISOPNITB/d(ISOPNITB)
    !  k_ISOPNITB_OH_1: ISOPNITB + OH -> 0.5*HYAC + 0.5*GLYALD + 0.5*NOA + 1*HO2 + 0.5*HONITR
    LU(i,780) = LU(i,780) - rate_constant(i,79) * number_density(i,166)

    ! df_HYAC/d(ISOPNITB)
    !  k_ISOPNITB_OH_1: ISOPNITB + OH -> 0.5*HYAC + 0.5*GLYALD + 0.5*NOA + 1*HO2 + 0.5*HONITR
    LU(i,776) = LU(i,776) + 0.5*rate_constant(i,79) * number_density(i,166)

    ! df_GLYALD/d(ISOPNITB)
    !  k_ISOPNITB_OH_1: ISOPNITB + OH -> 0.5*HYAC + 0.5*GLYALD + 0.5*NOA + 1*HO2 + 0.5*HONITR
    LU(i,801) = LU(i,801) + 0.5*rate_constant(i,79) * number_density(i,166)

    ! df_HO2/d(ISOPNITB)
    !  k_ISOPNITB_OH_1: ISOPNITB + OH -> 0.5*HYAC + 0.5*GLYALD + 0.5*NOA + 1*HO2 + 0.5*HONITR
    LU(i,830) = LU(i,830) + rate_constant(i,79) * number_density(i,166)

    ! df_HONITR/d(ISOPNITB)
    !  k_ISOPNITB_OH_1: ISOPNITB + OH -> 0.5*HYAC + 0.5*GLYALD + 0.5*NOA + 1*HO2 + 0.5*HONITR
    LU(i,795) = LU(i,795) + 0.5*rate_constant(i,79) * number_density(i,166)

    ! df_OH/d(ISOPNITB)
    !  k_ISOPNITB_OH_1: ISOPNITB + OH -> 0.5*HYAC + 0.5*GLYALD + 0.5*NOA + 1*HO2 + 0.5*HONITR
    LU(i,810) = LU(i,810) - rate_constant(i,79) * number_density(i,166)

    ! df_NOA/d(ISOPNITB)
    !  k_ISOPNITB_OH_1: ISOPNITB + OH -> 0.5*HYAC + 0.5*GLYALD + 0.5*NOA + 1*HO2 + 0.5*HONITR
    LU(i,772) = LU(i,772) + 0.5*rate_constant(i,79) * number_density(i,166)

    ! df_SO3/d(SO3)
    !  k_SO3_1: SO3 -> 1*SO2 + 1*O
    LU(i,119) = LU(i,119) - rate_constant(i,24)

    !  k_H2O_SO3_1: H2O + SO3 -> 1*H2SO4 + 1*H2O
    LU(i,119) = LU(i,119) - rate_constant(i,325) * number_density(i,68)

    ! df_SO2/d(SO3)
    !  k_SO3_1: SO3 -> 1*SO2 + 1*O
    LU(i,120) = LU(i,120) + rate_constant(i,24)

    ! df_O/d(SO3)
    !  k_SO3_1: SO3 -> 1*SO2 + 1*O
    LU(i,121) = LU(i,121) + rate_constant(i,24)

    ! df_H2SO4/d(SO3)
    !  k_H2O_SO3_1: H2O + SO3 -> 1*H2SO4 + 1*H2O
    LU(i,118) = LU(i,118) + rate_constant(i,325) * number_density(i,68)

    ! df_OCS/d(OCS)
    !  k_OCS_OH_1: OCS + OH -> 1*SO2 + 1*CO + 1*H
    LU(i,123) = LU(i,123) - rate_constant(i,312) * number_density(i,166)

    !  k_OCS_1: OCS -> 1*S + 1*CO
    LU(i,123) = LU(i,123) - rate_constant(i,345)

    ! df_S/d(OCS)
    !  k_OCS_1: OCS -> 1*S + 1*CO
    LU(i,122) = LU(i,122) + rate_constant(i,345)

    ! df_H/d(OCS)
    !  k_OCS_OH_1: OCS + OH -> 1*SO2 + 1*CO + 1*H
    LU(i,124) = LU(i,124) + rate_constant(i,312) * number_density(i,166)

    ! df_SO2/d(OCS)
    !  k_OCS_OH_1: OCS + OH -> 1*SO2 + 1*CO + 1*H
    LU(i,125) = LU(i,125) + rate_constant(i,312) * number_density(i,166)

    ! df_OH/d(OCS)
    !  k_OCS_OH_1: OCS + OH -> 1*SO2 + 1*CO + 1*H
    LU(i,126) = LU(i,126) - rate_constant(i,312) * number_density(i,166)

    ! df_CO/d(OCS)
    !  k_OCS_OH_1: OCS + OH -> 1*SO2 + 1*CO + 1*H
    LU(i,127) = LU(i,127) + rate_constant(i,312) * number_density(i,166)

    !  k_OCS_1: OCS -> 1*S + 1*CO
    LU(i,127) = LU(i,127) + rate_constant(i,345)

    ! df_O2/d(SO)
    !  k_O3_SO_1: O3 + SO -> 1*SO2 + 1*O2
    LU(i,159) = LU(i,159) + rate_constant(i,140) * number_density(i,171)

    !  k_O2_SO_1: O2 + SO -> 1*SO2 + 1*O
    LU(i,159) = LU(i,159) - rate_constant(i,241) * number_density(i,41)

  end do
  !$acc end parallel

end subroutine dforce_dy5

subroutine dforce_dy6(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell
    ! df_SO/d(SO)
    !  k_OCLO_SO_1: OCLO + SO -> 1*SO2 + 1*CLO
    LU(i,158) = LU(i,158) - rate_constant(i,47) * number_density(i,183)

    !  k_BRO_SO_1: BRO + SO -> 1*SO2 + 1*BR
    LU(i,158) = LU(i,158) - rate_constant(i,58) * number_density(i,71)

    !  k_CLO_SO_1: CLO + SO -> 1*SO2 + 1*CL
    LU(i,158) = LU(i,158) - rate_constant(i,118) * number_density(i,86)

    !  k_O3_SO_1: O3 + SO -> 1*SO2 + 1*O2
    LU(i,158) = LU(i,158) - rate_constant(i,140) * number_density(i,171)

    !  k_O2_SO_1: O2 + SO -> 1*SO2 + 1*O
    LU(i,158) = LU(i,158) - rate_constant(i,241) * number_density(i,41)

    !  k_NO2_SO_1: NO2 + SO -> 1*SO2 + 1*NO
    LU(i,158) = LU(i,158) - rate_constant(i,260) * number_density(i,54)

    !  k_SO_1: SO -> 1*S + 1*O
    LU(i,158) = LU(i,158) - rate_constant(i,287)

    !  k_OH_SO_1: OH + SO -> 1*SO2 + 1*H
    LU(i,158) = LU(i,158) - rate_constant(i,486) * number_density(i,166)

    ! df_S/d(SO)
    !  k_SO_1: SO -> 1*S + 1*O
    LU(i,157) = LU(i,157) + rate_constant(i,287)

    ! df_H/d(SO)
    !  k_OH_SO_1: OH + SO -> 1*SO2 + 1*H
    LU(i,160) = LU(i,160) + rate_constant(i,486) * number_density(i,166)

    ! df_SO2/d(SO)
    !  k_OCLO_SO_1: OCLO + SO -> 1*SO2 + 1*CLO
    LU(i,162) = LU(i,162) + rate_constant(i,47) * number_density(i,183)

    !  k_BRO_SO_1: BRO + SO -> 1*SO2 + 1*BR
    LU(i,162) = LU(i,162) + rate_constant(i,58) * number_density(i,71)

    !  k_CLO_SO_1: CLO + SO -> 1*SO2 + 1*CL
    LU(i,162) = LU(i,162) + rate_constant(i,118) * number_density(i,86)

    !  k_O3_SO_1: O3 + SO -> 1*SO2 + 1*O2
    LU(i,162) = LU(i,162) + rate_constant(i,140) * number_density(i,171)

    !  k_O2_SO_1: O2 + SO -> 1*SO2 + 1*O
    LU(i,162) = LU(i,162) + rate_constant(i,241) * number_density(i,41)

    !  k_NO2_SO_1: NO2 + SO -> 1*SO2 + 1*NO
    LU(i,162) = LU(i,162) + rate_constant(i,260) * number_density(i,54)

    !  k_OH_SO_1: OH + SO -> 1*SO2 + 1*H
    LU(i,162) = LU(i,162) + rate_constant(i,486) * number_density(i,166)

    ! df_NO2/d(SO)
    !  k_NO2_SO_1: NO2 + SO -> 1*SO2 + 1*NO
    LU(i,161) = LU(i,161) - rate_constant(i,260) * number_density(i,54)

    ! df_NO/d(SO)
    !  k_NO2_SO_1: NO2 + SO -> 1*SO2 + 1*NO
    LU(i,167) = LU(i,167) + rate_constant(i,260) * number_density(i,54)

    ! df_BR/d(SO)
    !  k_BRO_SO_1: BRO + SO -> 1*SO2 + 1*BR
    LU(i,165) = LU(i,165) + rate_constant(i,58) * number_density(i,71)

    ! df_BRO/d(SO)
    !  k_BRO_SO_1: BRO + SO -> 1*SO2 + 1*BR
    LU(i,163) = LU(i,163) - rate_constant(i,58) * number_density(i,71)

    ! df_CL/d(SO)
    !  k_CLO_SO_1: CLO + SO -> 1*SO2 + 1*CL
    LU(i,166) = LU(i,166) + rate_constant(i,118) * number_density(i,86)

    ! df_CLO/d(SO)
    !  k_OCLO_SO_1: OCLO + SO -> 1*SO2 + 1*CLO
    LU(i,164) = LU(i,164) + rate_constant(i,47) * number_density(i,183)

    !  k_CLO_SO_1: CLO + SO -> 1*SO2 + 1*CL
    LU(i,164) = LU(i,164) - rate_constant(i,118) * number_density(i,86)

    ! df_O/d(SO)
    !  k_O2_SO_1: O2 + SO -> 1*SO2 + 1*O
    LU(i,171) = LU(i,171) + rate_constant(i,241) * number_density(i,41)

    !  k_SO_1: SO -> 1*S + 1*O
    LU(i,171) = LU(i,171) + rate_constant(i,287)

    ! df_OCLO/d(SO)
    !  k_OCLO_SO_1: OCLO + SO -> 1*SO2 + 1*CLO
    LU(i,170) = LU(i,170) - rate_constant(i,47) * number_density(i,183)

    ! df_OH/d(SO)
    !  k_OH_SO_1: OH + SO -> 1*SO2 + 1*H
    LU(i,168) = LU(i,168) - rate_constant(i,486) * number_density(i,166)

    ! df_O3/d(SO)
    !  k_O3_SO_1: O3 + SO -> 1*SO2 + 1*O2
    LU(i,169) = LU(i,169) - rate_constant(i,140) * number_density(i,171)

  end do
  !$acc end parallel

end subroutine dforce_dy6

subroutine dforce_dy7(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell
    ! df_O2/d(H)
    !  k_H_O3_1: H + O3 -> 1*OH + 1*O2
    LU(i,297) = LU(i,297) + rate_constant(i,158) * number_density(i,171)

    !  k_H_HO2_1: H + HO2 -> 1*H2 + 1*O2
    LU(i,297) = LU(i,297) + rate_constant(i,224) * number_density(i,192)

    !  k_H_O2_1: H + O2 -> 1*HO2
    LU(i,297) = LU(i,297) - rate_constant(i,240) * number_density(i,41)

    ! df_H/d(H)
    !  k_H_O3_1: H + O3 -> 1*OH + 1*O2
    LU(i,298) = LU(i,298) - rate_constant(i,158) * number_density(i,171)

    !  k_H_HO2_1: H + HO2 -> 1*H2 + 1*O2
    LU(i,298) = LU(i,298) - rate_constant(i,224) * number_density(i,192)

    !  k_H_O2_1: H + O2 -> 1*HO2
    LU(i,298) = LU(i,298) - rate_constant(i,240) * number_density(i,41)

    !  k_H_HO2_2: H + HO2 -> 1*H2O + 1*O
    LU(i,298) = LU(i,298) - rate_constant(i,282) * number_density(i,192)

    !  k_H_HO2_3: H + HO2 -> 2*OH
    LU(i,298) = LU(i,298) - rate_constant(i,457) * number_density(i,192)

    ! df_H2O/d(H)
    !  k_H_HO2_2: H + HO2 -> 1*H2O + 1*O
    LU(i,301) = LU(i,301) + rate_constant(i,282) * number_density(i,192)

    ! df_O/d(H)
    !  k_H_HO2_2: H + HO2 -> 1*H2O + 1*O
    LU(i,315) = LU(i,315) + rate_constant(i,282) * number_density(i,192)

    ! df_HO2/d(H)
    !  k_H_HO2_1: H + HO2 -> 1*H2 + 1*O2
    LU(i,316) = LU(i,316) - rate_constant(i,224) * number_density(i,192)

    !  k_H_O2_1: H + O2 -> 1*HO2
    LU(i,316) = LU(i,316) + rate_constant(i,240) * number_density(i,41)

    !  k_H_HO2_2: H + HO2 -> 1*H2O + 1*O
    LU(i,316) = LU(i,316) - rate_constant(i,282) * number_density(i,192)

    !  k_H_HO2_3: H + HO2 -> 2*OH
    LU(i,316) = LU(i,316) - rate_constant(i,457) * number_density(i,192)

    ! df_H2/d(H)
    !  k_H_HO2_1: H + HO2 -> 1*H2 + 1*O2
    LU(i,308) = LU(i,308) + rate_constant(i,224) * number_density(i,192)

    ! df_OH/d(H)
    !  k_H_O3_1: H + O3 -> 1*OH + 1*O2
    LU(i,311) = LU(i,311) + rate_constant(i,158) * number_density(i,171)

    !  k_H_HO2_3: H + HO2 -> 2*OH
    LU(i,311) = LU(i,311) + 2*rate_constant(i,457) * number_density(i,192)

    ! df_O3/d(H)
    !  k_H_O3_1: H + O3 -> 1*OH + 1*O2
    LU(i,312) = LU(i,312) - rate_constant(i,158) * number_density(i,171)

    ! df_MEK/d(MEK)
    !  k_MEK_1: MEK -> 1*CH3CO3 + 1*C2H5O2
    LU(i,2111) = LU(i,2111) - rate_constant(i,45)

    !  k_MEK_OH_1: MEK + OH -> 1*MEKO2
    LU(i,2111) = LU(i,2111) - rate_constant(i,66) * number_density(i,166)

    ! df_CH3CO3/d(MEK)
    !  k_MEK_1: MEK -> 1*CH3CO3 + 1*C2H5O2
    LU(i,2096) = LU(i,2096) + rate_constant(i,45)

    ! df_C2H5O2/d(MEK)
    !  k_MEK_1: MEK -> 1*CH3CO3 + 1*C2H5O2
    LU(i,2107) = LU(i,2107) + rate_constant(i,45)

    ! df_MEKO2/d(MEK)
    !  k_MEK_OH_1: MEK + OH -> 1*MEKO2
    LU(i,2120) = LU(i,2120) + rate_constant(i,66) * number_density(i,166)

    ! df_OH/d(MEK)
    !  k_MEK_OH_1: MEK + OH -> 1*MEKO2
    LU(i,2137) = LU(i,2137) - rate_constant(i,66) * number_density(i,166)

    ! df_SOAG0/d(MTERP)
    !  k_MTERP_O3_1: MTERP + O3 -> 1*MTERP + 1*O3 + 0.0508*SOAG0 + 0.1149*SOAG1 + 0.0348*SOAG2 + 0.0554*SOAG3 + 0.1278*SOAG4
    LU(i,134) = LU(i,134) + 0.0508*rate_constant(i,78) * number_density(i,171)

    !  k_MTERP_OH_2: MTERP + OH -> 1*MTERP + 1*OH + 0.0508*SOAG0 + 0.1149*SOAG1 + 0.0348*SOAG2 + 0.0554*SOAG3 + 0.1278*SOAG4
    LU(i,134) = LU(i,134) + 0.0508*rate_constant(i,254) * number_density(i,166)

    ! df_SOAG1/d(MTERP)
    !  k_MTERP_O3_1: MTERP + O3 -> 1*MTERP + 1*O3 + 0.0508*SOAG0 + 0.1149*SOAG1 + 0.0348*SOAG2 + 0.0554*SOAG3 + 0.1278*SOAG4
    LU(i,135) = LU(i,135) + 0.1149*rate_constant(i,78) * number_density(i,171)

    !  k_MTERP_OH_2: MTERP + OH -> 1*MTERP + 1*OH + 0.0508*SOAG0 + 0.1149*SOAG1 + 0.0348*SOAG2 + 0.0554*SOAG3 + 0.1278*SOAG4
    LU(i,135) = LU(i,135) + 0.1149*rate_constant(i,254) * number_density(i,166)

    ! df_SOAG2/d(MTERP)
    !  k_MTERP_O3_1: MTERP + O3 -> 1*MTERP + 1*O3 + 0.0508*SOAG0 + 0.1149*SOAG1 + 0.0348*SOAG2 + 0.0554*SOAG3 + 0.1278*SOAG4
    LU(i,136) = LU(i,136) + 0.0348*rate_constant(i,78) * number_density(i,171)
  end do
  !$acc end parallel

end subroutine dforce_dy7

subroutine dforce_dy8(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    !  k_MTERP_OH_2: MTERP + OH -> 1*MTERP + 1*OH + 0.0508*SOAG0 + 0.1149*SOAG1 + 0.0348*SOAG2 + 0.0554*SOAG3 + 0.1278*SOAG4
    LU(i,136) = LU(i,136) + 0.0348*rate_constant(i,254) * number_density(i,166)

    ! df_SOAG3/d(MTERP)
    !  k_MTERP_O3_1: MTERP + O3 -> 1*MTERP + 1*O3 + 0.0508*SOAG0 + 0.1149*SOAG1 + 0.0348*SOAG2 + 0.0554*SOAG3 + 0.1278*SOAG4
    LU(i,137) = LU(i,137) + 0.0554*rate_constant(i,78) * number_density(i,171)

    !  k_MTERP_NO3_2: MTERP + NO3 -> 1*MTERP + 1*NO3 + 0.17493*SOAG3 + 0.59019*SOAG4
    LU(i,137) = LU(i,137) + 0.17493*rate_constant(i,173) * number_density(i,165)

    !  k_MTERP_OH_2: MTERP + OH -> 1*MTERP + 1*OH + 0.0508*SOAG0 + 0.1149*SOAG1 + 0.0348*SOAG2 + 0.0554*SOAG3 + 0.1278*SOAG4
    LU(i,137) = LU(i,137) + 0.0554*rate_constant(i,254) * number_density(i,166)

    ! df_SOAG4/d(MTERP)
    !  k_MTERP_O3_1: MTERP + O3 -> 1*MTERP + 1*O3 + 0.0508*SOAG0 + 0.1149*SOAG1 + 0.0348*SOAG2 + 0.0554*SOAG3 + 0.1278*SOAG4
    LU(i,138) = LU(i,138) + 0.1278*rate_constant(i,78) * number_density(i,171)

    !  k_MTERP_NO3_2: MTERP + NO3 -> 1*MTERP + 1*NO3 + 0.17493*SOAG3 + 0.59019*SOAG4
    LU(i,138) = LU(i,138) + 0.59019*rate_constant(i,173) * number_density(i,165)

    !  k_MTERP_OH_2: MTERP + OH -> 1*MTERP + 1*OH + 0.0508*SOAG0 + 0.1149*SOAG1 + 0.0348*SOAG2 + 0.0554*SOAG3 + 0.1278*SOAG4
    LU(i,138) = LU(i,138) + 0.1278*rate_constant(i,254) * number_density(i,166)

    ! df_MTERP/d(MTERP)
    !  k_MTERP_NO3_1: MTERP + NO3 -> 1*NTERPO2
    LU(i,139) = LU(i,139) - rate_constant(i,111) * number_density(i,165)

    !  k_MTERP_OH_1: MTERP + OH -> 1*TERPO2
    LU(i,139) = LU(i,139) - rate_constant(i,181) * number_density(i,166)

    !  k_MTERP_O3_2: MTERP + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,139) = LU(i,139) - rate_constant(i,307) * number_density(i,171)

    ! df_RO2/d(MTERP)
    !  k_MTERP_O3_2: MTERP + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,140) = LU(i,140) + 0.06*rate_constant(i,307) * number_density(i,171)

    ! df_CH3CO3/d(MTERP)
    !  k_MTERP_O3_2: MTERP + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,141) = LU(i,141) + 0.06*rate_constant(i,307) * number_density(i,171)

    ! df_TERPROD1/d(MTERP)
    !  k_MTERP_O3_2: MTERP + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,142) = LU(i,142) + 0.33*rate_constant(i,307) * number_density(i,171)

    ! df_CO2/d(MTERP)
    !  k_MTERP_O3_2: MTERP + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,143) = LU(i,143) + 0.27*rate_constant(i,307) * number_density(i,171)

    ! df_HCOOH/d(MTERP)
    !  k_MTERP_O3_2: MTERP + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,146) = LU(i,146) + 0.05*rate_constant(i,307) * number_density(i,171)

    ! df_CH3COCH3/d(MTERP)
    !  k_MTERP_O3_2: MTERP + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,144) = LU(i,144) + 0.52*rate_constant(i,307) * number_density(i,171)

    ! df_BIGALD/d(MTERP)
    !  k_MTERP_O3_2: MTERP + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,145) = LU(i,145) + 0.1*rate_constant(i,307) * number_density(i,171)

    ! df_BIGALK/d(MTERP)
    !  k_MTERP_O3_2: MTERP + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,148) = LU(i,148) + 0.05*rate_constant(i,307) * number_density(i,171)

    ! df_CH2O/d(MTERP)
    !  k_MTERP_O3_2: MTERP + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,147) = LU(i,147) + 0.34*rate_constant(i,307) * number_density(i,171)

    ! df_HO2/d(MTERP)
    !  k_MTERP_O3_2: MTERP + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,156) = LU(i,156) + 0.57*rate_constant(i,307) * number_density(i,171)

    ! df_NTERPO2/d(MTERP)
    !  k_MTERP_NO3_1: MTERP + NO3 -> 1*NTERPO2
    LU(i,149) = LU(i,149) + rate_constant(i,111) * number_density(i,165)

    ! df_TERPO2/d(MTERP)
    !  k_MTERP_OH_1: MTERP + OH -> 1*TERPO2
    LU(i,150) = LU(i,150) + rate_constant(i,181) * number_density(i,166)

    ! df_TERPROD2/d(MTERP)
    !  k_MTERP_O3_2: MTERP + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,151) = LU(i,151) + 0.3*rate_constant(i,307) * number_density(i,171)

    ! df_NO3/d(MTERP)
    !  k_MTERP_NO3_1: MTERP + NO3 -> 1*NTERPO2
    LU(i,152) = LU(i,152) - rate_constant(i,111) * number_density(i,165)

    ! df_OH/d(MTERP)
    !  k_MTERP_OH_1: MTERP + OH -> 1*TERPO2
    LU(i,153) = LU(i,153) - rate_constant(i,181) * number_density(i,166)

    !  k_MTERP_O3_2: MTERP + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,153) = LU(i,153) + 0.63*rate_constant(i,307) * number_density(i,171)

    ! df_O3/d(MTERP)
    !  k_MTERP_O3_2: MTERP + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,154) = LU(i,154) - rate_constant(i,307) * number_density(i,171)

  end do
  !$acc end parallel

end subroutine dforce_dy8

subroutine dforce_dy9(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell
    ! df_CO/d(MTERP)
    !  k_MTERP_O3_2: MTERP + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,155) = LU(i,155) + 0.23*rate_constant(i,307) * number_density(i,171)

    ! df_N2O5/d(N2O5)
    !  k_N2O5_1: N2O5 -> 1*NO2 + 1*NO3
    LU(i,356) = LU(i,356) - rate_constant(i,236)

    !  k_N2O5_2: N2O5 -> 1*NO + 1*O + 1*NO3
    LU(i,356) = LU(i,356) - rate_constant(i,278)

    !  k_N2O5_3: N2O5 -> 1*NO2 + 1*NO3
    LU(i,356) = LU(i,356) - rate_constant(i,427)

    ! df_NO2/d(N2O5)
    !  k_N2O5_1: N2O5 -> 1*NO2 + 1*NO3
    LU(i,357) = LU(i,357) + rate_constant(i,236)

    !  k_N2O5_3: N2O5 -> 1*NO2 + 1*NO3
    LU(i,357) = LU(i,357) + rate_constant(i,427)

    ! df_NO/d(N2O5)
    !  k_N2O5_2: N2O5 -> 1*NO + 1*O + 1*NO3
    LU(i,358) = LU(i,358) + rate_constant(i,278)

    ! df_O/d(N2O5)
    !  k_N2O5_2: N2O5 -> 1*NO + 1*O + 1*NO3
    LU(i,360) = LU(i,360) + rate_constant(i,278)

    ! df_NO3/d(N2O5)
    !  k_N2O5_1: N2O5 -> 1*NO2 + 1*NO3
    LU(i,359) = LU(i,359) + rate_constant(i,236)

    !  k_N2O5_2: N2O5 -> 1*NO + 1*O + 1*NO3
    LU(i,359) = LU(i,359) + rate_constant(i,278)

    !  k_N2O5_3: N2O5 -> 1*NO2 + 1*NO3
    LU(i,359) = LU(i,359) + rate_constant(i,427)

    ! df_HCN/d(HCN)
    !  k_HCN_OH_1: HCN + OH -> 1*HO2
    LU(i,293) = LU(i,293) - rate_constant(i,234) * number_density(i,166)

    !  k_HCN_O1D_1: HCN + O1D -> 1*OH
    LU(i,293) = LU(i,293) - rate_constant(i,268) * number_density(i,112)

    ! df_O1D/d(HCN)
    !  k_HCN_O1D_1: HCN + O1D -> 1*OH
    LU(i,294) = LU(i,294) - rate_constant(i,268) * number_density(i,112)

    ! df_HO2/d(HCN)
    !  k_HCN_OH_1: HCN + OH -> 1*HO2
    LU(i,296) = LU(i,296) + rate_constant(i,234) * number_density(i,166)

    ! df_OH/d(HCN)
    !  k_HCN_OH_1: HCN + OH -> 1*HO2
    LU(i,295) = LU(i,295) - rate_constant(i,234) * number_density(i,166)

    !  k_HCN_O1D_1: HCN + O1D -> 1*OH
    LU(i,295) = LU(i,295) + rate_constant(i,268) * number_density(i,112)

    ! df_SOAG0/d(SVOC)
    !  k_OH_SVOC_1: OH + SVOC -> 1*OH + 0.5931*SOAG0 + 0.1534*SOAG1 + 0.0459*SOAG2 + 0.0085*SOAG3 + 0.0128*SOAG4
    LU(i,128) = LU(i,128) + 0.5931*rate_constant(i,51) * number_density(i,166)

    ! df_SOAG1/d(SVOC)
    !  k_OH_SVOC_1: OH + SVOC -> 1*OH + 0.5931*SOAG0 + 0.1534*SOAG1 + 0.0459*SOAG2 + 0.0085*SOAG3 + 0.0128*SOAG4
    LU(i,129) = LU(i,129) + 0.1534*rate_constant(i,51) * number_density(i,166)

    ! df_SOAG2/d(SVOC)
    !  k_OH_SVOC_1: OH + SVOC -> 1*OH + 0.5931*SOAG0 + 0.1534*SOAG1 + 0.0459*SOAG2 + 0.0085*SOAG3 + 0.0128*SOAG4
    LU(i,130) = LU(i,130) + 0.0459*rate_constant(i,51) * number_density(i,166)

    ! df_SOAG3/d(SVOC)
    !  k_OH_SVOC_1: OH + SVOC -> 1*OH + 0.5931*SOAG0 + 0.1534*SOAG1 + 0.0459*SOAG2 + 0.0085*SOAG3 + 0.0128*SOAG4
    LU(i,131) = LU(i,131) + 0.0085*rate_constant(i,51) * number_density(i,166)

    ! df_SOAG4/d(SVOC)
    !  k_OH_SVOC_1: OH + SVOC -> 1*OH + 0.5931*SOAG0 + 0.1534*SOAG1 + 0.0459*SOAG2 + 0.0085*SOAG3 + 0.0128*SOAG4
    LU(i,132) = LU(i,132) + 0.0128*rate_constant(i,51) * number_density(i,166)

    ! df_SVOC/d(SVOC)
    !  k_OH_SVOC_1: OH + SVOC -> 1*OH + 0.5931*SOAG0 + 0.1534*SOAG1 + 0.0459*SOAG2 + 0.0085*SOAG3 + 0.0128*SOAG4
    LU(i,133) = LU(i,133) - rate_constant(i,51) * number_density(i,166)

    ! df_ISOPNO3/d(ISOPNO3)
    !  k_CH3O2_ISOPNO3_1: CH3O2 + ISOPNO3 -> 0.8*NC4CHO + 1.2*HO2 + 0.8*CH2O + 0.2*CH3OH + 0.2*NC4CH2OH
    LU(i,278) = LU(i,278) - rate_constant(i,160) * number_density(i,191)

    !  k_ISOPNO3_NO_1: ISOPNO3 + NO -> 1*NC4CHO + 1*NO2 + 1*HO2
    LU(i,278) = LU(i,278) - rate_constant(i,302) * number_density(i,137)

    !  k_HO2_ISOPNO3_1: HO2 + ISOPNO3 -> 1*ISOPNOOH
    LU(i,278) = LU(i,278) - rate_constant(i,335) * number_density(i,192)

    !  k_CH3CO3_ISOPNO3_1: CH3CO3 + ISOPNO3 -> 1*NC4CHO + 1*CH3O2 + 1*HO2
    LU(i,278) = LU(i,278) - rate_constant(i,413) * number_density(i,49)

    !  k_ISOPNO3_NO3_1: ISOPNO3 + NO3 -> 1*NC4CHO + 1*NO2 + 1*HO2
    LU(i,278) = LU(i,278) - rate_constant(i,451) * number_density(i,165)

  end do
  !$acc end parallel

end subroutine dforce_dy9

subroutine dforce_dy10(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell
    ! df_CH3CO3/d(ISOPNO3)
    !  k_CH3CO3_ISOPNO3_1: CH3CO3 + ISOPNO3 -> 1*NC4CHO + 1*CH3O2 + 1*HO2
    LU(i,279) = LU(i,279) - rate_constant(i,413) * number_density(i,49)

    ! df_NO2/d(ISOPNO3)
    !  k_ISOPNO3_NO_1: ISOPNO3 + NO -> 1*NC4CHO + 1*NO2 + 1*HO2
    LU(i,280) = LU(i,280) + rate_constant(i,302) * number_density(i,137)

    !  k_ISOPNO3_NO3_1: ISOPNO3 + NO3 -> 1*NC4CHO + 1*NO2 + 1*HO2
    LU(i,280) = LU(i,280) + rate_constant(i,451) * number_density(i,165)

    ! df_NO/d(ISOPNO3)
    !  k_ISOPNO3_NO_1: ISOPNO3 + NO -> 1*NC4CHO + 1*NO2 + 1*HO2
    LU(i,286) = LU(i,286) - rate_constant(i,302) * number_density(i,137)

    ! df_CH3O2/d(ISOPNO3)
    !  k_CH3O2_ISOPNO3_1: CH3O2 + ISOPNO3 -> 0.8*NC4CHO + 1.2*HO2 + 0.8*CH2O + 0.2*CH3OH + 0.2*NC4CH2OH
    LU(i,291) = LU(i,291) - rate_constant(i,160) * number_density(i,191)

    !  k_CH3CO3_ISOPNO3_1: CH3CO3 + ISOPNO3 -> 1*NC4CHO + 1*CH3O2 + 1*HO2
    LU(i,291) = LU(i,291) + rate_constant(i,413) * number_density(i,49)

    ! df_CH2O/d(ISOPNO3)
    !  k_CH3O2_ISOPNO3_1: CH3O2 + ISOPNO3 -> 0.8*NC4CHO + 1.2*HO2 + 0.8*CH2O + 0.2*CH3OH + 0.2*NC4CH2OH
    LU(i,284) = LU(i,284) + 0.8*rate_constant(i,160) * number_density(i,191)

    ! df_CH3OH/d(ISOPNO3)
    !  k_CH3O2_ISOPNO3_1: CH3O2 + ISOPNO3 -> 0.8*NC4CHO + 1.2*HO2 + 0.8*CH2O + 0.2*CH3OH + 0.2*NC4CH2OH
    LU(i,283) = LU(i,283) + 0.2*rate_constant(i,160) * number_density(i,191)

    ! df_NC4CH2OH/d(ISOPNO3)
    !  k_CH3O2_ISOPNO3_1: CH3O2 + ISOPNO3 -> 0.8*NC4CHO + 1.2*HO2 + 0.8*CH2O + 0.2*CH3OH + 0.2*NC4CH2OH
    LU(i,287) = LU(i,287) + 0.2*rate_constant(i,160) * number_density(i,191)

    ! df_HO2/d(ISOPNO3)
    !  k_CH3O2_ISOPNO3_1: CH3O2 + ISOPNO3 -> 0.8*NC4CHO + 1.2*HO2 + 0.8*CH2O + 0.2*CH3OH + 0.2*NC4CH2OH
    LU(i,292) = LU(i,292) + 1.2*rate_constant(i,160) * number_density(i,191)

    !  k_ISOPNO3_NO_1: ISOPNO3 + NO -> 1*NC4CHO + 1*NO2 + 1*HO2
    LU(i,292) = LU(i,292) + rate_constant(i,302) * number_density(i,137)

    !  k_HO2_ISOPNO3_1: HO2 + ISOPNO3 -> 1*ISOPNOOH
    LU(i,292) = LU(i,292) - rate_constant(i,335) * number_density(i,192)

    !  k_CH3CO3_ISOPNO3_1: CH3CO3 + ISOPNO3 -> 1*NC4CHO + 1*CH3O2 + 1*HO2
    LU(i,292) = LU(i,292) + rate_constant(i,413) * number_density(i,49)

    !  k_ISOPNO3_NO3_1: ISOPNO3 + NO3 -> 1*NC4CHO + 1*NO2 + 1*HO2
    LU(i,292) = LU(i,292) + rate_constant(i,451) * number_density(i,165)

    ! df_ISOPNOOH/d(ISOPNO3)
    !  k_HO2_ISOPNO3_1: HO2 + ISOPNO3 -> 1*ISOPNOOH
    LU(i,288) = LU(i,288) + rate_constant(i,335) * number_density(i,192)

    ! df_NO3/d(ISOPNO3)
    !  k_ISOPNO3_NO3_1: ISOPNO3 + NO3 -> 1*NC4CHO + 1*NO2 + 1*HO2
    LU(i,289) = LU(i,289) - rate_constant(i,451) * number_density(i,165)

    ! df_NC4CHO/d(ISOPNO3)
    !  k_CH3O2_ISOPNO3_1: CH3O2 + ISOPNO3 -> 0.8*NC4CHO + 1.2*HO2 + 0.8*CH2O + 0.2*CH3OH + 0.2*NC4CH2OH
    LU(i,276) = LU(i,276) + 0.8*rate_constant(i,160) * number_density(i,191)

    !  k_ISOPNO3_NO_1: ISOPNO3 + NO -> 1*NC4CHO + 1*NO2 + 1*HO2
    LU(i,276) = LU(i,276) + rate_constant(i,302) * number_density(i,137)

    !  k_CH3CO3_ISOPNO3_1: CH3CO3 + ISOPNO3 -> 1*NC4CHO + 1*CH3O2 + 1*HO2
    LU(i,276) = LU(i,276) + rate_constant(i,413) * number_density(i,49)

    !  k_ISOPNO3_NO3_1: ISOPNO3 + NO3 -> 1*NC4CHO + 1*NO2 + 1*HO2
    LU(i,276) = LU(i,276) + rate_constant(i,451) * number_density(i,165)

    ! df_RO2/d(RO2)
    !  k_HO2_RO2_1: HO2 + RO2 -> 0.85*ROOH + 0.15*OH + 0.15*CH2O + 0.15*CH3CO3
    LU(i,214) = LU(i,214) - rate_constant(i,133) * number_density(i,192)

    !  k_CH3O2_RO2_1: CH3O2 + RO2 -> 0.3*CH3CO3 + 0.8*CH2O + 0.3*HO2 + 0.2*HYAC + 0.5*CH3COCHO + 0.5*CH3OH
    LU(i,214) = LU(i,214) - rate_constant(i,354) * number_density(i,191)

    !  k_NO_RO2_1: NO + RO2 -> 1*CH3CO3 + 1*CH2O + 1*NO2
    LU(i,214) = LU(i,214) - rate_constant(i,484) * number_density(i,137)

    ! df_CH3CO3/d(RO2)
    !  k_HO2_RO2_1: HO2 + RO2 -> 0.85*ROOH + 0.15*OH + 0.15*CH2O + 0.15*CH3CO3
    LU(i,215) = LU(i,215) + 0.15*rate_constant(i,133) * number_density(i,192)

    !  k_CH3O2_RO2_1: CH3O2 + RO2 -> 0.3*CH3CO3 + 0.8*CH2O + 0.3*HO2 + 0.2*HYAC + 0.5*CH3COCHO + 0.5*CH3OH
    LU(i,215) = LU(i,215) + 0.3*rate_constant(i,354) * number_density(i,191)

    !  k_NO_RO2_1: NO + RO2 -> 1*CH3CO3 + 1*CH2O + 1*NO2
    LU(i,215) = LU(i,215) + rate_constant(i,484) * number_density(i,137)

    ! df_HYAC/d(RO2)
    !  k_CH3O2_RO2_1: CH3O2 + RO2 -> 0.3*CH3CO3 + 0.8*CH2O + 0.3*HO2 + 0.2*HYAC + 0.5*CH3COCHO + 0.5*CH3OH
    LU(i,217) = LU(i,217) + 0.2*rate_constant(i,354) * number_density(i,191)

    ! df_NO2/d(RO2)
    !  k_NO_RO2_1: NO + RO2 -> 1*CH3CO3 + 1*CH2O + 1*NO2
    LU(i,216) = LU(i,216) + rate_constant(i,484) * number_density(i,137)

    ! df_NO/d(RO2)
    !  k_NO_RO2_1: NO + RO2 -> 1*CH3CO3 + 1*CH2O + 1*NO2
    LU(i,222) = LU(i,222) - rate_constant(i,484) * number_density(i,137)
  end do
  !$acc end parallel

end subroutine dforce_dy10

subroutine dforce_dy11(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! df_CH3COCHO/d(RO2)
    !  k_CH3O2_RO2_1: CH3O2 + RO2 -> 0.3*CH3CO3 + 0.8*CH2O + 0.3*HO2 + 0.2*HYAC + 0.5*CH3COCHO + 0.5*CH3OH
    LU(i,218) = LU(i,218) + 0.5*rate_constant(i,354) * number_density(i,191)

    ! df_CH3O2/d(RO2)
    !  k_CH3O2_RO2_1: CH3O2 + RO2 -> 0.3*CH3CO3 + 0.8*CH2O + 0.3*HO2 + 0.2*HYAC + 0.5*CH3COCHO + 0.5*CH3OH
    LU(i,224) = LU(i,224) - rate_constant(i,354) * number_density(i,191)

    ! df_CH2O/d(RO2)
    !  k_HO2_RO2_1: HO2 + RO2 -> 0.85*ROOH + 0.15*OH + 0.15*CH2O + 0.15*CH3CO3
    LU(i,221) = LU(i,221) + 0.15*rate_constant(i,133) * number_density(i,192)

    !  k_CH3O2_RO2_1: CH3O2 + RO2 -> 0.3*CH3CO3 + 0.8*CH2O + 0.3*HO2 + 0.2*HYAC + 0.5*CH3COCHO + 0.5*CH3OH
    LU(i,221) = LU(i,221) + 0.8*rate_constant(i,354) * number_density(i,191)

    !  k_NO_RO2_1: NO + RO2 -> 1*CH3CO3 + 1*CH2O + 1*NO2
    LU(i,221) = LU(i,221) + rate_constant(i,484) * number_density(i,137)

    ! df_CH3OH/d(RO2)
    !  k_CH3O2_RO2_1: CH3O2 + RO2 -> 0.3*CH3CO3 + 0.8*CH2O + 0.3*HO2 + 0.2*HYAC + 0.5*CH3COCHO + 0.5*CH3OH
    LU(i,220) = LU(i,220) + 0.5*rate_constant(i,354) * number_density(i,191)

    ! df_HO2/d(RO2)
    !  k_HO2_RO2_1: HO2 + RO2 -> 0.85*ROOH + 0.15*OH + 0.15*CH2O + 0.15*CH3CO3
    LU(i,225) = LU(i,225) - rate_constant(i,133) * number_density(i,192)

    !  k_CH3O2_RO2_1: CH3O2 + RO2 -> 0.3*CH3CO3 + 0.8*CH2O + 0.3*HO2 + 0.2*HYAC + 0.5*CH3COCHO + 0.5*CH3OH
    LU(i,225) = LU(i,225) + 0.3*rate_constant(i,354) * number_density(i,191)

    ! df_OH/d(RO2)
    !  k_HO2_RO2_1: HO2 + RO2 -> 0.85*ROOH + 0.15*OH + 0.15*CH2O + 0.15*CH3CO3
    LU(i,223) = LU(i,223) + 0.15*rate_constant(i,133) * number_density(i,192)

    ! df_ROOH/d(RO2)
    !  k_HO2_RO2_1: HO2 + RO2 -> 0.85*ROOH + 0.15*OH + 0.15*CH2O + 0.15*CH3CO3
    LU(i,219) = LU(i,219) + 0.85*rate_constant(i,133) * number_density(i,192)

    ! df_PHENO2/d(PHENO2)
    !  k_NO_PHENO2_1: NO + PHENO2 -> 1*HO2 + 0.7*GLYOXAL + 1*NO2
    LU(i,203) = LU(i,203) - rate_constant(i,257) * number_density(i,137)

    !  k_HO2_PHENO2_1: HO2 + PHENO2 -> 1*PHENOOH
    LU(i,203) = LU(i,203) - rate_constant(i,267) * number_density(i,192)

    ! df_NO2/d(PHENO2)
    !  k_NO_PHENO2_1: NO + PHENO2 -> 1*HO2 + 0.7*GLYOXAL + 1*NO2
    LU(i,204) = LU(i,204) + rate_constant(i,257) * number_density(i,137)

    ! df_NO/d(PHENO2)
    !  k_NO_PHENO2_1: NO + PHENO2 -> 1*HO2 + 0.7*GLYOXAL + 1*NO2
    LU(i,207) = LU(i,207) - rate_constant(i,257) * number_density(i,137)

    ! df_GLYOXAL/d(PHENO2)
    !  k_NO_PHENO2_1: NO + PHENO2 -> 1*HO2 + 0.7*GLYOXAL + 1*NO2
    LU(i,206) = LU(i,206) + 0.7*rate_constant(i,257) * number_density(i,137)

    ! df_HO2/d(PHENO2)
    !  k_NO_PHENO2_1: NO + PHENO2 -> 1*HO2 + 0.7*GLYOXAL + 1*NO2
    LU(i,208) = LU(i,208) + rate_constant(i,257) * number_density(i,137)

    !  k_HO2_PHENO2_1: HO2 + PHENO2 -> 1*PHENOOH
    LU(i,208) = LU(i,208) - rate_constant(i,267) * number_density(i,192)

    ! df_PHENOOH/d(PHENO2)
    !  k_HO2_PHENO2_1: HO2 + PHENO2 -> 1*PHENOOH
    LU(i,205) = LU(i,205) + rate_constant(i,267) * number_density(i,192)

    ! df_SOAG0/d(IVOC)
    !  k_IVOC_OH_1: IVOC + OH -> 1*OH + 0.2381*SOAG0 + 0.1308*SOAG1 + 0.0348*SOAG2 + 0.0076*SOAG3 + 0.0113*SOAG4
    LU(i,179) = LU(i,179) + 0.2381*rate_constant(i,243) * number_density(i,166)

    ! df_SOAG1/d(IVOC)
    !  k_IVOC_OH_1: IVOC + OH -> 1*OH + 0.2381*SOAG0 + 0.1308*SOAG1 + 0.0348*SOAG2 + 0.0076*SOAG3 + 0.0113*SOAG4
    LU(i,180) = LU(i,180) + 0.1308*rate_constant(i,243) * number_density(i,166)

    ! df_SOAG2/d(IVOC)
    !  k_IVOC_OH_1: IVOC + OH -> 1*OH + 0.2381*SOAG0 + 0.1308*SOAG1 + 0.0348*SOAG2 + 0.0076*SOAG3 + 0.0113*SOAG4
    LU(i,181) = LU(i,181) + 0.0348*rate_constant(i,243) * number_density(i,166)

    ! df_SOAG3/d(IVOC)
    !  k_IVOC_OH_1: IVOC + OH -> 1*OH + 0.2381*SOAG0 + 0.1308*SOAG1 + 0.0348*SOAG2 + 0.0076*SOAG3 + 0.0113*SOAG4
    LU(i,182) = LU(i,182) + 0.0076*rate_constant(i,243) * number_density(i,166)

    ! df_SOAG4/d(IVOC)
    !  k_IVOC_OH_1: IVOC + OH -> 1*OH + 0.2381*SOAG0 + 0.1308*SOAG1 + 0.0348*SOAG2 + 0.0076*SOAG3 + 0.0113*SOAG4
    LU(i,183) = LU(i,183) + 0.0113*rate_constant(i,243) * number_density(i,166)

    ! df_IVOC/d(IVOC)
    !  k_IVOC_OH_1: IVOC + OH -> 1*OH + 0.2381*SOAG0 + 0.1308*SOAG1 + 0.0348*SOAG2 + 0.0076*SOAG3 + 0.0113*SOAG4
    LU(i,184) = LU(i,184) - rate_constant(i,243) * number_density(i,166)

    ! df_TERPNIT/d(TERPNIT)
    !  k_TERPNIT_1: TERPNIT -> 1*TERPROD1 + 1*NO2 + 1*HO2
    LU(i,209) = LU(i,209) - rate_constant(i,5)

    !  k_OH_TERPNIT_1: OH + TERPNIT -> 1*NO2 + 1*TERPROD1
    LU(i,209) = LU(i,209) - rate_constant(i,428) * number_density(i,166)

    ! df_TERPROD1/d(TERPNIT)
    !  k_TERPNIT_1: TERPNIT -> 1*TERPROD1 + 1*NO2 + 1*HO2
    LU(i,211) = LU(i,211) + rate_constant(i,5)
  end do
  !$acc end parallel

end subroutine dforce_dy11

subroutine dforce_dy12(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    !  k_OH_TERPNIT_1: OH + TERPNIT -> 1*NO2 + 1*TERPROD1
    LU(i,211) = LU(i,211) + rate_constant(i,428) * number_density(i,166)

    ! df_NO2/d(TERPNIT)
    !  k_TERPNIT_1: TERPNIT -> 1*TERPROD1 + 1*NO2 + 1*HO2
    LU(i,210) = LU(i,210) + rate_constant(i,5)

    !  k_OH_TERPNIT_1: OH + TERPNIT -> 1*NO2 + 1*TERPROD1
    LU(i,210) = LU(i,210) + rate_constant(i,428) * number_density(i,166)

    ! df_HO2/d(TERPNIT)
    !  k_TERPNIT_1: TERPNIT -> 1*TERPROD1 + 1*NO2 + 1*HO2
    LU(i,213) = LU(i,213) + rate_constant(i,5)

    ! df_OH/d(TERPNIT)
    !  k_OH_TERPNIT_1: OH + TERPNIT -> 1*NO2 + 1*TERPROD1
    LU(i,212) = LU(i,212) - rate_constant(i,428) * number_density(i,166)

    ! df_CCL4/d(CCL4)
    !  k_CCL4_1: CCL4 -> 4*CL
    LU(i,556) = LU(i,556) - rate_constant(i,116)

    !  k_CCL4_O1D_1: CCL4 + O1D -> 4*CL
    LU(i,556) = LU(i,556) - rate_constant(i,366) * number_density(i,112)

    ! df_CL/d(CCL4)
    !  k_CCL4_1: CCL4 -> 4*CL
    LU(i,557) = LU(i,557) + 4*rate_constant(i,116)

    !  k_CCL4_O1D_1: CCL4 + O1D -> 4*CL
    LU(i,557) = LU(i,557) + 4*rate_constant(i,366) * number_density(i,112)

    ! df_O1D/d(CCL4)
    !  k_CCL4_O1D_1: CCL4 + O1D -> 4*CL
    LU(i,558) = LU(i,558) - rate_constant(i,366) * number_density(i,112)

    ! df_HNO3/d(HNO3)
    !  k_HNO3_1: HNO3 -> 1*NO2 + 1*OH
    LU(i,245) = LU(i,245) - rate_constant(i,258)

    !  k_HNO3_OH_1: HNO3 + OH -> 1*NO3 + 1*H2O
    LU(i,245) = LU(i,245) - rate_constant(i,398) * number_density(i,166)

    !  k_HNO3_OH_2: HNO3 + OH -> 1*NO3 + 1*H2O
    LU(i,245) = LU(i,245) - rate_constant(i,399) * number_density(i,166)

    ! df_H2O/d(HNO3)
    !  k_HNO3_OH_1: HNO3 + OH -> 1*NO3 + 1*H2O
    LU(i,247) = LU(i,247) + rate_constant(i,398) * number_density(i,166)

    !  k_HNO3_OH_2: HNO3 + OH -> 1*NO3 + 1*H2O
    LU(i,247) = LU(i,247) + rate_constant(i,399) * number_density(i,166)

    ! df_NO2/d(HNO3)
    !  k_HNO3_1: HNO3 -> 1*NO2 + 1*OH
    LU(i,246) = LU(i,246) + rate_constant(i,258)

    ! df_NO3/d(HNO3)
    !  k_HNO3_OH_1: HNO3 + OH -> 1*NO3 + 1*H2O
    LU(i,248) = LU(i,248) + rate_constant(i,398) * number_density(i,166)

    !  k_HNO3_OH_2: HNO3 + OH -> 1*NO3 + 1*H2O
    LU(i,248) = LU(i,248) + rate_constant(i,399) * number_density(i,166)

    ! df_OH/d(HNO3)
    !  k_HNO3_1: HNO3 -> 1*NO2 + 1*OH
    LU(i,249) = LU(i,249) + rate_constant(i,258)

    !  k_HNO3_OH_1: HNO3 + OH -> 1*NO3 + 1*H2O
    LU(i,249) = LU(i,249) - rate_constant(i,398) * number_density(i,166)

    !  k_HNO3_OH_2: HNO3 + OH -> 1*NO3 + 1*H2O
    LU(i,249) = LU(i,249) - rate_constant(i,399) * number_density(i,166)

    ! df_ACBZO2/d(ACBZO2)
    !  k_ACBZO2_HO2_1: ACBZO2 + HO2 -> 0.4*C6H5O2 + 0.4*OH
    LU(i,250) = LU(i,250) - rate_constant(i,52) * number_density(i,192)

    !  k_ACBZO2_NO_1: ACBZO2 + NO -> 1*C6H5O2 + 1*NO2
    LU(i,250) = LU(i,250) - rate_constant(i,263) * number_density(i,137)

    !  k_ACBZO2_NO2_1: ACBZO2 + NO2 -> 1*PBZNIT
    LU(i,250) = LU(i,250) - rate_constant(i,388) * number_density(i,54)

    ! df_C6H5O2/d(ACBZO2)
    !  k_ACBZO2_HO2_1: ACBZO2 + HO2 -> 0.4*C6H5O2 + 0.4*OH
    LU(i,252) = LU(i,252) + 0.4*rate_constant(i,52) * number_density(i,192)

    !  k_ACBZO2_NO_1: ACBZO2 + NO -> 1*C6H5O2 + 1*NO2
    LU(i,252) = LU(i,252) + rate_constant(i,263) * number_density(i,137)

    ! df_NO2/d(ACBZO2)
    !  k_ACBZO2_NO_1: ACBZO2 + NO -> 1*C6H5O2 + 1*NO2
    LU(i,251) = LU(i,251) + rate_constant(i,263) * number_density(i,137)

    !  k_ACBZO2_NO2_1: ACBZO2 + NO2 -> 1*PBZNIT
    LU(i,251) = LU(i,251) - rate_constant(i,388) * number_density(i,54)

    ! df_NO/d(ACBZO2)
    !  k_ACBZO2_NO_1: ACBZO2 + NO -> 1*C6H5O2 + 1*NO2
    LU(i,253) = LU(i,253) - rate_constant(i,263) * number_density(i,137)
  end do
  !$acc end parallel

end subroutine dforce_dy12

subroutine dforce_dy13(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! df_HO2/d(ACBZO2)
    !  k_ACBZO2_HO2_1: ACBZO2 + HO2 -> 0.4*C6H5O2 + 0.4*OH
    LU(i,256) = LU(i,256) - rate_constant(i,52) * number_density(i,192)

    ! df_PBZNIT/d(ACBZO2)
    !  k_ACBZO2_NO2_1: ACBZO2 + NO2 -> 1*PBZNIT
    LU(i,254) = LU(i,254) + rate_constant(i,388) * number_density(i,54)

    ! df_OH/d(ACBZO2)
    !  k_ACBZO2_HO2_1: ACBZO2 + HO2 -> 0.4*C6H5O2 + 0.4*OH
    LU(i,255) = LU(i,255) + 0.4*rate_constant(i,52) * number_density(i,192)

    ! df_CH3COOOH/d(CH3COOOH)
    !  k_CH3COOOH_1: CH3COOOH -> 1*CH3O2 + 1*OH + 1*CO2
    LU(i,7649) = LU(i,7649) - rate_constant(i,199)

    !  k_CH3COOOH_OH_1: CH3COOOH + OH -> 0.5*CH3CO3 + 0.5*CH2O + 0.5*CO2 + 1*H2O
    LU(i,7649) = LU(i,7649) - rate_constant(i,393) * number_density(i,166)

    ! df_CH3CO3/d(CH3COOOH)
    !  k_CH3COOOH_OH_1: CH3COOOH + OH -> 0.5*CH3CO3 + 0.5*CH2O + 0.5*CO2 + 1*H2O
    LU(i,7583) = LU(i,7583) + 0.5*rate_constant(i,393) * number_density(i,166)

    ! df_H2O/d(CH3COOOH)
    !  k_CH3COOOH_OH_1: CH3COOOH + OH -> 0.5*CH3CO3 + 0.5*CH2O + 0.5*CO2 + 1*H2O
    LU(i,7587) = LU(i,7587) + rate_constant(i,393) * number_density(i,166)

    ! df_CO2/d(CH3COOOH)
    !  k_CH3COOOH_1: CH3COOOH -> 1*CH3O2 + 1*OH + 1*CO2
    LU(i,7592) = LU(i,7592) + rate_constant(i,199)

    !  k_CH3COOOH_OH_1: CH3COOOH + OH -> 0.5*CH3CO3 + 0.5*CH2O + 0.5*CO2 + 1*H2O
    LU(i,7592) = LU(i,7592) + 0.5*rate_constant(i,393) * number_density(i,166)

    ! df_CH3O2/d(CH3COOOH)
    !  k_CH3COOOH_1: CH3COOOH -> 1*CH3O2 + 1*OH + 1*CO2
    LU(i,7656) = LU(i,7656) + rate_constant(i,199)

    ! df_CH2O/d(CH3COOOH)
    !  k_CH3COOOH_OH_1: CH3COOOH + OH -> 0.5*CH3CO3 + 0.5*CH2O + 0.5*CO2 + 1*H2O
    LU(i,7603) = LU(i,7603) + 0.5*rate_constant(i,393) * number_density(i,166)

    ! df_OH/d(CH3COOOH)
    !  k_CH3COOOH_1: CH3COOOH -> 1*CH3O2 + 1*OH + 1*CO2
    LU(i,7631) = LU(i,7631) + rate_constant(i,199)

    !  k_CH3COOOH_OH_1: CH3COOOH + OH -> 0.5*CH3CO3 + 0.5*CH2O + 0.5*CO2 + 1*H2O
    LU(i,7631) = LU(i,7631) - rate_constant(i,393) * number_density(i,166)

    ! df_SO3/d(SO2)
    !  k_OH_SO2_1: OH + SO2 -> 1*SO3 + 1*HO2
    LU(i,435) = LU(i,435) + rate_constant(i,22) * number_density(i,166)

    ! df_SO/d(SO2)
    !  k_SO2_1: SO2 -> 1*SO + 1*O
    LU(i,436) = LU(i,436) + rate_constant(i,87)

    ! df_SO2/d(SO2)
    !  k_OH_SO2_1: OH + SO2 -> 1*SO3 + 1*HO2
    LU(i,440) = LU(i,440) - rate_constant(i,22) * number_density(i,166)

    !  k_SO2_1: SO2 -> 1*SO + 1*O
    LU(i,440) = LU(i,440) - rate_constant(i,87)

    ! df_O/d(SO2)
    !  k_SO2_1: SO2 -> 1*SO + 1*O
    LU(i,485) = LU(i,485) + rate_constant(i,87)

    ! df_HO2/d(SO2)
    !  k_OH_SO2_1: OH + SO2 -> 1*SO3 + 1*HO2
    LU(i,490) = LU(i,490) + rate_constant(i,22) * number_density(i,166)

    ! df_OH/d(SO2)
    !  k_OH_SO2_1: OH + SO2 -> 1*SO3 + 1*HO2
    LU(i,473) = LU(i,473) - rate_constant(i,22) * number_density(i,166)

    ! df_PAN/d(CH3CO3)
    !  k_CH3CO3_NO2_1: CH3CO3 + NO2 -> 1*PAN
    LU(i,317) = LU(i,317) + rate_constant(i,383) * number_density(i,54)

    ! df_MVK/d(CH3CO3)
    !  k_CH3CO3_ISOPAO2_1: CH3CO3 + ISOPAO2 -> 1*CH3O2 + 1*HO2 + 1*CH2O + 0.39*MACR + 0.61*MVK + 1*CO2
    LU(i,319) = LU(i,319) + 0.61*rate_constant(i,65) * number_density(i,189)

    ! df_ISOPNO3/d(CH3CO3)
    !  k_CH3CO3_ISOPNO3_1: CH3CO3 + ISOPNO3 -> 1*NC4CHO + 1*CH3O2 + 1*HO2
    LU(i,321) = LU(i,321) - rate_constant(i,413) * number_density(i,46)

    ! df_CH3COOOH/d(CH3CO3)
    !  k_CH3CO3_HO2_1: CH3CO3 + HO2 -> 0.4*CH3COOOH + 0.15*CH3COOH + 0.15*O3 + 0.45*OH + 0.45*CH3O2
    LU(i,347) = LU(i,347) + 0.4*rate_constant(i,259) * number_density(i,192)

    ! df_CH3CO3/d(CH3CO3)
    !  k_CH3CO3_NO_1: CH3CO3 + NO -> 1*CH3O2 + 1*CO2 + 1*NO2
    LU(i,322) = LU(i,322) - rate_constant(i,25) * number_density(i,137)

    !  k_CH3CO3_CH3CO3_1: CH3CO3 + CH3CO3 -> 2*CH3O2 + 2*CO2
    LU(i,322) = LU(i,322) - rate_constant(i,32) * number_density(i,49)

    !  k_CH3CO3_CH3CO3_1: CH3CO3 + CH3CO3 -> 2*CH3O2 + 2*CO2
    LU(i,322) = LU(i,322) - rate_constant(i,32) * number_density(i,49)
  end do
  !$acc end parallel

end subroutine dforce_dy13

subroutine dforce_dy14(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    !  k_CH3CO3_CH3CO3_1: CH3CO3 + CH3CO3 -> 2*CH3O2 + 2*CO2
    LU(i,322) = LU(i,322) - rate_constant(i,32) * number_density(i,49)

    !  k_CH3CO3_CH3CO3_1: CH3CO3 + CH3CO3 -> 2*CH3O2 + 2*CO2
    LU(i,322) = LU(i,322) - rate_constant(i,32) * number_density(i,49)

    !  k_CH3CO3_ISOPAO2_1: CH3CO3 + ISOPAO2 -> 1*CH3O2 + 1*HO2 + 1*CH2O + 0.39*MACR + 0.61*MVK + 1*CO2
    LU(i,322) = LU(i,322) - rate_constant(i,65) * number_density(i,189)

    !  k_CH3CO3_CH3O2_1: CH3CO3 + CH3O2 -> 0.9*CH3O2 + 1*CH2O + 0.9*HO2 + 0.9*CO2 + 0.1*CH3COOH
    LU(i,322) = LU(i,322) - rate_constant(i,99) * number_density(i,191)

    !  k_CH3CO3_XO2_1: CH3CO3 + XO2 -> 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 1*CH3O2 + 1*HO2 + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD + 1*CO2
    LU(i,322) = LU(i,322) - rate_constant(i,106) * number_density(i,153)

    !  k_CH3CO3_MACRO2_1: CH3CO3 + MACRO2 -> 0.25*CH3COCHO + 1*CH3O2 + 0.22*CO + 0.47*HO2 + 0.53*GLYALD + 0.22*HYAC + 0.25*CH2O + 0.53*CH3CO3
    LU(i,322) = LU(i,322) - 0.47*rate_constant(i,235) * number_density(i,188)

    !  k_CH3CO3_HO2_1: CH3CO3 + HO2 -> 0.4*CH3COOOH + 0.15*CH3COOH + 0.15*O3 + 0.45*OH + 0.45*CH3O2
    LU(i,322) = LU(i,322) - rate_constant(i,259) * number_density(i,192)

    !  k_CH3CO3_ISOPBO2_1: CH3CO3 + ISOPBO2 -> 1*HYDRALD + 1*CH3O2 + 1*HO2
    LU(i,322) = LU(i,322) - rate_constant(i,340) * number_density(i,190)

    !  k_CH3CO3_NO2_1: CH3CO3 + NO2 -> 1*PAN
    LU(i,322) = LU(i,322) - rate_constant(i,383) * number_density(i,54)

    !  k_CH3CO3_ISOPNO3_1: CH3CO3 + ISOPNO3 -> 1*NC4CHO + 1*CH3O2 + 1*HO2
    LU(i,322) = LU(i,322) - rate_constant(i,413) * number_density(i,46)

    ! df_HYAC/d(CH3CO3)
    !  k_CH3CO3_XO2_1: CH3CO3 + XO2 -> 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 1*CH3O2 + 1*HO2 + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD + 1*CO2
    LU(i,324) = LU(i,324) + 0.25*rate_constant(i,106) * number_density(i,153)

    !  k_CH3CO3_MACRO2_1: CH3CO3 + MACRO2 -> 0.25*CH3COCHO + 1*CH3O2 + 0.22*CO + 0.47*HO2 + 0.53*GLYALD + 0.22*HYAC + 0.25*CH2O + 0.53*CH3CO3
    LU(i,324) = LU(i,324) + 0.22*rate_constant(i,235) * number_density(i,188)

    ! df_NO2/d(CH3CO3)
    !  k_CH3CO3_NO_1: CH3CO3 + NO -> 1*CH3O2 + 1*CO2 + 1*NO2
    LU(i,323) = LU(i,323) + rate_constant(i,25) * number_density(i,137)

    !  k_CH3CO3_NO2_1: CH3CO3 + NO2 -> 1*PAN
    LU(i,323) = LU(i,323) - rate_constant(i,383) * number_density(i,54)

    ! df_NO/d(CH3CO3)
    !  k_CH3CO3_NO_1: CH3CO3 + NO -> 1*CH3O2 + 1*CO2 + 1*NO2
    LU(i,333) = LU(i,333) - rate_constant(i,25) * number_density(i,137)

    ! df_CO2/d(CH3CO3)
    !  k_CH3CO3_NO_1: CH3CO3 + NO -> 1*CH3O2 + 1*CO2 + 1*NO2
    LU(i,325) = LU(i,325) + rate_constant(i,25) * number_density(i,137)

    !  k_CH3CO3_CH3CO3_1: CH3CO3 + CH3CO3 -> 2*CH3O2 + 2*CO2
    LU(i,325) = LU(i,325) + 2*rate_constant(i,32) * number_density(i,49)

    !  k_CH3CO3_CH3CO3_1: CH3CO3 + CH3CO3 -> 2*CH3O2 + 2*CO2
    LU(i,325) = LU(i,325) + 2*rate_constant(i,32) * number_density(i,49)

    !  k_CH3CO3_ISOPAO2_1: CH3CO3 + ISOPAO2 -> 1*CH3O2 + 1*HO2 + 1*CH2O + 0.39*MACR + 0.61*MVK + 1*CO2
    LU(i,325) = LU(i,325) + rate_constant(i,65) * number_density(i,189)

    !  k_CH3CO3_MCO3_1: CH3CO3 + MCO3 -> 2*CO2 + 1*CH3O2 + 1*CH2O + 1*CH3CO3
    LU(i,325) = LU(i,325) + 2*rate_constant(i,81) * number_density(i,167)

    !  k_CH3CO3_CH3O2_1: CH3CO3 + CH3O2 -> 0.9*CH3O2 + 1*CH2O + 0.9*HO2 + 0.9*CO2 + 0.1*CH3COOH
    LU(i,325) = LU(i,325) + 0.9*rate_constant(i,99) * number_density(i,191)

    !  k_CH3CO3_XO2_1: CH3CO3 + XO2 -> 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 1*CH3O2 + 1*HO2 + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD + 1*CO2
    LU(i,325) = LU(i,325) + rate_constant(i,106) * number_density(i,153)

    ! df_CH3COCHO/d(CH3CO3)
    !  k_CH3CO3_XO2_1: CH3CO3 + XO2 -> 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 1*CH3O2 + 1*HO2 + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD + 1*CO2
    LU(i,327) = LU(i,327) + 0.25*rate_constant(i,106) * number_density(i,153)

    !  k_CH3CO3_MACRO2_1: CH3CO3 + MACRO2 -> 0.25*CH3COCHO + 1*CH3O2 + 0.22*CO + 0.47*HO2 + 0.53*GLYALD + 0.22*HYAC + 0.25*CH2O + 0.53*CH3CO3
    LU(i,327) = LU(i,327) + 0.25*rate_constant(i,235) * number_density(i,188)

    ! df_CH3O2/d(CH3CO3)
    !  k_CH3CO3_NO_1: CH3CO3 + NO -> 1*CH3O2 + 1*CO2 + 1*NO2
    LU(i,351) = LU(i,351) + rate_constant(i,25) * number_density(i,137)

    !  k_CH3CO3_CH3CO3_1: CH3CO3 + CH3CO3 -> 2*CH3O2 + 2*CO2
    LU(i,351) = LU(i,351) + 2*rate_constant(i,32) * number_density(i,49)

    !  k_CH3CO3_CH3CO3_1: CH3CO3 + CH3CO3 -> 2*CH3O2 + 2*CO2
    LU(i,351) = LU(i,351) + 2*rate_constant(i,32) * number_density(i,49)

    !  k_CH3CO3_ISOPAO2_1: CH3CO3 + ISOPAO2 -> 1*CH3O2 + 1*HO2 + 1*CH2O + 0.39*MACR + 0.61*MVK + 1*CO2
    LU(i,351) = LU(i,351) + rate_constant(i,65) * number_density(i,189)

    !  k_CH3CO3_MCO3_1: CH3CO3 + MCO3 -> 2*CO2 + 1*CH3O2 + 1*CH2O + 1*CH3CO3
    LU(i,351) = LU(i,351) + rate_constant(i,81) * number_density(i,167)

    !  k_CH3CO3_CH3O2_1: CH3CO3 + CH3O2 -> 0.9*CH3O2 + 1*CH2O + 0.9*HO2 + 0.9*CO2 + 0.1*CH3COOH
    LU(i,351) = LU(i,351) - 0.09999999999999998*rate_constant(i,99) * number_density(i,191)

    !  k_CH3CO3_XO2_1: CH3CO3 + XO2 -> 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 1*CH3O2 + 1*HO2 + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD + 1*CO2
    LU(i,351) = LU(i,351) + rate_constant(i,106) * number_density(i,153)

    !  k_CH3CO3_MACRO2_1: CH3CO3 + MACRO2 -> 0.25*CH3COCHO + 1*CH3O2 + 0.22*CO + 0.47*HO2 + 0.53*GLYALD + 0.22*HYAC + 0.25*CH2O + 0.53*CH3CO3
    LU(i,351) = LU(i,351) + rate_constant(i,235) * number_density(i,188)
  end do
  !$acc end parallel

end subroutine dforce_dy14

subroutine dforce_dy15(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    !  k_CH3CO3_HO2_1: CH3CO3 + HO2 -> 0.4*CH3COOOH + 0.15*CH3COOH + 0.15*O3 + 0.45*OH + 0.45*CH3O2
    LU(i,351) = LU(i,351) + 0.45*rate_constant(i,259) * number_density(i,192)

    !  k_CH3CO3_ISOPBO2_1: CH3CO3 + ISOPBO2 -> 1*HYDRALD + 1*CH3O2 + 1*HO2
    LU(i,351) = LU(i,351) + rate_constant(i,340) * number_density(i,190)

    !  k_CH3CO3_ISOPNO3_1: CH3CO3 + ISOPNO3 -> 1*NC4CHO + 1*CH3O2 + 1*HO2
    LU(i,351) = LU(i,351) + rate_constant(i,413) * number_density(i,46)

    ! df_CH2O/d(CH3CO3)
    !  k_CH3CO3_ISOPAO2_1: CH3CO3 + ISOPAO2 -> 1*CH3O2 + 1*HO2 + 1*CH2O + 0.39*MACR + 0.61*MVK + 1*CO2
    LU(i,331) = LU(i,331) + rate_constant(i,65) * number_density(i,189)

    !  k_CH3CO3_MCO3_1: CH3CO3 + MCO3 -> 2*CO2 + 1*CH3O2 + 1*CH2O + 1*CH3CO3
    LU(i,331) = LU(i,331) + rate_constant(i,81) * number_density(i,167)

    !  k_CH3CO3_CH3O2_1: CH3CO3 + CH3O2 -> 0.9*CH3O2 + 1*CH2O + 0.9*HO2 + 0.9*CO2 + 0.1*CH3COOH
    LU(i,331) = LU(i,331) + rate_constant(i,99) * number_density(i,191)

    !  k_CH3CO3_XO2_1: CH3CO3 + XO2 -> 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 1*CH3O2 + 1*HO2 + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD + 1*CO2
    LU(i,331) = LU(i,331) + 0.25*rate_constant(i,106) * number_density(i,153)

    !  k_CH3CO3_MACRO2_1: CH3CO3 + MACRO2 -> 0.25*CH3COCHO + 1*CH3O2 + 0.22*CO + 0.47*HO2 + 0.53*GLYALD + 0.22*HYAC + 0.25*CH2O + 0.53*CH3CO3
    LU(i,331) = LU(i,331) + 0.25*rate_constant(i,235) * number_density(i,188)

    ! df_MACRO2/d(CH3CO3)
    !  k_CH3CO3_MACRO2_1: CH3CO3 + MACRO2 -> 0.25*CH3COCHO + 1*CH3O2 + 0.22*CO + 0.47*HO2 + 0.53*GLYALD + 0.22*HYAC + 0.25*CH2O + 0.53*CH3CO3
    LU(i,348) = LU(i,348) - rate_constant(i,235) * number_density(i,188)

    ! df_ISOPAO2/d(CH3CO3)
    !  k_CH3CO3_ISOPAO2_1: CH3CO3 + ISOPAO2 -> 1*CH3O2 + 1*HO2 + 1*CH2O + 0.39*MACR + 0.61*MVK + 1*CO2
    LU(i,349) = LU(i,349) - rate_constant(i,65) * number_density(i,189)

    ! df_ISOPBO2/d(CH3CO3)
    !  k_CH3CO3_ISOPBO2_1: CH3CO3 + ISOPBO2 -> 1*HYDRALD + 1*CH3O2 + 1*HO2
    LU(i,350) = LU(i,350) - rate_constant(i,340) * number_density(i,190)

    ! df_MCO3/d(CH3CO3)
    !  k_CH3CO3_MCO3_1: CH3CO3 + MCO3 -> 2*CO2 + 1*CH3O2 + 1*CH2O + 1*CH3CO3
    LU(i,342) = LU(i,342) - rate_constant(i,81) * number_density(i,167)

    ! df_GLYOXAL/d(CH3CO3)
    !  k_CH3CO3_XO2_1: CH3CO3 + XO2 -> 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 1*CH3O2 + 1*HO2 + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD + 1*CO2
    LU(i,332) = LU(i,332) + 0.25*rate_constant(i,106) * number_density(i,153)

    ! df_GLYALD/d(CH3CO3)
    !  k_CH3CO3_XO2_1: CH3CO3 + XO2 -> 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 1*CH3O2 + 1*HO2 + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD + 1*CO2
    LU(i,336) = LU(i,336) + 0.25*rate_constant(i,106) * number_density(i,153)

    !  k_CH3CO3_MACRO2_1: CH3CO3 + MACRO2 -> 0.25*CH3COCHO + 1*CH3O2 + 0.22*CO + 0.47*HO2 + 0.53*GLYALD + 0.22*HYAC + 0.25*CH2O + 0.53*CH3CO3
    LU(i,336) = LU(i,336) + 0.53*rate_constant(i,235) * number_density(i,188)

    ! df_HO2/d(CH3CO3)
    !  k_CH3CO3_ISOPAO2_1: CH3CO3 + ISOPAO2 -> 1*CH3O2 + 1*HO2 + 1*CH2O + 0.39*MACR + 0.61*MVK + 1*CO2
    LU(i,352) = LU(i,352) + rate_constant(i,65) * number_density(i,189)

    !  k_CH3CO3_CH3O2_1: CH3CO3 + CH3O2 -> 0.9*CH3O2 + 1*CH2O + 0.9*HO2 + 0.9*CO2 + 0.1*CH3COOH
    LU(i,352) = LU(i,352) + 0.9*rate_constant(i,99) * number_density(i,191)

    !  k_CH3CO3_XO2_1: CH3CO3 + XO2 -> 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 1*CH3O2 + 1*HO2 + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD + 1*CO2
    LU(i,352) = LU(i,352) + rate_constant(i,106) * number_density(i,153)

    !  k_CH3CO3_MACRO2_1: CH3CO3 + MACRO2 -> 0.25*CH3COCHO + 1*CH3O2 + 0.22*CO + 0.47*HO2 + 0.53*GLYALD + 0.22*HYAC + 0.25*CH2O + 0.53*CH3CO3
    LU(i,352) = LU(i,352) + 0.47*rate_constant(i,235) * number_density(i,188)

    !  k_CH3CO3_HO2_1: CH3CO3 + HO2 -> 0.4*CH3COOOH + 0.15*CH3COOH + 0.15*O3 + 0.45*OH + 0.45*CH3O2
    LU(i,352) = LU(i,352) - rate_constant(i,259) * number_density(i,192)

    !  k_CH3CO3_ISOPBO2_1: CH3CO3 + ISOPBO2 -> 1*HYDRALD + 1*CH3O2 + 1*HO2
    LU(i,352) = LU(i,352) + rate_constant(i,340) * number_density(i,190)

    !  k_CH3CO3_ISOPNO3_1: CH3CO3 + ISOPNO3 -> 1*NC4CHO + 1*CH3O2 + 1*HO2
    LU(i,352) = LU(i,352) + rate_constant(i,413) * number_density(i,46)

    ! df_HYDRALD/d(CH3CO3)
    !  k_CH3CO3_ISOPBO2_1: CH3CO3 + ISOPBO2 -> 1*HYDRALD + 1*CH3O2 + 1*HO2
    LU(i,334) = LU(i,334) + rate_constant(i,340) * number_density(i,190)

    ! df_XO2/d(CH3CO3)
    !  k_CH3CO3_XO2_1: CH3CO3 + XO2 -> 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 1*CH3O2 + 1*HO2 + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD + 1*CO2
    LU(i,335) = LU(i,335) - rate_constant(i,106) * number_density(i,153)

    ! df_MACR/d(CH3CO3)
    !  k_CH3CO3_ISOPAO2_1: CH3CO3 + ISOPAO2 -> 1*CH3O2 + 1*HO2 + 1*CH2O + 0.39*MACR + 0.61*MVK + 1*CO2
    LU(i,337) = LU(i,337) + 0.39*rate_constant(i,65) * number_density(i,189)

    ! df_OH/d(CH3CO3)
    !  k_CH3CO3_HO2_1: CH3CO3 + HO2 -> 0.4*CH3COOOH + 0.15*CH3COOH + 0.15*O3 + 0.45*OH + 0.45*CH3O2
    LU(i,341) = LU(i,341) + 0.45*rate_constant(i,259) * number_density(i,192)

    ! df_O3/d(CH3CO3)
    !  k_CH3CO3_HO2_1: CH3CO3 + HO2 -> 0.4*CH3COOOH + 0.15*CH3COOH + 0.15*O3 + 0.45*OH + 0.45*CH3O2
    LU(i,343) = LU(i,343) + 0.15*rate_constant(i,259) * number_density(i,192)

    ! df_CO/d(CH3CO3)
    !  k_CH3CO3_XO2_1: CH3CO3 + XO2 -> 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 1*CH3O2 + 1*HO2 + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD + 1*CO2
    LU(i,344) = LU(i,344) + 0.25*rate_constant(i,106) * number_density(i,153)

    !  k_CH3CO3_MACRO2_1: CH3CO3 + MACRO2 -> 0.25*CH3COCHO + 1*CH3O2 + 0.22*CO + 0.47*HO2 + 0.53*GLYALD + 0.22*HYAC + 0.25*CH2O + 0.53*CH3CO3
    LU(i,344) = LU(i,344) + 0.22*rate_constant(i,235) * number_density(i,188)
  end do
  !$acc end parallel

end subroutine dforce_dy15

subroutine dforce_dy16(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! df_CH3COOH/d(CH3CO3)
    !  k_CH3CO3_CH3O2_1: CH3CO3 + CH3O2 -> 0.9*CH3O2 + 1*CH2O + 0.9*HO2 + 0.9*CO2 + 0.1*CH3COOH
    LU(i,345) = LU(i,345) + 0.1*rate_constant(i,99) * number_density(i,191)

    !  k_CH3CO3_HO2_1: CH3CO3 + HO2 -> 0.4*CH3COOOH + 0.15*CH3COOH + 0.15*O3 + 0.45*OH + 0.45*CH3O2
    LU(i,345) = LU(i,345) + 0.15*rate_constant(i,259) * number_density(i,192)

    ! df_NC4CHO/d(CH3CO3)
    !  k_CH3CO3_ISOPNO3_1: CH3CO3 + ISOPNO3 -> 1*NC4CHO + 1*CH3O2 + 1*HO2
    LU(i,318) = LU(i,318) + rate_constant(i,413) * number_density(i,46)

    ! df_C6H5OOH/d(C6H5O2)
    !  k_C6H5O2_HO2_1: C6H5O2 + HO2 -> 1*C6H5OOH
    LU(i,1067) = LU(i,1067) + rate_constant(i,179) * number_density(i,192)

    ! df_C6H5O2/d(C6H5O2)
    !  k_C6H5O2_NO_1: C6H5O2 + NO -> 1*PHENO + 1*NO2
    LU(i,1075) = LU(i,1075) - rate_constant(i,175) * number_density(i,137)

    !  k_C6H5O2_HO2_1: C6H5O2 + HO2 -> 1*C6H5OOH
    LU(i,1075) = LU(i,1075) - rate_constant(i,179) * number_density(i,192)

    ! df_NO2/d(C6H5O2)
    !  k_C6H5O2_NO_1: C6H5O2 + NO -> 1*PHENO + 1*NO2
    LU(i,1068) = LU(i,1068) + rate_constant(i,175) * number_density(i,137)

    ! df_NO/d(C6H5O2)
    !  k_C6H5O2_NO_1: C6H5O2 + NO -> 1*PHENO + 1*NO2
    LU(i,1089) = LU(i,1089) - rate_constant(i,175) * number_density(i,137)

    ! df_PHENO/d(C6H5O2)
    !  k_C6H5O2_NO_1: C6H5O2 + NO -> 1*PHENO + 1*NO2
    LU(i,1113) = LU(i,1113) + rate_constant(i,175) * number_density(i,137)

    ! df_HO2/d(C6H5O2)
    !  k_C6H5O2_HO2_1: C6H5O2 + HO2 -> 1*C6H5OOH
    LU(i,1123) = LU(i,1123) - rate_constant(i,179) * number_density(i,192)

    ! df_H/d(CH4)
    !  k_CH4_1: CH4 -> 1.44*H2 + 0.18*CH2O + 0.18*O + 0.33*OH + 0.33*H + 0.44*CO2 + 0.38*CO + 0.05*H2O
    LU(i,263) = LU(i,263) + 0.33*rate_constant(i,37)

    !  k_CH4_2: CH4 -> 1*H + 1*CH3O2
    LU(i,263) = LU(i,263) + rate_constant(i,183)

    !  k_CH4_O1D_2: CH4 + O1D -> 1*CH2O + 1*H + 1*HO2
    LU(i,263) = LU(i,263) + rate_constant(i,283) * number_density(i,112)

    ! df_CH4/d(CH4)
    !  k_CH4_CL_1: CH4 + CL -> 1*CH3O2 + 1*HCL
    LU(i,262) = LU(i,262) - rate_constant(i,23) * number_density(i,100)

    !  k_CH4_1: CH4 -> 1.44*H2 + 0.18*CH2O + 0.18*O + 0.33*OH + 0.33*H + 0.44*CO2 + 0.38*CO + 0.05*H2O
    LU(i,262) = LU(i,262) - rate_constant(i,37)

    !  k_CH4_O1D_1: CH4 + O1D -> 1*CH2O + 1*H2
    LU(i,262) = LU(i,262) - rate_constant(i,141) * number_density(i,112)

    !  k_CH4_2: CH4 -> 1*H + 1*CH3O2
    LU(i,262) = LU(i,262) - rate_constant(i,183)

    !  k_CH4_O1D_2: CH4 + O1D -> 1*CH2O + 1*H + 1*HO2
    LU(i,262) = LU(i,262) - rate_constant(i,283) * number_density(i,112)

    !  k_CH4_OH_1: CH4 + OH -> 1*CH3O2 + 1*H2O
    LU(i,262) = LU(i,262) - rate_constant(i,284) * number_density(i,166)

    !  k_CH4_O1D_3: CH4 + O1D -> 1*CH3O2 + 1*OH
    LU(i,262) = LU(i,262) - rate_constant(i,386) * number_density(i,112)

    ! df_H2O/d(CH4)
    !  k_CH4_1: CH4 -> 1.44*H2 + 0.18*CH2O + 0.18*O + 0.33*OH + 0.33*H + 0.44*CO2 + 0.38*CO + 0.05*H2O
    LU(i,264) = LU(i,264) + 0.05*rate_constant(i,37)

    !  k_CH4_OH_1: CH4 + OH -> 1*CH3O2 + 1*H2O
    LU(i,264) = LU(i,264) + rate_constant(i,284) * number_density(i,166)

    ! df_CL/d(CH4)
    !  k_CH4_CL_1: CH4 + CL -> 1*CH3O2 + 1*HCL
    LU(i,266) = LU(i,266) - rate_constant(i,23) * number_density(i,100)

    ! df_CO2/d(CH4)
    !  k_CH4_1: CH4 -> 1.44*H2 + 0.18*CH2O + 0.18*O + 0.33*OH + 0.33*H + 0.44*CO2 + 0.38*CO + 0.05*H2O
    LU(i,265) = LU(i,265) + 0.44*rate_constant(i,37)

    ! df_O/d(CH4)
    !  k_CH4_1: CH4 -> 1.44*H2 + 0.18*CH2O + 0.18*O + 0.33*OH + 0.33*H + 0.44*CO2 + 0.38*CO + 0.05*H2O
    LU(i,273) = LU(i,273) + 0.18*rate_constant(i,37)

    ! df_O1D/d(CH4)
    !  k_CH4_O1D_1: CH4 + O1D -> 1*CH2O + 1*H2
    LU(i,267) = LU(i,267) - rate_constant(i,141) * number_density(i,112)

    !  k_CH4_O1D_2: CH4 + O1D -> 1*CH2O + 1*H + 1*HO2
    LU(i,267) = LU(i,267) - rate_constant(i,283) * number_density(i,112)

    !  k_CH4_O1D_3: CH4 + O1D -> 1*CH3O2 + 1*OH
    LU(i,267) = LU(i,267) - rate_constant(i,386) * number_density(i,112)

    ! df_HCL/d(CH4)
    !  k_CH4_CL_1: CH4 + CL -> 1*CH3O2 + 1*HCL
    LU(i,272) = LU(i,272) + rate_constant(i,23) * number_density(i,100)
  end do
  !$acc end parallel

end subroutine dforce_dy16

subroutine dforce_dy17(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! df_CH3O2/d(CH4)
    !  k_CH4_CL_1: CH4 + CL -> 1*CH3O2 + 1*HCL
    LU(i,274) = LU(i,274) + rate_constant(i,23) * number_density(i,100)

    !  k_CH4_2: CH4 -> 1*H + 1*CH3O2
    LU(i,274) = LU(i,274) + rate_constant(i,183)

    !  k_CH4_OH_1: CH4 + OH -> 1*CH3O2 + 1*H2O
    LU(i,274) = LU(i,274) + rate_constant(i,284) * number_density(i,166)

    !  k_CH4_O1D_3: CH4 + O1D -> 1*CH3O2 + 1*OH
    LU(i,274) = LU(i,274) + rate_constant(i,386) * number_density(i,112)

    ! df_CH2O/d(CH4)
    !  k_CH4_1: CH4 -> 1.44*H2 + 0.18*CH2O + 0.18*O + 0.33*OH + 0.33*H + 0.44*CO2 + 0.38*CO + 0.05*H2O
    LU(i,268) = LU(i,268) + 0.18*rate_constant(i,37)

    !  k_CH4_O1D_1: CH4 + O1D -> 1*CH2O + 1*H2
    LU(i,268) = LU(i,268) + rate_constant(i,141) * number_density(i,112)

    !  k_CH4_O1D_2: CH4 + O1D -> 1*CH2O + 1*H + 1*HO2
    LU(i,268) = LU(i,268) + rate_constant(i,283) * number_density(i,112)

    ! df_HO2/d(CH4)
    !  k_CH4_O1D_2: CH4 + O1D -> 1*CH2O + 1*H + 1*HO2
    LU(i,275) = LU(i,275) + rate_constant(i,283) * number_density(i,112)

    ! df_H2/d(CH4)
    !  k_CH4_1: CH4 -> 1.44*H2 + 0.18*CH2O + 0.18*O + 0.33*OH + 0.33*H + 0.44*CO2 + 0.38*CO + 0.05*H2O
    LU(i,269) = LU(i,269) + 1.44*rate_constant(i,37)

    !  k_CH4_O1D_1: CH4 + O1D -> 1*CH2O + 1*H2
    LU(i,269) = LU(i,269) + rate_constant(i,141) * number_density(i,112)

    ! df_OH/d(CH4)
    !  k_CH4_1: CH4 -> 1.44*H2 + 0.18*CH2O + 0.18*O + 0.33*OH + 0.33*H + 0.44*CO2 + 0.38*CO + 0.05*H2O
    LU(i,270) = LU(i,270) + 0.33*rate_constant(i,37)

    !  k_CH4_OH_1: CH4 + OH -> 1*CH3O2 + 1*H2O
    LU(i,270) = LU(i,270) - rate_constant(i,284) * number_density(i,166)

    !  k_CH4_O1D_3: CH4 + O1D -> 1*CH3O2 + 1*OH
    LU(i,270) = LU(i,270) + rate_constant(i,386) * number_density(i,112)

    ! df_CO/d(CH4)
    !  k_CH4_1: CH4 -> 1.44*H2 + 0.18*CH2O + 0.18*O + 0.33*OH + 0.33*H + 0.44*CO2 + 0.38*CO + 0.05*H2O
    LU(i,271) = LU(i,271) + 0.38*rate_constant(i,37)

    ! df_CH3CL/d(CH3CL)
    !  k_CH3CL_OH_1: CH3CL + OH -> 1*CL + 1*H2O + 1*HO2
    LU(i,364) = LU(i,364) - rate_constant(i,92) * number_density(i,166)

    !  k_CH3CL_CL_1: CH3CL + CL -> 1*HO2 + 1*CO + 2*HCL
    LU(i,364) = LU(i,364) - rate_constant(i,102) * number_density(i,100)

    !  k_CH3CL_1: CH3CL -> 1*CL + 1*CH3O2
    LU(i,364) = LU(i,364) - rate_constant(i,320)

    ! df_H2O/d(CH3CL)
    !  k_CH3CL_OH_1: CH3CL + OH -> 1*CL + 1*H2O + 1*HO2
    LU(i,365) = LU(i,365) + rate_constant(i,92) * number_density(i,166)

    ! df_CL/d(CH3CL)
    !  k_CH3CL_OH_1: CH3CL + OH -> 1*CL + 1*H2O + 1*HO2
    LU(i,366) = LU(i,366) + rate_constant(i,92) * number_density(i,166)

    !  k_CH3CL_CL_1: CH3CL + CL -> 1*HO2 + 1*CO + 2*HCL
    LU(i,366) = LU(i,366) - rate_constant(i,102) * number_density(i,100)

    !  k_CH3CL_1: CH3CL -> 1*CL + 1*CH3O2
    LU(i,366) = LU(i,366) + rate_constant(i,320)

    ! df_HCL/d(CH3CL)
    !  k_CH3CL_CL_1: CH3CL + CL -> 1*HO2 + 1*CO + 2*HCL
    LU(i,369) = LU(i,369) + 2*rate_constant(i,102) * number_density(i,100)

    ! df_CH3O2/d(CH3CL)
    !  k_CH3CL_1: CH3CL -> 1*CL + 1*CH3O2
    LU(i,370) = LU(i,370) + rate_constant(i,320)

    ! df_HO2/d(CH3CL)
    !  k_CH3CL_OH_1: CH3CL + OH -> 1*CL + 1*H2O + 1*HO2
    LU(i,371) = LU(i,371) + rate_constant(i,92) * number_density(i,166)

    !  k_CH3CL_CL_1: CH3CL + CL -> 1*HO2 + 1*CO + 2*HCL
    LU(i,371) = LU(i,371) + rate_constant(i,102) * number_density(i,100)

    ! df_OH/d(CH3CL)
    !  k_CH3CL_OH_1: CH3CL + OH -> 1*CL + 1*H2O + 1*HO2
    LU(i,367) = LU(i,367) - rate_constant(i,92) * number_density(i,166)

    ! df_CO/d(CH3CL)
    !  k_CH3CL_CL_1: CH3CL + CL -> 1*HO2 + 1*CO + 2*HCL
    LU(i,368) = LU(i,368) + rate_constant(i,102) * number_density(i,100)

    ! df_TERPROD1/d(TERPROD1)
    !  k_OH_TERPROD1_1: OH + TERPROD1 -> 1*TERP2O2
    LU(i,548) = LU(i,548) - rate_constant(i,151) * number_density(i,166)

    !  k_TERPROD1_1: TERPROD1 -> 1*HO2 + 1*CO + 1*TERPROD2
    LU(i,548) = LU(i,548) - rate_constant(i,286)
  end do
  !$acc end parallel

end subroutine dforce_dy17

subroutine dforce_dy18(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    !  k_NO3_TERPROD1_1: NO3 + TERPROD1 -> 0.5*TERP2O2 + 0.5*NTERPO2
    LU(i,548) = LU(i,548) - rate_constant(i,309) * number_density(i,165)

    ! df_HO2/d(TERPROD1)
    !  k_TERPROD1_1: TERPROD1 -> 1*HO2 + 1*CO + 1*TERPROD2
    LU(i,555) = LU(i,555) + rate_constant(i,286)

    ! df_NTERPO2/d(TERPROD1)
    !  k_NO3_TERPROD1_1: NO3 + TERPROD1 -> 0.5*TERP2O2 + 0.5*NTERPO2
    LU(i,549) = LU(i,549) + 0.5*rate_constant(i,309) * number_density(i,165)

    ! df_TERP2O2/d(TERPROD1)
    !  k_OH_TERPROD1_1: OH + TERPROD1 -> 1*TERP2O2
    LU(i,550) = LU(i,550) + rate_constant(i,151) * number_density(i,166)

    !  k_NO3_TERPROD1_1: NO3 + TERPROD1 -> 0.5*TERP2O2 + 0.5*NTERPO2
    LU(i,550) = LU(i,550) + 0.5*rate_constant(i,309) * number_density(i,165)

    ! df_TERPROD2/d(TERPROD1)
    !  k_TERPROD1_1: TERPROD1 -> 1*HO2 + 1*CO + 1*TERPROD2
    LU(i,551) = LU(i,551) + rate_constant(i,286)

    ! df_NO3/d(TERPROD1)
    !  k_NO3_TERPROD1_1: NO3 + TERPROD1 -> 0.5*TERP2O2 + 0.5*NTERPO2
    LU(i,552) = LU(i,552) - rate_constant(i,309) * number_density(i,165)

    ! df_OH/d(TERPROD1)
    !  k_OH_TERPROD1_1: OH + TERPROD1 -> 1*TERP2O2
    LU(i,553) = LU(i,553) - rate_constant(i,151) * number_density(i,166)

    ! df_CO/d(TERPROD1)
    !  k_TERPROD1_1: TERPROD1 -> 1*HO2 + 1*CO + 1*TERPROD2
    LU(i,554) = LU(i,554) + rate_constant(i,286)

    ! df_CH3CO3/d(HYAC)
    !  k_HYAC_1: HYAC -> 1*CH3CO3 + 1*HO2 + 1*CH2O
    LU(i,495) = LU(i,495) + rate_constant(i,215)

    ! df_HYAC/d(HYAC)
    !  k_HYAC_1: HYAC -> 1*CH3CO3 + 1*HO2 + 1*CH2O
    LU(i,498) = LU(i,498) - rate_constant(i,215)

    !  k_HYAC_OH_1: HYAC + OH -> 1*CH3COCHO + 1*HO2
    LU(i,498) = LU(i,498) - rate_constant(i,422) * number_density(i,166)

    ! df_CH3COCHO/d(HYAC)
    !  k_HYAC_OH_1: HYAC + OH -> 1*CH3COCHO + 1*HO2
    LU(i,509) = LU(i,509) + rate_constant(i,422) * number_density(i,166)

    ! df_CH2O/d(HYAC)
    !  k_HYAC_1: HYAC -> 1*CH3CO3 + 1*HO2 + 1*CH2O
    LU(i,514) = LU(i,514) + rate_constant(i,215)

    ! df_HO2/d(HYAC)
    !  k_HYAC_1: HYAC -> 1*CH3CO3 + 1*HO2 + 1*CH2O
    LU(i,547) = LU(i,547) + rate_constant(i,215)

    !  k_HYAC_OH_1: HYAC + OH -> 1*CH3COCHO + 1*HO2
    LU(i,547) = LU(i,547) + rate_constant(i,422) * number_density(i,166)

    ! df_OH/d(HYAC)
    !  k_HYAC_OH_1: HYAC + OH -> 1*CH3COCHO + 1*HO2
    LU(i,530) = LU(i,530) - rate_constant(i,422) * number_density(i,166)

    ! df_HPALD/d(HPALD)
    !  k_HPALD_1: HPALD -> 1*BIGALD3 + 1*OH + 1*HO2
    LU(i,592) = LU(i,592) - rate_constant(i,430)

    !  k_HPALD_OH_1: HPALD + OH -> 1*XO2
    LU(i,592) = LU(i,592) - rate_constant(i,444) * number_density(i,166)

    ! df_BIGALD3/d(HPALD)
    !  k_HPALD_1: HPALD -> 1*BIGALD3 + 1*OH + 1*HO2
    LU(i,593) = LU(i,593) + rate_constant(i,430)

    ! df_HO2/d(HPALD)
    !  k_HPALD_1: HPALD -> 1*BIGALD3 + 1*OH + 1*HO2
    LU(i,596) = LU(i,596) + rate_constant(i,430)

    ! df_XO2/d(HPALD)
    !  k_HPALD_OH_1: HPALD + OH -> 1*XO2
    LU(i,594) = LU(i,594) + rate_constant(i,444) * number_density(i,166)

    ! df_OH/d(HPALD)
    !  k_HPALD_1: HPALD -> 1*BIGALD3 + 1*OH + 1*HO2
    LU(i,595) = LU(i,595) + rate_constant(i,430)

    !  k_HPALD_OH_1: HPALD + OH -> 1*XO2
    LU(i,595) = LU(i,595) - rate_constant(i,444) * number_density(i,166)

    ! df_O2/d(H2O)
    !  k_H2O_HO2_HO2_1: H2O + HO2 + HO2 -> 1*H2O2 + 1*O2 + 1*H2O
    LU(i,599) = LU(i,599) + rate_constant(i,211) * number_density(i,192) * number_density(i,192)

    !  k_H2O_HO2_HO2_M_1: H2O + HO2 + HO2 + M -> 1*H2O2 + 1*O2 + 1*M + 1*H2O
    LU(i,599) = LU(i,599) + rate_constant(i,212) * number_density(i,192) * number_density(i,192) * number_density(i,1)

    ! df_SO3/d(H2O)
    !  k_H2O_SO3_1: H2O + SO3 -> 1*H2SO4 + 1*H2O
    LU(i,598) = LU(i,598) - rate_constant(i,325) * number_density(i,28)
  end do
  !$acc end parallel

end subroutine dforce_dy18

subroutine dforce_dy19(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! df_H/d(H2O)
    !  k_H2O_1: H2O -> 2*H + 1*O
    LU(i,600) = LU(i,600) + 2*rate_constant(i,77)

    !  k_H2O_3: H2O -> 1*OH + 1*H
    LU(i,600) = LU(i,600) + rate_constant(i,192)

    ! df_H2O/d(H2O)
    !  k_H2O_O1D_1: H2O + O1D -> 2*OH
    LU(i,604) = LU(i,604) - rate_constant(i,39) * number_density(i,112)

    !  k_H2O_1: H2O -> 2*H + 1*O
    LU(i,604) = LU(i,604) - rate_constant(i,77)

    !  k_H2O_2: H2O -> 1*H2 + 1*O1D
    LU(i,604) = LU(i,604) - rate_constant(i,114)

    !  k_H2O_3: H2O -> 1*OH + 1*H
    LU(i,604) = LU(i,604) - rate_constant(i,192)

    ! df_O/d(H2O)
    !  k_H2O_1: H2O -> 2*H + 1*O
    LU(i,648) = LU(i,648) + rate_constant(i,77)

    ! df_O1D/d(H2O)
    !  k_H2O_O1D_1: H2O + O1D -> 2*OH
    LU(i,615) = LU(i,615) - rate_constant(i,39) * number_density(i,112)

    !  k_H2O_2: H2O -> 1*H2 + 1*O1D
    LU(i,615) = LU(i,615) + rate_constant(i,114)

    ! df_H2O2/d(H2O)
    !  k_H2O_HO2_HO2_1: H2O + HO2 + HO2 -> 1*H2O2 + 1*O2 + 1*H2O
    LU(i,642) = LU(i,642) + rate_constant(i,211) * number_density(i,192) * number_density(i,192)

    !  k_H2O_HO2_HO2_M_1: H2O + HO2 + HO2 + M -> 1*H2O2 + 1*O2 + 1*M + 1*H2O
    LU(i,642) = LU(i,642) + rate_constant(i,212) * number_density(i,192) * number_density(i,192) * number_density(i,1)

    ! df_HO2/d(H2O)
    !  k_H2O_HO2_HO2_1: H2O + HO2 + HO2 -> 1*H2O2 + 1*O2 + 1*H2O
    LU(i,653) = LU(i,653) - rate_constant(i,211) * number_density(i,192) * number_density(i,192)

    !  k_H2O_HO2_HO2_1: H2O + HO2 + HO2 -> 1*H2O2 + 1*O2 + 1*H2O
    LU(i,653) = LU(i,653) - rate_constant(i,211) * number_density(i,192) * number_density(i,192)

    !  k_H2O_HO2_HO2_M_1: H2O + HO2 + HO2 + M -> 1*H2O2 + 1*O2 + 1*M + 1*H2O
    LU(i,653) = LU(i,653) - rate_constant(i,212) * number_density(i,192) * number_density(i,192) * number_density(i,1)

    !  k_H2O_HO2_HO2_M_1: H2O + HO2 + HO2 + M -> 1*H2O2 + 1*O2 + 1*M + 1*H2O
    LU(i,653) = LU(i,653) - rate_constant(i,212) * number_density(i,192) * number_density(i,192) * number_density(i,1)

    ! df_H2/d(H2O)
    !  k_H2O_2: H2O -> 1*H2 + 1*O1D
    LU(i,624) = LU(i,624) + rate_constant(i,114)

    ! df_H2SO4/d(H2O)
    !  k_H2O_SO3_1: H2O + SO3 -> 1*H2SO4 + 1*H2O
    LU(i,597) = LU(i,597) + rate_constant(i,325) * number_density(i,28)

    ! df_OH/d(H2O)
    !  k_H2O_O1D_1: H2O + O1D -> 2*OH
    LU(i,635) = LU(i,635) + 2*rate_constant(i,39) * number_density(i,112)

    !  k_H2O_3: H2O -> 1*OH + 1*H
    LU(i,635) = LU(i,635) + rate_constant(i,192)

    ! df_O2/d(NO2)
    !  k_N_NO2_1: N + NO2 -> 1*N2 + 1*O2
    LU(i,377) = LU(i,377) + rate_constant(i,8) * number_density(i,185)

    !  k_NO2_O3_1: NO2 + O3 -> 1*NO3 + 1*O2
    LU(i,377) = LU(i,377) + rate_constant(i,165) * number_density(i,171)

    !  k_NO2_O_1: NO2 + O -> 1*NO + 1*O2
    LU(i,377) = LU(i,377) + rate_constant(i,351) * number_density(i,187)

    ! df_N2/d(NO2)
    !  k_N_NO2_1: N + NO2 -> 1*N2 + 1*O2
    LU(i,372) = LU(i,372) + rate_constant(i,8) * number_density(i,185)

    ! df_PAN/d(NO2)
    !  k_CH3CO3_NO2_1: CH3CO3 + NO2 -> 1*PAN
    LU(i,373) = LU(i,373) + rate_constant(i,383) * number_density(i,49)

    ! df_SO/d(NO2)
    !  k_NO2_SO_1: NO2 + SO -> 1*SO2 + 1*NO
    LU(i,374) = LU(i,374) - rate_constant(i,260) * number_density(i,32)

    ! df_N2O5/d(NO2)
    !  k_NO2_NO3_1: NO2 + NO3 -> 1*N2O5
    LU(i,382) = LU(i,382) + rate_constant(i,481) * number_density(i,165)

    ! df_HNO3/d(NO2)
    !  k_NO2_OH_1: NO2 + OH -> 1*HNO3
    LU(i,378) = LU(i,378) + rate_constant(i,207) * number_density(i,166)

    ! df_ACBZO2/d(NO2)
    !  k_ACBZO2_NO2_1: ACBZO2 + NO2 -> 1*PBZNIT
    LU(i,379) = LU(i,379) - rate_constant(i,388) * number_density(i,43)

  end do
  !$acc end parallel

end subroutine dforce_dy19

