    !  k_NTERPOOH_1: NTERPOOH -> 1*TERPROD1 + 1*NO2 + 1*OH
    LU(i,2738) = LU(i,2738) + rate_constant(i,143)

    !  k_NTERPOOH_OH_1: NTERPOOH + OH -> 1*NTERPO2
    LU(i,2738) = LU(i,2738) - rate_constant(i,328) * number_density(i,166)

    ! df_CFC113/d(CFC113)
    !  k_CFC113_O1D_1: CFC113 + O1D -> 3*CL
    LU(i,361) = LU(i,361) - rate_constant(i,13) * number_density(i,112)

    !  k_CFC113_1: CFC113 -> 3*CL
    LU(i,361) = LU(i,361) - rate_constant(i,384)

    ! df_CL/d(CFC113)
    !  k_CFC113_O1D_1: CFC113 + O1D -> 3*CL
    LU(i,362) = LU(i,362) + 3*rate_constant(i,13) * number_density(i,112)

    !  k_CFC113_1: CFC113 -> 3*CL
    LU(i,362) = LU(i,362) + 3*rate_constant(i,384)

    ! df_O1D/d(CFC113)
    !  k_CFC113_O1D_1: CFC113 + O1D -> 3*CL
    LU(i,363) = LU(i,363) - rate_constant(i,13) * number_density(i,112)

    ! df_H2O/d(CH2BR2)
    !  k_CH2BR2_OH_1: CH2BR2 + OH -> 2*BR + 1*H2O
    LU(i,6483) = LU(i,6483) + rate_constant(i,455) * number_density(i,166)

    ! df_CH2BR2/d(CH2BR2)
    !  k_CH2BR2_CL_1: CH2BR2 + CL -> 2*BR + 1*HCL
    LU(i,6530) = LU(i,6530) - rate_constant(i,27) * number_density(i,100)

    !  k_CH2BR2_O1D_1: CH2BR2 + O1D -> 2*BR
    LU(i,6530) = LU(i,6530) - rate_constant(i,120) * number_density(i,112)

    !  k_CH2BR2_1: CH2BR2 -> 2*BR
    LU(i,6530) = LU(i,6530) - rate_constant(i,131)

    !  k_CH2BR2_OH_1: CH2BR2 + OH -> 2*BR + 1*H2O
    LU(i,6530) = LU(i,6530) - rate_constant(i,455) * number_density(i,166)

    ! df_BR/d(CH2BR2)
    !  k_CH2BR2_CL_1: CH2BR2 + CL -> 2*BR + 1*HCL
    LU(i,6491) = LU(i,6491) + 2*rate_constant(i,27) * number_density(i,100)

    !  k_CH2BR2_O1D_1: CH2BR2 + O1D -> 2*BR
    LU(i,6491) = LU(i,6491) + 2*rate_constant(i,120) * number_density(i,112)

    !  k_CH2BR2_1: CH2BR2 -> 2*BR
    LU(i,6491) = LU(i,6491) + 2*rate_constant(i,131)

    !  k_CH2BR2_OH_1: CH2BR2 + OH -> 2*BR + 1*H2O
    LU(i,6491) = LU(i,6491) + 2*rate_constant(i,455) * number_density(i,166)

    ! df_CL/d(CH2BR2)
    !  k_CH2BR2_CL_1: CH2BR2 + CL -> 2*BR + 1*HCL
    LU(i,6492) = LU(i,6492) - rate_constant(i,27) * number_density(i,100)

    ! df_O1D/d(CH2BR2)
    !  k_CH2BR2_O1D_1: CH2BR2 + O1D -> 2*BR
    LU(i,6495) = LU(i,6495) - rate_constant(i,120) * number_density(i,112)

    ! df_HCL/d(CH2BR2)
    !  k_CH2BR2_CL_1: CH2BR2 + CL -> 2*BR + 1*HCL
    LU(i,6541) = LU(i,6541) + rate_constant(i,27) * number_density(i,100)

    ! df_OH/d(CH2BR2)
    !  k_CH2BR2_OH_1: CH2BR2 + OH -> 2*BR + 1*H2O
    LU(i,6527) = LU(i,6527) - rate_constant(i,455) * number_density(i,166)

    ! df_ALKNIT/d(NO)
    !  k_ALKO2_NO_2: ALKO2 + NO -> 1*ALKNIT
    LU(i,4002) = LU(i,4002) + rate_constant(i,194) * number_density(i,85)

    ! df_O2/d(NO)
    !  k_NO_O3_1: NO + O3 -> 1*NO2 + 1*O2
    LU(i,4013) = LU(i,4013) + rate_constant(i,439) * number_density(i,171)

    ! df_BENZO2/d(NO)
    !  k_BENZO2_NO_1: BENZO2 + NO -> 1*NO2 + 1*GLYOXAL + 0.5*BIGALD1 + 1*HO2
    LU(i,4004) = LU(i,4004) - rate_constant(i,59) * number_density(i,13)

    ! df_BZOO/d(NO)
    !  k_BZOO_NO_1: BZOO + NO -> 1*BZALD + 1*NO2 + 1*HO2
    LU(i,4008) = LU(i,4008) - rate_constant(i,195) * number_density(i,33)

    ! df_N2/d(NO)
    !  k_N_NO_1: N + NO -> 1*N2 + 1*O
    LU(i,4003) = LU(i,4003) + rate_constant(i,408) * number_density(i,185)
  end do
  !$acc end parallel

end subroutine dforce_dy22

subroutine dforce_dy23(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! df_HMPROPO2/d(NO)
    !  k_HMPROPO2_NO_1: HMPROPO2 + NO -> 1*NO2 + 1*CO2 + 1*HO2 + 1*CH3COCH3
    LU(i,4028) = LU(i,4028) - rate_constant(i,156) * number_density(i,77)

    ! df_MVK/d(NO)
    !  k_ISOPAO2_NO_1: ISOPAO2 + NO -> 0.08*ISOPNITA + 0.92*NO2 + 0.36*MACR + 0.56*MVK + 0.92*CH2O + 0.92*HO2
    LU(i,4006) = LU(i,4006) + 0.56*rate_constant(i,464) * number_density(i,189)

    ! df_ISOPNITB/d(NO)
    !  k_ISOPBO2_NO_1: ISOPBO2 + NO -> 0.87*HYDRALD + 0.08*ISOPNITB + 0.92*NO2 + 0.92*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    LU(i,4025) = LU(i,4025) + 0.08*rate_constant(i,96) * number_density(i,190)

    ! df_MEK/d(NO)
    !  k_ALKO2_NO_1: ALKO2 + NO -> 0.4*CH3CHO + 0.1*CH2O + 0.25*CH3COCH3 + 1*HO2 + 0.8*MEK + 1*NO2
    LU(i,4039) = LU(i,4039) + 0.8*rate_constant(i,71) * number_density(i,85)

    ! df_ISOPNO3/d(NO)
    !  k_ISOPNO3_NO_1: ISOPNO3 + NO -> 1*NC4CHO + 1*NO2 + 1*HO2
    LU(i,4015) = LU(i,4015) - rate_constant(i,302) * number_density(i,46)

    ! df_RO2/d(NO)
    !  k_NO_RO2_1: NO + RO2 -> 1*CH3CO3 + 1*CH2O + 1*NO2
    LU(i,4012) = LU(i,4012) - rate_constant(i,484) * number_density(i,40)

    ! df_PHENO2/d(NO)
    !  k_NO_PHENO2_1: NO + PHENO2 -> 1*HO2 + 0.7*GLYOXAL + 1*NO2
    LU(i,4010) = LU(i,4010) - rate_constant(i,257) * number_density(i,38)

    ! df_TERPNIT/d(NO)
    !  k_NO_NTERPO2_1: NO + NTERPO2 -> 0.2*TERPNIT + 1.6*NO2 + 0.8*TERPROD1
    LU(i,4011) = LU(i,4011) + 0.2*rate_constant(i,306) * number_density(i,143)

    !  k_NO_TERPO2_1: NO + TERPO2 -> 0.2*TERPNIT + 0.8*NO2 + 0.32*CH2O + 0.04*CH3COCH3 + 0.8*TERPROD1 + 0.8*HO2
    LU(i,4011) = LU(i,4011) + 0.2*rate_constant(i,392) * number_density(i,147)

    ! df_ACBZO2/d(NO)
    !  k_ACBZO2_NO_1: ACBZO2 + NO -> 1*C6H5O2 + 1*NO2
    LU(i,4014) = LU(i,4014) - rate_constant(i,263) * number_density(i,43)

    ! df_CH3CO3/d(NO)
    !  k_CH3CO3_NO_1: CH3CO3 + NO -> 1*CH3O2 + 1*CO2 + 1*NO2
    LU(i,4017) = LU(i,4017) - rate_constant(i,25) * number_density(i,49)

    !  k_MACRO2_NO_1: MACRO2 + NO -> 1*NO2 + 0.47*HO2 + 0.25*CH2O + 0.53*GLYALD + 0.25*CH3COCHO + 0.53*CH3CO3 + 0.22*HYAC + 0.22*CO
    LU(i,4017) = LU(i,4017) + 0.53*rate_constant(i,40) * number_density(i,188)

    !  k_MEKO2_NO_1: MEKO2 + NO -> 1*CH3CO3 + 1*CH3CHO + 1*NO2
    LU(i,4017) = LU(i,4017) + rate_constant(i,332) * number_density(i,128)

    !  k_MCO3_NO_1: MCO3 + NO -> 1*NO2 + 1*CH2O + 1*CH3CO3
    LU(i,4017) = LU(i,4017) + rate_constant(i,353) * number_density(i,167)

    !  k_NO_RO2_1: NO + RO2 -> 1*CH3CO3 + 1*CH2O + 1*NO2
    LU(i,4017) = LU(i,4017) + rate_constant(i,484) * number_density(i,40)

    ! df_C6H5O2/d(NO)
    !  k_C6H5O2_NO_1: C6H5O2 + NO -> 1*PHENO + 1*NO2
    LU(i,4029) = LU(i,4029) - rate_constant(i,175) * number_density(i,81)

    !  k_ACBZO2_NO_1: ACBZO2 + NO -> 1*C6H5O2 + 1*NO2
    LU(i,4029) = LU(i,4029) + rate_constant(i,263) * number_density(i,43)

    ! df_TERPROD1/d(NO)
    !  k_NO_NTERPO2_1: NO + NTERPO2 -> 0.2*TERPNIT + 1.6*NO2 + 0.8*TERPROD1
    LU(i,4021) = LU(i,4021) + 0.8*rate_constant(i,306) * number_density(i,143)

    !  k_NO_TERPO2_1: NO + TERPO2 -> 0.2*TERPNIT + 0.8*NO2 + 0.32*CH2O + 0.04*CH3COCH3 + 0.8*TERPROD1 + 0.8*HO2
    LU(i,4021) = LU(i,4021) + 0.8*rate_constant(i,392) * number_density(i,147)

    ! df_HYAC/d(NO)
    !  k_MACRO2_NO_1: MACRO2 + NO -> 1*NO2 + 0.47*HO2 + 0.25*CH2O + 0.53*GLYALD + 0.25*CH3COCHO + 0.53*CH3CO3 + 0.22*HYAC + 0.22*CO
    LU(i,4020) = LU(i,4020) + 0.22*rate_constant(i,40) * number_density(i,188)

    !  k_ISOPBO2_NO_1: ISOPBO2 + NO -> 0.87*HYDRALD + 0.08*ISOPNITB + 0.92*NO2 + 0.92*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    LU(i,4020) = LU(i,4020) + 0.05*rate_constant(i,96) * number_density(i,190)

    !  k_NO_XO2_1: NO + XO2 -> 1*NO2 + 1*HO2 + 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD
    LU(i,4020) = LU(i,4020) + 0.25*rate_constant(i,252) * number_density(i,153)

    ! df_NO2/d(NO)
    !  k_EO2_NO_1: EO2 + NO -> 0.5*CH2O + 0.25*HO2 + 0.75*EO + 1*NO2
    LU(i,4018) = LU(i,4018) + rate_constant(i,16) * number_density(i,163)

    !  k_CH3CO3_NO_1: CH3CO3 + NO -> 1*CH3O2 + 1*CO2 + 1*NO2
    LU(i,4018) = LU(i,4018) + rate_constant(i,25) * number_density(i,49)

    !  k_MACRO2_NO_1: MACRO2 + NO -> 1*NO2 + 0.47*HO2 + 0.25*CH2O + 0.53*GLYALD + 0.25*CH3COCHO + 0.53*CH3CO3 + 0.22*HYAC + 0.22*CO
    LU(i,4018) = LU(i,4018) + rate_constant(i,40) * number_density(i,188)

    !  k_NO_NO3_1: NO + NO3 -> 2*NO2
    LU(i,4018) = LU(i,4018) + 2*rate_constant(i,41) * number_density(i,165)

    !  k_BENZO2_NO_1: BENZO2 + NO -> 1*NO2 + 1*GLYOXAL + 0.5*BIGALD1 + 1*HO2
    LU(i,4018) = LU(i,4018) + rate_constant(i,59) * number_density(i,13)

    !  k_NO_TOLO2_1: NO + TOLO2 -> 1*NO2 + 0.6*GLYOXAL + 0.4*CH3COCHO + 1*HO2 + 0.2*BIGALD1 + 0.2*BIGALD2 + 0.2*BIGALD3
    LU(i,4018) = LU(i,4018) + rate_constant(i,60) * number_density(i,144)

    !  k_NO_O_1: NO + O -> 1*NO2
    LU(i,4018) = LU(i,4018) + rate_constant(i,62) * number_density(i,187)
  end do
  !$acc end parallel

end subroutine dforce_dy23

subroutine dforce_dy24(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    !  k_ALKO2_NO_1: ALKO2 + NO -> 0.4*CH3CHO + 0.1*CH2O + 0.25*CH3COCH3 + 1*HO2 + 0.8*MEK + 1*NO2
    LU(i,4018) = LU(i,4018) + rate_constant(i,71) * number_density(i,85)

    !  k_ISOPBO2_NO_1: ISOPBO2 + NO -> 0.87*HYDRALD + 0.08*ISOPNITB + 0.92*NO2 + 0.92*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    LU(i,4018) = LU(i,4018) + 0.92*rate_constant(i,96) * number_density(i,190)

    !  k_NO_TERP2O2_1: NO + TERP2O2 -> 0.1*ONITR + 0.9*NO2 + 0.34*CH2O + 0.27*CH3COCH3 + 0.225*CO + 0.9*CO2 + 0.9*TERPROD2 + 0.9*HO2 + 0.225*GLYALD
    LU(i,4018) = LU(i,4018) + 0.9*rate_constant(i,110) * number_density(i,145)

    !  k_HOCH2OO_NO_1: HOCH2OO + NO -> 1*HCOOH + 1*NO2 + 1*HO2
    LU(i,4018) = LU(i,4018) + rate_constant(i,113) * number_density(i,154)

    !  k_HMPROPO2_NO_1: HMPROPO2 + NO -> 1*NO2 + 1*CO2 + 1*HO2 + 1*CH3COCH3
    LU(i,4018) = LU(i,4018) + rate_constant(i,156) * number_density(i,77)

    !  k_C6H5O2_NO_1: C6H5O2 + NO -> 1*PHENO + 1*NO2
    LU(i,4018) = LU(i,4018) + rate_constant(i,175) * number_density(i,81)

    !  k_BZOO_NO_1: BZOO + NO -> 1*BZALD + 1*NO2 + 1*HO2
    LU(i,4018) = LU(i,4018) + rate_constant(i,195) * number_density(i,33)

    !  k_ENEO2_NO_1: ENEO2 + NO -> 1*CH3CHO + 0.5*CH2O + 0.5*CH3COCH3 + 1*HO2 + 1*NO2
    LU(i,4018) = LU(i,4018) + rate_constant(i,201) * number_density(i,133)

    !  k_CLO_NO_1: CLO + NO -> 1*NO2 + 1*CL
    LU(i,4018) = LU(i,4018) + rate_constant(i,203) * number_density(i,86)

    !  k_BRO_NO_1: BRO + NO -> 1*BR + 1*NO2
    LU(i,4018) = LU(i,4018) + rate_constant(i,206) * number_density(i,71)

    !  k_NO_XO2_1: NO + XO2 -> 1*NO2 + 1*HO2 + 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD
    LU(i,4018) = LU(i,4018) + rate_constant(i,252) * number_density(i,153)

    !  k_NO_PHENO2_1: NO + PHENO2 -> 1*HO2 + 0.7*GLYOXAL + 1*NO2
    LU(i,4018) = LU(i,4018) + rate_constant(i,257) * number_density(i,38)

    !  k_ACBZO2_NO_1: ACBZO2 + NO -> 1*C6H5O2 + 1*NO2
    LU(i,4018) = LU(i,4018) + rate_constant(i,263) * number_density(i,43)

    !  k_C2H5O2_NO_1: C2H5O2 + NO -> 1*CH3CHO + 1*HO2 + 1*NO2
    LU(i,4018) = LU(i,4018) + rate_constant(i,270) * number_density(i,87)

    !  k_ISOPNO3_NO_1: ISOPNO3 + NO -> 1*NC4CHO + 1*NO2 + 1*HO2
    LU(i,4018) = LU(i,4018) + rate_constant(i,302) * number_density(i,46)

    !  k_NO_NTERPO2_1: NO + NTERPO2 -> 0.2*TERPNIT + 1.6*NO2 + 0.8*TERPROD1
    LU(i,4018) = LU(i,4018) + 1.6*rate_constant(i,306) * number_density(i,143)

    !  k_MBOO2_NO_1: MBOO2 + NO -> 1*HO2 + 0.67*GLYALD + 0.67*CH3COCH3 + 0.33*HMPROP + 0.33*CH2O + 1*NO2
    LU(i,4018) = LU(i,4018) + rate_constant(i,308) * number_density(i,125)

    !  k_MBONO3O2_NO_1: MBONO3O2 + NO -> 0.25*HMPROP + 0.25*CH2O + 1.25*NO2 + 0.75*HONITR + 0.75*CH3COCH3 + 0.75*HO2
    LU(i,4018) = LU(i,4018) + 1.25*rate_constant(i,313) * number_density(i,123)

    !  k_CH3O2_NO_1: CH3O2 + NO -> 1*CH2O + 1*NO2 + 1*HO2
    LU(i,4018) = LU(i,4018) + rate_constant(i,329) * number_density(i,191)

    !  k_MEKO2_NO_1: MEKO2 + NO -> 1*CH3CO3 + 1*CH3CHO + 1*NO2
    LU(i,4018) = LU(i,4018) + rate_constant(i,332) * number_density(i,128)

    !  k_DICARBO2_NO_1: DICARBO2 + NO -> 1*NO2 + 0.17*HO2 + 0.17*CH3COCHO + 0.17*CO + 0.83*CH3O2
    LU(i,4018) = LU(i,4018) + rate_constant(i,337) * number_density(i,181)

    !  k_MCO3_NO_1: MCO3 + NO -> 1*NO2 + 1*CH2O + 1*CH3CO3
    LU(i,4018) = LU(i,4018) + rate_constant(i,353) * number_density(i,167)

    !  k_NO_PO2_1: NO + PO2 -> 1*CH3CHO + 1*CH2O + 1*HO2 + 1*NO2
    LU(i,4018) = LU(i,4018) + rate_constant(i,365) * number_density(i,151)

    !  k_NO_TERPO2_1: NO + TERPO2 -> 0.2*TERPNIT + 0.8*NO2 + 0.32*CH2O + 0.04*CH3COCH3 + 0.8*TERPROD1 + 0.8*HO2
    LU(i,4018) = LU(i,4018) + 0.8*rate_constant(i,392) * number_density(i,147)

    !  k_MDIALO2_NO_1: MDIALO2 + NO -> 1*NO2 + 0.83*HO2 + 0.17*CH3COCHO + 0.35*CO + 0.17*CH3O2 + 0.17*GLYOXAL
    LU(i,4018) = LU(i,4018) + rate_constant(i,403) * number_density(i,164)

    !  k_NO_XYLOLO2_1: NO + XYLOLO2 -> 1*HO2 + 1*NO2 + 0.17*GLYOXAL + 0.51*CH3COCHO
    LU(i,4018) = LU(i,4018) + rate_constant(i,404) * number_density(i,148)

    !  k_NO_XYLENO2_1: NO + XYLENO2 -> 1*NO2 + 1*HO2 + 0.34*GLYOXAL + 0.54*CH3COCHO + 0.06*BIGALD1 + 0.2*BIGALD2 + 0.15*BIGALD3 + 0.21*BIGALD4
    LU(i,4018) = LU(i,4018) + rate_constant(i,419) * number_density(i,146)

    !  k_MALO2_NO_1: MALO2 + NO -> 0.4*GLYOXAL + 0.4*HO2 + 0.4*CO + 1*NO2
    LU(i,4018) = LU(i,4018) + rate_constant(i,424) * number_density(i,170)

    !  k_NO_O3_1: NO + O3 -> 1*NO2 + 1*O2
    LU(i,4018) = LU(i,4018) + rate_constant(i,439) * number_density(i,171)

    !  k_ISOPAO2_NO_1: ISOPAO2 + NO -> 0.08*ISOPNITA + 0.92*NO2 + 0.36*MACR + 0.56*MVK + 0.92*CH2O + 0.92*HO2
    LU(i,4018) = LU(i,4018) + 0.92*rate_constant(i,464) * number_density(i,189)

    !  k_C3H7O2_NO_1: C3H7O2 + NO -> 0.82*CH3COCH3 + 1*NO2 + 1*HO2 + 0.27*CH3CHO
    LU(i,4018) = LU(i,4018) + rate_constant(i,471) * number_density(i,109)

    !  k_HO2_NO_1: HO2 + NO -> 1*NO2 + 1*OH
    LU(i,4018) = LU(i,4018) + rate_constant(i,483) * number_density(i,192)

    !  k_NO_RO2_1: NO + RO2 -> 1*CH3CO3 + 1*CH2O + 1*NO2
    LU(i,4018) = LU(i,4018) + rate_constant(i,484) * number_density(i,40)

    ! df_NO/d(NO)
    !  k_EO2_NO_1: EO2 + NO -> 0.5*CH2O + 0.25*HO2 + 0.75*EO + 1*NO2
    LU(i,4064) = LU(i,4064) - rate_constant(i,16) * number_density(i,163)
  end do
  !$acc end parallel

end subroutine dforce_dy24

subroutine dforce_dy25(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    !  k_CH3CO3_NO_1: CH3CO3 + NO -> 1*CH3O2 + 1*CO2 + 1*NO2
    LU(i,4064) = LU(i,4064) - rate_constant(i,25) * number_density(i,49)

    !  k_MACRO2_NO_1: MACRO2 + NO -> 1*NO2 + 0.47*HO2 + 0.25*CH2O + 0.53*GLYALD + 0.25*CH3COCHO + 0.53*CH3CO3 + 0.22*HYAC + 0.22*CO
    LU(i,4064) = LU(i,4064) - rate_constant(i,40) * number_density(i,188)

    !  k_NO_NO3_1: NO + NO3 -> 2*NO2
    LU(i,4064) = LU(i,4064) - rate_constant(i,41) * number_density(i,165)

    !  k_BENZO2_NO_1: BENZO2 + NO -> 1*NO2 + 1*GLYOXAL + 0.5*BIGALD1 + 1*HO2
    LU(i,4064) = LU(i,4064) - rate_constant(i,59) * number_density(i,13)

    !  k_NO_TOLO2_1: NO + TOLO2 -> 1*NO2 + 0.6*GLYOXAL + 0.4*CH3COCHO + 1*HO2 + 0.2*BIGALD1 + 0.2*BIGALD2 + 0.2*BIGALD3
    LU(i,4064) = LU(i,4064) - rate_constant(i,60) * number_density(i,144)

    !  k_NO_O_1: NO + O -> 1*NO2
    LU(i,4064) = LU(i,4064) - rate_constant(i,62) * number_density(i,187)

    !  k_ALKO2_NO_1: ALKO2 + NO -> 0.4*CH3CHO + 0.1*CH2O + 0.25*CH3COCH3 + 1*HO2 + 0.8*MEK + 1*NO2
    LU(i,4064) = LU(i,4064) - rate_constant(i,71) * number_density(i,85)

    !  k_ISOPBO2_NO_1: ISOPBO2 + NO -> 0.87*HYDRALD + 0.08*ISOPNITB + 0.92*NO2 + 0.92*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    LU(i,4064) = LU(i,4064) - rate_constant(i,96) * number_density(i,190)

    !  k_NO_1: NO -> 1*N + 1*O
    LU(i,4064) = LU(i,4064) - rate_constant(i,97)

    !  k_NO_TERP2O2_1: NO + TERP2O2 -> 0.1*ONITR + 0.9*NO2 + 0.34*CH2O + 0.27*CH3COCH3 + 0.225*CO + 0.9*CO2 + 0.9*TERPROD2 + 0.9*HO2 + 0.225*GLYALD
    LU(i,4064) = LU(i,4064) - rate_constant(i,110) * number_density(i,145)

    !  k_HOCH2OO_NO_1: HOCH2OO + NO -> 1*HCOOH + 1*NO2 + 1*HO2
    LU(i,4064) = LU(i,4064) - rate_constant(i,113) * number_density(i,154)

    !  k_HMPROPO2_NO_1: HMPROPO2 + NO -> 1*NO2 + 1*CO2 + 1*HO2 + 1*CH3COCH3
    LU(i,4064) = LU(i,4064) - rate_constant(i,156) * number_density(i,77)

    !  k_C6H5O2_NO_1: C6H5O2 + NO -> 1*PHENO + 1*NO2
    LU(i,4064) = LU(i,4064) - rate_constant(i,175) * number_density(i,81)

    !  k_ALKO2_NO_2: ALKO2 + NO -> 1*ALKNIT
    LU(i,4064) = LU(i,4064) - rate_constant(i,194) * number_density(i,85)

    !  k_BZOO_NO_1: BZOO + NO -> 1*BZALD + 1*NO2 + 1*HO2
    LU(i,4064) = LU(i,4064) - rate_constant(i,195) * number_density(i,33)

    !  k_ENEO2_NO_1: ENEO2 + NO -> 1*CH3CHO + 0.5*CH2O + 0.5*CH3COCH3 + 1*HO2 + 1*NO2
    LU(i,4064) = LU(i,4064) - rate_constant(i,201) * number_density(i,133)

    !  k_CLO_NO_1: CLO + NO -> 1*NO2 + 1*CL
    LU(i,4064) = LU(i,4064) - rate_constant(i,203) * number_density(i,86)

    !  k_BRO_NO_1: BRO + NO -> 1*BR + 1*NO2
    LU(i,4064) = LU(i,4064) - rate_constant(i,206) * number_density(i,71)

    !  k_NO_XO2_1: NO + XO2 -> 1*NO2 + 1*HO2 + 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD
    LU(i,4064) = LU(i,4064) - rate_constant(i,252) * number_density(i,153)

    !  k_NO_PHENO2_1: NO + PHENO2 -> 1*HO2 + 0.7*GLYOXAL + 1*NO2
    LU(i,4064) = LU(i,4064) - rate_constant(i,257) * number_density(i,38)

    !  k_ACBZO2_NO_1: ACBZO2 + NO -> 1*C6H5O2 + 1*NO2
    LU(i,4064) = LU(i,4064) - rate_constant(i,263) * number_density(i,43)

    !  k_C2H5O2_NO_1: C2H5O2 + NO -> 1*CH3CHO + 1*HO2 + 1*NO2
    LU(i,4064) = LU(i,4064) - rate_constant(i,270) * number_density(i,87)

    !  k_ISOPNO3_NO_1: ISOPNO3 + NO -> 1*NC4CHO + 1*NO2 + 1*HO2
    LU(i,4064) = LU(i,4064) - rate_constant(i,302) * number_density(i,46)

    !  k_NO_NTERPO2_1: NO + NTERPO2 -> 0.2*TERPNIT + 1.6*NO2 + 0.8*TERPROD1
    LU(i,4064) = LU(i,4064) - rate_constant(i,306) * number_density(i,143)

    !  k_MBOO2_NO_1: MBOO2 + NO -> 1*HO2 + 0.67*GLYALD + 0.67*CH3COCH3 + 0.33*HMPROP + 0.33*CH2O + 1*NO2
    LU(i,4064) = LU(i,4064) - rate_constant(i,308) * number_density(i,125)

    !  k_MBONO3O2_NO_1: MBONO3O2 + NO -> 0.25*HMPROP + 0.25*CH2O + 1.25*NO2 + 0.75*HONITR + 0.75*CH3COCH3 + 0.75*HO2
    LU(i,4064) = LU(i,4064) - rate_constant(i,313) * number_density(i,123)

    !  k_CH3O2_NO_1: CH3O2 + NO -> 1*CH2O + 1*NO2 + 1*HO2
    LU(i,4064) = LU(i,4064) - rate_constant(i,329) * number_density(i,191)

    !  k_MEKO2_NO_1: MEKO2 + NO -> 1*CH3CO3 + 1*CH3CHO + 1*NO2
    LU(i,4064) = LU(i,4064) - rate_constant(i,332) * number_density(i,128)

    !  k_DICARBO2_NO_1: DICARBO2 + NO -> 1*NO2 + 0.17*HO2 + 0.17*CH3COCHO + 0.17*CO + 0.83*CH3O2
    LU(i,4064) = LU(i,4064) - rate_constant(i,337) * number_density(i,181)

    !  k_MCO3_NO_1: MCO3 + NO -> 1*NO2 + 1*CH2O + 1*CH3CO3
    LU(i,4064) = LU(i,4064) - rate_constant(i,353) * number_density(i,167)

    !  k_NO_PO2_1: NO + PO2 -> 1*CH3CHO + 1*CH2O + 1*HO2 + 1*NO2
    LU(i,4064) = LU(i,4064) - rate_constant(i,365) * number_density(i,151)

    !  k_MACRO2_NO_2: MACRO2 + NO -> 1*HONITR
    LU(i,4064) = LU(i,4064) - rate_constant(i,376) * number_density(i,188)

    !  k_ENEO2_NO_2: ENEO2 + NO -> 1*HONITR
    LU(i,4064) = LU(i,4064) - rate_constant(i,378) * number_density(i,133)

    !  k_NO_TERPO2_1: NO + TERPO2 -> 0.2*TERPNIT + 0.8*NO2 + 0.32*CH2O + 0.04*CH3COCH3 + 0.8*TERPROD1 + 0.8*HO2
    LU(i,4064) = LU(i,4064) - rate_constant(i,392) * number_density(i,147)
  end do
  !$acc end parallel

end subroutine dforce_dy25

subroutine dforce_dy26(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    !  k_MDIALO2_NO_1: MDIALO2 + NO -> 1*NO2 + 0.83*HO2 + 0.17*CH3COCHO + 0.35*CO + 0.17*CH3O2 + 0.17*GLYOXAL
    LU(i,4064) = LU(i,4064) - rate_constant(i,403) * number_density(i,164)

    !  k_NO_XYLOLO2_1: NO + XYLOLO2 -> 1*HO2 + 1*NO2 + 0.17*GLYOXAL + 0.51*CH3COCHO
    LU(i,4064) = LU(i,4064) - rate_constant(i,404) * number_density(i,148)

    !  k_N_NO_1: N + NO -> 1*N2 + 1*O
    LU(i,4064) = LU(i,4064) - rate_constant(i,408) * number_density(i,185)

    !  k_NO_XYLENO2_1: NO + XYLENO2 -> 1*NO2 + 1*HO2 + 0.34*GLYOXAL + 0.54*CH3COCHO + 0.06*BIGALD1 + 0.2*BIGALD2 + 0.15*BIGALD3 + 0.21*BIGALD4
    LU(i,4064) = LU(i,4064) - rate_constant(i,419) * number_density(i,146)

    !  k_MALO2_NO_1: MALO2 + NO -> 0.4*GLYOXAL + 0.4*HO2 + 0.4*CO + 1*NO2
    LU(i,4064) = LU(i,4064) - rate_constant(i,424) * number_density(i,170)

    !  k_NO_O3_1: NO + O3 -> 1*NO2 + 1*O2
    LU(i,4064) = LU(i,4064) - rate_constant(i,439) * number_density(i,171)

    !  k_ISOPAO2_NO_1: ISOPAO2 + NO -> 0.08*ISOPNITA + 0.92*NO2 + 0.36*MACR + 0.56*MVK + 0.92*CH2O + 0.92*HO2
    LU(i,4064) = LU(i,4064) - rate_constant(i,464) * number_density(i,189)

    !  k_C3H7O2_NO_1: C3H7O2 + NO -> 0.82*CH3COCH3 + 1*NO2 + 1*HO2 + 0.27*CH3CHO
    LU(i,4064) = LU(i,4064) - rate_constant(i,471) * number_density(i,109)

    !  k_HO2_NO_1: HO2 + NO -> 1*NO2 + 1*OH
    LU(i,4064) = LU(i,4064) - rate_constant(i,483) * number_density(i,192)

    !  k_NO_RO2_1: NO + RO2 -> 1*CH3CO3 + 1*CH2O + 1*NO2
    LU(i,4064) = LU(i,4064) - rate_constant(i,484) * number_density(i,40)

    ! df_BR/d(NO)
    !  k_BRO_NO_1: BRO + NO -> 1*BR + 1*NO2
    LU(i,4036) = LU(i,4036) + rate_constant(i,206) * number_density(i,71)

    ! df_BRO/d(NO)
    !  k_BRO_NO_1: BRO + NO -> 1*BR + 1*NO2
    LU(i,4023) = LU(i,4023) - rate_constant(i,206) * number_density(i,71)

    ! df_CL/d(NO)
    !  k_CLO_NO_1: CLO + NO -> 1*NO2 + 1*CL
    LU(i,4038) = LU(i,4038) + rate_constant(i,203) * number_density(i,86)

    ! df_CLO/d(NO)
    !  k_CLO_NO_1: CLO + NO -> 1*NO2 + 1*CL
    LU(i,4032) = LU(i,4032) - rate_constant(i,203) * number_density(i,86)

    ! df_CO2/d(NO)
    !  k_CH3CO3_NO_1: CH3CO3 + NO -> 1*CH3O2 + 1*CO2 + 1*NO2
    LU(i,4030) = LU(i,4030) + rate_constant(i,25) * number_density(i,49)

    !  k_NO_TERP2O2_1: NO + TERP2O2 -> 0.1*ONITR + 0.9*NO2 + 0.34*CH2O + 0.27*CH3COCH3 + 0.225*CO + 0.9*CO2 + 0.9*TERPROD2 + 0.9*HO2 + 0.225*GLYALD
    LU(i,4030) = LU(i,4030) + 0.9*rate_constant(i,110) * number_density(i,145)

    !  k_HMPROPO2_NO_1: HMPROPO2 + NO -> 1*NO2 + 1*CO2 + 1*HO2 + 1*CH3COCH3
    LU(i,4030) = LU(i,4030) + rate_constant(i,156) * number_density(i,77)

    ! df_HCOOH/d(NO)
    !  k_HOCH2OO_NO_1: HOCH2OO + NO -> 1*HCOOH + 1*NO2 + 1*HO2
    LU(i,4049) = LU(i,4049) + rate_constant(i,113) * number_density(i,154)

    ! df_N/d(NO)
    !  k_NO_1: NO -> 1*N + 1*O
    LU(i,4108) = LU(i,4108) + rate_constant(i,97)

    !  k_N_NO_1: N + NO -> 1*N2 + 1*O
    LU(i,4108) = LU(i,4108) - rate_constant(i,408) * number_density(i,185)

    ! df_C2H5O2/d(NO)
    !  k_C2H5O2_NO_1: C2H5O2 + NO -> 1*CH3CHO + 1*HO2 + 1*NO2
    LU(i,4033) = LU(i,4033) - rate_constant(i,270) * number_density(i,87)

    ! df_CH3COCHO/d(NO)
    !  k_MACRO2_NO_1: MACRO2 + NO -> 1*NO2 + 0.47*HO2 + 0.25*CH2O + 0.53*GLYALD + 0.25*CH3COCHO + 0.53*CH3CO3 + 0.22*HYAC + 0.22*CO
    LU(i,4044) = LU(i,4044) + 0.25*rate_constant(i,40) * number_density(i,188)

    !  k_NO_TOLO2_1: NO + TOLO2 -> 1*NO2 + 0.6*GLYOXAL + 0.4*CH3COCHO + 1*HO2 + 0.2*BIGALD1 + 0.2*BIGALD2 + 0.2*BIGALD3
    LU(i,4044) = LU(i,4044) + 0.4*rate_constant(i,60) * number_density(i,144)

    !  k_ISOPBO2_NO_1: ISOPBO2 + NO -> 0.87*HYDRALD + 0.08*ISOPNITB + 0.92*NO2 + 0.92*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    LU(i,4044) = LU(i,4044) + 0.05*rate_constant(i,96) * number_density(i,190)

    !  k_NO_XO2_1: NO + XO2 -> 1*NO2 + 1*HO2 + 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD
    LU(i,4044) = LU(i,4044) + 0.25*rate_constant(i,252) * number_density(i,153)

    !  k_DICARBO2_NO_1: DICARBO2 + NO -> 1*NO2 + 0.17*HO2 + 0.17*CH3COCHO + 0.17*CO + 0.83*CH3O2
    LU(i,4044) = LU(i,4044) + 0.17*rate_constant(i,337) * number_density(i,181)

    !  k_MDIALO2_NO_1: MDIALO2 + NO -> 1*NO2 + 0.83*HO2 + 0.17*CH3COCHO + 0.35*CO + 0.17*CH3O2 + 0.17*GLYOXAL
    LU(i,4044) = LU(i,4044) + 0.17*rate_constant(i,403) * number_density(i,164)

    !  k_NO_XYLOLO2_1: NO + XYLOLO2 -> 1*HO2 + 1*NO2 + 0.17*GLYOXAL + 0.51*CH3COCHO
    LU(i,4044) = LU(i,4044) + 0.51*rate_constant(i,404) * number_density(i,148)

    !  k_NO_XYLENO2_1: NO + XYLENO2 -> 1*NO2 + 1*HO2 + 0.34*GLYOXAL + 0.54*CH3COCHO + 0.06*BIGALD1 + 0.2*BIGALD2 + 0.15*BIGALD3 + 0.21*BIGALD4
    LU(i,4044) = LU(i,4044) + 0.54*rate_constant(i,419) * number_density(i,146)

    ! df_CH3COCH3/d(NO)
    !  k_ALKO2_NO_1: ALKO2 + NO -> 0.4*CH3CHO + 0.1*CH2O + 0.25*CH3COCH3 + 1*HO2 + 0.8*MEK + 1*NO2
    LU(i,4035) = LU(i,4035) + 0.25*rate_constant(i,71) * number_density(i,85)

  end do
  !$acc end parallel

end subroutine dforce_dy26

subroutine dforce_dy27(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell
    !  k_NO_TERP2O2_1: NO + TERP2O2 -> 0.1*ONITR + 0.9*NO2 + 0.34*CH2O + 0.27*CH3COCH3 + 0.225*CO + 0.9*CO2 + 0.9*TERPROD2 + 0.9*HO2 + 0.225*GLYALD
    LU(i,4035) = LU(i,4035) + 0.27*rate_constant(i,110) * number_density(i,145)

    !  k_HMPROPO2_NO_1: HMPROPO2 + NO -> 1*NO2 + 1*CO2 + 1*HO2 + 1*CH3COCH3
    LU(i,4035) = LU(i,4035) + rate_constant(i,156) * number_density(i,77)

    !  k_ENEO2_NO_1: ENEO2 + NO -> 1*CH3CHO + 0.5*CH2O + 0.5*CH3COCH3 + 1*HO2 + 1*NO2
    LU(i,4035) = LU(i,4035) + 0.5*rate_constant(i,201) * number_density(i,133)

    !  k_MBOO2_NO_1: MBOO2 + NO -> 1*HO2 + 0.67*GLYALD + 0.67*CH3COCH3 + 0.33*HMPROP + 0.33*CH2O + 1*NO2
    LU(i,4035) = LU(i,4035) + 0.67*rate_constant(i,308) * number_density(i,125)

    !  k_MBONO3O2_NO_1: MBONO3O2 + NO -> 0.25*HMPROP + 0.25*CH2O + 1.25*NO2 + 0.75*HONITR + 0.75*CH3COCH3 + 0.75*HO2
    LU(i,4035) = LU(i,4035) + 0.75*rate_constant(i,313) * number_density(i,123)

    !  k_NO_TERPO2_1: NO + TERPO2 -> 0.2*TERPNIT + 0.8*NO2 + 0.32*CH2O + 0.04*CH3COCH3 + 0.8*TERPROD1 + 0.8*HO2
    LU(i,4035) = LU(i,4035) + 0.04*rate_constant(i,392) * number_density(i,147)

    !  k_C3H7O2_NO_1: C3H7O2 + NO -> 0.82*CH3COCH3 + 1*NO2 + 1*HO2 + 0.27*CH3CHO
    LU(i,4035) = LU(i,4035) + 0.82*rate_constant(i,471) * number_density(i,109)

    ! df_O/d(NO)
    !  k_NO_O_1: NO + O -> 1*NO2
    LU(i,4110) = LU(i,4110) - rate_constant(i,62) * number_density(i,187)

    !  k_NO_1: NO -> 1*N + 1*O
    LU(i,4110) = LU(i,4110) + rate_constant(i,97)

    !  k_N_NO_1: N + NO -> 1*N2 + 1*O
    LU(i,4110) = LU(i,4110) + rate_constant(i,408) * number_density(i,185)

    ! df_PHENO/d(NO)
    !  k_C6H5O2_NO_1: C6H5O2 + NO -> 1*PHENO + 1*NO2
    LU(i,4105) = LU(i,4105) + rate_constant(i,175) * number_density(i,81)

    ! df_O3S/d(NO)
    !  k_NO_O3S_1: NO + O3S -> 1*NO
    LU(i,4009) = LU(i,4009) - rate_constant(i,125) * number_density(i,36)

    ! df_BZALD/d(NO)
    !  k_BZOO_NO_1: BZOO + NO -> 1*BZALD + 1*NO2 + 1*HO2
    LU(i,4040) = LU(i,4040) + rate_constant(i,195) * number_density(i,33)

    ! df_C3H7O2/d(NO)
    !  k_C3H7O2_NO_1: C3H7O2 + NO -> 0.82*CH3COCH3 + 1*NO2 + 1*HO2 + 0.27*CH3CHO
    LU(i,4042) = LU(i,4042) - rate_constant(i,471) * number_density(i,109)

    ! df_CH3O2/d(NO)
    !  k_CH3CO3_NO_1: CH3CO3 + NO -> 1*CH3O2 + 1*CO2 + 1*NO2
    LU(i,4114) = LU(i,4114) + rate_constant(i,25) * number_density(i,49)

    !  k_CH3O2_NO_1: CH3O2 + NO -> 1*CH2O + 1*NO2 + 1*HO2
    LU(i,4114) = LU(i,4114) - rate_constant(i,329) * number_density(i,191)

    !  k_DICARBO2_NO_1: DICARBO2 + NO -> 1*NO2 + 0.17*HO2 + 0.17*CH3COCHO + 0.17*CO + 0.83*CH3O2
    LU(i,4114) = LU(i,4114) + 0.83*rate_constant(i,337) * number_density(i,181)

    !  k_MDIALO2_NO_1: MDIALO2 + NO -> 1*NO2 + 0.83*HO2 + 0.17*CH3COCHO + 0.35*CO + 0.17*CH3O2 + 0.17*GLYOXAL
    LU(i,4114) = LU(i,4114) + 0.17*rate_constant(i,403) * number_density(i,164)

    ! df_BIGALD2/d(NO)
    !  k_NO_TOLO2_1: NO + TOLO2 -> 1*NO2 + 0.6*GLYOXAL + 0.4*CH3COCHO + 1*HO2 + 0.2*BIGALD1 + 0.2*BIGALD2 + 0.2*BIGALD3
    LU(i,4047) = LU(i,4047) + 0.2*rate_constant(i,60) * number_density(i,144)

    !  k_NO_XYLENO2_1: NO + XYLENO2 -> 1*NO2 + 1*HO2 + 0.34*GLYOXAL + 0.54*CH3COCHO + 0.06*BIGALD1 + 0.2*BIGALD2 + 0.15*BIGALD3 + 0.21*BIGALD4
    LU(i,4047) = LU(i,4047) + 0.2*rate_constant(i,419) * number_density(i,146)

    ! df_BIGALD3/d(NO)
    !  k_NO_TOLO2_1: NO + TOLO2 -> 1*NO2 + 0.6*GLYOXAL + 0.4*CH3COCHO + 1*HO2 + 0.2*BIGALD1 + 0.2*BIGALD2 + 0.2*BIGALD3
    LU(i,4041) = LU(i,4041) + 0.2*rate_constant(i,60) * number_density(i,144)

    !  k_NO_XYLENO2_1: NO + XYLENO2 -> 1*NO2 + 1*HO2 + 0.34*GLYOXAL + 0.54*CH3COCHO + 0.06*BIGALD1 + 0.2*BIGALD2 + 0.15*BIGALD3 + 0.21*BIGALD4
    LU(i,4041) = LU(i,4041) + 0.15*rate_constant(i,419) * number_density(i,146)

    ! df_BIGALD4/d(NO)
    !  k_NO_XYLENO2_1: NO + XYLENO2 -> 1*NO2 + 1*HO2 + 0.34*GLYOXAL + 0.54*CH3COCHO + 0.06*BIGALD1 + 0.2*BIGALD2 + 0.15*BIGALD3 + 0.21*BIGALD4
    LU(i,4043) = LU(i,4043) + 0.21*rate_constant(i,419) * number_density(i,146)

    ! df_CH2O/d(NO)
    !  k_EO2_NO_1: EO2 + NO -> 0.5*CH2O + 0.25*HO2 + 0.75*EO + 1*NO2
    LU(i,4054) = LU(i,4054) + 0.5*rate_constant(i,16) * number_density(i,163)

    !  k_MACRO2_NO_1: MACRO2 + NO -> 1*NO2 + 0.47*HO2 + 0.25*CH2O + 0.53*GLYALD + 0.25*CH3COCHO + 0.53*CH3CO3 + 0.22*HYAC + 0.22*CO
    LU(i,4054) = LU(i,4054) + 0.25*rate_constant(i,40) * number_density(i,188)

    !  k_ALKO2_NO_1: ALKO2 + NO -> 0.4*CH3CHO + 0.1*CH2O + 0.25*CH3COCH3 + 1*HO2 + 0.8*MEK + 1*NO2
    LU(i,4054) = LU(i,4054) + 0.1*rate_constant(i,71) * number_density(i,85)

    !  k_NO_TERP2O2_1: NO + TERP2O2 -> 0.1*ONITR + 0.9*NO2 + 0.34*CH2O + 0.27*CH3COCH3 + 0.225*CO + 0.9*CO2 + 0.9*TERPROD2 + 0.9*HO2 + 0.225*GLYALD
    LU(i,4054) = LU(i,4054) + 0.34*rate_constant(i,110) * number_density(i,145)

    !  k_ENEO2_NO_1: ENEO2 + NO -> 1*CH3CHO + 0.5*CH2O + 0.5*CH3COCH3 + 1*HO2 + 1*NO2
    LU(i,4054) = LU(i,4054) + 0.5*rate_constant(i,201) * number_density(i,133)

    !  k_NO_XO2_1: NO + XO2 -> 1*NO2 + 1*HO2 + 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD
    LU(i,4054) = LU(i,4054) + 0.25*rate_constant(i,252) * number_density(i,153)

    !  k_MBOO2_NO_1: MBOO2 + NO -> 1*HO2 + 0.67*GLYALD + 0.67*CH3COCH3 + 0.33*HMPROP + 0.33*CH2O + 1*NO2
    LU(i,4054) = LU(i,4054) + 0.33*rate_constant(i,308) * number_density(i,125)

    !  k_MBONO3O2_NO_1: MBONO3O2 + NO -> 0.25*HMPROP + 0.25*CH2O + 1.25*NO2 + 0.75*HONITR + 0.75*CH3COCH3 + 0.75*HO2
    LU(i,4054) = LU(i,4054) + 0.25*rate_constant(i,313) * number_density(i,123)
  end do
  !$acc end parallel

end subroutine dforce_dy27

subroutine dforce_dy28(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    !  k_CH3O2_NO_1: CH3O2 + NO -> 1*CH2O + 1*NO2 + 1*HO2
    LU(i,4054) = LU(i,4054) + rate_constant(i,329) * number_density(i,191)

    !  k_MCO3_NO_1: MCO3 + NO -> 1*NO2 + 1*CH2O + 1*CH3CO3
    LU(i,4054) = LU(i,4054) + rate_constant(i,353) * number_density(i,167)

    !  k_NO_PO2_1: NO + PO2 -> 1*CH3CHO + 1*CH2O + 1*HO2 + 1*NO2
    LU(i,4054) = LU(i,4054) + rate_constant(i,365) * number_density(i,151)

    !  k_NO_TERPO2_1: NO + TERPO2 -> 0.2*TERPNIT + 0.8*NO2 + 0.32*CH2O + 0.04*CH3COCH3 + 0.8*TERPROD1 + 0.8*HO2
    LU(i,4054) = LU(i,4054) + 0.32*rate_constant(i,392) * number_density(i,147)

    !  k_ISOPAO2_NO_1: ISOPAO2 + NO -> 0.08*ISOPNITA + 0.92*NO2 + 0.36*MACR + 0.56*MVK + 0.92*CH2O + 0.92*HO2
    LU(i,4054) = LU(i,4054) + 0.92*rate_constant(i,464) * number_density(i,189)

    !  k_NO_RO2_1: NO + RO2 -> 1*CH3CO3 + 1*CH2O + 1*NO2
    LU(i,4054) = LU(i,4054) + rate_constant(i,484) * number_density(i,40)

    ! df_ENEO2/d(NO)
    !  k_ENEO2_NO_1: ENEO2 + NO -> 1*CH3CHO + 0.5*CH2O + 0.5*CH3COCH3 + 1*HO2 + 1*NO2
    LU(i,4061) = LU(i,4061) - rate_constant(i,201) * number_density(i,133)

    !  k_ENEO2_NO_2: ENEO2 + NO -> 1*HONITR
    LU(i,4061) = LU(i,4061) - rate_constant(i,378) * number_density(i,133)

    ! df_MACRO2/d(NO)
    !  k_MACRO2_NO_1: MACRO2 + NO -> 1*NO2 + 0.47*HO2 + 0.25*CH2O + 0.53*GLYALD + 0.25*CH3COCHO + 0.53*CH3CO3 + 0.22*HYAC + 0.22*CO
    LU(i,4111) = LU(i,4111) - rate_constant(i,40) * number_density(i,188)

    !  k_MACRO2_NO_2: MACRO2 + NO -> 1*HONITR
    LU(i,4111) = LU(i,4111) - rate_constant(i,376) * number_density(i,188)

    ! df_ISOPAO2/d(NO)
    !  k_ISOPAO2_NO_1: ISOPAO2 + NO -> 0.08*ISOPNITA + 0.92*NO2 + 0.36*MACR + 0.56*MVK + 0.92*CH2O + 0.92*HO2
    LU(i,4112) = LU(i,4112) - rate_constant(i,464) * number_density(i,189)

    ! df_MALO2/d(NO)
    !  k_MALO2_NO_1: MALO2 + NO -> 0.4*GLYOXAL + 0.4*HO2 + 0.4*CO + 1*NO2
    LU(i,4093) = LU(i,4093) - rate_constant(i,424) * number_density(i,170)

    ! df_MBONO3O2/d(NO)
    !  k_MBONO3O2_NO_1: MBONO3O2 + NO -> 0.25*HMPROP + 0.25*CH2O + 1.25*NO2 + 0.75*HONITR + 0.75*CH3COCH3 + 0.75*HO2
    LU(i,4053) = LU(i,4053) - rate_constant(i,313) * number_density(i,123)

    ! df_MBOO2/d(NO)
    !  k_MBOO2_NO_1: MBOO2 + NO -> 1*HO2 + 0.67*GLYALD + 0.67*CH3COCH3 + 0.33*HMPROP + 0.33*CH2O + 1*NO2
    LU(i,4055) = LU(i,4055) - rate_constant(i,308) * number_density(i,125)

    ! df_ISOPBO2/d(NO)
    !  k_ISOPBO2_NO_1: ISOPBO2 + NO -> 0.87*HYDRALD + 0.08*ISOPNITB + 0.92*NO2 + 0.92*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    LU(i,4113) = LU(i,4113) - rate_constant(i,96) * number_density(i,190)

    ! df_MCO3/d(NO)
    !  k_MCO3_NO_1: MCO3 + NO -> 1*NO2 + 1*CH2O + 1*CH3CO3
    LU(i,4090) = LU(i,4090) - rate_constant(i,353) * number_density(i,167)

    ! df_MDIALO2/d(NO)
    !  k_MDIALO2_NO_1: MDIALO2 + NO -> 1*NO2 + 0.83*HO2 + 0.17*CH3COCHO + 0.35*CO + 0.17*CH3O2 + 0.17*GLYOXAL
    LU(i,4087) = LU(i,4087) - rate_constant(i,403) * number_density(i,164)

    ! df_MEKO2/d(NO)
    !  k_MEKO2_NO_1: MEKO2 + NO -> 1*CH3CO3 + 1*CH3CHO + 1*NO2
    LU(i,4057) = LU(i,4057) - rate_constant(i,332) * number_density(i,128)

    ! df_EO2/d(NO)
    !  k_EO2_NO_1: EO2 + NO -> 0.5*CH2O + 0.25*HO2 + 0.75*EO + 1*NO2
    LU(i,4086) = LU(i,4086) - rate_constant(i,16) * number_density(i,163)

    ! df_EO/d(NO)
    !  k_EO2_NO_1: EO2 + NO -> 0.5*CH2O + 0.25*HO2 + 0.75*EO + 1*NO2
    LU(i,4085) = LU(i,4085) + 0.75*rate_constant(i,16) * number_density(i,163)

    ! df_GLYOXAL/d(NO)
    !  k_BENZO2_NO_1: BENZO2 + NO -> 1*NO2 + 1*GLYOXAL + 0.5*BIGALD1 + 1*HO2
    LU(i,4059) = LU(i,4059) + rate_constant(i,59) * number_density(i,13)

    !  k_NO_TOLO2_1: NO + TOLO2 -> 1*NO2 + 0.6*GLYOXAL + 0.4*CH3COCHO + 1*HO2 + 0.2*BIGALD1 + 0.2*BIGALD2 + 0.2*BIGALD3
    LU(i,4059) = LU(i,4059) + 0.6*rate_constant(i,60) * number_density(i,144)

    !  k_ISOPBO2_NO_1: ISOPBO2 + NO -> 0.87*HYDRALD + 0.08*ISOPNITB + 0.92*NO2 + 0.92*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    LU(i,4059) = LU(i,4059) + 0.05*rate_constant(i,96) * number_density(i,190)

    !  k_NO_XO2_1: NO + XO2 -> 1*NO2 + 1*HO2 + 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD
    LU(i,4059) = LU(i,4059) + 0.25*rate_constant(i,252) * number_density(i,153)

    !  k_NO_PHENO2_1: NO + PHENO2 -> 1*HO2 + 0.7*GLYOXAL + 1*NO2
    LU(i,4059) = LU(i,4059) + 0.7*rate_constant(i,257) * number_density(i,38)

    !  k_MDIALO2_NO_1: MDIALO2 + NO -> 1*NO2 + 0.83*HO2 + 0.17*CH3COCHO + 0.35*CO + 0.17*CH3O2 + 0.17*GLYOXAL
    LU(i,4059) = LU(i,4059) + 0.17*rate_constant(i,403) * number_density(i,164)

    !  k_NO_XYLOLO2_1: NO + XYLOLO2 -> 1*HO2 + 1*NO2 + 0.17*GLYOXAL + 0.51*CH3COCHO
    LU(i,4059) = LU(i,4059) + 0.17*rate_constant(i,404) * number_density(i,148)

    !  k_NO_XYLENO2_1: NO + XYLENO2 -> 1*NO2 + 1*HO2 + 0.34*GLYOXAL + 0.54*CH3COCHO + 0.06*BIGALD1 + 0.2*BIGALD2 + 0.15*BIGALD3 + 0.21*BIGALD4
    LU(i,4059) = LU(i,4059) + 0.34*rate_constant(i,419) * number_density(i,146)

    !  k_MALO2_NO_1: MALO2 + NO -> 0.4*GLYOXAL + 0.4*HO2 + 0.4*CO + 1*NO2
    LU(i,4059) = LU(i,4059) + 0.4*rate_constant(i,424) * number_density(i,170)

  end do
  !$acc end parallel

end subroutine dforce_dy28

subroutine dforce_dy29(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell
    ! df_HMPROP/d(NO)
    !  k_MBOO2_NO_1: MBOO2 + NO -> 1*HO2 + 0.67*GLYALD + 0.67*CH3COCH3 + 0.33*HMPROP + 0.33*CH2O + 1*NO2
    LU(i,4060) = LU(i,4060) + 0.33*rate_constant(i,308) * number_density(i,125)

    !  k_MBONO3O2_NO_1: MBONO3O2 + NO -> 0.25*HMPROP + 0.25*CH2O + 1.25*NO2 + 0.75*HONITR + 0.75*CH3COCH3 + 0.75*HO2
    LU(i,4060) = LU(i,4060) + 0.25*rate_constant(i,313) * number_density(i,123)

    ! df_GLYALD/d(NO)
    !  k_MACRO2_NO_1: MACRO2 + NO -> 1*NO2 + 0.47*HO2 + 0.25*CH2O + 0.53*GLYALD + 0.25*CH3COCHO + 0.53*CH3CO3 + 0.22*HYAC + 0.22*CO
    LU(i,4079) = LU(i,4079) + 0.53*rate_constant(i,40) * number_density(i,188)

    !  k_ISOPBO2_NO_1: ISOPBO2 + NO -> 0.87*HYDRALD + 0.08*ISOPNITB + 0.92*NO2 + 0.92*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    LU(i,4079) = LU(i,4079) + 0.05*rate_constant(i,96) * number_density(i,190)

    !  k_NO_TERP2O2_1: NO + TERP2O2 -> 0.1*ONITR + 0.9*NO2 + 0.34*CH2O + 0.27*CH3COCH3 + 0.225*CO + 0.9*CO2 + 0.9*TERPROD2 + 0.9*HO2 + 0.225*GLYALD
    LU(i,4079) = LU(i,4079) + 0.225*rate_constant(i,110) * number_density(i,145)

    !  k_NO_XO2_1: NO + XO2 -> 1*NO2 + 1*HO2 + 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD
    LU(i,4079) = LU(i,4079) + 0.25*rate_constant(i,252) * number_density(i,153)

    !  k_MBOO2_NO_1: MBOO2 + NO -> 1*HO2 + 0.67*GLYALD + 0.67*CH3COCH3 + 0.33*HMPROP + 0.33*CH2O + 1*NO2
    LU(i,4079) = LU(i,4079) + 0.67*rate_constant(i,308) * number_density(i,125)

    ! df_HO2/d(NO)
    !  k_EO2_NO_1: EO2 + NO -> 0.5*CH2O + 0.25*HO2 + 0.75*EO + 1*NO2
    LU(i,4115) = LU(i,4115) + 0.25*rate_constant(i,16) * number_density(i,163)

    !  k_MACRO2_NO_1: MACRO2 + NO -> 1*NO2 + 0.47*HO2 + 0.25*CH2O + 0.53*GLYALD + 0.25*CH3COCHO + 0.53*CH3CO3 + 0.22*HYAC + 0.22*CO
    LU(i,4115) = LU(i,4115) + 0.47*rate_constant(i,40) * number_density(i,188)

    !  k_BENZO2_NO_1: BENZO2 + NO -> 1*NO2 + 1*GLYOXAL + 0.5*BIGALD1 + 1*HO2
    LU(i,4115) = LU(i,4115) + rate_constant(i,59) * number_density(i,13)

    !  k_NO_TOLO2_1: NO + TOLO2 -> 1*NO2 + 0.6*GLYOXAL + 0.4*CH3COCHO + 1*HO2 + 0.2*BIGALD1 + 0.2*BIGALD2 + 0.2*BIGALD3
    LU(i,4115) = LU(i,4115) + rate_constant(i,60) * number_density(i,144)

    !  k_ALKO2_NO_1: ALKO2 + NO -> 0.4*CH3CHO + 0.1*CH2O + 0.25*CH3COCH3 + 1*HO2 + 0.8*MEK + 1*NO2
    LU(i,4115) = LU(i,4115) + rate_constant(i,71) * number_density(i,85)

    !  k_ISOPBO2_NO_1: ISOPBO2 + NO -> 0.87*HYDRALD + 0.08*ISOPNITB + 0.92*NO2 + 0.92*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    LU(i,4115) = LU(i,4115) + 0.92*rate_constant(i,96) * number_density(i,190)

    !  k_NO_TERP2O2_1: NO + TERP2O2 -> 0.1*ONITR + 0.9*NO2 + 0.34*CH2O + 0.27*CH3COCH3 + 0.225*CO + 0.9*CO2 + 0.9*TERPROD2 + 0.9*HO2 + 0.225*GLYALD
    LU(i,4115) = LU(i,4115) + 0.9*rate_constant(i,110) * number_density(i,145)

    !  k_HOCH2OO_NO_1: HOCH2OO + NO -> 1*HCOOH + 1*NO2 + 1*HO2
    LU(i,4115) = LU(i,4115) + rate_constant(i,113) * number_density(i,154)

    !  k_HMPROPO2_NO_1: HMPROPO2 + NO -> 1*NO2 + 1*CO2 + 1*HO2 + 1*CH3COCH3
    LU(i,4115) = LU(i,4115) + rate_constant(i,156) * number_density(i,77)

    !  k_BZOO_NO_1: BZOO + NO -> 1*BZALD + 1*NO2 + 1*HO2
    LU(i,4115) = LU(i,4115) + rate_constant(i,195) * number_density(i,33)

    !  k_ENEO2_NO_1: ENEO2 + NO -> 1*CH3CHO + 0.5*CH2O + 0.5*CH3COCH3 + 1*HO2 + 1*NO2
    LU(i,4115) = LU(i,4115) + rate_constant(i,201) * number_density(i,133)

    !  k_NO_XO2_1: NO + XO2 -> 1*NO2 + 1*HO2 + 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD
    LU(i,4115) = LU(i,4115) + rate_constant(i,252) * number_density(i,153)

    !  k_NO_PHENO2_1: NO + PHENO2 -> 1*HO2 + 0.7*GLYOXAL + 1*NO2
    LU(i,4115) = LU(i,4115) + rate_constant(i,257) * number_density(i,38)

    !  k_C2H5O2_NO_1: C2H5O2 + NO -> 1*CH3CHO + 1*HO2 + 1*NO2
    LU(i,4115) = LU(i,4115) + rate_constant(i,270) * number_density(i,87)

    !  k_ISOPNO3_NO_1: ISOPNO3 + NO -> 1*NC4CHO + 1*NO2 + 1*HO2
    LU(i,4115) = LU(i,4115) + rate_constant(i,302) * number_density(i,46)

    !  k_MBOO2_NO_1: MBOO2 + NO -> 1*HO2 + 0.67*GLYALD + 0.67*CH3COCH3 + 0.33*HMPROP + 0.33*CH2O + 1*NO2
    LU(i,4115) = LU(i,4115) + rate_constant(i,308) * number_density(i,125)

    !  k_MBONO3O2_NO_1: MBONO3O2 + NO -> 0.25*HMPROP + 0.25*CH2O + 1.25*NO2 + 0.75*HONITR + 0.75*CH3COCH3 + 0.75*HO2
    LU(i,4115) = LU(i,4115) + 0.75*rate_constant(i,313) * number_density(i,123)

    !  k_CH3O2_NO_1: CH3O2 + NO -> 1*CH2O + 1*NO2 + 1*HO2
    LU(i,4115) = LU(i,4115) + rate_constant(i,329) * number_density(i,191)

    !  k_DICARBO2_NO_1: DICARBO2 + NO -> 1*NO2 + 0.17*HO2 + 0.17*CH3COCHO + 0.17*CO + 0.83*CH3O2
    LU(i,4115) = LU(i,4115) + 0.17*rate_constant(i,337) * number_density(i,181)

    !  k_NO_PO2_1: NO + PO2 -> 1*CH3CHO + 1*CH2O + 1*HO2 + 1*NO2
    LU(i,4115) = LU(i,4115) + rate_constant(i,365) * number_density(i,151)

    !  k_NO_TERPO2_1: NO + TERPO2 -> 0.2*TERPNIT + 0.8*NO2 + 0.32*CH2O + 0.04*CH3COCH3 + 0.8*TERPROD1 + 0.8*HO2
    LU(i,4115) = LU(i,4115) + 0.8*rate_constant(i,392) * number_density(i,147)

    !  k_MDIALO2_NO_1: MDIALO2 + NO -> 1*NO2 + 0.83*HO2 + 0.17*CH3COCHO + 0.35*CO + 0.17*CH3O2 + 0.17*GLYOXAL
    LU(i,4115) = LU(i,4115) + 0.83*rate_constant(i,403) * number_density(i,164)

    !  k_NO_XYLOLO2_1: NO + XYLOLO2 -> 1*HO2 + 1*NO2 + 0.17*GLYOXAL + 0.51*CH3COCHO
    LU(i,4115) = LU(i,4115) + rate_constant(i,404) * number_density(i,148)

    !  k_NO_XYLENO2_1: NO + XYLENO2 -> 1*NO2 + 1*HO2 + 0.34*GLYOXAL + 0.54*CH3COCHO + 0.06*BIGALD1 + 0.2*BIGALD2 + 0.15*BIGALD3 + 0.21*BIGALD4
    LU(i,4115) = LU(i,4115) + rate_constant(i,419) * number_density(i,146)

    !  k_MALO2_NO_1: MALO2 + NO -> 0.4*GLYOXAL + 0.4*HO2 + 0.4*CO + 1*NO2
    LU(i,4115) = LU(i,4115) + 0.4*rate_constant(i,424) * number_density(i,170)

    !  k_ISOPAO2_NO_1: ISOPAO2 + NO -> 0.08*ISOPNITA + 0.92*NO2 + 0.36*MACR + 0.56*MVK + 0.92*CH2O + 0.92*HO2
    LU(i,4115) = LU(i,4115) + 0.92*rate_constant(i,464) * number_density(i,189)
  end do
  !$acc end parallel

end subroutine dforce_dy29

subroutine dforce_dy30(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    !  k_C3H7O2_NO_1: C3H7O2 + NO -> 0.82*CH3COCH3 + 1*NO2 + 1*HO2 + 0.27*CH3CHO
    LU(i,4115) = LU(i,4115) + rate_constant(i,471) * number_density(i,109)

    !  k_HO2_NO_1: HO2 + NO -> 1*NO2 + 1*OH
    LU(i,4115) = LU(i,4115) - rate_constant(i,483) * number_density(i,192)

    ! df_HOCH2OO/d(NO)
    !  k_HOCH2OO_NO_1: HOCH2OO + NO -> 1*HCOOH + 1*NO2 + 1*HO2
    LU(i,4077) = LU(i,4077) - rate_constant(i,113) * number_density(i,154)

    ! df_HYDRALD/d(NO)
    !  k_ISOPBO2_NO_1: ISOPBO2 + NO -> 0.87*HYDRALD + 0.08*ISOPNITB + 0.92*NO2 + 0.92*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    LU(i,4065) = LU(i,4065) + 0.87*rate_constant(i,96) * number_density(i,190)

    ! df_NTERPO2/d(NO)
    !  k_NO_NTERPO2_1: NO + NTERPO2 -> 0.2*TERPNIT + 1.6*NO2 + 0.8*TERPROD1
    LU(i,4066) = LU(i,4066) - rate_constant(i,306) * number_density(i,143)

    ! df_TOLO2/d(NO)
    !  k_NO_TOLO2_1: NO + TOLO2 -> 1*NO2 + 0.6*GLYOXAL + 0.4*CH3COCHO + 1*HO2 + 0.2*BIGALD1 + 0.2*BIGALD2 + 0.2*BIGALD3
    LU(i,4067) = LU(i,4067) - rate_constant(i,60) * number_density(i,144)

    ! df_TERP2O2/d(NO)
    !  k_NO_TERP2O2_1: NO + TERP2O2 -> 0.1*ONITR + 0.9*NO2 + 0.34*CH2O + 0.27*CH3COCH3 + 0.225*CO + 0.9*CO2 + 0.9*TERPROD2 + 0.9*HO2 + 0.225*GLYALD
    LU(i,4068) = LU(i,4068) - rate_constant(i,110) * number_density(i,145)

    ! df_XYLENO2/d(NO)
    !  k_NO_XYLENO2_1: NO + XYLENO2 -> 1*NO2 + 1*HO2 + 0.34*GLYOXAL + 0.54*CH3COCHO + 0.06*BIGALD1 + 0.2*BIGALD2 + 0.15*BIGALD3 + 0.21*BIGALD4
    LU(i,4069) = LU(i,4069) - rate_constant(i,419) * number_density(i,146)

    ! df_TERPO2/d(NO)
    !  k_NO_TERPO2_1: NO + TERPO2 -> 0.2*TERPNIT + 0.8*NO2 + 0.32*CH2O + 0.04*CH3COCH3 + 0.8*TERPROD1 + 0.8*HO2
    LU(i,4070) = LU(i,4070) - rate_constant(i,392) * number_density(i,147)

    ! df_XYLOLO2/d(NO)
    !  k_NO_XYLOLO2_1: NO + XYLOLO2 -> 1*HO2 + 1*NO2 + 0.17*GLYOXAL + 0.51*CH3COCHO
    LU(i,4071) = LU(i,4071) - rate_constant(i,404) * number_density(i,148)

    ! df_PO2/d(NO)
    !  k_NO_PO2_1: NO + PO2 -> 1*CH3CHO + 1*CH2O + 1*HO2 + 1*NO2
    LU(i,4074) = LU(i,4074) - rate_constant(i,365) * number_density(i,151)

    ! df_XO2/d(NO)
    !  k_NO_XO2_1: NO + XO2 -> 1*NO2 + 1*HO2 + 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD
    LU(i,4076) = LU(i,4076) - rate_constant(i,252) * number_density(i,153)

    ! df_TERPROD2/d(NO)
    !  k_NO_TERP2O2_1: NO + TERP2O2 -> 0.1*ONITR + 0.9*NO2 + 0.34*CH2O + 0.27*CH3COCH3 + 0.225*CO + 0.9*CO2 + 0.9*TERPROD2 + 0.9*HO2 + 0.225*GLYALD
    LU(i,4078) = LU(i,4078) + 0.9*rate_constant(i,110) * number_density(i,145)

    ! df_MACR/d(NO)
    !  k_ISOPAO2_NO_1: ISOPAO2 + NO -> 0.08*ISOPNITA + 0.92*NO2 + 0.36*MACR + 0.56*MVK + 0.92*CH2O + 0.92*HO2
    LU(i,4080) = LU(i,4080) + 0.36*rate_constant(i,464) * number_density(i,189)

    ! df_HONITR/d(NO)
    !  k_MBONO3O2_NO_1: MBONO3O2 + NO -> 0.25*HMPROP + 0.25*CH2O + 1.25*NO2 + 0.75*HONITR + 0.75*CH3COCH3 + 0.75*HO2
    LU(i,4062) = LU(i,4062) + 0.75*rate_constant(i,313) * number_density(i,123)

    !  k_MACRO2_NO_2: MACRO2 + NO -> 1*HONITR
    LU(i,4062) = LU(i,4062) + rate_constant(i,376) * number_density(i,188)

    !  k_ENEO2_NO_2: ENEO2 + NO -> 1*HONITR
    LU(i,4062) = LU(i,4062) + rate_constant(i,378) * number_density(i,133)

    ! df_ISOPNITA/d(NO)
    !  k_ISOPAO2_NO_1: ISOPAO2 + NO -> 0.08*ISOPNITA + 0.92*NO2 + 0.36*MACR + 0.56*MVK + 0.92*CH2O + 0.92*HO2
    LU(i,4048) = LU(i,4048) + 0.08*rate_constant(i,464) * number_density(i,189)

    ! df_ONITR/d(NO)
    !  k_NO_TERP2O2_1: NO + TERP2O2 -> 0.1*ONITR + 0.9*NO2 + 0.34*CH2O + 0.27*CH3COCH3 + 0.225*CO + 0.9*CO2 + 0.9*TERPROD2 + 0.9*HO2 + 0.225*GLYALD
    LU(i,4058) = LU(i,4058) + 0.1*rate_constant(i,110) * number_density(i,145)

    ! df_NO3/d(NO)
    !  k_NO_NO3_1: NO + NO3 -> 2*NO2
    LU(i,4088) = LU(i,4088) - rate_constant(i,41) * number_density(i,165)

    ! df_OH/d(NO)
    !  k_HO2_NO_1: HO2 + NO -> 1*NO2 + 1*OH
    LU(i,4089) = LU(i,4089) + rate_constant(i,483) * number_density(i,192)

    ! df_O3/d(NO)
    !  k_NO_O3_1: NO + O3 -> 1*NO2 + 1*O2
    LU(i,4094) = LU(i,4094) - rate_constant(i,439) * number_density(i,171)

    ! df_CO/d(NO)
    !  k_MACRO2_NO_1: MACRO2 + NO -> 1*NO2 + 0.47*HO2 + 0.25*CH2O + 0.53*GLYALD + 0.25*CH3COCHO + 0.53*CH3CO3 + 0.22*HYAC + 0.22*CO
    LU(i,4099) = LU(i,4099) + 0.22*rate_constant(i,40) * number_density(i,188)

    !  k_NO_TERP2O2_1: NO + TERP2O2 -> 0.1*ONITR + 0.9*NO2 + 0.34*CH2O + 0.27*CH3COCH3 + 0.225*CO + 0.9*CO2 + 0.9*TERPROD2 + 0.9*HO2 + 0.225*GLYALD
    LU(i,4099) = LU(i,4099) + 0.225*rate_constant(i,110) * number_density(i,145)

    !  k_NO_XO2_1: NO + XO2 -> 1*NO2 + 1*HO2 + 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD
    LU(i,4099) = LU(i,4099) + 0.25*rate_constant(i,252) * number_density(i,153)

    !  k_DICARBO2_NO_1: DICARBO2 + NO -> 1*NO2 + 0.17*HO2 + 0.17*CH3COCHO + 0.17*CO + 0.83*CH3O2
    LU(i,4099) = LU(i,4099) + 0.17*rate_constant(i,337) * number_density(i,181)

    !  k_MDIALO2_NO_1: MDIALO2 + NO -> 1*NO2 + 0.83*HO2 + 0.17*CH3COCHO + 0.35*CO + 0.17*CH3O2 + 0.17*GLYOXAL
    LU(i,4099) = LU(i,4099) + 0.35*rate_constant(i,403) * number_density(i,164)

  end do
  !$acc end parallel

end subroutine dforce_dy30

subroutine dforce_dy31(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell
    !  k_MALO2_NO_1: MALO2 + NO -> 0.4*GLYOXAL + 0.4*HO2 + 0.4*CO + 1*NO2
    LU(i,4099) = LU(i,4099) + 0.4*rate_constant(i,424) * number_density(i,170)

    ! df_CH3CHO/d(NO)
    !  k_ALKO2_NO_1: ALKO2 + NO -> 0.4*CH3CHO + 0.1*CH2O + 0.25*CH3COCH3 + 1*HO2 + 0.8*MEK + 1*NO2
    LU(i,4101) = LU(i,4101) + 0.4*rate_constant(i,71) * number_density(i,85)

    !  k_ENEO2_NO_1: ENEO2 + NO -> 1*CH3CHO + 0.5*CH2O + 0.5*CH3COCH3 + 1*HO2 + 1*NO2
    LU(i,4101) = LU(i,4101) + rate_constant(i,201) * number_density(i,133)

    !  k_C2H5O2_NO_1: C2H5O2 + NO -> 1*CH3CHO + 1*HO2 + 1*NO2
    LU(i,4101) = LU(i,4101) + rate_constant(i,270) * number_density(i,87)

    !  k_MEKO2_NO_1: MEKO2 + NO -> 1*CH3CO3 + 1*CH3CHO + 1*NO2
    LU(i,4101) = LU(i,4101) + rate_constant(i,332) * number_density(i,128)

    !  k_NO_PO2_1: NO + PO2 -> 1*CH3CHO + 1*CH2O + 1*HO2 + 1*NO2
    LU(i,4101) = LU(i,4101) + rate_constant(i,365) * number_density(i,151)

    !  k_C3H7O2_NO_1: C3H7O2 + NO -> 0.82*CH3COCH3 + 1*NO2 + 1*HO2 + 0.27*CH3CHO
    LU(i,4101) = LU(i,4101) + 0.27*rate_constant(i,471) * number_density(i,109)

    ! df_BIGALD1/d(NO)
    !  k_BENZO2_NO_1: BENZO2 + NO -> 1*NO2 + 1*GLYOXAL + 0.5*BIGALD1 + 1*HO2
    LU(i,4027) = LU(i,4027) + 0.5*rate_constant(i,59) * number_density(i,13)

    !  k_NO_TOLO2_1: NO + TOLO2 -> 1*NO2 + 0.6*GLYOXAL + 0.4*CH3COCHO + 1*HO2 + 0.2*BIGALD1 + 0.2*BIGALD2 + 0.2*BIGALD3
    LU(i,4027) = LU(i,4027) + 0.2*rate_constant(i,60) * number_density(i,144)

    !  k_NO_XYLENO2_1: NO + XYLENO2 -> 1*NO2 + 1*HO2 + 0.34*GLYOXAL + 0.54*CH3COCHO + 0.06*BIGALD1 + 0.2*BIGALD2 + 0.15*BIGALD3 + 0.21*BIGALD4
    LU(i,4027) = LU(i,4027) + 0.06*rate_constant(i,419) * number_density(i,146)

    ! df_DICARBO2/d(NO)
    !  k_DICARBO2_NO_1: DICARBO2 + NO -> 1*NO2 + 0.17*HO2 + 0.17*CH3COCHO + 0.17*CO + 0.83*CH3O2
    LU(i,4104) = LU(i,4104) - rate_constant(i,337) * number_density(i,181)

    ! df_ALKO2/d(NO)
    !  k_ALKO2_NO_1: ALKO2 + NO -> 0.4*CH3CHO + 0.1*CH2O + 0.25*CH3COCH3 + 1*HO2 + 0.8*MEK + 1*NO2
    LU(i,4031) = LU(i,4031) - rate_constant(i,71) * number_density(i,85)

    !  k_ALKO2_NO_2: ALKO2 + NO -> 1*ALKNIT
    LU(i,4031) = LU(i,4031) - rate_constant(i,194) * number_density(i,85)

    ! df_NC4CHO/d(NO)
    !  k_ISOPNO3_NO_1: ISOPNO3 + NO -> 1*NC4CHO + 1*NO2 + 1*HO2
    LU(i,4005) = LU(i,4005) + rate_constant(i,302) * number_density(i,46)

    ! df_O2/d(BR)
    !  k_BR_HO2_1: BR + HO2 -> 1*HBR + 1*O2
    LU(i,1488) = LU(i,1488) + rate_constant(i,38) * number_density(i,192)

    !  k_BR_O3_1: BR + O3 -> 1*BRO + 1*O2
    LU(i,1488) = LU(i,1488) + rate_constant(i,317) * number_density(i,171)

    ! df_BR/d(BR)
    !  k_BR_HO2_1: BR + HO2 -> 1*HBR + 1*O2
    LU(i,1502) = LU(i,1502) - rate_constant(i,38) * number_density(i,192)

    !  k_BR_CH2O_1: BR + CH2O -> 1*HBR + 1*HO2 + 1*CO
    LU(i,1502) = LU(i,1502) - rate_constant(i,298) * number_density(i,124)

    !  k_BR_O3_1: BR + O3 -> 1*BRO + 1*O2
    LU(i,1502) = LU(i,1502) - rate_constant(i,317) * number_density(i,171)

    ! df_BRO/d(BR)
    !  k_BR_O3_1: BR + O3 -> 1*BRO + 1*O2
    LU(i,1494) = LU(i,1494) + rate_constant(i,317) * number_density(i,171)

    ! df_HBR/d(BR)
    !  k_BR_HO2_1: BR + HO2 -> 1*HBR + 1*O2
    LU(i,1497) = LU(i,1497) + rate_constant(i,38) * number_density(i,192)

    !  k_BR_CH2O_1: BR + CH2O -> 1*HBR + 1*HO2 + 1*CO
    LU(i,1497) = LU(i,1497) + rate_constant(i,298) * number_density(i,124)

    ! df_CH2O/d(BR)
    !  k_BR_CH2O_1: BR + CH2O -> 1*HBR + 1*HO2 + 1*CO
    LU(i,1510) = LU(i,1510) - rate_constant(i,298) * number_density(i,124)

    ! df_HO2/d(BR)
    !  k_BR_HO2_1: BR + HO2 -> 1*HBR + 1*O2
    LU(i,1547) = LU(i,1547) - rate_constant(i,38) * number_density(i,192)

    !  k_BR_CH2O_1: BR + CH2O -> 1*HBR + 1*HO2 + 1*CO
    LU(i,1547) = LU(i,1547) + rate_constant(i,298) * number_density(i,124)

    ! df_O3/d(BR)
    !  k_BR_O3_1: BR + O3 -> 1*BRO + 1*O2
    LU(i,1529) = LU(i,1529) - rate_constant(i,317) * number_density(i,171)

    ! df_CO/d(BR)
    !  k_BR_CH2O_1: BR + CH2O -> 1*HBR + 1*HO2 + 1*CO
    LU(i,1531) = LU(i,1531) + rate_constant(i,298) * number_density(i,124)

    ! df_BR/d(BRCL)
    !  k_BRCL_1: BRCL -> 1*BR + 1*CL
    LU(i,6790) = LU(i,6790) + rate_constant(i,342)

    ! df_BRCL/d(BRCL)
    !  k_BRCL_1: BRCL -> 1*BR + 1*CL
    LU(i,6833) = LU(i,6833) - rate_constant(i,342)
  end do
  !$acc end parallel

end subroutine dforce_dy31

subroutine dforce_dy32(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! df_CL/d(BRCL)
    !  k_BRCL_1: BRCL -> 1*BR + 1*CL
    LU(i,6791) = LU(i,6791) + rate_constant(i,342)

    ! df_O2/d(BRO)
    !  k_BRO_O_1: BRO + O -> 1*BR + 1*O2
    LU(i,660) = LU(i,660) + rate_constant(i,223) * number_density(i,187)

    !  k_BRO_BRO_1: BRO + BRO -> 2*BR + 1*O2
    LU(i,660) = LU(i,660) + rate_constant(i,294) * number_density(i,71)

    !  k_BRO_BRO_1: BRO + BRO -> 2*BR + 1*O2
    LU(i,660) = LU(i,660) + rate_constant(i,294) * number_density(i,71)

    !  k_BRO_HO2_1: BRO + HO2 -> 1*HOBR + 1*O2
    LU(i,660) = LU(i,660) + rate_constant(i,299) * number_density(i,192)

    !  k_BRO_CLO_1: BRO + CLO -> 1*BR + 1*CL + 1*O2
    LU(i,660) = LU(i,660) + rate_constant(i,361) * number_density(i,86)

    !  k_BRO_CLO_2: BRO + CLO -> 1*BRCL + 1*O2
    LU(i,660) = LU(i,660) + rate_constant(i,432) * number_density(i,86)

    ! df_SO/d(BRO)
    !  k_BRO_SO_1: BRO + SO -> 1*SO2 + 1*BR
    LU(i,659) = LU(i,659) - rate_constant(i,58) * number_density(i,32)

    ! df_SO2/d(BRO)
    !  k_BRO_SO_1: BRO + SO -> 1*SO2 + 1*BR
    LU(i,663) = LU(i,663) + rate_constant(i,58) * number_density(i,32)

    ! df_NO2/d(BRO)
    !  k_BRO_NO2_1: BRO + NO2 -> 1*BRONO2
    LU(i,662) = LU(i,662) - rate_constant(i,184) * number_density(i,54)

    !  k_BRO_NO_1: BRO + NO -> 1*BR + 1*NO2
    LU(i,662) = LU(i,662) + rate_constant(i,206) * number_density(i,137)

    ! df_NO/d(BRO)
    !  k_BRO_NO_1: BRO + NO -> 1*BR + 1*NO2
    LU(i,682) = LU(i,682) - rate_constant(i,206) * number_density(i,137)

    ! df_BR/d(BRO)
    !  k_BRO_SO_1: BRO + SO -> 1*SO2 + 1*BR
    LU(i,672) = LU(i,672) + rate_constant(i,58) * number_density(i,32)

    !  k_BRO_1: BRO -> 1*BR + 1*O
    LU(i,672) = LU(i,672) + rate_constant(i,83)

    !  k_BRO_OH_1: BRO + OH -> 1*BR + 1*HO2
    LU(i,672) = LU(i,672) + rate_constant(i,204) * number_density(i,166)

    !  k_BRO_NO_1: BRO + NO -> 1*BR + 1*NO2
    LU(i,672) = LU(i,672) + rate_constant(i,206) * number_density(i,137)

    !  k_BRO_O_1: BRO + O -> 1*BR + 1*O2
    LU(i,672) = LU(i,672) + rate_constant(i,223) * number_density(i,187)

    !  k_BRO_BRO_1: BRO + BRO -> 2*BR + 1*O2
    LU(i,672) = LU(i,672) + 2*rate_constant(i,294) * number_density(i,71)

    !  k_BRO_BRO_1: BRO + BRO -> 2*BR + 1*O2
    LU(i,672) = LU(i,672) + 2*rate_constant(i,294) * number_density(i,71)

    !  k_BRO_CLO_1: BRO + CLO -> 1*BR + 1*CL + 1*O2
    LU(i,672) = LU(i,672) + rate_constant(i,361) * number_density(i,86)

    !  k_BRO_CLO_3: BRO + CLO -> 1*BR + 1*OCLO
    LU(i,672) = LU(i,672) + rate_constant(i,448) * number_density(i,86)

    ! df_BRCL/d(BRO)
    !  k_BRO_CLO_2: BRO + CLO -> 1*BRCL + 1*O2
    LU(i,700) = LU(i,700) + rate_constant(i,432) * number_density(i,86)

    ! df_BRO/d(BRO)
    !  k_BRO_SO_1: BRO + SO -> 1*SO2 + 1*BR
    LU(i,666) = LU(i,666) - rate_constant(i,58) * number_density(i,32)

    !  k_BRO_1: BRO -> 1*BR + 1*O
    LU(i,666) = LU(i,666) - rate_constant(i,83)

    !  k_BRO_NO2_1: BRO + NO2 -> 1*BRONO2
    LU(i,666) = LU(i,666) - rate_constant(i,184) * number_density(i,54)

    !  k_BRO_OH_1: BRO + OH -> 1*BR + 1*HO2
    LU(i,666) = LU(i,666) - rate_constant(i,204) * number_density(i,166)

    !  k_BRO_NO_1: BRO + NO -> 1*BR + 1*NO2
    LU(i,666) = LU(i,666) - rate_constant(i,206) * number_density(i,137)

    !  k_BRO_O_1: BRO + O -> 1*BR + 1*O2
    LU(i,666) = LU(i,666) - rate_constant(i,223) * number_density(i,187)

    !  k_BRO_BRO_1: BRO + BRO -> 2*BR + 1*O2
    LU(i,666) = LU(i,666) - rate_constant(i,294) * number_density(i,71)

    !  k_BRO_BRO_1: BRO + BRO -> 2*BR + 1*O2
    LU(i,666) = LU(i,666) - rate_constant(i,294) * number_density(i,71)

    !  k_BRO_BRO_1: BRO + BRO -> 2*BR + 1*O2
    LU(i,666) = LU(i,666) - rate_constant(i,294) * number_density(i,71)
  end do
  !$acc end parallel

end subroutine dforce_dy32

subroutine dforce_dy33(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    !  k_BRO_BRO_1: BRO + BRO -> 2*BR + 1*O2
    LU(i,666) = LU(i,666) - rate_constant(i,294) * number_density(i,71)

    !  k_BRO_HO2_1: BRO + HO2 -> 1*HOBR + 1*O2
    LU(i,666) = LU(i,666) - rate_constant(i,299) * number_density(i,192)

    !  k_BRO_CLO_1: BRO + CLO -> 1*BR + 1*CL + 1*O2
    LU(i,666) = LU(i,666) - rate_constant(i,361) * number_density(i,86)

    !  k_BRO_CLO_2: BRO + CLO -> 1*BRCL + 1*O2
    LU(i,666) = LU(i,666) - rate_constant(i,432) * number_density(i,86)

    !  k_BRO_CLO_3: BRO + CLO -> 1*BR + 1*OCLO
    LU(i,666) = LU(i,666) - rate_constant(i,448) * number_density(i,86)

    ! df_BRONO2/d(BRO)
    !  k_BRO_NO2_1: BRO + NO2 -> 1*BRONO2
    LU(i,667) = LU(i,667) + rate_constant(i,184) * number_density(i,54)

    ! df_CL/d(BRO)
    !  k_BRO_CLO_1: BRO + CLO -> 1*BR + 1*CL + 1*O2
    LU(i,673) = LU(i,673) + rate_constant(i,361) * number_density(i,86)

    ! df_CLO/d(BRO)
    !  k_BRO_CLO_1: BRO + CLO -> 1*BR + 1*CL + 1*O2
    LU(i,671) = LU(i,671) - rate_constant(i,361) * number_density(i,86)

    !  k_BRO_CLO_2: BRO + CLO -> 1*BRCL + 1*O2
    LU(i,671) = LU(i,671) - rate_constant(i,432) * number_density(i,86)

    !  k_BRO_CLO_3: BRO + CLO -> 1*BR + 1*OCLO
    LU(i,671) = LU(i,671) - rate_constant(i,448) * number_density(i,86)

    ! df_HOBR/d(BRO)
    !  k_BRO_HO2_1: BRO + HO2 -> 1*HOBR + 1*O2
    LU(i,710) = LU(i,710) + rate_constant(i,299) * number_density(i,192)

    ! df_O/d(BRO)
    !  k_BRO_1: BRO -> 1*BR + 1*O
    LU(i,711) = LU(i,711) + rate_constant(i,83)

    !  k_BRO_O_1: BRO + O -> 1*BR + 1*O2
    LU(i,711) = LU(i,711) - rate_constant(i,223) * number_density(i,187)

    ! df_OCLO/d(BRO)
    !  k_BRO_CLO_3: BRO + CLO -> 1*BR + 1*OCLO
    LU(i,707) = LU(i,707) + rate_constant(i,448) * number_density(i,86)

    ! df_HO2/d(BRO)
    !  k_BRO_OH_1: BRO + OH -> 1*BR + 1*HO2
    LU(i,716) = LU(i,716) + rate_constant(i,204) * number_density(i,166)

    !  k_BRO_HO2_1: BRO + HO2 -> 1*HOBR + 1*O2
    LU(i,716) = LU(i,716) - rate_constant(i,299) * number_density(i,192)

    ! df_OH/d(BRO)
    !  k_BRO_OH_1: BRO + OH -> 1*BR + 1*HO2
    LU(i,696) = LU(i,696) - rate_constant(i,204) * number_density(i,166)

    ! df_NO2/d(BRONO2)
    !  k_BRONO2_2: BRONO2 -> 1*BRO + 1*NO2
    LU(i,717) = LU(i,717) + rate_constant(i,94)

    ! df_BR/d(BRONO2)
    !  k_BRONO2_1: BRONO2 -> 1*BR + 1*NO3
    LU(i,727) = LU(i,727) + rate_constant(i,56)

    ! df_BRO/d(BRONO2)
    !  k_BRONO2_2: BRONO2 -> 1*BRO + 1*NO2
    LU(i,721) = LU(i,721) + rate_constant(i,94)

    !  k_BRONO2_O_1: BRONO2 + O -> 1*BRO + 1*NO3
    LU(i,721) = LU(i,721) + rate_constant(i,418) * number_density(i,187)

    ! df_BRONO2/d(BRONO2)
    !  k_BRONO2_1: BRONO2 -> 1*BR + 1*NO3
    LU(i,722) = LU(i,722) - rate_constant(i,56)

    !  k_BRONO2_2: BRONO2 -> 1*BRO + 1*NO2
    LU(i,722) = LU(i,722) - rate_constant(i,94)

    !  k_BRONO2_O_1: BRONO2 + O -> 1*BRO + 1*NO3
    LU(i,722) = LU(i,722) - rate_constant(i,418) * number_density(i,187)

    ! df_O/d(BRONO2)
    !  k_BRONO2_O_1: BRONO2 + O -> 1*BRO + 1*NO3
    LU(i,766) = LU(i,766) - rate_constant(i,418) * number_density(i,187)

    ! df_NO3/d(BRONO2)
    !  k_BRONO2_1: BRONO2 -> 1*BR + 1*NO3
    LU(i,750) = LU(i,750) + rate_constant(i,56)

    !  k_BRONO2_O_1: BRONO2 + O -> 1*BRO + 1*NO3
    LU(i,750) = LU(i,750) + rate_constant(i,418) * number_density(i,187)

    ! df_COF2/d(CF2CLBR)
    !  k_CF2CLBR_1: CF2CLBR -> 1*BR + 1*CL + 1*COF2
    LU(i,1758) = LU(i,1758) + rate_constant(i,74)

    !  k_CF2CLBR_O1D_1: CF2CLBR + O1D -> 1*CL + 1*BR + 1*COF2
    LU(i,1758) = LU(i,1758) + rate_constant(i,128) * number_density(i,112)
  end do
  !$acc end parallel

end subroutine dforce_dy33

subroutine dforce_dy34(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! df_BR/d(CF2CLBR)
    !  k_CF2CLBR_1: CF2CLBR -> 1*BR + 1*CL + 1*COF2
    LU(i,1759) = LU(i,1759) + rate_constant(i,74)

    !  k_CF2CLBR_O1D_1: CF2CLBR + O1D -> 1*CL + 1*BR + 1*COF2
    LU(i,1759) = LU(i,1759) + rate_constant(i,128) * number_density(i,112)

    ! df_CF2CLBR/d(CF2CLBR)
    !  k_CF2CLBR_1: CF2CLBR -> 1*BR + 1*CL + 1*COF2
    LU(i,1760) = LU(i,1760) - rate_constant(i,74)

    !  k_CF2CLBR_O1D_1: CF2CLBR + O1D -> 1*CL + 1*BR + 1*COF2
    LU(i,1760) = LU(i,1760) - rate_constant(i,128) * number_density(i,112)

    ! df_CL/d(CF2CLBR)
    !  k_CF2CLBR_1: CF2CLBR -> 1*BR + 1*CL + 1*COF2
    LU(i,1761) = LU(i,1761) + rate_constant(i,74)

    !  k_CF2CLBR_O1D_1: CF2CLBR + O1D -> 1*CL + 1*BR + 1*COF2
    LU(i,1761) = LU(i,1761) + rate_constant(i,128) * number_density(i,112)

    ! df_O1D/d(CF2CLBR)
    !  k_CF2CLBR_O1D_1: CF2CLBR + O1D -> 1*CL + 1*BR + 1*COF2
    LU(i,1764) = LU(i,1764) - rate_constant(i,128) * number_density(i,112)

    ! df_COF2/d(CF3BR)
    !  k_CF3BR_1: CF3BR -> 1*BR + 1*F + 1*COF2
    LU(i,559) = LU(i,559) + rate_constant(i,303)

    !  k_CF3BR_O1D_1: CF3BR + O1D -> 1*BR + 1*F + 1*COF2
    LU(i,559) = LU(i,559) + rate_constant(i,381) * number_density(i,112)

    ! df_F/d(CF3BR)
    !  k_CF3BR_1: CF3BR -> 1*BR + 1*F + 1*COF2
    LU(i,560) = LU(i,560) + rate_constant(i,303)

    !  k_CF3BR_O1D_1: CF3BR + O1D -> 1*BR + 1*F + 1*COF2
    LU(i,560) = LU(i,560) + rate_constant(i,381) * number_density(i,112)

    ! df_BR/d(CF3BR)
    !  k_CF3BR_1: CF3BR -> 1*BR + 1*F + 1*COF2
    LU(i,562) = LU(i,562) + rate_constant(i,303)

    !  k_CF3BR_O1D_1: CF3BR + O1D -> 1*BR + 1*F + 1*COF2
    LU(i,562) = LU(i,562) + rate_constant(i,381) * number_density(i,112)

    ! df_CF3BR/d(CF3BR)
    !  k_CF3BR_1: CF3BR -> 1*BR + 1*F + 1*COF2
    LU(i,561) = LU(i,561) - rate_constant(i,303)

    !  k_CF3BR_O1D_1: CF3BR + O1D -> 1*BR + 1*F + 1*COF2
    LU(i,561) = LU(i,561) - rate_constant(i,381) * number_density(i,112)

    ! df_O1D/d(CF3BR)
    !  k_CF3BR_O1D_1: CF3BR + O1D -> 1*BR + 1*F + 1*COF2
    LU(i,563) = LU(i,563) - rate_constant(i,381) * number_density(i,112)

    ! df_CFC11/d(CFC11)
    !  k_CFC11_1: CFC11 -> 3*CL
    LU(i,564) = LU(i,564) - rate_constant(i,285)

    !  k_CFC11_O1D_1: CFC11 + O1D -> 3*CL
    LU(i,564) = LU(i,564) - rate_constant(i,474) * number_density(i,112)

    ! df_CL/d(CFC11)
    !  k_CFC11_1: CFC11 -> 3*CL
    LU(i,565) = LU(i,565) + 3*rate_constant(i,285)

    !  k_CFC11_O1D_1: CFC11 + O1D -> 3*CL
    LU(i,565) = LU(i,565) + 3*rate_constant(i,474) * number_density(i,112)

    ! df_O1D/d(CFC11)
    !  k_CFC11_O1D_1: CFC11 + O1D -> 3*CL
    LU(i,566) = LU(i,566) - rate_constant(i,474) * number_density(i,112)

    ! df_COF2/d(CFC114)
    !  k_CFC114_O1D_1: CFC114 + O1D -> 2*CL + 2*COF2
    LU(i,567) = LU(i,567) + 2*rate_constant(i,18) * number_density(i,112)

    !  k_CFC114_1: CFC114 -> 2*CL + 2*COF2
    LU(i,567) = LU(i,567) + 2*rate_constant(i,355)

    ! df_CFC114/d(CFC114)
    !  k_CFC114_O1D_1: CFC114 + O1D -> 2*CL + 2*COF2
    LU(i,568) = LU(i,568) - rate_constant(i,18) * number_density(i,112)

    !  k_CFC114_1: CFC114 -> 2*CL + 2*COF2
    LU(i,568) = LU(i,568) - rate_constant(i,355)

    ! df_CL/d(CFC114)
    !  k_CFC114_O1D_1: CFC114 + O1D -> 2*CL + 2*COF2
    LU(i,569) = LU(i,569) + 2*rate_constant(i,18) * number_density(i,112)

    !  k_CFC114_1: CFC114 -> 2*CL + 2*COF2
    LU(i,569) = LU(i,569) + 2*rate_constant(i,355)

    ! df_O1D/d(CFC114)
    !  k_CFC114_O1D_1: CFC114 + O1D -> 2*CL + 2*COF2
    LU(i,570) = LU(i,570) - rate_constant(i,18) * number_density(i,112)

  end do
  !$acc end parallel

end subroutine dforce_dy34

subroutine dforce_dy35(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
