    !  k_CH3BR_CL_1: CH3BR + CL -> 1*HCL + 1*HO2 + 1*BR
    LU(i,1885) = LU(i,1885) - rate_constant(i,396) * number_density(i,94)

    ! df_CHBR3/d(CL)
    !  k_CHBR3_CL_1: CHBR3 + CL -> 3*BR + 1*HCL
    LU(i,1879) = LU(i,1879) - rate_constant(i,462) * number_density(i,84)

    ! df_CL/d(CL)
    !  k_CH4_CL_1: CH4 + CL -> 1*CH3O2 + 1*HCL
    LU(i,1886) = LU(i,1886) - rate_constant(i,23) * number_density(i,45)

    !  k_CH2BR2_CL_1: CH2BR2 + CL -> 2*BR + 1*HCL
    LU(i,1886) = LU(i,1886) - rate_constant(i,27) * number_density(i,169)

    !  k_CL_HOCL_1: CL + HOCL -> 1*HCL + 1*CLO
    LU(i,1886) = LU(i,1886) - rate_constant(i,91) * number_density(i,88)

    !  k_CH3CL_CL_1: CH3CL + CL -> 1*HO2 + 1*CO + 2*HCL
    LU(i,1886) = LU(i,1886) - rate_constant(i,102) * number_density(i,53)

    !  k_CL_O3_1: CL + O3 -> 1*CLO + 1*O2
    LU(i,1886) = LU(i,1886) - rate_constant(i,150) * number_density(i,171)

    !  k_CL_H2_1: CL + H2 -> 1*HCL + 1*H
    LU(i,1886) = LU(i,1886) - rate_constant(i,166) * number_density(i,152)

    !  k_C2H6_CL_1: C2H6 + CL -> 1*HCL + 1*C2H5O2
    LU(i,1886) = LU(i,1886) - rate_constant(i,193) * number_density(i,174)

    !  k_CL_HO2_1: CL + HO2 -> 1*HCL + 1*O2
    LU(i,1886) = LU(i,1886) - rate_constant(i,264) * number_density(i,192)

    !  k_CL_H2O2_1: CL + H2O2 -> 1*HCL + 1*HO2
    LU(i,1886) = LU(i,1886) - rate_constant(i,310) * number_density(i,179)

    !  k_CH3BR_CL_1: CH3BR + CL -> 1*HCL + 1*HO2 + 1*BR
    LU(i,1886) = LU(i,1886) - rate_constant(i,396) * number_density(i,94)

    !  k_CH2O_CL_1: CH2O + CL -> 1*HCL + 1*HO2 + 1*CO
    LU(i,1886) = LU(i,1886) - rate_constant(i,425) * number_density(i,124)

    !  k_CHBR3_CL_1: CHBR3 + CL -> 3*BR + 1*HCL
    LU(i,1886) = LU(i,1886) - rate_constant(i,462) * number_density(i,84)

    !  k_CL_HO2_2: CL + HO2 -> 1*OH + 1*CLO
    LU(i,1886) = LU(i,1886) - rate_constant(i,470) * number_density(i,192)

    !  k_CL_CLONO2_1: CL + CLONO2 -> 1*CL2 + 1*NO3
    LU(i,1886) = LU(i,1886) - rate_constant(i,480) * number_density(i,74)

    ! df_CL2/d(CL)
    !  k_CL_CLONO2_1: CL + CLONO2 -> 1*CL2 + 1*NO3
    LU(i,1873) = LU(i,1873) + rate_constant(i,480) * number_density(i,74)

    ! df_CLO/d(CL)
    !  k_CL_HOCL_1: CL + HOCL -> 1*HCL + 1*CLO
    LU(i,1880) = LU(i,1880) + rate_constant(i,91) * number_density(i,88)

    !  k_CL_O3_1: CL + O3 -> 1*CLO + 1*O2
    LU(i,1880) = LU(i,1880) + rate_constant(i,150) * number_density(i,171)

    !  k_CL_HO2_2: CL + HO2 -> 1*OH + 1*CLO
    LU(i,1880) = LU(i,1880) + rate_constant(i,470) * number_density(i,192)

    ! df_CLONO2/d(CL)
    !  k_CL_CLONO2_1: CL + CLONO2 -> 1*CL2 + 1*NO3
    LU(i,1876) = LU(i,1876) - rate_constant(i,480) * number_density(i,74)

    ! df_HOCL/d(CL)
    !  k_CL_HOCL_1: CL + HOCL -> 1*HCL + 1*CLO
    LU(i,1882) = LU(i,1882) - rate_constant(i,91) * number_density(i,88)

    ! df_C2H4/d(CL)
    !  k_C2H4_CL_1: C2H4 + CL -> 1*CL
    LU(i,1884) = LU(i,1884) - rate_constant(i,188) * number_density(i,93)

    ! df_C2H5O2/d(CL)
    !  k_C2H6_CL_1: C2H6 + CL -> 1*HCL + 1*C2H5O2
    LU(i,1881) = LU(i,1881) + rate_constant(i,193) * number_density(i,174)

    ! df_HCL/d(CL)
    !  k_CH4_CL_1: CH4 + CL -> 1*CH3O2 + 1*HCL
    LU(i,1924) = LU(i,1924) + rate_constant(i,23) * number_density(i,45)

    !  k_CH2BR2_CL_1: CH2BR2 + CL -> 2*BR + 1*HCL
    LU(i,1924) = LU(i,1924) + rate_constant(i,27) * number_density(i,169)

    !  k_CL_HOCL_1: CL + HOCL -> 1*HCL + 1*CLO
    LU(i,1924) = LU(i,1924) + rate_constant(i,91) * number_density(i,88)

    !  k_CH3CL_CL_1: CH3CL + CL -> 1*HO2 + 1*CO + 2*HCL
    LU(i,1924) = LU(i,1924) + 2*rate_constant(i,102) * number_density(i,53)

  end do
  !$acc end parallel

end subroutine dforce_dy37

subroutine dforce_dy38(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell
    !  k_CL_H2_1: CL + H2 -> 1*HCL + 1*H
    LU(i,1924) = LU(i,1924) + rate_constant(i,166) * number_density(i,152)

    !  k_C2H6_CL_1: C2H6 + CL -> 1*HCL + 1*C2H5O2
    LU(i,1924) = LU(i,1924) + rate_constant(i,193) * number_density(i,174)

