    !  k_CH2O_CL_1: CH2O + CL -> 1*HCL + 1*HO2 + 1*CO
    LU(i,1924) = LU(i,1924) + rate_constant(i,425) * number_density(i,124)

    !  k_CHBR3_CL_1: CHBR3 + CL -> 3*BR + 1*HCL
    LU(i,1924) = LU(i,1924) + rate_constant(i,462) * number_density(i,84)

    ! df_CH3O2/d(CL)
    !  k_CH4_CL_1: CH4 + CL -> 1*CH3O2 + 1*HCL
    LU(i,1935) = LU(i,1935) + rate_constant(i,23) * number_density(i,45)

    ! df_H2O2/d(CL)
    !  k_CL_H2O2_1: CL + H2O2 -> 1*HCL + 1*HO2
    LU(i,1923) = LU(i,1923) - rate_constant(i,310) * number_density(i,179)

    ! df_C2H6/d(CL)
    !  k_C2H6_CL_1: C2H6 + CL -> 1*HCL + 1*C2H5O2
    LU(i,1918) = LU(i,1918) - rate_constant(i,193) * number_density(i,174)

    ! df_CH2O/d(CL)
    !  k_CH2O_CL_1: CH2O + CL -> 1*HCL + 1*HO2 + 1*CO
    LU(i,1893) = LU(i,1893) - rate_constant(i,425) * number_density(i,124)

    ! df_C2H2/d(CL)
    !  k_C2H2_CL_1: C2H2 + CL -> 1*CL
    LU(i,1913) = LU(i,1913) - rate_constant(i,450) * number_density(i,168)

    ! df_HO2/d(CL)
    !  k_CH3CL_CL_1: CH3CL + CL -> 1*HO2 + 1*CO + 2*HCL
    LU(i,1936) = LU(i,1936) + rate_constant(i,102) * number_density(i,53)

    !  k_CL_HO2_1: CL + HO2 -> 1*HCL + 1*O2
    LU(i,1936) = LU(i,1936) - rate_constant(i,264) * number_density(i,192)

    !  k_CL_H2O2_1: CL + H2O2 -> 1*HCL + 1*HO2
    LU(i,1936) = LU(i,1936) + rate_constant(i,310) * number_density(i,179)

    !  k_CH3BR_CL_1: CH3BR + CL -> 1*HCL + 1*HO2 + 1*BR
    LU(i,1936) = LU(i,1936) + rate_constant(i,396) * number_density(i,94)

    !  k_CH2O_CL_1: CH2O + CL -> 1*HCL + 1*HO2 + 1*CO
    LU(i,1936) = LU(i,1936) + rate_constant(i,425) * number_density(i,124)

    !  k_CL_HO2_2: CL + HO2 -> 1*OH + 1*CLO
    LU(i,1936) = LU(i,1936) - rate_constant(i,470) * number_density(i,192)

    ! df_H2/d(CL)
    !  k_CL_H2_1: CL + H2 -> 1*HCL + 1*H
    LU(i,1899) = LU(i,1899) - rate_constant(i,166) * number_density(i,152)

    ! df_NO3/d(CL)
    !  k_CL_CLONO2_1: CL + CLONO2 -> 1*CL2 + 1*NO3
    LU(i,1910) = LU(i,1910) + rate_constant(i,480) * number_density(i,74)

    ! df_OH/d(CL)
    !  k_CL_HO2_2: CL + HO2 -> 1*OH + 1*CLO
    LU(i,1911) = LU(i,1911) + rate_constant(i,470) * number_density(i,192)

    ! df_O3/d(CL)
    !  k_CL_O3_1: CL + O3 -> 1*CLO + 1*O2
    LU(i,1916) = LU(i,1916) - rate_constant(i,150) * number_density(i,171)

    ! df_CO/d(CL)
    !  k_CH3CL_CL_1: CH3CL + CL -> 1*HO2 + 1*CO + 2*HCL
    LU(i,1920) = LU(i,1920) + rate_constant(i,102) * number_density(i,53)

    !  k_CH2O_CL_1: CH2O + CL -> 1*HCL + 1*HO2 + 1*CO
    LU(i,1920) = LU(i,1920) + rate_constant(i,425) * number_density(i,124)

    ! df_CL/d(CL2)
    !  k_CL2_1: CL2 -> 2*CL
    LU(i,658) = LU(i,658) + 2*rate_constant(i,219)

    ! df_CL2/d(CL2)
    !  k_CL2_1: CL2 -> 2*CL
    LU(i,657) = LU(i,657) - rate_constant(i,219)

    ! df_CL/d(CL2O2)
    !  k_CL2O2_1: CL2O2 -> 2*CL
    LU(i,656) = LU(i,656) + 2*rate_constant(i,446)

    ! df_CL2O2/d(CL2O2)
    !  k_CL2O2_M_1: CL2O2 + M -> 2*CLO + 1*M
    LU(i,654) = LU(i,654) - rate_constant(i,67) * number_density(i,1)

    !  k_CL2O2_1: CL2O2 -> 2*CL
    LU(i,654) = LU(i,654) - rate_constant(i,446)
  end do
  !$acc end parallel

end subroutine dforce_dy38

subroutine dforce_dy39(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
