    LU(i,1250) = LU(i,1250) + rate_constant(i,103) * number_density(i,86)

    !  k_CLO_CLO_1: CLO + CLO -> 2*CL + 1*O2
    LU(i,1250) = LU(i,1250) + rate_constant(i,103) * number_density(i,86)

    !  k_BRO_CLO_1: BRO + CLO -> 1*BR + 1*CL + 1*O2
    LU(i,1250) = LU(i,1250) + rate_constant(i,361) * number_density(i,71)

    !  k_CLO_HO2_1: CLO + HO2 -> 1*O2 + 1*HOCL
    LU(i,1250) = LU(i,1250) + rate_constant(i,402) * number_density(i,192)

    !  k_BRO_CLO_2: BRO + CLO -> 1*BRCL + 1*O2
    LU(i,1250) = LU(i,1250) + rate_constant(i,432) * number_density(i,71)

    !  k_CLO_CLO_3: CLO + CLO -> 1*CL2 + 1*O2
    LU(i,1250) = LU(i,1250) + rate_constant(i,436) * number_density(i,86)

    !  k_CLO_CLO_3: CLO + CLO -> 1*CL2 + 1*O2
    LU(i,1250) = LU(i,1250) + rate_constant(i,436) * number_density(i,86)

    ! df_SO/d(CLO)
    !  k_CLO_SO_1: CLO + SO -> 1*SO2 + 1*CL
    LU(i,1249) = LU(i,1249) - rate_constant(i,118) * number_density(i,32)

    ! df_SO2/d(CLO)
