    LU(i,1265) = LU(i,1265) + rate_constant(i,361) * number_density(i,71)

    !  k_BRO_CLO_3: BRO + CLO -> 1*BR + 1*OCLO
    LU(i,1265) = LU(i,1265) + rate_constant(i,448) * number_density(i,71)

