    LU(i,1293) = LU(i,1293) + rate_constant(i,432) * number_density(i,71)

    ! df_BRO/d(CLO)
    !  k_BRO_CLO_1: BRO + CLO -> 1*BR + 1*CL + 1*O2
    LU(i,1258) = LU(i,1258) - rate_constant(i,361) * number_density(i,71)

    !  k_BRO_CLO_2: BRO + CLO -> 1*BRCL + 1*O2
    LU(i,1258) = LU(i,1258) - rate_constant(i,432) * number_density(i,71)

    !  k_BRO_CLO_3: BRO + CLO -> 1*BR + 1*OCLO
    LU(i,1258) = LU(i,1258) - rate_constant(i,448) * number_density(i,71)

