    !  k_CLO_NO2_1: CLO + NO2 -> 1*CLONO2
    LU(i,1263) = LU(i,1263) - rate_constant(i,214) * number_density(i,54)

    !  k_CLO_CLO_2: CLO + CLO -> 1*CL2O2
    LU(i,1263) = LU(i,1263) - rate_constant(i,262) * number_density(i,86)

    !  k_CLO_CLO_2: CLO + CLO -> 1*CL2O2
    LU(i,1263) = LU(i,1263) - rate_constant(i,262) * number_density(i,86)

    !  k_CLO_CLO_2: CLO + CLO -> 1*CL2O2
    LU(i,1263) = LU(i,1263) - rate_constant(i,262) * number_density(i,86)

    !  k_CLO_CLO_2: CLO + CLO -> 1*CL2O2
    LU(i,1263) = LU(i,1263) - rate_constant(i,262) * number_density(i,86)

    !  k_CLO_OH_2: CLO + OH -> 1*CL + 1*HO2
    LU(i,1263) = LU(i,1263) - rate_constant(i,305) * number_density(i,166)

    !  k_BRO_CLO_1: BRO + CLO -> 1*BR + 1*CL + 1*O2
    LU(i,1263) = LU(i,1263) - rate_constant(i,361) * number_density(i,71)

    !  k_CLO_1: CLO -> 1*CL + 1*O
    LU(i,1263) = LU(i,1263) - rate_constant(i,380)

    !  k_CLO_HO2_1: CLO + HO2 -> 1*O2 + 1*HOCL
    LU(i,1263) = LU(i,1263) - rate_constant(i,402) * number_density(i,192)

    !  k_BRO_CLO_2: BRO + CLO -> 1*BRCL + 1*O2
    LU(i,1263) = LU(i,1263) - rate_constant(i,432) * number_density(i,71)

    !  k_CLO_CLO_3: CLO + CLO -> 1*CL2 + 1*O2
    LU(i,1263) = LU(i,1263) - rate_constant(i,436) * number_density(i,86)

