    LU(i,1305) = LU(i,1305) - rate_constant(i,21) * number_density(i,187)

    !  k_CLO_1: CLO -> 1*CL + 1*O
    LU(i,1305) = LU(i,1305) + rate_constant(i,380)

    ! df_OCLO/d(CLO)
    !  k_BRO_CLO_3: BRO + CLO -> 1*BR + 1*OCLO
    LU(i,1301) = LU(i,1301) + rate_constant(i,448) * number_density(i,71)

    !  k_CLO_CLO_4: CLO + CLO -> 1*CL + 1*OCLO
    LU(i,1301) = LU(i,1301) + rate_constant(i,468) * number_density(i,86)

    !  k_CLO_CLO_4: CLO + CLO -> 1*CL + 1*OCLO
    LU(i,1301) = LU(i,1301) + rate_constant(i,468) * number_density(i,86)

    ! df_HCL/d(CLO)
    !  k_CLO_OH_1: CLO + OH -> 1*HCL + 1*O2
    LU(i,1298) = LU(i,1298) + rate_constant(i,43) * number_density(i,166)

    ! df_CH3O2/d(CLO)
    !  k_CH3O2_CLO_1: CH3O2 + CLO -> 1*CL + 1*HO2 + 1*CH2O
    LU(i,1309) = LU(i,1309) - rate_constant(i,467) * number_density(i,191)

    ! df_CH2O/d(CLO)
    !  k_CH3O2_CLO_1: CH3O2 + CLO -> 1*CL + 1*HO2 + 1*CH2O
    LU(i,1273) = LU(i,1273) + rate_constant(i,467) * number_density(i,191)

    ! df_HO2/d(CLO)
    !  k_CLO_OH_2: CLO + OH -> 1*CL + 1*HO2
    LU(i,1310) = LU(i,1310) + rate_constant(i,305) * number_density(i,166)

    !  k_CLO_HO2_1: CLO + HO2 -> 1*O2 + 1*HOCL
    LU(i,1310) = LU(i,1310) - rate_constant(i,402) * number_density(i,192)

    !  k_CH3O2_CLO_1: CH3O2 + CLO -> 1*CL + 1*HO2 + 1*CH2O
    LU(i,1310) = LU(i,1310) + rate_constant(i,467) * number_density(i,191)

    ! df_OH/d(CLO)
    !  k_CLO_OH_1: CLO + OH -> 1*HCL + 1*O2
    LU(i,1289) = LU(i,1289) - rate_constant(i,43) * number_density(i,166)

    !  k_CLO_OH_2: CLO + OH -> 1*CL + 1*HO2
    LU(i,1289) = LU(i,1289) - rate_constant(i,305) * number_density(i,166)

    ! df_NO2/d(CLONO2)
    !  k_CLONO2_2: CLONO2 -> 1*CLO + 1*NO2
    LU(i,831) = LU(i,831) + rate_constant(i,406)

    ! df_CL/d(CLONO2)
