    ! df_CL2/d(CLONO2)
    !  k_CL_CLONO2_1: CL + CLONO2 -> 1*CL2 + 1*NO3
    LU(i,835) = LU(i,835) + rate_constant(i,480) * number_density(i,100)

    ! df_CLO/d(CLONO2)
    !  k_CLONO2_2: CLONO2 -> 1*CLO + 1*NO2
    LU(i,841) = LU(i,841) + rate_constant(i,406)

    !  k_CLONO2_O_1: CLONO2 + O -> 1*CLO + 1*NO3
    LU(i,841) = LU(i,841) + rate_constant(i,463) * number_density(i,187)

    ! df_CLONO2/d(CLONO2)
