  end do
  !$acc end parallel

end subroutine dforce_dy41

subroutine dforce_dy42(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! df_NO3/d(CLONO2)
    !  k_CLONO2_1: CLONO2 -> 1*CL + 1*NO3
    LU(i,866) = LU(i,866) + rate_constant(i,290)

    !  k_CLONO2_OH_1: CLONO2 + OH -> 1*HOCL + 1*NO3
    LU(i,866) = LU(i,866) + rate_constant(i,334) * number_density(i,166)

    !  k_CLONO2_O_1: CLONO2 + O -> 1*CLO + 1*NO3
    LU(i,866) = LU(i,866) + rate_constant(i,463) * number_density(i,187)

    !  k_CL_CLONO2_1: CL + CLONO2 -> 1*CL2 + 1*NO3
    LU(i,866) = LU(i,866) + rate_constant(i,480) * number_density(i,100)

    ! df_OH/d(CLONO2)
    !  k_CLONO2_OH_1: CLONO2 + OH -> 1*HOCL + 1*NO3
    LU(i,867) = LU(i,867) - rate_constant(i,334) * number_density(i,166)

    ! df_CO2/d(CO2)
    !  k_CO2_1: CO2 -> 1*CO + 1*O
    LU(i,1124) = LU(i,1124) - rate_constant(i,274)

    ! df_O/d(CO2)
    !  k_CO2_1: CO2 -> 1*CO + 1*O
    LU(i,1126) = LU(i,1126) + rate_constant(i,274)

    ! df_CO/d(CO2)
    !  k_CO2_1: CO2 -> 1*CO + 1*O
    LU(i,1125) = LU(i,1125) + rate_constant(i,274)

    ! df_H2O/d(HCOOH)
    !  k_HCOOH_OH_1: HCOOH + OH -> 1*HO2 + 1*CO2 + 1*H2O
    LU(i,2976) = LU(i,2976) + rate_constant(i,296) * number_density(i,166)

    ! df_CO2/d(HCOOH)
    !  k_HCOOH_OH_1: HCOOH + OH -> 1*HO2 + 1*CO2 + 1*H2O
    LU(i,2981) = LU(i,2981) + rate_constant(i,296) * number_density(i,166)

    ! df_HCOOH/d(HCOOH)
    !  k_HCOOH_OH_1: HCOOH + OH -> 1*HO2 + 1*CO2 + 1*H2O
    LU(i,2989) = LU(i,2989) - rate_constant(i,296) * number_density(i,166)

    ! df_HO2/d(HCOOH)
    !  k_HCOOH_OH_1: HCOOH + OH -> 1*HO2 + 1*CO2 + 1*H2O
    LU(i,3036) = LU(i,3036) + rate_constant(i,296) * number_density(i,166)

    ! df_OH/d(HCOOH)
    !  k_HCOOH_OH_1: HCOOH + OH -> 1*HO2 + 1*CO2 + 1*H2O
    LU(i,3010) = LU(i,3010) - rate_constant(i,296) * number_density(i,166)

    ! df_COF2/d(H2402)
    !  k_H2402_O1D_1: H2402 + O1D -> 2*BR + 2*COF2
    LU(i,588) = LU(i,588) + 2*rate_constant(i,347) * number_density(i,112)

    !  k_H2402_1: H2402 -> 2*BR + 2*COF2
    LU(i,588) = LU(i,588) + 2*rate_constant(i,441)

    ! df_BR/d(H2402)
    !  k_H2402_O1D_1: H2402 + O1D -> 2*BR + 2*COF2
    LU(i,590) = LU(i,590) + 2*rate_constant(i,347) * number_density(i,112)

    !  k_H2402_1: H2402 -> 2*BR + 2*COF2
    LU(i,590) = LU(i,590) + 2*rate_constant(i,441)

    ! df_H2402/d(H2402)
    !  k_H2402_O1D_1: H2402 + O1D -> 2*BR + 2*COF2
    LU(i,589) = LU(i,589) - rate_constant(i,347) * number_density(i,112)

    !  k_H2402_1: H2402 -> 2*BR + 2*COF2
    LU(i,589) = LU(i,589) - rate_constant(i,441)

    ! df_O1D/d(H2402)
    !  k_H2402_O1D_1: H2402 + O1D -> 2*BR + 2*COF2
    LU(i,591) = LU(i,591) - rate_constant(i,347) * number_density(i,112)

    ! df_COFCL/d(HCFC141B)
    !  k_HCFC141B_O1D_1: HCFC141B + O1D -> 1*CL + 1*COFCL
    LU(i,2228) = LU(i,2228) + rate_constant(i,137) * number_density(i,112)

    !  k_HCFC141B_OH_1: HCFC141B + OH -> 1*CL + 1*COFCL
    LU(i,2228) = LU(i,2228) + rate_constant(i,360) * number_density(i,166)

    ! df_CL/d(HCFC141B)
    !  k_HCFC141B_O1D_1: HCFC141B + O1D -> 1*CL + 1*COFCL
    LU(i,2229) = LU(i,2229) + rate_constant(i,137) * number_density(i,112)

    !  k_HCFC141B_1: HCFC141B -> 2*CL
    LU(i,2229) = LU(i,2229) + 2*rate_constant(i,200)

    !  k_HCFC141B_OH_1: HCFC141B + OH -> 1*CL + 1*COFCL
    LU(i,2229) = LU(i,2229) + rate_constant(i,360) * number_density(i,166)

    ! df_HCFC141B/d(HCFC141B)
    !  k_HCFC141B_O1D_1: HCFC141B + O1D -> 1*CL + 1*COFCL
    LU(i,2230) = LU(i,2230) - rate_constant(i,137) * number_density(i,112)

    !  k_HCFC141B_1: HCFC141B -> 2*CL
    LU(i,2230) = LU(i,2230) - rate_constant(i,200)

    !  k_HCFC141B_OH_1: HCFC141B + OH -> 1*CL + 1*COFCL
    LU(i,2230) = LU(i,2230) - rate_constant(i,360) * number_density(i,166)
  end do
  !$acc end parallel

end subroutine dforce_dy42

subroutine dforce_dy43(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
