    ! df_CL/d(HCFC22)
    !  k_HCFC22_O1D_1: HCFC22 + O1D -> 1*CL + 1*COF2
    LU(i,1138) = LU(i,1138) + rate_constant(i,64) * number_density(i,112)

    !  k_HCFC22_1: HCFC22 -> 1*CL + 1*COF2
    LU(i,1138) = LU(i,1138) + rate_constant(i,163)

    !  k_HCFC22_OH_1: HCFC22 + OH -> 1*H2O + 1*CL + 1*COF2
    LU(i,1138) = LU(i,1138) + rate_constant(i,238) * number_density(i,166)

    ! df_HCFC22/d(HCFC22)
    !  k_HCFC22_O1D_1: HCFC22 + O1D -> 1*CL + 1*COF2
    LU(i,1134) = LU(i,1134) - rate_constant(i,64) * number_density(i,112)

    !  k_HCFC22_1: HCFC22 -> 1*CL + 1*COF2
    LU(i,1134) = LU(i,1134) - rate_constant(i,163)

    !  k_HCFC22_OH_1: HCFC22 + OH -> 1*H2O + 1*CL + 1*COF2
