    ! df_O1D/d(HCFC22)
    !  k_HCFC22_O1D_1: HCFC22 + O1D -> 1*CL + 1*COF2
    LU(i,1141) = LU(i,1141) - rate_constant(i,64) * number_density(i,112)

    ! df_OH/d(HCFC22)
    !  k_HCFC22_OH_1: HCFC22 + OH -> 1*H2O + 1*CL + 1*COF2
    LU(i,1161) = LU(i,1161) - rate_constant(i,238) * number_density(i,166)

    ! df_BR/d(HOBR)
    !  k_HOBR_1: HOBR -> 1*BR + 1*OH
    LU(i,7742) = LU(i,7742) + rate_constant(i,186)

    ! df_BRO/d(HOBR)
