    LU(i,7798) = LU(i,7798) - rate_constant(i,186)

    !  k_HOBR_O_1: HOBR + O -> 1*BRO + 1*OH
    LU(i,7798) = LU(i,7798) - rate_constant(i,447) * number_density(i,187)

    ! df_O/d(HOBR)
    !  k_HOBR_O_1: HOBR + O -> 1*BRO + 1*OH
    LU(i,7799) = LU(i,7799) - rate_constant(i,447) * number_density(i,187)

    ! df_OH/d(HOBR)
    !  k_HOBR_1: HOBR -> 1*BR + 1*OH
    LU(i,7778) = LU(i,7778) + rate_constant(i,186)

    !  k_HOBR_O_1: HOBR + O -> 1*BRO + 1*OH
    LU(i,7778) = LU(i,7778) + rate_constant(i,447) * number_density(i,187)

    ! df_H2O/d(HOCL)
    !  k_HOCL_OH_1: HOCL + OH -> 1*H2O + 1*CLO
    LU(i,1373) = LU(i,1373) + rate_constant(i,30) * number_density(i,166)

    ! df_CL/d(HOCL)
    !  k_CL_HOCL_1: CL + HOCL -> 1*HCL + 1*CLO
    LU(i,1382) = LU(i,1382) - rate_constant(i,91) * number_density(i,100)

    !  k_HOCL_1: HOCL -> 1*OH + 1*CL
    LU(i,1382) = LU(i,1382) + rate_constant(i,363)

    ! df_CLO/d(HOCL)
    !  k_HOCL_OH_1: HOCL + OH -> 1*H2O + 1*CLO
    LU(i,1379) = LU(i,1379) + rate_constant(i,30) * number_density(i,166)

    !  k_CL_HOCL_1: CL + HOCL -> 1*HCL + 1*CLO
    LU(i,1379) = LU(i,1379) + rate_constant(i,91) * number_density(i,100)

    !  k_HOCL_O_1: HOCL + O -> 1*CLO + 1*OH
    LU(i,1379) = LU(i,1379) + rate_constant(i,244) * number_density(i,187)

    ! df_HOCL/d(HOCL)
