    LU(i,1380) = LU(i,1380) - rate_constant(i,30) * number_density(i,166)
  end do
  !$acc end parallel

end subroutine dforce_dy44

subroutine dforce_dy45(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    !  k_CL_HOCL_1: CL + HOCL -> 1*HCL + 1*CLO
    LU(i,1380) = LU(i,1380) - rate_constant(i,91) * number_density(i,100)

    !  k_HOCL_O_1: HOCL + O -> 1*CLO + 1*OH
    LU(i,1380) = LU(i,1380) - rate_constant(i,244) * number_density(i,187)

    !  k_HOCL_1: HOCL -> 1*OH + 1*CL
    LU(i,1380) = LU(i,1380) - rate_constant(i,363)

    ! df_O/d(HOCL)
    !  k_HOCL_O_1: HOCL + O -> 1*CLO + 1*OH
    LU(i,1421) = LU(i,1421) - rate_constant(i,244) * number_density(i,187)

    ! df_HCL/d(HOCL)
    !  k_CL_HOCL_1: CL + HOCL -> 1*HCL + 1*CLO
    LU(i,1414) = LU(i,1414) + rate_constant(i,91) * number_density(i,100)

    ! df_OH/d(HOCL)
    !  k_HOCL_OH_1: HOCL + OH -> 1*H2O + 1*CLO
    LU(i,1405) = LU(i,1405) - rate_constant(i,30) * number_density(i,166)

    !  k_HOCL_O_1: HOCL + O -> 1*CLO + 1*OH
    LU(i,1405) = LU(i,1405) + rate_constant(i,244) * number_density(i,187)

    !  k_HOCL_1: HOCL -> 1*OH + 1*CL
    LU(i,1405) = LU(i,1405) + rate_constant(i,363)

    ! df_O2/d(N)
    !  k_N_NO2_1: N + NO2 -> 1*N2 + 1*O2
    LU(i,7659) = LU(i,7659) + rate_constant(i,8) * number_density(i,54)

    !  k_N_O2_1: N + O2 -> 1*NO + 1*O
    LU(i,7659) = LU(i,7659) - rate_constant(i,117) * number_density(i,41)

    ! df_N2/d(N)
    !  k_N_NO2_1: N + NO2 -> 1*N2 + 1*O2
    LU(i,7658) = LU(i,7658) + rate_constant(i,8) * number_density(i,54)

    !  k_N_NO_1: N + NO -> 1*N2 + 1*O
    LU(i,7658) = LU(i,7658) + rate_constant(i,408) * number_density(i,137)

    ! df_H/d(N)
    !  k_N_OH_1: N + OH -> 1*NO + 1*H
    LU(i,7660) = LU(i,7660) + rate_constant(i,250) * number_density(i,166)

    ! df_NO2/d(N)
    !  k_N_NO2_1: N + NO2 -> 1*N2 + 1*O2
    LU(i,7661) = LU(i,7661) - rate_constant(i,8) * number_density(i,54)

    !  k_N_NO2_2: N + NO2 -> 2*NO
    LU(i,7661) = LU(i,7661) - rate_constant(i,154) * number_density(i,54)

    !  k_N_NO2_3: N + NO2 -> 1*N2O + 1*O
    LU(i,7661) = LU(i,7661) - rate_constant(i,273) * number_density(i,54)

    ! df_NO/d(N)
    !  k_N_O2_1: N + O2 -> 1*NO + 1*O
    LU(i,7683) = LU(i,7683) + rate_constant(i,117) * number_density(i,41)

    !  k_N_NO2_2: N + NO2 -> 2*NO
    LU(i,7683) = LU(i,7683) + 2*rate_constant(i,154) * number_density(i,54)

    !  k_N_OH_1: N + OH -> 1*NO + 1*H
    LU(i,7683) = LU(i,7683) + rate_constant(i,250) * number_density(i,166)

    !  k_N_NO_1: N + NO -> 1*N2 + 1*O
    LU(i,7683) = LU(i,7683) - rate_constant(i,408) * number_density(i,137)

    ! df_N/d(N)
    !  k_N_NO2_1: N + NO2 -> 1*N2 + 1*O2
    LU(i,7727) = LU(i,7727) - rate_constant(i,8) * number_density(i,54)

    !  k_N_O2_1: N + O2 -> 1*NO + 1*O
    LU(i,7727) = LU(i,7727) - rate_constant(i,117) * number_density(i,41)

    !  k_N_NO2_2: N + NO2 -> 2*NO
    LU(i,7727) = LU(i,7727) - rate_constant(i,154) * number_density(i,54)

    !  k_N_OH_1: N + OH -> 1*NO + 1*H
    LU(i,7727) = LU(i,7727) - rate_constant(i,250) * number_density(i,166)

    !  k_N_NO2_3: N + NO2 -> 1*N2O + 1*O
    LU(i,7727) = LU(i,7727) - rate_constant(i,273) * number_density(i,54)

    !  k_N_NO_1: N + NO -> 1*N2 + 1*O
    LU(i,7727) = LU(i,7727) - rate_constant(i,408) * number_density(i,137)

    ! df_O/d(N)
    !  k_N_O2_1: N + O2 -> 1*NO + 1*O
    LU(i,7729) = LU(i,7729) + rate_constant(i,117) * number_density(i,41)

    !  k_N_NO2_3: N + NO2 -> 1*N2O + 1*O
    LU(i,7729) = LU(i,7729) + rate_constant(i,273) * number_density(i,54)

    !  k_N_NO_1: N + NO -> 1*N2 + 1*O
    LU(i,7729) = LU(i,7729) + rate_constant(i,408) * number_density(i,137)

    ! df_N2O/d(N)
    !  k_N_NO2_3: N + NO2 -> 1*N2O + 1*O
    LU(i,7703) = LU(i,7703) + rate_constant(i,273) * number_density(i,54)
  end do
  !$acc end parallel

end subroutine dforce_dy45

subroutine dforce_dy46(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! df_OH/d(N)
    !  k_N_OH_1: N + OH -> 1*NO + 1*H
    LU(i,7708) = LU(i,7708) - rate_constant(i,250) * number_density(i,166)

    ! df_NO2/d(BIGENE)
    !  k_BIGENE_NO3_1: BIGENE + NO3 -> 1*NO2 + 1*CH3CHO + 0.5*CH2O + 0.5*CH3COCH3
    LU(i,1697) = LU(i,1697) + rate_constant(i,387) * number_density(i,165)

    ! df_BIGENE/d(BIGENE)
    !  k_BIGENE_NO3_1: BIGENE + NO3 -> 1*NO2 + 1*CH3CHO + 0.5*CH2O + 0.5*CH3COCH3
    LU(i,1710) = LU(i,1710) - rate_constant(i,387) * number_density(i,165)

    !  k_BIGENE_OH_1: BIGENE + OH -> 1*ENEO2
    LU(i,1710) = LU(i,1710) - rate_constant(i,475) * number_density(i,166)

    ! df_CH3COCH3/d(BIGENE)
    !  k_BIGENE_NO3_1: BIGENE + NO3 -> 1*NO2 + 1*CH3CHO + 0.5*CH2O + 0.5*CH3COCH3
    LU(i,1708) = LU(i,1708) + 0.5*rate_constant(i,387) * number_density(i,165)

    ! df_CH2O/d(BIGENE)
    !  k_BIGENE_NO3_1: BIGENE + NO3 -> 1*NO2 + 1*CH3CHO + 0.5*CH2O + 0.5*CH3COCH3
    LU(i,1719) = LU(i,1719) + 0.5*rate_constant(i,387) * number_density(i,165)

    ! df_ENEO2/d(BIGENE)
    !  k_BIGENE_OH_1: BIGENE + OH -> 1*ENEO2
    LU(i,1721) = LU(i,1721) + rate_constant(i,475) * number_density(i,166)

    ! df_NO3/d(BIGENE)
    !  k_BIGENE_NO3_1: BIGENE + NO3 -> 1*NO2 + 1*CH3CHO + 0.5*CH2O + 0.5*CH3COCH3
    LU(i,1735) = LU(i,1735) - rate_constant(i,387) * number_density(i,165)

    ! df_OH/d(BIGENE)
    !  k_BIGENE_OH_1: BIGENE + OH -> 1*ENEO2
    LU(i,1736) = LU(i,1736) - rate_constant(i,475) * number_density(i,166)

    ! df_CH3CHO/d(BIGENE)
    !  k_BIGENE_NO3_1: BIGENE + NO3 -> 1*NO2 + 1*CH3CHO + 0.5*CH2O + 0.5*CH3COCH3
    LU(i,1743) = LU(i,1743) + rate_constant(i,387) * number_density(i,165)

    ! df_HCOOH/d(C2H4)
    !  k_C2H4_O3_1: C2H4 + O3 -> 0.63*CO + 0.13*OH + 0.13*HO2 + 0.37*HCOOH + 1*CH2O
    LU(i,1620) = LU(i,1620) + 0.37*rate_constant(i,323) * number_density(i,171)

    ! df_C2H4/d(C2H4)
    !  k_C2H4_CL_1: C2H4 + CL -> 1*CL
    LU(i,1619) = LU(i,1619) - rate_constant(i,188) * number_density(i,100)

    !  k_C2H4_OH_1: C2H4 + OH -> 1*EO2
    LU(i,1619) = LU(i,1619) - rate_constant(i,319) * number_density(i,166)

    !  k_C2H4_O3_1: C2H4 + O3 -> 0.63*CO + 0.13*OH + 0.13*HO2 + 0.37*HCOOH + 1*CH2O
    LU(i,1619) = LU(i,1619) - rate_constant(i,323) * number_density(i,171)

    ! df_CH2O/d(C2H4)
    !  k_C2H4_O3_1: C2H4 + O3 -> 0.63*CO + 0.13*OH + 0.13*HO2 + 0.37*HCOOH + 1*CH2O
    LU(i,1621) = LU(i,1621) + rate_constant(i,323) * number_density(i,171)

    ! df_EO2/d(C2H4)
    !  k_C2H4_OH_1: C2H4 + OH -> 1*EO2
    LU(i,1622) = LU(i,1622) + rate_constant(i,319) * number_density(i,166)

    ! df_HO2/d(C2H4)
    !  k_C2H4_O3_1: C2H4 + O3 -> 0.63*CO + 0.13*OH + 0.13*HO2 + 0.37*HCOOH + 1*CH2O
    LU(i,1626) = LU(i,1626) + 0.13*rate_constant(i,323) * number_density(i,171)

    ! df_OH/d(C2H4)
    !  k_C2H4_OH_1: C2H4 + OH -> 1*EO2
    LU(i,1623) = LU(i,1623) - rate_constant(i,319) * number_density(i,166)

    !  k_C2H4_O3_1: C2H4 + O3 -> 0.63*CO + 0.13*OH + 0.13*HO2 + 0.37*HCOOH + 1*CH2O
    LU(i,1623) = LU(i,1623) + 0.13*rate_constant(i,323) * number_density(i,171)

    ! df_O3/d(C2H4)
    !  k_C2H4_O3_1: C2H4 + O3 -> 0.63*CO + 0.13*OH + 0.13*HO2 + 0.37*HCOOH + 1*CH2O
    LU(i,1624) = LU(i,1624) - rate_constant(i,323) * number_density(i,171)

    ! df_CO/d(C2H4)
    !  k_C2H4_O3_1: C2H4 + O3 -> 0.63*CO + 0.13*OH + 0.13*HO2 + 0.37*HCOOH + 1*CH2O
    LU(i,1625) = LU(i,1625) + 0.63*rate_constant(i,323) * number_density(i,171)

    ! df_O2/d(C2H5O2)
    !  k_C2H5O2_HO2_1: C2H5O2 + HO2 -> 1*C2H5OOH + 1*O2
    LU(i,1311) = LU(i,1311) + rate_constant(i,343) * number_density(i,192)

    ! df_NO2/d(C2H5O2)
    !  k_C2H5O2_NO_1: C2H5O2 + NO -> 1*CH3CHO + 1*HO2 + 1*NO2
    LU(i,1313) = LU(i,1313) + rate_constant(i,270) * number_density(i,137)

    ! df_NO/d(C2H5O2)
