    LU(i,1336) = LU(i,1336) - rate_constant(i,270) * number_density(i,137)

    ! df_C2H5O2/d(C2H5O2)
    !  k_C2H5O2_C2H5O2_1: C2H5O2 + C2H5O2 -> 1.6*CH3CHO + 1.2*HO2 + 0.4*C2H5OH
    LU(i,1323) = LU(i,1323) - rate_constant(i,248) * number_density(i,87)

    !  k_C2H5O2_C2H5O2_1: C2H5O2 + C2H5O2 -> 1.6*CH3CHO + 1.2*HO2 + 0.4*C2H5OH
    LU(i,1323) = LU(i,1323) - rate_constant(i,248) * number_density(i,87)

    !  k_C2H5O2_C2H5O2_1: C2H5O2 + C2H5O2 -> 1.6*CH3CHO + 1.2*HO2 + 0.4*C2H5OH
    LU(i,1323) = LU(i,1323) - rate_constant(i,248) * number_density(i,87)
  end do
  !$acc end parallel

end subroutine dforce_dy46

subroutine dforce_dy47(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    !  k_C2H5O2_C2H5O2_1: C2H5O2 + C2H5O2 -> 1.6*CH3CHO + 1.2*HO2 + 0.4*C2H5OH
    LU(i,1323) = LU(i,1323) - rate_constant(i,248) * number_density(i,87)

    !  k_C2H5O2_NO_1: C2H5O2 + NO -> 1*CH3CHO + 1*HO2 + 1*NO2
    LU(i,1323) = LU(i,1323) - rate_constant(i,270) * number_density(i,137)

    !  k_C2H5O2_CH3O2_1: C2H5O2 + CH3O2 -> 0.7*CH2O + 0.8*CH3CHO + 1*HO2 + 0.3*CH3OH + 0.2*C2H5OH
    LU(i,1323) = LU(i,1323) - rate_constant(i,277) * number_density(i,191)

    !  k_C2H5O2_HO2_1: C2H5O2 + HO2 -> 1*C2H5OOH + 1*O2
    LU(i,1323) = LU(i,1323) - rate_constant(i,343) * number_density(i,192)

    ! df_C2H5OH/d(C2H5O2)
    !  k_C2H5O2_C2H5O2_1: C2H5O2 + C2H5O2 -> 1.6*CH3CHO + 1.2*HO2 + 0.4*C2H5OH
    LU(i,1334) = LU(i,1334) + 0.4*rate_constant(i,248) * number_density(i,87)

    !  k_C2H5O2_C2H5O2_1: C2H5O2 + C2H5O2 -> 1.6*CH3CHO + 1.2*HO2 + 0.4*C2H5OH
    LU(i,1334) = LU(i,1334) + 0.4*rate_constant(i,248) * number_density(i,87)

    !  k_C2H5O2_CH3O2_1: C2H5O2 + CH3O2 -> 0.7*CH2O + 0.8*CH3CHO + 1*HO2 + 0.3*CH3OH + 0.2*C2H5OH
    LU(i,1334) = LU(i,1334) + 0.2*rate_constant(i,277) * number_density(i,191)

    ! df_CH3O2/d(C2H5O2)
    !  k_C2H5O2_CH3O2_1: C2H5O2 + CH3O2 -> 0.7*CH2O + 0.8*CH3CHO + 1*HO2 + 0.3*CH3OH + 0.2*C2H5OH
    LU(i,1371) = LU(i,1371) - rate_constant(i,277) * number_density(i,191)

    ! df_C2H5OOH/d(C2H5O2)
    !  k_C2H5O2_HO2_1: C2H5O2 + HO2 -> 1*C2H5OOH + 1*O2
    LU(i,1355) = LU(i,1355) + rate_constant(i,343) * number_density(i,192)

    ! df_CH2O/d(C2H5O2)
    !  k_C2H5O2_CH3O2_1: C2H5O2 + CH3O2 -> 0.7*CH2O + 0.8*CH3CHO + 1*HO2 + 0.3*CH3OH + 0.2*C2H5OH
    LU(i,1333) = LU(i,1333) + 0.7*rate_constant(i,277) * number_density(i,191)

    ! df_CH3OH/d(C2H5O2)
    !  k_C2H5O2_CH3O2_1: C2H5O2 + CH3O2 -> 0.7*CH2O + 0.8*CH3CHO + 1*HO2 + 0.3*CH3OH + 0.2*C2H5OH
    LU(i,1332) = LU(i,1332) + 0.3*rate_constant(i,277) * number_density(i,191)

    ! df_HO2/d(C2H5O2)
    !  k_C2H5O2_C2H5O2_1: C2H5O2 + C2H5O2 -> 1.6*CH3CHO + 1.2*HO2 + 0.4*C2H5OH
    LU(i,1372) = LU(i,1372) + 1.2*rate_constant(i,248) * number_density(i,87)

    !  k_C2H5O2_C2H5O2_1: C2H5O2 + C2H5O2 -> 1.6*CH3CHO + 1.2*HO2 + 0.4*C2H5OH
    LU(i,1372) = LU(i,1372) + 1.2*rate_constant(i,248) * number_density(i,87)

    !  k_C2H5O2_NO_1: C2H5O2 + NO -> 1*CH3CHO + 1*HO2 + 1*NO2
    LU(i,1372) = LU(i,1372) + rate_constant(i,270) * number_density(i,137)

    !  k_C2H5O2_CH3O2_1: C2H5O2 + CH3O2 -> 0.7*CH2O + 0.8*CH3CHO + 1*HO2 + 0.3*CH3OH + 0.2*C2H5OH
    LU(i,1372) = LU(i,1372) + rate_constant(i,277) * number_density(i,191)

    !  k_C2H5O2_HO2_1: C2H5O2 + HO2 -> 1*C2H5OOH + 1*O2
    LU(i,1372) = LU(i,1372) - rate_constant(i,343) * number_density(i,192)

    ! df_CH3CHO/d(C2H5O2)
    !  k_C2H5O2_C2H5O2_1: C2H5O2 + C2H5O2 -> 1.6*CH3CHO + 1.2*HO2 + 0.4*C2H5OH
    LU(i,1358) = LU(i,1358) + 1.6*rate_constant(i,248) * number_density(i,87)

    !  k_C2H5O2_C2H5O2_1: C2H5O2 + C2H5O2 -> 1.6*CH3CHO + 1.2*HO2 + 0.4*C2H5OH
    LU(i,1358) = LU(i,1358) + 1.6*rate_constant(i,248) * number_density(i,87)

    !  k_C2H5O2_NO_1: C2H5O2 + NO -> 1*CH3CHO + 1*HO2 + 1*NO2
    LU(i,1358) = LU(i,1358) + rate_constant(i,270) * number_density(i,137)

    !  k_C2H5O2_CH3O2_1: C2H5O2 + CH3O2 -> 0.7*CH2O + 0.8*CH3CHO + 1*HO2 + 0.3*CH3OH + 0.2*C2H5OH
    LU(i,1358) = LU(i,1358) + 0.8*rate_constant(i,277) * number_density(i,191)

    ! df_HNO3/d(CH3COCHO)
    !  k_CH3COCHO_NO3_1: CH3COCHO + NO3 -> 1*HNO3 + 1*CO + 1*CH3CO3
    LU(i,2484) = LU(i,2484) + rate_constant(i,405) * number_density(i,165)

    ! df_CH3CO3/d(CH3COCHO)
    !  k_CH3COCHO_1: CH3COCHO -> 1*CH3CO3 + 1*CO + 1*HO2
    LU(i,2485) = LU(i,2485) + rate_constant(i,17)

    !  k_CH3COCHO_OH_1: CH3COCHO + OH -> 1*CH3CO3 + 1*CO + 1*H2O
    LU(i,2485) = LU(i,2485) + rate_constant(i,122) * number_density(i,166)

    !  k_CH3COCHO_NO3_1: CH3COCHO + NO3 -> 1*HNO3 + 1*CO + 1*CH3CO3
    LU(i,2485) = LU(i,2485) + rate_constant(i,405) * number_density(i,165)

    ! df_H2O/d(CH3COCHO)
    !  k_CH3COCHO_OH_1: CH3COCHO + OH -> 1*CH3CO3 + 1*CO + 1*H2O
    LU(i,2489) = LU(i,2489) + rate_constant(i,122) * number_density(i,166)

    ! df_CH3COCHO/d(CH3COCHO)
    !  k_CH3COCHO_1: CH3COCHO -> 1*CH3CO3 + 1*CO + 1*HO2
    LU(i,2500) = LU(i,2500) - rate_constant(i,17)

    !  k_CH3COCHO_OH_1: CH3COCHO + OH -> 1*CH3CO3 + 1*CO + 1*H2O
    LU(i,2500) = LU(i,2500) - rate_constant(i,122) * number_density(i,166)

    !  k_CH3COCHO_NO3_1: CH3COCHO + NO3 -> 1*HNO3 + 1*CO + 1*CH3CO3
    LU(i,2500) = LU(i,2500) - rate_constant(i,405) * number_density(i,165)

    ! df_HO2/d(CH3COCHO)
    !  k_CH3COCHO_1: CH3COCHO -> 1*CH3CO3 + 1*CO + 1*HO2
    LU(i,2548) = LU(i,2548) + rate_constant(i,17)

    ! df_NO3/d(CH3COCHO)
    !  k_CH3COCHO_NO3_1: CH3COCHO + NO3 -> 1*HNO3 + 1*CO + 1*CH3CO3
    LU(i,2522) = LU(i,2522) - rate_constant(i,405) * number_density(i,165)
  end do
  !$acc end parallel

end subroutine dforce_dy47

subroutine dforce_dy48(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! df_OH/d(CH3COCHO)
    !  k_CH3COCHO_OH_1: CH3COCHO + OH -> 1*CH3CO3 + 1*CO + 1*H2O
    LU(i,2523) = LU(i,2523) - rate_constant(i,122) * number_density(i,166)

    ! df_CO/d(CH3COCHO)
    !  k_CH3COCHO_1: CH3COCHO -> 1*CH3CO3 + 1*CO + 1*HO2
    LU(i,2532) = LU(i,2532) + rate_constant(i,17)

    !  k_CH3COCHO_OH_1: CH3COCHO + OH -> 1*CH3CO3 + 1*CO + 1*H2O
    LU(i,2532) = LU(i,2532) + rate_constant(i,122) * number_density(i,166)

    !  k_CH3COCHO_NO3_1: CH3COCHO + NO3 -> 1*HNO3 + 1*CO + 1*CH3CO3
    LU(i,2532) = LU(i,2532) + rate_constant(i,405) * number_density(i,165)

    ! df_RO2/d(CH3COCH3)
    !  k_CH3COCH3_OH_1: CH3COCH3 + OH -> 1*RO2 + 1*H2O
    LU(i,1427) = LU(i,1427) + rate_constant(i,68) * number_density(i,166)

    !  k_CH3COCH3_OH_2: CH3COCH3 + OH -> 1*RO2 + 1*H2O
    LU(i,1427) = LU(i,1427) + rate_constant(i,69) * number_density(i,166)

    ! df_CH3CO3/d(CH3COCH3)
    !  k_CH3COCH3_1: CH3COCH3 -> 1*CH3CO3 + 1*CH3O2
    LU(i,1428) = LU(i,1428) + rate_constant(i,46)

    ! df_H2O/d(CH3COCH3)
    !  k_CH3COCH3_OH_1: CH3COCH3 + OH -> 1*RO2 + 1*H2O
    LU(i,1432) = LU(i,1432) + rate_constant(i,68) * number_density(i,166)

    !  k_CH3COCH3_OH_2: CH3COCH3 + OH -> 1*RO2 + 1*H2O
    LU(i,1432) = LU(i,1432) + rate_constant(i,69) * number_density(i,166)

    ! df_CH3COCH3/d(CH3COCH3)
    !  k_CH3COCH3_1: CH3COCH3 -> 1*CH3CO3 + 1*CH3O2
    LU(i,1440) = LU(i,1440) - rate_constant(i,46)

    !  k_CH3COCH3_OH_1: CH3COCH3 + OH -> 1*RO2 + 1*H2O
    LU(i,1440) = LU(i,1440) - rate_constant(i,68) * number_density(i,166)

    !  k_CH3COCH3_OH_2: CH3COCH3 + OH -> 1*RO2 + 1*H2O
    LU(i,1440) = LU(i,1440) - rate_constant(i,69) * number_density(i,166)

    ! df_CH3O2/d(CH3COCH3)
    !  k_CH3COCH3_1: CH3COCH3 -> 1*CH3CO3 + 1*CH3O2
    LU(i,1486) = LU(i,1486) + rate_constant(i,46)

    ! df_OH/d(CH3COCH3)
    !  k_CH3COCH3_OH_1: CH3COCH3 + OH -> 1*RO2 + 1*H2O
    LU(i,1466) = LU(i,1466) - rate_constant(i,68) * number_density(i,166)

    !  k_CH3COCH3_OH_2: CH3COCH3 + OH -> 1*RO2 + 1*H2O
    LU(i,1466) = LU(i,1466) - rate_constant(i,69) * number_density(i,166)

    ! df_O2/d(O)
    !  k_CLO_O_1: CLO + O -> 1*CL + 1*O2
    LU(i,7805) = LU(i,7805) + rate_constant(i,21) * number_density(i,86)

    !  k_NO3_O_1: NO3 + O -> 1*NO2 + 1*O2
    LU(i,7805) = LU(i,7805) + rate_constant(i,129) * number_density(i,165)

    !  k_O_O3_1: O + O3 -> 2*O2
    LU(i,7805) = LU(i,7805) + 2*rate_constant(i,187) * number_density(i,171)

    !  k_O_OH_1: O + OH -> 1*H + 1*O2
    LU(i,7805) = LU(i,7805) + rate_constant(i,196) * number_density(i,166)

    !  k_M_O_O2_1: M + O + O2 -> 1*O3 + 1*M
    LU(i,7805) = LU(i,7805) - rate_constant(i,202) * number_density(i,1) * number_density(i,41)

    !  k_HO2_O_1: HO2 + O -> 1*OH + 1*O2
    LU(i,7805) = LU(i,7805) + rate_constant(i,217) * number_density(i,192)

    !  k_BRO_O_1: BRO + O -> 1*BR + 1*O2
    LU(i,7805) = LU(i,7805) + rate_constant(i,223) * number_density(i,71)

    !  k_M_O_O_1: M + O + O -> 1*O2 + 1*M
    LU(i,7805) = LU(i,7805) + rate_constant(i,304) * number_density(i,1) * number_density(i,187)

    !  k_M_O_O_1: M + O + O -> 1*O2 + 1*M
    LU(i,7805) = LU(i,7805) + rate_constant(i,304) * number_density(i,1) * number_density(i,187)

    !  k_NO2_O_1: NO2 + O -> 1*NO + 1*O2
    LU(i,7805) = LU(i,7805) + rate_constant(i,351) * number_density(i,54)

    ! df_H/d(O)
    !  k_O_OH_1: O + OH -> 1*H + 1*O2
    LU(i,7806) = LU(i,7806) + rate_constant(i,196) * number_density(i,166)

    !  k_H2_O_1: H2 + O -> 1*OH + 1*H
    LU(i,7806) = LU(i,7806) + rate_constant(i,465) * number_density(i,152)

    ! df_NO2/d(O)
    !  k_NO_O_1: NO + O -> 1*NO2
    LU(i,7807) = LU(i,7807) + rate_constant(i,62) * number_density(i,137)

    !  k_NO3_O_1: NO3 + O -> 1*NO2 + 1*O2
    LU(i,7807) = LU(i,7807) + rate_constant(i,129) * number_density(i,165)

    !  k_NO2_O_1: NO2 + O -> 1*NO + 1*O2
    LU(i,7807) = LU(i,7807) - rate_constant(i,351) * number_density(i,54)
  end do
  !$acc end parallel

end subroutine dforce_dy48

subroutine dforce_dy49(LU, rate_constant, number_density, number_density_air)
