    LU(i,7817) = LU(i,7817) - rate_constant(i,21) * number_density(i,86)

    !  k_HOCL_O_1: HOCL + O -> 1*CLO + 1*OH
    LU(i,7817) = LU(i,7817) + rate_constant(i,244) * number_density(i,88)

    !  k_CLONO2_O_1: CLONO2 + O -> 1*CLO + 1*NO3
    LU(i,7817) = LU(i,7817) + rate_constant(i,463) * number_density(i,74)

    ! df_CLONO2/d(O)
