    !  k_BRO_O_1: BRO + O -> 1*BR + 1*O2
    LU(i,7876) = LU(i,7876) - rate_constant(i,223) * number_density(i,71)

    !  k_HOCL_O_1: HOCL + O -> 1*CLO + 1*OH
    LU(i,7876) = LU(i,7876) - rate_constant(i,244) * number_density(i,88)

    !  k_HCL_O_1: HCL + O -> 1*CL + 1*OH
    LU(i,7876) = LU(i,7876) - rate_constant(i,293) * number_density(i,180)

    !  k_M_O_O_1: M + O + O -> 1*O2 + 1*M
    LU(i,7876) = LU(i,7876) - rate_constant(i,304) * number_density(i,1) * number_density(i,187)
  end do
  !$acc end parallel

end subroutine dforce_dy49

subroutine dforce_dy50(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    !  k_M_O_O_1: M + O + O -> 1*O2 + 1*M
    LU(i,7876) = LU(i,7876) - rate_constant(i,304) * number_density(i,1) * number_density(i,187)

    !  k_M_O_O_1: M + O + O -> 1*O2 + 1*M
    LU(i,7876) = LU(i,7876) - rate_constant(i,304) * number_density(i,1) * number_density(i,187)

    !  k_M_O_O_1: M + O + O -> 1*O2 + 1*M
    LU(i,7876) = LU(i,7876) - rate_constant(i,304) * number_density(i,1) * number_density(i,187)

    !  k_NO2_O_1: NO2 + O -> 1*NO + 1*O2
    LU(i,7876) = LU(i,7876) - rate_constant(i,351) * number_density(i,54)

    !  k_BRONO2_O_1: BRONO2 + O -> 1*BRO + 1*NO3
    LU(i,7876) = LU(i,7876) - rate_constant(i,418) * number_density(i,72)

    !  k_H2O2_O_1: H2O2 + O -> 1*OH + 1*HO2
    LU(i,7876) = LU(i,7876) - rate_constant(i,440) * number_density(i,179)

    !  k_HOBR_O_1: HOBR + O -> 1*BRO + 1*OH
    LU(i,7876) = LU(i,7876) - rate_constant(i,447) * number_density(i,186)

    !  k_CLONO2_O_1: CLONO2 + O -> 1*CLO + 1*NO3
    LU(i,7876) = LU(i,7876) - rate_constant(i,463) * number_density(i,74)

    !  k_H2_O_1: H2 + O -> 1*OH + 1*H
    LU(i,7876) = LU(i,7876) - rate_constant(i,465) * number_density(i,152)

    !  k_NO2_O_2: NO2 + O -> 1*NO3
    LU(i,7876) = LU(i,7876) - rate_constant(i,472) * number_density(i,54)

    !  k_HBR_O_1: HBR + O -> 1*BR + 1*OH
    LU(i,7876) = LU(i,7876) - rate_constant(i,473) * number_density(i,80)

    ! df_HCL/d(O)
    !  k_HCL_O_1: HCL + O -> 1*CL + 1*OH
    LU(i,7869) = LU(i,7869) - rate_constant(i,293) * number_density(i,180)

    ! df_H2O2/d(O)
    !  k_H2O2_O_1: H2O2 + O -> 1*OH + 1*HO2
    LU(i,7868) = LU(i,7868) - rate_constant(i,440) * number_density(i,179)

    ! df_CH2O/d(O)
    !  k_CH2O_O_1: CH2O + O -> 1*HO2 + 1*OH + 1*CO
    LU(i,7827) = LU(i,7827) - rate_constant(i,10) * number_density(i,124)

    ! df_HO2/d(O)
    !  k_CH2O_O_1: CH2O + O -> 1*HO2 + 1*OH + 1*CO
    LU(i,7881) = LU(i,7881) + rate_constant(i,10) * number_density(i,124)

    !  k_HO2_O_1: HO2 + O -> 1*OH + 1*O2
    LU(i,7881) = LU(i,7881) - rate_constant(i,217) * number_density(i,192)

    !  k_H2O2_O_1: H2O2 + O -> 1*OH + 1*HO2
    LU(i,7881) = LU(i,7881) + rate_constant(i,440) * number_density(i,179)

    ! df_H2/d(O)
    !  k_H2_O_1: H2 + O -> 1*OH + 1*H
    LU(i,7841) = LU(i,7841) - rate_constant(i,465) * number_density(i,152)

    ! df_NO3/d(O)
    !  k_NO3_O_1: NO3 + O -> 1*NO2 + 1*O2
    LU(i,7854) = LU(i,7854) - rate_constant(i,129) * number_density(i,165)

    !  k_BRONO2_O_1: BRONO2 + O -> 1*BRO + 1*NO3
    LU(i,7854) = LU(i,7854) + rate_constant(i,418) * number_density(i,72)

    !  k_CLONO2_O_1: CLONO2 + O -> 1*CLO + 1*NO3
    LU(i,7854) = LU(i,7854) + rate_constant(i,463) * number_density(i,74)

    !  k_NO2_O_2: NO2 + O -> 1*NO3
    LU(i,7854) = LU(i,7854) + rate_constant(i,472) * number_density(i,54)

    ! df_OH/d(O)
    !  k_CH2O_O_1: CH2O + O -> 1*HO2 + 1*OH + 1*CO
    LU(i,7855) = LU(i,7855) + rate_constant(i,10) * number_density(i,124)

    !  k_O_OH_1: O + OH -> 1*H + 1*O2
    LU(i,7855) = LU(i,7855) - rate_constant(i,196) * number_density(i,166)

    !  k_HO2_O_1: HO2 + O -> 1*OH + 1*O2
    LU(i,7855) = LU(i,7855) + rate_constant(i,217) * number_density(i,192)

    !  k_HOCL_O_1: HOCL + O -> 1*CLO + 1*OH
    LU(i,7855) = LU(i,7855) + rate_constant(i,244) * number_density(i,88)

    !  k_HCL_O_1: HCL + O -> 1*CL + 1*OH
    LU(i,7855) = LU(i,7855) + rate_constant(i,293) * number_density(i,180)

    !  k_H2O2_O_1: H2O2 + O -> 1*OH + 1*HO2
    LU(i,7855) = LU(i,7855) + rate_constant(i,440) * number_density(i,179)

    !  k_HOBR_O_1: HOBR + O -> 1*BRO + 1*OH
    LU(i,7855) = LU(i,7855) + rate_constant(i,447) * number_density(i,186)

    !  k_H2_O_1: H2 + O -> 1*OH + 1*H
    LU(i,7855) = LU(i,7855) + rate_constant(i,465) * number_density(i,152)

    !  k_HBR_O_1: HBR + O -> 1*BR + 1*OH
    LU(i,7855) = LU(i,7855) + rate_constant(i,473) * number_density(i,80)

  end do
  !$acc end parallel

end subroutine dforce_dy50

subroutine dforce_dy51(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell
    ! df_O3/d(O)
    !  k_O_O3_1: O + O3 -> 2*O2
    LU(i,7860) = LU(i,7860) - rate_constant(i,187) * number_density(i,171)

    !  k_M_O_O2_1: M + O + O2 -> 1*O3 + 1*M
    LU(i,7860) = LU(i,7860) + rate_constant(i,202) * number_density(i,1) * number_density(i,41)

    ! df_CO/d(O)
    !  k_CH2O_O_1: CH2O + O -> 1*HO2 + 1*OH + 1*CO
    LU(i,7865) = LU(i,7865) + rate_constant(i,10) * number_density(i,124)

    ! df_SO/d(OCLO)
    !  k_OCLO_SO_1: OCLO + SO -> 1*SO2 + 1*CLO
    LU(i,7506) = LU(i,7506) - rate_constant(i,47) * number_density(i,32)

    ! df_SO2/d(OCLO)
    !  k_OCLO_SO_1: OCLO + SO -> 1*SO2 + 1*CLO
    LU(i,7510) = LU(i,7510) + rate_constant(i,47) * number_density(i,32)

    ! df_CLO/d(OCLO)
    !  k_OCLO_SO_1: OCLO + SO -> 1*SO2 + 1*CLO
    LU(i,7518) = LU(i,7518) + rate_constant(i,47) * number_density(i,32)

    !  k_OCLO_1: OCLO -> 1*O + 1*CLO
    LU(i,7518) = LU(i,7518) + rate_constant(i,256)

    ! df_O/d(OCLO)
    !  k_OCLO_1: OCLO -> 1*O + 1*CLO
    LU(i,7577) = LU(i,7577) + rate_constant(i,256)

    ! df_OCLO/d(OCLO)
    !  k_OCLO_SO_1: OCLO + SO -> 1*SO2 + 1*CLO
    LU(i,7573) = LU(i,7573) - rate_constant(i,47) * number_density(i,32)

    !  k_OCLO_1: OCLO -> 1*O + 1*CLO
    LU(i,7573) = LU(i,7573) - rate_constant(i,256)

    ! df_COF2/d(O1D)
    !  k_CFC114_O1D_1: CFC114 + O1D -> 2*CL + 2*COF2
    LU(i,2549) = LU(i,2549) + 2*rate_constant(i,18) * number_density(i,62)

    !  k_HCFC22_O1D_1: HCFC22 + O1D -> 1*CL + 1*COF2
    LU(i,2549) = LU(i,2549) + rate_constant(i,64) * number_density(i,83)

    !  k_CF2CLBR_O1D_1: CF2CLBR + O1D -> 1*CL + 1*BR + 1*COF2
    LU(i,2549) = LU(i,2549) + rate_constant(i,128) * number_density(i,98)

    !  k_CFC12_O1D_1: CFC12 + O1D -> 2*CL + 1*COF2
    LU(i,2549) = LU(i,2549) + rate_constant(i,222) * number_density(i,64)

    !  k_CFC115_O1D_1: CFC115 + O1D -> 1*CL + 1*F + 2*COF2
    LU(i,2549) = LU(i,2549) + 2*rate_constant(i,253) * number_density(i,63)

    !  k_H2402_O1D_1: H2402 + O1D -> 2*BR + 2*COF2
    LU(i,2549) = LU(i,2549) + 2*rate_constant(i,347) * number_density(i,66)

    !  k_CF3BR_O1D_1: CF3BR + O1D -> 1*BR + 1*F + 1*COF2
    LU(i,2549) = LU(i,2549) + rate_constant(i,381) * number_density(i,60)

    !  k_HCFC142B_O1D_1: HCFC142B + O1D -> 1*CL + 1*COF2
    LU(i,2549) = LU(i,2549) + rate_constant(i,466) * number_density(i,172)

    ! df_O2/d(O1D)
    !  k_N2O_O1D_2: N2O + O1D -> 1*N2 + 1*O2
    LU(i,2553) = LU(i,2553) + rate_constant(i,443) * number_density(i,161)

    !  k_O1D_O3_1: O1D + O3 -> 1*O2
    LU(i,2553) = LU(i,2553) + rate_constant(i,487) * number_density(i,171)

    ! df_COFCL/d(O1D)
    !  k_HCFC141B_O1D_1: HCFC141B + O1D -> 1*CL + 1*COFCL
    LU(i,2550) = LU(i,2550) + rate_constant(i,137) * number_density(i,106)

    ! df_F/d(O1D)
    !  k_CFC115_O1D_1: CFC115 + O1D -> 1*CL + 1*F + 2*COF2
    LU(i,2551) = LU(i,2551) + rate_constant(i,253) * number_density(i,63)

    !  k_CF3BR_O1D_1: CF3BR + O1D -> 1*BR + 1*F + 1*COF2
    LU(i,2551) = LU(i,2551) + rate_constant(i,381) * number_density(i,60)

    ! df_N2/d(O1D)
    !  k_N2O_O1D_2: N2O + O1D -> 1*N2 + 1*O2
    LU(i,2552) = LU(i,2552) + rate_constant(i,443) * number_density(i,161)

    ! df_H/d(O1D)
    !  k_HBR_O1D_1: HBR + O1D -> 1*BRO + 1*H
    LU(i,2556) = LU(i,2556) + rate_constant(i,19) * number_density(i,80)

    !  k_H2_O1D_1: H2 + O1D -> 1*H + 1*OH
    LU(i,2556) = LU(i,2556) + rate_constant(i,237) * number_density(i,152)

    !  k_CH4_O1D_2: CH4 + O1D -> 1*CH2O + 1*H + 1*HO2
    LU(i,2556) = LU(i,2556) + rate_constant(i,283) * number_density(i,45)

    !  k_HCL_O1D_2: HCL + O1D -> 1*CLO + 1*H
    LU(i,2556) = LU(i,2556) + rate_constant(i,344) * number_density(i,180)

    ! df_HCN/d(O1D)
    !  k_HCN_O1D_1: HCN + O1D -> 1*OH
    LU(i,2555) = LU(i,2555) - rate_constant(i,268) * number_density(i,47)

  end do
  !$acc end parallel

end subroutine dforce_dy51

subroutine dforce_dy52(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell
    ! df_CCL4/d(O1D)
    !  k_CCL4_O1D_1: CCL4 + O1D -> 4*CL
    LU(i,2561) = LU(i,2561) - rate_constant(i,366) * number_density(i,59)

    ! df_CH4/d(O1D)
    !  k_CH4_O1D_1: CH4 + O1D -> 1*CH2O + 1*H2
    LU(i,2554) = LU(i,2554) - rate_constant(i,141) * number_density(i,45)

    !  k_CH4_O1D_2: CH4 + O1D -> 1*CH2O + 1*H + 1*HO2
    LU(i,2554) = LU(i,2554) - rate_constant(i,283) * number_density(i,45)

    !  k_CH4_O1D_3: CH4 + O1D -> 1*CH3O2 + 1*OH
    LU(i,2554) = LU(i,2554) - rate_constant(i,386) * number_density(i,45)

    ! df_H2O/d(O1D)
    !  k_H2O_O1D_1: H2O + O1D -> 2*OH
    LU(i,2568) = LU(i,2568) - rate_constant(i,39) * number_density(i,68)

    ! df_CFC113/d(O1D)
    !  k_CFC113_O1D_1: CFC113 + O1D -> 3*CL
    LU(i,2557) = LU(i,2557) - rate_constant(i,13) * number_density(i,52)

    ! df_CH2BR2/d(O1D)
    !  k_CH2BR2_O1D_1: CH2BR2 + O1D -> 2*BR
    LU(i,2611) = LU(i,2611) - rate_constant(i,120) * number_density(i,169)

    ! df_NO/d(O1D)
    !  k_N2O_O1D_1: N2O + O1D -> 2*NO
    LU(i,2593) = LU(i,2593) + 2*rate_constant(i,180) * number_density(i,161)

    ! df_BR/d(O1D)
    !  k_CH3BR_O1D_1: CH3BR + O1D -> 1*BR
    LU(i,2579) = LU(i,2579) + rate_constant(i,48) * number_density(i,94)

    !  k_CH2BR2_O1D_1: CH2BR2 + O1D -> 2*BR
    LU(i,2579) = LU(i,2579) + 2*rate_constant(i,120) * number_density(i,169)

    !  k_CF2CLBR_O1D_1: CF2CLBR + O1D -> 1*CL + 1*BR + 1*COF2
    LU(i,2579) = LU(i,2579) + rate_constant(i,128) * number_density(i,98)

    !  k_HBR_O1D_2: HBR + O1D -> 1*BR + 1*OH
    LU(i,2579) = LU(i,2579) + rate_constant(i,276) * number_density(i,80)

    !  k_H2402_O1D_1: H2402 + O1D -> 2*BR + 2*COF2
    LU(i,2579) = LU(i,2579) + 2*rate_constant(i,347) * number_density(i,66)

    !  k_CHBR3_O1D_1: CHBR3 + O1D -> 3*BR
    LU(i,2579) = LU(i,2579) + 3*rate_constant(i,373) * number_density(i,84)

    !  k_CF3BR_O1D_1: CF3BR + O1D -> 1*BR + 1*F + 1*COF2
    LU(i,2579) = LU(i,2579) + rate_constant(i,381) * number_density(i,60)

    ! df_BRO/d(O1D)
    !  k_HBR_O1D_1: HBR + O1D -> 1*BRO + 1*H
    LU(i,2569) = LU(i,2569) + rate_constant(i,19) * number_density(i,80)

    ! df_CF2CLBR/d(O1D)
    !  k_CF2CLBR_O1D_1: CF2CLBR + O1D -> 1*CL + 1*BR + 1*COF2
    LU(i,2581) = LU(i,2581) - rate_constant(i,128) * number_density(i,98)

    ! df_CF3BR/d(O1D)
    !  k_CF3BR_O1D_1: CF3BR + O1D -> 1*BR + 1*F + 1*COF2
    LU(i,2562) = LU(i,2562) - rate_constant(i,381) * number_density(i,60)

    ! df_CFC11/d(O1D)
    !  k_CFC11_O1D_1: CFC11 + O1D -> 3*CL
    LU(i,2563) = LU(i,2563) - rate_constant(i,474) * number_density(i,61)

    ! df_CFC114/d(O1D)
    !  k_CFC114_O1D_1: CFC114 + O1D -> 2*CL + 2*COF2
    LU(i,2564) = LU(i,2564) - rate_constant(i,18) * number_density(i,62)

    ! df_CFC115/d(O1D)
    !  k_CFC115_O1D_1: CFC115 + O1D -> 1*CL + 1*F + 2*COF2
    LU(i,2565) = LU(i,2565) - rate_constant(i,253) * number_density(i,63)

    ! df_CFC12/d(O1D)
    !  k_CFC12_O1D_1: CFC12 + O1D -> 2*CL + 1*COF2
    LU(i,2566) = LU(i,2566) - rate_constant(i,222) * number_density(i,64)

    ! df_CH3BR/d(O1D)
    !  k_CH3BR_O1D_1: CH3BR + O1D -> 1*BR
    LU(i,2580) = LU(i,2580) - rate_constant(i,48) * number_density(i,94)

    ! df_CHBR3/d(O1D)
    !  k_CHBR3_O1D_1: CHBR3 + O1D -> 3*BR
    LU(i,2576) = LU(i,2576) - rate_constant(i,373) * number_density(i,84)

    ! df_CL/d(O1D)
    !  k_CFC113_O1D_1: CFC113 + O1D -> 3*CL
    LU(i,2582) = LU(i,2582) + 3*rate_constant(i,13) * number_density(i,52)

    !  k_CFC114_O1D_1: CFC114 + O1D -> 2*CL + 2*COF2
    LU(i,2582) = LU(i,2582) + 2*rate_constant(i,18) * number_density(i,62)

    !  k_HCL_O1D_1: HCL + O1D -> 1*CL + 1*OH
    LU(i,2582) = LU(i,2582) + rate_constant(i,53) * number_density(i,180)

    !  k_HCFC22_O1D_1: HCFC22 + O1D -> 1*CL + 1*COF2
    LU(i,2582) = LU(i,2582) + rate_constant(i,64) * number_density(i,83)

  end do
  !$acc end parallel

end subroutine dforce_dy52

subroutine dforce_dy53(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell
    !  k_CF2CLBR_O1D_1: CF2CLBR + O1D -> 1*CL + 1*BR + 1*COF2
    LU(i,2582) = LU(i,2582) + rate_constant(i,128) * number_density(i,98)

    !  k_HCFC141B_O1D_1: HCFC141B + O1D -> 1*CL + 1*COFCL
    LU(i,2582) = LU(i,2582) + rate_constant(i,137) * number_density(i,106)

    !  k_CFC12_O1D_1: CFC12 + O1D -> 2*CL + 1*COF2
    LU(i,2582) = LU(i,2582) + 2*rate_constant(i,222) * number_density(i,64)

    !  k_CFC115_O1D_1: CFC115 + O1D -> 1*CL + 1*F + 2*COF2
    LU(i,2582) = LU(i,2582) + rate_constant(i,253) * number_density(i,63)

    !  k_CCL4_O1D_1: CCL4 + O1D -> 4*CL
    LU(i,2582) = LU(i,2582) + 4*rate_constant(i,366) * number_density(i,59)

    !  k_HCFC142B_O1D_1: HCFC142B + O1D -> 1*CL + 1*COF2
    LU(i,2582) = LU(i,2582) + rate_constant(i,466) * number_density(i,172)

    !  k_CFC11_O1D_1: CFC11 + O1D -> 3*CL
    LU(i,2582) = LU(i,2582) + 3*rate_constant(i,474) * number_density(i,61)

    ! df_CLO/d(O1D)
