    LU(i,2567) = LU(i,2567) - rate_constant(i,347) * number_density(i,66)

    ! df_HCFC141B/d(O1D)
    !  k_HCFC141B_O1D_1: HCFC141B + O1D -> 1*CL + 1*COFCL
    LU(i,2583) = LU(i,2583) - rate_constant(i,137) * number_density(i,106)

    ! df_HBR/d(O1D)
