    LU(i,2572) = LU(i,2572) - rate_constant(i,19) * number_density(i,80)

    !  k_HBR_O1D_2: HBR + O1D -> 1*BR + 1*OH
    LU(i,2572) = LU(i,2572) - rate_constant(i,276) * number_density(i,80)

    ! df_HCFC142B/d(O1D)
    !  k_HCFC142B_O1D_1: HCFC142B + O1D -> 1*CL + 1*COF2
    LU(i,2614) = LU(i,2614) - rate_constant(i,466) * number_density(i,172)

    ! df_HCFC22/d(O1D)
