    LU(i,2629) = LU(i,2629) + rate_constant(i,6) * number_density(i,11)

    !  k_O1D_O2_1: O1D + O2 -> 1*O + 1*O2
    LU(i,2629) = LU(i,2629) + rate_constant(i,395) * number_density(i,41)

    ! df_O1D/d(O1D)
    !  k_N2_O1D_1: N2 + O1D -> 1*O + 1*N2
    LU(i,2586) = LU(i,2586) - rate_constant(i,6) * number_density(i,11)

    !  k_CFC113_O1D_1: CFC113 + O1D -> 3*CL
    LU(i,2586) = LU(i,2586) - rate_constant(i,13) * number_density(i,52)

    !  k_CFC114_O1D_1: CFC114 + O1D -> 2*CL + 2*COF2
    LU(i,2586) = LU(i,2586) - rate_constant(i,18) * number_density(i,62)

    !  k_HBR_O1D_1: HBR + O1D -> 1*BRO + 1*H
