    !  k_HCFC22_O1D_1: HCFC22 + O1D -> 1*CL + 1*COF2
    LU(i,2586) = LU(i,2586) - rate_constant(i,64) * number_density(i,83)

    !  k_CH2BR2_O1D_1: CH2BR2 + O1D -> 2*BR
    LU(i,2586) = LU(i,2586) - rate_constant(i,120) * number_density(i,169)

    !  k_CF2CLBR_O1D_1: CF2CLBR + O1D -> 1*CL + 1*BR + 1*COF2
    LU(i,2586) = LU(i,2586) - rate_constant(i,128) * number_density(i,98)

    !  k_HCFC141B_O1D_1: HCFC141B + O1D -> 1*CL + 1*COFCL
    LU(i,2586) = LU(i,2586) - rate_constant(i,137) * number_density(i,106)

    !  k_CH4_O1D_1: CH4 + O1D -> 1*CH2O + 1*H2
