end subroutine dforce_dy53

subroutine dforce_dy54(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell
    !  k_CFC115_O1D_1: CFC115 + O1D -> 1*CL + 1*F + 2*COF2
    LU(i,2586) = LU(i,2586) - rate_constant(i,253) * number_density(i,63)

    !  k_HCN_O1D_1: HCN + O1D -> 1*OH
    LU(i,2586) = LU(i,2586) - rate_constant(i,268) * number_density(i,47)

    !  k_HBR_O1D_2: HBR + O1D -> 1*BR + 1*OH
    LU(i,2586) = LU(i,2586) - rate_constant(i,276) * number_density(i,80)

    !  k_CH4_O1D_2: CH4 + O1D -> 1*CH2O + 1*H + 1*HO2
    LU(i,2586) = LU(i,2586) - rate_constant(i,283) * number_density(i,45)

    !  k_HCL_O1D_2: HCL + O1D -> 1*CLO + 1*H
    LU(i,2586) = LU(i,2586) - rate_constant(i,344) * number_density(i,180)

    !  k_H2402_O1D_1: H2402 + O1D -> 2*BR + 2*COF2
    LU(i,2586) = LU(i,2586) - rate_constant(i,347) * number_density(i,66)

    !  k_CCL4_O1D_1: CCL4 + O1D -> 4*CL
    LU(i,2586) = LU(i,2586) - rate_constant(i,366) * number_density(i,59)

    !  k_CHBR3_O1D_1: CHBR3 + O1D -> 3*BR
    LU(i,2586) = LU(i,2586) - rate_constant(i,373) * number_density(i,84)

    !  k_CF3BR_O1D_1: CF3BR + O1D -> 1*BR + 1*F + 1*COF2
    LU(i,2586) = LU(i,2586) - rate_constant(i,381) * number_density(i,60)

    !  k_CH4_O1D_3: CH4 + O1D -> 1*CH3O2 + 1*OH
    LU(i,2586) = LU(i,2586) - rate_constant(i,386) * number_density(i,45)

    !  k_O1D_O2_1: O1D + O2 -> 1*O + 1*O2
    LU(i,2586) = LU(i,2586) - rate_constant(i,395) * number_density(i,41)

    !  k_N2O_O1D_2: N2O + O1D -> 1*N2 + 1*O2
    LU(i,2586) = LU(i,2586) - rate_constant(i,443) * number_density(i,161)

    !  k_HCFC142B_O1D_1: HCFC142B + O1D -> 1*CL + 1*COF2
    LU(i,2586) = LU(i,2586) - rate_constant(i,466) * number_density(i,172)

    !  k_CFC11_O1D_1: CFC11 + O1D -> 3*CL
    LU(i,2586) = LU(i,2586) - rate_constant(i,474) * number_density(i,61)

    !  k_O1D_O3_1: O1D + O3 -> 1*O2
    LU(i,2586) = LU(i,2586) - rate_constant(i,487) * number_density(i,171)

    ! df_HCL/d(O1D)
    !  k_HCL_O1D_1: HCL + O1D -> 1*CL + 1*OH
    LU(i,2622) = LU(i,2622) - rate_constant(i,53) * number_density(i,180)

    !  k_HCL_O1D_2: HCL + O1D -> 1*CLO + 1*H
    LU(i,2622) = LU(i,2622) - rate_constant(i,344) * number_density(i,180)

    ! df_CH3O2/d(O1D)
    !  k_CH4_O1D_3: CH4 + O1D -> 1*CH3O2 + 1*OH
    LU(i,2633) = LU(i,2633) + rate_constant(i,386) * number_density(i,45)

    ! df_CH2O/d(O1D)
    !  k_CH4_O1D_1: CH4 + O1D -> 1*CH2O + 1*H2
    LU(i,2590) = LU(i,2590) + rate_constant(i,141) * number_density(i,45)

    !  k_CH4_O1D_2: CH4 + O1D -> 1*CH2O + 1*H + 1*HO2
    LU(i,2590) = LU(i,2590) + rate_constant(i,283) * number_density(i,45)

    ! df_N2O/d(O1D)
    !  k_N2O_O1D_1: N2O + O1D -> 2*NO
    LU(i,2603) = LU(i,2603) - rate_constant(i,180) * number_density(i,161)

    !  k_N2O_O1D_2: N2O + O1D -> 1*N2 + 1*O2
    LU(i,2603) = LU(i,2603) - rate_constant(i,443) * number_density(i,161)

    ! df_HO2/d(O1D)
    !  k_CH4_O1D_2: CH4 + O1D -> 1*CH2O + 1*H + 1*HO2
    LU(i,2634) = LU(i,2634) + rate_constant(i,283) * number_density(i,45)

    ! df_H2/d(O1D)
    !  k_CH4_O1D_1: CH4 + O1D -> 1*CH2O + 1*H2
    LU(i,2596) = LU(i,2596) + rate_constant(i,141) * number_density(i,45)

    !  k_H2_O1D_1: H2 + O1D -> 1*H + 1*OH
    LU(i,2596) = LU(i,2596) - rate_constant(i,237) * number_density(i,152)

    ! df_OH/d(O1D)
    !  k_H2O_O1D_1: H2O + O1D -> 2*OH
    LU(i,2608) = LU(i,2608) + 2*rate_constant(i,39) * number_density(i,68)

    !  k_HCL_O1D_1: HCL + O1D -> 1*CL + 1*OH
    LU(i,2608) = LU(i,2608) + rate_constant(i,53) * number_density(i,180)

    !  k_H2_O1D_1: H2 + O1D -> 1*H + 1*OH
    LU(i,2608) = LU(i,2608) + rate_constant(i,237) * number_density(i,152)

    !  k_HCN_O1D_1: HCN + O1D -> 1*OH
    LU(i,2608) = LU(i,2608) + rate_constant(i,268) * number_density(i,47)

    !  k_HBR_O1D_2: HBR + O1D -> 1*BR + 1*OH
    LU(i,2608) = LU(i,2608) + rate_constant(i,276) * number_density(i,80)

    !  k_CH4_O1D_3: CH4 + O1D -> 1*CH3O2 + 1*OH
    LU(i,2608) = LU(i,2608) + rate_constant(i,386) * number_density(i,45)

    ! df_O3/d(O1D)
    !  k_O1D_O3_1: O1D + O3 -> 1*O2
    LU(i,2613) = LU(i,2613) - rate_constant(i,487) * number_density(i,171)
  end do
  !$acc end parallel

end subroutine dforce_dy54

subroutine dforce_dy55(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! df_C6H5O2/d(PHENO)
    !  k_O3_PHENO_1: O3 + PHENO -> 1*C6H5O2
    LU(i,7439) = LU(i,7439) + rate_constant(i,249) * number_density(i,171)

    ! df_NO2/d(PHENO)
    !  k_NO2_PHENO_1: NO2 + PHENO -> 
    LU(i,7432) = LU(i,7432) - rate_constant(i,292) * number_density(i,54)

    ! df_PHENO/d(PHENO)
    !  k_O3_PHENO_1: O3 + PHENO -> 1*C6H5O2
    LU(i,7495) = LU(i,7495) - rate_constant(i,249) * number_density(i,171)

    !  k_NO2_PHENO_1: NO2 + PHENO -> 
    LU(i,7495) = LU(i,7495) - rate_constant(i,292) * number_density(i,54)

    ! df_O3/d(PHENO)
    !  k_O3_PHENO_1: O3 + PHENO -> 1*C6H5O2
    LU(i,7484) = LU(i,7484) - rate_constant(i,249) * number_density(i,171)

    ! df_HNO3/d(DMS)
    !  k_DMS_NO3_1: DMS + NO3 -> 1*SO2 + 1*HNO3
    LU(i,1806) = LU(i,1806) + rate_constant(i,197) * number_density(i,165)

    ! df_SO2/d(DMS)
    !  k_DMS_NO3_1: DMS + NO3 -> 1*SO2 + 1*HNO3
    LU(i,1808) = LU(i,1808) + rate_constant(i,197) * number_density(i,165)

    !  k_DMS_OH_1: DMS + OH -> 0.5*SO2 + 0.5*HO2
    LU(i,1808) = LU(i,1808) + 0.5*rate_constant(i,227) * number_density(i,166)

    !  k_DMS_OH_2: DMS + OH -> 1*SO2
    LU(i,1808) = LU(i,1808) + rate_constant(i,476) * number_density(i,166)

    ! df_DMS/d(DMS)
    !  k_DMS_NO3_1: DMS + NO3 -> 1*SO2 + 1*HNO3
    LU(i,1819) = LU(i,1819) - rate_constant(i,197) * number_density(i,165)

    !  k_DMS_OH_1: DMS + OH -> 0.5*SO2 + 0.5*HO2
    LU(i,1819) = LU(i,1819) - rate_constant(i,227) * number_density(i,166)

    !  k_DMS_OH_2: DMS + OH -> 1*SO2
    LU(i,1819) = LU(i,1819) - rate_constant(i,476) * number_density(i,166)

    ! df_HO2/d(DMS)
    !  k_DMS_OH_1: DMS + OH -> 0.5*SO2 + 0.5*HO2
    LU(i,1864) = LU(i,1864) + 0.5*rate_constant(i,227) * number_density(i,166)

    ! df_NO3/d(DMS)
    !  k_DMS_NO3_1: DMS + NO3 -> 1*SO2 + 1*HNO3
    LU(i,1842) = LU(i,1842) - rate_constant(i,197) * number_density(i,165)

    ! df_OH/d(DMS)
    !  k_DMS_OH_1: DMS + OH -> 0.5*SO2 + 0.5*HO2
    LU(i,1843) = LU(i,1843) - rate_constant(i,227) * number_density(i,166)

    !  k_DMS_OH_2: DMS + OH -> 1*SO2
    LU(i,1843) = LU(i,1843) - rate_constant(i,476) * number_density(i,166)

    ! df_C2H5OH/d(C2H5OH)
    !  k_C2H5OH_OH_1: C2H5OH + OH -> 1*HO2 + 1*CH3CHO
    LU(i,3388) = LU(i,3388) - rate_constant(i,477) * number_density(i,166)

    ! df_HO2/d(C2H5OH)
    !  k_C2H5OH_OH_1: C2H5OH + OH -> 1*HO2 + 1*CH3CHO
    LU(i,3391) = LU(i,3391) + rate_constant(i,477) * number_density(i,166)

    ! df_OH/d(C2H5OH)
    !  k_C2H5OH_OH_1: C2H5OH + OH -> 1*HO2 + 1*CH3CHO
    LU(i,3389) = LU(i,3389) - rate_constant(i,477) * number_density(i,166)

    ! df_CH3CHO/d(C2H5OH)
    !  k_C2H5OH_OH_1: C2H5OH + OH -> 1*HO2 + 1*CH3CHO
    LU(i,3390) = LU(i,3390) + rate_constant(i,477) * number_density(i,166)

    ! df_H/d(HCL)
    !  k_HCL_1: HCL -> 1*H + 1*CL
    LU(i,7283) = LU(i,7283) + rate_constant(i,321)

    !  k_HCL_O1D_2: HCL + O1D -> 1*CLO + 1*H
    LU(i,7283) = LU(i,7283) + rate_constant(i,344) * number_density(i,112)

    ! df_H2O/d(HCL)
    !  k_HCL_OH_1: HCL + OH -> 1*H2O + 1*CL
    LU(i,7287) = LU(i,7287) + rate_constant(i,458) * number_density(i,166)

    ! df_CL/d(HCL)
    !  k_HCL_O1D_1: HCL + O1D -> 1*CL + 1*OH
    LU(i,7296) = LU(i,7296) + rate_constant(i,53) * number_density(i,112)

    !  k_HCL_O_1: HCL + O -> 1*CL + 1*OH
    LU(i,7296) = LU(i,7296) + rate_constant(i,293) * number_density(i,187)

    !  k_HCL_1: HCL -> 1*H + 1*CL
    LU(i,7296) = LU(i,7296) + rate_constant(i,321)

    !  k_HCL_OH_1: HCL + OH -> 1*H2O + 1*CL
    LU(i,7296) = LU(i,7296) + rate_constant(i,458) * number_density(i,166)

    ! df_CLO/d(HCL)
    !  k_HCL_O1D_2: HCL + O1D -> 1*CLO + 1*H
    LU(i,7293) = LU(i,7293) + rate_constant(i,344) * number_density(i,112)
  end do
  !$acc end parallel

end subroutine dforce_dy55

subroutine dforce_dy56(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! df_O/d(HCL)
    !  k_HCL_O_1: HCL + O -> 1*CL + 1*OH
    LU(i,7352) = LU(i,7352) - rate_constant(i,293) * number_density(i,187)

    ! df_O1D/d(HCL)
    !  k_HCL_O1D_1: HCL + O1D -> 1*CL + 1*OH
    LU(i,7299) = LU(i,7299) - rate_constant(i,53) * number_density(i,112)

    !  k_HCL_O1D_2: HCL + O1D -> 1*CLO + 1*H
    LU(i,7299) = LU(i,7299) - rate_constant(i,344) * number_density(i,112)

    ! df_HCL/d(HCL)
    !  k_HCL_O1D_1: HCL + O1D -> 1*CL + 1*OH
    LU(i,7345) = LU(i,7345) - rate_constant(i,53) * number_density(i,112)

    !  k_HCL_O_1: HCL + O -> 1*CL + 1*OH
    LU(i,7345) = LU(i,7345) - rate_constant(i,293) * number_density(i,187)

    !  k_HCL_1: HCL -> 1*H + 1*CL
    LU(i,7345) = LU(i,7345) - rate_constant(i,321)

    !  k_HCL_O1D_2: HCL + O1D -> 1*CLO + 1*H
    LU(i,7345) = LU(i,7345) - rate_constant(i,344) * number_density(i,112)

    !  k_HCL_OH_1: HCL + OH -> 1*H2O + 1*CL
    LU(i,7345) = LU(i,7345) - rate_constant(i,458) * number_density(i,166)

    ! df_OH/d(HCL)
    !  k_HCL_O1D_1: HCL + O1D -> 1*CL + 1*OH
    LU(i,7331) = LU(i,7331) + rate_constant(i,53) * number_density(i,112)

    !  k_HCL_O_1: HCL + O -> 1*CL + 1*OH
    LU(i,7331) = LU(i,7331) + rate_constant(i,293) * number_density(i,187)

    !  k_HCL_OH_1: HCL + OH -> 1*H2O + 1*CL
    LU(i,7331) = LU(i,7331) - rate_constant(i,458) * number_density(i,166)

    ! df_O3S/d(O3S)
    !  k_NO2_O3S_1: NO2 + O3S -> 1*NO2
    LU(i,192) = LU(i,192) - rate_constant(i,82) * number_density(i,54)

    !  k_NO_O3S_1: NO + O3S -> 1*NO
    LU(i,192) = LU(i,192) - rate_constant(i,125) * number_density(i,137)

    ! df_BEPOMUC/d(BEPOMUC)
    !  k_BEPOMUC_1: BEPOMUC -> 1*BIGALD1 + 1.5*HO2 + 1.5*CO
    LU(i,1693) = LU(i,1693) - rate_constant(i,132)

    ! df_HO2/d(BEPOMUC)
    !  k_BEPOMUC_1: BEPOMUC -> 1*BIGALD1 + 1.5*HO2 + 1.5*CO
    LU(i,1696) = LU(i,1696) + 1.5*rate_constant(i,132)

    ! df_CO/d(BEPOMUC)
    !  k_BEPOMUC_1: BEPOMUC -> 1*BIGALD1 + 1.5*HO2 + 1.5*CO
    LU(i,1695) = LU(i,1695) + 1.5*rate_constant(i,132)

    ! df_BIGALD1/d(BEPOMUC)
    !  k_BEPOMUC_1: BEPOMUC -> 1*BIGALD1 + 1.5*HO2 + 1.5*CO
    LU(i,1692) = LU(i,1692) + rate_constant(i,132)

    ! df_ACBZO2/d(BZALD)
    !  k_BZALD_OH_1: BZALD + OH -> 1*ACBZO2
    LU(i,2281) = LU(i,2281) + rate_constant(i,57) * number_density(i,166)

    ! df_BZALD/d(BZALD)
    !  k_BZALD_OH_1: BZALD + OH -> 1*ACBZO2
    LU(i,2295) = LU(i,2295) - rate_constant(i,57) * number_density(i,166)

    ! df_OH/d(BZALD)
    !  k_BZALD_OH_1: BZALD + OH -> 1*ACBZO2
    LU(i,2320) = LU(i,2320) - rate_constant(i,57) * number_density(i,166)

    ! df_BENZO2/d(BENZENE)
    !  k_BENZENE_OH_1: BENZENE + OH -> 0.53*PHENOL + 0.12*BEPOMUC + 0.65*HO2 + 0.35*BENZO2
    LU(i,1937) = LU(i,1937) + 0.35*rate_constant(i,318) * number_density(i,166)

    ! df_SOAG0/d(BENZENE)
    !  k_BENZENE_OH_2: BENZENE + OH -> 1*BENZENE + 1*OH + 0.0023*SOAG0 + 0.0008*SOAG1 + 0.0843*SOAG2 + 0.0443*SOAG3 + 0.1621*SOAG4
    LU(i,1938) = LU(i,1938) + 0.0023*rate_constant(i,478) * number_density(i,166)

    ! df_SOAG1/d(BENZENE)
    !  k_BENZENE_OH_2: BENZENE + OH -> 1*BENZENE + 1*OH + 0.0023*SOAG0 + 0.0008*SOAG1 + 0.0843*SOAG2 + 0.0443*SOAG3 + 0.1621*SOAG4
    LU(i,1939) = LU(i,1939) + 0.0008*rate_constant(i,478) * number_density(i,166)

    ! df_SOAG2/d(BENZENE)
    !  k_BENZENE_OH_2: BENZENE + OH -> 1*BENZENE + 1*OH + 0.0023*SOAG0 + 0.0008*SOAG1 + 0.0843*SOAG2 + 0.0443*SOAG3 + 0.1621*SOAG4
    LU(i,1940) = LU(i,1940) + 0.0843*rate_constant(i,478) * number_density(i,166)

    ! df_SOAG3/d(BENZENE)
    !  k_BENZENE_OH_2: BENZENE + OH -> 1*BENZENE + 1*OH + 0.0023*SOAG0 + 0.0008*SOAG1 + 0.0843*SOAG2 + 0.0443*SOAG3 + 0.1621*SOAG4
    LU(i,1941) = LU(i,1941) + 0.0443*rate_constant(i,478) * number_density(i,166)

    ! df_SOAG4/d(BENZENE)
    !  k_BENZENE_OH_2: BENZENE + OH -> 1*BENZENE + 1*OH + 0.0023*SOAG0 + 0.0008*SOAG1 + 0.0843*SOAG2 + 0.0443*SOAG3 + 0.1621*SOAG4
    LU(i,1942) = LU(i,1942) + 0.1621*rate_constant(i,478) * number_density(i,166)

    ! df_BEPOMUC/d(BENZENE)
    !  k_BENZENE_OH_1: BENZENE + OH -> 0.53*PHENOL + 0.12*BEPOMUC + 0.65*HO2 + 0.35*BENZO2
    LU(i,1959) = LU(i,1959) + 0.12*rate_constant(i,318) * number_density(i,166)

  end do
  !$acc end parallel

end subroutine dforce_dy56

subroutine dforce_dy57(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell
    ! df_BENZENE/d(BENZENE)
    !  k_BENZENE_OH_1: BENZENE + OH -> 0.53*PHENOL + 0.12*BEPOMUC + 0.65*HO2 + 0.35*BENZO2
    LU(i,1961) = LU(i,1961) - rate_constant(i,318) * number_density(i,166)

    ! df_HO2/d(BENZENE)
    !  k_BENZENE_OH_1: BENZENE + OH -> 0.53*PHENOL + 0.12*BEPOMUC + 0.65*HO2 + 0.35*BENZO2
    LU(i,2012) = LU(i,2012) + 0.65*rate_constant(i,318) * number_density(i,166)

    ! df_OH/d(BENZENE)
    !  k_BENZENE_OH_1: BENZENE + OH -> 0.53*PHENOL + 0.12*BEPOMUC + 0.65*HO2 + 0.35*BENZO2
    LU(i,1987) = LU(i,1987) - rate_constant(i,318) * number_density(i,166)

    ! df_PHENOL/d(BENZENE)
    !  k_BENZENE_OH_1: BENZENE + OH -> 0.53*PHENOL + 0.12*BEPOMUC + 0.65*HO2 + 0.35*BENZO2
    LU(i,1943) = LU(i,1943) + 0.53*rate_constant(i,318) * number_density(i,166)

    ! df_O2/d(C3H7O2)
    !  k_C3H7O2_HO2_1: C3H7O2 + HO2 -> 1*C3H7OOH + 1*O2
    LU(i,2351) = LU(i,2351) + rate_constant(i,142) * number_density(i,192)

    ! df_NO2/d(C3H7O2)
    !  k_C3H7O2_NO_1: C3H7O2 + NO -> 0.82*CH3COCH3 + 1*NO2 + 1*HO2 + 0.27*CH3CHO
    LU(i,2353) = LU(i,2353) + rate_constant(i,471) * number_density(i,137)

    ! df_NO/d(C3H7O2)
    !  k_C3H7O2_NO_1: C3H7O2 + NO -> 0.82*CH3COCH3 + 1*NO2 + 1*HO2 + 0.27*CH3CHO
    LU(i,2378) = LU(i,2378) - rate_constant(i,471) * number_density(i,137)

    ! df_CH3COCH3/d(C3H7O2)
    !  k_C3H7O2_CH3O2_1: C3H7O2 + CH3O2 -> 1*CH2O + 1*HO2 + 0.82*CH3COCH3
    LU(i,2364) = LU(i,2364) + 0.82*rate_constant(i,63) * number_density(i,191)

    !  k_C3H7O2_NO_1: C3H7O2 + NO -> 0.82*CH3COCH3 + 1*NO2 + 1*HO2 + 0.27*CH3CHO
    LU(i,2364) = LU(i,2364) + 0.82*rate_constant(i,471) * number_density(i,137)

    ! df_C3H7O2/d(C3H7O2)
    !  k_C3H7O2_CH3O2_1: C3H7O2 + CH3O2 -> 1*CH2O + 1*HO2 + 0.82*CH3COCH3
    LU(i,2368) = LU(i,2368) - rate_constant(i,63) * number_density(i,191)

    !  k_C3H7O2_HO2_1: C3H7O2 + HO2 -> 1*C3H7OOH + 1*O2
    LU(i,2368) = LU(i,2368) - rate_constant(i,142) * number_density(i,192)

    !  k_C3H7O2_NO_1: C3H7O2 + NO -> 0.82*CH3COCH3 + 1*NO2 + 1*HO2 + 0.27*CH3CHO
    LU(i,2368) = LU(i,2368) - rate_constant(i,471) * number_density(i,137)

    ! df_CH3O2/d(C3H7O2)
    !  k_C3H7O2_CH3O2_1: C3H7O2 + CH3O2 -> 1*CH2O + 1*HO2 + 0.82*CH3COCH3
    LU(i,2417) = LU(i,2417) - rate_constant(i,63) * number_density(i,191)

    ! df_CH2O/d(C3H7O2)
    !  k_C3H7O2_CH3O2_1: C3H7O2 + CH3O2 -> 1*CH2O + 1*HO2 + 0.82*CH3COCH3
    LU(i,2375) = LU(i,2375) + rate_constant(i,63) * number_density(i,191)

    ! df_HO2/d(C3H7O2)
    !  k_C3H7O2_CH3O2_1: C3H7O2 + CH3O2 -> 1*CH2O + 1*HO2 + 0.82*CH3COCH3
    LU(i,2418) = LU(i,2418) + rate_constant(i,63) * number_density(i,191)

    !  k_C3H7O2_HO2_1: C3H7O2 + HO2 -> 1*C3H7OOH + 1*O2
    LU(i,2418) = LU(i,2418) - rate_constant(i,142) * number_density(i,192)

    !  k_C3H7O2_NO_1: C3H7O2 + NO -> 0.82*CH3COCH3 + 1*NO2 + 1*HO2 + 0.27*CH3CHO
    LU(i,2418) = LU(i,2418) + rate_constant(i,471) * number_density(i,137)

    ! df_CH3CHO/d(C3H7O2)
    !  k_C3H7O2_NO_1: C3H7O2 + NO -> 0.82*CH3COCH3 + 1*NO2 + 1*HO2 + 0.27*CH3CHO
    LU(i,2404) = LU(i,2404) + 0.27*rate_constant(i,471) * number_density(i,137)

    ! df_C3H7OOH/d(C3H7O2)
    !  k_C3H7O2_HO2_1: C3H7O2 + HO2 -> 1*C3H7OOH + 1*O2
    LU(i,2350) = LU(i,2350) + rate_constant(i,142) * number_density(i,192)

    ! df_O2/d(CH3O2)
    !  k_CH3O2_HO2_1: CH3O2 + HO2 -> 1*CH3OOH + 1*O2
    LU(i,8122) = LU(i,8122) + rate_constant(i,301) * number_density(i,192)

    ! df_MVK/d(CH3O2)
    !  k_CH3O2_ISOPAO2_1: CH3O2 + ISOPAO2 -> 0.25*CH3OH + 1*HO2 + 1.5*CH2O + 0.31*MACR + 0.44*MVK
    LU(i,8118) = LU(i,8118) + 0.44*rate_constant(i,434) * number_density(i,189)

    ! df_ISOPNO3/d(CH3O2)
    !  k_CH3O2_ISOPNO3_1: CH3O2 + ISOPNO3 -> 0.8*NC4CHO + 1.2*HO2 + 0.8*CH2O + 0.2*CH3OH + 0.2*NC4CH2OH
    LU(i,8123) = LU(i,8123) - rate_constant(i,160) * number_density(i,46)

    ! df_RO2/d(CH3O2)
    !  k_CH3O2_RO2_1: CH3O2 + RO2 -> 0.3*CH3CO3 + 0.8*CH2O + 0.3*HO2 + 0.2*HYAC + 0.5*CH3COCHO + 0.5*CH3OH
    LU(i,8121) = LU(i,8121) - rate_constant(i,354) * number_density(i,40)

    ! df_TERPNIT/d(CH3O2)
    !  k_CH3O2_NTERPO2_1: CH3O2 + NTERPO2 -> 0.5*TERPNIT + 0.75*CH2O + 0.25*CH3OH + 0.5*HO2 + 0.5*TERPROD1 + 0.5*NO2
    LU(i,8120) = LU(i,8120) + 0.5*rate_constant(i,135) * number_density(i,143)

    ! df_CH3CO3/d(CH3O2)
    !  k_CH3O2_MCO3_1: CH3O2 + MCO3 -> 2*CH2O + 1*HO2 + 1*CO2 + 1*CH3CO3
    LU(i,8125) = LU(i,8125) + rate_constant(i,84) * number_density(i,167)

    !  k_CH3CO3_CH3O2_1: CH3CO3 + CH3O2 -> 0.9*CH3O2 + 1*CH2O + 0.9*HO2 + 0.9*CO2 + 0.1*CH3COOH
    LU(i,8125) = LU(i,8125) - rate_constant(i,99) * number_density(i,49)

    !  k_CH3O2_MACRO2_1: CH3O2 + MACRO2 -> 0.73*HO2 + 0.88*CH2O + 0.11*CO + 0.24*CH3COCHO + 0.26*GLYALD + 0.26*CH3CO3 + 0.25*CH3OH + 0.23*HYAC
    LU(i,8125) = LU(i,8125) + 0.26*rate_constant(i,322) * number_density(i,188)

  end do
  !$acc end parallel

end subroutine dforce_dy57

subroutine dforce_dy58(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell
    !  k_CH3O2_RO2_1: CH3O2 + RO2 -> 0.3*CH3CO3 + 0.8*CH2O + 0.3*HO2 + 0.2*HYAC + 0.5*CH3COCHO + 0.5*CH3OH
    LU(i,8125) = LU(i,8125) + 0.3*rate_constant(i,354) * number_density(i,40)

    ! df_TERPROD1/d(CH3O2)
    !  k_CH3O2_TERPO2_1: CH3O2 + TERPO2 -> 1*TERPROD1 + 0.95*CH2O + 0.25*CH3OH + 1*HO2 + 0.025*CH3COCH3
    LU(i,8129) = LU(i,8129) + rate_constant(i,3) * number_density(i,147)

    !  k_CH3O2_NTERPO2_1: CH3O2 + NTERPO2 -> 0.5*TERPNIT + 0.75*CH2O + 0.25*CH3OH + 0.5*HO2 + 0.5*TERPROD1 + 0.5*NO2
    LU(i,8129) = LU(i,8129) + 0.5*rate_constant(i,135) * number_density(i,143)

    ! df_HYAC/d(CH3O2)
    !  k_CH3O2_MACRO2_1: CH3O2 + MACRO2 -> 0.73*HO2 + 0.88*CH2O + 0.11*CO + 0.24*CH3COCHO + 0.26*GLYALD + 0.26*CH3CO3 + 0.25*CH3OH + 0.23*HYAC
    LU(i,8128) = LU(i,8128) + 0.23*rate_constant(i,322) * number_density(i,188)

    !  k_CH3O2_RO2_1: CH3O2 + RO2 -> 0.3*CH3CO3 + 0.8*CH2O + 0.3*HO2 + 0.2*HYAC + 0.5*CH3COCHO + 0.5*CH3OH
    LU(i,8128) = LU(i,8128) + 0.2*rate_constant(i,354) * number_density(i,40)

    !  k_CH3O2_XO2_1: CH3O2 + XO2 -> 0.3*CH3OH + 0.8*HO2 + 0.8*CH2O + 0.2*CO + 0.1*GLYOXAL + 0.1*CH3COCHO + 0.1*HYAC + 0.1*GLYALD
    LU(i,8128) = LU(i,8128) + 0.1*rate_constant(i,410) * number_density(i,153)

    ! df_NO2/d(CH3O2)
    !  k_CH3O2_NTERPO2_1: CH3O2 + NTERPO2 -> 0.5*TERPNIT + 0.75*CH2O + 0.25*CH3OH + 0.5*HO2 + 0.5*TERPROD1 + 0.5*NO2
    LU(i,8126) = LU(i,8126) + 0.5*rate_constant(i,135) * number_density(i,143)

    !  k_CH3O2_NO_1: CH3O2 + NO -> 1*CH2O + 1*NO2 + 1*HO2
    LU(i,8126) = LU(i,8126) + rate_constant(i,329) * number_density(i,137)

    ! df_NO/d(CH3O2)
    !  k_CH3O2_NO_1: CH3O2 + NO -> 1*CH2O + 1*NO2 + 1*HO2
    LU(i,8156) = LU(i,8156) - rate_constant(i,329) * number_density(i,137)

    ! df_CL/d(CH3O2)
    !  k_CH3O2_CLO_1: CH3O2 + CLO -> 1*CL + 1*HO2 + 1*CH2O
    LU(i,8141) = LU(i,8141) + rate_constant(i,467) * number_density(i,86)

    ! df_CLO/d(CH3O2)
    !  k_CH3O2_CLO_1: CH3O2 + CLO -> 1*CL + 1*HO2 + 1*CH2O
    LU(i,8136) = LU(i,8136) - rate_constant(i,467) * number_density(i,86)

    ! df_CO2/d(CH3O2)
    !  k_CH3O2_MCO3_1: CH3O2 + MCO3 -> 2*CH2O + 1*HO2 + 1*CO2 + 1*CH3CO3
    LU(i,8135) = LU(i,8135) + rate_constant(i,84) * number_density(i,167)

    !  k_CH3CO3_CH3O2_1: CH3CO3 + CH3O2 -> 0.9*CH3O2 + 1*CH2O + 0.9*HO2 + 0.9*CO2 + 0.1*CH3COOH
    LU(i,8135) = LU(i,8135) + 0.9*rate_constant(i,99) * number_density(i,49)

    !  k_CH3O2_TERP2O2_1: CH3O2 + TERP2O2 -> 1*TERPROD2 + 0.93*CH2O + 0.25*CH3OH + 1*HO2 + 0.5*CO2 + 0.125*CO + 0.125*GLYALD + 0.15*CH3COCH3
    LU(i,8135) = LU(i,8135) + 0.5*rate_constant(i,414) * number_density(i,145)

    ! df_C2H5O2/d(CH3O2)
    !  k_C2H5O2_CH3O2_1: C2H5O2 + CH3O2 -> 0.7*CH2O + 0.8*CH3CHO + 1*HO2 + 0.3*CH3OH + 0.2*C2H5OH
    LU(i,8137) = LU(i,8137) - rate_constant(i,277) * number_density(i,87)

    ! df_CH3COCHO/d(CH3O2)
    !  k_CH3O2_MACRO2_1: CH3O2 + MACRO2 -> 0.73*HO2 + 0.88*CH2O + 0.11*CO + 0.24*CH3COCHO + 0.26*GLYALD + 0.26*CH3CO3 + 0.25*CH3OH + 0.23*HYAC
    LU(i,8144) = LU(i,8144) + 0.24*rate_constant(i,322) * number_density(i,188)

    !  k_CH3O2_RO2_1: CH3O2 + RO2 -> 0.3*CH3CO3 + 0.8*CH2O + 0.3*HO2 + 0.2*HYAC + 0.5*CH3COCHO + 0.5*CH3OH
    LU(i,8144) = LU(i,8144) + 0.5*rate_constant(i,354) * number_density(i,40)

    !  k_CH3O2_XO2_1: CH3O2 + XO2 -> 0.3*CH3OH + 0.8*HO2 + 0.8*CH2O + 0.2*CO + 0.1*GLYOXAL + 0.1*CH3COCHO + 0.1*HYAC + 0.1*GLYALD
    LU(i,8144) = LU(i,8144) + 0.1*rate_constant(i,410) * number_density(i,153)

    ! df_CH3COCH3/d(CH3O2)
    !  k_CH3O2_TERPO2_1: CH3O2 + TERPO2 -> 1*TERPROD1 + 0.95*CH2O + 0.25*CH3OH + 1*HO2 + 0.025*CH3COCH3
    LU(i,8139) = LU(i,8139) + 0.025*rate_constant(i,3) * number_density(i,147)

    !  k_C3H7O2_CH3O2_1: C3H7O2 + CH3O2 -> 1*CH2O + 1*HO2 + 0.82*CH3COCH3
    LU(i,8139) = LU(i,8139) + 0.82*rate_constant(i,63) * number_density(i,109)

    !  k_CH3O2_MBOO2_1: CH3O2 + MBOO2 -> 0.917*CH2O + 1*HO2 + 0.25*CH3OH + 0.333*GLYALD + 0.333*CH3COCH3 + 0.167*HMPROP
    LU(i,8139) = LU(i,8139) + 0.333*rate_constant(i,155) * number_density(i,125)

    !  k_CH3O2_TERP2O2_1: CH3O2 + TERP2O2 -> 1*TERPROD2 + 0.93*CH2O + 0.25*CH3OH + 1*HO2 + 0.5*CO2 + 0.125*CO + 0.125*GLYALD + 0.15*CH3COCH3
    LU(i,8139) = LU(i,8139) + 0.15*rate_constant(i,414) * number_density(i,145)

    ! df_C2H5OH/d(CH3O2)
    !  k_C2H5O2_CH3O2_1: C2H5O2 + CH3O2 -> 0.7*CH2O + 0.8*CH3CHO + 1*HO2 + 0.3*CH3OH + 0.2*C2H5OH
    LU(i,8152) = LU(i,8152) + 0.2*rate_constant(i,277) * number_density(i,87)

    ! df_C3H7O2/d(CH3O2)
    !  k_C3H7O2_CH3O2_1: C3H7O2 + CH3O2 -> 1*CH2O + 1*HO2 + 0.82*CH3COCH3
    LU(i,8143) = LU(i,8143) - rate_constant(i,63) * number_density(i,109)

    ! df_CH3O2/d(CH3O2)
    !  k_CH3O2_TERPO2_1: CH3O2 + TERPO2 -> 1*TERPROD1 + 0.95*CH2O + 0.25*CH3OH + 1*HO2 + 0.025*CH3COCH3
    LU(i,8206) = LU(i,8206) - rate_constant(i,3) * number_density(i,147)

    !  k_C3H7O2_CH3O2_1: C3H7O2 + CH3O2 -> 1*CH2O + 1*HO2 + 0.82*CH3COCH3
    LU(i,8206) = LU(i,8206) - rate_constant(i,63) * number_density(i,109)

    !  k_CH3O2_MCO3_1: CH3O2 + MCO3 -> 2*CH2O + 1*HO2 + 1*CO2 + 1*CH3CO3
    LU(i,8206) = LU(i,8206) - rate_constant(i,84) * number_density(i,167)

    !  k_CH3CO3_CH3O2_1: CH3CO3 + CH3O2 -> 0.9*CH3O2 + 1*CH2O + 0.9*HO2 + 0.9*CO2 + 0.1*CH3COOH
    LU(i,8206) = LU(i,8206) - 0.09999999999999998*rate_constant(i,99) * number_density(i,49)

    !  k_CH3O2_NTERPO2_1: CH3O2 + NTERPO2 -> 0.5*TERPNIT + 0.75*CH2O + 0.25*CH3OH + 0.5*HO2 + 0.5*TERPROD1 + 0.5*NO2
    LU(i,8206) = LU(i,8206) - rate_constant(i,135) * number_density(i,143)

    !  k_CH3O2_MBOO2_1: CH3O2 + MBOO2 -> 0.917*CH2O + 1*HO2 + 0.25*CH3OH + 0.333*GLYALD + 0.333*CH3COCH3 + 0.167*HMPROP
    LU(i,8206) = LU(i,8206) - rate_constant(i,155) * number_density(i,125)
  end do
  !$acc end parallel

end subroutine dforce_dy58

subroutine dforce_dy59(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    !  k_CH3O2_ISOPNO3_1: CH3O2 + ISOPNO3 -> 0.8*NC4CHO + 1.2*HO2 + 0.8*CH2O + 0.2*CH3OH + 0.2*NC4CH2OH
    LU(i,8206) = LU(i,8206) - rate_constant(i,160) * number_density(i,46)

    !  k_CH3O2_ISOPBO2_1: CH3O2 + ISOPBO2 -> 0.25*CH3OH + 1*HO2 + 0.75*CH2O + 0.75*HYDRALD
    LU(i,8206) = LU(i,8206) - rate_constant(i,167) * number_density(i,190)

    !  k_C2H5O2_CH3O2_1: C2H5O2 + CH3O2 -> 0.7*CH2O + 0.8*CH3CHO + 1*HO2 + 0.3*CH3OH + 0.2*C2H5OH
    LU(i,8206) = LU(i,8206) - rate_constant(i,277) * number_density(i,87)

    !  k_CH3O2_HO2_1: CH3O2 + HO2 -> 1*CH3OOH + 1*O2
    LU(i,8206) = LU(i,8206) - rate_constant(i,301) * number_density(i,192)

    !  k_CH3O2_MACRO2_1: CH3O2 + MACRO2 -> 0.73*HO2 + 0.88*CH2O + 0.11*CO + 0.24*CH3COCHO + 0.26*GLYALD + 0.26*CH3CO3 + 0.25*CH3OH + 0.23*HYAC
    LU(i,8206) = LU(i,8206) - rate_constant(i,322) * number_density(i,188)

    !  k_CH3O2_NO_1: CH3O2 + NO -> 1*CH2O + 1*NO2 + 1*HO2
    LU(i,8206) = LU(i,8206) - rate_constant(i,329) * number_density(i,137)

    !  k_CH3O2_RO2_1: CH3O2 + RO2 -> 0.3*CH3CO3 + 0.8*CH2O + 0.3*HO2 + 0.2*HYAC + 0.5*CH3COCHO + 0.5*CH3OH
    LU(i,8206) = LU(i,8206) - rate_constant(i,354) * number_density(i,40)

    !  k_CH3O2_XO2_1: CH3O2 + XO2 -> 0.3*CH3OH + 0.8*HO2 + 0.8*CH2O + 0.2*CO + 0.1*GLYOXAL + 0.1*CH3COCHO + 0.1*HYAC + 0.1*GLYALD
    LU(i,8206) = LU(i,8206) - rate_constant(i,410) * number_density(i,153)

    !  k_CH3O2_TERP2O2_1: CH3O2 + TERP2O2 -> 1*TERPROD2 + 0.93*CH2O + 0.25*CH3OH + 1*HO2 + 0.5*CO2 + 0.125*CO + 0.125*GLYALD + 0.15*CH3COCH3
    LU(i,8206) = LU(i,8206) - rate_constant(i,414) * number_density(i,145)

    !  k_CH3O2_CH3O2_1: CH3O2 + CH3O2 -> 2*CH2O + 2*HO2
    LU(i,8206) = LU(i,8206) - rate_constant(i,433) * number_density(i,191)

    !  k_CH3O2_CH3O2_1: CH3O2 + CH3O2 -> 2*CH2O + 2*HO2
    LU(i,8206) = LU(i,8206) - rate_constant(i,433) * number_density(i,191)

    !  k_CH3O2_CH3O2_1: CH3O2 + CH3O2 -> 2*CH2O + 2*HO2
    LU(i,8206) = LU(i,8206) - rate_constant(i,433) * number_density(i,191)

    !  k_CH3O2_CH3O2_1: CH3O2 + CH3O2 -> 2*CH2O + 2*HO2
    LU(i,8206) = LU(i,8206) - rate_constant(i,433) * number_density(i,191)

    !  k_CH3O2_ISOPAO2_1: CH3O2 + ISOPAO2 -> 0.25*CH3OH + 1*HO2 + 1.5*CH2O + 0.31*MACR + 0.44*MVK
    LU(i,8206) = LU(i,8206) - rate_constant(i,434) * number_density(i,189)

    !  k_CH3O2_CH3O2_2: CH3O2 + CH3O2 -> 1*CH2O + 1*CH3OH
    LU(i,8206) = LU(i,8206) - rate_constant(i,459) * number_density(i,191)

    !  k_CH3O2_CH3O2_2: CH3O2 + CH3O2 -> 1*CH2O + 1*CH3OH
    LU(i,8206) = LU(i,8206) - rate_constant(i,459) * number_density(i,191)

    !  k_CH3O2_CH3O2_2: CH3O2 + CH3O2 -> 1*CH2O + 1*CH3OH
    LU(i,8206) = LU(i,8206) - rate_constant(i,459) * number_density(i,191)

    !  k_CH3O2_CH3O2_2: CH3O2 + CH3O2 -> 1*CH2O + 1*CH3OH
    LU(i,8206) = LU(i,8206) - rate_constant(i,459) * number_density(i,191)

    !  k_CH3O2_CLO_1: CH3O2 + CLO -> 1*CL + 1*HO2 + 1*CH2O
    LU(i,8206) = LU(i,8206) - rate_constant(i,467) * number_density(i,86)

    ! df_CH2O/d(CH3O2)
    !  k_CH3O2_TERPO2_1: CH3O2 + TERPO2 -> 1*TERPROD1 + 0.95*CH2O + 0.25*CH3OH + 1*HO2 + 0.025*CH3COCH3
    LU(i,8150) = LU(i,8150) + 0.95*rate_constant(i,3) * number_density(i,147)

    !  k_C3H7O2_CH3O2_1: C3H7O2 + CH3O2 -> 1*CH2O + 1*HO2 + 0.82*CH3COCH3
    LU(i,8150) = LU(i,8150) + rate_constant(i,63) * number_density(i,109)

    !  k_CH3O2_MCO3_1: CH3O2 + MCO3 -> 2*CH2O + 1*HO2 + 1*CO2 + 1*CH3CO3
    LU(i,8150) = LU(i,8150) + 2*rate_constant(i,84) * number_density(i,167)

    !  k_CH3CO3_CH3O2_1: CH3CO3 + CH3O2 -> 0.9*CH3O2 + 1*CH2O + 0.9*HO2 + 0.9*CO2 + 0.1*CH3COOH
    LU(i,8150) = LU(i,8150) + rate_constant(i,99) * number_density(i,49)

    !  k_CH3O2_NTERPO2_1: CH3O2 + NTERPO2 -> 0.5*TERPNIT + 0.75*CH2O + 0.25*CH3OH + 0.5*HO2 + 0.5*TERPROD1 + 0.5*NO2
    LU(i,8150) = LU(i,8150) + 0.75*rate_constant(i,135) * number_density(i,143)

    !  k_CH3O2_MBOO2_1: CH3O2 + MBOO2 -> 0.917*CH2O + 1*HO2 + 0.25*CH3OH + 0.333*GLYALD + 0.333*CH3COCH3 + 0.167*HMPROP
    LU(i,8150) = LU(i,8150) + 0.917*rate_constant(i,155) * number_density(i,125)

    !  k_CH3O2_ISOPNO3_1: CH3O2 + ISOPNO3 -> 0.8*NC4CHO + 1.2*HO2 + 0.8*CH2O + 0.2*CH3OH + 0.2*NC4CH2OH
    LU(i,8150) = LU(i,8150) + 0.8*rate_constant(i,160) * number_density(i,46)

    !  k_CH3O2_ISOPBO2_1: CH3O2 + ISOPBO2 -> 0.25*CH3OH + 1*HO2 + 0.75*CH2O + 0.75*HYDRALD
    LU(i,8150) = LU(i,8150) + 0.75*rate_constant(i,167) * number_density(i,190)

    !  k_C2H5O2_CH3O2_1: C2H5O2 + CH3O2 -> 0.7*CH2O + 0.8*CH3CHO + 1*HO2 + 0.3*CH3OH + 0.2*C2H5OH
    LU(i,8150) = LU(i,8150) + 0.7*rate_constant(i,277) * number_density(i,87)

    !  k_CH3O2_MACRO2_1: CH3O2 + MACRO2 -> 0.73*HO2 + 0.88*CH2O + 0.11*CO + 0.24*CH3COCHO + 0.26*GLYALD + 0.26*CH3CO3 + 0.25*CH3OH + 0.23*HYAC
    LU(i,8150) = LU(i,8150) + 0.88*rate_constant(i,322) * number_density(i,188)

    !  k_CH3O2_NO_1: CH3O2 + NO -> 1*CH2O + 1*NO2 + 1*HO2
    LU(i,8150) = LU(i,8150) + rate_constant(i,329) * number_density(i,137)

    !  k_CH3O2_RO2_1: CH3O2 + RO2 -> 0.3*CH3CO3 + 0.8*CH2O + 0.3*HO2 + 0.2*HYAC + 0.5*CH3COCHO + 0.5*CH3OH
    LU(i,8150) = LU(i,8150) + 0.8*rate_constant(i,354) * number_density(i,40)

    !  k_CH3O2_XO2_1: CH3O2 + XO2 -> 0.3*CH3OH + 0.8*HO2 + 0.8*CH2O + 0.2*CO + 0.1*GLYOXAL + 0.1*CH3COCHO + 0.1*HYAC + 0.1*GLYALD
    LU(i,8150) = LU(i,8150) + 0.8*rate_constant(i,410) * number_density(i,153)

    !  k_CH3O2_TERP2O2_1: CH3O2 + TERP2O2 -> 1*TERPROD2 + 0.93*CH2O + 0.25*CH3OH + 1*HO2 + 0.5*CO2 + 0.125*CO + 0.125*GLYALD + 0.15*CH3COCH3
    LU(i,8150) = LU(i,8150) + 0.93*rate_constant(i,414) * number_density(i,145)

  end do
  !$acc end parallel

end subroutine dforce_dy59

subroutine dforce_dy60(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell
    !  k_CH3O2_CH3O2_1: CH3O2 + CH3O2 -> 2*CH2O + 2*HO2
    LU(i,8150) = LU(i,8150) + 2*rate_constant(i,433) * number_density(i,191)

    !  k_CH3O2_CH3O2_1: CH3O2 + CH3O2 -> 2*CH2O + 2*HO2
    LU(i,8150) = LU(i,8150) + 2*rate_constant(i,433) * number_density(i,191)

    !  k_CH3O2_ISOPAO2_1: CH3O2 + ISOPAO2 -> 0.25*CH3OH + 1*HO2 + 1.5*CH2O + 0.31*MACR + 0.44*MVK
    LU(i,8150) = LU(i,8150) + 1.5*rate_constant(i,434) * number_density(i,189)

    !  k_CH3O2_CH3O2_2: CH3O2 + CH3O2 -> 1*CH2O + 1*CH3OH
    LU(i,8150) = LU(i,8150) + rate_constant(i,459) * number_density(i,191)

    !  k_CH3O2_CH3O2_2: CH3O2 + CH3O2 -> 1*CH2O + 1*CH3OH
    LU(i,8150) = LU(i,8150) + rate_constant(i,459) * number_density(i,191)

    !  k_CH3O2_CLO_1: CH3O2 + CLO -> 1*CL + 1*HO2 + 1*CH2O
    LU(i,8150) = LU(i,8150) + rate_constant(i,467) * number_density(i,86)

    ! df_CH3OH/d(CH3O2)
    !  k_CH3O2_TERPO2_1: CH3O2 + TERPO2 -> 1*TERPROD1 + 0.95*CH2O + 0.25*CH3OH + 1*HO2 + 0.025*CH3COCH3
    LU(i,8149) = LU(i,8149) + 0.25*rate_constant(i,3) * number_density(i,147)

    !  k_CH3O2_NTERPO2_1: CH3O2 + NTERPO2 -> 0.5*TERPNIT + 0.75*CH2O + 0.25*CH3OH + 0.5*HO2 + 0.5*TERPROD1 + 0.5*NO2
    LU(i,8149) = LU(i,8149) + 0.25*rate_constant(i,135) * number_density(i,143)

    !  k_CH3O2_MBOO2_1: CH3O2 + MBOO2 -> 0.917*CH2O + 1*HO2 + 0.25*CH3OH + 0.333*GLYALD + 0.333*CH3COCH3 + 0.167*HMPROP
    LU(i,8149) = LU(i,8149) + 0.25*rate_constant(i,155) * number_density(i,125)

    !  k_CH3O2_ISOPNO3_1: CH3O2 + ISOPNO3 -> 0.8*NC4CHO + 1.2*HO2 + 0.8*CH2O + 0.2*CH3OH + 0.2*NC4CH2OH
    LU(i,8149) = LU(i,8149) + 0.2*rate_constant(i,160) * number_density(i,46)

    !  k_CH3O2_ISOPBO2_1: CH3O2 + ISOPBO2 -> 0.25*CH3OH + 1*HO2 + 0.75*CH2O + 0.75*HYDRALD
    LU(i,8149) = LU(i,8149) + 0.25*rate_constant(i,167) * number_density(i,190)

    !  k_C2H5O2_CH3O2_1: C2H5O2 + CH3O2 -> 0.7*CH2O + 0.8*CH3CHO + 1*HO2 + 0.3*CH3OH + 0.2*C2H5OH
    LU(i,8149) = LU(i,8149) + 0.3*rate_constant(i,277) * number_density(i,87)

    !  k_CH3O2_MACRO2_1: CH3O2 + MACRO2 -> 0.73*HO2 + 0.88*CH2O + 0.11*CO + 0.24*CH3COCHO + 0.26*GLYALD + 0.26*CH3CO3 + 0.25*CH3OH + 0.23*HYAC
    LU(i,8149) = LU(i,8149) + 0.25*rate_constant(i,322) * number_density(i,188)

    !  k_CH3O2_RO2_1: CH3O2 + RO2 -> 0.3*CH3CO3 + 0.8*CH2O + 0.3*HO2 + 0.2*HYAC + 0.5*CH3COCHO + 0.5*CH3OH
    LU(i,8149) = LU(i,8149) + 0.5*rate_constant(i,354) * number_density(i,40)

    !  k_CH3O2_XO2_1: CH3O2 + XO2 -> 0.3*CH3OH + 0.8*HO2 + 0.8*CH2O + 0.2*CO + 0.1*GLYOXAL + 0.1*CH3COCHO + 0.1*HYAC + 0.1*GLYALD
    LU(i,8149) = LU(i,8149) + 0.3*rate_constant(i,410) * number_density(i,153)

    !  k_CH3O2_TERP2O2_1: CH3O2 + TERP2O2 -> 1*TERPROD2 + 0.93*CH2O + 0.25*CH3OH + 1*HO2 + 0.5*CO2 + 0.125*CO + 0.125*GLYALD + 0.15*CH3COCH3
    LU(i,8149) = LU(i,8149) + 0.25*rate_constant(i,414) * number_density(i,145)

    !  k_CH3O2_ISOPAO2_1: CH3O2 + ISOPAO2 -> 0.25*CH3OH + 1*HO2 + 1.5*CH2O + 0.31*MACR + 0.44*MVK
    LU(i,8149) = LU(i,8149) + 0.25*rate_constant(i,434) * number_density(i,189)

    !  k_CH3O2_CH3O2_2: CH3O2 + CH3O2 -> 1*CH2O + 1*CH3OH
    LU(i,8149) = LU(i,8149) + rate_constant(i,459) * number_density(i,191)

    !  k_CH3O2_CH3O2_2: CH3O2 + CH3O2 -> 1*CH2O + 1*CH3OH
    LU(i,8149) = LU(i,8149) + rate_constant(i,459) * number_density(i,191)

    ! df_CH3OOH/d(CH3O2)
    !  k_CH3O2_HO2_1: CH3O2 + HO2 -> 1*CH3OOH + 1*O2
    LU(i,8155) = LU(i,8155) + rate_constant(i,301) * number_density(i,192)

    ! df_MACRO2/d(CH3O2)
    !  k_CH3O2_MACRO2_1: CH3O2 + MACRO2 -> 0.73*HO2 + 0.88*CH2O + 0.11*CO + 0.24*CH3COCHO + 0.26*GLYALD + 0.26*CH3CO3 + 0.25*CH3OH + 0.23*HYAC
    LU(i,8203) = LU(i,8203) - rate_constant(i,322) * number_density(i,188)

    ! df_ISOPAO2/d(CH3O2)
    !  k_CH3O2_ISOPAO2_1: CH3O2 + ISOPAO2 -> 0.25*CH3OH + 1*HO2 + 1.5*CH2O + 0.31*MACR + 0.44*MVK
    LU(i,8204) = LU(i,8204) - rate_constant(i,434) * number_density(i,189)

    ! df_MBOO2/d(CH3O2)
    !  k_CH3O2_MBOO2_1: CH3O2 + MBOO2 -> 0.917*CH2O + 1*HO2 + 0.25*CH3OH + 0.333*GLYALD + 0.333*CH3COCH3 + 0.167*HMPROP
    LU(i,8151) = LU(i,8151) - rate_constant(i,155) * number_density(i,125)

    ! df_ISOPBO2/d(CH3O2)
    !  k_CH3O2_ISOPBO2_1: CH3O2 + ISOPBO2 -> 0.25*CH3OH + 1*HO2 + 0.75*CH2O + 0.75*HYDRALD
    LU(i,8205) = LU(i,8205) - rate_constant(i,167) * number_density(i,190)

    ! df_MCO3/d(CH3O2)
    !  k_CH3O2_MCO3_1: CH3O2 + MCO3 -> 2*CH2O + 1*HO2 + 1*CO2 + 1*CH3CO3
    LU(i,8182) = LU(i,8182) - rate_constant(i,84) * number_density(i,167)

    ! df_GLYOXAL/d(CH3O2)
    !  k_CH3O2_XO2_1: CH3O2 + XO2 -> 0.3*CH3OH + 0.8*HO2 + 0.8*CH2O + 0.2*CO + 0.1*GLYOXAL + 0.1*CH3COCHO + 0.1*HYAC + 0.1*GLYALD
    LU(i,8153) = LU(i,8153) + 0.1*rate_constant(i,410) * number_density(i,153)

    ! df_HMPROP/d(CH3O2)
    !  k_CH3O2_MBOO2_1: CH3O2 + MBOO2 -> 0.917*CH2O + 1*HO2 + 0.25*CH3OH + 0.333*GLYALD + 0.333*CH3COCH3 + 0.167*HMPROP
    LU(i,8154) = LU(i,8154) + 0.167*rate_constant(i,155) * number_density(i,125)

    ! df_NC4CH2OH/d(CH3O2)
    !  k_CH3O2_ISOPNO3_1: CH3O2 + ISOPNO3 -> 0.8*NC4CHO + 1.2*HO2 + 0.8*CH2O + 0.2*CH3OH + 0.2*NC4CH2OH
    LU(i,8173) = LU(i,8173) + 0.2*rate_constant(i,160) * number_density(i,46)

    ! df_GLYALD/d(CH3O2)
    !  k_CH3O2_MBOO2_1: CH3O2 + MBOO2 -> 0.917*CH2O + 1*HO2 + 0.25*CH3OH + 0.333*GLYALD + 0.333*CH3COCH3 + 0.167*HMPROP
    LU(i,8171) = LU(i,8171) + 0.333*rate_constant(i,155) * number_density(i,125)

    !  k_CH3O2_MACRO2_1: CH3O2 + MACRO2 -> 0.73*HO2 + 0.88*CH2O + 0.11*CO + 0.24*CH3COCHO + 0.26*GLYALD + 0.26*CH3CO3 + 0.25*CH3OH + 0.23*HYAC
    LU(i,8171) = LU(i,8171) + 0.26*rate_constant(i,322) * number_density(i,188)

  end do
  !$acc end parallel

end subroutine dforce_dy60

subroutine dforce_dy61(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
