    LU(i,8171) = LU(i,8171) + 0.125*rate_constant(i,414) * number_density(i,145)

    ! df_HO2/d(CH3O2)
    !  k_CH3O2_TERPO2_1: CH3O2 + TERPO2 -> 1*TERPROD1 + 0.95*CH2O + 0.25*CH3OH + 1*HO2 + 0.025*CH3COCH3
    LU(i,8207) = LU(i,8207) + rate_constant(i,3) * number_density(i,147)

    !  k_C3H7O2_CH3O2_1: C3H7O2 + CH3O2 -> 1*CH2O + 1*HO2 + 0.82*CH3COCH3
    LU(i,8207) = LU(i,8207) + rate_constant(i,63) * number_density(i,109)

    !  k_CH3O2_MCO3_1: CH3O2 + MCO3 -> 2*CH2O + 1*HO2 + 1*CO2 + 1*CH3CO3
    LU(i,8207) = LU(i,8207) + rate_constant(i,84) * number_density(i,167)

    !  k_CH3CO3_CH3O2_1: CH3CO3 + CH3O2 -> 0.9*CH3O2 + 1*CH2O + 0.9*HO2 + 0.9*CO2 + 0.1*CH3COOH
    LU(i,8207) = LU(i,8207) + 0.9*rate_constant(i,99) * number_density(i,49)

    !  k_CH3O2_NTERPO2_1: CH3O2 + NTERPO2 -> 0.5*TERPNIT + 0.75*CH2O + 0.25*CH3OH + 0.5*HO2 + 0.5*TERPROD1 + 0.5*NO2
    LU(i,8207) = LU(i,8207) + 0.5*rate_constant(i,135) * number_density(i,143)

    !  k_CH3O2_MBOO2_1: CH3O2 + MBOO2 -> 0.917*CH2O + 1*HO2 + 0.25*CH3OH + 0.333*GLYALD + 0.333*CH3COCH3 + 0.167*HMPROP
    LU(i,8207) = LU(i,8207) + rate_constant(i,155) * number_density(i,125)

    !  k_CH3O2_ISOPNO3_1: CH3O2 + ISOPNO3 -> 0.8*NC4CHO + 1.2*HO2 + 0.8*CH2O + 0.2*CH3OH + 0.2*NC4CH2OH
    LU(i,8207) = LU(i,8207) + 1.2*rate_constant(i,160) * number_density(i,46)

    !  k_CH3O2_ISOPBO2_1: CH3O2 + ISOPBO2 -> 0.25*CH3OH + 1*HO2 + 0.75*CH2O + 0.75*HYDRALD
    LU(i,8207) = LU(i,8207) + rate_constant(i,167) * number_density(i,190)

    !  k_C2H5O2_CH3O2_1: C2H5O2 + CH3O2 -> 0.7*CH2O + 0.8*CH3CHO + 1*HO2 + 0.3*CH3OH + 0.2*C2H5OH
    LU(i,8207) = LU(i,8207) + rate_constant(i,277) * number_density(i,87)

    !  k_CH3O2_HO2_1: CH3O2 + HO2 -> 1*CH3OOH + 1*O2
    LU(i,8207) = LU(i,8207) - rate_constant(i,301) * number_density(i,192)

    !  k_CH3O2_MACRO2_1: CH3O2 + MACRO2 -> 0.73*HO2 + 0.88*CH2O + 0.11*CO + 0.24*CH3COCHO + 0.26*GLYALD + 0.26*CH3CO3 + 0.25*CH3OH + 0.23*HYAC
    LU(i,8207) = LU(i,8207) + 0.73*rate_constant(i,322) * number_density(i,188)

    !  k_CH3O2_NO_1: CH3O2 + NO -> 1*CH2O + 1*NO2 + 1*HO2
    LU(i,8207) = LU(i,8207) + rate_constant(i,329) * number_density(i,137)

    !  k_CH3O2_RO2_1: CH3O2 + RO2 -> 0.3*CH3CO3 + 0.8*CH2O + 0.3*HO2 + 0.2*HYAC + 0.5*CH3COCHO + 0.5*CH3OH
    LU(i,8207) = LU(i,8207) + 0.3*rate_constant(i,354) * number_density(i,40)

    !  k_CH3O2_XO2_1: CH3O2 + XO2 -> 0.3*CH3OH + 0.8*HO2 + 0.8*CH2O + 0.2*CO + 0.1*GLYOXAL + 0.1*CH3COCHO + 0.1*HYAC + 0.1*GLYALD
    LU(i,8207) = LU(i,8207) + 0.8*rate_constant(i,410) * number_density(i,153)

    !  k_CH3O2_TERP2O2_1: CH3O2 + TERP2O2 -> 1*TERPROD2 + 0.93*CH2O + 0.25*CH3OH + 1*HO2 + 0.5*CO2 + 0.125*CO + 0.125*GLYALD + 0.15*CH3COCH3
    LU(i,8207) = LU(i,8207) + rate_constant(i,414) * number_density(i,145)

    !  k_CH3O2_CH3O2_1: CH3O2 + CH3O2 -> 2*CH2O + 2*HO2
    LU(i,8207) = LU(i,8207) + 2*rate_constant(i,433) * number_density(i,191)

    !  k_CH3O2_CH3O2_1: CH3O2 + CH3O2 -> 2*CH2O + 2*HO2
    LU(i,8207) = LU(i,8207) + 2*rate_constant(i,433) * number_density(i,191)

    !  k_CH3O2_ISOPAO2_1: CH3O2 + ISOPAO2 -> 0.25*CH3OH + 1*HO2 + 1.5*CH2O + 0.31*MACR + 0.44*MVK
    LU(i,8207) = LU(i,8207) + rate_constant(i,434) * number_density(i,189)

    !  k_CH3O2_CLO_1: CH3O2 + CLO -> 1*CL + 1*HO2 + 1*CH2O
    LU(i,8207) = LU(i,8207) + rate_constant(i,467) * number_density(i,86)

    ! df_HYDRALD/d(CH3O2)
    !  k_CH3O2_ISOPBO2_1: CH3O2 + ISOPBO2 -> 0.25*CH3OH + 1*HO2 + 0.75*CH2O + 0.75*HYDRALD
    LU(i,8157) = LU(i,8157) + 0.75*rate_constant(i,167) * number_density(i,190)

    ! df_NTERPO2/d(CH3O2)
    !  k_CH3O2_NTERPO2_1: CH3O2 + NTERPO2 -> 0.5*TERPNIT + 0.75*CH2O + 0.25*CH3OH + 0.5*HO2 + 0.5*TERPROD1 + 0.5*NO2
    LU(i,8158) = LU(i,8158) - rate_constant(i,135) * number_density(i,143)

    ! df_TERP2O2/d(CH3O2)
    !  k_CH3O2_TERP2O2_1: CH3O2 + TERP2O2 -> 1*TERPROD2 + 0.93*CH2O + 0.25*CH3OH + 1*HO2 + 0.5*CO2 + 0.125*CO + 0.125*GLYALD + 0.15*CH3COCH3
    LU(i,8160) = LU(i,8160) - rate_constant(i,414) * number_density(i,145)

    ! df_TERPO2/d(CH3O2)
    !  k_CH3O2_TERPO2_1: CH3O2 + TERPO2 -> 1*TERPROD1 + 0.95*CH2O + 0.25*CH3OH + 1*HO2 + 0.025*CH3COCH3
    LU(i,8162) = LU(i,8162) - rate_constant(i,3) * number_density(i,147)

    ! df_XO2/d(CH3O2)
    !  k_CH3O2_XO2_1: CH3O2 + XO2 -> 0.3*CH3OH + 0.8*HO2 + 0.8*CH2O + 0.2*CO + 0.1*GLYOXAL + 0.1*CH3COCHO + 0.1*HYAC + 0.1*GLYALD
    LU(i,8168) = LU(i,8168) - rate_constant(i,410) * number_density(i,153)

    ! df_TERPROD2/d(CH3O2)
    !  k_CH3O2_TERP2O2_1: CH3O2 + TERP2O2 -> 1*TERPROD2 + 0.93*CH2O + 0.25*CH3OH + 1*HO2 + 0.5*CO2 + 0.125*CO + 0.125*GLYALD + 0.15*CH3COCH3
    LU(i,8170) = LU(i,8170) + rate_constant(i,414) * number_density(i,145)

    ! df_MACR/d(CH3O2)
    !  k_CH3O2_ISOPAO2_1: CH3O2 + ISOPAO2 -> 0.25*CH3OH + 1*HO2 + 1.5*CH2O + 0.31*MACR + 0.44*MVK
    LU(i,8172) = LU(i,8172) + 0.31*rate_constant(i,434) * number_density(i,189)

    ! df_CO/d(CH3O2)
    !  k_CH3O2_MACRO2_1: CH3O2 + MACRO2 -> 0.73*HO2 + 0.88*CH2O + 0.11*CO + 0.24*CH3COCHO + 0.26*GLYALD + 0.26*CH3CO3 + 0.25*CH3OH + 0.23*HYAC
    LU(i,8191) = LU(i,8191) + 0.11*rate_constant(i,322) * number_density(i,188)

    !  k_CH3O2_XO2_1: CH3O2 + XO2 -> 0.3*CH3OH + 0.8*HO2 + 0.8*CH2O + 0.2*CO + 0.1*GLYOXAL + 0.1*CH3COCHO + 0.1*HYAC + 0.1*GLYALD
    LU(i,8191) = LU(i,8191) + 0.2*rate_constant(i,410) * number_density(i,153)

    !  k_CH3O2_TERP2O2_1: CH3O2 + TERP2O2 -> 1*TERPROD2 + 0.93*CH2O + 0.25*CH3OH + 1*HO2 + 0.5*CO2 + 0.125*CO + 0.125*GLYALD + 0.15*CH3COCH3
    LU(i,8191) = LU(i,8191) + 0.125*rate_constant(i,414) * number_density(i,145)
  end do
  !$acc end parallel

end subroutine dforce_dy61

subroutine dforce_dy62(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! df_CH3COOH/d(CH3O2)
    !  k_CH3CO3_CH3O2_1: CH3CO3 + CH3O2 -> 0.9*CH3O2 + 1*CH2O + 0.9*HO2 + 0.9*CO2 + 0.1*CH3COOH
    LU(i,8192) = LU(i,8192) + 0.1*rate_constant(i,99) * number_density(i,49)

    ! df_CH3CHO/d(CH3O2)
    !  k_C2H5O2_CH3O2_1: C2H5O2 + CH3O2 -> 0.7*CH2O + 0.8*CH3CHO + 1*HO2 + 0.3*CH3OH + 0.2*C2H5OH
    LU(i,8193) = LU(i,8193) + 0.8*rate_constant(i,277) * number_density(i,87)

    ! df_NC4CHO/d(CH3O2)
    !  k_CH3O2_ISOPNO3_1: CH3O2 + ISOPNO3 -> 0.8*NC4CHO + 1.2*HO2 + 0.8*CH2O + 0.2*CH3OH + 0.2*NC4CH2OH
    LU(i,8117) = LU(i,8117) + 0.8*rate_constant(i,160) * number_density(i,46)

    ! df_SOAG0/d(BCARY)
    !  k_BCARY_OH_1: BCARY + OH -> 1*BCARY + 1*OH + 0.2202*SOAG0 + 0.2067*SOAG1 + 0.0653*SOAG2 + 0.1284*SOAG3 + 0.114*SOAG4
    LU(i,2013) = LU(i,2013) + 0.2202*rate_constant(i,168) * number_density(i,166)

    !  k_BCARY_O3_2: BCARY + O3 -> 1*BCARY + 1*O3 + 0.2202*SOAG0 + 0.2067*SOAG1 + 0.0653*SOAG2 + 0.1284*SOAG3 + 0.114*SOAG4
    LU(i,2013) = LU(i,2013) + 0.2202*rate_constant(i,349) * number_density(i,171)

    ! df_SOAG1/d(BCARY)
    !  k_BCARY_OH_1: BCARY + OH -> 1*BCARY + 1*OH + 0.2202*SOAG0 + 0.2067*SOAG1 + 0.0653*SOAG2 + 0.1284*SOAG3 + 0.114*SOAG4
    LU(i,2014) = LU(i,2014) + 0.2067*rate_constant(i,168) * number_density(i,166)

    !  k_BCARY_O3_2: BCARY + O3 -> 1*BCARY + 1*O3 + 0.2202*SOAG0 + 0.2067*SOAG1 + 0.0653*SOAG2 + 0.1284*SOAG3 + 0.114*SOAG4
    LU(i,2014) = LU(i,2014) + 0.2067*rate_constant(i,349) * number_density(i,171)

    ! df_SOAG2/d(BCARY)
    !  k_BCARY_OH_1: BCARY + OH -> 1*BCARY + 1*OH + 0.2202*SOAG0 + 0.2067*SOAG1 + 0.0653*SOAG2 + 0.1284*SOAG3 + 0.114*SOAG4
    LU(i,2015) = LU(i,2015) + 0.0653*rate_constant(i,168) * number_density(i,166)

    !  k_BCARY_O3_2: BCARY + O3 -> 1*BCARY + 1*O3 + 0.2202*SOAG0 + 0.2067*SOAG1 + 0.0653*SOAG2 + 0.1284*SOAG3 + 0.114*SOAG4
    LU(i,2015) = LU(i,2015) + 0.0653*rate_constant(i,349) * number_density(i,171)

    ! df_SOAG3/d(BCARY)
    !  k_BCARY_OH_1: BCARY + OH -> 1*BCARY + 1*OH + 0.2202*SOAG0 + 0.2067*SOAG1 + 0.0653*SOAG2 + 0.1284*SOAG3 + 0.114*SOAG4
    LU(i,2016) = LU(i,2016) + 0.1284*rate_constant(i,168) * number_density(i,166)

    !  k_BCARY_O3_2: BCARY + O3 -> 1*BCARY + 1*O3 + 0.2202*SOAG0 + 0.2067*SOAG1 + 0.0653*SOAG2 + 0.1284*SOAG3 + 0.114*SOAG4
    LU(i,2016) = LU(i,2016) + 0.1284*rate_constant(i,349) * number_density(i,171)

    !  k_BCARY_NO3_2: BCARY + NO3 -> 1*BCARY + 1*NO3 + 0.17493*SOAG3 + 0.59019*SOAG4
    LU(i,2016) = LU(i,2016) + 0.17493*rate_constant(i,358) * number_density(i,165)

    ! df_SOAG4/d(BCARY)
    !  k_BCARY_OH_1: BCARY + OH -> 1*BCARY + 1*OH + 0.2202*SOAG0 + 0.2067*SOAG1 + 0.0653*SOAG2 + 0.1284*SOAG3 + 0.114*SOAG4
    LU(i,2017) = LU(i,2017) + 0.114*rate_constant(i,168) * number_density(i,166)

    !  k_BCARY_O3_2: BCARY + O3 -> 1*BCARY + 1*O3 + 0.2202*SOAG0 + 0.2067*SOAG1 + 0.0653*SOAG2 + 0.1284*SOAG3 + 0.114*SOAG4
    LU(i,2017) = LU(i,2017) + 0.114*rate_constant(i,349) * number_density(i,171)

    !  k_BCARY_NO3_2: BCARY + NO3 -> 1*BCARY + 1*NO3 + 0.17493*SOAG3 + 0.59019*SOAG4
    LU(i,2017) = LU(i,2017) + 0.59019*rate_constant(i,358) * number_density(i,165)

    ! df_RO2/d(BCARY)
    !  k_BCARY_O3_1: BCARY + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,2018) = LU(i,2018) + 0.06*rate_constant(i,229) * number_density(i,171)

    ! df_CH3CO3/d(BCARY)
    !  k_BCARY_O3_1: BCARY + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,2019) = LU(i,2019) + 0.06*rate_constant(i,229) * number_density(i,171)

    ! df_TERPROD1/d(BCARY)
    !  k_BCARY_O3_1: BCARY + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,2023) = LU(i,2023) + 0.33*rate_constant(i,229) * number_density(i,171)

    ! df_CO2/d(BCARY)
    !  k_BCARY_O3_1: BCARY + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,2029) = LU(i,2029) + 0.27*rate_constant(i,229) * number_density(i,171)

    ! df_HCOOH/d(BCARY)
    !  k_BCARY_O3_1: BCARY + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,2040) = LU(i,2040) + 0.05*rate_constant(i,229) * number_density(i,171)

    ! df_CH3COCH3/d(BCARY)
    !  k_BCARY_O3_1: BCARY + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,2032) = LU(i,2032) + 0.52*rate_constant(i,229) * number_density(i,171)

    ! df_BCARY/d(BCARY)
    !  k_BCARY_NO3_1: BCARY + NO3 -> 1*NTERPO2
    LU(i,2035) = LU(i,2035) - rate_constant(i,225) * number_density(i,165)

    !  k_BCARY_O3_1: BCARY + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,2035) = LU(i,2035) - rate_constant(i,229) * number_density(i,171)

    !  k_BCARY_OH_2: BCARY + OH -> 1*TERPO2
    LU(i,2035) = LU(i,2035) - rate_constant(i,232) * number_density(i,166)

    ! df_BIGALD/d(BCARY)
    !  k_BCARY_O3_1: BCARY + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,2036) = LU(i,2036) + 0.1*rate_constant(i,229) * number_density(i,171)

    ! df_BIGALK/d(BCARY)
    !  k_BCARY_O3_1: BCARY + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,2046) = LU(i,2046) + 0.05*rate_constant(i,229) * number_density(i,171)

    ! df_CH2O/d(BCARY)
    !  k_BCARY_O3_1: BCARY + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,2044) = LU(i,2044) + 0.34*rate_constant(i,229) * number_density(i,171)

    ! df_HO2/d(BCARY)
    !  k_BCARY_O3_1: BCARY + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,2092) = LU(i,2092) + 0.57*rate_constant(i,229) * number_density(i,171)
  end do
  !$acc end parallel

end subroutine dforce_dy62

subroutine dforce_dy63(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! df_NTERPO2/d(BCARY)
    !  k_BCARY_NO3_1: BCARY + NO3 -> 1*NTERPO2
    LU(i,2050) = LU(i,2050) + rate_constant(i,225) * number_density(i,165)

    ! df_TERPO2/d(BCARY)
    !  k_BCARY_OH_2: BCARY + OH -> 1*TERPO2
    LU(i,2052) = LU(i,2052) + rate_constant(i,232) * number_density(i,166)

    ! df_TERPROD2/d(BCARY)
    !  k_BCARY_O3_1: BCARY + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,2056) = LU(i,2056) + 0.3*rate_constant(i,229) * number_density(i,171)

    ! df_NO3/d(BCARY)
    !  k_BCARY_NO3_1: BCARY + NO3 -> 1*NTERPO2
    LU(i,2066) = LU(i,2066) - rate_constant(i,225) * number_density(i,165)

    ! df_OH/d(BCARY)
    !  k_BCARY_O3_1: BCARY + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,2067) = LU(i,2067) + 0.63*rate_constant(i,229) * number_density(i,171)

    !  k_BCARY_OH_2: BCARY + OH -> 1*TERPO2
    LU(i,2067) = LU(i,2067) - rate_constant(i,232) * number_density(i,166)

    ! df_O3/d(BCARY)
    !  k_BCARY_O3_1: BCARY + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,2072) = LU(i,2072) - rate_constant(i,229) * number_density(i,171)

    ! df_CO/d(BCARY)
    !  k_BCARY_O3_1: BCARY + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,2076) = LU(i,2076) + 0.23*rate_constant(i,229) * number_density(i,171)

    ! df_CH3CO3/d(BIGALD)
    !  k_BIGALD_1: BIGALD -> 0.45*CO + 0.13*GLYOXAL + 0.56*HO2 + 0.13*CH3CO3 + 0.18*CH3COCHO
    LU(i,2163) = LU(i,2163) + 0.13*rate_constant(i,469)

    ! df_CH3COCHO/d(BIGALD)
    !  k_BIGALD_1: BIGALD -> 0.45*CO + 0.13*GLYOXAL + 0.56*HO2 + 0.13*CH3CO3 + 0.18*CH3COCHO
    LU(i,2179) = LU(i,2179) + 0.18*rate_constant(i,469)

    ! df_BIGALD/d(BIGALD)
    !  k_BIGALD_1: BIGALD -> 0.45*CO + 0.13*GLYOXAL + 0.56*HO2 + 0.13*CH3CO3 + 0.18*CH3COCHO
    LU(i,2177) = LU(i,2177) - rate_constant(i,469)

    ! df_GLYOXAL/d(BIGALD)
    !  k_BIGALD_1: BIGALD -> 0.45*CO + 0.13*GLYOXAL + 0.56*HO2 + 0.13*CH3CO3 + 0.18*CH3COCHO
    LU(i,2186) = LU(i,2186) + 0.13*rate_constant(i,469)

    ! df_HO2/d(BIGALD)
    !  k_BIGALD_1: BIGALD -> 0.45*CO + 0.13*GLYOXAL + 0.56*HO2 + 0.13*CH3CO3 + 0.18*CH3COCHO
    LU(i,2227) = LU(i,2227) + 0.56*rate_constant(i,469)

    ! df_CO/d(BIGALD)
    !  k_BIGALD_1: BIGALD -> 0.45*CO + 0.13*GLYOXAL + 0.56*HO2 + 0.13*CH3CO3 + 0.18*CH3COCHO
    LU(i,2211) = LU(i,2211) + 0.45*rate_constant(i,469)

    ! df_BIGALD2/d(BIGALD2)
    !  k_BIGALD2_1: BIGALD2 -> 0.6*HO2 + 0.6*DICARBO2
    LU(i,2831) = LU(i,2831) - rate_constant(i,375)

    ! df_HO2/d(BIGALD2)
    !  k_BIGALD2_1: BIGALD2 -> 0.6*HO2 + 0.6*DICARBO2
    LU(i,2833) = LU(i,2833) + 0.6*rate_constant(i,375)

    ! df_DICARBO2/d(BIGALD2)
    !  k_BIGALD2_1: BIGALD2 -> 0.6*HO2 + 0.6*DICARBO2
    LU(i,2832) = LU(i,2832) + 0.6*rate_constant(i,375)

    ! df_BIGALD3/d(BIGALD3)
    !  k_BIGALD3_1: BIGALD3 -> 0.6*HO2 + 0.6*CO + 0.6*MDIALO2
    LU(i,2346) = LU(i,2346) - rate_constant(i,126)

    ! df_MDIALO2/d(BIGALD3)
    !  k_BIGALD3_1: BIGALD3 -> 0.6*HO2 + 0.6*CO + 0.6*MDIALO2
    LU(i,2347) = LU(i,2347) + 0.6*rate_constant(i,126)

    ! df_HO2/d(BIGALD3)
    !  k_BIGALD3_1: BIGALD3 -> 0.6*HO2 + 0.6*CO + 0.6*MDIALO2
    LU(i,2349) = LU(i,2349) + 0.6*rate_constant(i,126)

    ! df_CO/d(BIGALD3)
    !  k_BIGALD3_1: BIGALD3 -> 0.6*HO2 + 0.6*CO + 0.6*MDIALO2
    LU(i,2348) = LU(i,2348) + 0.6*rate_constant(i,126)

    ! df_CH3CO3/d(BIGALD4)
    !  k_BIGALD4_1: BIGALD4 -> 1*HO2 + 1*CO + 1*CH3COCHO + 1*CH3CO3
    LU(i,2419) = LU(i,2419) + rate_constant(i,61)

    ! df_CH3COCHO/d(BIGALD4)
    !  k_BIGALD4_1: BIGALD4 -> 1*HO2 + 1*CO + 1*CH3COCHO + 1*CH3CO3
    LU(i,2435) = LU(i,2435) + rate_constant(i,61)

    ! df_BIGALD4/d(BIGALD4)
    !  k_BIGALD4_1: BIGALD4 -> 1*HO2 + 1*CO + 1*CH3COCHO + 1*CH3CO3
    LU(i,2434) = LU(i,2434) - rate_constant(i,61)

    ! df_HO2/d(BIGALD4)
    !  k_BIGALD4_1: BIGALD4 -> 1*HO2 + 1*CO + 1*CH3COCHO + 1*CH3CO3
    LU(i,2483) = LU(i,2483) + rate_constant(i,61)

    ! df_CO/d(BIGALD4)
    !  k_BIGALD4_1: BIGALD4 -> 1*HO2 + 1*CO + 1*CH3COCHO + 1*CH3CO3
    LU(i,2467) = LU(i,2467) + rate_constant(i,61)
  end do
  !$acc end parallel

end subroutine dforce_dy63

subroutine dforce_dy64(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! df_BIGALK/d(BIGALK)
    !  k_BIGALK_OH_1: BIGALK + OH -> 1*ALKO2
    LU(i,3608) = LU(i,3608) - rate_constant(i,315) * number_density(i,166)

    ! df_OH/d(BIGALK)
    !  k_BIGALK_OH_1: BIGALK + OH -> 1*ALKO2
    LU(i,3628) = LU(i,3628) - rate_constant(i,315) * number_density(i,166)

    ! df_ALKO2/d(BIGALK)
    !  k_BIGALK_OH_1: BIGALK + OH -> 1*ALKO2
    LU(i,3591) = LU(i,3591) + rate_constant(i,315) * number_density(i,166)

    ! df_H2O/d(H2O2)
    !  k_H2O2_OH_1: H2O2 + OH -> 1*H2O + 1*HO2
    LU(i,7212) = LU(i,7212) + rate_constant(i,456) * number_density(i,166)

    ! df_CL/d(H2O2)
    !  k_CL_H2O2_1: CL + H2O2 -> 1*HCL + 1*HO2
    LU(i,7221) = LU(i,7221) - rate_constant(i,310) * number_density(i,100)

    ! df_O/d(H2O2)
    !  k_H2O2_O_1: H2O2 + O -> 1*OH + 1*HO2
    LU(i,7277) = LU(i,7277) - rate_constant(i,440) * number_density(i,187)

    ! df_HCL/d(H2O2)
    !  k_CL_H2O2_1: CL + H2O2 -> 1*HCL + 1*HO2
    LU(i,7270) = LU(i,7270) + rate_constant(i,310) * number_density(i,100)

    ! df_H2O2/d(H2O2)
    !  k_H2O2_1: H2O2 -> 2*OH
    LU(i,7269) = LU(i,7269) - rate_constant(i,239)

    !  k_CL_H2O2_1: CL + H2O2 -> 1*HCL + 1*HO2
    LU(i,7269) = LU(i,7269) - rate_constant(i,310) * number_density(i,100)

    !  k_H2O2_O_1: H2O2 + O -> 1*OH + 1*HO2
    LU(i,7269) = LU(i,7269) - rate_constant(i,440) * number_density(i,187)

    !  k_H2O2_OH_1: H2O2 + OH -> 1*H2O + 1*HO2
    LU(i,7269) = LU(i,7269) - rate_constant(i,456) * number_density(i,166)

    ! df_HO2/d(H2O2)
    !  k_CL_H2O2_1: CL + H2O2 -> 1*HCL + 1*HO2
    LU(i,7282) = LU(i,7282) + rate_constant(i,310) * number_density(i,100)

    !  k_H2O2_O_1: H2O2 + O -> 1*OH + 1*HO2
    LU(i,7282) = LU(i,7282) + rate_constant(i,440) * number_density(i,187)

    !  k_H2O2_OH_1: H2O2 + OH -> 1*H2O + 1*HO2
    LU(i,7282) = LU(i,7282) + rate_constant(i,456) * number_density(i,166)

    ! df_OH/d(H2O2)
    !  k_H2O2_1: H2O2 -> 2*OH
    LU(i,7256) = LU(i,7256) + 2*rate_constant(i,239)

    !  k_H2O2_O_1: H2O2 + O -> 1*OH + 1*HO2
    LU(i,7256) = LU(i,7256) + rate_constant(i,440) * number_density(i,187)

    !  k_H2O2_OH_1: H2O2 + OH -> 1*H2O + 1*HO2
    LU(i,7256) = LU(i,7256) - rate_constant(i,456) * number_density(i,166)

    ! df_C2H5O2/d(C2H5OOH)
    !  k_C2H5OOH_OH_1: C2H5OOH + OH -> 0.5*C2H5O2 + 0.5*CH3CHO + 0.5*OH
    LU(i,6925) = LU(i,6925) + 0.5*rate_constant(i,246) * number_density(i,166)

    ! df_C2H5OOH/d(C2H5OOH)
    !  k_C2H5OOH_OH_1: C2H5OOH + OH -> 0.5*C2H5O2 + 0.5*CH3CHO + 0.5*OH
    LU(i,6972) = LU(i,6972) - rate_constant(i,246) * number_density(i,166)

    !  k_C2H5OOH_1: C2H5OOH -> 1*CH3CHO + 1*HO2 + 1*OH
    LU(i,6972) = LU(i,6972) - rate_constant(i,261)

    ! df_HO2/d(C2H5OOH)
    !  k_C2H5OOH_1: C2H5OOH -> 1*CH3CHO + 1*HO2 + 1*OH
    LU(i,6989) = LU(i,6989) + rate_constant(i,261)

    ! df_OH/d(C2H5OOH)
    !  k_C2H5OOH_OH_1: C2H5OOH + OH -> 0.5*C2H5O2 + 0.5*CH3CHO + 0.5*OH
    LU(i,6963) = LU(i,6963) - 0.5*rate_constant(i,246) * number_density(i,166)

    !  k_C2H5OOH_1: C2H5OOH -> 1*CH3CHO + 1*HO2 + 1*OH
    LU(i,6963) = LU(i,6963) + rate_constant(i,261)

    ! df_CH3CHO/d(C2H5OOH)
    !  k_C2H5OOH_OH_1: C2H5OOH + OH -> 0.5*C2H5O2 + 0.5*CH3CHO + 0.5*OH
    LU(i,6975) = LU(i,6975) + 0.5*rate_constant(i,246) * number_density(i,166)

    !  k_C2H5OOH_1: C2H5OOH -> 1*CH3CHO + 1*HO2 + 1*OH
    LU(i,6975) = LU(i,6975) + rate_constant(i,261)

    ! df_H2O/d(C2H6)
    !  k_C2H6_OH_1: C2H6 + OH -> 1*C2H5O2 + 1*H2O
    LU(i,6853) = LU(i,6853) + rate_constant(i,174) * number_density(i,166)

    ! df_CL/d(C2H6)
    !  k_C2H6_CL_1: C2H6 + CL -> 1*HCL + 1*C2H5O2
    LU(i,6863) = LU(i,6863) - rate_constant(i,193) * number_density(i,100)

    ! df_C2H5O2/d(C2H6)
    !  k_C2H6_OH_1: C2H6 + OH -> 1*C2H5O2 + 1*H2O
    LU(i,6860) = LU(i,6860) + rate_constant(i,174) * number_density(i,166)
  end do
  !$acc end parallel

end subroutine dforce_dy64

subroutine dforce_dy65(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    !  k_C2H6_CL_1: C2H6 + CL -> 1*HCL + 1*C2H5O2
    LU(i,6860) = LU(i,6860) + rate_constant(i,193) * number_density(i,100)

    ! df_HCL/d(C2H6)
    !  k_C2H6_CL_1: C2H6 + CL -> 1*HCL + 1*C2H5O2
    LU(i,6912) = LU(i,6912) + rate_constant(i,193) * number_density(i,100)

    ! df_C2H6/d(C2H6)
    !  k_C2H6_OH_1: C2H6 + OH -> 1*C2H5O2 + 1*H2O
    LU(i,6906) = LU(i,6906) - rate_constant(i,174) * number_density(i,166)

    !  k_C2H6_CL_1: C2H6 + CL -> 1*HCL + 1*C2H5O2
    LU(i,6906) = LU(i,6906) - rate_constant(i,193) * number_density(i,100)

    ! df_OH/d(C2H6)
    !  k_C2H6_OH_1: C2H6 + OH -> 1*C2H5O2 + 1*H2O
    LU(i,6898) = LU(i,6898) - rate_constant(i,174) * number_density(i,166)

    ! df_H2O/d(C3H8)
    !  k_C3H8_OH_1: C3H8 + OH -> 1*C3H7O2 + 1*H2O
    LU(i,492) = LU(i,492) + rate_constant(i,251) * number_density(i,166)

    ! df_C3H7O2/d(C3H8)
    !  k_C3H8_OH_1: C3H8 + OH -> 1*C3H7O2 + 1*H2O
    LU(i,493) = LU(i,493) + rate_constant(i,251) * number_density(i,166)

    ! df_C3H8/d(C3H8)
    !  k_C3H8_OH_1: C3H8 + OH -> 1*C3H7O2 + 1*H2O
    LU(i,491) = LU(i,491) - rate_constant(i,251) * number_density(i,166)

    ! df_OH/d(C3H8)
    !  k_C3H8_OH_1: C3H8 + OH -> 1*C3H7O2 + 1*H2O
    LU(i,494) = LU(i,494) - rate_constant(i,251) * number_density(i,166)

    ! df_CH4/d(C3H6)
    !  k_C3H6_O3_1: C3H6 + O3 -> 0.5*CH2O + 0.12*HCOOH + 0.12*CH3COOH + 0.5*CH3CHO + 0.56*CO + 0.28*CH3O2 + 0.1*CH4 + 0.2*CO2 + 0.28*HO2 + 0.36*OH
    LU(i,3038) = LU(i,3038) + 0.1*rate_constant(i,170) * number_density(i,171)

    ! df_CO2/d(C3H6)
    !  k_C3H6_O3_1: C3H6 + O3 -> 0.5*CH2O + 0.12*HCOOH + 0.12*CH3COOH + 0.5*CH3CHO + 0.56*CO + 0.28*CH3O2 + 0.1*CH4 + 0.2*CO2 + 0.28*HO2 + 0.36*OH
    LU(i,3049) = LU(i,3049) + 0.2*rate_constant(i,170) * number_density(i,171)

    ! df_HCOOH/d(C3H6)
    !  k_C3H6_O3_1: C3H6 + O3 -> 0.5*CH2O + 0.12*HCOOH + 0.12*CH3COOH + 0.5*CH3CHO + 0.56*CO + 0.28*CH3O2 + 0.1*CH4 + 0.2*CO2 + 0.28*HO2 + 0.36*OH
    LU(i,3057) = LU(i,3057) + 0.12*rate_constant(i,170) * number_density(i,171)

    ! df_CH3O2/d(C3H6)
    !  k_C3H6_O3_1: C3H6 + O3 -> 0.5*CH2O + 0.12*HCOOH + 0.12*CH3COOH + 0.5*CH3CHO + 0.56*CO + 0.28*CH3O2 + 0.1*CH4 + 0.2*CO2 + 0.28*HO2 + 0.36*OH
    LU(i,3104) = LU(i,3104) + 0.28*rate_constant(i,170) * number_density(i,171)

    ! df_C3H6/d(C3H6)
    !  k_C3H6_O3_1: C3H6 + O3 -> 0.5*CH2O + 0.12*HCOOH + 0.12*CH3COOH + 0.5*CH3CHO + 0.56*CO + 0.28*CH3O2 + 0.1*CH4 + 0.2*CO2 + 0.28*HO2 + 0.36*OH
    LU(i,3058) = LU(i,3058) - rate_constant(i,170) * number_density(i,171)

    !  k_C3H6_NO3_1: C3H6 + NO3 -> 1*NOA
    LU(i,3058) = LU(i,3058) - rate_constant(i,221) * number_density(i,165)

    !  k_C3H6_OH_1: C3H6 + OH -> 1*PO2
    LU(i,3058) = LU(i,3058) - rate_constant(i,231) * number_density(i,166)

    ! df_CH2O/d(C3H6)
    !  k_C3H6_O3_1: C3H6 + O3 -> 0.5*CH2O + 0.12*HCOOH + 0.12*CH3COOH + 0.5*CH3CHO + 0.56*CO + 0.28*CH3O2 + 0.1*CH4 + 0.2*CO2 + 0.28*HO2 + 0.36*OH
    LU(i,3060) = LU(i,3060) + 0.5*rate_constant(i,170) * number_density(i,171)

    ! df_HO2/d(C3H6)
    !  k_C3H6_O3_1: C3H6 + O3 -> 0.5*CH2O + 0.12*HCOOH + 0.12*CH3COOH + 0.5*CH3CHO + 0.56*CO + 0.28*CH3O2 + 0.1*CH4 + 0.2*CO2 + 0.28*HO2 + 0.36*OH
    LU(i,3105) = LU(i,3105) + 0.28*rate_constant(i,170) * number_density(i,171)

    ! df_PO2/d(C3H6)
    !  k_C3H6_OH_1: C3H6 + OH -> 1*PO2
    LU(i,3066) = LU(i,3066) + rate_constant(i,231) * number_density(i,166)

    ! df_NO3/d(C3H6)
    !  k_C3H6_NO3_1: C3H6 + NO3 -> 1*NOA
    LU(i,3078) = LU(i,3078) - rate_constant(i,221) * number_density(i,165)

    ! df_OH/d(C3H6)
    !  k_C3H6_O3_1: C3H6 + O3 -> 0.5*CH2O + 0.12*HCOOH + 0.12*CH3COOH + 0.5*CH3CHO + 0.56*CO + 0.28*CH3O2 + 0.1*CH4 + 0.2*CO2 + 0.28*HO2 + 0.36*OH
    LU(i,3079) = LU(i,3079) + 0.36*rate_constant(i,170) * number_density(i,171)

    !  k_C3H6_OH_1: C3H6 + OH -> 1*PO2
    LU(i,3079) = LU(i,3079) - rate_constant(i,231) * number_density(i,166)

    ! df_O3/d(C3H6)
    !  k_C3H6_O3_1: C3H6 + O3 -> 0.5*CH2O + 0.12*HCOOH + 0.12*CH3COOH + 0.5*CH3CHO + 0.56*CO + 0.28*CH3O2 + 0.1*CH4 + 0.2*CO2 + 0.28*HO2 + 0.36*OH
    LU(i,3084) = LU(i,3084) - rate_constant(i,170) * number_density(i,171)

    ! df_CO/d(C3H6)
    !  k_C3H6_O3_1: C3H6 + O3 -> 0.5*CH2O + 0.12*HCOOH + 0.12*CH3COOH + 0.5*CH3CHO + 0.56*CO + 0.28*CH3O2 + 0.1*CH4 + 0.2*CO2 + 0.28*HO2 + 0.36*OH
    LU(i,3089) = LU(i,3089) + 0.56*rate_constant(i,170) * number_density(i,171)

    ! df_CH3COOH/d(C3H6)
    !  k_C3H6_O3_1: C3H6 + O3 -> 0.5*CH2O + 0.12*HCOOH + 0.12*CH3COOH + 0.5*CH3CHO + 0.56*CO + 0.28*CH3O2 + 0.1*CH4 + 0.2*CO2 + 0.28*HO2 + 0.36*OH
    LU(i,3090) = LU(i,3090) + 0.12*rate_constant(i,170) * number_density(i,171)

    ! df_CH3CHO/d(C3H6)
    !  k_C3H6_O3_1: C3H6 + O3 -> 0.5*CH2O + 0.12*HCOOH + 0.12*CH3COOH + 0.5*CH3CHO + 0.56*CO + 0.28*CH3O2 + 0.1*CH4 + 0.2*CO2 + 0.28*HO2 + 0.36*OH
    LU(i,3091) = LU(i,3091) + 0.5*rate_constant(i,170) * number_density(i,171)

    ! df_NOA/d(C3H6)
    !  k_C3H6_NO3_1: C3H6 + NO3 -> 1*NOA
    LU(i,3037) = LU(i,3037) + rate_constant(i,221) * number_density(i,165)
  end do
  !$acc end parallel

end subroutine dforce_dy65

subroutine dforce_dy66(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! df_H/d(CH2O)
    !  k_CH2O_2: CH2O -> 1*CO + 2*H
    LU(i,3249) = LU(i,3249) + 2*rate_constant(i,149)

    !  k_CH2O_OH_1: CH2O + OH -> 1*CO + 1*H2O + 1*H
    LU(i,3249) = LU(i,3249) + rate_constant(i,415) * number_density(i,166)

    ! df_HNO3/d(CH2O)
    !  k_CH2O_NO3_1: CH2O + NO3 -> 1*CO + 1*HO2 + 1*HNO3
    LU(i,3248) = LU(i,3248) + rate_constant(i,423) * number_density(i,165)

    ! df_H2O/d(CH2O)
    !  k_CH2O_OH_1: CH2O + OH -> 1*CO + 1*H2O + 1*H
    LU(i,3253) = LU(i,3253) + rate_constant(i,415) * number_density(i,166)

    ! df_BR/d(CH2O)
    !  k_BR_CH2O_1: BR + CH2O -> 1*HBR + 1*HO2 + 1*CO
    LU(i,3262) = LU(i,3262) - rate_constant(i,298) * number_density(i,90)

    ! df_CL/d(CH2O)
    !  k_CH2O_CL_1: CH2O + CL -> 1*HCL + 1*HO2 + 1*CO
    LU(i,3263) = LU(i,3263) - rate_constant(i,425) * number_density(i,100)

    ! df_HBR/d(CH2O)
    !  k_BR_CH2O_1: BR + CH2O -> 1*HBR + 1*HO2 + 1*CO
    LU(i,3257) = LU(i,3257) + rate_constant(i,298) * number_density(i,90)

    ! df_O/d(CH2O)
    !  k_CH2O_O_1: CH2O + O -> 1*HO2 + 1*OH + 1*CO
    LU(i,3311) = LU(i,3311) - rate_constant(i,10) * number_density(i,187)

    ! df_HCL/d(CH2O)
    !  k_CH2O_CL_1: CH2O + CL -> 1*HCL + 1*HO2 + 1*CO
    LU(i,3304) = LU(i,3304) + rate_constant(i,425) * number_density(i,100)

    ! df_CH2O/d(CH2O)
    !  k_CH2O_O_1: CH2O + O -> 1*HO2 + 1*OH + 1*CO
    LU(i,3270) = LU(i,3270) - rate_constant(i,10) * number_density(i,187)

    !  k_CH2O_1: CH2O -> 1*CO + 1*H2
    LU(i,3270) = LU(i,3270) - rate_constant(i,93)

    !  k_CH2O_2: CH2O -> 1*CO + 2*H
    LU(i,3270) = LU(i,3270) - rate_constant(i,149)

    !  k_BR_CH2O_1: BR + CH2O -> 1*HBR + 1*HO2 + 1*CO
    LU(i,3270) = LU(i,3270) - rate_constant(i,298) * number_density(i,90)

    !  k_CH2O_OH_1: CH2O + OH -> 1*CO + 1*H2O + 1*H
    LU(i,3270) = LU(i,3270) - rate_constant(i,415) * number_density(i,166)

    !  k_CH2O_NO3_1: CH2O + NO3 -> 1*CO + 1*HO2 + 1*HNO3
    LU(i,3270) = LU(i,3270) - rate_constant(i,423) * number_density(i,165)

    !  k_CH2O_CL_1: CH2O + CL -> 1*HCL + 1*HO2 + 1*CO
    LU(i,3270) = LU(i,3270) - rate_constant(i,425) * number_density(i,100)

    !  k_CH2O_HO2_1: CH2O + HO2 -> 1*HOCH2OO
    LU(i,3270) = LU(i,3270) - rate_constant(i,449) * number_density(i,192)

    ! df_HO2/d(CH2O)
    !  k_CH2O_O_1: CH2O + O -> 1*HO2 + 1*OH + 1*CO
    LU(i,3316) = LU(i,3316) + rate_constant(i,10) * number_density(i,187)

    !  k_BR_CH2O_1: BR + CH2O -> 1*HBR + 1*HO2 + 1*CO
    LU(i,3316) = LU(i,3316) + rate_constant(i,298) * number_density(i,90)

    !  k_CH2O_NO3_1: CH2O + NO3 -> 1*CO + 1*HO2 + 1*HNO3
    LU(i,3316) = LU(i,3316) + rate_constant(i,423) * number_density(i,165)

    !  k_CH2O_CL_1: CH2O + CL -> 1*HCL + 1*HO2 + 1*CO
    LU(i,3316) = LU(i,3316) + rate_constant(i,425) * number_density(i,100)

    !  k_CH2O_HO2_1: CH2O + HO2 -> 1*HOCH2OO
    LU(i,3316) = LU(i,3316) - rate_constant(i,449) * number_density(i,192)

    ! df_HOCH2OO/d(CH2O)
    !  k_CH2O_HO2_1: CH2O + HO2 -> 1*HOCH2OO
    LU(i,3279) = LU(i,3279) + rate_constant(i,449) * number_density(i,192)

    ! df_H2/d(CH2O)
    !  k_CH2O_1: CH2O -> 1*CO + 1*H2
    LU(i,3277) = LU(i,3277) + rate_constant(i,93)

    ! df_NO3/d(CH2O)
    !  k_CH2O_NO3_1: CH2O + NO3 -> 1*CO + 1*HO2 + 1*HNO3
    LU(i,3289) = LU(i,3289) - rate_constant(i,423) * number_density(i,165)

    ! df_OH/d(CH2O)
    !  k_CH2O_O_1: CH2O + O -> 1*HO2 + 1*OH + 1*CO
    LU(i,3290) = LU(i,3290) + rate_constant(i,10) * number_density(i,187)

    !  k_CH2O_OH_1: CH2O + OH -> 1*CO + 1*H2O + 1*H
    LU(i,3290) = LU(i,3290) - rate_constant(i,415) * number_density(i,166)

    ! df_CO/d(CH2O)
    !  k_CH2O_O_1: CH2O + O -> 1*HO2 + 1*OH + 1*CO
    LU(i,3300) = LU(i,3300) + rate_constant(i,10) * number_density(i,187)

    !  k_CH2O_1: CH2O -> 1*CO + 1*H2
    LU(i,3300) = LU(i,3300) + rate_constant(i,93)
  end do
  !$acc end parallel

end subroutine dforce_dy66

subroutine dforce_dy67(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    !  k_CH2O_2: CH2O -> 1*CO + 2*H
    LU(i,3300) = LU(i,3300) + rate_constant(i,149)

    !  k_BR_CH2O_1: BR + CH2O -> 1*HBR + 1*HO2 + 1*CO
    LU(i,3300) = LU(i,3300) + rate_constant(i,298) * number_density(i,90)

    !  k_CH2O_OH_1: CH2O + OH -> 1*CO + 1*H2O + 1*H
    LU(i,3300) = LU(i,3300) + rate_constant(i,415) * number_density(i,166)

    !  k_CH2O_NO3_1: CH2O + NO3 -> 1*CO + 1*HO2 + 1*HNO3
    LU(i,3300) = LU(i,3300) + rate_constant(i,423) * number_density(i,165)

    !  k_CH2O_CL_1: CH2O + CL -> 1*HCL + 1*HO2 + 1*CO
    LU(i,3300) = LU(i,3300) + rate_constant(i,425) * number_density(i,100)

    ! df_CH3CN/d(CH3CN)
    !  k_CH3CN_OH_1: CH3CN + OH -> 1*HO2
    LU(i,353) = LU(i,353) - rate_constant(i,153) * number_density(i,166)

    ! df_HO2/d(CH3CN)
    !  k_CH3CN_OH_1: CH3CN + OH -> 1*HO2
    LU(i,355) = LU(i,355) + rate_constant(i,153) * number_density(i,166)

    ! df_OH/d(CH3CN)
    !  k_CH3CN_OH_1: CH3CN + OH -> 1*HO2
    LU(i,354) = LU(i,354) - rate_constant(i,153) * number_density(i,166)

    ! df_HCOOH/d(C2H2)
    !  k_C2H2_OH_1: C2H2 + OH -> 0.65*GLYOXAL + 0.65*OH + 0.35*HCOOH + 0.35*HO2 + 0.35*CO
    LU(i,6425) = LU(i,6425) + 0.35*rate_constant(i,2) * number_density(i,166)

    ! df_C2H2/d(C2H2)
    !  k_C2H2_OH_1: C2H2 + OH -> 0.65*GLYOXAL + 0.65*OH + 0.35*HCOOH + 0.35*HO2 + 0.35*CO
    LU(i,6458) = LU(i,6458) - rate_constant(i,2) * number_density(i,166)

    !  k_C2H2_CL_1: C2H2 + CL -> 1*CL
    LU(i,6458) = LU(i,6458) - rate_constant(i,450) * number_density(i,100)

    ! df_GLYOXAL/d(C2H2)
    !  k_C2H2_OH_1: C2H2 + OH -> 0.65*GLYOXAL + 0.65*OH + 0.35*HCOOH + 0.35*HO2 + 0.35*CO
    LU(i,6430) = LU(i,6430) + 0.65*rate_constant(i,2) * number_density(i,166)

    ! df_HO2/d(C2H2)
    !  k_C2H2_OH_1: C2H2 + OH -> 0.65*GLYOXAL + 0.65*OH + 0.35*HCOOH + 0.35*HO2 + 0.35*CO
    LU(i,6482) = LU(i,6482) + 0.35*rate_constant(i,2) * number_density(i,166)

    ! df_OH/d(C2H2)
    !  k_C2H2_OH_1: C2H2 + OH -> 0.65*GLYOXAL + 0.65*OH + 0.35*HCOOH + 0.35*HO2 + 0.35*CO
    LU(i,6456) = LU(i,6456) - 0.35*rate_constant(i,2) * number_density(i,166)

    ! df_CO/d(C2H2)
    !  k_C2H2_OH_1: C2H2 + OH -> 0.65*GLYOXAL + 0.65*OH + 0.35*HCOOH + 0.35*HO2 + 0.35*CO
    LU(i,6466) = LU(i,6466) + 0.35*rate_constant(i,2) * number_density(i,166)

    ! df_CH2O/d(CH3OH)
    !  k_CH3OH_OH_1: CH3OH + OH -> 1*HO2 + 1*CH2O
    LU(i,3175) = LU(i,3175) + rate_constant(i,409) * number_density(i,166)

    ! df_CH3OH/d(CH3OH)
    !  k_CH3OH_OH_1: CH3OH + OH -> 1*HO2 + 1*CH2O
    LU(i,3174) = LU(i,3174) - rate_constant(i,409) * number_density(i,166)

    ! df_HO2/d(CH3OH)
    !  k_CH3OH_OH_1: CH3OH + OH -> 1*HO2 + 1*CH2O
    LU(i,3177) = LU(i,3177) + rate_constant(i,409) * number_density(i,166)

    ! df_OH/d(CH3OH)
    !  k_CH3OH_OH_1: CH3OH + OH -> 1*HO2 + 1*CH2O
    LU(i,3176) = LU(i,3176) - rate_constant(i,409) * number_density(i,166)

    ! df_H/d(CH3OOH)
    !  k_CH3OOH_1: CH3OOH -> 1*CH2O + 1*H + 1*OH
    LU(i,3865) = LU(i,3865) + rate_constant(i,379)

    ! df_H2O/d(CH3OOH)
    !  k_CH3OOH_OH_1: CH3OOH + OH -> 0.7*CH3O2 + 0.3*OH + 0.3*CH2O + 1*H2O
    LU(i,3869) = LU(i,3869) + rate_constant(i,348) * number_density(i,166)

    ! df_CH3O2/d(CH3OOH)
    !  k_CH3OOH_OH_1: CH3OOH + OH -> 0.7*CH3O2 + 0.3*OH + 0.3*CH2O + 1*H2O
    LU(i,3931) = LU(i,3931) + 0.7*rate_constant(i,348) * number_density(i,166)

    ! df_CH2O/d(CH3OOH)
    !  k_CH3OOH_OH_1: CH3OOH + OH -> 0.7*CH3O2 + 0.3*OH + 0.3*CH2O + 1*H2O
    LU(i,3885) = LU(i,3885) + 0.3*rate_constant(i,348) * number_density(i,166)

    !  k_CH3OOH_1: CH3OOH -> 1*CH2O + 1*H + 1*OH
    LU(i,3885) = LU(i,3885) + rate_constant(i,379)

    ! df_CH3OOH/d(CH3OOH)
    !  k_CH3OOH_OH_1: CH3OOH + OH -> 0.7*CH3O2 + 0.3*OH + 0.3*CH2O + 1*H2O
    LU(i,3888) = LU(i,3888) - rate_constant(i,348) * number_density(i,166)

    !  k_CH3OOH_1: CH3OOH -> 1*CH2O + 1*H + 1*OH
    LU(i,3888) = LU(i,3888) - rate_constant(i,379)

    ! df_OH/d(CH3OOH)
    !  k_CH3OOH_OH_1: CH3OOH + OH -> 0.7*CH3O2 + 0.3*OH + 0.3*CH2O + 1*H2O
    LU(i,3906) = LU(i,3906) - 0.7*rate_constant(i,348) * number_density(i,166)

  end do
  !$acc end parallel

end subroutine dforce_dy67

subroutine dforce_dy68(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell
    !  k_CH3OOH_1: CH3OOH -> 1*CH2O + 1*H + 1*OH
    LU(i,3906) = LU(i,3906) + rate_constant(i,379)

    ! df_PHENO2/d(CRESOL)
    !  k_CRESOL_OH_1: CRESOL + OH -> 0.2*PHENO2 + 0.73*HO2 + 0.07*PHENO
    LU(i,4194) = LU(i,4194) + 0.2*rate_constant(i,95) * number_density(i,166)

    ! df_PHENO/d(CRESOL)
    !  k_CRESOL_OH_1: CRESOL + OH -> 0.2*PHENO2 + 0.73*HO2 + 0.07*PHENO
    LU(i,4260) = LU(i,4260) + 0.07*rate_constant(i,95) * number_density(i,166)

    ! df_CRESOL/d(CRESOL)
    !  k_CRESOL_OH_1: CRESOL + OH -> 0.2*PHENO2 + 0.73*HO2 + 0.07*PHENO
    LU(i,4219) = LU(i,4219) - rate_constant(i,95) * number_density(i,166)

    ! df_HO2/d(CRESOL)
    !  k_CRESOL_OH_1: CRESOL + OH -> 0.2*PHENO2 + 0.73*HO2 + 0.07*PHENO
    LU(i,4270) = LU(i,4270) + 0.73*rate_constant(i,95) * number_density(i,166)

    ! df_OH/d(CRESOL)
    !  k_CRESOL_OH_1: CRESOL + OH -> 0.2*PHENO2 + 0.73*HO2 + 0.07*PHENO
    LU(i,4244) = LU(i,4244) - rate_constant(i,95) * number_density(i,166)

    ! df_NO2/d(ENEO2)
    !  k_ENEO2_NO_1: ENEO2 + NO -> 1*CH3CHO + 0.5*CH2O + 0.5*CH3COCH3 + 1*HO2 + 1*NO2
    LU(i,3724) = LU(i,3724) + rate_constant(i,201) * number_density(i,137)

    ! df_NO/d(ENEO2)
    !  k_ENEO2_NO_1: ENEO2 + NO -> 1*CH3CHO + 0.5*CH2O + 0.5*CH3COCH3 + 1*HO2 + 1*NO2
    LU(i,3750) = LU(i,3750) - rate_constant(i,201) * number_density(i,137)

    !  k_ENEO2_NO_2: ENEO2 + NO -> 1*HONITR
    LU(i,3750) = LU(i,3750) - rate_constant(i,378) * number_density(i,137)

    ! df_CH3COCH3/d(ENEO2)
    !  k_ENEO2_NO_1: ENEO2 + NO -> 1*CH3CHO + 0.5*CH2O + 0.5*CH3COCH3 + 1*HO2 + 1*NO2
    LU(i,3735) = LU(i,3735) + 0.5*rate_constant(i,201) * number_density(i,137)

    ! df_CH2O/d(ENEO2)
    !  k_ENEO2_NO_1: ENEO2 + NO -> 1*CH3CHO + 0.5*CH2O + 0.5*CH3COCH3 + 1*HO2 + 1*NO2
    LU(i,3745) = LU(i,3745) + 0.5*rate_constant(i,201) * number_density(i,137)

    ! df_ENEO2/d(ENEO2)
    !  k_ENEO2_NO_1: ENEO2 + NO -> 1*CH3CHO + 0.5*CH2O + 0.5*CH3COCH3 + 1*HO2 + 1*NO2
    LU(i,3748) = LU(i,3748) - rate_constant(i,201) * number_density(i,137)

    !  k_ENEO2_NO_2: ENEO2 + NO -> 1*HONITR
    LU(i,3748) = LU(i,3748) - rate_constant(i,378) * number_density(i,137)

    ! df_HO2/d(ENEO2)
    !  k_ENEO2_NO_1: ENEO2 + NO -> 1*CH3CHO + 0.5*CH2O + 0.5*CH3COCH3 + 1*HO2 + 1*NO2
    LU(i,3793) = LU(i,3793) + rate_constant(i,201) * number_density(i,137)

    ! df_HONITR/d(ENEO2)
    !  k_ENEO2_NO_2: ENEO2 + NO -> 1*HONITR
    LU(i,3749) = LU(i,3749) + rate_constant(i,378) * number_density(i,137)

    ! df_CH3CHO/d(ENEO2)
    !  k_ENEO2_NO_1: ENEO2 + NO -> 1*CH3CHO + 0.5*CH2O + 0.5*CH3COCH3 + 1*HO2 + 1*NO2
    LU(i,3779) = LU(i,3779) + rate_constant(i,201) * number_density(i,137)

    ! df_MACROOH/d(MACRO2)
    !  k_HO2_MACRO2_1: HO2 + MACRO2 -> 1*MACROOH
    LU(i,7882) = LU(i,7882) + rate_constant(i,36) * number_density(i,192)

    ! df_CH3CO3/d(MACRO2)
    !  k_MACRO2_NO_1: MACRO2 + NO -> 1*NO2 + 0.47*HO2 + 0.25*CH2O + 0.53*GLYALD + 0.25*CH3COCHO + 0.53*CH3CO3 + 0.22*HYAC + 0.22*CO
    LU(i,7883) = LU(i,7883) + 0.53*rate_constant(i,40) * number_density(i,137)

    !  k_MACRO2_NO3_1: MACRO2 + NO3 -> 1*NO2 + 0.47*HO2 + 0.25*CH2O + 0.25*CH3COCHO + 0.22*CO + 0.53*GLYALD + 0.22*HYAC + 0.53*CH3CO3
    LU(i,7883) = LU(i,7883) + 0.53*rate_constant(i,134) * number_density(i,165)

    !  k_CH3CO3_MACRO2_1: CH3CO3 + MACRO2 -> 0.25*CH3COCHO + 1*CH3O2 + 0.22*CO + 0.47*HO2 + 0.53*GLYALD + 0.22*HYAC + 0.25*CH2O + 0.53*CH3CO3
    LU(i,7883) = LU(i,7883) - 0.47*rate_constant(i,235) * number_density(i,49)

    !  k_CH3O2_MACRO2_1: CH3O2 + MACRO2 -> 0.73*HO2 + 0.88*CH2O + 0.11*CO + 0.24*CH3COCHO + 0.26*GLYALD + 0.26*CH3CO3 + 0.25*CH3OH + 0.23*HYAC
    LU(i,7883) = LU(i,7883) + 0.26*rate_constant(i,322) * number_density(i,191)

    ! df_HYAC/d(MACRO2)
    !  k_MACRO2_NO_1: MACRO2 + NO -> 1*NO2 + 0.47*HO2 + 0.25*CH2O + 0.53*GLYALD + 0.25*CH3COCHO + 0.53*CH3CO3 + 0.22*HYAC + 0.22*CO
    LU(i,7886) = LU(i,7886) + 0.22*rate_constant(i,40) * number_density(i,137)

    !  k_MACRO2_NO3_1: MACRO2 + NO3 -> 1*NO2 + 0.47*HO2 + 0.25*CH2O + 0.25*CH3COCHO + 0.22*CO + 0.53*GLYALD + 0.22*HYAC + 0.53*CH3CO3
    LU(i,7886) = LU(i,7886) + 0.22*rate_constant(i,134) * number_density(i,165)

    !  k_CH3CO3_MACRO2_1: CH3CO3 + MACRO2 -> 0.25*CH3COCHO + 1*CH3O2 + 0.22*CO + 0.47*HO2 + 0.53*GLYALD + 0.22*HYAC + 0.25*CH2O + 0.53*CH3CO3
    LU(i,7886) = LU(i,7886) + 0.22*rate_constant(i,235) * number_density(i,49)

    !  k_CH3O2_MACRO2_1: CH3O2 + MACRO2 -> 0.73*HO2 + 0.88*CH2O + 0.11*CO + 0.24*CH3COCHO + 0.26*GLYALD + 0.26*CH3CO3 + 0.25*CH3OH + 0.23*HYAC
    LU(i,7886) = LU(i,7886) + 0.23*rate_constant(i,322) * number_density(i,191)

    ! df_NO2/d(MACRO2)
    !  k_MACRO2_NO_1: MACRO2 + NO -> 1*NO2 + 0.47*HO2 + 0.25*CH2O + 0.53*GLYALD + 0.25*CH3COCHO + 0.53*CH3CO3 + 0.22*HYAC + 0.22*CO
    LU(i,7884) = LU(i,7884) + rate_constant(i,40) * number_density(i,137)

    !  k_MACRO2_NO3_1: MACRO2 + NO3 -> 1*NO2 + 0.47*HO2 + 0.25*CH2O + 0.25*CH3COCHO + 0.22*CO + 0.53*GLYALD + 0.22*HYAC + 0.53*CH3CO3
    LU(i,7884) = LU(i,7884) + rate_constant(i,134) * number_density(i,165)

    ! df_NO/d(MACRO2)
    !  k_MACRO2_NO_1: MACRO2 + NO -> 1*NO2 + 0.47*HO2 + 0.25*CH2O + 0.53*GLYALD + 0.25*CH3COCHO + 0.53*CH3CO3 + 0.22*HYAC + 0.22*CO
    LU(i,7907) = LU(i,7907) - rate_constant(i,40) * number_density(i,137)
  end do
  !$acc end parallel

end subroutine dforce_dy68

subroutine dforce_dy69(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
