subroutine dforce_dy70(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell
    !  k_MACRO2_NO3_1: MACRO2 + NO3 -> 1*NO2 + 0.47*HO2 + 0.25*CH2O + 0.25*CH3COCHO + 0.22*CO + 0.53*GLYALD + 0.22*HYAC + 0.53*CH3CO3
    LU(i,7942) = LU(i,7942) + 0.22*rate_constant(i,134) * number_density(i,165)

    !  k_CH3CO3_MACRO2_1: CH3CO3 + MACRO2 -> 0.25*CH3COCHO + 1*CH3O2 + 0.22*CO + 0.47*HO2 + 0.53*GLYALD + 0.22*HYAC + 0.25*CH2O + 0.53*CH3CO3
    LU(i,7942) = LU(i,7942) + 0.22*rate_constant(i,235) * number_density(i,49)

    !  k_CH3O2_MACRO2_1: CH3O2 + MACRO2 -> 0.73*HO2 + 0.88*CH2O + 0.11*CO + 0.24*CH3COCHO + 0.26*GLYALD + 0.26*CH3CO3 + 0.25*CH3OH + 0.23*HYAC
    LU(i,7942) = LU(i,7942) + 0.11*rate_constant(i,322) * number_density(i,191)

    ! df_MVK/d(ISOPAO2)
    !  k_CH3CO3_ISOPAO2_1: CH3CO3 + ISOPAO2 -> 1*CH3O2 + 1*HO2 + 1*CH2O + 0.39*MACR + 0.61*MVK + 1*CO2
    LU(i,7959) = LU(i,7959) + 0.61*rate_constant(i,65) * number_density(i,49)

    !  k_ISOPAO2_NO3_1: ISOPAO2 + NO3 -> 1*NO2 + 0.4*MACR + 0.6*MVK + 1*CH2O + 1*HO2
    LU(i,7959) = LU(i,7959) + 0.6*rate_constant(i,330) * number_density(i,165)

    !  k_CH3O2_ISOPAO2_1: CH3O2 + ISOPAO2 -> 0.25*CH3OH + 1*HO2 + 1.5*CH2O + 0.31*MACR + 0.44*MVK
    LU(i,7959) = LU(i,7959) + 0.44*rate_constant(i,434) * number_density(i,191)

    !  k_ISOPAO2_NO_1: ISOPAO2 + NO -> 0.08*ISOPNITA + 0.92*NO2 + 0.36*MACR + 0.56*MVK + 0.92*CH2O + 0.92*HO2
    LU(i,7959) = LU(i,7959) + 0.56*rate_constant(i,464) * number_density(i,137)

    ! df_CH3CO3/d(ISOPAO2)
    !  k_CH3CO3_ISOPAO2_1: CH3CO3 + ISOPAO2 -> 1*CH3O2 + 1*HO2 + 1*CH2O + 0.39*MACR + 0.61*MVK + 1*CO2
    LU(i,7960) = LU(i,7960) - rate_constant(i,65) * number_density(i,49)

    ! df_NO2/d(ISOPAO2)
    !  k_ISOPAO2_NO3_1: ISOPAO2 + NO3 -> 1*NO2 + 0.4*MACR + 0.6*MVK + 1*CH2O + 1*HO2
    LU(i,7961) = LU(i,7961) + rate_constant(i,330) * number_density(i,165)

    !  k_ISOPAO2_NO_1: ISOPAO2 + NO -> 0.08*ISOPNITA + 0.92*NO2 + 0.36*MACR + 0.56*MVK + 0.92*CH2O + 0.92*HO2
    LU(i,7961) = LU(i,7961) + 0.92*rate_constant(i,464) * number_density(i,137)

    ! df_NO/d(ISOPAO2)
    !  k_ISOPAO2_NO_1: ISOPAO2 + NO -> 0.08*ISOPNITA + 0.92*NO2 + 0.36*MACR + 0.56*MVK + 0.92*CH2O + 0.92*HO2
    LU(i,7985) = LU(i,7985) - rate_constant(i,464) * number_density(i,137)

    ! df_CO2/d(ISOPAO2)
    !  k_CH3CO3_ISOPAO2_1: CH3CO3 + ISOPAO2 -> 1*CH3O2 + 1*HO2 + 1*CH2O + 0.39*MACR + 0.61*MVK + 1*CO2
    LU(i,7969) = LU(i,7969) + rate_constant(i,65) * number_density(i,49)

    ! df_CH3O2/d(ISOPAO2)
    !  k_CH3CO3_ISOPAO2_1: CH3CO3 + ISOPAO2 -> 1*CH3O2 + 1*HO2 + 1*CH2O + 0.39*MACR + 0.61*MVK + 1*CO2
    LU(i,8036) = LU(i,8036) + rate_constant(i,65) * number_density(i,49)

    !  k_CH3O2_ISOPAO2_1: CH3O2 + ISOPAO2 -> 0.25*CH3OH + 1*HO2 + 1.5*CH2O + 0.31*MACR + 0.44*MVK
    LU(i,8036) = LU(i,8036) - rate_constant(i,434) * number_density(i,191)

    ! df_CH2O/d(ISOPAO2)
    !  k_CH3CO3_ISOPAO2_1: CH3CO3 + ISOPAO2 -> 1*CH3O2 + 1*HO2 + 1*CH2O + 0.39*MACR + 0.61*MVK + 1*CO2
    LU(i,7981) = LU(i,7981) + rate_constant(i,65) * number_density(i,49)

    !  k_ISOPAO2_NO3_1: ISOPAO2 + NO3 -> 1*NO2 + 0.4*MACR + 0.6*MVK + 1*CH2O + 1*HO2
    LU(i,7981) = LU(i,7981) + rate_constant(i,330) * number_density(i,165)

    !  k_CH3O2_ISOPAO2_1: CH3O2 + ISOPAO2 -> 0.25*CH3OH + 1*HO2 + 1.5*CH2O + 0.31*MACR + 0.44*MVK
    LU(i,7981) = LU(i,7981) + 1.5*rate_constant(i,434) * number_density(i,191)

    !  k_ISOPAO2_NO_1: ISOPAO2 + NO -> 0.08*ISOPNITA + 0.92*NO2 + 0.36*MACR + 0.56*MVK + 0.92*CH2O + 0.92*HO2
    LU(i,7981) = LU(i,7981) + 0.92*rate_constant(i,464) * number_density(i,137)

    ! df_CH3OH/d(ISOPAO2)
    !  k_CH3O2_ISOPAO2_1: CH3O2 + ISOPAO2 -> 0.25*CH3OH + 1*HO2 + 1.5*CH2O + 0.31*MACR + 0.44*MVK
    LU(i,7980) = LU(i,7980) + 0.25*rate_constant(i,434) * number_density(i,191)

    ! df_ISOPAO2/d(ISOPAO2)
    !  k_CH3CO3_ISOPAO2_1: CH3CO3 + ISOPAO2 -> 1*CH3O2 + 1*HO2 + 1*CH2O + 0.39*MACR + 0.61*MVK + 1*CO2
    LU(i,8034) = LU(i,8034) - rate_constant(i,65) * number_density(i,49)

    !  k_HO2_ISOPAO2_1: HO2 + ISOPAO2 -> 1*ISOPOOH
    LU(i,8034) = LU(i,8034) - rate_constant(i,324) * number_density(i,192)

    !  k_ISOPAO2_NO3_1: ISOPAO2 + NO3 -> 1*NO2 + 0.4*MACR + 0.6*MVK + 1*CH2O + 1*HO2
    LU(i,8034) = LU(i,8034) - rate_constant(i,330) * number_density(i,165)

    !  k_CH3O2_ISOPAO2_1: CH3O2 + ISOPAO2 -> 0.25*CH3OH + 1*HO2 + 1.5*CH2O + 0.31*MACR + 0.44*MVK
    LU(i,8034) = LU(i,8034) - rate_constant(i,434) * number_density(i,191)

    !  k_ISOPAO2_NO_1: ISOPAO2 + NO -> 0.08*ISOPNITA + 0.92*NO2 + 0.36*MACR + 0.56*MVK + 0.92*CH2O + 0.92*HO2
    LU(i,8034) = LU(i,8034) - rate_constant(i,464) * number_density(i,137)

    ! df_ISOPOOH/d(ISOPAO2)
    !  k_HO2_ISOPAO2_1: HO2 + ISOPAO2 -> 1*ISOPOOH
    LU(i,7986) = LU(i,7986) + rate_constant(i,324) * number_density(i,192)

    ! df_HO2/d(ISOPAO2)
    !  k_CH3CO3_ISOPAO2_1: CH3CO3 + ISOPAO2 -> 1*CH3O2 + 1*HO2 + 1*CH2O + 0.39*MACR + 0.61*MVK + 1*CO2
    LU(i,8037) = LU(i,8037) + rate_constant(i,65) * number_density(i,49)

    !  k_HO2_ISOPAO2_1: HO2 + ISOPAO2 -> 1*ISOPOOH
    LU(i,8037) = LU(i,8037) - rate_constant(i,324) * number_density(i,192)

    !  k_ISOPAO2_NO3_1: ISOPAO2 + NO3 -> 1*NO2 + 0.4*MACR + 0.6*MVK + 1*CH2O + 1*HO2
    LU(i,8037) = LU(i,8037) + rate_constant(i,330) * number_density(i,165)

    !  k_CH3O2_ISOPAO2_1: CH3O2 + ISOPAO2 -> 0.25*CH3OH + 1*HO2 + 1.5*CH2O + 0.31*MACR + 0.44*MVK
    LU(i,8037) = LU(i,8037) + rate_constant(i,434) * number_density(i,191)

    !  k_ISOPAO2_NO_1: ISOPAO2 + NO -> 0.08*ISOPNITA + 0.92*NO2 + 0.36*MACR + 0.56*MVK + 0.92*CH2O + 0.92*HO2
    LU(i,8037) = LU(i,8037) + 0.92*rate_constant(i,464) * number_density(i,137)

  end do
  !$acc end parallel

end subroutine dforce_dy70

subroutine dforce_dy71(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell
    ! df_MACR/d(ISOPAO2)
    !  k_CH3CO3_ISOPAO2_1: CH3CO3 + ISOPAO2 -> 1*CH3O2 + 1*HO2 + 1*CH2O + 0.39*MACR + 0.61*MVK + 1*CO2
    LU(i,8002) = LU(i,8002) + 0.39*rate_constant(i,65) * number_density(i,49)

    !  k_ISOPAO2_NO3_1: ISOPAO2 + NO3 -> 1*NO2 + 0.4*MACR + 0.6*MVK + 1*CH2O + 1*HO2
    LU(i,8002) = LU(i,8002) + 0.4*rate_constant(i,330) * number_density(i,165)

