    !  k_ISOPAO2_NO_1: ISOPAO2 + NO -> 0.08*ISOPNITA + 0.92*NO2 + 0.36*MACR + 0.56*MVK + 0.92*CH2O + 0.92*HO2
    LU(i,8002) = LU(i,8002) + 0.36*rate_constant(i,464) * number_density(i,137)

    ! df_ISOPNITA/d(ISOPAO2)
    !  k_ISOPAO2_NO_1: ISOPAO2 + NO -> 0.08*ISOPNITA + 0.92*NO2 + 0.36*MACR + 0.56*MVK + 0.92*CH2O + 0.92*HO2
    LU(i,7977) = LU(i,7977) + 0.08*rate_constant(i,464) * number_density(i,137)

    ! df_NO3/d(ISOPAO2)
    !  k_ISOPAO2_NO3_1: ISOPAO2 + NO3 -> 1*NO2 + 0.4*MACR + 0.6*MVK + 1*CH2O + 1*HO2
    LU(i,8010) = LU(i,8010) - rate_constant(i,330) * number_density(i,165)

    ! df_NO2/d(MALO2)
    !  k_MALO2_NO2_1: MALO2 + NO2 -> 
    LU(i,6554) = LU(i,6554) - rate_constant(i,356) * number_density(i,54)

    !  k_MALO2_NO_1: MALO2 + NO -> 0.4*GLYOXAL + 0.4*HO2 + 0.4*CO + 1*NO2
    LU(i,6554) = LU(i,6554) + rate_constant(i,424) * number_density(i,137)

    ! df_NO/d(MALO2)
    !  k_MALO2_NO_1: MALO2 + NO -> 0.4*GLYOXAL + 0.4*HO2 + 0.4*CO + 1*NO2
    LU(i,6576) = LU(i,6576) - rate_constant(i,424) * number_density(i,137)

    ! df_MALO2/d(MALO2)
    !  k_HO2_MALO2_1: HO2 + MALO2 -> 0.16*GLYOXAL + 0.16*HO2 + 0.16*CO
    LU(i,6605) = LU(i,6605) - rate_constant(i,1) * number_density(i,192)

    !  k_MALO2_NO2_1: MALO2 + NO2 -> 
    LU(i,6605) = LU(i,6605) - rate_constant(i,356) * number_density(i,54)

    !  k_MALO2_NO_1: MALO2 + NO -> 0.4*GLYOXAL + 0.4*HO2 + 0.4*CO + 1*NO2
    LU(i,6605) = LU(i,6605) - rate_constant(i,424) * number_density(i,137)

    ! df_GLYOXAL/d(MALO2)
    !  k_HO2_MALO2_1: HO2 + MALO2 -> 0.16*GLYOXAL + 0.16*HO2 + 0.16*CO
    LU(i,6575) = LU(i,6575) + 0.16*rate_constant(i,1) * number_density(i,192)

    !  k_MALO2_NO_1: MALO2 + NO -> 0.4*GLYOXAL + 0.4*HO2 + 0.4*CO + 1*NO2
    LU(i,6575) = LU(i,6575) + 0.4*rate_constant(i,424) * number_density(i,137)

    ! df_HO2/d(MALO2)
    !  k_HO2_MALO2_1: HO2 + MALO2 -> 0.16*GLYOXAL + 0.16*HO2 + 0.16*CO
    LU(i,6627) = LU(i,6627) - 0.84*rate_constant(i,1) * number_density(i,192)

    !  k_MALO2_NO_1: MALO2 + NO -> 0.4*GLYOXAL + 0.4*HO2 + 0.4*CO + 1*NO2
    LU(i,6627) = LU(i,6627) + 0.4*rate_constant(i,424) * number_density(i,137)

    ! df_CO/d(MALO2)
    !  k_HO2_MALO2_1: HO2 + MALO2 -> 0.16*GLYOXAL + 0.16*HO2 + 0.16*CO
    LU(i,6611) = LU(i,6611) + 0.16*rate_constant(i,1) * number_density(i,192)

    !  k_MALO2_NO_1: MALO2 + NO -> 0.4*GLYOXAL + 0.4*HO2 + 0.4*CO + 1*NO2
    LU(i,6611) = LU(i,6611) + 0.4*rate_constant(i,424) * number_density(i,137)

    ! df_NO2/d(MBONO3O2)
    !  k_MBONO3O2_NO3_1: MBONO3O2 + NO3 -> 0.25*HMPROP + 0.25*CH2O + 1.25*NO2 + 0.75*HONITR + 0.75*CH3COCH3 + 0.75*HO2
    LU(i,3178) = LU(i,3178) + 1.25*rate_constant(i,44) * number_density(i,165)

    !  k_MBONO3O2_NO_1: MBONO3O2 + NO -> 0.25*HMPROP + 0.25*CH2O + 1.25*NO2 + 0.75*HONITR + 0.75*CH3COCH3 + 0.75*HO2
    LU(i,3178) = LU(i,3178) + 1.25*rate_constant(i,313) * number_density(i,137)

    ! df_NO/d(MBONO3O2)
    !  k_MBONO3O2_NO_1: MBONO3O2 + NO -> 0.25*HMPROP + 0.25*CH2O + 1.25*NO2 + 0.75*HONITR + 0.75*CH3COCH3 + 0.75*HO2
    LU(i,3205) = LU(i,3205) - rate_constant(i,313) * number_density(i,137)

    ! df_CH3COCH3/d(MBONO3O2)
    !  k_MBONO3O2_NO3_1: MBONO3O2 + NO3 -> 0.25*HMPROP + 0.25*CH2O + 1.25*NO2 + 0.75*HONITR + 0.75*CH3COCH3 + 0.75*HO2
    LU(i,3189) = LU(i,3189) + 0.75*rate_constant(i,44) * number_density(i,165)

    !  k_MBONO3O2_NO_1: MBONO3O2 + NO -> 0.25*HMPROP + 0.25*CH2O + 1.25*NO2 + 0.75*HONITR + 0.75*CH3COCH3 + 0.75*HO2
    LU(i,3189) = LU(i,3189) + 0.75*rate_constant(i,313) * number_density(i,137)

    ! df_CH2O/d(MBONO3O2)
    !  k_MBONO3O2_NO3_1: MBONO3O2 + NO3 -> 0.25*HMPROP + 0.25*CH2O + 1.25*NO2 + 0.75*HONITR + 0.75*CH3COCH3 + 0.75*HO2
    LU(i,3200) = LU(i,3200) + 0.25*rate_constant(i,44) * number_density(i,165)

    !  k_MBONO3O2_NO_1: MBONO3O2 + NO -> 0.25*HMPROP + 0.25*CH2O + 1.25*NO2 + 0.75*HONITR + 0.75*CH3COCH3 + 0.75*HO2
    LU(i,3200) = LU(i,3200) + 0.25*rate_constant(i,313) * number_density(i,137)

    ! df_MBONO3O2/d(MBONO3O2)
    !  k_MBONO3O2_NO3_1: MBONO3O2 + NO3 -> 0.25*HMPROP + 0.25*CH2O + 1.25*NO2 + 0.75*HONITR + 0.75*CH3COCH3 + 0.75*HO2
    LU(i,3199) = LU(i,3199) - rate_constant(i,44) * number_density(i,165)

    !  k_HO2_MBONO3O2_1: HO2 + MBONO3O2 -> 
    LU(i,3199) = LU(i,3199) - rate_constant(i,90) * number_density(i,192)

    !  k_MBONO3O2_NO_1: MBONO3O2 + NO -> 0.25*HMPROP + 0.25*CH2O + 1.25*NO2 + 0.75*HONITR + 0.75*CH3COCH3 + 0.75*HO2
    LU(i,3199) = LU(i,3199) - rate_constant(i,313) * number_density(i,137)

    ! df_HMPROP/d(MBONO3O2)
    !  k_MBONO3O2_NO3_1: MBONO3O2 + NO3 -> 0.25*HMPROP + 0.25*CH2O + 1.25*NO2 + 0.75*HONITR + 0.75*CH3COCH3 + 0.75*HO2
    LU(i,3203) = LU(i,3203) + 0.25*rate_constant(i,44) * number_density(i,165)
  end do
  !$acc end parallel

end subroutine dforce_dy71

subroutine dforce_dy72(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    !  k_MBONO3O2_NO_1: MBONO3O2 + NO -> 0.25*HMPROP + 0.25*CH2O + 1.25*NO2 + 0.75*HONITR + 0.75*CH3COCH3 + 0.75*HO2
    LU(i,3203) = LU(i,3203) + 0.25*rate_constant(i,313) * number_density(i,137)

    ! df_HO2/d(MBONO3O2)
    !  k_MBONO3O2_NO3_1: MBONO3O2 + NO3 -> 0.25*HMPROP + 0.25*CH2O + 1.25*NO2 + 0.75*HONITR + 0.75*CH3COCH3 + 0.75*HO2
    LU(i,3247) = LU(i,3247) + 0.75*rate_constant(i,44) * number_density(i,165)

    !  k_HO2_MBONO3O2_1: HO2 + MBONO3O2 -> 
    LU(i,3247) = LU(i,3247) - rate_constant(i,90) * number_density(i,192)

    !  k_MBONO3O2_NO_1: MBONO3O2 + NO -> 0.25*HMPROP + 0.25*CH2O + 1.25*NO2 + 0.75*HONITR + 0.75*CH3COCH3 + 0.75*HO2
    LU(i,3247) = LU(i,3247) + 0.75*rate_constant(i,313) * number_density(i,137)

    ! df_HONITR/d(MBONO3O2)
    !  k_MBONO3O2_NO3_1: MBONO3O2 + NO3 -> 0.25*HMPROP + 0.25*CH2O + 1.25*NO2 + 0.75*HONITR + 0.75*CH3COCH3 + 0.75*HO2
    LU(i,3204) = LU(i,3204) + 0.75*rate_constant(i,44) * number_density(i,165)

    !  k_MBONO3O2_NO_1: MBONO3O2 + NO -> 0.25*HMPROP + 0.25*CH2O + 1.25*NO2 + 0.75*HONITR + 0.75*CH3COCH3 + 0.75*HO2
    LU(i,3204) = LU(i,3204) + 0.75*rate_constant(i,313) * number_density(i,137)

    ! df_NO3/d(MBONO3O2)
    !  k_MBONO3O2_NO3_1: MBONO3O2 + NO3 -> 0.25*HMPROP + 0.25*CH2O + 1.25*NO2 + 0.75*HONITR + 0.75*CH3COCH3 + 0.75*HO2
    LU(i,3220) = LU(i,3220) - rate_constant(i,44) * number_density(i,165)

    ! df_NO2/d(MBOO2)
    !  k_MBOO2_NO_1: MBOO2 + NO -> 1*HO2 + 0.67*GLYALD + 0.67*CH3COCH3 + 0.33*HMPROP + 0.33*CH2O + 1*NO2
    LU(i,3317) = LU(i,3317) + rate_constant(i,308) * number_density(i,137)

    ! df_NO/d(MBOO2)
    !  k_MBOO2_NO_1: MBOO2 + NO -> 1*HO2 + 0.67*GLYALD + 0.67*CH3COCH3 + 0.33*HMPROP + 0.33*CH2O + 1*NO2
    LU(i,3343) = LU(i,3343) - rate_constant(i,308) * number_density(i,137)

    ! df_CH3COCH3/d(MBOO2)
    !  k_CH3O2_MBOO2_1: CH3O2 + MBOO2 -> 0.917*CH2O + 1*HO2 + 0.25*CH3OH + 0.333*GLYALD + 0.333*CH3COCH3 + 0.167*HMPROP
    LU(i,3328) = LU(i,3328) + 0.333*rate_constant(i,155) * number_density(i,191)

    !  k_MBOO2_NO_1: MBOO2 + NO -> 1*HO2 + 0.67*GLYALD + 0.67*CH3COCH3 + 0.33*HMPROP + 0.33*CH2O + 1*NO2
    LU(i,3328) = LU(i,3328) + 0.67*rate_constant(i,308) * number_density(i,137)

    ! df_CH3O2/d(MBOO2)
    !  k_CH3O2_MBOO2_1: CH3O2 + MBOO2 -> 0.917*CH2O + 1*HO2 + 0.25*CH3OH + 0.333*GLYALD + 0.333*CH3COCH3 + 0.167*HMPROP
    LU(i,3386) = LU(i,3386) - rate_constant(i,155) * number_density(i,191)

    ! df_CH2O/d(MBOO2)
    !  k_CH3O2_MBOO2_1: CH3O2 + MBOO2 -> 0.917*CH2O + 1*HO2 + 0.25*CH3OH + 0.333*GLYALD + 0.333*CH3COCH3 + 0.167*HMPROP
    LU(i,3338) = LU(i,3338) + 0.917*rate_constant(i,155) * number_density(i,191)

    !  k_MBOO2_NO_1: MBOO2 + NO -> 1*HO2 + 0.67*GLYALD + 0.67*CH3COCH3 + 0.33*HMPROP + 0.33*CH2O + 1*NO2
    LU(i,3338) = LU(i,3338) + 0.33*rate_constant(i,308) * number_density(i,137)

    ! df_CH3OH/d(MBOO2)
    !  k_CH3O2_MBOO2_1: CH3O2 + MBOO2 -> 0.917*CH2O + 1*HO2 + 0.25*CH3OH + 0.333*GLYALD + 0.333*CH3COCH3 + 0.167*HMPROP
    LU(i,3337) = LU(i,3337) + 0.25*rate_constant(i,155) * number_density(i,191)

    ! df_MBOO2/d(MBOO2)
    !  k_CH3O2_MBOO2_1: CH3O2 + MBOO2 -> 0.917*CH2O + 1*HO2 + 0.25*CH3OH + 0.333*GLYALD + 0.333*CH3COCH3 + 0.167*HMPROP
    LU(i,3339) = LU(i,3339) - rate_constant(i,155) * number_density(i,191)

    !  k_HO2_MBOO2_1: HO2 + MBOO2 -> 1*MBOOOH
    LU(i,3339) = LU(i,3339) - rate_constant(i,247) * number_density(i,192)

    !  k_MBOO2_NO_1: MBOO2 + NO -> 1*HO2 + 0.67*GLYALD + 0.67*CH3COCH3 + 0.33*HMPROP + 0.33*CH2O + 1*NO2
    LU(i,3339) = LU(i,3339) - rate_constant(i,308) * number_density(i,137)

    ! df_HMPROP/d(MBOO2)
    !  k_CH3O2_MBOO2_1: CH3O2 + MBOO2 -> 0.917*CH2O + 1*HO2 + 0.25*CH3OH + 0.333*GLYALD + 0.333*CH3COCH3 + 0.167*HMPROP
    LU(i,3342) = LU(i,3342) + 0.167*rate_constant(i,155) * number_density(i,191)

    !  k_MBOO2_NO_1: MBOO2 + NO -> 1*HO2 + 0.67*GLYALD + 0.67*CH3COCH3 + 0.33*HMPROP + 0.33*CH2O + 1*NO2
    LU(i,3342) = LU(i,3342) + 0.33*rate_constant(i,308) * number_density(i,137)

    ! df_GLYALD/d(MBOO2)
    !  k_CH3O2_MBOO2_1: CH3O2 + MBOO2 -> 0.917*CH2O + 1*HO2 + 0.25*CH3OH + 0.333*GLYALD + 0.333*CH3COCH3 + 0.167*HMPROP
    LU(i,3351) = LU(i,3351) + 0.333*rate_constant(i,155) * number_density(i,191)

    !  k_MBOO2_NO_1: MBOO2 + NO -> 1*HO2 + 0.67*GLYALD + 0.67*CH3COCH3 + 0.33*HMPROP + 0.33*CH2O + 1*NO2
    LU(i,3351) = LU(i,3351) + 0.67*rate_constant(i,308) * number_density(i,137)

    ! df_HO2/d(MBOO2)
    !  k_CH3O2_MBOO2_1: CH3O2 + MBOO2 -> 0.917*CH2O + 1*HO2 + 0.25*CH3OH + 0.333*GLYALD + 0.333*CH3COCH3 + 0.167*HMPROP
    LU(i,3387) = LU(i,3387) + rate_constant(i,155) * number_density(i,191)

    !  k_HO2_MBOO2_1: HO2 + MBOO2 -> 1*MBOOOH
    LU(i,3387) = LU(i,3387) - rate_constant(i,247) * number_density(i,192)

    !  k_MBOO2_NO_1: MBOO2 + NO -> 1*HO2 + 0.67*GLYALD + 0.67*CH3COCH3 + 0.33*HMPROP + 0.33*CH2O + 1*NO2
    LU(i,3387) = LU(i,3387) + rate_constant(i,308) * number_density(i,137)

    ! df_MBOOOH/d(MBOO2)
    !  k_HO2_MBOO2_1: HO2 + MBOO2 -> 1*MBOOOH
    LU(i,3346) = LU(i,3346) + rate_constant(i,247) * number_density(i,192)

    ! df_ISOPNITB/d(ISOPBO2)
    !  k_ISOPBO2_NO_1: ISOPBO2 + NO -> 0.87*HYDRALD + 0.08*ISOPNITB + 0.92*NO2 + 0.92*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    LU(i,8046) = LU(i,8046) + 0.08*rate_constant(i,96) * number_density(i,137)

    ! df_CH3CO3/d(ISOPBO2)
    !  k_CH3CO3_ISOPBO2_1: CH3CO3 + ISOPBO2 -> 1*HYDRALD + 1*CH3O2 + 1*HO2
    LU(i,8038) = LU(i,8038) - rate_constant(i,340) * number_density(i,49)

  end do
  !$acc end parallel

end subroutine dforce_dy72

subroutine dforce_dy73(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell
    ! df_HYAC/d(ISOPBO2)
    !  k_ISOPBO2_NO_1: ISOPBO2 + NO -> 0.87*HYDRALD + 0.08*ISOPNITB + 0.92*NO2 + 0.92*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    LU(i,8041) = LU(i,8041) + 0.05*rate_constant(i,96) * number_density(i,137)

    !  k_ISOPBO2_NO3_1: ISOPBO2 + NO3 -> 1*NO2 + 0.95*HYDRALD + 1*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    LU(i,8041) = LU(i,8041) + 0.05*rate_constant(i,178) * number_density(i,165)

    ! df_HPALD/d(ISOPBO2)
    !  k_ISOPBO2_1: ISOPBO2 -> 1*HPALD + 1*HO2
    LU(i,8042) = LU(i,8042) + rate_constant(i,390)

    ! df_NO2/d(ISOPBO2)
    !  k_ISOPBO2_NO_1: ISOPBO2 + NO -> 0.87*HYDRALD + 0.08*ISOPNITB + 0.92*NO2 + 0.92*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    LU(i,8039) = LU(i,8039) + 0.92*rate_constant(i,96) * number_density(i,137)

    !  k_ISOPBO2_NO3_1: ISOPBO2 + NO3 -> 1*NO2 + 0.95*HYDRALD + 1*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    LU(i,8039) = LU(i,8039) + rate_constant(i,178) * number_density(i,165)

    ! df_NO/d(ISOPBO2)
    !  k_ISOPBO2_NO_1: ISOPBO2 + NO -> 0.87*HYDRALD + 0.08*ISOPNITB + 0.92*NO2 + 0.92*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    LU(i,8064) = LU(i,8064) - rate_constant(i,96) * number_density(i,137)

    ! df_CH3COCHO/d(ISOPBO2)
    !  k_ISOPBO2_NO_1: ISOPBO2 + NO -> 0.87*HYDRALD + 0.08*ISOPNITB + 0.92*NO2 + 0.92*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    LU(i,8055) = LU(i,8055) + 0.05*rate_constant(i,96) * number_density(i,137)

    !  k_ISOPBO2_NO3_1: ISOPBO2 + NO3 -> 1*NO2 + 0.95*HYDRALD + 1*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    LU(i,8055) = LU(i,8055) + 0.05*rate_constant(i,178) * number_density(i,165)

    ! df_CH3O2/d(ISOPBO2)
    !  k_CH3O2_ISOPBO2_1: CH3O2 + ISOPBO2 -> 0.25*CH3OH + 1*HO2 + 0.75*CH2O + 0.75*HYDRALD
    LU(i,8115) = LU(i,8115) - rate_constant(i,167) * number_density(i,191)

    !  k_CH3CO3_ISOPBO2_1: CH3CO3 + ISOPBO2 -> 1*HYDRALD + 1*CH3O2 + 1*HO2
    LU(i,8115) = LU(i,8115) + rate_constant(i,340) * number_density(i,49)

    ! df_CH2O/d(ISOPBO2)
    !  k_CH3O2_ISOPBO2_1: CH3O2 + ISOPBO2 -> 0.25*CH3OH + 1*HO2 + 0.75*CH2O + 0.75*HYDRALD
    LU(i,8060) = LU(i,8060) + 0.75*rate_constant(i,167) * number_density(i,191)

    ! df_CH3OH/d(ISOPBO2)
    !  k_CH3O2_ISOPBO2_1: CH3O2 + ISOPBO2 -> 0.25*CH3OH + 1*HO2 + 0.75*CH2O + 0.75*HYDRALD
    LU(i,8059) = LU(i,8059) + 0.25*rate_constant(i,167) * number_density(i,191)

    ! df_ISOPBO2/d(ISOPBO2)
    !  k_ISOPBO2_NO_1: ISOPBO2 + NO -> 0.87*HYDRALD + 0.08*ISOPNITB + 0.92*NO2 + 0.92*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    LU(i,8114) = LU(i,8114) - rate_constant(i,96) * number_density(i,137)

    !  k_CH3O2_ISOPBO2_1: CH3O2 + ISOPBO2 -> 0.25*CH3OH + 1*HO2 + 0.75*CH2O + 0.75*HYDRALD
    LU(i,8114) = LU(i,8114) - rate_constant(i,167) * number_density(i,191)

    !  k_ISOPBO2_NO3_1: ISOPBO2 + NO3 -> 1*NO2 + 0.95*HYDRALD + 1*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    LU(i,8114) = LU(i,8114) - rate_constant(i,178) * number_density(i,165)

    !  k_HO2_ISOPBO2_1: HO2 + ISOPBO2 -> 1*ISOPOOH
    LU(i,8114) = LU(i,8114) - rate_constant(i,279) * number_density(i,192)

    !  k_CH3CO3_ISOPBO2_1: CH3CO3 + ISOPBO2 -> 1*HYDRALD + 1*CH3O2 + 1*HO2
    LU(i,8114) = LU(i,8114) - rate_constant(i,340) * number_density(i,49)

    !  k_ISOPBO2_1: ISOPBO2 -> 1*HPALD + 1*HO2
    LU(i,8114) = LU(i,8114) - rate_constant(i,390)

    ! df_GLYOXAL/d(ISOPBO2)
    !  k_ISOPBO2_NO_1: ISOPBO2 + NO -> 0.87*HYDRALD + 0.08*ISOPNITB + 0.92*NO2 + 0.92*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    LU(i,8062) = LU(i,8062) + 0.05*rate_constant(i,96) * number_density(i,137)

    !  k_ISOPBO2_NO3_1: ISOPBO2 + NO3 -> 1*NO2 + 0.95*HYDRALD + 1*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    LU(i,8062) = LU(i,8062) + 0.05*rate_constant(i,178) * number_density(i,165)

    ! df_ISOPOOH/d(ISOPBO2)
    !  k_HO2_ISOPBO2_1: HO2 + ISOPBO2 -> 1*ISOPOOH
    LU(i,8065) = LU(i,8065) + rate_constant(i,279) * number_density(i,192)

    ! df_GLYALD/d(ISOPBO2)
    !  k_ISOPBO2_NO_1: ISOPBO2 + NO -> 0.87*HYDRALD + 0.08*ISOPNITB + 0.92*NO2 + 0.92*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    LU(i,8080) = LU(i,8080) + 0.05*rate_constant(i,96) * number_density(i,137)

    !  k_ISOPBO2_NO3_1: ISOPBO2 + NO3 -> 1*NO2 + 0.95*HYDRALD + 1*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    LU(i,8080) = LU(i,8080) + 0.05*rate_constant(i,178) * number_density(i,165)

    ! df_HO2/d(ISOPBO2)
    !  k_ISOPBO2_NO_1: ISOPBO2 + NO -> 0.87*HYDRALD + 0.08*ISOPNITB + 0.92*NO2 + 0.92*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    LU(i,8116) = LU(i,8116) + 0.92*rate_constant(i,96) * number_density(i,137)

    !  k_CH3O2_ISOPBO2_1: CH3O2 + ISOPBO2 -> 0.25*CH3OH + 1*HO2 + 0.75*CH2O + 0.75*HYDRALD
    LU(i,8116) = LU(i,8116) + rate_constant(i,167) * number_density(i,191)

    !  k_ISOPBO2_NO3_1: ISOPBO2 + NO3 -> 1*NO2 + 0.95*HYDRALD + 1*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    LU(i,8116) = LU(i,8116) + rate_constant(i,178) * number_density(i,165)

    !  k_HO2_ISOPBO2_1: HO2 + ISOPBO2 -> 1*ISOPOOH
    LU(i,8116) = LU(i,8116) - rate_constant(i,279) * number_density(i,192)

    !  k_CH3CO3_ISOPBO2_1: CH3CO3 + ISOPBO2 -> 1*HYDRALD + 1*CH3O2 + 1*HO2
