    ! df_CH3CHO/d(MEKO2)
    !  k_HO2_MEKO2_1: HO2 + MEKO2 -> 0.8*MEKOOH + 0.2*OH + 0.2*CH3CHO + 0.2*CH3CO3
    LU(i,3509) = LU(i,3509) + 0.2*rate_constant(i,139) * number_density(i,192)

    !  k_MEKO2_NO_1: MEKO2 + NO -> 1*CH3CO3 + 1*CH3CHO + 1*NO2
    LU(i,3509) = LU(i,3509) + rate_constant(i,332) * number_density(i,137)

    ! df_NO2/d(EO2)
    !  k_EO2_NO_1: EO2 + NO -> 0.5*CH2O + 0.25*HO2 + 0.75*EO + 1*NO2
    LU(i,5928) = LU(i,5928) + rate_constant(i,16) * number_density(i,137)

    ! df_EOOH/d(EO2)
    !  k_EO2_HO2_1: EO2 + HO2 -> 1*EOOH
    LU(i,5935) = LU(i,5935) + rate_constant(i,152) * number_density(i,192)

    ! df_NO/d(EO2)
    !  k_EO2_NO_1: EO2 + NO -> 0.5*CH2O + 0.25*HO2 + 0.75*EO + 1*NO2
    LU(i,5951) = LU(i,5951) - rate_constant(i,16) * number_density(i,137)

    ! df_CH2O/d(EO2)
    !  k_EO2_NO_1: EO2 + NO -> 0.5*CH2O + 0.25*HO2 + 0.75*EO + 1*NO2
    LU(i,5948) = LU(i,5948) + 0.5*rate_constant(i,16) * number_density(i,137)

    ! df_EO2/d(EO2)
    !  k_EO2_NO_1: EO2 + NO -> 0.5*CH2O + 0.25*HO2 + 0.75*EO + 1*NO2
    LU(i,5973) = LU(i,5973) - rate_constant(i,16) * number_density(i,137)

    !  k_EO2_HO2_1: EO2 + HO2 -> 1*EOOH
    LU(i,5973) = LU(i,5973) - rate_constant(i,152) * number_density(i,192)

    ! df_EO/d(EO2)
    !  k_EO2_NO_1: EO2 + NO -> 0.5*CH2O + 0.25*HO2 + 0.75*EO + 1*NO2
    LU(i,5972) = LU(i,5972) + 0.75*rate_constant(i,16) * number_density(i,137)

    ! df_HO2/d(EO2)
    !  k_EO2_NO_1: EO2 + NO -> 0.5*CH2O + 0.25*HO2 + 0.75*EO + 1*NO2
    LU(i,6002) = LU(i,6002) + 0.25*rate_constant(i,16) * number_density(i,137)

    !  k_EO2_HO2_1: EO2 + HO2 -> 1*EOOH
    LU(i,6002) = LU(i,6002) - rate_constant(i,152) * number_density(i,192)

    ! df_O2/d(EO)
    !  k_EO_O2_1: EO + O2 -> 1*GLYALD + 1*HO2
    LU(i,5852) = LU(i,5852) - rate_constant(i,442) * number_density(i,41)

    ! df_CH2O/d(EO)
    !  k_EO_1: EO -> 2*CH2O + 1*HO2
    LU(i,5873) = LU(i,5873) + 2*rate_constant(i,372)

    ! df_EO/d(EO)
    !  k_EO_1: EO -> 2*CH2O + 1*HO2
    LU(i,5897) = LU(i,5897) - rate_constant(i,372)

    !  k_EO_O2_1: EO + O2 -> 1*GLYALD + 1*HO2
    LU(i,5897) = LU(i,5897) - rate_constant(i,442) * number_density(i,41)

  end do
  !$acc end parallel

end subroutine dforce_dy76

subroutine dforce_dy77(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell
    ! df_GLYALD/d(EO)
    !  k_EO_O2_1: EO + O2 -> 1*GLYALD + 1*HO2
    LU(i,5891) = LU(i,5891) + rate_constant(i,442) * number_density(i,41)

    ! df_HO2/d(EO)
    !  k_EO_1: EO -> 2*CH2O + 1*HO2
    LU(i,5927) = LU(i,5927) + rate_constant(i,372)

    !  k_EO_O2_1: EO + O2 -> 1*GLYALD + 1*HO2
    LU(i,5927) = LU(i,5927) + rate_constant(i,442) * number_density(i,41)

    ! df_CO2/d(GLYOXAL)
    !  k_GLYOXAL_OH_1: GLYOXAL + OH -> 1*HO2 + 1*CO + 1*CO2
    LU(i,3655) = LU(i,3655) + rate_constant(i,176) * number_density(i,166)

    ! df_GLYOXAL/d(GLYOXAL)
    !  k_GLYOXAL_OH_1: GLYOXAL + OH -> 1*HO2 + 1*CO + 1*CO2
    LU(i,3656) = LU(i,3656) - rate_constant(i,176) * number_density(i,166)

    !  k_GLYOXAL_1: GLYOXAL -> 2*CO + 2*HO2
    LU(i,3656) = LU(i,3656) - rate_constant(i,416)

    ! df_HO2/d(GLYOXAL)
    !  k_GLYOXAL_OH_1: GLYOXAL + OH -> 1*HO2 + 1*CO + 1*CO2
    LU(i,3660) = LU(i,3660) + rate_constant(i,176) * number_density(i,166)

    !  k_GLYOXAL_1: GLYOXAL -> 2*CO + 2*HO2
    LU(i,3660) = LU(i,3660) + 2*rate_constant(i,416)

    ! df_OH/d(GLYOXAL)
    !  k_GLYOXAL_OH_1: GLYOXAL + OH -> 1*HO2 + 1*CO + 1*CO2
    LU(i,3657) = LU(i,3657) - rate_constant(i,176) * number_density(i,166)

    ! df_CO/d(GLYOXAL)
    !  k_GLYOXAL_OH_1: GLYOXAL + OH -> 1*HO2 + 1*CO + 1*CO2
    LU(i,3658) = LU(i,3658) + rate_constant(i,176) * number_density(i,166)

    !  k_GLYOXAL_1: GLYOXAL -> 2*CO + 2*HO2
    LU(i,3658) = LU(i,3658) + 2*rate_constant(i,416)

    ! df_HMPROPO2/d(HMPROP)
    !  k_HMPROP_OH_1: HMPROP + OH -> 1*HMPROPO2
    LU(i,3661) = LU(i,3661) + rate_constant(i,453) * number_density(i,166)

    ! df_HMPROP/d(HMPROP)
    !  k_HMPROP_OH_1: HMPROP + OH -> 1*HMPROPO2
    LU(i,3679) = LU(i,3679) - rate_constant(i,453) * number_density(i,166)

    ! df_OH/d(HMPROP)
    !  k_HMPROP_OH_1: HMPROP + OH -> 1*HMPROPO2
    LU(i,3697) = LU(i,3697) - rate_constant(i,453) * number_density(i,166)

    ! df_O2/d(N2O)
    !  k_N2O_O1D_2: N2O + O1D -> 1*N2 + 1*O2
    LU(i,5776) = LU(i,5776) + rate_constant(i,443) * number_density(i,112)

    ! df_N2/d(N2O)
    !  k_N2O_1: N2O -> 1*O1D + 1*N2
    LU(i,5775) = LU(i,5775) + rate_constant(i,147)

    !  k_N2O_O1D_2: N2O + O1D -> 1*N2 + 1*O2
    LU(i,5775) = LU(i,5775) + rate_constant(i,443) * number_density(i,112)

    ! df_NO/d(N2O)
    !  k_N2O_O1D_1: N2O + O1D -> 2*NO
    LU(i,5800) = LU(i,5800) + 2*rate_constant(i,180) * number_density(i,112)

    ! df_O1D/d(N2O)
    !  k_N2O_1: N2O -> 1*O1D + 1*N2
    LU(i,5793) = LU(i,5793) + rate_constant(i,147)

    !  k_N2O_O1D_1: N2O + O1D -> 2*NO
    LU(i,5793) = LU(i,5793) - rate_constant(i,180) * number_density(i,112)

    !  k_N2O_O1D_2: N2O + O1D -> 1*N2 + 1*O2
    LU(i,5793) = LU(i,5793) - rate_constant(i,443) * number_density(i,112)

    ! df_N2O/d(N2O)
    !  k_N2O_1: N2O -> 1*O1D + 1*N2
    LU(i,5820) = LU(i,5820) - rate_constant(i,147)

    !  k_N2O_O1D_1: N2O + O1D -> 2*NO
    LU(i,5820) = LU(i,5820) - rate_constant(i,180) * number_density(i,112)

    !  k_N2O_O1D_2: N2O + O1D -> 1*N2 + 1*O2
    LU(i,5820) = LU(i,5820) - rate_constant(i,443) * number_density(i,112)

    ! df_HYAC/d(MPAN)
    !  k_MPAN_OH_1: MPAN + OH -> 0.5*HYAC + 0.5*NO3 + 0.5*CH2O + 0.5*HO2 + 0.5*CO2
    LU(i,5626) = LU(i,5626) + 0.5*rate_constant(i,28) * number_density(i,166)

    ! df_NO2/d(MPAN)
    !  k_MPAN_1: MPAN -> 1*MCO3 + 1*NO2
    LU(i,5624) = LU(i,5624) + rate_constant(i,288)

    !  k_MPAN_2: MPAN -> 1*MCO3 + 1*NO2
    LU(i,5624) = LU(i,5624) + rate_constant(i,438)

    ! df_CO2/d(MPAN)
    !  k_MPAN_OH_1: MPAN + OH -> 0.5*HYAC + 0.5*NO3 + 0.5*CH2O + 0.5*HO2 + 0.5*CO2
    LU(i,5632) = LU(i,5632) + 0.5*rate_constant(i,28) * number_density(i,166)
  end do
  !$acc end parallel

end subroutine dforce_dy77

subroutine dforce_dy78(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! df_CH2O/d(MPAN)
    !  k_MPAN_OH_1: MPAN + OH -> 0.5*HYAC + 0.5*NO3 + 0.5*CH2O + 0.5*HO2 + 0.5*CO2
    LU(i,5643) = LU(i,5643) + 0.5*rate_constant(i,28) * number_density(i,166)

    ! df_MCO3/d(MPAN)
    !  k_MPAN_1: MPAN -> 1*MCO3 + 1*NO2
    LU(i,5672) = LU(i,5672) + rate_constant(i,288)

    !  k_MPAN_2: MPAN -> 1*MCO3 + 1*NO2
    LU(i,5672) = LU(i,5672) + rate_constant(i,438)

    ! df_MPAN/d(MPAN)
    !  k_MPAN_OH_1: MPAN + OH -> 0.5*HYAC + 0.5*NO3 + 0.5*CH2O + 0.5*HO2 + 0.5*CO2
    LU(i,5664) = LU(i,5664) - rate_constant(i,28) * number_density(i,166)

    !  k_MPAN_1: MPAN -> 1*MCO3 + 1*NO2
    LU(i,5664) = LU(i,5664) - rate_constant(i,288)

    !  k_MPAN_2: MPAN -> 1*MCO3 + 1*NO2
    LU(i,5664) = LU(i,5664) - rate_constant(i,438)

    ! df_HO2/d(MPAN)
    !  k_MPAN_OH_1: MPAN + OH -> 0.5*HYAC + 0.5*NO3 + 0.5*CH2O + 0.5*HO2 + 0.5*CO2
    LU(i,5697) = LU(i,5697) + 0.5*rate_constant(i,28) * number_density(i,166)

    ! df_NO3/d(MPAN)
    !  k_MPAN_OH_1: MPAN + OH -> 0.5*HYAC + 0.5*NO3 + 0.5*CH2O + 0.5*HO2 + 0.5*CO2
    LU(i,5670) = LU(i,5670) + 0.5*rate_constant(i,28) * number_density(i,166)

    ! df_OH/d(MPAN)
    !  k_MPAN_OH_1: MPAN + OH -> 0.5*HYAC + 0.5*NO3 + 0.5*CH2O + 0.5*HO2 + 0.5*CO2
    LU(i,5671) = LU(i,5671) - rate_constant(i,28) * number_density(i,166)

    ! df_NC4CH2OH/d(NC4CH2OH)
    !  k_NC4CH2OH_OH_1: NC4CH2OH + OH -> 1*GLYALD + 1*NOA + 1*HO2
    LU(i,5589) = LU(i,5589) - rate_constant(i,295) * number_density(i,166)

    ! df_GLYALD/d(NC4CH2OH)
    !  k_NC4CH2OH_OH_1: NC4CH2OH + OH -> 1*GLYALD + 1*NOA + 1*HO2
    LU(i,5587) = LU(i,5587) + rate_constant(i,295) * number_density(i,166)

    ! df_HO2/d(NC4CH2OH)
    !  k_NC4CH2OH_OH_1: NC4CH2OH + OH -> 1*GLYALD + 1*NOA + 1*HO2
    LU(i,5623) = LU(i,5623) + rate_constant(i,295) * number_density(i,166)

    ! df_OH/d(NC4CH2OH)
    !  k_NC4CH2OH_OH_1: NC4CH2OH + OH -> 1*GLYALD + 1*NOA + 1*HO2
    LU(i,5597) = LU(i,5597) - rate_constant(i,295) * number_density(i,166)

    ! df_NOA/d(NC4CH2OH)
    !  k_NC4CH2OH_OH_1: NC4CH2OH + OH -> 1*GLYALD + 1*NOA + 1*HO2
    LU(i,5548) = LU(i,5548) + rate_constant(i,295) * number_density(i,166)

    ! df_MVK/d(ISOPOOH)
    !  k_ISOPOOH_1: ISOPOOH -> 0.402*MVK + 0.288*MACR + 0.69*CH2O + 1*HO2
    LU(i,4116) = LU(i,4116) + 0.402*rate_constant(i,233)

    ! df_CH2O/d(ISOPOOH)
    !  k_ISOPOOH_1: ISOPOOH -> 0.402*MVK + 0.288*MACR + 0.69*CH2O + 1*HO2
    LU(i,4138) = LU(i,4138) + 0.69*rate_constant(i,233)

    ! df_ISOPOOH/d(ISOPOOH)
    !  k_ISOPOOH_1: ISOPOOH -> 0.402*MVK + 0.288*MACR + 0.69*CH2O + 1*HO2
    LU(i,4142) = LU(i,4142) - rate_constant(i,233)

    !  k_ISOPOOH_OH_1: ISOPOOH + OH -> 0.4*XO2 + 0.6*IEPOX + 0.6*OH
    LU(i,4142) = LU(i,4142) - rate_constant(i,482) * number_density(i,166)

    ! df_HO2/d(ISOPOOH)
    !  k_ISOPOOH_1: ISOPOOH -> 0.402*MVK + 0.288*MACR + 0.69*CH2O + 1*HO2
    LU(i,4193) = LU(i,4193) + rate_constant(i,233)

    ! df_XO2/d(ISOPOOH)
    !  k_ISOPOOH_OH_1: ISOPOOH + OH -> 0.4*XO2 + 0.6*IEPOX + 0.6*OH
    LU(i,4154) = LU(i,4154) + 0.4*rate_constant(i,482) * number_density(i,166)

    ! df_MACR/d(ISOPOOH)
    !  k_ISOPOOH_1: ISOPOOH -> 0.402*MVK + 0.288*MACR + 0.69*CH2O + 1*HO2
    LU(i,4158) = LU(i,4158) + 0.288*rate_constant(i,233)

    ! df_IEPOX/d(ISOPOOH)
    !  k_ISOPOOH_OH_1: ISOPOOH + OH -> 0.4*XO2 + 0.6*IEPOX + 0.6*OH
    LU(i,4125) = LU(i,4125) + 0.6*rate_constant(i,482) * number_density(i,166)

    ! df_OH/d(ISOPOOH)
    !  k_ISOPOOH_OH_1: ISOPOOH + OH -> 0.4*XO2 + 0.6*IEPOX + 0.6*OH
    LU(i,4167) = LU(i,4167) - 0.4*rate_constant(i,482) * number_density(i,166)

    ! df_CO2/d(GLYALD)
    !  k_GLYALD_OH_1: GLYALD + OH -> 1*HO2 + 0.2*GLYOXAL + 0.8*CH2O + 0.8*CO2
    LU(i,5417) = LU(i,5417) + 0.8*rate_constant(i,123) * number_density(i,166)

    ! df_CH2O/d(GLYALD)
    !  k_GLYALD_OH_1: GLYALD + OH -> 1*HO2 + 0.2*GLYOXAL + 0.8*CH2O + 0.8*CO2
    LU(i,5418) = LU(i,5418) + 0.8*rate_constant(i,123) * number_density(i,166)

    !  k_GLYALD_1: GLYALD -> 2*HO2 + 1*CO + 1*CH2O
    LU(i,5418) = LU(i,5418) + rate_constant(i,338)

    ! df_GLYOXAL/d(GLYALD)
    !  k_GLYALD_OH_1: GLYALD + OH -> 1*HO2 + 0.2*GLYOXAL + 0.8*CH2O + 0.8*CO2
    LU(i,5420) = LU(i,5420) + 0.2*rate_constant(i,123) * number_density(i,166)
  end do
  !$acc end parallel

end subroutine dforce_dy78

subroutine dforce_dy79(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! df_GLYALD/d(GLYALD)
    !  k_GLYALD_OH_1: GLYALD + OH -> 1*HO2 + 0.2*GLYOXAL + 0.8*CH2O + 0.8*CO2
    LU(i,5436) = LU(i,5436) - rate_constant(i,123) * number_density(i,166)

    !  k_GLYALD_1: GLYALD -> 2*HO2 + 1*CO + 1*CH2O
    LU(i,5436) = LU(i,5436) - rate_constant(i,338)

    ! df_HO2/d(GLYALD)
    !  k_GLYALD_OH_1: GLYALD + OH -> 1*HO2 + 0.2*GLYOXAL + 0.8*CH2O + 0.8*CO2
    LU(i,5472) = LU(i,5472) + rate_constant(i,123) * number_density(i,166)

    !  k_GLYALD_1: GLYALD -> 2*HO2 + 1*CO + 1*CH2O
    LU(i,5472) = LU(i,5472) + 2*rate_constant(i,338)

    ! df_OH/d(GLYALD)
    !  k_GLYALD_OH_1: GLYALD + OH -> 1*HO2 + 0.2*GLYOXAL + 0.8*CH2O + 0.8*CO2
    LU(i,5446) = LU(i,5446) - rate_constant(i,123) * number_density(i,166)

    ! df_CO/d(GLYALD)
    !  k_GLYALD_1: GLYALD -> 2*HO2 + 1*CO + 1*CH2O
    LU(i,5456) = LU(i,5456) + rate_constant(i,338)

    ! df_BZOOH/d(HO2)
    !  k_BZOO_HO2_1: BZOO + HO2 -> 1*BZOOH
    LU(i,8208) = LU(i,8208) + rate_constant(i,331) * number_density(i,33)

    ! df_C6H5OOH/d(HO2)
    !  k_C6H5O2_HO2_1: C6H5O2 + HO2 -> 1*C6H5OOH
    LU(i,8210) = LU(i,8210) + rate_constant(i,179) * number_density(i,81)

    ! df_O2/d(HO2)
    !  k_BR_HO2_1: BR + HO2 -> 1*HBR + 1*O2
    LU(i,8219) = LU(i,8219) + rate_constant(i,38) * number_density(i,90)

    !  k_C3H7O2_HO2_1: C3H7O2 + HO2 -> 1*C3H7OOH + 1*O2
    LU(i,8219) = LU(i,8219) + rate_constant(i,142) * number_density(i,109)

    !  k_HO2_HO2_1: HO2 + HO2 -> 1*H2O2 + 1*O2
    LU(i,8219) = LU(i,8219) + rate_constant(i,209) * number_density(i,192)

    !  k_HO2_HO2_1: HO2 + HO2 -> 1*H2O2 + 1*O2
    LU(i,8219) = LU(i,8219) + rate_constant(i,209) * number_density(i,192)

    !  k_HO2_HO2_M_1: HO2 + HO2 + M -> 1*H2O2 + 1*O2 + 1*M
    LU(i,8219) = LU(i,8219) + rate_constant(i,210) * number_density(i,192) * number_density(i,1)

    !  k_HO2_HO2_M_1: HO2 + HO2 + M -> 1*H2O2 + 1*O2 + 1*M
    LU(i,8219) = LU(i,8219) + rate_constant(i,210) * number_density(i,192) * number_density(i,1)

    !  k_H2O_HO2_HO2_1: H2O + HO2 + HO2 -> 1*H2O2 + 1*O2 + 1*H2O
    LU(i,8219) = LU(i,8219) + rate_constant(i,211) * number_density(i,68) * number_density(i,192)

    !  k_H2O_HO2_HO2_1: H2O + HO2 + HO2 -> 1*H2O2 + 1*O2 + 1*H2O
    LU(i,8219) = LU(i,8219) + rate_constant(i,211) * number_density(i,68) * number_density(i,192)

    !  k_H2O_HO2_HO2_M_1: H2O + HO2 + HO2 + M -> 1*H2O2 + 1*O2 + 1*M + 1*H2O
    LU(i,8219) = LU(i,8219) + rate_constant(i,212) * number_density(i,68) * number_density(i,192) * number_density(i,1)

    !  k_H2O_HO2_HO2_M_1: H2O + HO2 + HO2 + M -> 1*H2O2 + 1*O2 + 1*M + 1*H2O
    LU(i,8219) = LU(i,8219) + rate_constant(i,212) * number_density(i,68) * number_density(i,192) * number_density(i,1)

    !  k_HO2_O_1: HO2 + O -> 1*OH + 1*O2
    LU(i,8219) = LU(i,8219) + rate_constant(i,217) * number_density(i,187)

    !  k_H_HO2_1: H + HO2 -> 1*H2 + 1*O2
    LU(i,8219) = LU(i,8219) + rate_constant(i,224) * number_density(i,48)

    !  k_CL_HO2_1: CL + HO2 -> 1*HCL + 1*O2
    LU(i,8219) = LU(i,8219) + rate_constant(i,264) * number_density(i,100)

    !  k_HO2_PO2_1: HO2 + PO2 -> 1*POOH + 1*O2
    LU(i,8219) = LU(i,8219) + rate_constant(i,265) * number_density(i,151)

    !  k_HO2_OH_1: HO2 + OH -> 1*H2O + 1*O2
    LU(i,8219) = LU(i,8219) + rate_constant(i,291) * number_density(i,166)

    !  k_BRO_HO2_1: BRO + HO2 -> 1*HOBR + 1*O2
    LU(i,8219) = LU(i,8219) + rate_constant(i,299) * number_density(i,71)

    !  k_CH3O2_HO2_1: CH3O2 + HO2 -> 1*CH3OOH + 1*O2
    LU(i,8219) = LU(i,8219) + rate_constant(i,301) * number_density(i,191)

    !  k_C2H5O2_HO2_1: C2H5O2 + HO2 -> 1*C2H5OOH + 1*O2
    LU(i,8219) = LU(i,8219) + rate_constant(i,343) * number_density(i,87)

    !  k_HO2_O3_1: HO2 + O3 -> 1*OH + 2*O2
    LU(i,8219) = LU(i,8219) + 2*rate_constant(i,368) * number_density(i,171)

    !  k_CLO_HO2_1: CLO + HO2 -> 1*O2 + 1*HOCL
    LU(i,8219) = LU(i,8219) + rate_constant(i,402) * number_density(i,86)

    !  k_HO2_NO3_1: HO2 + NO3 -> 1*OH + 1*NO2 + 1*O2
    LU(i,8219) = LU(i,8219) + rate_constant(i,454) * number_density(i,165)

    ! df_BENZO2/d(HO2)
    !  k_BENZO2_HO2_1: BENZO2 + HO2 -> 1*BENZOOH
    LU(i,8211) = LU(i,8211) - rate_constant(i,391) * number_density(i,13)

    ! df_BZOO/d(HO2)
    !  k_BZOO_HO2_1: BZOO + HO2 -> 1*BZOOH
    LU(i,8214) = LU(i,8214) - rate_constant(i,331) * number_density(i,33)
  end do
  !$acc end parallel

end subroutine dforce_dy79

subroutine dforce_dy80(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! df_HMPROPO2/d(HO2)
    !  k_HMPROPO2_HO2_1: HMPROPO2 + HO2 -> 0.4*OH + 0.4*HO2 + 0.4*CH3COCH3 + 0.4*CO2
    LU(i,8234) = LU(i,8234) - rate_constant(i,289) * number_density(i,77)

    ! df_MACROOH/d(HO2)
    !  k_HO2_MACRO2_1: HO2 + MACRO2 -> 1*MACROOH
    LU(i,8221) = LU(i,8221) + rate_constant(i,36) * number_density(i,188)

    ! df_H/d(HO2)
    !  k_H_HO2_1: H + HO2 -> 1*H2 + 1*O2
    LU(i,8223) = LU(i,8223) - rate_constant(i,224) * number_density(i,48)

    !  k_H_HO2_2: H + HO2 -> 1*H2O + 1*O
    LU(i,8223) = LU(i,8223) - rate_constant(i,282) * number_density(i,48)

    !  k_H_HO2_3: H + HO2 -> 2*OH
    LU(i,8223) = LU(i,8223) - rate_constant(i,457) * number_density(i,48)

    ! df_ISOPNO3/d(HO2)
    !  k_HO2_ISOPNO3_1: HO2 + ISOPNO3 -> 1*ISOPNOOH
    LU(i,8222) = LU(i,8222) - rate_constant(i,335) * number_density(i,46)

    ! df_RO2/d(HO2)
    !  k_HO2_RO2_1: HO2 + RO2 -> 0.85*ROOH + 0.15*OH + 0.15*CH2O + 0.15*CH3CO3
    LU(i,8218) = LU(i,8218) - rate_constant(i,133) * number_density(i,40)

    ! df_PHENO2/d(HO2)
    !  k_HO2_PHENO2_1: HO2 + PHENO2 -> 1*PHENOOH
    LU(i,8217) = LU(i,8217) - rate_constant(i,267) * number_density(i,38)

    ! df_ACBZO2/d(HO2)
    !  k_ACBZO2_HO2_1: ACBZO2 + HO2 -> 0.4*C6H5O2 + 0.4*OH
    LU(i,8220) = LU(i,8220) - rate_constant(i,52) * number_density(i,43)

    ! df_CH3COOOH/d(HO2)
    !  k_CH3CO3_HO2_1: CH3CO3 + HO2 -> 0.4*CH3COOOH + 0.15*CH3COOH + 0.15*O3 + 0.45*OH + 0.45*CH3O2
    LU(i,8319) = LU(i,8319) + 0.4*rate_constant(i,259) * number_density(i,49)

    !  k_HO2_MCO3_1: HO2 + MCO3 -> 0.15*O3 + 0.15*CH3COOH + 0.4*CH3COOOH + 0.45*OH + 0.45*CO2 + 0.45*CH2O + 0.45*CH3CO3
    LU(i,8319) = LU(i,8319) + 0.4*rate_constant(i,269) * number_density(i,167)

    ! df_CH3CO3/d(HO2)
    !  k_HO2_RO2_1: HO2 + RO2 -> 0.85*ROOH + 0.15*OH + 0.15*CH2O + 0.15*CH3CO3
    LU(i,8224) = LU(i,8224) + 0.15*rate_constant(i,133) * number_density(i,40)

    !  k_HO2_MEKO2_1: HO2 + MEKO2 -> 0.8*MEKOOH + 0.2*OH + 0.2*CH3CHO + 0.2*CH3CO3
    LU(i,8224) = LU(i,8224) + 0.2*rate_constant(i,139) * number_density(i,128)

    !  k_CH3CO3_HO2_1: CH3CO3 + HO2 -> 0.4*CH3COOOH + 0.15*CH3COOH + 0.15*O3 + 0.45*OH + 0.45*CH3O2
    LU(i,8224) = LU(i,8224) - rate_constant(i,259) * number_density(i,49)

    !  k_HO2_MCO3_1: HO2 + MCO3 -> 0.15*O3 + 0.15*CH3COOH + 0.4*CH3COOOH + 0.45*OH + 0.45*CO2 + 0.45*CH2O + 0.45*CH3CO3
    LU(i,8224) = LU(i,8224) + 0.45*rate_constant(i,269) * number_density(i,167)

    ! df_C6H5O2/d(HO2)
    !  k_ACBZO2_HO2_1: ACBZO2 + HO2 -> 0.4*C6H5O2 + 0.4*OH
    LU(i,8237) = LU(i,8237) + 0.4*rate_constant(i,52) * number_density(i,43)

    !  k_C6H5O2_HO2_1: C6H5O2 + HO2 -> 1*C6H5OOH
    LU(i,8237) = LU(i,8237) - rate_constant(i,179) * number_density(i,81)

    ! df_H2O/d(HO2)
    !  k_H_HO2_2: H + HO2 -> 1*H2O + 1*O
    LU(i,8229) = LU(i,8229) + rate_constant(i,282) * number_density(i,48)

    !  k_HO2_OH_1: HO2 + OH -> 1*H2O + 1*O2
    LU(i,8229) = LU(i,8229) + rate_constant(i,291) * number_density(i,166)

    ! df_NO2/d(HO2)
    !  k_HO2_NO2_1: HO2 + NO2 -> 1*HO2NO2
    LU(i,8225) = LU(i,8225) - rate_constant(i,73) * number_density(i,54)

    !  k_HO2_NO3_1: HO2 + NO3 -> 1*OH + 1*NO2 + 1*O2
    LU(i,8225) = LU(i,8225) + rate_constant(i,454) * number_density(i,165)

    !  k_HO2_NO_1: HO2 + NO -> 1*NO2 + 1*OH
    LU(i,8225) = LU(i,8225) + rate_constant(i,483) * number_density(i,137)

    ! df_EOOH/d(HO2)
    !  k_EO2_HO2_1: EO2 + HO2 -> 1*EOOH
    LU(i,8235) = LU(i,8235) + rate_constant(i,152) * number_density(i,163)

    ! df_NTERPOOH/d(HO2)
    !  k_HO2_NTERPO2_1: HO2 + NTERPO2 -> 1*NTERPOOH
    LU(i,8258) = LU(i,8258) + rate_constant(i,124) * number_density(i,143)

    ! df_NO/d(HO2)
    !  k_HO2_NO_1: HO2 + NO -> 1*NO2 + 1*OH
    LU(i,8275) = LU(i,8275) - rate_constant(i,483) * number_density(i,137)

    ! df_BR/d(HO2)
    !  k_BR_HO2_1: BR + HO2 -> 1*HBR + 1*O2
    LU(i,8244) = LU(i,8244) - rate_constant(i,38) * number_density(i,90)

    ! df_BRO/d(HO2)
    !  k_BRO_HO2_1: BRO + HO2 -> 1*HOBR + 1*O2
    LU(i,8230) = LU(i,8230) - rate_constant(i,299) * number_density(i,71)

    ! df_CL/d(HO2)
    !  k_CL_HO2_1: CL + HO2 -> 1*HCL + 1*O2
    LU(i,8248) = LU(i,8248) - rate_constant(i,264) * number_density(i,100)
  end do
  !$acc end parallel

end subroutine dforce_dy80

subroutine dforce_dy81(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    !  k_CL_HO2_2: CL + HO2 -> 1*OH + 1*CLO
    LU(i,8248) = LU(i,8248) - rate_constant(i,470) * number_density(i,100)

    ! df_CLO/d(HO2)
    !  k_CLO_HO2_1: CLO + HO2 -> 1*O2 + 1*HOCL
    LU(i,8240) = LU(i,8240) - rate_constant(i,402) * number_density(i,86)

    !  k_CL_HO2_2: CL + HO2 -> 1*OH + 1*CLO
    LU(i,8240) = LU(i,8240) + rate_constant(i,470) * number_density(i,100)

    ! df_CO2/d(HO2)
    !  k_HO2_MCO3_1: HO2 + MCO3 -> 0.15*O3 + 0.15*CH3COOH + 0.4*CH3COOOH + 0.45*OH + 0.45*CO2 + 0.45*CH2O + 0.45*CH3CO3
    LU(i,8238) = LU(i,8238) + 0.45*rate_constant(i,269) * number_density(i,167)

    !  k_HMPROPO2_HO2_1: HMPROPO2 + HO2 -> 0.4*OH + 0.4*HO2 + 0.4*CH3COCH3 + 0.4*CO2
    LU(i,8238) = LU(i,8238) + 0.4*rate_constant(i,289) * number_density(i,77)

    ! df_HCOOH/d(HO2)
    !  k_HO2_HOCH2OO_1: HO2 + HOCH2OO -> 1*HCOOH
    LU(i,8261) = LU(i,8261) + rate_constant(i,172) * number_density(i,154)

    ! df_HBR/d(HO2)
    !  k_BR_HO2_1: BR + HO2 -> 1*HBR + 1*O2
    LU(i,8236) = LU(i,8236) + rate_constant(i,38) * number_density(i,90)

    ! df_HOBR/d(HO2)
    !  k_BRO_HO2_1: BRO + HO2 -> 1*HOBR + 1*O2
    LU(i,8321) = LU(i,8321) + rate_constant(i,299) * number_density(i,71)

    ! df_HOCL/d(HO2)
    !  k_CLO_HO2_1: CLO + HO2 -> 1*O2 + 1*HOCL
    LU(i,8242) = LU(i,8242) + rate_constant(i,402) * number_density(i,86)

    ! df_C2H5O2/d(HO2)
    !  k_C2H5O2_HO2_1: C2H5O2 + HO2 -> 1*C2H5OOH + 1*O2
    LU(i,8241) = LU(i,8241) - rate_constant(i,343) * number_density(i,87)

    ! df_CH3COCHO/d(HO2)
    !  k_HO2_MDIALO2_1: HO2 + MDIALO2 -> 0.4*OH + 0.33*HO2 + 0.07*CH3COCHO + 0.14*CO + 0.07*CH3O2 + 0.07*GLYOXAL
    LU(i,8255) = LU(i,8255) + 0.07*rate_constant(i,161) * number_density(i,164)

    !  k_DICARBO2_HO2_1: DICARBO2 + HO2 -> 0.4*OH + 0.07*HO2 + 0.07*CH3COCHO + 0.07*CO + 0.33*CH3O2
    LU(i,8255) = LU(i,8255) + 0.07*rate_constant(i,370) * number_density(i,181)

    ! df_CH3COCH3/d(HO2)
    !  k_HMPROPO2_HO2_1: HMPROPO2 + HO2 -> 0.4*OH + 0.4*HO2 + 0.4*CH3COCH3 + 0.4*CO2
    LU(i,8243) = LU(i,8243) + 0.4*rate_constant(i,289) * number_density(i,77)

    ! df_O/d(HO2)
    !  k_HO2_O_1: HO2 + O -> 1*OH + 1*O2
    LU(i,8322) = LU(i,8322) - rate_constant(i,217) * number_density(i,187)

    !  k_H_HO2_2: H + HO2 -> 1*H2O + 1*O
    LU(i,8322) = LU(i,8322) + rate_constant(i,282) * number_density(i,48)

    ! df_HCL/d(HO2)
    !  k_CL_HO2_1: CL + HO2 -> 1*HCL + 1*O2
    LU(i,8315) = LU(i,8315) + rate_constant(i,264) * number_density(i,100)

    ! df_C3H7O2/d(HO2)
    !  k_C3H7O2_HO2_1: C3H7O2 + HO2 -> 1*C3H7OOH + 1*O2
    LU(i,8253) = LU(i,8253) - rate_constant(i,142) * number_density(i,109)

    ! df_CH3O2/d(HO2)
    !  k_HO2_MDIALO2_1: HO2 + MDIALO2 -> 0.4*OH + 0.33*HO2 + 0.07*CH3COCHO + 0.14*CO + 0.07*CH3O2 + 0.07*GLYOXAL
    LU(i,8326) = LU(i,8326) + 0.07*rate_constant(i,161) * number_density(i,164)

    !  k_CH3CO3_HO2_1: CH3CO3 + HO2 -> 0.4*CH3COOOH + 0.15*CH3COOH + 0.15*O3 + 0.45*OH + 0.45*CH3O2
    LU(i,8326) = LU(i,8326) + 0.45*rate_constant(i,259) * number_density(i,49)

    !  k_CH3O2_HO2_1: CH3O2 + HO2 -> 1*CH3OOH + 1*O2
    LU(i,8326) = LU(i,8326) - rate_constant(i,301) * number_density(i,191)

    !  k_DICARBO2_HO2_1: DICARBO2 + HO2 -> 0.4*OH + 0.07*HO2 + 0.07*CH3COCHO + 0.07*CO + 0.33*CH3O2
    LU(i,8326) = LU(i,8326) + 0.33*rate_constant(i,370) * number_density(i,181)

    ! df_H2O2/d(HO2)
    !  k_HO2_HO2_1: HO2 + HO2 -> 1*H2O2 + 1*O2
    LU(i,8314) = LU(i,8314) + rate_constant(i,209) * number_density(i,192)

    !  k_HO2_HO2_1: HO2 + HO2 -> 1*H2O2 + 1*O2
    LU(i,8314) = LU(i,8314) + rate_constant(i,209) * number_density(i,192)

    !  k_HO2_HO2_M_1: HO2 + HO2 + M -> 1*H2O2 + 1*O2 + 1*M
    LU(i,8314) = LU(i,8314) + rate_constant(i,210) * number_density(i,192) * number_density(i,1)

    !  k_HO2_HO2_M_1: HO2 + HO2 + M -> 1*H2O2 + 1*O2 + 1*M
    LU(i,8314) = LU(i,8314) + rate_constant(i,210) * number_density(i,192) * number_density(i,1)

    !  k_H2O_HO2_HO2_1: H2O + HO2 + HO2 -> 1*H2O2 + 1*O2 + 1*H2O
    LU(i,8314) = LU(i,8314) + rate_constant(i,211) * number_density(i,68) * number_density(i,192)

    !  k_H2O_HO2_HO2_1: H2O + HO2 + HO2 -> 1*H2O2 + 1*O2 + 1*H2O
    LU(i,8314) = LU(i,8314) + rate_constant(i,211) * number_density(i,68) * number_density(i,192)

    !  k_H2O_HO2_HO2_M_1: H2O + HO2 + HO2 + M -> 1*H2O2 + 1*O2 + 1*M + 1*H2O
    LU(i,8314) = LU(i,8314) + rate_constant(i,212) * number_density(i,68) * number_density(i,192) * number_density(i,1)

    !  k_H2O_HO2_HO2_M_1: H2O + HO2 + HO2 + M -> 1*H2O2 + 1*O2 + 1*M + 1*H2O
    LU(i,8314) = LU(i,8314) + rate_constant(i,212) * number_density(i,68) * number_density(i,192) * number_density(i,1)
  end do
  !$acc end parallel

end subroutine dforce_dy81

subroutine dforce_dy82(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
