    LU(i,8267) = LU(i,8267) - rate_constant(i,247) * number_density(i,125)

    ! df_ISOPBO2/d(HO2)
    !  k_HO2_ISOPBO2_1: HO2 + ISOPBO2 -> 1*ISOPOOH
    LU(i,8325) = LU(i,8325) - rate_constant(i,279) * number_density(i,190)

    ! df_MCO3/d(HO2)
    !  k_HO2_MCO3_1: HO2 + MCO3 -> 0.15*O3 + 0.15*CH3COOH + 0.4*CH3COOOH + 0.45*OH + 0.45*CO2 + 0.45*CH2O + 0.45*CH3CO3
    LU(i,8302) = LU(i,8302) - rate_constant(i,269) * number_density(i,167)

    ! df_MDIALO2/d(HO2)
    !  k_HO2_MDIALO2_1: HO2 + MDIALO2 -> 0.4*OH + 0.33*HO2 + 0.07*CH3COCHO + 0.14*CO + 0.07*CH3O2 + 0.07*GLYOXAL
    LU(i,8299) = LU(i,8299) - rate_constant(i,161) * number_density(i,164)

    ! df_MEKO2/d(HO2)
    !  k_HO2_MEKO2_1: HO2 + MEKO2 -> 0.8*MEKOOH + 0.2*OH + 0.2*CH3CHO + 0.2*CH3CO3
    LU(i,8269) = LU(i,8269) - rate_constant(i,139) * number_density(i,128)

    ! df_EO2/d(HO2)
    !  k_EO2_HO2_1: EO2 + HO2 -> 1*EOOH
    LU(i,8298) = LU(i,8298) - rate_constant(i,152) * number_density(i,163)

    ! df_GLYOXAL/d(HO2)
    !  k_HO2_MALO2_1: HO2 + MALO2 -> 0.16*GLYOXAL + 0.16*HO2 + 0.16*CO
    LU(i,8270) = LU(i,8270) + 0.16*rate_constant(i,1) * number_density(i,170)

    !  k_HO2_MDIALO2_1: HO2 + MDIALO2 -> 0.4*OH + 0.33*HO2 + 0.07*CH3COCHO + 0.14*CO + 0.07*CH3O2 + 0.07*GLYOXAL
    LU(i,8270) = LU(i,8270) + 0.07*rate_constant(i,161) * number_density(i,164)

    ! df_ISOPOOH/d(HO2)
    !  k_HO2_ISOPBO2_1: HO2 + ISOPBO2 -> 1*ISOPOOH
    LU(i,8276) = LU(i,8276) + rate_constant(i,279) * number_density(i,190)

    !  k_HO2_ISOPAO2_1: HO2 + ISOPAO2 -> 1*ISOPOOH
    LU(i,8276) = LU(i,8276) + rate_constant(i,324) * number_density(i,189)

    ! df_HO2/d(HO2)
    !  k_HO2_MALO2_1: HO2 + MALO2 -> 0.16*GLYOXAL + 0.16*HO2 + 0.16*CO
    LU(i,8327) = LU(i,8327) - 0.84*rate_constant(i,1) * number_density(i,170)

    !  k_HO2_MACRO2_1: HO2 + MACRO2 -> 1*MACROOH
    LU(i,8327) = LU(i,8327) - rate_constant(i,36) * number_density(i,188)

    !  k_BR_HO2_1: BR + HO2 -> 1*HBR + 1*O2
    LU(i,8327) = LU(i,8327) - rate_constant(i,38) * number_density(i,90)

    !  k_ACBZO2_HO2_1: ACBZO2 + HO2 -> 0.4*C6H5O2 + 0.4*OH
    LU(i,8327) = LU(i,8327) - rate_constant(i,52) * number_density(i,43)

    !  k_HO2_NO2_1: HO2 + NO2 -> 1*HO2NO2
    LU(i,8327) = LU(i,8327) - rate_constant(i,73) * number_density(i,54)

    !  k_HO2_MBONO3O2_1: HO2 + MBONO3O2 -> 
    LU(i,8327) = LU(i,8327) - rate_constant(i,90) * number_density(i,123)

    !  k_HO2_NTERPO2_1: HO2 + NTERPO2 -> 1*NTERPOOH
    LU(i,8327) = LU(i,8327) - rate_constant(i,124) * number_density(i,143)

    !  k_HO2_RO2_1: HO2 + RO2 -> 0.85*ROOH + 0.15*OH + 0.15*CH2O + 0.15*CH3CO3
    LU(i,8327) = LU(i,8327) - rate_constant(i,133) * number_density(i,40)

    !  k_HO2_MEKO2_1: HO2 + MEKO2 -> 0.8*MEKOOH + 0.2*OH + 0.2*CH3CHO + 0.2*CH3CO3
    LU(i,8327) = LU(i,8327) - rate_constant(i,139) * number_density(i,128)

  end do
  !$acc end parallel

end subroutine dforce_dy82

subroutine dforce_dy83(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell
    !  k_C3H7O2_HO2_1: C3H7O2 + HO2 -> 1*C3H7OOH + 1*O2
    LU(i,8327) = LU(i,8327) - rate_constant(i,142) * number_density(i,109)

    !  k_HO2_TERPO2_1: HO2 + TERPO2 -> 1*TERPOOH
    LU(i,8327) = LU(i,8327) - rate_constant(i,145) * number_density(i,147)

    !  k_EO2_HO2_1: EO2 + HO2 -> 1*EOOH
    LU(i,8327) = LU(i,8327) - rate_constant(i,152) * number_density(i,163)

    !  k_HO2_MDIALO2_1: HO2 + MDIALO2 -> 0.4*OH + 0.33*HO2 + 0.07*CH3COCHO + 0.14*CO + 0.07*CH3O2 + 0.07*GLYOXAL
    LU(i,8327) = LU(i,8327) - 0.6699999999999999*rate_constant(i,161) * number_density(i,164)

    !  k_HO2_HOCH2OO_1: HO2 + HOCH2OO -> 1*HCOOH
    LU(i,8327) = LU(i,8327) - rate_constant(i,172) * number_density(i,154)

    !  k_C6H5O2_HO2_1: C6H5O2 + HO2 -> 1*C6H5OOH
    LU(i,8327) = LU(i,8327) - rate_constant(i,179) * number_density(i,81)

    !  k_HO2_XO2_1: HO2 + XO2 -> 1*XOOH
    LU(i,8327) = LU(i,8327) - rate_constant(i,205) * number_density(i,153)

    !  k_HO2_HO2_1: HO2 + HO2 -> 1*H2O2 + 1*O2
    LU(i,8327) = LU(i,8327) - rate_constant(i,209) * number_density(i,192)

    !  k_HO2_HO2_1: HO2 + HO2 -> 1*H2O2 + 1*O2
    LU(i,8327) = LU(i,8327) - rate_constant(i,209) * number_density(i,192)

    !  k_HO2_HO2_1: HO2 + HO2 -> 1*H2O2 + 1*O2
    LU(i,8327) = LU(i,8327) - rate_constant(i,209) * number_density(i,192)

    !  k_HO2_HO2_1: HO2 + HO2 -> 1*H2O2 + 1*O2
    LU(i,8327) = LU(i,8327) - rate_constant(i,209) * number_density(i,192)

    !  k_HO2_HO2_M_1: HO2 + HO2 + M -> 1*H2O2 + 1*O2 + 1*M
    LU(i,8327) = LU(i,8327) - rate_constant(i,210) * number_density(i,192) * number_density(i,1)

    !  k_HO2_HO2_M_1: HO2 + HO2 + M -> 1*H2O2 + 1*O2 + 1*M
    LU(i,8327) = LU(i,8327) - rate_constant(i,210) * number_density(i,192) * number_density(i,1)

    !  k_HO2_HO2_M_1: HO2 + HO2 + M -> 1*H2O2 + 1*O2 + 1*M
    LU(i,8327) = LU(i,8327) - rate_constant(i,210) * number_density(i,192) * number_density(i,1)

    !  k_HO2_HO2_M_1: HO2 + HO2 + M -> 1*H2O2 + 1*O2 + 1*M
    LU(i,8327) = LU(i,8327) - rate_constant(i,210) * number_density(i,192) * number_density(i,1)

    !  k_H2O_HO2_HO2_1: H2O + HO2 + HO2 -> 1*H2O2 + 1*O2 + 1*H2O
    LU(i,8327) = LU(i,8327) - rate_constant(i,211) * number_density(i,68) * number_density(i,192)

    !  k_H2O_HO2_HO2_1: H2O + HO2 + HO2 -> 1*H2O2 + 1*O2 + 1*H2O
    LU(i,8327) = LU(i,8327) - rate_constant(i,211) * number_density(i,68) * number_density(i,192)

    !  k_H2O_HO2_HO2_1: H2O + HO2 + HO2 -> 1*H2O2 + 1*O2 + 1*H2O
    LU(i,8327) = LU(i,8327) - rate_constant(i,211) * number_density(i,68) * number_density(i,192)

    !  k_H2O_HO2_HO2_1: H2O + HO2 + HO2 -> 1*H2O2 + 1*O2 + 1*H2O
    LU(i,8327) = LU(i,8327) - rate_constant(i,211) * number_density(i,68) * number_density(i,192)

    !  k_H2O_HO2_HO2_M_1: H2O + HO2 + HO2 + M -> 1*H2O2 + 1*O2 + 1*M + 1*H2O
    LU(i,8327) = LU(i,8327) - rate_constant(i,212) * number_density(i,68) * number_density(i,192) * number_density(i,1)

    !  k_H2O_HO2_HO2_M_1: H2O + HO2 + HO2 + M -> 1*H2O2 + 1*O2 + 1*M + 1*H2O
    LU(i,8327) = LU(i,8327) - rate_constant(i,212) * number_density(i,68) * number_density(i,192) * number_density(i,1)

    !  k_H2O_HO2_HO2_M_1: H2O + HO2 + HO2 + M -> 1*H2O2 + 1*O2 + 1*M + 1*H2O
    LU(i,8327) = LU(i,8327) - rate_constant(i,212) * number_density(i,68) * number_density(i,192) * number_density(i,1)

    !  k_H2O_HO2_HO2_M_1: H2O + HO2 + HO2 + M -> 1*H2O2 + 1*O2 + 1*M + 1*H2O
    LU(i,8327) = LU(i,8327) - rate_constant(i,212) * number_density(i,68) * number_density(i,192) * number_density(i,1)

    !  k_HO2_O_1: HO2 + O -> 1*OH + 1*O2
    LU(i,8327) = LU(i,8327) - rate_constant(i,217) * number_density(i,187)

    !  k_H_HO2_1: H + HO2 -> 1*H2 + 1*O2
    LU(i,8327) = LU(i,8327) - rate_constant(i,224) * number_density(i,48)

    !  k_HO2_MBOO2_1: HO2 + MBOO2 -> 1*MBOOOH
    LU(i,8327) = LU(i,8327) - rate_constant(i,247) * number_density(i,125)

    !  k_CH3CO3_HO2_1: CH3CO3 + HO2 -> 0.4*CH3COOOH + 0.15*CH3COOH + 0.15*O3 + 0.45*OH + 0.45*CH3O2
    LU(i,8327) = LU(i,8327) - rate_constant(i,259) * number_density(i,49)

    !  k_CL_HO2_1: CL + HO2 -> 1*HCL + 1*O2
    LU(i,8327) = LU(i,8327) - rate_constant(i,264) * number_density(i,100)

    !  k_HO2_PO2_1: HO2 + PO2 -> 1*POOH + 1*O2
    LU(i,8327) = LU(i,8327) - rate_constant(i,265) * number_density(i,151)

    !  k_HO2_PHENO2_1: HO2 + PHENO2 -> 1*PHENOOH
    LU(i,8327) = LU(i,8327) - rate_constant(i,267) * number_density(i,38)

    !  k_HO2_MCO3_1: HO2 + MCO3 -> 0.15*O3 + 0.15*CH3COOH + 0.4*CH3COOOH + 0.45*OH + 0.45*CO2 + 0.45*CH2O + 0.45*CH3CO3
    LU(i,8327) = LU(i,8327) - rate_constant(i,269) * number_density(i,167)

    !  k_HO2_ISOPBO2_1: HO2 + ISOPBO2 -> 1*ISOPOOH
    LU(i,8327) = LU(i,8327) - rate_constant(i,279) * number_density(i,190)

    !  k_H_HO2_2: H + HO2 -> 1*H2O + 1*O
    LU(i,8327) = LU(i,8327) - rate_constant(i,282) * number_density(i,48)

    !  k_HMPROPO2_HO2_1: HMPROPO2 + HO2 -> 0.4*OH + 0.4*HO2 + 0.4*CH3COCH3 + 0.4*CO2
    LU(i,8327) = LU(i,8327) - 0.6*rate_constant(i,289) * number_density(i,77)
  end do
  !$acc end parallel

end subroutine dforce_dy83

subroutine dforce_dy84(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    !  k_HO2_OH_1: HO2 + OH -> 1*H2O + 1*O2
    LU(i,8327) = LU(i,8327) - rate_constant(i,291) * number_density(i,166)

    !  k_BRO_HO2_1: BRO + HO2 -> 1*HOBR + 1*O2
    LU(i,8327) = LU(i,8327) - rate_constant(i,299) * number_density(i,71)

    !  k_CH3O2_HO2_1: CH3O2 + HO2 -> 1*CH3OOH + 1*O2
    LU(i,8327) = LU(i,8327) - rate_constant(i,301) * number_density(i,191)

    !  k_HO2_ISOPAO2_1: HO2 + ISOPAO2 -> 1*ISOPOOH
    LU(i,8327) = LU(i,8327) - rate_constant(i,324) * number_density(i,189)

    !  k_BZOO_HO2_1: BZOO + HO2 -> 1*BZOOH
    LU(i,8327) = LU(i,8327) - rate_constant(i,331) * number_density(i,33)

    !  k_HO2_XYLENO2_1: HO2 + XYLENO2 -> 1*XYLENOOH
    LU(i,8327) = LU(i,8327) - rate_constant(i,333) * number_density(i,146)

    !  k_HO2_ISOPNO3_1: HO2 + ISOPNO3 -> 1*ISOPNOOH
    LU(i,8327) = LU(i,8327) - rate_constant(i,335) * number_density(i,46)

    !  k_HO2_TERP2O2_1: HO2 + TERP2O2 -> 1*TERP2OOH
    LU(i,8327) = LU(i,8327) - rate_constant(i,341) * number_density(i,145)

    !  k_C2H5O2_HO2_1: C2H5O2 + HO2 -> 1*C2H5OOH + 1*O2
    LU(i,8327) = LU(i,8327) - rate_constant(i,343) * number_density(i,87)

    !  k_HO2_XYLOLO2_1: HO2 + XYLOLO2 -> 1*XYLOLOOH
    LU(i,8327) = LU(i,8327) - rate_constant(i,357) * number_density(i,148)

    !  k_HO2_O3_1: HO2 + O3 -> 1*OH + 2*O2
    LU(i,8327) = LU(i,8327) - rate_constant(i,368) * number_density(i,171)

    !  k_DICARBO2_HO2_1: DICARBO2 + HO2 -> 0.4*OH + 0.07*HO2 + 0.07*CH3COCHO + 0.07*CO + 0.33*CH3O2
    LU(i,8327) = LU(i,8327) - 0.9299999999999999*rate_constant(i,370) * number_density(i,181)

    !  k_BENZO2_HO2_1: BENZO2 + HO2 -> 1*BENZOOH
    LU(i,8327) = LU(i,8327) - rate_constant(i,391) * number_density(i,13)

    !  k_CLO_HO2_1: CLO + HO2 -> 1*O2 + 1*HOCL
    LU(i,8327) = LU(i,8327) - rate_constant(i,402) * number_density(i,86)

    !  k_ALKO2_HO2_1: ALKO2 + HO2 -> 1*ALKOOH
    LU(i,8327) = LU(i,8327) - rate_constant(i,426) * number_density(i,85)

    !  k_CH2O_HO2_1: CH2O + HO2 -> 1*HOCH2OO
    LU(i,8327) = LU(i,8327) - rate_constant(i,449) * number_density(i,124)

    !  k_HO2_NO3_1: HO2 + NO3 -> 1*OH + 1*NO2 + 1*O2
    LU(i,8327) = LU(i,8327) - rate_constant(i,454) * number_density(i,165)

    !  k_H_HO2_3: H + HO2 -> 2*OH
    LU(i,8327) = LU(i,8327) - rate_constant(i,457) * number_density(i,48)

    !  k_CL_HO2_2: CL + HO2 -> 1*OH + 1*CLO
    LU(i,8327) = LU(i,8327) - rate_constant(i,470) * number_density(i,100)

    !  k_HO2_TOLO2_1: HO2 + TOLO2 -> 1*TOLOOH
    LU(i,8327) = LU(i,8327) - rate_constant(i,479) * number_density(i,144)

    !  k_HO2_NO_1: HO2 + NO -> 1*NO2 + 1*OH
    LU(i,8327) = LU(i,8327) - rate_constant(i,483) * number_density(i,137)

    ! df_HOCH2OO/d(HO2)
    !  k_HO2_HOCH2OO_1: HO2 + HOCH2OO -> 1*HCOOH
    LU(i,8289) = LU(i,8289) - rate_constant(i,172) * number_density(i,154)

    !  k_CH2O_HO2_1: CH2O + HO2 -> 1*HOCH2OO
    LU(i,8289) = LU(i,8289) + rate_constant(i,449) * number_density(i,124)

    ! df_H2/d(HO2)
    !  k_H_HO2_1: H + HO2 -> 1*H2 + 1*O2
    LU(i,8287) = LU(i,8287) + rate_constant(i,224) * number_density(i,48)

    ! df_MBOOOH/d(HO2)
    !  k_HO2_MBOO2_1: HO2 + MBOO2 -> 1*MBOOOH
    LU(i,8285) = LU(i,8285) + rate_constant(i,247) * number_density(i,125)

    ! df_NTERPO2/d(HO2)
    !  k_HO2_NTERPO2_1: HO2 + NTERPO2 -> 1*NTERPOOH
    LU(i,8278) = LU(i,8278) - rate_constant(i,124) * number_density(i,143)

    ! df_TOLO2/d(HO2)
    !  k_HO2_TOLO2_1: HO2 + TOLO2 -> 1*TOLOOH
    LU(i,8279) = LU(i,8279) - rate_constant(i,479) * number_density(i,144)

    ! df_TERP2O2/d(HO2)
    !  k_HO2_TERP2O2_1: HO2 + TERP2O2 -> 1*TERP2OOH
    LU(i,8280) = LU(i,8280) - rate_constant(i,341) * number_density(i,145)

    ! df_XYLENO2/d(HO2)
    !  k_HO2_XYLENO2_1: HO2 + XYLENO2 -> 1*XYLENOOH
    LU(i,8281) = LU(i,8281) - rate_constant(i,333) * number_density(i,146)

    ! df_TERPO2/d(HO2)
    !  k_HO2_TERPO2_1: HO2 + TERPO2 -> 1*TERPOOH
    LU(i,8282) = LU(i,8282) - rate_constant(i,145) * number_density(i,147)

    ! df_XYLOLO2/d(HO2)
    !  k_HO2_XYLOLO2_1: HO2 + XYLOLO2 -> 1*XYLOLOOH
    LU(i,8283) = LU(i,8283) - rate_constant(i,357) * number_density(i,148)
  end do
  !$acc end parallel

end subroutine dforce_dy84

subroutine dforce_dy85(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! df_PO2/d(HO2)
    !  k_HO2_PO2_1: HO2 + PO2 -> 1*POOH + 1*O2
    LU(i,8286) = LU(i,8286) - rate_constant(i,265) * number_density(i,151)

    ! df_XO2/d(HO2)
    !  k_HO2_XO2_1: HO2 + XO2 -> 1*XOOH
    LU(i,8288) = LU(i,8288) - rate_constant(i,205) * number_density(i,153)

    ! df_XOOH/d(HO2)
    !  k_HO2_XO2_1: HO2 + XO2 -> 1*XOOH
    LU(i,8249) = LU(i,8249) + rate_constant(i,205) * number_density(i,153)

    ! df_MEKOOH/d(HO2)
    !  k_HO2_MEKO2_1: HO2 + MEKO2 -> 0.8*MEKOOH + 0.2*OH + 0.2*CH3CHO + 0.2*CH3CO3
    LU(i,8274) = LU(i,8274) + 0.8*rate_constant(i,139) * number_density(i,128)

    ! df_ISOPNOOH/d(HO2)
    !  k_HO2_ISOPNO3_1: HO2 + ISOPNO3 -> 1*ISOPNOOH
    LU(i,8295) = LU(i,8295) + rate_constant(i,335) * number_density(i,46)

    ! df_NO3/d(HO2)
    !  k_HO2_NO3_1: HO2 + NO3 -> 1*OH + 1*NO2 + 1*O2
    LU(i,8300) = LU(i,8300) - rate_constant(i,454) * number_density(i,165)

    ! df_OH/d(HO2)
    !  k_ACBZO2_HO2_1: ACBZO2 + HO2 -> 0.4*C6H5O2 + 0.4*OH
    LU(i,8301) = LU(i,8301) + 0.4*rate_constant(i,52) * number_density(i,43)

    !  k_HO2_RO2_1: HO2 + RO2 -> 0.85*ROOH + 0.15*OH + 0.15*CH2O + 0.15*CH3CO3
    LU(i,8301) = LU(i,8301) + 0.15*rate_constant(i,133) * number_density(i,40)

    !  k_HO2_MEKO2_1: HO2 + MEKO2 -> 0.8*MEKOOH + 0.2*OH + 0.2*CH3CHO + 0.2*CH3CO3
    LU(i,8301) = LU(i,8301) + 0.2*rate_constant(i,139) * number_density(i,128)

    !  k_HO2_MDIALO2_1: HO2 + MDIALO2 -> 0.4*OH + 0.33*HO2 + 0.07*CH3COCHO + 0.14*CO + 0.07*CH3O2 + 0.07*GLYOXAL
    LU(i,8301) = LU(i,8301) + 0.4*rate_constant(i,161) * number_density(i,164)

    !  k_HO2_O_1: HO2 + O -> 1*OH + 1*O2
    LU(i,8301) = LU(i,8301) + rate_constant(i,217) * number_density(i,187)

    !  k_CH3CO3_HO2_1: CH3CO3 + HO2 -> 0.4*CH3COOOH + 0.15*CH3COOH + 0.15*O3 + 0.45*OH + 0.45*CH3O2
    LU(i,8301) = LU(i,8301) + 0.45*rate_constant(i,259) * number_density(i,49)

    !  k_HO2_MCO3_1: HO2 + MCO3 -> 0.15*O3 + 0.15*CH3COOH + 0.4*CH3COOOH + 0.45*OH + 0.45*CO2 + 0.45*CH2O + 0.45*CH3CO3
    LU(i,8301) = LU(i,8301) + 0.45*rate_constant(i,269) * number_density(i,167)

    !  k_HMPROPO2_HO2_1: HMPROPO2 + HO2 -> 0.4*OH + 0.4*HO2 + 0.4*CH3COCH3 + 0.4*CO2
    LU(i,8301) = LU(i,8301) + 0.4*rate_constant(i,289) * number_density(i,77)

    !  k_HO2_OH_1: HO2 + OH -> 1*H2O + 1*O2
    LU(i,8301) = LU(i,8301) - rate_constant(i,291) * number_density(i,166)

    !  k_HO2_O3_1: HO2 + O3 -> 1*OH + 2*O2
    LU(i,8301) = LU(i,8301) + rate_constant(i,368) * number_density(i,171)

    !  k_DICARBO2_HO2_1: DICARBO2 + HO2 -> 0.4*OH + 0.07*HO2 + 0.07*CH3COCHO + 0.07*CO + 0.33*CH3O2
    LU(i,8301) = LU(i,8301) + 0.4*rate_constant(i,370) * number_density(i,181)

    !  k_HO2_NO3_1: HO2 + NO3 -> 1*OH + 1*NO2 + 1*O2
    LU(i,8301) = LU(i,8301) + rate_constant(i,454) * number_density(i,165)

    !  k_H_HO2_3: H + HO2 -> 2*OH
    LU(i,8301) = LU(i,8301) + 2*rate_constant(i,457) * number_density(i,48)

    !  k_CL_HO2_2: CL + HO2 -> 1*OH + 1*CLO
    LU(i,8301) = LU(i,8301) + rate_constant(i,470) * number_density(i,100)

    !  k_HO2_NO_1: HO2 + NO -> 1*NO2 + 1*OH
    LU(i,8301) = LU(i,8301) + rate_constant(i,483) * number_density(i,137)

    ! df_PHENOOH/d(HO2)
    !  k_HO2_PHENO2_1: HO2 + PHENO2 -> 1*PHENOOH
    LU(i,8259) = LU(i,8259) + rate_constant(i,267) * number_density(i,38)

    ! df_ROOH/d(HO2)
    !  k_HO2_RO2_1: HO2 + RO2 -> 0.85*ROOH + 0.15*OH + 0.15*CH2O + 0.15*CH3CO3
    LU(i,8263) = LU(i,8263) + 0.85*rate_constant(i,133) * number_density(i,40)

    ! df_O3/d(HO2)
    !  k_CH3CO3_HO2_1: CH3CO3 + HO2 -> 0.4*CH3COOOH + 0.15*CH3COOH + 0.15*O3 + 0.45*OH + 0.45*CH3O2
    LU(i,8306) = LU(i,8306) + 0.15*rate_constant(i,259) * number_density(i,49)

    !  k_HO2_MCO3_1: HO2 + MCO3 -> 0.15*O3 + 0.15*CH3COOH + 0.4*CH3COOOH + 0.45*OH + 0.45*CO2 + 0.45*CH2O + 0.45*CH3CO3
    LU(i,8306) = LU(i,8306) + 0.15*rate_constant(i,269) * number_density(i,167)

    !  k_HO2_O3_1: HO2 + O3 -> 1*OH + 2*O2
    LU(i,8306) = LU(i,8306) - rate_constant(i,368) * number_density(i,171)

    ! df_TERPOOH/d(HO2)
    !  k_HO2_TERPO2_1: HO2 + TERPO2 -> 1*TERPOOH
    LU(i,8257) = LU(i,8257) + rate_constant(i,145) * number_density(i,147)

    ! df_TOLOOH/d(HO2)
    !  k_HO2_TOLO2_1: HO2 + TOLO2 -> 1*TOLOOH
    LU(i,8247) = LU(i,8247) + rate_constant(i,479) * number_density(i,144)

    ! df_XYLENOOH/d(HO2)
    !  k_HO2_XYLENO2_1: HO2 + XYLENO2 -> 1*XYLENOOH
    LU(i,8246) = LU(i,8246) + rate_constant(i,333) * number_density(i,146)

  end do
  !$acc end parallel

end subroutine dforce_dy85

subroutine dforce_dy86(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell
    ! df_XYLOLOOH/d(HO2)
    !  k_HO2_XYLOLO2_1: HO2 + XYLOLO2 -> 1*XYLOLOOH
    LU(i,8213) = LU(i,8213) + rate_constant(i,357) * number_density(i,148)

    ! df_CO/d(HO2)
    !  k_HO2_MALO2_1: HO2 + MALO2 -> 0.16*GLYOXAL + 0.16*HO2 + 0.16*CO
    LU(i,8311) = LU(i,8311) + 0.16*rate_constant(i,1) * number_density(i,170)

    !  k_HO2_MDIALO2_1: HO2 + MDIALO2 -> 0.4*OH + 0.33*HO2 + 0.07*CH3COCHO + 0.14*CO + 0.07*CH3O2 + 0.07*GLYOXAL
    LU(i,8311) = LU(i,8311) + 0.14*rate_constant(i,161) * number_density(i,164)

    !  k_DICARBO2_HO2_1: DICARBO2 + HO2 -> 0.4*OH + 0.07*HO2 + 0.07*CH3COCHO + 0.07*CO + 0.33*CH3O2
    LU(i,8311) = LU(i,8311) + 0.07*rate_constant(i,370) * number_density(i,181)

    ! df_CH3COOH/d(HO2)
    !  k_CH3CO3_HO2_1: CH3CO3 + HO2 -> 0.4*CH3COOOH + 0.15*CH3COOH + 0.15*O3 + 0.45*OH + 0.45*CH3O2
    LU(i,8312) = LU(i,8312) + 0.15*rate_constant(i,259) * number_density(i,49)

    !  k_HO2_MCO3_1: HO2 + MCO3 -> 0.15*O3 + 0.15*CH3COOH + 0.4*CH3COOOH + 0.45*OH + 0.45*CO2 + 0.45*CH2O + 0.45*CH3CO3
    LU(i,8312) = LU(i,8312) + 0.15*rate_constant(i,269) * number_density(i,167)

    ! df_CH3CHO/d(HO2)
    !  k_HO2_MEKO2_1: HO2 + MEKO2 -> 0.8*MEKOOH + 0.2*OH + 0.2*CH3CHO + 0.2*CH3CO3
    LU(i,8313) = LU(i,8313) + 0.2*rate_constant(i,139) * number_density(i,128)

    ! df_ALKOOH/d(HO2)
    !  k_ALKO2_HO2_1: ALKO2 + HO2 -> 1*ALKOOH
    LU(i,8228) = LU(i,8228) + rate_constant(i,426) * number_density(i,85)

    ! df_DICARBO2/d(HO2)
    !  k_DICARBO2_HO2_1: DICARBO2 + HO2 -> 0.4*OH + 0.07*HO2 + 0.07*CH3COCHO + 0.07*CO + 0.33*CH3O2
    LU(i,8316) = LU(i,8316) - rate_constant(i,370) * number_density(i,181)

    ! df_BENZOOH/d(HO2)
    !  k_BENZO2_HO2_1: BENZO2 + HO2 -> 1*BENZOOH
    LU(i,8245) = LU(i,8245) + rate_constant(i,391) * number_density(i,13)

    ! df_ALKO2/d(HO2)
    !  k_ALKO2_HO2_1: ALKO2 + HO2 -> 1*ALKOOH
    LU(i,8239) = LU(i,8239) - rate_constant(i,426) * number_density(i,85)

    ! df_HO2NO2/d(HO2)
    !  k_HO2_NO2_1: HO2 + NO2 -> 1*HO2NO2
    LU(i,8215) = LU(i,8215) + rate_constant(i,73) * number_density(i,54)

    ! df_C3H7OOH/d(HO2)
    !  k_C3H7O2_HO2_1: C3H7O2 + HO2 -> 1*C3H7OOH + 1*O2
    LU(i,8212) = LU(i,8212) + rate_constant(i,142) * number_density(i,109)

    ! df_TERP2OOH/d(HO2)
    !  k_HO2_TERP2O2_1: HO2 + TERP2O2 -> 1*TERP2OOH
    LU(i,8216) = LU(i,8216) + rate_constant(i,341) * number_density(i,145)

    ! df_POOH/d(HO2)
    !  k_HO2_PO2_1: HO2 + PO2 -> 1*POOH + 1*O2
    LU(i,8209) = LU(i,8209) + rate_constant(i,265) * number_density(i,151)

    ! df_NO2/d(HOCH2OO)
    !  k_HOCH2OO_NO_1: HOCH2OO + NO -> 1*HCOOH + 1*NO2 + 1*HO2
    LU(i,5265) = LU(i,5265) + rate_constant(i,113) * number_density(i,137)

    ! df_NO/d(HOCH2OO)
    !  k_HOCH2OO_NO_1: HOCH2OO + NO -> 1*HCOOH + 1*NO2 + 1*HO2
    LU(i,5287) = LU(i,5287) - rate_constant(i,113) * number_density(i,137)

    ! df_HCOOH/d(HOCH2OO)
    !  k_HOCH2OO_NO_1: HOCH2OO + NO -> 1*HCOOH + 1*NO2 + 1*HO2
    LU(i,5281) = LU(i,5281) + rate_constant(i,113) * number_density(i,137)

    !  k_HO2_HOCH2OO_1: HO2 + HOCH2OO -> 1*HCOOH
    LU(i,5281) = LU(i,5281) + rate_constant(i,172) * number_density(i,192)

    ! df_CH2O/d(HOCH2OO)
    !  k_HOCH2OO_1: HOCH2OO -> 1*CH2O + 1*HO2
    LU(i,5284) = LU(i,5284) + rate_constant(i,431)

    ! df_HO2/d(HOCH2OO)
    !  k_HOCH2OO_NO_1: HOCH2OO + NO -> 1*HCOOH + 1*NO2 + 1*HO2
    LU(i,5338) = LU(i,5338) + rate_constant(i,113) * number_density(i,137)

    !  k_HO2_HOCH2OO_1: HO2 + HOCH2OO -> 1*HCOOH
    LU(i,5338) = LU(i,5338) - rate_constant(i,172) * number_density(i,192)

    !  k_HOCH2OO_1: HOCH2OO -> 1*CH2O + 1*HO2
    LU(i,5338) = LU(i,5338) + rate_constant(i,431)

    ! df_HOCH2OO/d(HOCH2OO)
    !  k_HOCH2OO_NO_1: HOCH2OO + NO -> 1*HCOOH + 1*NO2 + 1*HO2
    LU(i,5300) = LU(i,5300) - rate_constant(i,113) * number_density(i,137)

    !  k_HO2_HOCH2OO_1: HO2 + HOCH2OO -> 1*HCOOH
    LU(i,5300) = LU(i,5300) - rate_constant(i,172) * number_density(i,192)

    !  k_HOCH2OO_1: HOCH2OO -> 1*CH2O + 1*HO2
    LU(i,5300) = LU(i,5300) - rate_constant(i,431)

    ! df_H/d(H2)
    !  k_CL_H2_1: CL + H2 -> 1*HCL + 1*H
    LU(i,5114) = LU(i,5114) + rate_constant(i,166) * number_density(i,100)

    !  k_H2_O1D_1: H2 + O1D -> 1*H + 1*OH
    LU(i,5114) = LU(i,5114) + rate_constant(i,237) * number_density(i,112)
  end do
  !$acc end parallel

end subroutine dforce_dy86

subroutine dforce_dy87(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    !  k_H2_OH_1: H2 + OH -> 1*H2O + 1*H
    LU(i,5114) = LU(i,5114) + rate_constant(i,281) * number_density(i,166)

    !  k_H2_O_1: H2 + O -> 1*OH + 1*H
    LU(i,5114) = LU(i,5114) + rate_constant(i,465) * number_density(i,187)

    ! df_H2O/d(H2)
    !  k_H2_OH_1: H2 + OH -> 1*H2O + 1*H
    LU(i,5118) = LU(i,5118) + rate_constant(i,281) * number_density(i,166)

    ! df_CL/d(H2)
    !  k_CL_H2_1: CL + H2 -> 1*HCL + 1*H
    LU(i,5127) = LU(i,5127) - rate_constant(i,166) * number_density(i,100)

    ! df_O/d(H2)
    !  k_H2_O_1: H2 + O -> 1*OH + 1*H
    LU(i,5183) = LU(i,5183) - rate_constant(i,465) * number_density(i,187)

    ! df_O1D/d(H2)
    !  k_H2_O1D_1: H2 + O1D -> 1*H + 1*OH
    LU(i,5130) = LU(i,5130) - rate_constant(i,237) * number_density(i,112)

    ! df_HCL/d(H2)
    !  k_CL_H2_1: CL + H2 -> 1*HCL + 1*H
    LU(i,5176) = LU(i,5176) + rate_constant(i,166) * number_density(i,100)

    ! df_H2/d(H2)
    !  k_CL_H2_1: CL + H2 -> 1*HCL + 1*H
    LU(i,5148) = LU(i,5148) - rate_constant(i,166) * number_density(i,100)

    !  k_H2_O1D_1: H2 + O1D -> 1*H + 1*OH
    LU(i,5148) = LU(i,5148) - rate_constant(i,237) * number_density(i,112)

    !  k_H2_OH_1: H2 + OH -> 1*H2O + 1*H
    LU(i,5148) = LU(i,5148) - rate_constant(i,281) * number_density(i,166)

    !  k_H2_O_1: H2 + O -> 1*OH + 1*H
    LU(i,5148) = LU(i,5148) - rate_constant(i,465) * number_density(i,187)

    ! df_OH/d(H2)
    !  k_H2_O1D_1: H2 + O1D -> 1*H + 1*OH
    LU(i,5162) = LU(i,5162) + rate_constant(i,237) * number_density(i,112)

    !  k_H2_OH_1: H2 + OH -> 1*H2O + 1*H
    LU(i,5162) = LU(i,5162) - rate_constant(i,281) * number_density(i,166)

    !  k_H2_O_1: H2 + O -> 1*OH + 1*H
    LU(i,5162) = LU(i,5162) + rate_constant(i,465) * number_density(i,187)

    ! df_HYDRALD/d(HYDRALD)
    !  k_HYDRALD_OH_1: HYDRALD + OH -> 1*XO2
    LU(i,4356) = LU(i,4356) - rate_constant(i,407) * number_density(i,166)

    ! df_XO2/d(HYDRALD)
    !  k_HYDRALD_OH_1: HYDRALD + OH -> 1*XO2
    LU(i,4357) = LU(i,4357) + rate_constant(i,407) * number_density(i,166)

    ! df_OH/d(HYDRALD)
    !  k_HYDRALD_OH_1: HYDRALD + OH -> 1*XO2
    LU(i,4358) = LU(i,4358) - rate_constant(i,407) * number_density(i,166)

    ! df_MVK/d(ISOP)
    !  k_ISOP_O3_2: ISOP + O3 -> 0.3*MACR + 0.2*MVK + 0.11*HCOOH + 0.62*CO + 0.32*OH + 0.37*HO2 + 0.91*CH2O + 0.08*CH3CO3 + 0.13*C3H6 + 0.05*CH3O2
    LU(i,4364) = LU(i,4364) + 0.2*rate_constant(i,377) * number_density(i,171)

    ! df_SOAG0/d(ISOP)
    !  k_ISOP_OH_1: ISOP + OH -> 1*ISOP + 1*OH + 0.0031*SOAG0 + 0.0035*SOAG1 + 0.0003*SOAG2 + 0.0271*SOAG3 + 0.0474*SOAG4
    LU(i,4359) = LU(i,4359) + 0.0031*rate_constant(i,75) * number_density(i,166)

    ! df_SOAG1/d(ISOP)
    !  k_ISOP_OH_1: ISOP + OH -> 1*ISOP + 1*OH + 0.0031*SOAG0 + 0.0035*SOAG1 + 0.0003*SOAG2 + 0.0271*SOAG3 + 0.0474*SOAG4
    LU(i,4360) = LU(i,4360) + 0.0035*rate_constant(i,75) * number_density(i,166)

    ! df_SOAG2/d(ISOP)
    !  k_ISOP_OH_1: ISOP + OH -> 1*ISOP + 1*OH + 0.0031*SOAG0 + 0.0035*SOAG1 + 0.0003*SOAG2 + 0.0271*SOAG3 + 0.0474*SOAG4
    LU(i,4361) = LU(i,4361) + 0.0003*rate_constant(i,75) * number_density(i,166)

    ! df_SOAG3/d(ISOP)
    !  k_ISOP_O3_1: ISOP + O3 -> 1*ISOP + 1*O3 + 0.0033*SOAG3
    LU(i,4362) = LU(i,4362) + 0.0033*rate_constant(i,42) * number_density(i,171)

    !  k_ISOP_OH_1: ISOP + OH -> 1*ISOP + 1*OH + 0.0031*SOAG0 + 0.0035*SOAG1 + 0.0003*SOAG2 + 0.0271*SOAG3 + 0.0474*SOAG4
    LU(i,4362) = LU(i,4362) + 0.0271*rate_constant(i,75) * number_density(i,166)

    !  k_ISOP_NO3_1: ISOP + NO3 -> 1*ISOP + 1*NO3 + 0.059024*SOAG3 + 0.025024*SOAG4
    LU(i,4362) = LU(i,4362) + 0.059024*rate_constant(i,346) * number_density(i,165)

    ! df_SOAG4/d(ISOP)
    !  k_ISOP_OH_1: ISOP + OH -> 1*ISOP + 1*OH + 0.0031*SOAG0 + 0.0035*SOAG1 + 0.0003*SOAG2 + 0.0271*SOAG3 + 0.0474*SOAG4
    LU(i,4363) = LU(i,4363) + 0.0474*rate_constant(i,75) * number_density(i,166)

    !  k_ISOP_NO3_1: ISOP + NO3 -> 1*ISOP + 1*NO3 + 0.059024*SOAG3 + 0.025024*SOAG4
    LU(i,4363) = LU(i,4363) + 0.025024*rate_constant(i,346) * number_density(i,165)

    ! df_ISOPNO3/d(ISOP)
    !  k_ISOP_NO3_2: ISOP + NO3 -> 1*ISOPNO3
    LU(i,4365) = LU(i,4365) + rate_constant(i,385) * number_density(i,165)

    ! df_CH3CO3/d(ISOP)
    !  k_ISOP_O3_2: ISOP + O3 -> 0.3*MACR + 0.2*MVK + 0.11*HCOOH + 0.62*CO + 0.32*OH + 0.37*HO2 + 0.91*CH2O + 0.08*CH3CO3 + 0.13*C3H6 + 0.05*CH3O2
    LU(i,4366) = LU(i,4366) + 0.08*rate_constant(i,377) * number_density(i,171)
  end do
  !$acc end parallel

end subroutine dforce_dy87

subroutine dforce_dy88(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! df_HCOOH/d(ISOP)
    !  k_ISOP_O3_2: ISOP + O3 -> 0.3*MACR + 0.2*MVK + 0.11*HCOOH + 0.62*CO + 0.32*OH + 0.37*HO2 + 0.91*CH2O + 0.08*CH3CO3 + 0.13*C3H6 + 0.05*CH3O2
    LU(i,4383) = LU(i,4383) + 0.11*rate_constant(i,377) * number_density(i,171)

    ! df_CH3O2/d(ISOP)
    !  k_ISOP_O3_2: ISOP + O3 -> 0.3*MACR + 0.2*MVK + 0.11*HCOOH + 0.62*CO + 0.32*OH + 0.37*HO2 + 0.91*CH2O + 0.08*CH3CO3 + 0.13*C3H6 + 0.05*CH3O2
    LU(i,4440) = LU(i,4440) + 0.05*rate_constant(i,377) * number_density(i,171)

    ! df_C3H6/d(ISOP)
    !  k_ISOP_O3_2: ISOP + O3 -> 0.3*MACR + 0.2*MVK + 0.11*HCOOH + 0.62*CO + 0.32*OH + 0.37*HO2 + 0.91*CH2O + 0.08*CH3CO3 + 0.13*C3H6 + 0.05*CH3O2
    LU(i,4384) = LU(i,4384) + 0.13*rate_constant(i,377) * number_density(i,171)

    ! df_CH2O/d(ISOP)
    !  k_ISOP_O3_2: ISOP + O3 -> 0.3*MACR + 0.2*MVK + 0.11*HCOOH + 0.62*CO + 0.32*OH + 0.37*HO2 + 0.91*CH2O + 0.08*CH3CO3 + 0.13*C3H6 + 0.05*CH3O2
    LU(i,4386) = LU(i,4386) + 0.91*rate_constant(i,377) * number_density(i,171)

    ! df_ISOPAO2/d(ISOP)
    !  k_ISOP_OH_2: ISOP + OH -> 0.6*ISOPAO2 + 0.4*ISOPBO2
    LU(i,4438) = LU(i,4438) + 0.6*rate_constant(i,76) * number_density(i,166)

    ! df_ISOPBO2/d(ISOP)
    !  k_ISOP_OH_2: ISOP + OH -> 0.6*ISOPAO2 + 0.4*ISOPBO2
    LU(i,4439) = LU(i,4439) + 0.4*rate_constant(i,76) * number_density(i,166)

    ! df_HO2/d(ISOP)
    !  k_ISOP_O3_2: ISOP + O3 -> 0.3*MACR + 0.2*MVK + 0.11*HCOOH + 0.62*CO + 0.32*OH + 0.37*HO2 + 0.91*CH2O + 0.08*CH3CO3 + 0.13*C3H6 + 0.05*CH3O2
    LU(i,4441) = LU(i,4441) + 0.37*rate_constant(i,377) * number_density(i,171)

    ! df_ISOP/d(ISOP)
    !  k_ISOP_OH_2: ISOP + OH -> 0.6*ISOPAO2 + 0.4*ISOPBO2
    LU(i,4391) = LU(i,4391) - rate_constant(i,76) * number_density(i,166)

    !  k_ISOP_O3_2: ISOP + O3 -> 0.3*MACR + 0.2*MVK + 0.11*HCOOH + 0.62*CO + 0.32*OH + 0.37*HO2 + 0.91*CH2O + 0.08*CH3CO3 + 0.13*C3H6 + 0.05*CH3O2
    LU(i,4391) = LU(i,4391) - rate_constant(i,377) * number_density(i,171)

    !  k_ISOP_NO3_2: ISOP + NO3 -> 1*ISOPNO3
    LU(i,4391) = LU(i,4391) - rate_constant(i,385) * number_density(i,165)

    ! df_MACR/d(ISOP)
    !  k_ISOP_O3_2: ISOP + O3 -> 0.3*MACR + 0.2*MVK + 0.11*HCOOH + 0.62*CO + 0.32*OH + 0.37*HO2 + 0.91*CH2O + 0.08*CH3CO3 + 0.13*C3H6 + 0.05*CH3O2
    LU(i,4406) = LU(i,4406) + 0.3*rate_constant(i,377) * number_density(i,171)

    ! df_NO3/d(ISOP)
    !  k_ISOP_NO3_2: ISOP + NO3 -> 1*ISOPNO3
    LU(i,4414) = LU(i,4414) - rate_constant(i,385) * number_density(i,165)

    ! df_OH/d(ISOP)
    !  k_ISOP_OH_2: ISOP + OH -> 0.6*ISOPAO2 + 0.4*ISOPBO2
    LU(i,4415) = LU(i,4415) - rate_constant(i,76) * number_density(i,166)

    !  k_ISOP_O3_2: ISOP + O3 -> 0.3*MACR + 0.2*MVK + 0.11*HCOOH + 0.62*CO + 0.32*OH + 0.37*HO2 + 0.91*CH2O + 0.08*CH3CO3 + 0.13*C3H6 + 0.05*CH3O2
    LU(i,4415) = LU(i,4415) + 0.32*rate_constant(i,377) * number_density(i,171)

    ! df_O3/d(ISOP)
    !  k_ISOP_O3_2: ISOP + O3 -> 0.3*MACR + 0.2*MVK + 0.11*HCOOH + 0.62*CO + 0.32*OH + 0.37*HO2 + 0.91*CH2O + 0.08*CH3CO3 + 0.13*C3H6 + 0.05*CH3O2
    LU(i,4420) = LU(i,4420) - rate_constant(i,377) * number_density(i,171)

    ! df_CO/d(ISOP)
    !  k_ISOP_O3_2: ISOP + O3 -> 0.3*MACR + 0.2*MVK + 0.11*HCOOH + 0.62*CO + 0.32*OH + 0.37*HO2 + 0.91*CH2O + 0.08*CH3CO3 + 0.13*C3H6 + 0.05*CH3O2
    LU(i,4425) = LU(i,4425) + 0.62*rate_constant(i,377) * number_density(i,171)

    ! df_MBOO2/d(MBOOOH)
    !  k_MBOOOH_OH_1: MBOOOH + OH -> 0.5*MBOO2 + 0.5*OH
    LU(i,4981) = LU(i,4981) + 0.5*rate_constant(i,105) * number_density(i,166)

    ! df_MBOOOH/d(MBOOOH)
    !  k_MBOOOH_OH_1: MBOOOH + OH -> 0.5*MBOO2 + 0.5*OH
    LU(i,4994) = LU(i,4994) - rate_constant(i,105) * number_density(i,166)

    ! df_OH/d(MBOOOH)
    !  k_MBOOOH_OH_1: MBOOOH + OH -> 0.5*MBOO2 + 0.5*OH
    LU(i,5010) = LU(i,5010) - 0.5*rate_constant(i,105) * number_density(i,166)

    ! df_TERPNIT/d(NTERPO2)
    !  k_CH3O2_NTERPO2_1: CH3O2 + NTERPO2 -> 0.5*TERPNIT + 0.75*CH2O + 0.25*CH3OH + 0.5*HO2 + 0.5*TERPROD1 + 0.5*NO2
    LU(i,4442) = LU(i,4442) + 0.5*rate_constant(i,135) * number_density(i,191)

    !  k_NO_NTERPO2_1: NO + NTERPO2 -> 0.2*TERPNIT + 1.6*NO2 + 0.8*TERPROD1
    LU(i,4442) = LU(i,4442) + 0.2*rate_constant(i,306) * number_density(i,137)

    ! df_TERPROD1/d(NTERPO2)
    !  k_CH3O2_NTERPO2_1: CH3O2 + NTERPO2 -> 0.5*TERPNIT + 0.75*CH2O + 0.25*CH3OH + 0.5*HO2 + 0.5*TERPROD1 + 0.5*NO2
    LU(i,4446) = LU(i,4446) + 0.5*rate_constant(i,135) * number_density(i,191)

    !  k_NO_NTERPO2_1: NO + NTERPO2 -> 0.2*TERPNIT + 1.6*NO2 + 0.8*TERPROD1
    LU(i,4446) = LU(i,4446) + 0.8*rate_constant(i,306) * number_density(i,137)

    !  k_NO3_NTERPO2_1: NO3 + NTERPO2 -> 2*NO2 + 1*TERPROD1
    LU(i,4446) = LU(i,4446) + rate_constant(i,389) * number_density(i,165)

    ! df_NO2/d(NTERPO2)
    !  k_CH3O2_NTERPO2_1: CH3O2 + NTERPO2 -> 0.5*TERPNIT + 0.75*CH2O + 0.25*CH3OH + 0.5*HO2 + 0.5*TERPROD1 + 0.5*NO2
    LU(i,4443) = LU(i,4443) + 0.5*rate_constant(i,135) * number_density(i,191)

    !  k_NO_NTERPO2_1: NO + NTERPO2 -> 0.2*TERPNIT + 1.6*NO2 + 0.8*TERPROD1
    LU(i,4443) = LU(i,4443) + 1.6*rate_constant(i,306) * number_density(i,137)

    !  k_NO3_NTERPO2_1: NO3 + NTERPO2 -> 2*NO2 + 1*TERPROD1
    LU(i,4443) = LU(i,4443) + 2*rate_constant(i,389) * number_density(i,165)

  end do
  !$acc end parallel

end subroutine dforce_dy88

subroutine dforce_dy89(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell
    ! df_NTERPOOH/d(NTERPO2)
    !  k_HO2_NTERPO2_1: HO2 + NTERPO2 -> 1*NTERPOOH
    LU(i,4460) = LU(i,4460) + rate_constant(i,124) * number_density(i,192)

    ! df_NO/d(NTERPO2)
    !  k_NO_NTERPO2_1: NO + NTERPO2 -> 0.2*TERPNIT + 1.6*NO2 + 0.8*TERPROD1
    LU(i,4467) = LU(i,4467) - rate_constant(i,306) * number_density(i,137)

    ! df_CH3O2/d(NTERPO2)
    !  k_CH3O2_NTERPO2_1: CH3O2 + NTERPO2 -> 0.5*TERPNIT + 0.75*CH2O + 0.25*CH3OH + 0.5*HO2 + 0.5*TERPROD1 + 0.5*NO2
    LU(i,4517) = LU(i,4517) - rate_constant(i,135) * number_density(i,191)

    ! df_CH2O/d(NTERPO2)
    !  k_CH3O2_NTERPO2_1: CH3O2 + NTERPO2 -> 0.5*TERPNIT + 0.75*CH2O + 0.25*CH3OH + 0.5*HO2 + 0.5*TERPROD1 + 0.5*NO2
    LU(i,4464) = LU(i,4464) + 0.75*rate_constant(i,135) * number_density(i,191)

    ! df_CH3OH/d(NTERPO2)
    !  k_CH3O2_NTERPO2_1: CH3O2 + NTERPO2 -> 0.5*TERPNIT + 0.75*CH2O + 0.25*CH3OH + 0.5*HO2 + 0.5*TERPROD1 + 0.5*NO2
    LU(i,4463) = LU(i,4463) + 0.25*rate_constant(i,135) * number_density(i,191)

    ! df_HO2/d(NTERPO2)
    !  k_HO2_NTERPO2_1: HO2 + NTERPO2 -> 1*NTERPOOH
    LU(i,4518) = LU(i,4518) - rate_constant(i,124) * number_density(i,192)

    !  k_CH3O2_NTERPO2_1: CH3O2 + NTERPO2 -> 0.5*TERPNIT + 0.75*CH2O + 0.25*CH3OH + 0.5*HO2 + 0.5*TERPROD1 + 0.5*NO2
    LU(i,4518) = LU(i,4518) + 0.5*rate_constant(i,135) * number_density(i,191)

    ! df_NTERPO2/d(NTERPO2)
    !  k_HO2_NTERPO2_1: HO2 + NTERPO2 -> 1*NTERPOOH
    LU(i,4469) = LU(i,4469) - rate_constant(i,124) * number_density(i,192)

    !  k_CH3O2_NTERPO2_1: CH3O2 + NTERPO2 -> 0.5*TERPNIT + 0.75*CH2O + 0.25*CH3OH + 0.5*HO2 + 0.5*TERPROD1 + 0.5*NO2
    LU(i,4469) = LU(i,4469) - rate_constant(i,135) * number_density(i,191)

    !  k_NO_NTERPO2_1: NO + NTERPO2 -> 0.2*TERPNIT + 1.6*NO2 + 0.8*TERPROD1
    LU(i,4469) = LU(i,4469) - rate_constant(i,306) * number_density(i,137)

    !  k_NO3_NTERPO2_1: NO3 + NTERPO2 -> 2*NO2 + 1*TERPROD1
    LU(i,4469) = LU(i,4469) - rate_constant(i,389) * number_density(i,165)

    ! df_NO3/d(NTERPO2)
    !  k_NO3_NTERPO2_1: NO3 + NTERPO2 -> 2*NO2 + 1*TERPROD1
    LU(i,4491) = LU(i,4491) - rate_constant(i,389) * number_density(i,165)

    ! df_NO2/d(TOLO2)
    !  k_NO_TOLO2_1: NO + TOLO2 -> 1*NO2 + 0.6*GLYOXAL + 0.4*CH3COCHO + 1*HO2 + 0.2*BIGALD1 + 0.2*BIGALD2 + 0.2*BIGALD3
    LU(i,4519) = LU(i,4519) + rate_constant(i,60) * number_density(i,137)

    ! df_NO/d(TOLO2)
    !  k_NO_TOLO2_1: NO + TOLO2 -> 1*NO2 + 0.6*GLYOXAL + 0.4*CH3COCHO + 1*HO2 + 0.2*BIGALD1 + 0.2*BIGALD2 + 0.2*BIGALD3
    LU(i,4544) = LU(i,4544) - rate_constant(i,60) * number_density(i,137)

    ! df_CH3COCHO/d(TOLO2)
    !  k_NO_TOLO2_1: NO + TOLO2 -> 1*NO2 + 0.6*GLYOXAL + 0.4*CH3COCHO + 1*HO2 + 0.2*BIGALD1 + 0.2*BIGALD2 + 0.2*BIGALD3
    LU(i,4535) = LU(i,4535) + 0.4*rate_constant(i,60) * number_density(i,137)

    ! df_BIGALD2/d(TOLO2)
    !  k_NO_TOLO2_1: NO + TOLO2 -> 1*NO2 + 0.6*GLYOXAL + 0.4*CH3COCHO + 1*HO2 + 0.2*BIGALD1 + 0.2*BIGALD2 + 0.2*BIGALD3
    LU(i,4537) = LU(i,4537) + 0.2*rate_constant(i,60) * number_density(i,137)

    ! df_BIGALD3/d(TOLO2)
    !  k_NO_TOLO2_1: NO + TOLO2 -> 1*NO2 + 0.6*GLYOXAL + 0.4*CH3COCHO + 1*HO2 + 0.2*BIGALD1 + 0.2*BIGALD2 + 0.2*BIGALD3
    LU(i,4534) = LU(i,4534) + 0.2*rate_constant(i,60) * number_density(i,137)

    ! df_GLYOXAL/d(TOLO2)
    !  k_NO_TOLO2_1: NO + TOLO2 -> 1*NO2 + 0.6*GLYOXAL + 0.4*CH3COCHO + 1*HO2 + 0.2*BIGALD1 + 0.2*BIGALD2 + 0.2*BIGALD3
    LU(i,4543) = LU(i,4543) + 0.6*rate_constant(i,60) * number_density(i,137)

    ! df_HO2/d(TOLO2)
    !  k_NO_TOLO2_1: NO + TOLO2 -> 1*NO2 + 0.6*GLYOXAL + 0.4*CH3COCHO + 1*HO2 + 0.2*BIGALD1 + 0.2*BIGALD2 + 0.2*BIGALD3
    LU(i,4595) = LU(i,4595) + rate_constant(i,60) * number_density(i,137)

    !  k_HO2_TOLO2_1: HO2 + TOLO2 -> 1*TOLOOH
    LU(i,4595) = LU(i,4595) - rate_constant(i,479) * number_density(i,192)

    ! df_TOLO2/d(TOLO2)
    !  k_NO_TOLO2_1: NO + TOLO2 -> 1*NO2 + 0.6*GLYOXAL + 0.4*CH3COCHO + 1*HO2 + 0.2*BIGALD1 + 0.2*BIGALD2 + 0.2*BIGALD3
    LU(i,4547) = LU(i,4547) - rate_constant(i,60) * number_density(i,137)

    !  k_HO2_TOLO2_1: HO2 + TOLO2 -> 1*TOLOOH
    LU(i,4547) = LU(i,4547) - rate_constant(i,479) * number_density(i,192)

    ! df_TOLOOH/d(TOLO2)
    !  k_HO2_TOLO2_1: HO2 + TOLO2 -> 1*TOLOOH
    LU(i,4532) = LU(i,4532) + rate_constant(i,479) * number_density(i,192)

    ! df_BIGALD1/d(TOLO2)
    !  k_NO_TOLO2_1: NO + TOLO2 -> 1*NO2 + 0.6*GLYOXAL + 0.4*CH3COCHO + 1*HO2 + 0.2*BIGALD1 + 0.2*BIGALD2 + 0.2*BIGALD3
    LU(i,4526) = LU(i,4526) + 0.2*rate_constant(i,60) * number_density(i,137)

    ! df_NO2/d(TERP2O2)
    !  k_NO_TERP2O2_1: NO + TERP2O2 -> 0.1*ONITR + 0.9*NO2 + 0.34*CH2O + 0.27*CH3COCH3 + 0.225*CO + 0.9*CO2 + 0.9*TERPROD2 + 0.9*HO2 + 0.225*GLYALD
    LU(i,4597) = LU(i,4597) + 0.9*rate_constant(i,110) * number_density(i,137)

    ! df_NO/d(TERP2O2)
    !  k_NO_TERP2O2_1: NO + TERP2O2 -> 0.1*ONITR + 0.9*NO2 + 0.34*CH2O + 0.27*CH3COCH3 + 0.225*CO + 0.9*CO2 + 0.9*TERPROD2 + 0.9*HO2 + 0.225*GLYALD
    LU(i,4622) = LU(i,4622) - rate_constant(i,110) * number_density(i,137)

    ! df_CO2/d(TERP2O2)
    !  k_NO_TERP2O2_1: NO + TERP2O2 -> 0.1*ONITR + 0.9*NO2 + 0.34*CH2O + 0.27*CH3COCH3 + 0.225*CO + 0.9*CO2 + 0.9*TERPROD2 + 0.9*HO2 + 0.225*GLYALD
    LU(i,4605) = LU(i,4605) + 0.9*rate_constant(i,110) * number_density(i,137)
  end do
  !$acc end parallel

end subroutine dforce_dy89

subroutine dforce_dy90(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    !  k_CH3O2_TERP2O2_1: CH3O2 + TERP2O2 -> 1*TERPROD2 + 0.93*CH2O + 0.25*CH3OH + 1*HO2 + 0.5*CO2 + 0.125*CO + 0.125*GLYALD + 0.15*CH3COCH3
    LU(i,4605) = LU(i,4605) + 0.5*rate_constant(i,414) * number_density(i,191)

    ! df_CH3COCH3/d(TERP2O2)
    !  k_NO_TERP2O2_1: NO + TERP2O2 -> 0.1*ONITR + 0.9*NO2 + 0.34*CH2O + 0.27*CH3COCH3 + 0.225*CO + 0.9*CO2 + 0.9*TERPROD2 + 0.9*HO2 + 0.225*GLYALD
    LU(i,4608) = LU(i,4608) + 0.27*rate_constant(i,110) * number_density(i,137)

    !  k_CH3O2_TERP2O2_1: CH3O2 + TERP2O2 -> 1*TERPROD2 + 0.93*CH2O + 0.25*CH3OH + 1*HO2 + 0.5*CO2 + 0.125*CO + 0.125*GLYALD + 0.15*CH3COCH3
    LU(i,4608) = LU(i,4608) + 0.15*rate_constant(i,414) * number_density(i,191)

    ! df_CH3O2/d(TERP2O2)
    !  k_CH3O2_TERP2O2_1: CH3O2 + TERP2O2 -> 1*TERPROD2 + 0.93*CH2O + 0.25*CH3OH + 1*HO2 + 0.5*CO2 + 0.125*CO + 0.125*GLYALD + 0.15*CH3COCH3
    LU(i,4672) = LU(i,4672) - rate_constant(i,414) * number_density(i,191)

    ! df_CH2O/d(TERP2O2)
    !  k_NO_TERP2O2_1: NO + TERP2O2 -> 0.1*ONITR + 0.9*NO2 + 0.34*CH2O + 0.27*CH3COCH3 + 0.225*CO + 0.9*CO2 + 0.9*TERPROD2 + 0.9*HO2 + 0.225*GLYALD
    LU(i,4618) = LU(i,4618) + 0.34*rate_constant(i,110) * number_density(i,137)

    !  k_CH3O2_TERP2O2_1: CH3O2 + TERP2O2 -> 1*TERPROD2 + 0.93*CH2O + 0.25*CH3OH + 1*HO2 + 0.5*CO2 + 0.125*CO + 0.125*GLYALD + 0.15*CH3COCH3
    LU(i,4618) = LU(i,4618) + 0.93*rate_constant(i,414) * number_density(i,191)

    ! df_CH3OH/d(TERP2O2)
    !  k_CH3O2_TERP2O2_1: CH3O2 + TERP2O2 -> 1*TERPROD2 + 0.93*CH2O + 0.25*CH3OH + 1*HO2 + 0.5*CO2 + 0.125*CO + 0.125*GLYALD + 0.15*CH3COCH3
    LU(i,4617) = LU(i,4617) + 0.25*rate_constant(i,414) * number_density(i,191)

    ! df_GLYALD/d(TERP2O2)
    !  k_NO_TERP2O2_1: NO + TERP2O2 -> 0.1*ONITR + 0.9*NO2 + 0.34*CH2O + 0.27*CH3COCH3 + 0.225*CO + 0.9*CO2 + 0.9*TERPROD2 + 0.9*HO2 + 0.225*GLYALD
    LU(i,4637) = LU(i,4637) + 0.225*rate_constant(i,110) * number_density(i,137)

    !  k_CH3O2_TERP2O2_1: CH3O2 + TERP2O2 -> 1*TERPROD2 + 0.93*CH2O + 0.25*CH3OH + 1*HO2 + 0.5*CO2 + 0.125*CO + 0.125*GLYALD + 0.15*CH3COCH3
    LU(i,4637) = LU(i,4637) + 0.125*rate_constant(i,414) * number_density(i,191)

    ! df_HO2/d(TERP2O2)
    !  k_NO_TERP2O2_1: NO + TERP2O2 -> 0.1*ONITR + 0.9*NO2 + 0.34*CH2O + 0.27*CH3COCH3 + 0.225*CO + 0.9*CO2 + 0.9*TERPROD2 + 0.9*HO2 + 0.225*GLYALD
    LU(i,4673) = LU(i,4673) + 0.9*rate_constant(i,110) * number_density(i,137)

    !  k_HO2_TERP2O2_1: HO2 + TERP2O2 -> 1*TERP2OOH
    LU(i,4673) = LU(i,4673) - rate_constant(i,341) * number_density(i,192)

    !  k_CH3O2_TERP2O2_1: CH3O2 + TERP2O2 -> 1*TERPROD2 + 0.93*CH2O + 0.25*CH3OH + 1*HO2 + 0.5*CO2 + 0.125*CO + 0.125*GLYALD + 0.15*CH3COCH3
    LU(i,4673) = LU(i,4673) + rate_constant(i,414) * number_density(i,191)

    ! df_TERP2O2/d(TERP2O2)
    !  k_NO_TERP2O2_1: NO + TERP2O2 -> 0.1*ONITR + 0.9*NO2 + 0.34*CH2O + 0.27*CH3COCH3 + 0.225*CO + 0.9*CO2 + 0.9*TERPROD2 + 0.9*HO2 + 0.225*GLYALD
    LU(i,4626) = LU(i,4626) - rate_constant(i,110) * number_density(i,137)

    !  k_HO2_TERP2O2_1: HO2 + TERP2O2 -> 1*TERP2OOH
    LU(i,4626) = LU(i,4626) - rate_constant(i,341) * number_density(i,192)

    !  k_CH3O2_TERP2O2_1: CH3O2 + TERP2O2 -> 1*TERPROD2 + 0.93*CH2O + 0.25*CH3OH + 1*HO2 + 0.5*CO2 + 0.125*CO + 0.125*GLYALD + 0.15*CH3COCH3
    LU(i,4626) = LU(i,4626) - rate_constant(i,414) * number_density(i,191)

    ! df_TERPROD2/d(TERP2O2)
    !  k_NO_TERP2O2_1: NO + TERP2O2 -> 0.1*ONITR + 0.9*NO2 + 0.34*CH2O + 0.27*CH3COCH3 + 0.225*CO + 0.9*CO2 + 0.9*TERPROD2 + 0.9*HO2 + 0.225*GLYALD
    LU(i,4636) = LU(i,4636) + 0.9*rate_constant(i,110) * number_density(i,137)

    !  k_CH3O2_TERP2O2_1: CH3O2 + TERP2O2 -> 1*TERPROD2 + 0.93*CH2O + 0.25*CH3OH + 1*HO2 + 0.5*CO2 + 0.125*CO + 0.125*GLYALD + 0.15*CH3COCH3
    LU(i,4636) = LU(i,4636) + rate_constant(i,414) * number_density(i,191)

    ! df_ONITR/d(TERP2O2)
    !  k_NO_TERP2O2_1: NO + TERP2O2 -> 0.1*ONITR + 0.9*NO2 + 0.34*CH2O + 0.27*CH3COCH3 + 0.225*CO + 0.9*CO2 + 0.9*TERPROD2 + 0.9*HO2 + 0.225*GLYALD
    LU(i,4620) = LU(i,4620) + 0.1*rate_constant(i,110) * number_density(i,137)

    ! df_CO/d(TERP2O2)
    !  k_NO_TERP2O2_1: NO + TERP2O2 -> 0.1*ONITR + 0.9*NO2 + 0.34*CH2O + 0.27*CH3COCH3 + 0.225*CO + 0.9*CO2 + 0.9*TERPROD2 + 0.9*HO2 + 0.225*GLYALD
    LU(i,4657) = LU(i,4657) + 0.225*rate_constant(i,110) * number_density(i,137)

    !  k_CH3O2_TERP2O2_1: CH3O2 + TERP2O2 -> 1*TERPROD2 + 0.93*CH2O + 0.25*CH3OH + 1*HO2 + 0.5*CO2 + 0.125*CO + 0.125*GLYALD + 0.15*CH3COCH3
    LU(i,4657) = LU(i,4657) + 0.125*rate_constant(i,414) * number_density(i,191)

    ! df_TERP2OOH/d(TERP2O2)
    !  k_HO2_TERP2O2_1: HO2 + TERP2O2 -> 1*TERP2OOH
    LU(i,4596) = LU(i,4596) + rate_constant(i,341) * number_density(i,192)

    ! df_NO2/d(XYLENO2)
    !  k_NO_XYLENO2_1: NO + XYLENO2 -> 1*NO2 + 1*HO2 + 0.34*GLYOXAL + 0.54*CH3COCHO + 0.06*BIGALD1 + 0.2*BIGALD2 + 0.15*BIGALD3 + 0.21*BIGALD4
    LU(i,4674) = LU(i,4674) + rate_constant(i,419) * number_density(i,137)

    ! df_NO/d(XYLENO2)
    !  k_NO_XYLENO2_1: NO + XYLENO2 -> 1*NO2 + 1*HO2 + 0.34*GLYOXAL + 0.54*CH3COCHO + 0.06*BIGALD1 + 0.2*BIGALD2 + 0.15*BIGALD3 + 0.21*BIGALD4
    LU(i,4700) = LU(i,4700) - rate_constant(i,419) * number_density(i,137)

    ! df_CH3COCHO/d(XYLENO2)
    !  k_NO_XYLENO2_1: NO + XYLENO2 -> 1*NO2 + 1*HO2 + 0.34*GLYOXAL + 0.54*CH3COCHO + 0.06*BIGALD1 + 0.2*BIGALD2 + 0.15*BIGALD3 + 0.21*BIGALD4
    LU(i,4691) = LU(i,4691) + 0.54*rate_constant(i,419) * number_density(i,137)

    ! df_BIGALD2/d(XYLENO2)
    !  k_NO_XYLENO2_1: NO + XYLENO2 -> 1*NO2 + 1*HO2 + 0.34*GLYOXAL + 0.54*CH3COCHO + 0.06*BIGALD1 + 0.2*BIGALD2 + 0.15*BIGALD3 + 0.21*BIGALD4
    LU(i,4693) = LU(i,4693) + 0.2*rate_constant(i,419) * number_density(i,137)

    ! df_BIGALD3/d(XYLENO2)
    !  k_NO_XYLENO2_1: NO + XYLENO2 -> 1*NO2 + 1*HO2 + 0.34*GLYOXAL + 0.54*CH3COCHO + 0.06*BIGALD1 + 0.2*BIGALD2 + 0.15*BIGALD3 + 0.21*BIGALD4
    LU(i,4689) = LU(i,4689) + 0.15*rate_constant(i,419) * number_density(i,137)

    ! df_BIGALD4/d(XYLENO2)
    !  k_NO_XYLENO2_1: NO + XYLENO2 -> 1*NO2 + 1*HO2 + 0.34*GLYOXAL + 0.54*CH3COCHO + 0.06*BIGALD1 + 0.2*BIGALD2 + 0.15*BIGALD3 + 0.21*BIGALD4
    LU(i,4690) = LU(i,4690) + 0.21*rate_constant(i,419) * number_density(i,137)

    ! df_GLYOXAL/d(XYLENO2)
    !  k_NO_XYLENO2_1: NO + XYLENO2 -> 1*NO2 + 1*HO2 + 0.34*GLYOXAL + 0.54*CH3COCHO + 0.06*BIGALD1 + 0.2*BIGALD2 + 0.15*BIGALD3 + 0.21*BIGALD4
    LU(i,4699) = LU(i,4699) + 0.34*rate_constant(i,419) * number_density(i,137)
  end do
  !$acc end parallel

end subroutine dforce_dy90

subroutine dforce_dy91(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! df_HO2/d(XYLENO2)
    !  k_HO2_XYLENO2_1: HO2 + XYLENO2 -> 1*XYLENOOH
    LU(i,4751) = LU(i,4751) - rate_constant(i,333) * number_density(i,192)

    !  k_NO_XYLENO2_1: NO + XYLENO2 -> 1*NO2 + 1*HO2 + 0.34*GLYOXAL + 0.54*CH3COCHO + 0.06*BIGALD1 + 0.2*BIGALD2 + 0.15*BIGALD3 + 0.21*BIGALD4
    LU(i,4751) = LU(i,4751) + rate_constant(i,419) * number_density(i,137)

    ! df_XYLENO2/d(XYLENO2)
    !  k_HO2_XYLENO2_1: HO2 + XYLENO2 -> 1*XYLENOOH
    LU(i,4705) = LU(i,4705) - rate_constant(i,333) * number_density(i,192)

    !  k_NO_XYLENO2_1: NO + XYLENO2 -> 1*NO2 + 1*HO2 + 0.34*GLYOXAL + 0.54*CH3COCHO + 0.06*BIGALD1 + 0.2*BIGALD2 + 0.15*BIGALD3 + 0.21*BIGALD4
    LU(i,4705) = LU(i,4705) - rate_constant(i,419) * number_density(i,137)

    ! df_XYLENOOH/d(XYLENO2)
    !  k_HO2_XYLENO2_1: HO2 + XYLENO2 -> 1*XYLENOOH
    LU(i,4687) = LU(i,4687) + rate_constant(i,333) * number_density(i,192)

    ! df_BIGALD1/d(XYLENO2)
    !  k_NO_XYLENO2_1: NO + XYLENO2 -> 1*NO2 + 1*HO2 + 0.34*GLYOXAL + 0.54*CH3COCHO + 0.06*BIGALD1 + 0.2*BIGALD2 + 0.15*BIGALD3 + 0.21*BIGALD4
    LU(i,4681) = LU(i,4681) + 0.06*rate_constant(i,419) * number_density(i,137)

    ! df_TERPNIT/d(TERPO2)
    !  k_NO_TERPO2_1: NO + TERPO2 -> 0.2*TERPNIT + 0.8*NO2 + 0.32*CH2O + 0.04*CH3COCH3 + 0.8*TERPROD1 + 0.8*HO2
    LU(i,4752) = LU(i,4752) + 0.2*rate_constant(i,392) * number_density(i,137)

    ! df_TERPROD1/d(TERPO2)
    !  k_CH3O2_TERPO2_1: CH3O2 + TERPO2 -> 1*TERPROD1 + 0.95*CH2O + 0.25*CH3OH + 1*HO2 + 0.025*CH3COCH3
    LU(i,4756) = LU(i,4756) + rate_constant(i,3) * number_density(i,191)

    !  k_NO_TERPO2_1: NO + TERPO2 -> 0.2*TERPNIT + 0.8*NO2 + 0.32*CH2O + 0.04*CH3COCH3 + 0.8*TERPROD1 + 0.8*HO2
    LU(i,4756) = LU(i,4756) + 0.8*rate_constant(i,392) * number_density(i,137)

    ! df_NO2/d(TERPO2)
    !  k_NO_TERPO2_1: NO + TERPO2 -> 0.2*TERPNIT + 0.8*NO2 + 0.32*CH2O + 0.04*CH3COCH3 + 0.8*TERPROD1 + 0.8*HO2
    LU(i,4753) = LU(i,4753) + 0.8*rate_constant(i,392) * number_density(i,137)

    ! df_NO/d(TERPO2)
    !  k_NO_TERPO2_1: NO + TERPO2 -> 0.2*TERPNIT + 0.8*NO2 + 0.32*CH2O + 0.04*CH3COCH3 + 0.8*TERPROD1 + 0.8*HO2
    LU(i,4779) = LU(i,4779) - rate_constant(i,392) * number_density(i,137)

    ! df_CH3COCH3/d(TERPO2)
    !  k_CH3O2_TERPO2_1: CH3O2 + TERPO2 -> 1*TERPROD1 + 0.95*CH2O + 0.25*CH3OH + 1*HO2 + 0.025*CH3COCH3
    LU(i,4765) = LU(i,4765) + 0.025*rate_constant(i,3) * number_density(i,191)

    !  k_NO_TERPO2_1: NO + TERPO2 -> 0.2*TERPNIT + 0.8*NO2 + 0.32*CH2O + 0.04*CH3COCH3 + 0.8*TERPROD1 + 0.8*HO2
    LU(i,4765) = LU(i,4765) + 0.04*rate_constant(i,392) * number_density(i,137)

    ! df_CH3O2/d(TERPO2)
    !  k_CH3O2_TERPO2_1: CH3O2 + TERPO2 -> 1*TERPROD1 + 0.95*CH2O + 0.25*CH3OH + 1*HO2 + 0.025*CH3COCH3
    LU(i,4829) = LU(i,4829) - rate_constant(i,3) * number_density(i,191)

    ! df_CH2O/d(TERPO2)
    !  k_CH3O2_TERPO2_1: CH3O2 + TERPO2 -> 1*TERPROD1 + 0.95*CH2O + 0.25*CH3OH + 1*HO2 + 0.025*CH3COCH3
    LU(i,4776) = LU(i,4776) + 0.95*rate_constant(i,3) * number_density(i,191)

    !  k_NO_TERPO2_1: NO + TERPO2 -> 0.2*TERPNIT + 0.8*NO2 + 0.32*CH2O + 0.04*CH3COCH3 + 0.8*TERPROD1 + 0.8*HO2
    LU(i,4776) = LU(i,4776) + 0.32*rate_constant(i,392) * number_density(i,137)

    ! df_CH3OH/d(TERPO2)
    !  k_CH3O2_TERPO2_1: CH3O2 + TERPO2 -> 1*TERPROD1 + 0.95*CH2O + 0.25*CH3OH + 1*HO2 + 0.025*CH3COCH3
    LU(i,4775) = LU(i,4775) + 0.25*rate_constant(i,3) * number_density(i,191)

    ! df_HO2/d(TERPO2)
    !  k_CH3O2_TERPO2_1: CH3O2 + TERPO2 -> 1*TERPROD1 + 0.95*CH2O + 0.25*CH3OH + 1*HO2 + 0.025*CH3COCH3
    LU(i,4830) = LU(i,4830) + rate_constant(i,3) * number_density(i,191)

    !  k_HO2_TERPO2_1: HO2 + TERPO2 -> 1*TERPOOH
    LU(i,4830) = LU(i,4830) - rate_constant(i,145) * number_density(i,192)

    !  k_NO_TERPO2_1: NO + TERPO2 -> 0.2*TERPNIT + 0.8*NO2 + 0.32*CH2O + 0.04*CH3COCH3 + 0.8*TERPROD1 + 0.8*HO2
    LU(i,4830) = LU(i,4830) + 0.8*rate_constant(i,392) * number_density(i,137)

    ! df_TERPO2/d(TERPO2)
    !  k_CH3O2_TERPO2_1: CH3O2 + TERPO2 -> 1*TERPROD1 + 0.95*CH2O + 0.25*CH3OH + 1*HO2 + 0.025*CH3COCH3
    LU(i,4785) = LU(i,4785) - rate_constant(i,3) * number_density(i,191)

    !  k_HO2_TERPO2_1: HO2 + TERPO2 -> 1*TERPOOH
    LU(i,4785) = LU(i,4785) - rate_constant(i,145) * number_density(i,192)

    !  k_NO_TERPO2_1: NO + TERPO2 -> 0.2*TERPNIT + 0.8*NO2 + 0.32*CH2O + 0.04*CH3COCH3 + 0.8*TERPROD1 + 0.8*HO2
    LU(i,4785) = LU(i,4785) - rate_constant(i,392) * number_density(i,137)

    ! df_TERPOOH/d(TERPO2)
    !  k_HO2_TERPO2_1: HO2 + TERPO2 -> 1*TERPOOH
    LU(i,4771) = LU(i,4771) + rate_constant(i,145) * number_density(i,192)

    ! df_NO2/d(XYLOLO2)
    !  k_NO_XYLOLO2_1: NO + XYLOLO2 -> 1*HO2 + 1*NO2 + 0.17*GLYOXAL + 0.51*CH3COCHO
    LU(i,4832) = LU(i,4832) + rate_constant(i,404) * number_density(i,137)

    ! df_NO/d(XYLOLO2)
    !  k_NO_XYLOLO2_1: NO + XYLOLO2 -> 1*HO2 + 1*NO2 + 0.17*GLYOXAL + 0.51*CH3COCHO
    LU(i,4854) = LU(i,4854) - rate_constant(i,404) * number_density(i,137)

    ! df_CH3COCHO/d(XYLOLO2)
    !  k_NO_XYLOLO2_1: NO + XYLOLO2 -> 1*HO2 + 1*NO2 + 0.17*GLYOXAL + 0.51*CH3COCHO
    LU(i,4846) = LU(i,4846) + 0.51*rate_constant(i,404) * number_density(i,137)

    ! df_GLYOXAL/d(XYLOLO2)
    !  k_NO_XYLOLO2_1: NO + XYLOLO2 -> 1*HO2 + 1*NO2 + 0.17*GLYOXAL + 0.51*CH3COCHO
    LU(i,4853) = LU(i,4853) + 0.17*rate_constant(i,404) * number_density(i,137)
  end do
  !$acc end parallel

end subroutine dforce_dy91

subroutine dforce_dy92(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! df_HO2/d(XYLOLO2)
    !  k_HO2_XYLOLO2_1: HO2 + XYLOLO2 -> 1*XYLOLOOH
    LU(i,4905) = LU(i,4905) - rate_constant(i,357) * number_density(i,192)

    !  k_NO_XYLOLO2_1: NO + XYLOLO2 -> 1*HO2 + 1*NO2 + 0.17*GLYOXAL + 0.51*CH3COCHO
    LU(i,4905) = LU(i,4905) + rate_constant(i,404) * number_density(i,137)

    ! df_XYLOLO2/d(XYLOLO2)
    !  k_HO2_XYLOLO2_1: HO2 + XYLOLO2 -> 1*XYLOLOOH
    LU(i,4861) = LU(i,4861) - rate_constant(i,357) * number_density(i,192)

    !  k_NO_XYLOLO2_1: NO + XYLOLO2 -> 1*HO2 + 1*NO2 + 0.17*GLYOXAL + 0.51*CH3COCHO
    LU(i,4861) = LU(i,4861) - rate_constant(i,404) * number_density(i,137)

    ! df_XYLOLOOH/d(XYLOLO2)
    !  k_HO2_XYLOLO2_1: HO2 + XYLOLO2 -> 1*XYLOLOOH
    LU(i,4831) = LU(i,4831) + rate_constant(i,357) * number_density(i,192)

    ! df_ACBZO2/d(PBZNIT)
    !  k_PBZNIT_1: PBZNIT -> 1*ACBZO2 + 1*NO2
    LU(i,4906) = LU(i,4906) + rate_constant(i,29)

    ! df_NO2/d(PBZNIT)
    !  k_PBZNIT_1: PBZNIT -> 1*ACBZO2 + 1*NO2
    LU(i,4907) = LU(i,4907) + rate_constant(i,29)

    ! df_PBZNIT/d(PBZNIT)
    !  k_PBZNIT_1: PBZNIT -> 1*ACBZO2 + 1*NO2
    LU(i,4937) = LU(i,4937) - rate_constant(i,29)

    ! df_BZOO/d(XYLENES)
    !  k_OH_XYLENES_1: OH + XYLENES -> 0.15*XYLOL + 0.23*TEPOMUC + 0.06*BZOO + 0.56*XYLENO2 + 0.38*HO2
    LU(i,4278) = LU(i,4278) + 0.06*rate_constant(i,7) * number_density(i,166)

    ! df_SOAG0/d(XYLENES)
    !  k_OH_XYLENES_2: OH + XYLENES -> 1*XYLENES + 1*OH + 0.1677*SOAG0 + 0.0174*SOAG1 + 0.086*SOAG2 + 0.0512*SOAG3 + 0.1598*SOAG4
    LU(i,4273) = LU(i,4273) + 0.1677*rate_constant(i,411) * number_density(i,166)

    ! df_SOAG1/d(XYLENES)
    !  k_OH_XYLENES_2: OH + XYLENES -> 1*XYLENES + 1*OH + 0.1677*SOAG0 + 0.0174*SOAG1 + 0.086*SOAG2 + 0.0512*SOAG3 + 0.1598*SOAG4
    LU(i,4274) = LU(i,4274) + 0.0174*rate_constant(i,411) * number_density(i,166)

    ! df_SOAG2/d(XYLENES)
    !  k_OH_XYLENES_2: OH + XYLENES -> 1*XYLENES + 1*OH + 0.1677*SOAG0 + 0.0174*SOAG1 + 0.086*SOAG2 + 0.0512*SOAG3 + 0.1598*SOAG4
    LU(i,4275) = LU(i,4275) + 0.086*rate_constant(i,411) * number_density(i,166)

    ! df_SOAG3/d(XYLENES)
    !  k_OH_XYLENES_2: OH + XYLENES -> 1*XYLENES + 1*OH + 0.1677*SOAG0 + 0.0174*SOAG1 + 0.086*SOAG2 + 0.0512*SOAG3 + 0.1598*SOAG4
    LU(i,4276) = LU(i,4276) + 0.0512*rate_constant(i,411) * number_density(i,166)

    ! df_SOAG4/d(XYLENES)
    !  k_OH_XYLENES_2: OH + XYLENES -> 1*XYLENES + 1*OH + 0.1677*SOAG0 + 0.0174*SOAG1 + 0.086*SOAG2 + 0.0512*SOAG3 + 0.1598*SOAG4
    LU(i,4277) = LU(i,4277) + 0.1598*rate_constant(i,411) * number_density(i,166)

    ! df_HO2/d(XYLENES)
    !  k_OH_XYLENES_1: OH + XYLENES -> 0.15*XYLOL + 0.23*TEPOMUC + 0.06*BZOO + 0.56*XYLENO2 + 0.38*HO2
    LU(i,4355) = LU(i,4355) + 0.38*rate_constant(i,7) * number_density(i,166)

    ! df_XYLENO2/d(XYLENES)
    !  k_OH_XYLENES_1: OH + XYLENES -> 0.15*XYLOL + 0.23*TEPOMUC + 0.06*BZOO + 0.56*XYLENO2 + 0.38*HO2
    LU(i,4309) = LU(i,4309) + 0.56*rate_constant(i,7) * number_density(i,166)

    ! df_XYLENES/d(XYLENES)
    !  k_OH_XYLENES_1: OH + XYLENES -> 0.15*XYLOL + 0.23*TEPOMUC + 0.06*BZOO + 0.56*XYLENO2 + 0.38*HO2
    LU(i,4304) = LU(i,4304) - rate_constant(i,7) * number_density(i,166)

    ! df_OH/d(XYLENES)
    !  k_OH_XYLENES_1: OH + XYLENES -> 0.15*XYLOL + 0.23*TEPOMUC + 0.06*BZOO + 0.56*XYLENO2 + 0.38*HO2
    LU(i,4329) = LU(i,4329) - rate_constant(i,7) * number_density(i,166)

    ! df_XYLOL/d(XYLENES)
    !  k_OH_XYLENES_1: OH + XYLENES -> 0.15*XYLOL + 0.23*TEPOMUC + 0.06*BZOO + 0.56*XYLENO2 + 0.38*HO2
    LU(i,4272) = LU(i,4272) + 0.15*rate_constant(i,7) * number_density(i,166)

    ! df_TEPOMUC/d(XYLENES)
    !  k_OH_XYLENES_1: OH + XYLENES -> 0.15*XYLOL + 0.23*TEPOMUC + 0.06*BZOO + 0.56*XYLENO2 + 0.38*HO2
    LU(i,4271) = LU(i,4271) + 0.23*rate_constant(i,7) * number_density(i,166)

    ! df_O2/d(PO2)
    !  k_HO2_PO2_1: HO2 + PO2 -> 1*POOH + 1*O2
    LU(i,5038) = LU(i,5038) + rate_constant(i,265) * number_density(i,192)

    ! df_NO2/d(PO2)
    !  k_NO_PO2_1: NO + PO2 -> 1*CH3CHO + 1*CH2O + 1*HO2 + 1*NO2
    LU(i,5040) = LU(i,5040) + rate_constant(i,365) * number_density(i,137)

    ! df_NO/d(PO2)
    !  k_NO_PO2_1: NO + PO2 -> 1*CH3CHO + 1*CH2O + 1*HO2 + 1*NO2
    LU(i,5062) = LU(i,5062) - rate_constant(i,365) * number_density(i,137)

    ! df_CH2O/d(PO2)
    !  k_NO_PO2_1: NO + PO2 -> 1*CH3CHO + 1*CH2O + 1*HO2 + 1*NO2
    LU(i,5059) = LU(i,5059) + rate_constant(i,365) * number_density(i,137)

    ! df_HO2/d(PO2)
    !  k_HO2_PO2_1: HO2 + PO2 -> 1*POOH + 1*O2
    LU(i,5113) = LU(i,5113) - rate_constant(i,265) * number_density(i,192)

    !  k_NO_PO2_1: NO + PO2 -> 1*CH3CHO + 1*CH2O + 1*HO2 + 1*NO2
    LU(i,5113) = LU(i,5113) + rate_constant(i,365) * number_density(i,137)
  end do
  !$acc end parallel

end subroutine dforce_dy92

subroutine dforce_dy93(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! df_PO2/d(PO2)
    !  k_HO2_PO2_1: HO2 + PO2 -> 1*POOH + 1*O2
    LU(i,5072) = LU(i,5072) - rate_constant(i,265) * number_density(i,192)

    !  k_NO_PO2_1: NO + PO2 -> 1*CH3CHO + 1*CH2O + 1*HO2 + 1*NO2
    LU(i,5072) = LU(i,5072) - rate_constant(i,365) * number_density(i,137)

    ! df_CH3CHO/d(PO2)
    !  k_NO_PO2_1: NO + PO2 -> 1*CH3CHO + 1*CH2O + 1*HO2 + 1*NO2
    LU(i,5099) = LU(i,5099) + rate_constant(i,365) * number_density(i,137)

    ! df_POOH/d(PO2)
    !  k_HO2_PO2_1: HO2 + PO2 -> 1*POOH + 1*O2
    LU(i,5037) = LU(i,5037) + rate_constant(i,265) * number_density(i,192)

    ! df_BZOO/d(TOLUENE)
    !  k_OH_TOLUENE_2: OH + TOLUENE -> 0.18*CRESOL + 0.1*TEPOMUC + 0.07*BZOO + 0.65*TOLO2 + 0.28*HO2
    LU(i,2840) = LU(i,2840) + 0.07*rate_constant(i,435) * number_density(i,166)

    ! df_SOAG0/d(TOLUENE)
    !  k_OH_TOLUENE_1: OH + TOLUENE -> 1*TOLUENE + 1*OH + 0.1364*SOAG0 + 0.0101*SOAG1 + 0.0763*SOAG2 + 0.2157*SOAG3 + 0.0738*SOAG4
    LU(i,2835) = LU(i,2835) + 0.1364*rate_constant(i,55) * number_density(i,166)

    ! df_SOAG1/d(TOLUENE)
    !  k_OH_TOLUENE_1: OH + TOLUENE -> 1*TOLUENE + 1*OH + 0.1364*SOAG0 + 0.0101*SOAG1 + 0.0763*SOAG2 + 0.2157*SOAG3 + 0.0738*SOAG4
    LU(i,2836) = LU(i,2836) + 0.0101*rate_constant(i,55) * number_density(i,166)

    ! df_SOAG2/d(TOLUENE)
    !  k_OH_TOLUENE_1: OH + TOLUENE -> 1*TOLUENE + 1*OH + 0.1364*SOAG0 + 0.0101*SOAG1 + 0.0763*SOAG2 + 0.2157*SOAG3 + 0.0738*SOAG4
    LU(i,2837) = LU(i,2837) + 0.0763*rate_constant(i,55) * number_density(i,166)

    ! df_SOAG3/d(TOLUENE)
    !  k_OH_TOLUENE_1: OH + TOLUENE -> 1*TOLUENE + 1*OH + 0.1364*SOAG0 + 0.0101*SOAG1 + 0.0763*SOAG2 + 0.2157*SOAG3 + 0.0738*SOAG4
    LU(i,2838) = LU(i,2838) + 0.2157*rate_constant(i,55) * number_density(i,166)

    ! df_SOAG4/d(TOLUENE)
    !  k_OH_TOLUENE_1: OH + TOLUENE -> 1*TOLUENE + 1*OH + 0.1364*SOAG0 + 0.0101*SOAG1 + 0.0763*SOAG2 + 0.2157*SOAG3 + 0.0738*SOAG4
    LU(i,2839) = LU(i,2839) + 0.0738*rate_constant(i,55) * number_density(i,166)

    ! df_CRESOL/d(TOLUENE)
    !  k_OH_TOLUENE_2: OH + TOLUENE -> 0.18*CRESOL + 0.1*TEPOMUC + 0.07*BZOO + 0.65*TOLO2 + 0.28*HO2
    LU(i,2867) = LU(i,2867) + 0.18*rate_constant(i,435) * number_density(i,166)

    ! df_HO2/d(TOLUENE)
    !  k_OH_TOLUENE_2: OH + TOLUENE -> 0.18*CRESOL + 0.1*TEPOMUC + 0.07*BZOO + 0.65*TOLO2 + 0.28*HO2
    LU(i,2909) = LU(i,2909) + 0.28*rate_constant(i,435) * number_density(i,166)

    ! df_TOLO2/d(TOLUENE)
    !  k_OH_TOLUENE_2: OH + TOLUENE -> 0.18*CRESOL + 0.1*TEPOMUC + 0.07*BZOO + 0.65*TOLO2 + 0.28*HO2
    LU(i,2869) = LU(i,2869) + 0.65*rate_constant(i,435) * number_density(i,166)

    ! df_TOLUENE/d(TOLUENE)
    !  k_OH_TOLUENE_2: OH + TOLUENE -> 0.18*CRESOL + 0.1*TEPOMUC + 0.07*BZOO + 0.65*TOLO2 + 0.28*HO2
    LU(i,2859) = LU(i,2859) - rate_constant(i,435) * number_density(i,166)

    ! df_OH/d(TOLUENE)
    !  k_OH_TOLUENE_2: OH + TOLUENE -> 0.18*CRESOL + 0.1*TEPOMUC + 0.07*BZOO + 0.65*TOLO2 + 0.28*HO2
    LU(i,2883) = LU(i,2883) - rate_constant(i,435) * number_density(i,166)

    ! df_TEPOMUC/d(TOLUENE)
    !  k_OH_TOLUENE_2: OH + TOLUENE -> 0.18*CRESOL + 0.1*TEPOMUC + 0.07*BZOO + 0.65*TOLO2 + 0.28*HO2
    LU(i,2834) = LU(i,2834) + 0.1*rate_constant(i,435) * number_density(i,166)

    ! df_CH3CO3/d(XO2)
    !  k_CH3CO3_XO2_1: CH3CO3 + XO2 -> 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 1*CH3O2 + 1*HO2 + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD + 1*CO2
    LU(i,5189) = LU(i,5189) - rate_constant(i,106) * number_density(i,49)

    ! df_HYAC/d(XO2)
    !  k_CH3CO3_XO2_1: CH3CO3 + XO2 -> 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 1*CH3O2 + 1*HO2 + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD + 1*CO2
    LU(i,5192) = LU(i,5192) + 0.25*rate_constant(i,106) * number_density(i,49)

    !  k_NO3_XO2_1: NO3 + XO2 -> 1*NO2 + 1*HO2 + 0.5*CO + 0.25*HYAC + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*GLYALD
    LU(i,5192) = LU(i,5192) + 0.25*rate_constant(i,109) * number_density(i,165)

    !  k_NO_XO2_1: NO + XO2 -> 1*NO2 + 1*HO2 + 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD
    LU(i,5192) = LU(i,5192) + 0.25*rate_constant(i,252) * number_density(i,137)

    !  k_CH3O2_XO2_1: CH3O2 + XO2 -> 0.3*CH3OH + 0.8*HO2 + 0.8*CH2O + 0.2*CO + 0.1*GLYOXAL + 0.1*CH3COCHO + 0.1*HYAC + 0.1*GLYALD
    LU(i,5192) = LU(i,5192) + 0.1*rate_constant(i,410) * number_density(i,191)

    ! df_NO2/d(XO2)
    !  k_NO3_XO2_1: NO3 + XO2 -> 1*NO2 + 1*HO2 + 0.5*CO + 0.25*HYAC + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*GLYALD
    LU(i,5190) = LU(i,5190) + rate_constant(i,109) * number_density(i,165)

    !  k_NO_XO2_1: NO + XO2 -> 1*NO2 + 1*HO2 + 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD
    LU(i,5190) = LU(i,5190) + rate_constant(i,252) * number_density(i,137)

    ! df_NO/d(XO2)
    !  k_NO_XO2_1: NO + XO2 -> 1*NO2 + 1*HO2 + 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD
    LU(i,5213) = LU(i,5213) - rate_constant(i,252) * number_density(i,137)

    ! df_CO2/d(XO2)
    !  k_CH3CO3_XO2_1: CH3CO3 + XO2 -> 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 1*CH3O2 + 1*HO2 + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD + 1*CO2
    LU(i,5198) = LU(i,5198) + rate_constant(i,106) * number_density(i,49)

    ! df_CH3COCHO/d(XO2)
    !  k_CH3CO3_XO2_1: CH3CO3 + XO2 -> 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 1*CH3O2 + 1*HO2 + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD + 1*CO2
    LU(i,5205) = LU(i,5205) + 0.25*rate_constant(i,106) * number_density(i,49)

    !  k_NO3_XO2_1: NO3 + XO2 -> 1*NO2 + 1*HO2 + 0.5*CO + 0.25*HYAC + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*GLYALD
    LU(i,5205) = LU(i,5205) + 0.25*rate_constant(i,109) * number_density(i,165)
  end do
  !$acc end parallel

end subroutine dforce_dy93

subroutine dforce_dy94(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    !  k_NO_XO2_1: NO + XO2 -> 1*NO2 + 1*HO2 + 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD
    LU(i,5205) = LU(i,5205) + 0.25*rate_constant(i,252) * number_density(i,137)

    !  k_CH3O2_XO2_1: CH3O2 + XO2 -> 0.3*CH3OH + 0.8*HO2 + 0.8*CH2O + 0.2*CO + 0.1*GLYOXAL + 0.1*CH3COCHO + 0.1*HYAC + 0.1*GLYALD
    LU(i,5205) = LU(i,5205) + 0.1*rate_constant(i,410) * number_density(i,191)

    ! df_CH3O2/d(XO2)
    !  k_CH3CO3_XO2_1: CH3CO3 + XO2 -> 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 1*CH3O2 + 1*HO2 + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD + 1*CO2
    LU(i,5263) = LU(i,5263) + rate_constant(i,106) * number_density(i,49)

    !  k_CH3O2_XO2_1: CH3O2 + XO2 -> 0.3*CH3OH + 0.8*HO2 + 0.8*CH2O + 0.2*CO + 0.1*GLYOXAL + 0.1*CH3COCHO + 0.1*HYAC + 0.1*GLYALD
    LU(i,5263) = LU(i,5263) - rate_constant(i,410) * number_density(i,191)

    ! df_CH2O/d(XO2)
    !  k_CH3CO3_XO2_1: CH3CO3 + XO2 -> 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 1*CH3O2 + 1*HO2 + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD + 1*CO2
    LU(i,5210) = LU(i,5210) + 0.25*rate_constant(i,106) * number_density(i,49)

    !  k_NO_XO2_1: NO + XO2 -> 1*NO2 + 1*HO2 + 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD
    LU(i,5210) = LU(i,5210) + 0.25*rate_constant(i,252) * number_density(i,137)

    !  k_CH3O2_XO2_1: CH3O2 + XO2 -> 0.3*CH3OH + 0.8*HO2 + 0.8*CH2O + 0.2*CO + 0.1*GLYOXAL + 0.1*CH3COCHO + 0.1*HYAC + 0.1*GLYALD
    LU(i,5210) = LU(i,5210) + 0.8*rate_constant(i,410) * number_density(i,191)

    ! df_CH3OH/d(XO2)
    !  k_CH3O2_XO2_1: CH3O2 + XO2 -> 0.3*CH3OH + 0.8*HO2 + 0.8*CH2O + 0.2*CO + 0.1*GLYOXAL + 0.1*CH3COCHO + 0.1*HYAC + 0.1*GLYALD
    LU(i,5209) = LU(i,5209) + 0.3*rate_constant(i,410) * number_density(i,191)

    ! df_GLYOXAL/d(XO2)
    !  k_CH3CO3_XO2_1: CH3CO3 + XO2 -> 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 1*CH3O2 + 1*HO2 + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD + 1*CO2
    LU(i,5212) = LU(i,5212) + 0.25*rate_constant(i,106) * number_density(i,49)

    !  k_NO3_XO2_1: NO3 + XO2 -> 1*NO2 + 1*HO2 + 0.5*CO + 0.25*HYAC + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*GLYALD
    LU(i,5212) = LU(i,5212) + 0.25*rate_constant(i,109) * number_density(i,165)

    !  k_NO_XO2_1: NO + XO2 -> 1*NO2 + 1*HO2 + 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD
    LU(i,5212) = LU(i,5212) + 0.25*rate_constant(i,252) * number_density(i,137)

    !  k_CH3O2_XO2_1: CH3O2 + XO2 -> 0.3*CH3OH + 0.8*HO2 + 0.8*CH2O + 0.2*CO + 0.1*GLYOXAL + 0.1*CH3COCHO + 0.1*HYAC + 0.1*GLYALD
    LU(i,5212) = LU(i,5212) + 0.1*rate_constant(i,410) * number_density(i,191)

    ! df_GLYALD/d(XO2)
    !  k_CH3CO3_XO2_1: CH3CO3 + XO2 -> 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 1*CH3O2 + 1*HO2 + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD + 1*CO2
    LU(i,5228) = LU(i,5228) + 0.25*rate_constant(i,106) * number_density(i,49)

    !  k_NO3_XO2_1: NO3 + XO2 -> 1*NO2 + 1*HO2 + 0.5*CO + 0.25*HYAC + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*GLYALD
    LU(i,5228) = LU(i,5228) + 0.25*rate_constant(i,109) * number_density(i,165)

    !  k_NO_XO2_1: NO + XO2 -> 1*NO2 + 1*HO2 + 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD
    LU(i,5228) = LU(i,5228) + 0.25*rate_constant(i,252) * number_density(i,137)

    !  k_CH3O2_XO2_1: CH3O2 + XO2 -> 0.3*CH3OH + 0.8*HO2 + 0.8*CH2O + 0.2*CO + 0.1*GLYOXAL + 0.1*CH3COCHO + 0.1*HYAC + 0.1*GLYALD
    LU(i,5228) = LU(i,5228) + 0.1*rate_constant(i,410) * number_density(i,191)

    ! df_HO2/d(XO2)
    !  k_CH3CO3_XO2_1: CH3CO3 + XO2 -> 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 1*CH3O2 + 1*HO2 + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD + 1*CO2
    LU(i,5264) = LU(i,5264) + rate_constant(i,106) * number_density(i,49)

    !  k_NO3_XO2_1: NO3 + XO2 -> 1*NO2 + 1*HO2 + 0.5*CO + 0.25*HYAC + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*GLYALD
    LU(i,5264) = LU(i,5264) + rate_constant(i,109) * number_density(i,165)

    !  k_HO2_XO2_1: HO2 + XO2 -> 1*XOOH
    LU(i,5264) = LU(i,5264) - rate_constant(i,205) * number_density(i,192)

    !  k_NO_XO2_1: NO + XO2 -> 1*NO2 + 1*HO2 + 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD
    LU(i,5264) = LU(i,5264) + rate_constant(i,252) * number_density(i,137)

    !  k_CH3O2_XO2_1: CH3O2 + XO2 -> 0.3*CH3OH + 0.8*HO2 + 0.8*CH2O + 0.2*CO + 0.1*GLYOXAL + 0.1*CH3COCHO + 0.1*HYAC + 0.1*GLYALD
    LU(i,5264) = LU(i,5264) + 0.8*rate_constant(i,410) * number_density(i,191)

    ! df_XO2/d(XO2)
    !  k_CH3CO3_XO2_1: CH3CO3 + XO2 -> 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 1*CH3O2 + 1*HO2 + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD + 1*CO2
    LU(i,5225) = LU(i,5225) - rate_constant(i,106) * number_density(i,49)

    !  k_NO3_XO2_1: NO3 + XO2 -> 1*NO2 + 1*HO2 + 0.5*CO + 0.25*HYAC + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*GLYALD
    LU(i,5225) = LU(i,5225) - rate_constant(i,109) * number_density(i,165)

    !  k_HO2_XO2_1: HO2 + XO2 -> 1*XOOH
    LU(i,5225) = LU(i,5225) - rate_constant(i,205) * number_density(i,192)

    !  k_NO_XO2_1: NO + XO2 -> 1*NO2 + 1*HO2 + 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD
    LU(i,5225) = LU(i,5225) - rate_constant(i,252) * number_density(i,137)

    !  k_CH3O2_XO2_1: CH3O2 + XO2 -> 0.3*CH3OH + 0.8*HO2 + 0.8*CH2O + 0.2*CO + 0.1*GLYOXAL + 0.1*CH3COCHO + 0.1*HYAC + 0.1*GLYALD
    LU(i,5225) = LU(i,5225) - rate_constant(i,410) * number_density(i,191)

    ! df_XOOH/d(XO2)
    !  k_HO2_XO2_1: HO2 + XO2 -> 1*XOOH
    LU(i,5203) = LU(i,5203) + rate_constant(i,205) * number_density(i,192)

    ! df_NO3/d(XO2)
    !  k_NO3_XO2_1: NO3 + XO2 -> 1*NO2 + 1*HO2 + 0.5*CO + 0.25*HYAC + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*GLYALD
    LU(i,5237) = LU(i,5237) - rate_constant(i,109) * number_density(i,165)

    ! df_CO/d(XO2)
    !  k_CH3CO3_XO2_1: CH3CO3 + XO2 -> 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 1*CH3O2 + 1*HO2 + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD + 1*CO2
    LU(i,5248) = LU(i,5248) + 0.25*rate_constant(i,106) * number_density(i,49)

    !  k_NO3_XO2_1: NO3 + XO2 -> 1*NO2 + 1*HO2 + 0.5*CO + 0.25*HYAC + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*GLYALD
    LU(i,5248) = LU(i,5248) + 0.5*rate_constant(i,109) * number_density(i,165)

  end do
  !$acc end parallel

end subroutine dforce_dy94

subroutine dforce_dy95(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell
    !  k_NO_XO2_1: NO + XO2 -> 1*NO2 + 1*HO2 + 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD
    LU(i,5248) = LU(i,5248) + 0.25*rate_constant(i,252) * number_density(i,137)

    !  k_CH3O2_XO2_1: CH3O2 + XO2 -> 0.3*CH3OH + 0.8*HO2 + 0.8*CH2O + 0.2*CO + 0.1*GLYOXAL + 0.1*CH3COCHO + 0.1*HYAC + 0.1*GLYALD
    LU(i,5248) = LU(i,5248) + 0.2*rate_constant(i,410) * number_density(i,191)

    ! df_XO2/d(XOOH)
    !  k_OH_XOOH_1: OH + XOOH -> 0.5*XO2 + 0.5*OH
    LU(i,2094) = LU(i,2094) + 0.5*rate_constant(i,185) * number_density(i,166)

    ! df_XOOH/d(XOOH)
    !  k_XOOH_1: XOOH -> 1*OH
    LU(i,2093) = LU(i,2093) - rate_constant(i,177)

    !  k_OH_XOOH_1: OH + XOOH -> 0.5*XO2 + 0.5*OH
    LU(i,2093) = LU(i,2093) - rate_constant(i,185) * number_density(i,166)

    ! df_OH/d(XOOH)
    !  k_XOOH_1: XOOH -> 1*OH
    LU(i,2095) = LU(i,2095) + rate_constant(i,177)

    !  k_OH_XOOH_1: OH + XOOH -> 0.5*XO2 + 0.5*OH
    LU(i,2095) = LU(i,2095) - 0.5*rate_constant(i,185) * number_density(i,166)

    ! df_RO2/d(TERPROD2)
    !  k_TERPROD2_1: TERPROD2 -> 0.15*RO2 + 0.68*CH2O + 0.8*CO2 + 0.5*CH3COCH3 + 0.65*CH3CO3 + 1.2*HO2 + 1.7*CO
    LU(i,5339) = LU(i,5339) + 0.15*rate_constant(i,35)

    !  k_OH_TERPROD2_1: OH + TERPROD2 -> 0.15*RO2 + 0.68*CH2O + 1.8*CO2 + 0.5*CH3COCH3 + 0.65*CH3CO3 + 0.2*HO2 + 0.7*CO
    LU(i,5339) = LU(i,5339) + 0.15*rate_constant(i,397) * number_density(i,166)

    ! df_CH3CO3/d(TERPROD2)
    !  k_TERPROD2_1: TERPROD2 -> 0.15*RO2 + 0.68*CH2O + 0.8*CO2 + 0.5*CH3COCH3 + 0.65*CH3CO3 + 1.2*HO2 + 1.7*CO
    LU(i,5340) = LU(i,5340) + 0.65*rate_constant(i,35)

    !  k_OH_TERPROD2_1: OH + TERPROD2 -> 0.15*RO2 + 0.68*CH2O + 1.8*CO2 + 0.5*CH3COCH3 + 0.65*CH3CO3 + 0.2*HO2 + 0.7*CO
    LU(i,5340) = LU(i,5340) + 0.65*rate_constant(i,397) * number_density(i,166)

    ! df_CO2/d(TERPROD2)
    !  k_TERPROD2_1: TERPROD2 -> 0.15*RO2 + 0.68*CH2O + 0.8*CO2 + 0.5*CH3COCH3 + 0.65*CH3CO3 + 1.2*HO2 + 1.7*CO
    LU(i,5349) = LU(i,5349) + 0.8*rate_constant(i,35)

    !  k_OH_TERPROD2_1: OH + TERPROD2 -> 0.15*RO2 + 0.68*CH2O + 1.8*CO2 + 0.5*CH3COCH3 + 0.65*CH3CO3 + 0.2*HO2 + 0.7*CO
    LU(i,5349) = LU(i,5349) + 1.8*rate_constant(i,397) * number_density(i,166)

    ! df_CH3COCH3/d(TERPROD2)
    !  k_TERPROD2_1: TERPROD2 -> 0.15*RO2 + 0.68*CH2O + 0.8*CO2 + 0.5*CH3COCH3 + 0.65*CH3CO3 + 1.2*HO2 + 1.7*CO
    LU(i,5352) = LU(i,5352) + 0.5*rate_constant(i,35)

    !  k_OH_TERPROD2_1: OH + TERPROD2 -> 0.15*RO2 + 0.68*CH2O + 1.8*CO2 + 0.5*CH3COCH3 + 0.65*CH3CO3 + 0.2*HO2 + 0.7*CO
    LU(i,5352) = LU(i,5352) + 0.5*rate_constant(i,397) * number_density(i,166)

    ! df_CH2O/d(TERPROD2)
    !  k_TERPROD2_1: TERPROD2 -> 0.15*RO2 + 0.68*CH2O + 0.8*CO2 + 0.5*CH3COCH3 + 0.65*CH3CO3 + 1.2*HO2 + 1.7*CO
    LU(i,5362) = LU(i,5362) + 0.68*rate_constant(i,35)

    !  k_OH_TERPROD2_1: OH + TERPROD2 -> 0.15*RO2 + 0.68*CH2O + 1.8*CO2 + 0.5*CH3COCH3 + 0.65*CH3CO3 + 0.2*HO2 + 0.7*CO
    LU(i,5362) = LU(i,5362) + 0.68*rate_constant(i,397) * number_density(i,166)

    ! df_HO2/d(TERPROD2)
    !  k_TERPROD2_1: TERPROD2 -> 0.15*RO2 + 0.68*CH2O + 0.8*CO2 + 0.5*CH3COCH3 + 0.65*CH3CO3 + 1.2*HO2 + 1.7*CO
    LU(i,5416) = LU(i,5416) + 1.2*rate_constant(i,35)

    !  k_OH_TERPROD2_1: OH + TERPROD2 -> 0.15*RO2 + 0.68*CH2O + 1.8*CO2 + 0.5*CH3COCH3 + 0.65*CH3CO3 + 0.2*HO2 + 0.7*CO
    LU(i,5416) = LU(i,5416) + 0.2*rate_constant(i,397) * number_density(i,166)

    ! df_TERPROD2/d(TERPROD2)
    !  k_TERPROD2_1: TERPROD2 -> 0.15*RO2 + 0.68*CH2O + 0.8*CO2 + 0.5*CH3COCH3 + 0.65*CH3CO3 + 1.2*HO2 + 1.7*CO
    LU(i,5379) = LU(i,5379) - rate_constant(i,35)

    !  k_OH_TERPROD2_1: OH + TERPROD2 -> 0.15*RO2 + 0.68*CH2O + 1.8*CO2 + 0.5*CH3COCH3 + 0.65*CH3CO3 + 0.2*HO2 + 0.7*CO
    LU(i,5379) = LU(i,5379) - rate_constant(i,397) * number_density(i,166)

    ! df_OH/d(TERPROD2)
    !  k_OH_TERPROD2_1: OH + TERPROD2 -> 0.15*RO2 + 0.68*CH2O + 1.8*CO2 + 0.5*CH3COCH3 + 0.65*CH3CO3 + 0.2*HO2 + 0.7*CO
    LU(i,5390) = LU(i,5390) - rate_constant(i,397) * number_density(i,166)

    ! df_CO/d(TERPROD2)
    !  k_TERPROD2_1: TERPROD2 -> 0.15*RO2 + 0.68*CH2O + 0.8*CO2 + 0.5*CH3COCH3 + 0.65*CH3CO3 + 1.2*HO2 + 1.7*CO
    LU(i,5400) = LU(i,5400) + 1.7*rate_constant(i,35)

    !  k_OH_TERPROD2_1: OH + TERPROD2 -> 0.15*RO2 + 0.68*CH2O + 1.8*CO2 + 0.5*CH3COCH3 + 0.65*CH3CO3 + 0.2*HO2 + 0.7*CO
    LU(i,5400) = LU(i,5400) + 0.7*rate_constant(i,397) * number_density(i,166)

    ! df_CH3CO3/d(MEKOOH)
    !  k_MEKOOH_1: MEKOOH -> 1*OH + 1*CH3CO3 + 1*CH3CHO
    LU(i,3933) = LU(i,3933) + rate_constant(i,89)

    ! df_MEKO2/d(MEKOOH)
    !  k_MEKOOH_OH_1: MEKOOH + OH -> 1*MEKO2
    LU(i,3955) = LU(i,3955) + rate_constant(i,352) * number_density(i,166)

    ! df_MEKOOH/d(MEKOOH)
    !  k_MEKOOH_1: MEKOOH -> 1*OH + 1*CH3CO3 + 1*CH3CHO
    LU(i,3957) = LU(i,3957) - rate_constant(i,89)

    !  k_MEKOOH_OH_1: MEKOOH + OH -> 1*MEKO2
    LU(i,3957) = LU(i,3957) - rate_constant(i,352) * number_density(i,166)

    ! df_OH/d(MEKOOH)
    !  k_MEKOOH_1: MEKOOH -> 1*OH + 1*CH3CO3 + 1*CH3CHO
    LU(i,3975) = LU(i,3975) + rate_constant(i,89)
  end do
  !$acc end parallel

end subroutine dforce_dy95

subroutine dforce_dy96(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    !  k_MEKOOH_OH_1: MEKOOH + OH -> 1*MEKO2
    LU(i,3975) = LU(i,3975) - rate_constant(i,352) * number_density(i,166)

    ! df_CH3CHO/d(MEKOOH)
    !  k_MEKOOH_1: MEKOOH -> 1*OH + 1*CH3CO3 + 1*CH3CHO
    LU(i,3987) = LU(i,3987) + rate_constant(i,89)

    ! df_CH3CO3/d(MACR)
    !  k_MACR_O3_1: MACR + O3 -> 0.12*CH2O + 0.24*OH + 0.65*CO + 0.1*CH3CO3 + 0.88*CH3COCHO + 0.33*HCOOH + 0.14*HO2
    LU(i,5473) = LU(i,5473) + 0.1*rate_constant(i,101) * number_density(i,171)

    !  k_MACR_2: MACR -> 1.34*HO2 + 0.66*MCO3 + 1.34*CH2O + 1.34*CH3CO3
    LU(i,5473) = LU(i,5473) + 1.34*rate_constant(i,272)

    ! df_H2O/d(MACR)
    !  k_MACR_OH_1: MACR + OH -> 0.5*MACRO2 + 0.5*H2O + 0.5*MCO3
    LU(i,5477) = LU(i,5477) + 0.5*rate_constant(i,220) * number_density(i,166)

    ! df_HCOOH/d(MACR)
    !  k_MACR_O3_1: MACR + O3 -> 0.12*CH2O + 0.24*OH + 0.65*CO + 0.1*CH3CO3 + 0.88*CH3COCHO + 0.33*HCOOH + 0.14*HO2
    LU(i,5490) = LU(i,5490) + 0.33*rate_constant(i,101) * number_density(i,171)

    ! df_CH3COCHO/d(MACR)
    !  k_MACR_O3_1: MACR + O3 -> 0.12*CH2O + 0.24*OH + 0.65*CO + 0.1*CH3CO3 + 0.88*CH3COCHO + 0.33*HCOOH + 0.14*HO2
    LU(i,5488) = LU(i,5488) + 0.88*rate_constant(i,101) * number_density(i,171)

    ! df_CH2O/d(MACR)
    !  k_MACR_O3_1: MACR + O3 -> 0.12*CH2O + 0.24*OH + 0.65*CO + 0.1*CH3CO3 + 0.88*CH3COCHO + 0.33*HCOOH + 0.14*HO2
    LU(i,5493) = LU(i,5493) + 0.12*rate_constant(i,101) * number_density(i,171)

    !  k_MACR_2: MACR -> 1.34*HO2 + 0.66*MCO3 + 1.34*CH2O + 1.34*CH3CO3
    LU(i,5493) = LU(i,5493) + 1.34*rate_constant(i,272)

    ! df_MACRO2/d(MACR)
    !  k_MACR_OH_1: MACR + OH -> 0.5*MACRO2 + 0.5*H2O + 0.5*MCO3
    LU(i,5543) = LU(i,5543) + 0.5*rate_constant(i,220) * number_density(i,166)

    ! df_MCO3/d(MACR)
    !  k_MACR_OH_1: MACR + OH -> 0.5*MACRO2 + 0.5*H2O + 0.5*MCO3
    LU(i,5522) = LU(i,5522) + 0.5*rate_constant(i,220) * number_density(i,166)

    !  k_MACR_2: MACR -> 1.34*HO2 + 0.66*MCO3 + 1.34*CH2O + 1.34*CH3CO3
    LU(i,5522) = LU(i,5522) + 0.66*rate_constant(i,272)

    ! df_HO2/d(MACR)
    !  k_MACR_O3_1: MACR + O3 -> 0.12*CH2O + 0.24*OH + 0.65*CO + 0.1*CH3CO3 + 0.88*CH3COCHO + 0.33*HCOOH + 0.14*HO2
    LU(i,5547) = LU(i,5547) + 0.14*rate_constant(i,101) * number_density(i,171)

    !  k_MACR_1: MACR -> 0.66*HO2 + 1.34*CO
    LU(i,5547) = LU(i,5547) + 0.66*rate_constant(i,138)

    !  k_MACR_2: MACR -> 1.34*HO2 + 0.66*MCO3 + 1.34*CH2O + 1.34*CH3CO3
    LU(i,5547) = LU(i,5547) + 1.34*rate_constant(i,272)

    ! df_MACR/d(MACR)
    !  k_MACR_O3_1: MACR + O3 -> 0.12*CH2O + 0.24*OH + 0.65*CO + 0.1*CH3CO3 + 0.88*CH3COCHO + 0.33*HCOOH + 0.14*HO2
    LU(i,5512) = LU(i,5512) - rate_constant(i,101) * number_density(i,171)

    !  k_MACR_1: MACR -> 0.66*HO2 + 1.34*CO
    LU(i,5512) = LU(i,5512) - rate_constant(i,138)

    !  k_MACR_OH_1: MACR + OH -> 0.5*MACRO2 + 0.5*H2O + 0.5*MCO3
    LU(i,5512) = LU(i,5512) - rate_constant(i,220) * number_density(i,166)

    !  k_MACR_2: MACR -> 1.34*HO2 + 0.66*MCO3 + 1.34*CH2O + 1.34*CH3CO3
    LU(i,5512) = LU(i,5512) - rate_constant(i,272)

    ! df_OH/d(MACR)
    !  k_MACR_O3_1: MACR + O3 -> 0.12*CH2O + 0.24*OH + 0.65*CO + 0.1*CH3CO3 + 0.88*CH3COCHO + 0.33*HCOOH + 0.14*HO2
    LU(i,5521) = LU(i,5521) + 0.24*rate_constant(i,101) * number_density(i,171)

    !  k_MACR_OH_1: MACR + OH -> 0.5*MACRO2 + 0.5*H2O + 0.5*MCO3
    LU(i,5521) = LU(i,5521) - rate_constant(i,220) * number_density(i,166)

    ! df_O3/d(MACR)
    !  k_MACR_O3_1: MACR + O3 -> 0.12*CH2O + 0.24*OH + 0.65*CO + 0.1*CH3CO3 + 0.88*CH3COCHO + 0.33*HCOOH + 0.14*HO2
    LU(i,5526) = LU(i,5526) - rate_constant(i,101) * number_density(i,171)

    ! df_CO/d(MACR)
    !  k_MACR_O3_1: MACR + O3 -> 0.12*CH2O + 0.24*OH + 0.65*CO + 0.1*CH3CO3 + 0.88*CH3COCHO + 0.33*HCOOH + 0.14*HO2
    LU(i,5531) = LU(i,5531) + 0.65*rate_constant(i,101) * number_density(i,171)

    !  k_MACR_1: MACR -> 0.66*HO2 + 1.34*CO
    LU(i,5531) = LU(i,5531) + 1.34*rate_constant(i,138)

    ! df_CH3CO3/d(HONITR)
    !  k_HONITR_1: HONITR -> 1*NO2 + 0.67*HO2 + 0.33*CH3CHO + 0.33*CH2O + 0.33*CO + 0.33*GLYALD + 0.33*CH3CO3 + 0.17*HYAC + 0.17*CH3COCH3
    LU(i,3794) = LU(i,3794) + 0.33*rate_constant(i,171)

    ! df_HYAC/d(HONITR)
    !  k_HONITR_1: HONITR -> 1*NO2 + 0.67*HO2 + 0.33*CH3CHO + 0.33*CH2O + 0.33*CO + 0.33*GLYALD + 0.33*CH3CO3 + 0.17*HYAC + 0.17*CH3COCH3
    LU(i,3797) = LU(i,3797) + 0.17*rate_constant(i,171)

    ! df_NO2/d(HONITR)
    !  k_HONITR_1: HONITR -> 1*NO2 + 0.67*HO2 + 0.33*CH3CHO + 0.33*CH2O + 0.33*CO + 0.33*GLYALD + 0.33*CH3CO3 + 0.17*HYAC + 0.17*CH3COCH3
    LU(i,3795) = LU(i,3795) + rate_constant(i,171)

    ! df_CH3COCH3/d(HONITR)
    !  k_HONITR_1: HONITR -> 1*NO2 + 0.67*HO2 + 0.33*CH3CHO + 0.33*CH2O + 0.33*CO + 0.33*GLYALD + 0.33*CH3CO3 + 0.17*HYAC + 0.17*CH3COCH3
    LU(i,3806) = LU(i,3806) + 0.17*rate_constant(i,171)
  end do
  !$acc end parallel

end subroutine dforce_dy96

subroutine dforce_dy97(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! df_CH2O/d(HONITR)
    !  k_HONITR_1: HONITR -> 1*NO2 + 0.67*HO2 + 0.33*CH3CHO + 0.33*CH2O + 0.33*CO + 0.33*GLYALD + 0.33*CH3CO3 + 0.17*HYAC + 0.17*CH3COCH3
    LU(i,3816) = LU(i,3816) + 0.33*rate_constant(i,171)

    ! df_GLYALD/d(HONITR)
    !  k_HONITR_1: HONITR -> 1*NO2 + 0.67*HO2 + 0.33*CH3CHO + 0.33*CH2O + 0.33*CO + 0.33*GLYALD + 0.33*CH3CO3 + 0.17*HYAC + 0.17*CH3COCH3
    LU(i,3828) = LU(i,3828) + 0.33*rate_constant(i,171)

    ! df_HO2/d(HONITR)
    !  k_HONITR_OH_1: HONITR + OH -> 1*ONITR + 1*HO2
    LU(i,3864) = LU(i,3864) + rate_constant(i,26) * number_density(i,166)

    !  k_HONITR_1: HONITR -> 1*NO2 + 0.67*HO2 + 0.33*CH3CHO + 0.33*CH2O + 0.33*CO + 0.33*GLYALD + 0.33*CH3CO3 + 0.17*HYAC + 0.17*CH3COCH3
    LU(i,3864) = LU(i,3864) + 0.67*rate_constant(i,171)

    ! df_HONITR/d(HONITR)
    !  k_HONITR_OH_1: HONITR + OH -> 1*ONITR + 1*HO2
    LU(i,3820) = LU(i,3820) - rate_constant(i,26) * number_density(i,166)

    !  k_HONITR_1: HONITR -> 1*NO2 + 0.67*HO2 + 0.33*CH3CHO + 0.33*CH2O + 0.33*CO + 0.33*GLYALD + 0.33*CH3CO3 + 0.17*HYAC + 0.17*CH3COCH3
    LU(i,3820) = LU(i,3820) - rate_constant(i,171)

    ! df_ONITR/d(HONITR)
    !  k_HONITR_OH_1: HONITR + OH -> 1*ONITR + 1*HO2
    LU(i,3818) = LU(i,3818) + rate_constant(i,26) * number_density(i,166)

    ! df_OH/d(HONITR)
    !  k_HONITR_OH_1: HONITR + OH -> 1*ONITR + 1*HO2
    LU(i,3838) = LU(i,3838) - rate_constant(i,26) * number_density(i,166)

    ! df_CO/d(HONITR)
    !  k_HONITR_1: HONITR -> 1*NO2 + 0.67*HO2 + 0.33*CH3CHO + 0.33*CH2O + 0.33*CO + 0.33*GLYALD + 0.33*CH3CO3 + 0.17*HYAC + 0.17*CH3COCH3
    LU(i,3848) = LU(i,3848) + 0.33*rate_constant(i,171)

    ! df_CH3CHO/d(HONITR)
    !  k_HONITR_1: HONITR -> 1*NO2 + 0.67*HO2 + 0.33*CH3CHO + 0.33*CH2O + 0.33*CO + 0.33*GLYALD + 0.33*CH3CO3 + 0.17*HYAC + 0.17*CH3COCH3
    LU(i,3850) = LU(i,3850) + 0.33*rate_constant(i,171)

    ! df_HYAC/d(ISOPNITA)
    !  k_ISOPNITA_OH_1: ISOPNITA + OH -> 0.7*HYAC + 0.7*GLYALD + 0.7*NO2 + 0.3*CH2O + 0.3*HONITR + 0.3*HO2
    LU(i,2912) = LU(i,2912) + 0.7*rate_constant(i,364) * number_density(i,166)

    ! df_NO2/d(ISOPNITA)
    !  k_ISOPNITA_OH_1: ISOPNITA + OH -> 0.7*HYAC + 0.7*GLYALD + 0.7*NO2 + 0.3*CH2O + 0.3*HONITR + 0.3*HO2
    LU(i,2910) = LU(i,2910) + 0.7*rate_constant(i,364) * number_density(i,166)

    ! df_CH2O/d(ISOPNITA)
    !  k_ISOPNITA_OH_1: ISOPNITA + OH -> 0.7*HYAC + 0.7*GLYALD + 0.7*NO2 + 0.3*CH2O + 0.3*HONITR + 0.3*HO2
    LU(i,2930) = LU(i,2930) + 0.3*rate_constant(i,364) * number_density(i,166)

    ! df_GLYALD/d(ISOPNITA)
    !  k_ISOPNITA_OH_1: ISOPNITA + OH -> 0.7*HYAC + 0.7*GLYALD + 0.7*NO2 + 0.3*CH2O + 0.3*HONITR + 0.3*HO2
    LU(i,2939) = LU(i,2939) + 0.7*rate_constant(i,364) * number_density(i,166)

    ! df_HO2/d(ISOPNITA)
    !  k_ISOPNITA_OH_1: ISOPNITA + OH -> 0.7*HYAC + 0.7*GLYALD + 0.7*NO2 + 0.3*CH2O + 0.3*HONITR + 0.3*HO2
    LU(i,2975) = LU(i,2975) + 0.3*rate_constant(i,364) * number_density(i,166)

    ! df_HONITR/d(ISOPNITA)
    !  k_ISOPNITA_OH_1: ISOPNITA + OH -> 0.7*HYAC + 0.7*GLYALD + 0.7*NO2 + 0.3*CH2O + 0.3*HONITR + 0.3*HO2
    LU(i,2933) = LU(i,2933) + 0.3*rate_constant(i,364) * number_density(i,166)

    ! df_ISOPNITA/d(ISOPNITA)
    !  k_ISOPNITA_OH_1: ISOPNITA + OH -> 0.7*HYAC + 0.7*GLYALD + 0.7*NO2 + 0.3*CH2O + 0.3*HONITR + 0.3*HO2
    LU(i,2926) = LU(i,2926) - rate_constant(i,364) * number_density(i,166)

    ! df_OH/d(ISOPNITA)
    !  k_ISOPNITA_OH_1: ISOPNITA + OH -> 0.7*HYAC + 0.7*GLYALD + 0.7*NO2 + 0.3*CH2O + 0.3*HONITR + 0.3*HO2
    LU(i,2949) = LU(i,2949) - rate_constant(i,364) * number_density(i,166)

    ! df_NO2/d(ISOPNOOH)
    !  k_ISOPNOOH_1: ISOPNOOH -> 1*NO2 + 1*HO2 + 1*ISOPOOH
    LU(i,5700) = LU(i,5700) + rate_constant(i,297)

    ! df_ISOPOOH/d(ISOPNOOH)
    !  k_ISOPNOOH_1: ISOPNOOH -> 1*NO2 + 1*HO2 + 1*ISOPOOH
    LU(i,5723) = LU(i,5723) + rate_constant(i,297)

    ! df_HO2/d(ISOPNOOH)
    !  k_ISOPNOOH_OH_1: ISOPNOOH + OH -> 1*NOA + 1*HO2
    LU(i,5774) = LU(i,5774) + rate_constant(i,271) * number_density(i,166)

    !  k_ISOPNOOH_1: ISOPNOOH -> 1*NO2 + 1*HO2 + 1*ISOPOOH
    LU(i,5774) = LU(i,5774) + rate_constant(i,297)

    ! df_ISOPNOOH/d(ISOPNOOH)
    !  k_ISOPNOOH_OH_1: ISOPNOOH + OH -> 1*NOA + 1*HO2
    LU(i,5742) = LU(i,5742) - rate_constant(i,271) * number_density(i,166)

    !  k_ISOPNOOH_1: ISOPNOOH -> 1*NO2 + 1*HO2 + 1*ISOPOOH
    LU(i,5742) = LU(i,5742) - rate_constant(i,297)

    ! df_OH/d(ISOPNOOH)
    !  k_ISOPNOOH_OH_1: ISOPNOOH + OH -> 1*NOA + 1*HO2
    LU(i,5748) = LU(i,5748) - rate_constant(i,271) * number_density(i,166)

    ! df_NOA/d(ISOPNOOH)
    !  k_ISOPNOOH_OH_1: ISOPNOOH + OH -> 1*NOA + 1*HO2
    LU(i,5698) = LU(i,5698) + rate_constant(i,271) * number_density(i,166)

  end do
  !$acc end parallel

end subroutine dforce_dy97

subroutine dforce_dy98(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
