  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell
    ! df_XO2/d(IEPOX)
    !  k_IEPOX_OH_1: IEPOX + OH -> 1*XO2
    LU(i,892) = LU(i,892) + rate_constant(i,190) * number_density(i,166)

    ! df_IEPOX/d(IEPOX)
    !  k_IEPOX_OH_1: IEPOX + OH -> 1*XO2
