    ! df_OH/d(IEPOX)
    !  k_IEPOX_OH_1: IEPOX + OH -> 1*XO2
    LU(i,893) = LU(i,893) - rate_constant(i,190) * number_density(i,166)

    ! df_NO2/d(ONITR)
    !  k_ONITR_1: ONITR -> 1*NO2
    LU(i,3524) = LU(i,3524) + rate_constant(i,216)

    ! df_ONITR/d(ONITR)
    !  k_ONITR_1: ONITR -> 1*NO2
    LU(i,3545) = LU(i,3545) - rate_constant(i,216)

    ! df_HCOOH/d(MBO)
    !  k_MBO_O3_1: MBO + O3 -> 0.7*HMPROP + 0.64*CO + 0.36*OH + 0.48*HO2 + 0.17*HCOOH + 0.3*CH2O + 0.23*CH3COCH3
    LU(i,3398) = LU(i,3398) + 0.17*rate_constant(i,228) * number_density(i,171)

    ! df_CH3COCH3/d(MBO)
    !  k_MBO_O3_1: MBO + O3 -> 0.7*HMPROP + 0.64*CO + 0.36*OH + 0.48*HO2 + 0.17*HCOOH + 0.3*CH2O + 0.23*CH3COCH3
    LU(i,3392) = LU(i,3392) + 0.23*rate_constant(i,228) * number_density(i,171)

    ! df_CH2O/d(MBO)
    !  k_MBO_O3_1: MBO + O3 -> 0.7*HMPROP + 0.64*CO + 0.36*OH + 0.48*HO2 + 0.17*HCOOH + 0.3*CH2O + 0.23*CH3COCH3
    LU(i,3403) = LU(i,3403) + 0.3*rate_constant(i,228) * number_density(i,171)

    ! df_MBONO3O2/d(MBO)
    !  k_MBO_NO3_1: MBO + NO3 -> 1*MBONO3O2
    LU(i,3402) = LU(i,3402) + rate_constant(i,11) * number_density(i,165)

    ! df_MBOO2/d(MBO)
    !  k_MBO_OH_1: MBO + OH -> 1*MBOO2
    LU(i,3404) = LU(i,3404) + rate_constant(i,191) * number_density(i,166)

    ! df_HMPROP/d(MBO)
    !  k_MBO_O3_1: MBO + O3 -> 0.7*HMPROP + 0.64*CO + 0.36*OH + 0.48*HO2 + 0.17*HCOOH + 0.3*CH2O + 0.23*CH3COCH3
    LU(i,3408) = LU(i,3408) + 0.7*rate_constant(i,228) * number_density(i,171)

    ! df_HO2/d(MBO)
    !  k_MBO_O3_1: MBO + O3 -> 0.7*HMPROP + 0.64*CO + 0.36*OH + 0.48*HO2 + 0.17*HCOOH + 0.3*CH2O + 0.23*CH3COCH3
    LU(i,3454) = LU(i,3454) + 0.48*rate_constant(i,228) * number_density(i,171)

    ! df_MBO/d(MBO)
    !  k_MBO_NO3_1: MBO + NO3 -> 1*MBONO3O2
    LU(i,3406) = LU(i,3406) - rate_constant(i,11) * number_density(i,165)

    !  k_MBO_OH_1: MBO + OH -> 1*MBOO2
    LU(i,3406) = LU(i,3406) - rate_constant(i,191) * number_density(i,166)

    !  k_MBO_O3_1: MBO + O3 -> 0.7*HMPROP + 0.64*CO + 0.36*OH + 0.48*HO2 + 0.17*HCOOH + 0.3*CH2O + 0.23*CH3COCH3
    LU(i,3406) = LU(i,3406) - rate_constant(i,228) * number_density(i,171)

    ! df_NO3/d(MBO)
    !  k_MBO_NO3_1: MBO + NO3 -> 1*MBONO3O2
    LU(i,3427) = LU(i,3427) - rate_constant(i,11) * number_density(i,165)

    ! df_OH/d(MBO)
    !  k_MBO_OH_1: MBO + OH -> 1*MBOO2
    LU(i,3428) = LU(i,3428) - rate_constant(i,191) * number_density(i,166)

    !  k_MBO_O3_1: MBO + O3 -> 0.7*HMPROP + 0.64*CO + 0.36*OH + 0.48*HO2 + 0.17*HCOOH + 0.3*CH2O + 0.23*CH3COCH3
    LU(i,3428) = LU(i,3428) + 0.36*rate_constant(i,228) * number_density(i,171)

    ! df_O3/d(MBO)
    !  k_MBO_O3_1: MBO + O3 -> 0.7*HMPROP + 0.64*CO + 0.36*OH + 0.48*HO2 + 0.17*HCOOH + 0.3*CH2O + 0.23*CH3COCH3
    LU(i,3433) = LU(i,3433) - rate_constant(i,228) * number_density(i,171)

    ! df_CO/d(MBO)
    !  k_MBO_O3_1: MBO + O3 -> 0.7*HMPROP + 0.64*CO + 0.36*OH + 0.48*HO2 + 0.17*HCOOH + 0.3*CH2O + 0.23*CH3COCH3
    LU(i,3438) = LU(i,3438) + 0.64*rate_constant(i,228) * number_density(i,171)

    ! df_O2/d(NO3)
    !  k_NO3_O_1: NO3 + O -> 1*NO2 + 1*O2
    LU(i,6084) = LU(i,6084) + rate_constant(i,129) * number_density(i,187)

    !  k_NO3_2: NO3 -> 1*NO + 1*O2
    LU(i,6084) = LU(i,6084) + rate_constant(i,374)

    !  k_HO2_NO3_1: HO2 + NO3 -> 1*OH + 1*NO2 + 1*O2
    LU(i,6084) = LU(i,6084) + rate_constant(i,454) * number_density(i,192)

    ! df_MVK/d(NO3)
    !  k_ISOPAO2_NO3_1: ISOPAO2 + NO3 -> 1*NO2 + 0.4*MACR + 0.6*MVK + 1*CH2O + 1*HO2
    LU(i,6080) = LU(i,6080) + 0.6*rate_constant(i,330) * number_density(i,189)

    ! df_SOAG3/d(NO3)
    !  k_MTERP_NO3_2: MTERP + NO3 -> 1*MTERP + 1*NO3 + 0.17493*SOAG3 + 0.59019*SOAG4
    LU(i,6077) = LU(i,6077) + 0.17493*rate_constant(i,173) * number_density(i,31)

    !  k_ISOP_NO3_1: ISOP + NO3 -> 1*ISOP + 1*NO3 + 0.059024*SOAG3 + 0.025024*SOAG4
    LU(i,6077) = LU(i,6077) + 0.059024*rate_constant(i,346) * number_density(i,142)

    !  k_BCARY_NO3_2: BCARY + NO3 -> 1*BCARY + 1*NO3 + 0.17493*SOAG3 + 0.59019*SOAG4
    LU(i,6077) = LU(i,6077) + 0.17493*rate_constant(i,358) * number_density(i,102)

  end do
  !$acc end parallel

end subroutine dforce_dy98

subroutine dforce_dy99(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell
    ! df_SOAG4/d(NO3)
    !  k_MTERP_NO3_2: MTERP + NO3 -> 1*MTERP + 1*NO3 + 0.17493*SOAG3 + 0.59019*SOAG4
    LU(i,6078) = LU(i,6078) + 0.59019*rate_constant(i,173) * number_density(i,31)

    !  k_ISOP_NO3_1: ISOP + NO3 -> 1*ISOP + 1*NO3 + 0.059024*SOAG3 + 0.025024*SOAG4
    LU(i,6078) = LU(i,6078) + 0.025024*rate_constant(i,346) * number_density(i,142)

    !  k_BCARY_NO3_2: BCARY + NO3 -> 1*BCARY + 1*NO3 + 0.17493*SOAG3 + 0.59019*SOAG4
    LU(i,6078) = LU(i,6078) + 0.59019*rate_constant(i,358) * number_density(i,102)

    ! df_MTERP/d(NO3)
    !  k_MTERP_NO3_1: MTERP + NO3 -> 1*NTERPO2
    LU(i,6082) = LU(i,6082) - rate_constant(i,111) * number_density(i,31)

    ! df_N2O5/d(NO3)
    !  k_NO2_NO3_1: NO2 + NO3 -> 1*N2O5
    LU(i,6089) = LU(i,6089) + rate_constant(i,481) * number_density(i,54)

    ! df_ISOPNO3/d(NO3)
    !  k_ISOP_NO3_2: ISOP + NO3 -> 1*ISOPNO3
    LU(i,6086) = LU(i,6086) + rate_constant(i,385) * number_density(i,142)

    !  k_ISOPNO3_NO3_1: ISOPNO3 + NO3 -> 1*NC4CHO + 1*NO2 + 1*HO2
    LU(i,6086) = LU(i,6086) - rate_constant(i,451) * number_density(i,46)

    ! df_HNO3/d(NO3)
    !  k_CH3CHO_NO3_1: CH3CHO + NO3 -> 1*CH3CO3 + 1*HNO3
    LU(i,6085) = LU(i,6085) + rate_constant(i,34) * number_density(i,178)

    !  k_DMS_NO3_1: DMS + NO3 -> 1*SO2 + 1*HNO3
    LU(i,6085) = LU(i,6085) + rate_constant(i,197) * number_density(i,99)

    !  k_CH3COCHO_NO3_1: CH3COCHO + NO3 -> 1*HNO3 + 1*CO + 1*CH3CO3
    LU(i,6085) = LU(i,6085) + rate_constant(i,405) * number_density(i,111)

    !  k_CH2O_NO3_1: CH2O + NO3 -> 1*CO + 1*HO2 + 1*HNO3
    LU(i,6085) = LU(i,6085) + rate_constant(i,423) * number_density(i,124)

    ! df_SO2/d(NO3)
    !  k_DMS_NO3_1: DMS + NO3 -> 1*SO2 + 1*HNO3
    LU(i,6091) = LU(i,6091) + rate_constant(i,197) * number_density(i,99)

    ! df_CH3CO3/d(NO3)
    !  k_CH3CHO_NO3_1: CH3CHO + NO3 -> 1*CH3CO3 + 1*HNO3
    LU(i,6088) = LU(i,6088) + rate_constant(i,34) * number_density(i,178)

    !  k_MACRO2_NO3_1: MACRO2 + NO3 -> 1*NO2 + 0.47*HO2 + 0.25*CH2O + 0.25*CH3COCHO + 0.22*CO + 0.53*GLYALD + 0.22*HYAC + 0.53*CH3CO3
    LU(i,6088) = LU(i,6088) + 0.53*rate_constant(i,134) * number_density(i,188)

    !  k_MCO3_NO3_1: MCO3 + NO3 -> 1*NO2 + 1*CH2O + 1*CH3CO3
    LU(i,6088) = LU(i,6088) + rate_constant(i,146) * number_density(i,167)

    !  k_CH3COCHO_NO3_1: CH3COCHO + NO3 -> 1*HNO3 + 1*CO + 1*CH3CO3
    LU(i,6088) = LU(i,6088) + rate_constant(i,405) * number_density(i,111)

    ! df_TERPROD1/d(NO3)
    !  k_NO3_TERPROD1_1: NO3 + TERPROD1 -> 0.5*TERP2O2 + 0.5*NTERPO2
    LU(i,6093) = LU(i,6093) - rate_constant(i,309) * number_density(i,58)

    !  k_NO3_NTERPO2_1: NO3 + NTERPO2 -> 2*NO2 + 1*TERPROD1
    LU(i,6093) = LU(i,6093) + rate_constant(i,389) * number_density(i,143)

    ! df_HYAC/d(NO3)
    !  k_NO3_XO2_1: NO3 + XO2 -> 1*NO2 + 1*HO2 + 0.5*CO + 0.25*HYAC + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*GLYALD
    LU(i,6092) = LU(i,6092) + 0.25*rate_constant(i,109) * number_density(i,153)

    !  k_MACRO2_NO3_1: MACRO2 + NO3 -> 1*NO2 + 0.47*HO2 + 0.25*CH2O + 0.25*CH3COCHO + 0.22*CO + 0.53*GLYALD + 0.22*HYAC + 0.53*CH3CO3
    LU(i,6092) = LU(i,6092) + 0.22*rate_constant(i,134) * number_density(i,188)

    !  k_ISOPBO2_NO3_1: ISOPBO2 + NO3 -> 1*NO2 + 0.95*HYDRALD + 1*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    LU(i,6092) = LU(i,6092) + 0.05*rate_constant(i,178) * number_density(i,190)

    ! df_NO2/d(NO3)
    !  k_NO3_OH_1: NO3 + OH -> 1*HO2 + 1*NO2
    LU(i,6090) = LU(i,6090) + rate_constant(i,9) * number_density(i,166)

    !  k_NO_NO3_1: NO + NO3 -> 2*NO2
    LU(i,6090) = LU(i,6090) + 2*rate_constant(i,41) * number_density(i,137)

    !  k_MBONO3O2_NO3_1: MBONO3O2 + NO3 -> 0.25*HMPROP + 0.25*CH2O + 1.25*NO2 + 0.75*HONITR + 0.75*CH3COCH3 + 0.75*HO2
    LU(i,6090) = LU(i,6090) + 1.25*rate_constant(i,44) * number_density(i,123)

    !  k_NO3_XO2_1: NO3 + XO2 -> 1*NO2 + 1*HO2 + 0.5*CO + 0.25*HYAC + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*GLYALD
    LU(i,6090) = LU(i,6090) + rate_constant(i,109) * number_density(i,153)

    !  k_NO3_O_1: NO3 + O -> 1*NO2 + 1*O2
    LU(i,6090) = LU(i,6090) + rate_constant(i,129) * number_density(i,187)

    !  k_MACRO2_NO3_1: MACRO2 + NO3 -> 1*NO2 + 0.47*HO2 + 0.25*CH2O + 0.25*CH3COCHO + 0.22*CO + 0.53*GLYALD + 0.22*HYAC + 0.53*CH3CO3
    LU(i,6090) = LU(i,6090) + rate_constant(i,134) * number_density(i,188)

    !  k_MCO3_NO3_1: MCO3 + NO3 -> 1*NO2 + 1*CH2O + 1*CH3CO3
    LU(i,6090) = LU(i,6090) + rate_constant(i,146) * number_density(i,167)

    !  k_ISOPBO2_NO3_1: ISOPBO2 + NO3 -> 1*NO2 + 0.95*HYDRALD + 1*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    LU(i,6090) = LU(i,6090) + rate_constant(i,178) * number_density(i,190)

    !  k_NO3_1: NO3 -> 1*NO2 + 1*O
    LU(i,6090) = LU(i,6090) + rate_constant(i,189)

    !  k_ISOPAO2_NO3_1: ISOPAO2 + NO3 -> 1*NO2 + 0.4*MACR + 0.6*MVK + 1*CH2O + 1*HO2
    LU(i,6090) = LU(i,6090) + rate_constant(i,330) * number_density(i,189)
  end do
  !$acc end parallel

end subroutine dforce_dy99

subroutine dforce_dy100(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    !  k_BIGENE_NO3_1: BIGENE + NO3 -> 1*NO2 + 1*CH3CHO + 0.5*CH2O + 0.5*CH3COCH3
    LU(i,6090) = LU(i,6090) + rate_constant(i,387) * number_density(i,97)

    !  k_NO3_NTERPO2_1: NO3 + NTERPO2 -> 2*NO2 + 1*TERPROD1
    LU(i,6090) = LU(i,6090) + 2*rate_constant(i,389) * number_density(i,143)

    !  k_ISOPNO3_NO3_1: ISOPNO3 + NO3 -> 1*NC4CHO + 1*NO2 + 1*HO2
    LU(i,6090) = LU(i,6090) + rate_constant(i,451) * number_density(i,46)

    !  k_HO2_NO3_1: HO2 + NO3 -> 1*OH + 1*NO2 + 1*O2
    LU(i,6090) = LU(i,6090) + rate_constant(i,454) * number_density(i,192)

    !  k_NO2_NO3_1: NO2 + NO3 -> 1*N2O5
    LU(i,6090) = LU(i,6090) - rate_constant(i,481) * number_density(i,54)

    ! df_NO/d(NO3)
    !  k_NO_NO3_1: NO + NO3 -> 2*NO2
    LU(i,6126) = LU(i,6126) - rate_constant(i,41) * number_density(i,137)

    !  k_NO3_2: NO3 -> 1*NO + 1*O2
    LU(i,6126) = LU(i,6126) + rate_constant(i,374)

    ! df_BIGENE/d(NO3)
    !  k_BIGENE_NO3_1: BIGENE + NO3 -> 1*NO2 + 1*CH3CHO + 0.5*CH2O + 0.5*CH3COCH3
    LU(i,6104) = LU(i,6104) - rate_constant(i,387) * number_density(i,97)

    ! df_CH3COCHO/d(NO3)
    !  k_NO3_XO2_1: NO3 + XO2 -> 1*NO2 + 1*HO2 + 0.5*CO + 0.25*HYAC + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*GLYALD
    LU(i,6110) = LU(i,6110) + 0.25*rate_constant(i,109) * number_density(i,153)

    !  k_MACRO2_NO3_1: MACRO2 + NO3 -> 1*NO2 + 0.47*HO2 + 0.25*CH2O + 0.25*CH3COCHO + 0.22*CO + 0.53*GLYALD + 0.22*HYAC + 0.53*CH3CO3
    LU(i,6110) = LU(i,6110) + 0.25*rate_constant(i,134) * number_density(i,188)

    !  k_ISOPBO2_NO3_1: ISOPBO2 + NO3 -> 1*NO2 + 0.95*HYDRALD + 1*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    LU(i,6110) = LU(i,6110) + 0.05*rate_constant(i,178) * number_density(i,190)

    !  k_CH3COCHO_NO3_1: CH3COCHO + NO3 -> 1*HNO3 + 1*CO + 1*CH3CO3
    LU(i,6110) = LU(i,6110) - rate_constant(i,405) * number_density(i,111)

    ! df_CH3COCH3/d(NO3)
    !  k_MBONO3O2_NO3_1: MBONO3O2 + NO3 -> 0.25*HMPROP + 0.25*CH2O + 1.25*NO2 + 0.75*HONITR + 0.75*CH3COCH3 + 0.75*HO2
    LU(i,6102) = LU(i,6102) + 0.75*rate_constant(i,44) * number_density(i,123)

    !  k_BIGENE_NO3_1: BIGENE + NO3 -> 1*NO2 + 1*CH3CHO + 0.5*CH2O + 0.5*CH3COCH3
    LU(i,6102) = LU(i,6102) + 0.5*rate_constant(i,387) * number_density(i,97)

    ! df_O/d(NO3)
    !  k_NO3_O_1: NO3 + O -> 1*NO2 + 1*O2
    LU(i,6173) = LU(i,6173) - rate_constant(i,129) * number_density(i,187)

    !  k_NO3_1: NO3 -> 1*NO2 + 1*O
    LU(i,6173) = LU(i,6173) + rate_constant(i,189)

    ! df_DMS/d(NO3)
    !  k_DMS_NO3_1: DMS + NO3 -> 1*SO2 + 1*HNO3
    LU(i,6105) = LU(i,6105) - rate_constant(i,197) * number_density(i,99)

    ! df_BCARY/d(NO3)
    !  k_BCARY_NO3_1: BCARY + NO3 -> 1*NTERPO2
    LU(i,6107) = LU(i,6107) - rate_constant(i,225) * number_density(i,102)

    ! df_C3H6/d(NO3)
    !  k_C3H6_NO3_1: C3H6 + NO3 -> 1*NOA
    LU(i,6113) = LU(i,6113) - rate_constant(i,221) * number_density(i,120)

    ! df_CH2O/d(NO3)
    !  k_MBONO3O2_NO3_1: MBONO3O2 + NO3 -> 0.25*HMPROP + 0.25*CH2O + 1.25*NO2 + 0.75*HONITR + 0.75*CH3COCH3 + 0.75*HO2
    LU(i,6117) = LU(i,6117) + 0.25*rate_constant(i,44) * number_density(i,123)

    !  k_MACRO2_NO3_1: MACRO2 + NO3 -> 1*NO2 + 0.47*HO2 + 0.25*CH2O + 0.25*CH3COCHO + 0.22*CO + 0.53*GLYALD + 0.22*HYAC + 0.53*CH3CO3
    LU(i,6117) = LU(i,6117) + 0.25*rate_constant(i,134) * number_density(i,188)

    !  k_MCO3_NO3_1: MCO3 + NO3 -> 1*NO2 + 1*CH2O + 1*CH3CO3
    LU(i,6117) = LU(i,6117) + rate_constant(i,146) * number_density(i,167)

    !  k_ISOPAO2_NO3_1: ISOPAO2 + NO3 -> 1*NO2 + 0.4*MACR + 0.6*MVK + 1*CH2O + 1*HO2
    LU(i,6117) = LU(i,6117) + rate_constant(i,330) * number_density(i,189)

    !  k_BIGENE_NO3_1: BIGENE + NO3 -> 1*NO2 + 1*CH3CHO + 0.5*CH2O + 0.5*CH3COCH3
    LU(i,6117) = LU(i,6117) + 0.5*rate_constant(i,387) * number_density(i,97)

    !  k_CH2O_NO3_1: CH2O + NO3 -> 1*CO + 1*HO2 + 1*HNO3
    LU(i,6117) = LU(i,6117) - rate_constant(i,423) * number_density(i,124)

    ! df_MACRO2/d(NO3)
    !  k_MACRO2_NO3_1: MACRO2 + NO3 -> 1*NO2 + 0.47*HO2 + 0.25*CH2O + 0.25*CH3COCHO + 0.22*CO + 0.53*GLYALD + 0.22*HYAC + 0.53*CH3CO3
    LU(i,6174) = LU(i,6174) - rate_constant(i,134) * number_density(i,188)

    ! df_ISOPAO2/d(NO3)
    !  k_ISOPAO2_NO3_1: ISOPAO2 + NO3 -> 1*NO2 + 0.4*MACR + 0.6*MVK + 1*CH2O + 1*HO2
    LU(i,6175) = LU(i,6175) - rate_constant(i,330) * number_density(i,189)

    ! df_MBONO3O2/d(NO3)
    !  k_MBO_NO3_1: MBO + NO3 -> 1*MBONO3O2
    LU(i,6116) = LU(i,6116) + rate_constant(i,11) * number_density(i,127)

    !  k_MBONO3O2_NO3_1: MBONO3O2 + NO3 -> 0.25*HMPROP + 0.25*CH2O + 1.25*NO2 + 0.75*HONITR + 0.75*CH3COCH3 + 0.75*HO2
    LU(i,6116) = LU(i,6116) - rate_constant(i,44) * number_density(i,123)

    ! df_ISOPBO2/d(NO3)
    !  k_ISOPBO2_NO3_1: ISOPBO2 + NO3 -> 1*NO2 + 0.95*HYDRALD + 1*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    LU(i,6176) = LU(i,6176) - rate_constant(i,178) * number_density(i,190)
  end do
  !$acc end parallel

end subroutine dforce_dy100

subroutine dforce_dy101(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! df_MCO3/d(NO3)
    !  k_MCO3_NO3_1: MCO3 + NO3 -> 1*NO2 + 1*CH2O + 1*CH3CO3
    LU(i,6153) = LU(i,6153) - rate_constant(i,146) * number_density(i,167)

    ! df_GLYOXAL/d(NO3)
    !  k_NO3_XO2_1: NO3 + XO2 -> 1*NO2 + 1*HO2 + 0.5*CO + 0.25*HYAC + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*GLYALD
    LU(i,6121) = LU(i,6121) + 0.25*rate_constant(i,109) * number_density(i,153)

    !  k_ISOPBO2_NO3_1: ISOPBO2 + NO3 -> 1*NO2 + 0.95*HYDRALD + 1*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    LU(i,6121) = LU(i,6121) + 0.05*rate_constant(i,178) * number_density(i,190)

    ! df_HMPROP/d(NO3)
    !  k_MBONO3O2_NO3_1: MBONO3O2 + NO3 -> 0.25*HMPROP + 0.25*CH2O + 1.25*NO2 + 0.75*HONITR + 0.75*CH3COCH3 + 0.75*HO2
    LU(i,6122) = LU(i,6122) + 0.25*rate_constant(i,44) * number_density(i,123)

    ! df_GLYALD/d(NO3)
    !  k_NO3_XO2_1: NO3 + XO2 -> 1*NO2 + 1*HO2 + 0.5*CO + 0.25*HYAC + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*GLYALD
    LU(i,6142) = LU(i,6142) + 0.25*rate_constant(i,109) * number_density(i,153)

    !  k_MACRO2_NO3_1: MACRO2 + NO3 -> 1*NO2 + 0.47*HO2 + 0.25*CH2O + 0.25*CH3COCHO + 0.22*CO + 0.53*GLYALD + 0.22*HYAC + 0.53*CH3CO3
    LU(i,6142) = LU(i,6142) + 0.53*rate_constant(i,134) * number_density(i,188)

    !  k_ISOPBO2_NO3_1: ISOPBO2 + NO3 -> 1*NO2 + 0.95*HYDRALD + 1*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    LU(i,6142) = LU(i,6142) + 0.05*rate_constant(i,178) * number_density(i,190)

    ! df_HO2/d(NO3)
    !  k_NO3_OH_1: NO3 + OH -> 1*HO2 + 1*NO2
    LU(i,6178) = LU(i,6178) + rate_constant(i,9) * number_density(i,166)

    !  k_MBONO3O2_NO3_1: MBONO3O2 + NO3 -> 0.25*HMPROP + 0.25*CH2O + 1.25*NO2 + 0.75*HONITR + 0.75*CH3COCH3 + 0.75*HO2
    LU(i,6178) = LU(i,6178) + 0.75*rate_constant(i,44) * number_density(i,123)

    !  k_NO3_XO2_1: NO3 + XO2 -> 1*NO2 + 1*HO2 + 0.5*CO + 0.25*HYAC + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*GLYALD
    LU(i,6178) = LU(i,6178) + rate_constant(i,109) * number_density(i,153)

    !  k_MACRO2_NO3_1: MACRO2 + NO3 -> 1*NO2 + 0.47*HO2 + 0.25*CH2O + 0.25*CH3COCHO + 0.22*CO + 0.53*GLYALD + 0.22*HYAC + 0.53*CH3CO3
    LU(i,6178) = LU(i,6178) + 0.47*rate_constant(i,134) * number_density(i,188)

    !  k_ISOPBO2_NO3_1: ISOPBO2 + NO3 -> 1*NO2 + 0.95*HYDRALD + 1*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    LU(i,6178) = LU(i,6178) + rate_constant(i,178) * number_density(i,190)

    !  k_ISOPAO2_NO3_1: ISOPAO2 + NO3 -> 1*NO2 + 0.4*MACR + 0.6*MVK + 1*CH2O + 1*HO2
    LU(i,6178) = LU(i,6178) + rate_constant(i,330) * number_density(i,189)

    !  k_CH2O_NO3_1: CH2O + NO3 -> 1*CO + 1*HO2 + 1*HNO3
    LU(i,6178) = LU(i,6178) + rate_constant(i,423) * number_density(i,124)

    !  k_ISOPNO3_NO3_1: ISOPNO3 + NO3 -> 1*NC4CHO + 1*NO2 + 1*HO2
    LU(i,6178) = LU(i,6178) + rate_constant(i,451) * number_density(i,46)

    !  k_HO2_NO3_1: HO2 + NO3 -> 1*OH + 1*NO2 + 1*O2
    LU(i,6178) = LU(i,6178) - rate_constant(i,454) * number_density(i,192)

    ! df_HYDRALD/d(NO3)
    !  k_ISOPBO2_NO3_1: ISOPBO2 + NO3 -> 1*NO2 + 0.95*HYDRALD + 1*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    LU(i,6127) = LU(i,6127) + 0.95*rate_constant(i,178) * number_density(i,190)

    ! df_ISOP/d(NO3)
    !  k_ISOP_NO3_2: ISOP + NO3 -> 1*ISOPNO3
    LU(i,6128) = LU(i,6128) - rate_constant(i,385) * number_density(i,142)

    ! df_NTERPO2/d(NO3)
    !  k_MTERP_NO3_1: MTERP + NO3 -> 1*NTERPO2
    LU(i,6129) = LU(i,6129) + rate_constant(i,111) * number_density(i,31)

    !  k_BCARY_NO3_1: BCARY + NO3 -> 1*NTERPO2
    LU(i,6129) = LU(i,6129) + rate_constant(i,225) * number_density(i,102)

    !  k_NO3_TERPROD1_1: NO3 + TERPROD1 -> 0.5*TERP2O2 + 0.5*NTERPO2
    LU(i,6129) = LU(i,6129) + 0.5*rate_constant(i,309) * number_density(i,58)

    !  k_NO3_NTERPO2_1: NO3 + NTERPO2 -> 2*NO2 + 1*TERPROD1
    LU(i,6129) = LU(i,6129) - rate_constant(i,389) * number_density(i,143)

    ! df_TERP2O2/d(NO3)
    !  k_NO3_TERPROD1_1: NO3 + TERPROD1 -> 0.5*TERP2O2 + 0.5*NTERPO2
    LU(i,6131) = LU(i,6131) + 0.5*rate_constant(i,309) * number_density(i,58)

    ! df_XO2/d(NO3)
    !  k_NO3_XO2_1: NO3 + XO2 -> 1*NO2 + 1*HO2 + 0.5*CO + 0.25*HYAC + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*GLYALD
    LU(i,6139) = LU(i,6139) - rate_constant(i,109) * number_density(i,153)

    ! df_MACR/d(NO3)
    !  k_ISOPAO2_NO3_1: ISOPAO2 + NO3 -> 1*NO2 + 0.4*MACR + 0.6*MVK + 1*CH2O + 1*HO2
    LU(i,6143) = LU(i,6143) + 0.4*rate_constant(i,330) * number_density(i,189)

    ! df_HONITR/d(NO3)
    !  k_MBONO3O2_NO3_1: MBONO3O2 + NO3 -> 0.25*HMPROP + 0.25*CH2O + 1.25*NO2 + 0.75*HONITR + 0.75*CH3COCH3 + 0.75*HO2
    LU(i,6124) = LU(i,6124) + 0.75*rate_constant(i,44) * number_density(i,123)

    ! df_MBO/d(NO3)
    !  k_MBO_NO3_1: MBO + NO3 -> 1*MBONO3O2
    LU(i,6119) = LU(i,6119) - rate_constant(i,11) * number_density(i,127)

    ! df_NO3/d(NO3)
    !  k_NO3_OH_1: NO3 + OH -> 1*HO2 + 1*NO2
    LU(i,6151) = LU(i,6151) - rate_constant(i,9) * number_density(i,166)

    !  k_MBO_NO3_1: MBO + NO3 -> 1*MBONO3O2
    LU(i,6151) = LU(i,6151) - rate_constant(i,11) * number_density(i,127)
  end do
  !$acc end parallel

end subroutine dforce_dy101

subroutine dforce_dy102(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    !  k_CH3CHO_NO3_1: CH3CHO + NO3 -> 1*CH3CO3 + 1*HNO3
    LU(i,6151) = LU(i,6151) - rate_constant(i,34) * number_density(i,178)

    !  k_NO_NO3_1: NO + NO3 -> 2*NO2
    LU(i,6151) = LU(i,6151) - rate_constant(i,41) * number_density(i,137)

    !  k_MBONO3O2_NO3_1: MBONO3O2 + NO3 -> 0.25*HMPROP + 0.25*CH2O + 1.25*NO2 + 0.75*HONITR + 0.75*CH3COCH3 + 0.75*HO2
    LU(i,6151) = LU(i,6151) - rate_constant(i,44) * number_density(i,123)

    !  k_NO3_XO2_1: NO3 + XO2 -> 1*NO2 + 1*HO2 + 0.5*CO + 0.25*HYAC + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*GLYALD
    LU(i,6151) = LU(i,6151) - rate_constant(i,109) * number_density(i,153)

    !  k_MTERP_NO3_1: MTERP + NO3 -> 1*NTERPO2
    LU(i,6151) = LU(i,6151) - rate_constant(i,111) * number_density(i,31)

    !  k_NO3_O_1: NO3 + O -> 1*NO2 + 1*O2
    LU(i,6151) = LU(i,6151) - rate_constant(i,129) * number_density(i,187)

    !  k_MACRO2_NO3_1: MACRO2 + NO3 -> 1*NO2 + 0.47*HO2 + 0.25*CH2O + 0.25*CH3COCHO + 0.22*CO + 0.53*GLYALD + 0.22*HYAC + 0.53*CH3CO3
    LU(i,6151) = LU(i,6151) - rate_constant(i,134) * number_density(i,188)

    !  k_MCO3_NO3_1: MCO3 + NO3 -> 1*NO2 + 1*CH2O + 1*CH3CO3
    LU(i,6151) = LU(i,6151) - rate_constant(i,146) * number_density(i,167)

    !  k_ISOPBO2_NO3_1: ISOPBO2 + NO3 -> 1*NO2 + 0.95*HYDRALD + 1*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    LU(i,6151) = LU(i,6151) - rate_constant(i,178) * number_density(i,190)

    !  k_NO3_1: NO3 -> 1*NO2 + 1*O
    LU(i,6151) = LU(i,6151) - rate_constant(i,189)

    !  k_DMS_NO3_1: DMS + NO3 -> 1*SO2 + 1*HNO3
    LU(i,6151) = LU(i,6151) - rate_constant(i,197) * number_density(i,99)

    !  k_C3H6_NO3_1: C3H6 + NO3 -> 1*NOA
    LU(i,6151) = LU(i,6151) - rate_constant(i,221) * number_density(i,120)

    !  k_BCARY_NO3_1: BCARY + NO3 -> 1*NTERPO2
    LU(i,6151) = LU(i,6151) - rate_constant(i,225) * number_density(i,102)

    !  k_NO3_TERPROD1_1: NO3 + TERPROD1 -> 0.5*TERP2O2 + 0.5*NTERPO2
    LU(i,6151) = LU(i,6151) - rate_constant(i,309) * number_density(i,58)

    !  k_ISOPAO2_NO3_1: ISOPAO2 + NO3 -> 1*NO2 + 0.4*MACR + 0.6*MVK + 1*CH2O + 1*HO2
    LU(i,6151) = LU(i,6151) - rate_constant(i,330) * number_density(i,189)

    !  k_NO3_2: NO3 -> 1*NO + 1*O2
    LU(i,6151) = LU(i,6151) - rate_constant(i,374)

    !  k_ISOP_NO3_2: ISOP + NO3 -> 1*ISOPNO3
    LU(i,6151) = LU(i,6151) - rate_constant(i,385) * number_density(i,142)

    !  k_BIGENE_NO3_1: BIGENE + NO3 -> 1*NO2 + 1*CH3CHO + 0.5*CH2O + 0.5*CH3COCH3
    LU(i,6151) = LU(i,6151) - rate_constant(i,387) * number_density(i,97)

    !  k_NO3_NTERPO2_1: NO3 + NTERPO2 -> 2*NO2 + 1*TERPROD1
    LU(i,6151) = LU(i,6151) - rate_constant(i,389) * number_density(i,143)

    !  k_CH3COCHO_NO3_1: CH3COCHO + NO3 -> 1*HNO3 + 1*CO + 1*CH3CO3
    LU(i,6151) = LU(i,6151) - rate_constant(i,405) * number_density(i,111)

    !  k_CH2O_NO3_1: CH2O + NO3 -> 1*CO + 1*HO2 + 1*HNO3
    LU(i,6151) = LU(i,6151) - rate_constant(i,423) * number_density(i,124)

    !  k_ISOPNO3_NO3_1: ISOPNO3 + NO3 -> 1*NC4CHO + 1*NO2 + 1*HO2
    LU(i,6151) = LU(i,6151) - rate_constant(i,451) * number_density(i,46)

    !  k_HO2_NO3_1: HO2 + NO3 -> 1*OH + 1*NO2 + 1*O2
    LU(i,6151) = LU(i,6151) - rate_constant(i,454) * number_density(i,192)

    !  k_NO2_NO3_1: NO2 + NO3 -> 1*N2O5
    LU(i,6151) = LU(i,6151) - rate_constant(i,481) * number_density(i,54)

    ! df_OH/d(NO3)
    !  k_NO3_OH_1: NO3 + OH -> 1*HO2 + 1*NO2
    LU(i,6152) = LU(i,6152) - rate_constant(i,9) * number_density(i,166)

    !  k_HO2_NO3_1: HO2 + NO3 -> 1*OH + 1*NO2 + 1*O2
    LU(i,6152) = LU(i,6152) + rate_constant(i,454) * number_density(i,192)

    ! df_CO/d(NO3)
    !  k_NO3_XO2_1: NO3 + XO2 -> 1*NO2 + 1*HO2 + 0.5*CO + 0.25*HYAC + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*GLYALD
    LU(i,6162) = LU(i,6162) + 0.5*rate_constant(i,109) * number_density(i,153)

    !  k_MACRO2_NO3_1: MACRO2 + NO3 -> 1*NO2 + 0.47*HO2 + 0.25*CH2O + 0.25*CH3COCHO + 0.22*CO + 0.53*GLYALD + 0.22*HYAC + 0.53*CH3CO3
    LU(i,6162) = LU(i,6162) + 0.22*rate_constant(i,134) * number_density(i,188)

    !  k_CH3COCHO_NO3_1: CH3COCHO + NO3 -> 1*HNO3 + 1*CO + 1*CH3CO3
    LU(i,6162) = LU(i,6162) + rate_constant(i,405) * number_density(i,111)

    !  k_CH2O_NO3_1: CH2O + NO3 -> 1*CO + 1*HO2 + 1*HNO3
    LU(i,6162) = LU(i,6162) + rate_constant(i,423) * number_density(i,124)

    ! df_CH3CHO/d(NO3)
    !  k_CH3CHO_NO3_1: CH3CHO + NO3 -> 1*CH3CO3 + 1*HNO3
    LU(i,6164) = LU(i,6164) - rate_constant(i,34) * number_density(i,178)

    !  k_BIGENE_NO3_1: BIGENE + NO3 -> 1*NO2 + 1*CH3CHO + 0.5*CH2O + 0.5*CH3COCH3
    LU(i,6164) = LU(i,6164) + rate_constant(i,387) * number_density(i,97)

    ! df_NOA/d(NO3)
    !  k_C3H6_NO3_1: C3H6 + NO3 -> 1*NOA
    LU(i,6081) = LU(i,6081) + rate_constant(i,221) * number_density(i,120)
  end do
  !$acc end parallel

end subroutine dforce_dy102

subroutine dforce_dy103(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! df_NC4CHO/d(NO3)
    !  k_ISOPNO3_NO3_1: ISOPNO3 + NO3 -> 1*NC4CHO + 1*NO2 + 1*HO2
    LU(i,6079) = LU(i,6079) + rate_constant(i,451) * number_density(i,46)

    ! df_ALKNIT/d(OH)
    !  k_ALKNIT_OH_1: ALKNIT + OH -> 0.4*CH2O + 0.8*CH3CHO + 0.8*CH3COCH3 + 1*NO2
    LU(i,6182) = LU(i,6182) - rate_constant(i,394) * number_density(i,5)

    ! df_BZOOH/d(OH)
    !  k_BZOOH_OH_1: BZOOH + OH -> 1*BZOO
    LU(i,6184) = LU(i,6184) - rate_constant(i,485) * number_density(i,8)

    ! df_C6H5OOH/d(OH)
    !  k_C6H5OOH_OH_1: C6H5OOH + OH -> 1*C6H5O2
    LU(i,6186) = LU(i,6186) - rate_constant(i,242) * number_density(i,10)

    ! df_COF2/d(OH)
    !  k_HCFC142B_OH_1: HCFC142B + OH -> 1*CL + 1*COF2
    LU(i,6181) = LU(i,6181) + rate_constant(i,14) * number_density(i,172)

    !  k_HCFC22_OH_1: HCFC22 + OH -> 1*H2O + 1*CL + 1*COF2
    LU(i,6181) = LU(i,6181) + rate_constant(i,238) * number_density(i,83)

    ! df_O2/d(OH)
    !  k_CLO_OH_1: CLO + OH -> 1*HCL + 1*O2
    LU(i,6213) = LU(i,6213) + rate_constant(i,43) * number_density(i,86)

    !  k_HO2NO2_OH_1: HO2NO2 + OH -> 1*H2O + 1*NO2 + 1*O2
    LU(i,6213) = LU(i,6213) + rate_constant(i,54) * number_density(i,35)

    !  k_O3_OH_1: O3 + OH -> 1*HO2 + 1*O2
    LU(i,6213) = LU(i,6213) + rate_constant(i,164) * number_density(i,171)

    !  k_O_OH_1: O + OH -> 1*H + 1*O2
    LU(i,6213) = LU(i,6213) + rate_constant(i,196) * number_density(i,187)

    !  k_HO2_OH_1: HO2 + OH -> 1*H2O + 1*O2
    LU(i,6213) = LU(i,6213) + rate_constant(i,291) * number_density(i,192)

    ! df_COFCL/d(OH)
    !  k_HCFC141B_OH_1: HCFC141B + OH -> 1*CL + 1*COFCL
    LU(i,6183) = LU(i,6183) + rate_constant(i,360) * number_density(i,106)

    ! df_BENZO2/d(OH)
    !  k_BENZENE_OH_1: BENZENE + OH -> 0.53*PHENOL + 0.12*BEPOMUC + 0.65*HO2 + 0.35*BENZO2
    LU(i,6188) = LU(i,6188) + 0.35*rate_constant(i,318) * number_density(i,101)

    !  k_BENZOOH_OH_1: BENZOOH + OH -> 1*BENZO2
    LU(i,6188) = LU(i,6188) + rate_constant(i,382) * number_density(i,91)

    ! df_BZOO/d(OH)
    !  k_OH_XYLENES_1: OH + XYLENES -> 0.15*XYLOL + 0.23*TEPOMUC + 0.06*BZOO + 0.56*XYLENO2 + 0.38*HO2
    LU(i,6206) = LU(i,6206) + 0.06*rate_constant(i,7) * number_density(i,140)

    !  k_OH_TOLUENE_2: OH + TOLUENE -> 0.18*CRESOL + 0.1*TEPOMUC + 0.07*BZOO + 0.65*TOLO2 + 0.28*HO2
    LU(i,6206) = LU(i,6206) + 0.07*rate_constant(i,435) * number_density(i,117)

    !  k_BZOOH_OH_1: BZOOH + OH -> 1*BZOO
    LU(i,6206) = LU(i,6206) + rate_constant(i,485) * number_density(i,8)

    ! df_PAN/d(OH)
    !  k_OH_PAN_1: OH + PAN -> 1*CH2O + 1*NO3
    LU(i,6187) = LU(i,6187) - rate_constant(i,144) * number_density(i,12)

    ! df_HMPROPO2/d(OH)
    !  k_HMPROP_OH_1: HMPROP + OH -> 1*HMPROPO2
    LU(i,6237) = LU(i,6237) + rate_constant(i,453) * number_density(i,132)

    ! df_MVK/d(OH)
    !  k_MVK_OH_1: MVK + OH -> 1*MACRO2
    LU(i,6198) = LU(i,6198) - rate_constant(i,336) * number_density(i,25)

    ! df_MACROOH/d(OH)
    !  k_MACROOH_OH_1: MACROOH + OH -> 0.5*MCO3 + 0.2*MACRO2 + 0.1*OH + 0.2*HO2
    LU(i,6216) = LU(i,6216) - rate_constant(i,136) * number_density(i,44)

    ! df_SOAG0/d(OH)
    !  k_OH_SVOC_1: OH + SVOC -> 1*OH + 0.5931*SOAG0 + 0.1534*SOAG1 + 0.0459*SOAG2 + 0.0085*SOAG3 + 0.0128*SOAG4
    LU(i,6190) = LU(i,6190) + 0.5931*rate_constant(i,51) * number_density(i,30)

    !  k_OH_TOLUENE_1: OH + TOLUENE -> 1*TOLUENE + 1*OH + 0.1364*SOAG0 + 0.0101*SOAG1 + 0.0763*SOAG2 + 0.2157*SOAG3 + 0.0738*SOAG4
    LU(i,6190) = LU(i,6190) + 0.1364*rate_constant(i,55) * number_density(i,117)

    !  k_ISOP_OH_1: ISOP + OH -> 1*ISOP + 1*OH + 0.0031*SOAG0 + 0.0035*SOAG1 + 0.0003*SOAG2 + 0.0271*SOAG3 + 0.0474*SOAG4
    LU(i,6190) = LU(i,6190) + 0.0031*rate_constant(i,75) * number_density(i,142)

    !  k_BCARY_OH_1: BCARY + OH -> 1*BCARY + 1*OH + 0.2202*SOAG0 + 0.2067*SOAG1 + 0.0653*SOAG2 + 0.1284*SOAG3 + 0.114*SOAG4
    LU(i,6190) = LU(i,6190) + 0.2202*rate_constant(i,168) * number_density(i,102)

    !  k_IVOC_OH_1: IVOC + OH -> 1*OH + 0.2381*SOAG0 + 0.1308*SOAG1 + 0.0348*SOAG2 + 0.0076*SOAG3 + 0.0113*SOAG4
    LU(i,6190) = LU(i,6190) + 0.2381*rate_constant(i,243) * number_density(i,34)

    !  k_MTERP_OH_2: MTERP + OH -> 1*MTERP + 1*OH + 0.0508*SOAG0 + 0.1149*SOAG1 + 0.0348*SOAG2 + 0.0554*SOAG3 + 0.1278*SOAG4
    LU(i,6190) = LU(i,6190) + 0.0508*rate_constant(i,254) * number_density(i,31)

    !  k_OH_XYLENES_2: OH + XYLENES -> 1*XYLENES + 1*OH + 0.1677*SOAG0 + 0.0174*SOAG1 + 0.086*SOAG2 + 0.0512*SOAG3 + 0.1598*SOAG4
    LU(i,6190) = LU(i,6190) + 0.1677*rate_constant(i,411) * number_density(i,140)

    !  k_BENZENE_OH_2: BENZENE + OH -> 1*BENZENE + 1*OH + 0.0023*SOAG0 + 0.0008*SOAG1 + 0.0843*SOAG2 + 0.0443*SOAG3 + 0.1621*SOAG4
    LU(i,6190) = LU(i,6190) + 0.0023*rate_constant(i,478) * number_density(i,101)
  end do
  !$acc end parallel

end subroutine dforce_dy103

