subroutine dforce_dy105(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell
    ! df_ISOPNITB/d(OH)
    !  k_ISOPNITB_OH_1: ISOPNITB + OH -> 0.5*HYAC + 0.5*GLYALD + 0.5*NOA + 1*HO2 + 0.5*HONITR
    LU(i,6233) = LU(i,6233) - rate_constant(i,79) * number_density(i,73)

    ! df_SO3/d(OH)
    !  k_OH_SO2_1: OH + SO2 -> 1*SO3 + 1*HO2
    LU(i,6201) = LU(i,6201) + rate_constant(i,22) * number_density(i,55)

    ! df_OCS/d(OH)
    !  k_OCS_OH_1: OCS + OH -> 1*SO2 + 1*CO + 1*H
    LU(i,6202) = LU(i,6202) - rate_constant(i,312) * number_density(i,29)

    ! df_SO/d(OH)
    !  k_OH_SO_1: OH + SO -> 1*SO2 + 1*H
    LU(i,6205) = LU(i,6205) - rate_constant(i,486) * number_density(i,32)

    ! df_H/d(OH)
    !  k_O_OH_1: O + OH -> 1*H + 1*O2
    LU(i,6219) = LU(i,6219) + rate_constant(i,196) * number_density(i,187)

    !  k_N_OH_1: N + OH -> 1*NO + 1*H
    LU(i,6219) = LU(i,6219) + rate_constant(i,250) * number_density(i,185)

    !  k_H2_OH_1: H2 + OH -> 1*H2O + 1*H
    LU(i,6219) = LU(i,6219) + rate_constant(i,281) * number_density(i,152)

    !  k_OCS_OH_1: OCS + OH -> 1*SO2 + 1*CO + 1*H
    LU(i,6219) = LU(i,6219) + rate_constant(i,312) * number_density(i,29)

    !  k_CH2O_OH_1: CH2O + OH -> 1*CO + 1*H2O + 1*H
    LU(i,6219) = LU(i,6219) + rate_constant(i,415) * number_density(i,124)

    !  k_CO_OH_2: CO + OH -> 1*CO2 + 1*H
    LU(i,6219) = LU(i,6219) + rate_constant(i,429) * number_density(i,176)

    !  k_OH_SO_1: OH + SO -> 1*SO2 + 1*H
    LU(i,6219) = LU(i,6219) + rate_constant(i,486) * number_density(i,32)

    ! df_MEK/d(OH)
    !  k_MEK_OH_1: MEK + OH -> 1*MEKO2
    LU(i,6262) = LU(i,6262) - rate_constant(i,66) * number_density(i,104)

    ! df_MTERP/d(OH)
    !  k_MTERP_OH_1: MTERP + OH -> 1*TERPO2
    LU(i,6204) = LU(i,6204) - rate_constant(i,181) * number_density(i,31)

    ! df_HCN/d(OH)
    !  k_HCN_OH_1: HCN + OH -> 1*HO2
    LU(i,6218) = LU(i,6218) - rate_constant(i,234) * number_density(i,47)

    ! df_SVOC/d(OH)
    !  k_OH_SVOC_1: OH + SVOC -> 1*OH + 0.5931*SOAG0 + 0.1534*SOAG1 + 0.0459*SOAG2 + 0.0085*SOAG3 + 0.0128*SOAG4
    LU(i,6203) = LU(i,6203) - rate_constant(i,51) * number_density(i,30)

    ! df_RO2/d(OH)
    !  k_CH3COCH3_OH_1: CH3COCH3 + OH -> 1*RO2 + 1*H2O
    LU(i,6212) = LU(i,6212) + rate_constant(i,68) * number_density(i,89)

    !  k_CH3COCH3_OH_2: CH3COCH3 + OH -> 1*RO2 + 1*H2O
    LU(i,6212) = LU(i,6212) + rate_constant(i,69) * number_density(i,89)

    !  k_OH_ROOH_1: OH + ROOH -> 1*RO2 + 1*H2O
    LU(i,6212) = LU(i,6212) + rate_constant(i,371) * number_density(i,121)

    !  k_OH_TERPROD2_1: OH + TERPROD2 -> 0.15*RO2 + 0.68*CH2O + 1.8*CO2 + 0.5*CH3COCH3 + 0.65*CH3CO3 + 0.2*HO2 + 0.7*CO
    LU(i,6212) = LU(i,6212) + 0.15*rate_constant(i,397) * number_density(i,155)

    ! df_PHENO2/d(OH)
    !  k_CRESOL_OH_1: CRESOL + OH -> 0.2*PHENO2 + 0.73*HO2 + 0.07*PHENO
    LU(i,6210) = LU(i,6210) + 0.2*rate_constant(i,95) * number_density(i,139)

    !  k_OH_PHENOL_1: OH + PHENOL -> 0.14*PHENO2 + 0.8*HO2 + 0.06*PHENO
    LU(i,6210) = LU(i,6210) + 0.14*rate_constant(i,266) * number_density(i,21)

    !  k_OH_PHENOOH_1: OH + PHENOOH -> 1*PHENO2
    LU(i,6210) = LU(i,6210) + rate_constant(i,412) * number_density(i,115)

    ! df_IVOC/d(OH)
    !  k_IVOC_OH_1: IVOC + OH -> 1*OH + 0.2381*SOAG0 + 0.1308*SOAG1 + 0.0348*SOAG2 + 0.0076*SOAG3 + 0.0113*SOAG4
    LU(i,6207) = LU(i,6207) - rate_constant(i,243) * number_density(i,34)

    ! df_TERPNIT/d(OH)
    !  k_OH_TERPNIT_1: OH + TERPNIT -> 1*NO2 + 1*TERPROD1
    LU(i,6211) = LU(i,6211) - rate_constant(i,428) * number_density(i,39)

    ! df_HNO3/d(OH)
    !  k_NO2_OH_1: NO2 + OH -> 1*HNO3
    LU(i,6214) = LU(i,6214) + rate_constant(i,207) * number_density(i,54)

    !  k_HNO3_OH_1: HNO3 + OH -> 1*NO3 + 1*H2O
    LU(i,6214) = LU(i,6214) - rate_constant(i,398) * number_density(i,42)

    !  k_HNO3_OH_2: HNO3 + OH -> 1*NO3 + 1*H2O
    LU(i,6214) = LU(i,6214) - rate_constant(i,399) * number_density(i,42)

    ! df_ACBZO2/d(OH)
    !  k_BZALD_OH_1: BZALD + OH -> 1*ACBZO2
    LU(i,6215) = LU(i,6215) + rate_constant(i,57) * number_density(i,107)

    ! df_CH3COOOH/d(OH)
    !  k_CH3COOOH_OH_1: CH3COOOH + OH -> 0.5*CH3CO3 + 0.5*CH2O + 0.5*CO2 + 1*H2O
    LU(i,6341) = LU(i,6341) - rate_constant(i,393) * number_density(i,184)
  end do
  !$acc end parallel

end subroutine dforce_dy105

subroutine dforce_dy106(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! df_SO2/d(OH)
    !  k_OH_SO2_1: OH + SO2 -> 1*SO3 + 1*HO2
    LU(i,6224) = LU(i,6224) - rate_constant(i,22) * number_density(i,55)

    !  k_DMS_OH_1: DMS + OH -> 0.5*SO2 + 0.5*HO2
    LU(i,6224) = LU(i,6224) + 0.5*rate_constant(i,227) * number_density(i,99)

    !  k_OCS_OH_1: OCS + OH -> 1*SO2 + 1*CO + 1*H
    LU(i,6224) = LU(i,6224) + rate_constant(i,312) * number_density(i,29)

    !  k_DMS_OH_2: DMS + OH -> 1*SO2
    LU(i,6224) = LU(i,6224) + rate_constant(i,476) * number_density(i,99)

    !  k_OH_SO_1: OH + SO -> 1*SO2 + 1*H
    LU(i,6224) = LU(i,6224) + rate_constant(i,486) * number_density(i,32)

    ! df_CH3CO3/d(OH)
    !  k_CH3CHO_OH_1: CH3CHO + OH -> 1*CH3CO3 + 1*H2O
    LU(i,6220) = LU(i,6220) + rate_constant(i,108) * number_density(i,178)

    !  k_CH3COCHO_OH_1: CH3COCHO + OH -> 1*CH3CO3 + 1*CO + 1*H2O
    LU(i,6220) = LU(i,6220) + rate_constant(i,122) * number_density(i,111)

    !  k_CH3COOOH_OH_1: CH3COOOH + OH -> 0.5*CH3CO3 + 0.5*CH2O + 0.5*CO2 + 1*H2O
    LU(i,6220) = LU(i,6220) + 0.5*rate_constant(i,393) * number_density(i,184)

    !  k_OH_TERPROD2_1: OH + TERPROD2 -> 0.15*RO2 + 0.68*CH2O + 1.8*CO2 + 0.5*CH3COCH3 + 0.65*CH3CO3 + 0.2*HO2 + 0.7*CO
    LU(i,6220) = LU(i,6220) + 0.65*rate_constant(i,397) * number_density(i,155)

    ! df_C6H5O2/d(OH)
    !  k_C6H5OOH_OH_1: C6H5OOH + OH -> 1*C6H5O2
    LU(i,6240) = LU(i,6240) + rate_constant(i,242) * number_density(i,10)

    ! df_CH4/d(OH)
    !  k_CH4_OH_1: CH4 + OH -> 1*CH3O2 + 1*H2O
    LU(i,6217) = LU(i,6217) - rate_constant(i,284) * number_density(i,45)

    ! df_CH3CL/d(OH)
    !  k_CH3CL_OH_1: CH3CL + OH -> 1*CL + 1*H2O + 1*HO2
    LU(i,6222) = LU(i,6222) - rate_constant(i,92) * number_density(i,53)

    ! df_TERPROD1/d(OH)
    !  k_OH_TERPROD1_1: OH + TERPROD1 -> 1*TERP2O2
    LU(i,6227) = LU(i,6227) - rate_constant(i,151) * number_density(i,58)

    !  k_OH_TERPNIT_1: OH + TERPNIT -> 1*NO2 + 1*TERPROD1
    LU(i,6227) = LU(i,6227) + rate_constant(i,428) * number_density(i,39)

    ! df_HYAC/d(OH)
    !  k_MPAN_OH_1: MPAN + OH -> 0.5*HYAC + 0.5*NO3 + 0.5*CH2O + 0.5*HO2 + 0.5*CO2
    LU(i,6226) = LU(i,6226) + 0.5*rate_constant(i,28) * number_density(i,159)

    !  k_ISOPNITB_OH_1: ISOPNITB + OH -> 0.5*HYAC + 0.5*GLYALD + 0.5*NOA + 1*HO2 + 0.5*HONITR
    LU(i,6226) = LU(i,6226) + 0.5*rate_constant(i,79) * number_density(i,73)

    !  k_OH_POOH_1: OH + POOH -> 0.5*PO2 + 0.5*OH + 0.5*HYAC + 1*H2O
    LU(i,6226) = LU(i,6226) + 0.5*rate_constant(i,127) * number_density(i,9)

    !  k_ISOPNITA_OH_1: ISOPNITA + OH -> 0.7*HYAC + 0.7*GLYALD + 0.7*NO2 + 0.3*CH2O + 0.3*HONITR + 0.3*HO2
    LU(i,6226) = LU(i,6226) + 0.7*rate_constant(i,364) * number_density(i,118)

    !  k_HYAC_OH_1: HYAC + OH -> 1*CH3COCHO + 1*HO2
    LU(i,6226) = LU(i,6226) - rate_constant(i,422) * number_density(i,57)

    ! df_HPALD/d(OH)
    !  k_HPALD_OH_1: HPALD + OH -> 1*XO2
    LU(i,6229) = LU(i,6229) - rate_constant(i,444) * number_density(i,67)

    ! df_H2O/d(OH)
    !  k_C3H7OOH_OH_1: C3H7OOH + OH -> 1*H2O + 1*C3H7O2
    LU(i,6230) = LU(i,6230) + rate_constant(i,4) * number_density(i,20)

    !  k_HOCL_OH_1: HOCL + OH -> 1*H2O + 1*CLO
    LU(i,6230) = LU(i,6230) + rate_constant(i,30) * number_density(i,88)

    !  k_HO2NO2_OH_1: HO2NO2 + OH -> 1*H2O + 1*NO2 + 1*O2
    LU(i,6230) = LU(i,6230) + rate_constant(i,54) * number_density(i,35)

    !  k_CH3COCH3_OH_1: CH3COCH3 + OH -> 1*RO2 + 1*H2O
    LU(i,6230) = LU(i,6230) + rate_constant(i,68) * number_density(i,89)

    !  k_CH3COCH3_OH_2: CH3COCH3 + OH -> 1*RO2 + 1*H2O
    LU(i,6230) = LU(i,6230) + rate_constant(i,69) * number_density(i,89)

    !  k_CH3CL_OH_1: CH3CL + OH -> 1*CL + 1*H2O + 1*HO2
    LU(i,6230) = LU(i,6230) + rate_constant(i,92) * number_density(i,53)

    !  k_OH_OH_1: OH + OH -> 1*H2O + 1*O
    LU(i,6230) = LU(i,6230) + rate_constant(i,100) * number_density(i,166)

    !  k_OH_OH_1: OH + OH -> 1*H2O + 1*O
    LU(i,6230) = LU(i,6230) + rate_constant(i,100) * number_density(i,166)

    !  k_CH3COOH_OH_1: CH3COOH + OH -> 1*CH3O2 + 1*CO2 + 1*H2O
    LU(i,6230) = LU(i,6230) + rate_constant(i,107) * number_density(i,177)

    !  k_CH3CHO_OH_1: CH3CHO + OH -> 1*CH3CO3 + 1*H2O
    LU(i,6230) = LU(i,6230) + rate_constant(i,108) * number_density(i,178)

    !  k_CH3BR_OH_1: CH3BR + OH -> 1*BR + 1*H2O + 1*HO2
    LU(i,6230) = LU(i,6230) + rate_constant(i,112) * number_density(i,94)
  end do
  !$acc end parallel

end subroutine dforce_dy106

subroutine dforce_dy107(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
