    LU(i,6230) = LU(i,6230) + rate_constant(i,174) * number_density(i,174)

    !  k_MACR_OH_1: MACR + OH -> 0.5*MACRO2 + 0.5*H2O + 0.5*MCO3
    LU(i,6230) = LU(i,6230) + 0.5*rate_constant(i,220) * number_density(i,157)

    !  k_HBR_OH_1: HBR + OH -> 1*BR + 1*H2O
    LU(i,6230) = LU(i,6230) + rate_constant(i,226) * number_density(i,80)

    !  k_HCFC22_OH_1: HCFC22 + OH -> 1*H2O + 1*CL + 1*COF2
    LU(i,6230) = LU(i,6230) + rate_constant(i,238) * number_density(i,83)

    !  k_C3H8_OH_1: C3H8 + OH -> 1*C3H7O2 + 1*H2O
    LU(i,6230) = LU(i,6230) + rate_constant(i,251) * number_density(i,56)

    !  k_H2_OH_1: H2 + OH -> 1*H2O + 1*H
    LU(i,6230) = LU(i,6230) + rate_constant(i,281) * number_density(i,152)

    !  k_CH4_OH_1: CH4 + OH -> 1*CH3O2 + 1*H2O
    LU(i,6230) = LU(i,6230) + rate_constant(i,284) * number_density(i,45)

    !  k_HO2_OH_1: HO2 + OH -> 1*H2O + 1*O2
    LU(i,6230) = LU(i,6230) + rate_constant(i,291) * number_density(i,192)

    !  k_HCOOH_OH_1: HCOOH + OH -> 1*HO2 + 1*CO2 + 1*H2O
    LU(i,6230) = LU(i,6230) + rate_constant(i,296) * number_density(i,119)

    !  k_CH3OOH_OH_1: CH3OOH + OH -> 0.7*CH3O2 + 0.3*OH + 0.3*CH2O + 1*H2O
    LU(i,6230) = LU(i,6230) + rate_constant(i,348) * number_density(i,135)

    !  k_OH_ROOH_1: OH + ROOH -> 1*RO2 + 1*H2O
    LU(i,6230) = LU(i,6230) + rate_constant(i,371) * number_density(i,121)

    !  k_CH3COOOH_OH_1: CH3COOOH + OH -> 0.5*CH3CO3 + 0.5*CH2O + 0.5*CO2 + 1*H2O
    LU(i,6230) = LU(i,6230) + rate_constant(i,393) * number_density(i,184)

    !  k_HNO3_OH_1: HNO3 + OH -> 1*NO3 + 1*H2O
    LU(i,6230) = LU(i,6230) + rate_constant(i,398) * number_density(i,42)

    !  k_HNO3_OH_2: HNO3 + OH -> 1*NO3 + 1*H2O
    LU(i,6230) = LU(i,6230) + rate_constant(i,399) * number_density(i,42)

    !  k_CH2O_OH_1: CH2O + OH -> 1*CO + 1*H2O + 1*H
    LU(i,6230) = LU(i,6230) + rate_constant(i,415) * number_density(i,124)

    !  k_CH2BR2_OH_1: CH2BR2 + OH -> 2*BR + 1*H2O
    LU(i,6230) = LU(i,6230) + rate_constant(i,455) * number_density(i,169)

    !  k_H2O2_OH_1: H2O2 + OH -> 1*H2O + 1*HO2
    LU(i,6230) = LU(i,6230) + rate_constant(i,456) * number_density(i,179)

    !  k_HCL_OH_1: HCL + OH -> 1*H2O + 1*CL
    LU(i,6230) = LU(i,6230) + rate_constant(i,458) * number_density(i,180)

    !  k_NH3_OH_1: NH3 + OH -> 1*H2O
    LU(i,6230) = LU(i,6230) + rate_constant(i,461) * number_density(i,3)

    ! df_NO2/d(OH)
    !  k_NO3_OH_1: NO3 + OH -> 1*HO2 + 1*NO2
    LU(i,6223) = LU(i,6223) + rate_constant(i,9) * number_density(i,165)

    !  k_HO2NO2_OH_1: HO2NO2 + OH -> 1*H2O + 1*NO2 + 1*O2
    LU(i,6223) = LU(i,6223) + rate_constant(i,54) * number_density(i,35)

    !  k_NO2_OH_1: NO2 + OH -> 1*HNO3
    LU(i,6223) = LU(i,6223) - rate_constant(i,207) * number_density(i,54)

    !  k_NOA_OH_1: NOA + OH -> 1*NO2 + 1*CH3COCHO
    LU(i,6223) = LU(i,6223) + rate_constant(i,311) * number_density(i,27)

    !  k_ISOPNITA_OH_1: ISOPNITA + OH -> 0.7*HYAC + 0.7*GLYALD + 0.7*NO2 + 0.3*CH2O + 0.3*HONITR + 0.3*HO2
    LU(i,6223) = LU(i,6223) + 0.7*rate_constant(i,364) * number_density(i,118)

