    LU(i,6223) = LU(i,6223) + rate_constant(i,394) * number_density(i,5)

    !  k_OH_TERPNIT_1: OH + TERPNIT -> 1*NO2 + 1*TERPROD1
    LU(i,6223) = LU(i,6223) + rate_constant(i,428) * number_density(i,39)

    ! df_NTERPOOH/d(OH)
    !  k_NTERPOOH_OH_1: NTERPOOH + OH -> 1*NTERPO2
    LU(i,6272) = LU(i,6272) - rate_constant(i,328) * number_density(i,114)

    ! df_CH2BR2/d(OH)
    !  k_CH2BR2_OH_1: CH2BR2 + OH -> 2*BR + 1*H2O
    LU(i,6326) = LU(i,6326) - rate_constant(i,455) * number_density(i,169)

    ! df_NO/d(OH)
    !  k_N_OH_1: N + OH -> 1*NO + 1*H
    LU(i,6294) = LU(i,6294) + rate_constant(i,250) * number_density(i,185)

  end do
  !$acc end parallel

end subroutine dforce_dy107

subroutine dforce_dy108(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell
    ! df_BR/d(OH)
    !  k_CH3BR_OH_1: CH3BR + OH -> 1*BR + 1*H2O + 1*HO2
    LU(i,6249) = LU(i,6249) + rate_constant(i,112) * number_density(i,94)

    !  k_BRO_OH_1: BRO + OH -> 1*BR + 1*HO2
    LU(i,6249) = LU(i,6249) + rate_constant(i,204) * number_density(i,71)

    !  k_HBR_OH_1: HBR + OH -> 1*BR + 1*H2O
    LU(i,6249) = LU(i,6249) + rate_constant(i,226) * number_density(i,80)

    !  k_CH2BR2_OH_1: CH2BR2 + OH -> 2*BR + 1*H2O
    LU(i,6249) = LU(i,6249) + 2*rate_constant(i,455) * number_density(i,169)

    !  k_CHBR3_OH_1: CHBR3 + OH -> 3*BR
    LU(i,6249) = LU(i,6249) + 3*rate_constant(i,460) * number_density(i,84)

    ! df_BRO/d(OH)
    !  k_BRO_OH_1: BRO + OH -> 1*BR + 1*HO2
    LU(i,6231) = LU(i,6231) - rate_constant(i,204) * number_density(i,71)

    ! df_CH3BR/d(OH)
    !  k_CH3BR_OH_1: CH3BR + OH -> 1*BR + 1*H2O + 1*HO2
    LU(i,6253) = LU(i,6253) - rate_constant(i,112) * number_density(i,94)

    ! df_CH3CCL3/d(OH)
    !  k_CH3CCL3_OH_1: CH3CCL3 + OH -> 1*H2O + 3*CL
    LU(i,6238) = LU(i,6238) - rate_constant(i,130) * number_density(i,79)

    ! df_CHBR3/d(OH)
    !  k_CHBR3_OH_1: CHBR3 + OH -> 3*BR
    LU(i,6243) = LU(i,6243) - rate_constant(i,460) * number_density(i,84)

    ! df_CL/d(OH)
    !  k_HCFC142B_OH_1: HCFC142B + OH -> 1*CL + 1*COF2
    LU(i,6258) = LU(i,6258) + rate_constant(i,14) * number_density(i,172)

    !  k_CH3CL_OH_1: CH3CL + OH -> 1*CL + 1*H2O + 1*HO2
    LU(i,6258) = LU(i,6258) + rate_constant(i,92) * number_density(i,53)

    !  k_CH3CCL3_OH_1: CH3CCL3 + OH -> 1*H2O + 3*CL
    LU(i,6258) = LU(i,6258) + 3*rate_constant(i,130) * number_density(i,79)

    !  k_HCFC22_OH_1: HCFC22 + OH -> 1*H2O + 1*CL + 1*COF2
    LU(i,6258) = LU(i,6258) + rate_constant(i,238) * number_density(i,83)

    !  k_CLO_OH_2: CLO + OH -> 1*CL + 1*HO2
    LU(i,6258) = LU(i,6258) + rate_constant(i,305) * number_density(i,86)

    !  k_HCFC141B_OH_1: HCFC141B + OH -> 1*CL + 1*COFCL
    LU(i,6258) = LU(i,6258) + rate_constant(i,360) * number_density(i,106)

    !  k_HCL_OH_1: HCL + OH -> 1*H2O + 1*CL
    LU(i,6258) = LU(i,6258) + rate_constant(i,458) * number_density(i,180)

    ! df_CLO/d(OH)
    !  k_HOCL_OH_1: HOCL + OH -> 1*H2O + 1*CLO
    LU(i,6245) = LU(i,6245) + rate_constant(i,30) * number_density(i,88)

    !  k_CLO_OH_1: CLO + OH -> 1*HCL + 1*O2
    LU(i,6245) = LU(i,6245) - rate_constant(i,43) * number_density(i,86)

    !  k_CLO_OH_2: CLO + OH -> 1*CL + 1*HO2
    LU(i,6245) = LU(i,6245) - rate_constant(i,305) * number_density(i,86)

    ! df_CLONO2/d(OH)
    !  k_CLONO2_OH_1: CLONO2 + OH -> 1*HOCL + 1*NO3
    LU(i,6234) = LU(i,6234) - rate_constant(i,334) * number_density(i,74)

    ! df_CO2/d(OH)
    !  k_MPAN_OH_1: MPAN + OH -> 0.5*HYAC + 0.5*NO3 + 0.5*CH2O + 0.5*HO2 + 0.5*CO2
    LU(i,6241) = LU(i,6241) + 0.5*rate_constant(i,28) * number_density(i,159)

    !  k_CH3COOH_OH_1: CH3COOH + OH -> 1*CH3O2 + 1*CO2 + 1*H2O
    LU(i,6241) = LU(i,6241) + rate_constant(i,107) * number_density(i,177)

    !  k_GLYALD_OH_1: GLYALD + OH -> 1*HO2 + 0.2*GLYOXAL + 0.8*CH2O + 0.8*CO2
    LU(i,6241) = LU(i,6241) + 0.8*rate_constant(i,123) * number_density(i,156)

    !  k_GLYOXAL_OH_1: GLYOXAL + OH -> 1*HO2 + 1*CO + 1*CO2
    LU(i,6241) = LU(i,6241) + rate_constant(i,176) * number_density(i,131)

    !  k_CO_OH_1: CO + OH -> 1*CO2 + 1*HO2
    LU(i,6241) = LU(i,6241) + rate_constant(i,208) * number_density(i,176)

    !  k_HCOOH_OH_1: HCOOH + OH -> 1*HO2 + 1*CO2 + 1*H2O
    LU(i,6241) = LU(i,6241) + rate_constant(i,296) * number_density(i,119)

    !  k_CH3COOOH_OH_1: CH3COOOH + OH -> 0.5*CH3CO3 + 0.5*CH2O + 0.5*CO2 + 1*H2O
    LU(i,6241) = LU(i,6241) + 0.5*rate_constant(i,393) * number_density(i,184)

    !  k_OH_TERPROD2_1: OH + TERPROD2 -> 0.15*RO2 + 0.68*CH2O + 1.8*CO2 + 0.5*CH3COCH3 + 0.65*CH3CO3 + 0.2*HO2 + 0.7*CO
    LU(i,6241) = LU(i,6241) + 1.8*rate_constant(i,397) * number_density(i,155)

    !  k_CO_OH_2: CO + OH -> 1*CO2 + 1*H
    LU(i,6241) = LU(i,6241) + rate_constant(i,429) * number_density(i,176)

    ! df_HCOOH/d(OH)
    !  k_C2H2_OH_1: C2H2 + OH -> 0.65*GLYOXAL + 0.65*OH + 0.35*HCOOH + 0.35*HO2 + 0.35*CO
    LU(i,6277) = LU(i,6277) + 0.35*rate_constant(i,2) * number_density(i,168)

    !  k_HCOOH_OH_1: HCOOH + OH -> 1*HO2 + 1*CO2 + 1*H2O
    LU(i,6277) = LU(i,6277) - rate_constant(i,296) * number_density(i,119)
  end do
  !$acc end parallel

end subroutine dforce_dy108

