    LU(i,6252) = LU(i,6252) - rate_constant(i,319) * number_density(i,93)

    ! df_C2H5O2/d(OH)
    !  k_C2H6_OH_1: C2H6 + OH -> 1*C2H5O2 + 1*H2O
    LU(i,6246) = LU(i,6246) + rate_constant(i,174) * number_density(i,174)

    !  k_C2H5OOH_OH_1: C2H5OOH + OH -> 0.5*C2H5O2 + 0.5*CH3CHO + 0.5*OH
    LU(i,6246) = LU(i,6246) + 0.5*rate_constant(i,246) * number_density(i,175)

    ! df_CH3COCHO/d(OH)
    !  k_CH3COCHO_OH_1: CH3COCHO + OH -> 1*CH3CO3 + 1*CO + 1*H2O
    LU(i,6269) = LU(i,6269) - rate_constant(i,122) * number_density(i,111)

    !  k_NOA_OH_1: NOA + OH -> 1*NO2 + 1*CH3COCHO
    LU(i,6269) = LU(i,6269) + rate_constant(i,311) * number_density(i,27)

    !  k_HYAC_OH_1: HYAC + OH -> 1*CH3COCHO + 1*HO2
    LU(i,6269) = LU(i,6269) + rate_constant(i,422) * number_density(i,57)

    ! df_CH3COCH3/d(OH)
    !  k_CH3COCH3_OH_1: CH3COCH3 + OH -> 1*RO2 + 1*H2O
    LU(i,6248) = LU(i,6248) - rate_constant(i,68) * number_density(i,89)

    !  k_CH3COCH3_OH_2: CH3COCH3 + OH -> 1*RO2 + 1*H2O
    LU(i,6248) = LU(i,6248) - rate_constant(i,69) * number_density(i,89)

    !  k_ALKNIT_OH_1: ALKNIT + OH -> 0.4*CH2O + 0.8*CH3CHO + 0.8*CH3COCH3 + 1*NO2
    LU(i,6248) = LU(i,6248) + 0.8*rate_constant(i,394) * number_density(i,5)

    !  k_OH_TERPROD2_1: OH + TERPROD2 -> 0.15*RO2 + 0.68*CH2O + 1.8*CO2 + 0.5*CH3COCH3 + 0.65*CH3CO3 + 0.2*HO2 + 0.7*CO
    LU(i,6248) = LU(i,6248) + 0.5*rate_constant(i,397) * number_density(i,155)

    ! df_O/d(OH)
    !  k_OH_OH_1: OH + OH -> 1*H2O + 1*O
    LU(i,6344) = LU(i,6344) + rate_constant(i,100) * number_density(i,166)

    !  k_OH_OH_1: OH + OH -> 1*H2O + 1*O
    LU(i,6344) = LU(i,6344) + rate_constant(i,100) * number_density(i,166)

    !  k_O_OH_1: O + OH -> 1*H + 1*O2
    LU(i,6344) = LU(i,6344) - rate_constant(i,196) * number_density(i,187)

    ! df_PHENO/d(OH)
    !  k_OH_XYLOL_1: OH + XYLOL -> 0.3*XYLOLO2 + 0.63*HO2 + 0.07*PHENO
    LU(i,6339) = LU(i,6339) + 0.07*rate_constant(i,80) * number_density(i,14)

    !  k_CRESOL_OH_1: CRESOL + OH -> 0.2*PHENO2 + 0.73*HO2 + 0.07*PHENO
    LU(i,6339) = LU(i,6339) + 0.07*rate_constant(i,95) * number_density(i,139)

    !  k_OH_PHENOL_1: OH + PHENOL -> 0.14*PHENO2 + 0.8*HO2 + 0.06*PHENO
    LU(i,6339) = LU(i,6339) + 0.06*rate_constant(i,266) * number_density(i,21)

    ! df_DMS/d(OH)
    !  k_DMS_OH_1: DMS + OH -> 0.5*SO2 + 0.5*HO2
    LU(i,6257) = LU(i,6257) - rate_constant(i,227) * number_density(i,99)

    !  k_DMS_OH_2: DMS + OH -> 1*SO2
    LU(i,6257) = LU(i,6257) - rate_constant(i,476) * number_density(i,99)

    ! df_C2H5OH/d(OH)
    !  k_C2H5OH_OH_1: C2H5OH + OH -> 1*HO2 + 1*CH3CHO
    LU(i,6283) = LU(i,6283) - rate_constant(i,477) * number_density(i,126)

    ! df_HCL/d(OH)
    !  k_CLO_OH_1: CLO + OH -> 1*HCL + 1*O2
    LU(i,6337) = LU(i,6337) + rate_constant(i,43) * number_density(i,86)

  end do
  !$acc end parallel

end subroutine dforce_dy109

subroutine dforce_dy110(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell
    !  k_HCL_OH_1: HCL + OH -> 1*H2O + 1*CL
    LU(i,6337) = LU(i,6337) - rate_constant(i,458) * number_density(i,180)

    ! df_BEPOMUC/d(OH)
    !  k_BENZENE_OH_1: BENZENE + OH -> 0.53*PHENOL + 0.12*BEPOMUC + 0.65*HO2 + 0.35*BENZO2
    LU(i,6255) = LU(i,6255) + 0.12*rate_constant(i,318) * number_density(i,101)

    ! df_BZALD/d(OH)
    !  k_BZALD_OH_1: BZALD + OH -> 1*ACBZO2
    LU(i,6265) = LU(i,6265) - rate_constant(i,57) * number_density(i,107)

    ! df_BENZENE/d(OH)
    !  k_BENZENE_OH_1: BENZENE + OH -> 0.53*PHENOL + 0.12*BEPOMUC + 0.65*HO2 + 0.35*BENZO2
    LU(i,6259) = LU(i,6259) - rate_constant(i,318) * number_density(i,101)

    ! df_C3H7O2/d(OH)
    !  k_C3H7OOH_OH_1: C3H7OOH + OH -> 1*H2O + 1*C3H7O2
    LU(i,6267) = LU(i,6267) + rate_constant(i,4) * number_density(i,20)

    !  k_C3H8_OH_1: C3H8 + OH -> 1*C3H7O2 + 1*H2O
    LU(i,6267) = LU(i,6267) + rate_constant(i,251) * number_density(i,56)

    ! df_CH3O2/d(OH)
    !  k_CH3COOH_OH_1: CH3COOH + OH -> 1*CH3O2 + 1*CO2 + 1*H2O
    LU(i,6348) = LU(i,6348) + rate_constant(i,107) * number_density(i,177)

    !  k_CH4_OH_1: CH4 + OH -> 1*CH3O2 + 1*H2O
    LU(i,6348) = LU(i,6348) + rate_constant(i,284) * number_density(i,45)

    !  k_CH3OOH_OH_1: CH3OOH + OH -> 0.7*CH3O2 + 0.3*OH + 0.3*CH2O + 1*H2O
    LU(i,6348) = LU(i,6348) + 0.7*rate_constant(i,348) * number_density(i,135)

    ! df_BCARY/d(OH)
    !  k_BCARY_OH_2: BCARY + OH -> 1*TERPO2
    LU(i,6260) = LU(i,6260) - rate_constant(i,232) * number_density(i,102)

    ! df_BIGALK/d(OH)
    !  k_BIGALK_OH_1: BIGALK + OH -> 1*ALKO2
    LU(i,6287) = LU(i,6287) - rate_constant(i,315) * number_density(i,130)

    ! df_H2O2/d(OH)
    !  k_OH_OH_2: OH + OH -> 1*H2O2
    LU(i,6336) = LU(i,6336) + rate_constant(i,213) * number_density(i,166)

    !  k_OH_OH_2: OH + OH -> 1*H2O2
    LU(i,6336) = LU(i,6336) + rate_constant(i,213) * number_density(i,166)

    !  k_H2O2_OH_1: H2O2 + OH -> 1*H2O + 1*HO2
    LU(i,6336) = LU(i,6336) - rate_constant(i,456) * number_density(i,179)

    ! df_C2H5OOH/d(OH)
    !  k_C2H5OOH_OH_1: C2H5OOH + OH -> 0.5*C2H5O2 + 0.5*CH3CHO + 0.5*OH
    LU(i,6332) = LU(i,6332) - rate_constant(i,246) * number_density(i,175)

    ! df_C2H6/d(OH)
    !  k_C2H6_OH_1: C2H6 + OH -> 1*C2H5O2 + 1*H2O
    LU(i,6331) = LU(i,6331) - rate_constant(i,174) * number_density(i,174)

    ! df_C3H8/d(OH)
    !  k_C3H8_OH_1: C3H8 + OH -> 1*C3H7O2 + 1*H2O
    LU(i,6225) = LU(i,6225) - rate_constant(i,251) * number_density(i,56)

    ! df_C3H6/d(OH)
    !  k_C3H6_OH_1: C3H6 + OH -> 1*PO2
    LU(i,6278) = LU(i,6278) - rate_constant(i,231) * number_density(i,120)

    ! df_CH2O/d(OH)
    !  k_MPAN_OH_1: MPAN + OH -> 0.5*HYAC + 0.5*NO3 + 0.5*CH2O + 0.5*HO2 + 0.5*CO2
    LU(i,6281) = LU(i,6281) + 0.5*rate_constant(i,28) * number_density(i,159)

    !  k_GLYALD_OH_1: GLYALD + OH -> 1*HO2 + 0.2*GLYOXAL + 0.8*CH2O + 0.8*CO2
    LU(i,6281) = LU(i,6281) + 0.8*rate_constant(i,123) * number_density(i,156)

    !  k_OH_PAN_1: OH + PAN -> 1*CH2O + 1*NO3
    LU(i,6281) = LU(i,6281) + rate_constant(i,144) * number_density(i,12)

    !  k_CH3OOH_OH_1: CH3OOH + OH -> 0.7*CH3O2 + 0.3*OH + 0.3*CH2O + 1*H2O
    LU(i,6281) = LU(i,6281) + 0.3*rate_constant(i,348) * number_density(i,135)

    !  k_ISOPNITA_OH_1: ISOPNITA + OH -> 0.7*HYAC + 0.7*GLYALD + 0.7*NO2 + 0.3*CH2O + 0.3*HONITR + 0.3*HO2
    LU(i,6281) = LU(i,6281) + 0.3*rate_constant(i,364) * number_density(i,118)

    !  k_CH3COOOH_OH_1: CH3COOOH + OH -> 0.5*CH3CO3 + 0.5*CH2O + 0.5*CO2 + 1*H2O
    LU(i,6281) = LU(i,6281) + 0.5*rate_constant(i,393) * number_density(i,184)

    !  k_ALKNIT_OH_1: ALKNIT + OH -> 0.4*CH2O + 0.8*CH3CHO + 0.8*CH3COCH3 + 1*NO2
    LU(i,6281) = LU(i,6281) + 0.4*rate_constant(i,394) * number_density(i,5)

    !  k_OH_TERPROD2_1: OH + TERPROD2 -> 0.15*RO2 + 0.68*CH2O + 1.8*CO2 + 0.5*CH3COCH3 + 0.65*CH3CO3 + 0.2*HO2 + 0.7*CO
    LU(i,6281) = LU(i,6281) + 0.68*rate_constant(i,397) * number_density(i,155)

    !  k_CH3OH_OH_1: CH3OH + OH -> 1*HO2 + 1*CH2O
    LU(i,6281) = LU(i,6281) + rate_constant(i,409) * number_density(i,122)

    !  k_CH2O_OH_1: CH2O + OH -> 1*CO + 1*H2O + 1*H
    LU(i,6281) = LU(i,6281) - rate_constant(i,415) * number_density(i,124)

    ! df_CH3CN/d(OH)
    !  k_CH3CN_OH_1: CH3CN + OH -> 1*HO2
    LU(i,6221) = LU(i,6221) - rate_constant(i,153) * number_density(i,50)

  end do
  !$acc end parallel

end subroutine dforce_dy110

subroutine dforce_dy111(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell
    ! df_C2H2/d(OH)
    !  k_C2H2_OH_1: C2H2 + OH -> 0.65*GLYOXAL + 0.65*OH + 0.35*HCOOH + 0.35*HO2 + 0.35*CO
    LU(i,6325) = LU(i,6325) - rate_constant(i,2) * number_density(i,168)

    ! df_CH3OH/d(OH)
    !  k_CH3OH_OH_1: CH3OH + OH -> 1*HO2 + 1*CH2O
    LU(i,6280) = LU(i,6280) - rate_constant(i,409) * number_density(i,122)

    ! df_CH3OOH/d(OH)
    !  k_CH3OOH_OH_1: CH3OOH + OH -> 0.7*CH3O2 + 0.3*OH + 0.3*CH2O + 1*H2O
    LU(i,6292) = LU(i,6292) - rate_constant(i,348) * number_density(i,135)

    ! df_CRESOL/d(OH)
    !  k_CRESOL_OH_1: CRESOL + OH -> 0.2*PHENO2 + 0.73*HO2 + 0.07*PHENO
    LU(i,6296) = LU(i,6296) - rate_constant(i,95) * number_density(i,139)

    !  k_OH_TOLUENE_2: OH + TOLUENE -> 0.18*CRESOL + 0.1*TEPOMUC + 0.07*BZOO + 0.65*TOLO2 + 0.28*HO2
    LU(i,6296) = LU(i,6296) + 0.18*rate_constant(i,435) * number_density(i,117)

    ! df_ENEO2/d(OH)
    !  k_BIGENE_OH_1: BIGENE + OH -> 1*ENEO2
    LU(i,6290) = LU(i,6290) + rate_constant(i,475) * number_density(i,97)

    ! df_MACRO2/d(OH)
    !  k_MACROOH_OH_1: MACROOH + OH -> 0.5*MCO3 + 0.2*MACRO2 + 0.1*OH + 0.2*HO2
    LU(i,6345) = LU(i,6345) + 0.2*rate_constant(i,136) * number_density(i,44)

    !  k_MACR_OH_1: MACR + OH -> 0.5*MACRO2 + 0.5*H2O + 0.5*MCO3
    LU(i,6345) = LU(i,6345) + 0.5*rate_constant(i,220) * number_density(i,157)

    !  k_MVK_OH_1: MVK + OH -> 1*MACRO2
    LU(i,6345) = LU(i,6345) + rate_constant(i,336) * number_density(i,25)

    ! df_ISOPAO2/d(OH)
    !  k_ISOP_OH_2: ISOP + OH -> 0.6*ISOPAO2 + 0.4*ISOPBO2
    LU(i,6346) = LU(i,6346) + 0.6*rate_constant(i,76) * number_density(i,142)

    ! df_MBOO2/d(OH)
    !  k_MBOOOH_OH_1: MBOOOH + OH -> 0.5*MBOO2 + 0.5*OH
    LU(i,6282) = LU(i,6282) + 0.5*rate_constant(i,105) * number_density(i,150)

    !  k_MBO_OH_1: MBO + OH -> 1*MBOO2
    LU(i,6282) = LU(i,6282) + rate_constant(i,191) * number_density(i,127)

    ! df_ISOPBO2/d(OH)
    !  k_ISOP_OH_2: ISOP + OH -> 0.6*ISOPAO2 + 0.4*ISOPBO2
    LU(i,6347) = LU(i,6347) + 0.4*rate_constant(i,76) * number_density(i,142)

    ! df_MCO3/d(OH)
    !  k_MACROOH_OH_1: MACROOH + OH -> 0.5*MCO3 + 0.2*MACRO2 + 0.1*OH + 0.2*HO2
    LU(i,6324) = LU(i,6324) + 0.5*rate_constant(i,136) * number_density(i,44)

    !  k_MACR_OH_1: MACR + OH -> 0.5*MACRO2 + 0.5*H2O + 0.5*MCO3
    LU(i,6324) = LU(i,6324) + 0.5*rate_constant(i,220) * number_density(i,157)

    ! df_MEKO2/d(OH)
    !  k_MEK_OH_1: MEK + OH -> 1*MEKO2
    LU(i,6285) = LU(i,6285) + rate_constant(i,66) * number_density(i,104)

    !  k_MEKOOH_OH_1: MEKOOH + OH -> 1*MEKO2
    LU(i,6285) = LU(i,6285) + rate_constant(i,352) * number_density(i,136)

    ! df_EO2/d(OH)
    !  k_C2H4_OH_1: C2H4 + OH -> 1*EO2
    LU(i,6320) = LU(i,6320) + rate_constant(i,319) * number_density(i,93)

    ! df_GLYOXAL/d(OH)
    !  k_C2H2_OH_1: C2H2 + OH -> 0.65*GLYOXAL + 0.65*OH + 0.35*HCOOH + 0.35*HO2 + 0.35*CO
    LU(i,6288) = LU(i,6288) + 0.65*rate_constant(i,2) * number_density(i,168)

    !  k_GLYALD_OH_1: GLYALD + OH -> 1*HO2 + 0.2*GLYOXAL + 0.8*CH2O + 0.8*CO2
    LU(i,6288) = LU(i,6288) + 0.2*rate_constant(i,123) * number_density(i,156)

    !  k_GLYOXAL_OH_1: GLYOXAL + OH -> 1*HO2 + 1*CO + 1*CO2
    LU(i,6288) = LU(i,6288) - rate_constant(i,176) * number_density(i,131)

    !  k_NC4CHO_OH_1: NC4CHO + OH -> 1*GLYOXAL + 1*NOA + 1*HO2
    LU(i,6288) = LU(i,6288) + rate_constant(i,182) * number_density(i,23)

    ! df_HMPROP/d(OH)
    !  k_HMPROP_OH_1: HMPROP + OH -> 1*HMPROPO2
    LU(i,6289) = LU(i,6289) - rate_constant(i,453) * number_density(i,132)

    ! df_MPAN/d(OH)
    !  k_MPAN_OH_1: MPAN + OH -> 0.5*HYAC + 0.5*NO3 + 0.5*CH2O + 0.5*HO2 + 0.5*CO2
    LU(i,6316) = LU(i,6316) - rate_constant(i,28) * number_density(i,159)

    ! df_NC4CH2OH/d(OH)
    !  k_NC4CH2OH_OH_1: NC4CH2OH + OH -> 1*GLYALD + 1*NOA + 1*HO2
    LU(i,6315) = LU(i,6315) - rate_constant(i,295) * number_density(i,158)

    ! df_ISOPOOH/d(OH)
    !  k_ISOPOOH_OH_1: ISOPOOH + OH -> 0.4*XO2 + 0.6*IEPOX + 0.6*OH
    LU(i,6295) = LU(i,6295) - rate_constant(i,482) * number_density(i,138)

    ! df_GLYALD/d(OH)
    !  k_ISOPNITB_OH_1: ISOPNITB + OH -> 0.5*HYAC + 0.5*GLYALD + 0.5*NOA + 1*HO2 + 0.5*HONITR
    LU(i,6313) = LU(i,6313) + 0.5*rate_constant(i,79) * number_density(i,73)

    !  k_GLYALD_OH_1: GLYALD + OH -> 1*HO2 + 0.2*GLYOXAL + 0.8*CH2O + 0.8*CO2
    LU(i,6313) = LU(i,6313) - rate_constant(i,123) * number_density(i,156)
  end do
  !$acc end parallel

end subroutine dforce_dy111

subroutine dforce_dy112(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    !  k_NC4CH2OH_OH_1: NC4CH2OH + OH -> 1*GLYALD + 1*NOA + 1*HO2
    LU(i,6313) = LU(i,6313) + rate_constant(i,295) * number_density(i,158)

    !  k_ISOPNITA_OH_1: ISOPNITA + OH -> 0.7*HYAC + 0.7*GLYALD + 0.7*NO2 + 0.3*CH2O + 0.3*HONITR + 0.3*HO2
    LU(i,6313) = LU(i,6313) + 0.7*rate_constant(i,364) * number_density(i,118)

    ! df_HO2/d(OH)
    !  k_C2H2_OH_1: C2H2 + OH -> 0.65*GLYOXAL + 0.65*OH + 0.35*HCOOH + 0.35*HO2 + 0.35*CO
    LU(i,6349) = LU(i,6349) + 0.35*rate_constant(i,2) * number_density(i,168)

    !  k_OH_XYLENES_1: OH + XYLENES -> 0.15*XYLOL + 0.23*TEPOMUC + 0.06*BZOO + 0.56*XYLENO2 + 0.38*HO2
    LU(i,6349) = LU(i,6349) + 0.38*rate_constant(i,7) * number_density(i,140)

    !  k_NO3_OH_1: NO3 + OH -> 1*HO2 + 1*NO2
    LU(i,6349) = LU(i,6349) + rate_constant(i,9) * number_density(i,165)

    !  k_OH_SO2_1: OH + SO2 -> 1*SO3 + 1*HO2
    LU(i,6349) = LU(i,6349) + rate_constant(i,22) * number_density(i,55)

    !  k_HONITR_OH_1: HONITR + OH -> 1*ONITR + 1*HO2
    LU(i,6349) = LU(i,6349) + rate_constant(i,26) * number_density(i,134)

    !  k_MPAN_OH_1: MPAN + OH -> 0.5*HYAC + 0.5*NO3 + 0.5*CH2O + 0.5*HO2 + 0.5*CO2
    LU(i,6349) = LU(i,6349) + 0.5*rate_constant(i,28) * number_density(i,159)

    !  k_ISOPNITB_OH_1: ISOPNITB + OH -> 0.5*HYAC + 0.5*GLYALD + 0.5*NOA + 1*HO2 + 0.5*HONITR
    LU(i,6349) = LU(i,6349) + rate_constant(i,79) * number_density(i,73)

    !  k_OH_XYLOL_1: OH + XYLOL -> 0.3*XYLOLO2 + 0.63*HO2 + 0.07*PHENO
    LU(i,6349) = LU(i,6349) + 0.63*rate_constant(i,80) * number_density(i,14)

    !  k_CH3CL_OH_1: CH3CL + OH -> 1*CL + 1*H2O + 1*HO2
    LU(i,6349) = LU(i,6349) + rate_constant(i,92) * number_density(i,53)

    !  k_CRESOL_OH_1: CRESOL + OH -> 0.2*PHENO2 + 0.73*HO2 + 0.07*PHENO
    LU(i,6349) = LU(i,6349) + 0.73*rate_constant(i,95) * number_density(i,139)

    !  k_CH3BR_OH_1: CH3BR + OH -> 1*BR + 1*H2O + 1*HO2
    LU(i,6349) = LU(i,6349) + rate_constant(i,112) * number_density(i,94)

    !  k_GLYALD_OH_1: GLYALD + OH -> 1*HO2 + 0.2*GLYOXAL + 0.8*CH2O + 0.8*CO2
    LU(i,6349) = LU(i,6349) + rate_constant(i,123) * number_density(i,156)

    !  k_MACROOH_OH_1: MACROOH + OH -> 0.5*MCO3 + 0.2*MACRO2 + 0.1*OH + 0.2*HO2
    LU(i,6349) = LU(i,6349) + 0.2*rate_constant(i,136) * number_density(i,44)

    !  k_CH3CN_OH_1: CH3CN + OH -> 1*HO2
    LU(i,6349) = LU(i,6349) + rate_constant(i,153) * number_density(i,50)

    !  k_O3_OH_1: O3 + OH -> 1*HO2 + 1*O2
    LU(i,6349) = LU(i,6349) + rate_constant(i,164) * number_density(i,171)

    !  k_GLYOXAL_OH_1: GLYOXAL + OH -> 1*HO2 + 1*CO + 1*CO2
    LU(i,6349) = LU(i,6349) + rate_constant(i,176) * number_density(i,131)

    !  k_NC4CHO_OH_1: NC4CHO + OH -> 1*GLYOXAL + 1*NOA + 1*HO2
    LU(i,6349) = LU(i,6349) + rate_constant(i,182) * number_density(i,23)

    !  k_BRO_OH_1: BRO + OH -> 1*BR + 1*HO2
    LU(i,6349) = LU(i,6349) + rate_constant(i,204) * number_density(i,71)

    !  k_CO_OH_1: CO + OH -> 1*CO2 + 1*HO2
    LU(i,6349) = LU(i,6349) + rate_constant(i,208) * number_density(i,176)

    !  k_DMS_OH_1: DMS + OH -> 0.5*SO2 + 0.5*HO2
    LU(i,6349) = LU(i,6349) + 0.5*rate_constant(i,227) * number_density(i,99)

    !  k_HCN_OH_1: HCN + OH -> 1*HO2
    LU(i,6349) = LU(i,6349) + rate_constant(i,234) * number_density(i,47)

    !  k_OH_PHENOL_1: OH + PHENOL -> 0.14*PHENO2 + 0.8*HO2 + 0.06*PHENO
    LU(i,6349) = LU(i,6349) + 0.8*rate_constant(i,266) * number_density(i,21)

    !  k_ISOPNOOH_OH_1: ISOPNOOH + OH -> 1*NOA + 1*HO2
    LU(i,6349) = LU(i,6349) + rate_constant(i,271) * number_density(i,160)

    !  k_HO2_OH_1: HO2 + OH -> 1*H2O + 1*O2
    LU(i,6349) = LU(i,6349) - rate_constant(i,291) * number_density(i,192)

    !  k_NC4CH2OH_OH_1: NC4CH2OH + OH -> 1*GLYALD + 1*NOA + 1*HO2
    LU(i,6349) = LU(i,6349) + rate_constant(i,295) * number_density(i,158)

    !  k_HCOOH_OH_1: HCOOH + OH -> 1*HO2 + 1*CO2 + 1*H2O
    LU(i,6349) = LU(i,6349) + rate_constant(i,296) * number_density(i,119)

    !  k_CLO_OH_2: CLO + OH -> 1*CL + 1*HO2
    LU(i,6349) = LU(i,6349) + rate_constant(i,305) * number_density(i,86)

    !  k_BENZENE_OH_1: BENZENE + OH -> 0.53*PHENOL + 0.12*BEPOMUC + 0.65*HO2 + 0.35*BENZO2
    LU(i,6349) = LU(i,6349) + 0.65*rate_constant(i,318) * number_density(i,101)

    !  k_ISOPNITA_OH_1: ISOPNITA + OH -> 0.7*HYAC + 0.7*GLYALD + 0.7*NO2 + 0.3*CH2O + 0.3*HONITR + 0.3*HO2
    LU(i,6349) = LU(i,6349) + 0.3*rate_constant(i,364) * number_density(i,118)

    !  k_OH_TERPROD2_1: OH + TERPROD2 -> 0.15*RO2 + 0.68*CH2O + 1.8*CO2 + 0.5*CH3COCH3 + 0.65*CH3CO3 + 0.2*HO2 + 0.7*CO
    LU(i,6349) = LU(i,6349) + 0.2*rate_constant(i,397) * number_density(i,155)

    !  k_CH3OH_OH_1: CH3OH + OH -> 1*HO2 + 1*CH2O
    LU(i,6349) = LU(i,6349) + rate_constant(i,409) * number_density(i,122)

  end do
  !$acc end parallel

end subroutine dforce_dy112

subroutine dforce_dy113(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell
    !  k_HYAC_OH_1: HYAC + OH -> 1*CH3COCHO + 1*HO2
    LU(i,6349) = LU(i,6349) + rate_constant(i,422) * number_density(i,57)

    !  k_OH_TOLUENE_2: OH + TOLUENE -> 0.18*CRESOL + 0.1*TEPOMUC + 0.07*BZOO + 0.65*TOLO2 + 0.28*HO2
    LU(i,6349) = LU(i,6349) + 0.28*rate_constant(i,435) * number_density(i,117)

    !  k_H2O2_OH_1: H2O2 + OH -> 1*H2O + 1*HO2
    LU(i,6349) = LU(i,6349) + rate_constant(i,456) * number_density(i,179)

    !  k_C2H5OH_OH_1: C2H5OH + OH -> 1*HO2 + 1*CH3CHO
    LU(i,6349) = LU(i,6349) + rate_constant(i,477) * number_density(i,126)

    ! df_H2/d(OH)
    !  k_H2_OH_1: H2 + OH -> 1*H2O + 1*H
    LU(i,6309) = LU(i,6309) - rate_constant(i,281) * number_density(i,152)

    ! df_HYDRALD/d(OH)
    !  k_HYDRALD_OH_1: HYDRALD + OH -> 1*XO2
    LU(i,6298) = LU(i,6298) - rate_constant(i,407) * number_density(i,141)

    ! df_ISOP/d(OH)
    !  k_ISOP_OH_2: ISOP + OH -> 0.6*ISOPAO2 + 0.4*ISOPBO2
    LU(i,6299) = LU(i,6299) - rate_constant(i,76) * number_density(i,142)

    ! df_MBOOOH/d(OH)
    !  k_MBOOOH_OH_1: MBOOOH + OH -> 0.5*MBOO2 + 0.5*OH
    LU(i,6307) = LU(i,6307) - rate_constant(i,105) * number_density(i,150)

    ! df_NTERPO2/d(OH)
    !  k_NTERPOOH_OH_1: NTERPOOH + OH -> 1*NTERPO2
    LU(i,6300) = LU(i,6300) + rate_constant(i,328) * number_density(i,114)

    ! df_TOLO2/d(OH)
    !  k_OH_TOLOOH_1: OH + TOLOOH -> 1*TOLO2
    LU(i,6301) = LU(i,6301) + rate_constant(i,70) * number_density(i,95)

    !  k_OH_TOLUENE_2: OH + TOLUENE -> 0.18*CRESOL + 0.1*TEPOMUC + 0.07*BZOO + 0.65*TOLO2 + 0.28*HO2
    LU(i,6301) = LU(i,6301) + 0.65*rate_constant(i,435) * number_density(i,117)

    ! df_TERP2O2/d(OH)
    !  k_OH_TERPROD1_1: OH + TERPROD1 -> 1*TERP2O2
    LU(i,6302) = LU(i,6302) + rate_constant(i,151) * number_density(i,58)

    !  k_OH_TERP2OOH_1: OH + TERP2OOH -> 1*TERP2O2
    LU(i,6302) = LU(i,6302) + rate_constant(i,445) * number_density(i,37)

    ! df_XYLENO2/d(OH)
    !  k_OH_XYLENES_1: OH + XYLENES -> 0.15*XYLOL + 0.23*TEPOMUC + 0.06*BZOO + 0.56*XYLENO2 + 0.38*HO2
    LU(i,6303) = LU(i,6303) + 0.56*rate_constant(i,7) * number_density(i,140)

    !  k_OH_XYLENOOH_1: OH + XYLENOOH -> 1*XYLENO2
    LU(i,6303) = LU(i,6303) + rate_constant(i,50) * number_density(i,92)

    ! df_TERPO2/d(OH)
    !  k_MTERP_OH_1: MTERP + OH -> 1*TERPO2
    LU(i,6304) = LU(i,6304) + rate_constant(i,181) * number_density(i,31)

    !  k_BCARY_OH_2: BCARY + OH -> 1*TERPO2
    LU(i,6304) = LU(i,6304) + rate_constant(i,232) * number_density(i,102)

    !  k_OH_TERPOOH_1: OH + TERPOOH -> 1*TERPO2
    LU(i,6304) = LU(i,6304) + rate_constant(i,314) * number_density(i,113)

    ! df_XYLOLO2/d(OH)
    !  k_OH_XYLOL_1: OH + XYLOL -> 0.3*XYLOLO2 + 0.63*HO2 + 0.07*PHENO
    LU(i,6305) = LU(i,6305) + 0.3*rate_constant(i,80) * number_density(i,14)

    !  k_OH_XYLOLOOH_1: OH + XYLOLOOH -> 1*XYLOLO2
    LU(i,6305) = LU(i,6305) + rate_constant(i,421) * number_density(i,26)

    ! df_XYLENES/d(OH)
    !  k_OH_XYLENES_1: OH + XYLENES -> 0.15*XYLOL + 0.23*TEPOMUC + 0.06*BZOO + 0.56*XYLENO2 + 0.38*HO2
    LU(i,6297) = LU(i,6297) - rate_constant(i,7) * number_density(i,140)

    ! df_PO2/d(OH)
    !  k_OH_POOH_1: OH + POOH -> 0.5*PO2 + 0.5*OH + 0.5*HYAC + 1*H2O
    LU(i,6308) = LU(i,6308) + 0.5*rate_constant(i,127) * number_density(i,9)

    !  k_C3H6_OH_1: C3H6 + OH -> 1*PO2
    LU(i,6308) = LU(i,6308) + rate_constant(i,231) * number_density(i,120)

    ! df_TOLUENE/d(OH)
    !  k_OH_TOLUENE_2: OH + TOLUENE -> 0.18*CRESOL + 0.1*TEPOMUC + 0.07*BZOO + 0.65*TOLO2 + 0.28*HO2
    LU(i,6275) = LU(i,6275) - rate_constant(i,435) * number_density(i,117)

    ! df_XO2/d(OH)
    !  k_OH_XOOH_1: OH + XOOH -> 0.5*XO2 + 0.5*OH
    LU(i,6310) = LU(i,6310) + 0.5*rate_constant(i,185) * number_density(i,103)

    !  k_IEPOX_OH_1: IEPOX + OH -> 1*XO2
    LU(i,6310) = LU(i,6310) + rate_constant(i,190) * number_density(i,76)

    !  k_HYDRALD_OH_1: HYDRALD + OH -> 1*XO2
    LU(i,6310) = LU(i,6310) + rate_constant(i,407) * number_density(i,141)

    !  k_HPALD_OH_1: HPALD + OH -> 1*XO2
    LU(i,6310) = LU(i,6310) + rate_constant(i,444) * number_density(i,67)

    !  k_ISOPOOH_OH_1: ISOPOOH + OH -> 0.4*XO2 + 0.6*IEPOX + 0.6*OH
    LU(i,6310) = LU(i,6310) + 0.4*rate_constant(i,482) * number_density(i,138)

  end do
  !$acc end parallel

end subroutine dforce_dy113

subroutine dforce_dy114(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell
    ! df_XOOH/d(OH)
    !  k_OH_XOOH_1: OH + XOOH -> 0.5*XO2 + 0.5*OH
    LU(i,6261) = LU(i,6261) - rate_constant(i,185) * number_density(i,103)

    ! df_TERPROD2/d(OH)
    !  k_OH_TERPROD2_1: OH + TERPROD2 -> 0.15*RO2 + 0.68*CH2O + 1.8*CO2 + 0.5*CH3COCH3 + 0.65*CH3CO3 + 0.2*HO2 + 0.7*CO
    LU(i,6312) = LU(i,6312) - rate_constant(i,397) * number_density(i,155)

    ! df_MEKOOH/d(OH)
    !  k_MEKOOH_OH_1: MEKOOH + OH -> 1*MEKO2
    LU(i,6293) = LU(i,6293) - rate_constant(i,352) * number_density(i,136)

    ! df_MACR/d(OH)
    !  k_MACR_OH_1: MACR + OH -> 0.5*MACRO2 + 0.5*H2O + 0.5*MCO3
    LU(i,6314) = LU(i,6314) - rate_constant(i,220) * number_density(i,157)

    ! df_HONITR/d(OH)
    !  k_HONITR_OH_1: HONITR + OH -> 1*ONITR + 1*HO2
    LU(i,6291) = LU(i,6291) - rate_constant(i,26) * number_density(i,134)

    !  k_ISOPNITB_OH_1: ISOPNITB + OH -> 0.5*HYAC + 0.5*GLYALD + 0.5*NOA + 1*HO2 + 0.5*HONITR
    LU(i,6291) = LU(i,6291) + 0.5*rate_constant(i,79) * number_density(i,73)

    !  k_ISOPNITA_OH_1: ISOPNITA + OH -> 0.7*HYAC + 0.7*GLYALD + 0.7*NO2 + 0.3*CH2O + 0.3*HONITR + 0.3*HO2
    LU(i,6291) = LU(i,6291) + 0.3*rate_constant(i,364) * number_density(i,118)

    ! df_ISOPNITA/d(OH)
    !  k_ISOPNITA_OH_1: ISOPNITA + OH -> 0.7*HYAC + 0.7*GLYALD + 0.7*NO2 + 0.3*CH2O + 0.3*HONITR + 0.3*HO2
    LU(i,6276) = LU(i,6276) - rate_constant(i,364) * number_density(i,118)

    ! df_ISOPNOOH/d(OH)
    !  k_ISOPNOOH_OH_1: ISOPNOOH + OH -> 1*NOA + 1*HO2
    LU(i,6317) = LU(i,6317) - rate_constant(i,271) * number_density(i,160)

    ! df_IEPOX/d(OH)
    !  k_IEPOX_OH_1: IEPOX + OH -> 1*XO2
    LU(i,6236) = LU(i,6236) - rate_constant(i,190) * number_density(i,76)

    !  k_ISOPOOH_OH_1: ISOPOOH + OH -> 0.4*XO2 + 0.6*IEPOX + 0.6*OH
    LU(i,6236) = LU(i,6236) + 0.6*rate_constant(i,482) * number_density(i,138)

    ! df_ONITR/d(OH)
    !  k_HONITR_OH_1: HONITR + OH -> 1*ONITR + 1*HO2
    LU(i,6286) = LU(i,6286) + rate_constant(i,26) * number_density(i,134)

    ! df_MBO/d(OH)
    !  k_MBO_OH_1: MBO + OH -> 1*MBOO2
    LU(i,6284) = LU(i,6284) - rate_constant(i,191) * number_density(i,127)

    ! df_NO3/d(OH)
    !  k_NO3_OH_1: NO3 + OH -> 1*HO2 + 1*NO2
    LU(i,6322) = LU(i,6322) - rate_constant(i,9) * number_density(i,165)

    !  k_MPAN_OH_1: MPAN + OH -> 0.5*HYAC + 0.5*NO3 + 0.5*CH2O + 0.5*HO2 + 0.5*CO2
    LU(i,6322) = LU(i,6322) + 0.5*rate_constant(i,28) * number_density(i,159)

    !  k_OH_PAN_1: OH + PAN -> 1*CH2O + 1*NO3
    LU(i,6322) = LU(i,6322) + rate_constant(i,144) * number_density(i,12)

    !  k_CLONO2_OH_1: CLONO2 + OH -> 1*HOCL + 1*NO3
    LU(i,6322) = LU(i,6322) + rate_constant(i,334) * number_density(i,74)

    !  k_HNO3_OH_1: HNO3 + OH -> 1*NO3 + 1*H2O
    LU(i,6322) = LU(i,6322) + rate_constant(i,398) * number_density(i,42)

    !  k_HNO3_OH_2: HNO3 + OH -> 1*NO3 + 1*H2O
    LU(i,6322) = LU(i,6322) + rate_constant(i,399) * number_density(i,42)

    ! df_OH/d(OH)
    !  k_C2H2_OH_1: C2H2 + OH -> 0.65*GLYOXAL + 0.65*OH + 0.35*HCOOH + 0.35*HO2 + 0.35*CO
    LU(i,6323) = LU(i,6323) - 0.35*rate_constant(i,2) * number_density(i,168)

    !  k_C3H7OOH_OH_1: C3H7OOH + OH -> 1*H2O + 1*C3H7O2
    LU(i,6323) = LU(i,6323) - rate_constant(i,4) * number_density(i,20)

    !  k_OH_XYLENES_1: OH + XYLENES -> 0.15*XYLOL + 0.23*TEPOMUC + 0.06*BZOO + 0.56*XYLENO2 + 0.38*HO2
    LU(i,6323) = LU(i,6323) - rate_constant(i,7) * number_density(i,140)

    !  k_NO3_OH_1: NO3 + OH -> 1*HO2 + 1*NO2
    LU(i,6323) = LU(i,6323) - rate_constant(i,9) * number_density(i,165)

    !  k_HCFC142B_OH_1: HCFC142B + OH -> 1*CL + 1*COF2
    LU(i,6323) = LU(i,6323) - rate_constant(i,14) * number_density(i,172)

    !  k_OH_SO2_1: OH + SO2 -> 1*SO3 + 1*HO2
    LU(i,6323) = LU(i,6323) - rate_constant(i,22) * number_density(i,55)

    !  k_HONITR_OH_1: HONITR + OH -> 1*ONITR + 1*HO2
    LU(i,6323) = LU(i,6323) - rate_constant(i,26) * number_density(i,134)

    !  k_MPAN_OH_1: MPAN + OH -> 0.5*HYAC + 0.5*NO3 + 0.5*CH2O + 0.5*HO2 + 0.5*CO2
    LU(i,6323) = LU(i,6323) - rate_constant(i,28) * number_density(i,159)

    !  k_HOCL_OH_1: HOCL + OH -> 1*H2O + 1*CLO
    LU(i,6323) = LU(i,6323) - rate_constant(i,30) * number_density(i,88)

    !  k_CLO_OH_1: CLO + OH -> 1*HCL + 1*O2
    LU(i,6323) = LU(i,6323) - rate_constant(i,43) * number_density(i,86)

    !  k_OH_XYLENOOH_1: OH + XYLENOOH -> 1*XYLENO2
    LU(i,6323) = LU(i,6323) - rate_constant(i,50) * number_density(i,92)
  end do
  !$acc end parallel

end subroutine dforce_dy114

subroutine dforce_dy115(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    !  k_HO2NO2_OH_1: HO2NO2 + OH -> 1*H2O + 1*NO2 + 1*O2
    LU(i,6323) = LU(i,6323) - rate_constant(i,54) * number_density(i,35)

    !  k_BZALD_OH_1: BZALD + OH -> 1*ACBZO2
    LU(i,6323) = LU(i,6323) - rate_constant(i,57) * number_density(i,107)

    !  k_MEK_OH_1: MEK + OH -> 1*MEKO2
    LU(i,6323) = LU(i,6323) - rate_constant(i,66) * number_density(i,104)

    !  k_CH3COCH3_OH_1: CH3COCH3 + OH -> 1*RO2 + 1*H2O
    LU(i,6323) = LU(i,6323) - rate_constant(i,68) * number_density(i,89)

    !  k_CH3COCH3_OH_2: CH3COCH3 + OH -> 1*RO2 + 1*H2O
    LU(i,6323) = LU(i,6323) - rate_constant(i,69) * number_density(i,89)

    !  k_OH_TOLOOH_1: OH + TOLOOH -> 1*TOLO2
    LU(i,6323) = LU(i,6323) - rate_constant(i,70) * number_density(i,95)

    !  k_ISOP_OH_2: ISOP + OH -> 0.6*ISOPAO2 + 0.4*ISOPBO2
    LU(i,6323) = LU(i,6323) - rate_constant(i,76) * number_density(i,142)

    !  k_ISOPNITB_OH_1: ISOPNITB + OH -> 0.5*HYAC + 0.5*GLYALD + 0.5*NOA + 1*HO2 + 0.5*HONITR
    LU(i,6323) = LU(i,6323) - rate_constant(i,79) * number_density(i,73)

    !  k_OH_XYLOL_1: OH + XYLOL -> 0.3*XYLOLO2 + 0.63*HO2 + 0.07*PHENO
    LU(i,6323) = LU(i,6323) - rate_constant(i,80) * number_density(i,14)

    !  k_CH3CL_OH_1: CH3CL + OH -> 1*CL + 1*H2O + 1*HO2
    LU(i,6323) = LU(i,6323) - rate_constant(i,92) * number_density(i,53)

    !  k_CRESOL_OH_1: CRESOL + OH -> 0.2*PHENO2 + 0.73*HO2 + 0.07*PHENO
    LU(i,6323) = LU(i,6323) - rate_constant(i,95) * number_density(i,139)

    !  k_OH_OH_1: OH + OH -> 1*H2O + 1*O
    LU(i,6323) = LU(i,6323) - rate_constant(i,100) * number_density(i,166)

