    !  k_OH_SO_1: OH + SO -> 1*SO2 + 1*H
    LU(i,6323) = LU(i,6323) - rate_constant(i,486) * number_density(i,32)

    ! df_PHENOOH/d(OH)
    !  k_OH_PHENOOH_1: OH + PHENOOH -> 1*PHENO2
    LU(i,6273) = LU(i,6273) - rate_constant(i,412) * number_density(i,115)

    ! df_PHENOL/d(OH)
    !  k_OH_PHENOL_1: OH + PHENOL -> 0.14*PHENO2 + 0.8*HO2 + 0.06*PHENO
    LU(i,6196) = LU(i,6196) - rate_constant(i,266) * number_density(i,21)

    !  k_BENZENE_OH_1: BENZENE + OH -> 0.53*PHENOL + 0.12*BEPOMUC + 0.65*HO2 + 0.35*BENZO2
    LU(i,6196) = LU(i,6196) + 0.53*rate_constant(i,318) * number_density(i,101)

    ! df_XYLOL/d(OH)
    !  k_OH_XYLENES_1: OH + XYLENES -> 0.15*XYLOL + 0.23*TEPOMUC + 0.06*BZOO + 0.56*XYLENO2 + 0.38*HO2
