    ! df_ROOH/d(OH)
    !  k_OH_ROOH_1: OH + ROOH -> 1*RO2 + 1*H2O
    LU(i,6279) = LU(i,6279) - rate_constant(i,371) * number_density(i,121)

    ! df_O3/d(OH)
    !  k_O3_OH_1: O3 + OH -> 1*HO2 + 1*O2
    LU(i,6328) = LU(i,6328) - rate_constant(i,164) * number_density(i,171)

