    !  k_OH_TOLOOH_1: OH + TOLOOH -> 1*TOLO2
    LU(i,6254) = LU(i,6254) - rate_constant(i,70) * number_density(i,95)

    ! df_XYLENOOH/d(OH)
    !  k_OH_XYLENOOH_1: OH + XYLENOOH -> 1*XYLENO2
    LU(i,6251) = LU(i,6251) - rate_constant(i,50) * number_density(i,92)

