    !  k_OH_XYLOLOOH_1: OH + XYLOLOOH -> 1*XYLOLO2
    LU(i,6199) = LU(i,6199) - rate_constant(i,421) * number_density(i,26)

    ! df_CO/d(OH)
    !  k_C2H2_OH_1: C2H2 + OH -> 0.65*GLYOXAL + 0.65*OH + 0.35*HCOOH + 0.35*HO2 + 0.35*CO
    LU(i,6333) = LU(i,6333) + 0.35*rate_constant(i,2) * number_density(i,168)

    !  k_CH3COCHO_OH_1: CH3COCHO + OH -> 1*CH3CO3 + 1*CO + 1*H2O
    LU(i,6333) = LU(i,6333) + rate_constant(i,122) * number_density(i,111)

    !  k_GLYOXAL_OH_1: GLYOXAL + OH -> 1*HO2 + 1*CO + 1*CO2
    LU(i,6333) = LU(i,6333) + rate_constant(i,176) * number_density(i,131)

    !  k_CO_OH_1: CO + OH -> 1*CO2 + 1*HO2
    LU(i,6333) = LU(i,6333) - rate_constant(i,208) * number_density(i,176)

    !  k_OCS_OH_1: OCS + OH -> 1*SO2 + 1*CO + 1*H
    LU(i,6333) = LU(i,6333) + rate_constant(i,312) * number_density(i,29)

    !  k_OH_TERPROD2_1: OH + TERPROD2 -> 0.15*RO2 + 0.68*CH2O + 1.8*CO2 + 0.5*CH3COCH3 + 0.65*CH3CO3 + 0.2*HO2 + 0.7*CO
    LU(i,6333) = LU(i,6333) + 0.7*rate_constant(i,397) * number_density(i,155)

    !  k_CH2O_OH_1: CH2O + OH -> 1*CO + 1*H2O + 1*H
    LU(i,6333) = LU(i,6333) + rate_constant(i,415) * number_density(i,124)

    !  k_CO_OH_2: CO + OH -> 1*CO2 + 1*H
    LU(i,6333) = LU(i,6333) - rate_constant(i,429) * number_density(i,176)

    ! df_CH3COOH/d(OH)
    !  k_CH3COOH_OH_1: CH3COOH + OH -> 1*CH3O2 + 1*CO2 + 1*H2O
    LU(i,6334) = LU(i,6334) - rate_constant(i,107) * number_density(i,177)

    ! df_CH3CHO/d(OH)
    !  k_CH3CHO_OH_1: CH3CHO + OH -> 1*CH3CO3 + 1*H2O
    LU(i,6335) = LU(i,6335) - rate_constant(i,108) * number_density(i,178)

    !  k_C2H5OOH_OH_1: C2H5OOH + OH -> 0.5*C2H5O2 + 0.5*CH3CHO + 0.5*OH
    LU(i,6335) = LU(i,6335) + 0.5*rate_constant(i,246) * number_density(i,175)

    !  k_ALKNIT_OH_1: ALKNIT + OH -> 0.4*CH2O + 0.8*CH3CHO + 0.8*CH3COCH3 + 1*NO2
    LU(i,6335) = LU(i,6335) + 0.8*rate_constant(i,394) * number_density(i,5)

    !  k_C2H5OH_OH_1: C2H5OH + OH -> 1*HO2 + 1*CH3CHO
    LU(i,6335) = LU(i,6335) + rate_constant(i,477) * number_density(i,126)

    ! df_ALKOOH/d(OH)
    !  k_ALKOOH_OH_1: ALKOOH + OH -> 1*ALKO2
    LU(i,6228) = LU(i,6228) - rate_constant(i,104) * number_density(i,65)

  end do
  !$acc end parallel

end subroutine dforce_dy118

subroutine dforce_dy119(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell
    ! df_BENZOOH/d(OH)
    !  k_BENZOOH_OH_1: BENZOOH + OH -> 1*BENZO2
    LU(i,6250) = LU(i,6250) - rate_constant(i,382) * number_density(i,91)

    ! df_ALKO2/d(OH)
    !  k_ALKOOH_OH_1: ALKOOH + OH -> 1*ALKO2
    LU(i,6244) = LU(i,6244) + rate_constant(i,104) * number_density(i,65)

    !  k_BIGALK_OH_1: BIGALK + OH -> 1*ALKO2
    LU(i,6244) = LU(i,6244) + rate_constant(i,315) * number_density(i,130)

    ! df_HO2NO2/d(OH)
    !  k_HO2NO2_OH_1: HO2NO2 + OH -> 1*H2O + 1*NO2 + 1*O2
    LU(i,6208) = LU(i,6208) - rate_constant(i,54) * number_density(i,35)

    ! df_C3H7OOH/d(OH)
    !  k_C3H7OOH_OH_1: C3H7OOH + OH -> 1*H2O + 1*C3H7O2
    LU(i,6195) = LU(i,6195) - rate_constant(i,4) * number_density(i,20)

    ! df_NH3/d(OH)
    !  k_NH3_OH_1: NH3 + OH -> 1*H2O
    LU(i,6180) = LU(i,6180) - rate_constant(i,461) * number_density(i,3)

    ! df_TERP2OOH/d(OH)
    !  k_OH_TERP2OOH_1: OH + TERP2OOH -> 1*TERP2O2
    LU(i,6209) = LU(i,6209) - rate_constant(i,445) * number_density(i,37)

    ! df_POOH/d(OH)
    !  k_OH_POOH_1: OH + POOH -> 0.5*PO2 + 0.5*OH + 0.5*HYAC + 1*H2O
    LU(i,6185) = LU(i,6185) - rate_constant(i,127) * number_density(i,9)

    ! df_NOA/d(OH)
    !  k_ISOPNITB_OH_1: ISOPNITB + OH -> 0.5*HYAC + 0.5*GLYALD + 0.5*NOA + 1*HO2 + 0.5*HONITR
    LU(i,6200) = LU(i,6200) + 0.5*rate_constant(i,79) * number_density(i,73)

    !  k_NC4CHO_OH_1: NC4CHO + OH -> 1*GLYOXAL + 1*NOA + 1*HO2
    LU(i,6200) = LU(i,6200) + rate_constant(i,182) * number_density(i,23)

    !  k_ISOPNOOH_OH_1: ISOPNOOH + OH -> 1*NOA + 1*HO2
    LU(i,6200) = LU(i,6200) + rate_constant(i,271) * number_density(i,160)

    !  k_NC4CH2OH_OH_1: NC4CH2OH + OH -> 1*GLYALD + 1*NOA + 1*HO2
    LU(i,6200) = LU(i,6200) + rate_constant(i,295) * number_density(i,158)

    !  k_NOA_OH_1: NOA + OH -> 1*NO2 + 1*CH3COCHO
    LU(i,6200) = LU(i,6200) - rate_constant(i,311) * number_density(i,27)

    ! df_NC4CHO/d(OH)
    !  k_NC4CHO_OH_1: NC4CHO + OH -> 1*GLYOXAL + 1*NOA + 1*HO2
    LU(i,6197) = LU(i,6197) - rate_constant(i,182) * number_density(i,23)

    ! df_TEPOMUC/d(OH)
    !  k_OH_XYLENES_1: OH + XYLENES -> 0.15*XYLOL + 0.23*TEPOMUC + 0.06*BZOO + 0.56*XYLENO2 + 0.38*HO2
    LU(i,6179) = LU(i,6179) + 0.23*rate_constant(i,7) * number_density(i,140)

    !  k_OH_TOLUENE_2: OH + TOLUENE -> 0.18*CRESOL + 0.1*TEPOMUC + 0.07*BZOO + 0.65*TOLO2 + 0.28*HO2
    LU(i,6179) = LU(i,6179) + 0.1*rate_constant(i,435) * number_density(i,117)

    ! df_PHENO2/d(PHENOOH)
    !  k_OH_PHENOOH_1: OH + PHENOOH -> 1*PHENO2
    LU(i,2765) = LU(i,2765) + rate_constant(i,412) * number_density(i,166)

    ! df_GLYOXAL/d(PHENOOH)
    !  k_PHENOOH_1: PHENOOH -> 1*OH + 1*HO2 + 0.7*GLYOXAL
    LU(i,2788) = LU(i,2788) + 0.7*rate_constant(i,98)

    ! df_HO2/d(PHENOOH)
    !  k_PHENOOH_1: PHENOOH -> 1*OH + 1*HO2 + 0.7*GLYOXAL
    LU(i,2830) = LU(i,2830) + rate_constant(i,98)

    ! df_OH/d(PHENOOH)
    !  k_PHENOOH_1: PHENOOH -> 1*OH + 1*HO2 + 0.7*GLYOXAL
    LU(i,2804) = LU(i,2804) + rate_constant(i,98)

    !  k_OH_PHENOOH_1: OH + PHENOOH -> 1*PHENO2
    LU(i,2804) = LU(i,2804) - rate_constant(i,412) * number_density(i,166)

    ! df_PHENOOH/d(PHENOOH)
    !  k_PHENOOH_1: PHENOOH -> 1*OH + 1*HO2 + 0.7*GLYOXAL
    LU(i,2782) = LU(i,2782) - rate_constant(i,98)

    !  k_OH_PHENOOH_1: OH + PHENOOH -> 1*PHENO2
    LU(i,2782) = LU(i,2782) - rate_constant(i,412) * number_density(i,166)

    ! df_PHENO2/d(PHENOL)
    !  k_OH_PHENOL_1: OH + PHENOL -> 0.14*PHENO2 + 0.8*HO2 + 0.06*PHENO
    LU(i,79) = LU(i,79) + 0.14*rate_constant(i,266) * number_density(i,166)

    ! df_PHENO/d(PHENOL)
    !  k_OH_PHENOL_1: OH + PHENOL -> 0.14*PHENO2 + 0.8*HO2 + 0.06*PHENO
    LU(i,81) = LU(i,81) + 0.06*rate_constant(i,266) * number_density(i,166)

    ! df_HO2/d(PHENOL)
    !  k_OH_PHENOL_1: OH + PHENOL -> 0.14*PHENO2 + 0.8*HO2 + 0.06*PHENO
    LU(i,82) = LU(i,82) + 0.8*rate_constant(i,266) * number_density(i,166)

    ! df_OH/d(PHENOL)
    !  k_OH_PHENOL_1: OH + PHENOL -> 0.14*PHENO2 + 0.8*HO2 + 0.06*PHENO
    LU(i,80) = LU(i,80) - rate_constant(i,266) * number_density(i,166)

    ! df_PHENOL/d(PHENOL)
    !  k_OH_PHENOL_1: OH + PHENOL -> 0.14*PHENO2 + 0.8*HO2 + 0.06*PHENO
    LU(i,78) = LU(i,78) - rate_constant(i,266) * number_density(i,166)
  end do
  !$acc end parallel

end subroutine dforce_dy119

subroutine dforce_dy120(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! df_PHENO/d(XYLOL)
    !  k_OH_XYLOL_1: OH + XYLOL -> 0.3*XYLOLO2 + 0.63*HO2 + 0.07*PHENO
    LU(i,65) = LU(i,65) + 0.07*rate_constant(i,80) * number_density(i,166)

    ! df_HO2/d(XYLOL)
    !  k_OH_XYLOL_1: OH + XYLOL -> 0.3*XYLOLO2 + 0.63*HO2 + 0.07*PHENO
    LU(i,66) = LU(i,66) + 0.63*rate_constant(i,80) * number_density(i,166)

    ! df_XYLOLO2/d(XYLOL)
    !  k_OH_XYLOL_1: OH + XYLOL -> 0.3*XYLOLO2 + 0.63*HO2 + 0.07*PHENO
    LU(i,63) = LU(i,63) + 0.3*rate_constant(i,80) * number_density(i,166)

    ! df_OH/d(XYLOL)
    !  k_OH_XYLOL_1: OH + XYLOL -> 0.3*XYLOLO2 + 0.63*HO2 + 0.07*PHENO
    LU(i,64) = LU(i,64) - rate_constant(i,80) * number_density(i,166)

    ! df_XYLOL/d(XYLOL)
    !  k_OH_XYLOL_1: OH + XYLOL -> 0.3*XYLOLO2 + 0.63*HO2 + 0.07*PHENO
    LU(i,62) = LU(i,62) - rate_constant(i,80) * number_density(i,166)

    ! df_RO2/d(ROOH)
    !  k_OH_ROOH_1: OH + ROOH -> 1*RO2 + 1*H2O
    LU(i,3106) = LU(i,3106) + rate_constant(i,371) * number_density(i,166)

    ! df_CH3CO3/d(ROOH)
    !  k_ROOH_1: ROOH -> 1*CH3CO3 + 1*CH2O + 1*OH
    LU(i,3107) = LU(i,3107) + rate_constant(i,148)

    ! df_H2O/d(ROOH)
    !  k_OH_ROOH_1: OH + ROOH -> 1*RO2 + 1*H2O
    LU(i,3111) = LU(i,3111) + rate_constant(i,371) * number_density(i,166)

    ! df_CH2O/d(ROOH)
    !  k_ROOH_1: ROOH -> 1*CH3CO3 + 1*CH2O + 1*OH
    LU(i,3128) = LU(i,3128) + rate_constant(i,148)

    ! df_OH/d(ROOH)
    !  k_ROOH_1: ROOH -> 1*CH3CO3 + 1*CH2O + 1*OH
    LU(i,3147) = LU(i,3147) + rate_constant(i,148)

    !  k_OH_ROOH_1: OH + ROOH -> 1*RO2 + 1*H2O
    LU(i,3147) = LU(i,3147) - rate_constant(i,371) * number_density(i,166)

    ! df_ROOH/d(ROOH)
    !  k_ROOH_1: ROOH -> 1*CH3CO3 + 1*CH2O + 1*OH
    LU(i,3126) = LU(i,3126) - rate_constant(i,148)

    !  k_OH_ROOH_1: OH + ROOH -> 1*RO2 + 1*H2O
    LU(i,3126) = LU(i,3126) - rate_constant(i,371) * number_density(i,166)

    ! df_O2/d(O3)
    !  k_O3_SO_1: O3 + SO -> 1*SO2 + 1*O2
    LU(i,6637) = LU(i,6637) + rate_constant(i,140) * number_density(i,32)

    !  k_CL_O3_1: CL + O3 -> 1*CLO + 1*O2
    LU(i,6637) = LU(i,6637) + rate_constant(i,150) * number_density(i,100)

    !  k_H_O3_1: H + O3 -> 1*OH + 1*O2
    LU(i,6637) = LU(i,6637) + rate_constant(i,158) * number_density(i,48)

    !  k_O3_OH_1: O3 + OH -> 1*HO2 + 1*O2
    LU(i,6637) = LU(i,6637) + rate_constant(i,164) * number_density(i,166)

    !  k_NO2_O3_1: NO2 + O3 -> 1*NO3 + 1*O2
    LU(i,6637) = LU(i,6637) + rate_constant(i,165) * number_density(i,54)

    !  k_O_O3_1: O + O3 -> 2*O2
    LU(i,6637) = LU(i,6637) + 2*rate_constant(i,187) * number_density(i,187)

    !  k_BR_O3_1: BR + O3 -> 1*BRO + 1*O2
    LU(i,6637) = LU(i,6637) + rate_constant(i,317) * number_density(i,90)

    !  k_O3_1: O3 -> 1*O + 1*O2
    LU(i,6637) = LU(i,6637) + rate_constant(i,367)

    !  k_HO2_O3_1: HO2 + O3 -> 1*OH + 2*O2
    LU(i,6637) = LU(i,6637) + 2*rate_constant(i,368) * number_density(i,192)

    !  k_O3_2: O3 -> 1*O1D + 1*O2
    LU(i,6637) = LU(i,6637) + rate_constant(i,417)

    !  k_NO_O3_1: NO + O3 -> 1*NO2 + 1*O2
    LU(i,6637) = LU(i,6637) + rate_constant(i,439) * number_density(i,137)

    !  k_O1D_O3_1: O1D + O3 -> 1*O2
    LU(i,6637) = LU(i,6637) + rate_constant(i,487) * number_density(i,112)

    ! df_MVK/d(O3)
    !  k_ISOP_O3_2: ISOP + O3 -> 0.3*MACR + 0.2*MVK + 0.11*HCOOH + 0.62*CO + 0.32*OH + 0.37*HO2 + 0.91*CH2O + 0.08*CH3CO3 + 0.13*C3H6 + 0.05*CH3O2
    LU(i,6633) = LU(i,6633) + 0.2*rate_constant(i,377) * number_density(i,142)

    !  k_MVK_O3_1: MVK + O3 -> 0.6*CH2O + 0.56*CO + 0.1*CH3CHO + 0.1*CO2 + 0.28*CH3CO3 + 0.5*CH3COCHO + 0.28*HO2 + 0.36*OH + 0.12*HCOOH
    LU(i,6633) = LU(i,6633) - rate_constant(i,420) * number_density(i,25)

    ! df_SOAG0/d(O3)
    !  k_MTERP_O3_1: MTERP + O3 -> 1*MTERP + 1*O3 + 0.0508*SOAG0 + 0.1149*SOAG1 + 0.0348*SOAG2 + 0.0554*SOAG3 + 0.1278*SOAG4
    LU(i,6628) = LU(i,6628) + 0.0508*rate_constant(i,78) * number_density(i,31)

    !  k_BCARY_O3_2: BCARY + O3 -> 1*BCARY + 1*O3 + 0.2202*SOAG0 + 0.2067*SOAG1 + 0.0653*SOAG2 + 0.1284*SOAG3 + 0.114*SOAG4
    LU(i,6628) = LU(i,6628) + 0.2202*rate_constant(i,349) * number_density(i,102)
  end do
  !$acc end parallel

end subroutine dforce_dy120

subroutine dforce_dy121(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! df_SOAG1/d(O3)
    !  k_MTERP_O3_1: MTERP + O3 -> 1*MTERP + 1*O3 + 0.0508*SOAG0 + 0.1149*SOAG1 + 0.0348*SOAG2 + 0.0554*SOAG3 + 0.1278*SOAG4
    LU(i,6629) = LU(i,6629) + 0.1149*rate_constant(i,78) * number_density(i,31)

    !  k_BCARY_O3_2: BCARY + O3 -> 1*BCARY + 1*O3 + 0.2202*SOAG0 + 0.2067*SOAG1 + 0.0653*SOAG2 + 0.1284*SOAG3 + 0.114*SOAG4
    LU(i,6629) = LU(i,6629) + 0.2067*rate_constant(i,349) * number_density(i,102)

    ! df_SOAG2/d(O3)
    !  k_MTERP_O3_1: MTERP + O3 -> 1*MTERP + 1*O3 + 0.0508*SOAG0 + 0.1149*SOAG1 + 0.0348*SOAG2 + 0.0554*SOAG3 + 0.1278*SOAG4
    LU(i,6630) = LU(i,6630) + 0.0348*rate_constant(i,78) * number_density(i,31)

    !  k_BCARY_O3_2: BCARY + O3 -> 1*BCARY + 1*O3 + 0.2202*SOAG0 + 0.2067*SOAG1 + 0.0653*SOAG2 + 0.1284*SOAG3 + 0.114*SOAG4
    LU(i,6630) = LU(i,6630) + 0.0653*rate_constant(i,349) * number_density(i,102)

    ! df_SOAG3/d(O3)
    !  k_ISOP_O3_1: ISOP + O3 -> 1*ISOP + 1*O3 + 0.0033*SOAG3
    LU(i,6631) = LU(i,6631) + 0.0033*rate_constant(i,42) * number_density(i,142)

    !  k_MTERP_O3_1: MTERP + O3 -> 1*MTERP + 1*O3 + 0.0508*SOAG0 + 0.1149*SOAG1 + 0.0348*SOAG2 + 0.0554*SOAG3 + 0.1278*SOAG4
    LU(i,6631) = LU(i,6631) + 0.0554*rate_constant(i,78) * number_density(i,31)

    !  k_BCARY_O3_2: BCARY + O3 -> 1*BCARY + 1*O3 + 0.2202*SOAG0 + 0.2067*SOAG1 + 0.0653*SOAG2 + 0.1284*SOAG3 + 0.114*SOAG4
    LU(i,6631) = LU(i,6631) + 0.1284*rate_constant(i,349) * number_density(i,102)

    ! df_SOAG4/d(O3)
    !  k_MTERP_O3_1: MTERP + O3 -> 1*MTERP + 1*O3 + 0.0508*SOAG0 + 0.1149*SOAG1 + 0.0348*SOAG2 + 0.0554*SOAG3 + 0.1278*SOAG4
    LU(i,6632) = LU(i,6632) + 0.1278*rate_constant(i,78) * number_density(i,31)

    !  k_BCARY_O3_2: BCARY + O3 -> 1*BCARY + 1*O3 + 0.2202*SOAG0 + 0.2067*SOAG1 + 0.0653*SOAG2 + 0.1284*SOAG3 + 0.114*SOAG4
    LU(i,6632) = LU(i,6632) + 0.114*rate_constant(i,349) * number_density(i,102)

    ! df_SO/d(O3)
    !  k_O3_SO_1: O3 + SO -> 1*SO2 + 1*O2
    LU(i,6635) = LU(i,6635) - rate_constant(i,140) * number_density(i,32)

    ! df_H/d(O3)
    !  k_H_O3_1: H + O3 -> 1*OH + 1*O2
    LU(i,6639) = LU(i,6639) - rate_constant(i,158) * number_density(i,48)

    ! df_MTERP/d(O3)
    !  k_MTERP_O3_2: MTERP + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,6634) = LU(i,6634) - rate_constant(i,307) * number_density(i,31)

    ! df_RO2/d(O3)
    !  k_BCARY_O3_1: BCARY + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,6636) = LU(i,6636) + 0.06*rate_constant(i,229) * number_density(i,102)

    !  k_MTERP_O3_2: MTERP + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,6636) = LU(i,6636) + 0.06*rate_constant(i,307) * number_density(i,31)

    ! df_SO2/d(O3)
    !  k_O3_SO_1: O3 + SO -> 1*SO2 + 1*O2
    LU(i,6642) = LU(i,6642) + rate_constant(i,140) * number_density(i,32)

    ! df_CH3CO3/d(O3)
    !  k_MACR_O3_1: MACR + O3 -> 0.12*CH2O + 0.24*OH + 0.65*CO + 0.1*CH3CO3 + 0.88*CH3COCHO + 0.33*HCOOH + 0.14*HO2
    LU(i,6640) = LU(i,6640) + 0.1*rate_constant(i,101) * number_density(i,157)

    !  k_BCARY_O3_1: BCARY + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,6640) = LU(i,6640) + 0.06*rate_constant(i,229) * number_density(i,102)

    !  k_MTERP_O3_2: MTERP + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,6640) = LU(i,6640) + 0.06*rate_constant(i,307) * number_density(i,31)

    !  k_ISOP_O3_2: ISOP + O3 -> 0.3*MACR + 0.2*MVK + 0.11*HCOOH + 0.62*CO + 0.32*OH + 0.37*HO2 + 0.91*CH2O + 0.08*CH3CO3 + 0.13*C3H6 + 0.05*CH3O2
    LU(i,6640) = LU(i,6640) + 0.08*rate_constant(i,377) * number_density(i,142)

    !  k_MVK_O3_1: MVK + O3 -> 0.6*CH2O + 0.56*CO + 0.1*CH3CHO + 0.1*CO2 + 0.28*CH3CO3 + 0.5*CH3COCHO + 0.28*HO2 + 0.36*OH + 0.12*HCOOH
    LU(i,6640) = LU(i,6640) + 0.28*rate_constant(i,420) * number_density(i,25)

    ! df_C6H5O2/d(O3)
    !  k_O3_PHENO_1: O3 + PHENO -> 1*C6H5O2
    LU(i,6649) = LU(i,6649) + rate_constant(i,249) * number_density(i,182)

    ! df_CH4/d(O3)
    !  k_C3H6_O3_1: C3H6 + O3 -> 0.5*CH2O + 0.12*HCOOH + 0.12*CH3COOH + 0.5*CH3CHO + 0.56*CO + 0.28*CH3O2 + 0.1*CH4 + 0.2*CO2 + 0.28*HO2 + 0.36*OH
    LU(i,6638) = LU(i,6638) + 0.1*rate_constant(i,170) * number_density(i,120)

    ! df_TERPROD1/d(O3)
    !  k_BCARY_O3_1: BCARY + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,6644) = LU(i,6644) + 0.33*rate_constant(i,229) * number_density(i,102)

    !  k_MTERP_O3_2: MTERP + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,6644) = LU(i,6644) + 0.33*rate_constant(i,307) * number_density(i,31)

    ! df_NO2/d(O3)
    !  k_NO2_O3_1: NO2 + O3 -> 1*NO3 + 1*O2
    LU(i,6641) = LU(i,6641) - rate_constant(i,165) * number_density(i,54)

    !  k_NO_O3_1: NO + O3 -> 1*NO2 + 1*O2
    LU(i,6641) = LU(i,6641) + rate_constant(i,439) * number_density(i,137)

    ! df_NO/d(O3)
    !  k_NO_O3_1: NO + O3 -> 1*NO2 + 1*O2
    LU(i,6674) = LU(i,6674) - rate_constant(i,439) * number_density(i,137)

    ! df_BR/d(O3)
    !  k_BR_O3_1: BR + O3 -> 1*BRO + 1*O2
    LU(i,6654) = LU(i,6654) - rate_constant(i,317) * number_density(i,90)

  end do
  !$acc end parallel

end subroutine dforce_dy121

subroutine dforce_dy122(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell
    ! df_BRO/d(O3)
    !  k_BR_O3_1: BR + O3 -> 1*BRO + 1*O2
    LU(i,6646) = LU(i,6646) + rate_constant(i,317) * number_density(i,90)

    ! df_CL/d(O3)
    !  k_CL_O3_1: CL + O3 -> 1*CLO + 1*O2
    LU(i,6656) = LU(i,6656) - rate_constant(i,150) * number_density(i,100)

    ! df_CLO/d(O3)
    !  k_CL_O3_1: CL + O3 -> 1*CLO + 1*O2
    LU(i,6651) = LU(i,6651) + rate_constant(i,150) * number_density(i,100)

    ! df_CO2/d(O3)
    !  k_C3H6_O3_1: C3H6 + O3 -> 0.5*CH2O + 0.12*HCOOH + 0.12*CH3COOH + 0.5*CH3CHO + 0.56*CO + 0.28*CH3O2 + 0.1*CH4 + 0.2*CO2 + 0.28*HO2 + 0.36*OH
    LU(i,6650) = LU(i,6650) + 0.2*rate_constant(i,170) * number_density(i,120)

    !  k_BCARY_O3_1: BCARY + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,6650) = LU(i,6650) + 0.27*rate_constant(i,229) * number_density(i,102)

    !  k_MTERP_O3_2: MTERP + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,6650) = LU(i,6650) + 0.27*rate_constant(i,307) * number_density(i,31)

    !  k_MVK_O3_1: MVK + O3 -> 0.6*CH2O + 0.56*CO + 0.1*CH3CHO + 0.1*CO2 + 0.28*CH3CO3 + 0.5*CH3COCHO + 0.28*HO2 + 0.36*OH + 0.12*HCOOH
    LU(i,6650) = LU(i,6650) + 0.1*rate_constant(i,420) * number_density(i,25)

    ! df_HCOOH/d(O3)
    !  k_MACR_O3_1: MACR + O3 -> 0.12*CH2O + 0.24*OH + 0.65*CO + 0.1*CH3CO3 + 0.88*CH3COCHO + 0.33*HCOOH + 0.14*HO2
    LU(i,6662) = LU(i,6662) + 0.33*rate_constant(i,101) * number_density(i,157)

    !  k_C3H6_O3_1: C3H6 + O3 -> 0.5*CH2O + 0.12*HCOOH + 0.12*CH3COOH + 0.5*CH3CHO + 0.56*CO + 0.28*CH3O2 + 0.1*CH4 + 0.2*CO2 + 0.28*HO2 + 0.36*OH
    LU(i,6662) = LU(i,6662) + 0.12*rate_constant(i,170) * number_density(i,120)

    !  k_MBO_O3_1: MBO + O3 -> 0.7*HMPROP + 0.64*CO + 0.36*OH + 0.48*HO2 + 0.17*HCOOH + 0.3*CH2O + 0.23*CH3COCH3
    LU(i,6662) = LU(i,6662) + 0.17*rate_constant(i,228) * number_density(i,127)

    !  k_BCARY_O3_1: BCARY + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,6662) = LU(i,6662) + 0.05*rate_constant(i,229) * number_density(i,102)

    !  k_MTERP_O3_2: MTERP + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,6662) = LU(i,6662) + 0.05*rate_constant(i,307) * number_density(i,31)

    !  k_C2H4_O3_1: C2H4 + O3 -> 0.63*CO + 0.13*OH + 0.13*HO2 + 0.37*HCOOH + 1*CH2O
    LU(i,6662) = LU(i,6662) + 0.37*rate_constant(i,323) * number_density(i,93)

    !  k_ISOP_O3_2: ISOP + O3 -> 0.3*MACR + 0.2*MVK + 0.11*HCOOH + 0.62*CO + 0.32*OH + 0.37*HO2 + 0.91*CH2O + 0.08*CH3CO3 + 0.13*C3H6 + 0.05*CH3O2
    LU(i,6662) = LU(i,6662) + 0.11*rate_constant(i,377) * number_density(i,142)

    !  k_MVK_O3_1: MVK + O3 -> 0.6*CH2O + 0.56*CO + 0.1*CH3CHO + 0.1*CO2 + 0.28*CH3CO3 + 0.5*CH3COCHO + 0.28*HO2 + 0.36*OH + 0.12*HCOOH
    LU(i,6662) = LU(i,6662) + 0.12*rate_constant(i,420) * number_density(i,25)

    ! df_C2H4/d(O3)
    !  k_C2H4_O3_1: C2H4 + O3 -> 0.63*CO + 0.13*OH + 0.13*HO2 + 0.37*HCOOH + 1*CH2O
    LU(i,6655) = LU(i,6655) - rate_constant(i,323) * number_density(i,93)

    ! df_CH3COCHO/d(O3)
    !  k_MACR_O3_1: MACR + O3 -> 0.12*CH2O + 0.24*OH + 0.65*CO + 0.1*CH3CO3 + 0.88*CH3COCHO + 0.33*HCOOH + 0.14*HO2
    LU(i,6660) = LU(i,6660) + 0.88*rate_constant(i,101) * number_density(i,157)

    !  k_MVK_O3_1: MVK + O3 -> 0.6*CH2O + 0.56*CO + 0.1*CH3CHO + 0.1*CO2 + 0.28*CH3CO3 + 0.5*CH3COCHO + 0.28*HO2 + 0.36*OH + 0.12*HCOOH
    LU(i,6660) = LU(i,6660) + 0.5*rate_constant(i,420) * number_density(i,25)

    ! df_CH3COCH3/d(O3)
    !  k_MBO_O3_1: MBO + O3 -> 0.7*HMPROP + 0.64*CO + 0.36*OH + 0.48*HO2 + 0.17*HCOOH + 0.3*CH2O + 0.23*CH3COCH3
    LU(i,6653) = LU(i,6653) + 0.23*rate_constant(i,228) * number_density(i,127)

    !  k_BCARY_O3_1: BCARY + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,6653) = LU(i,6653) + 0.52*rate_constant(i,229) * number_density(i,102)

    !  k_MTERP_O3_2: MTERP + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,6653) = LU(i,6653) + 0.52*rate_constant(i,307) * number_density(i,31)

    ! df_O/d(O3)
    !  k_O_O3_1: O + O3 -> 2*O2
    LU(i,6721) = LU(i,6721) - rate_constant(i,187) * number_density(i,187)

    !  k_O3_1: O3 -> 1*O + 1*O2
    LU(i,6721) = LU(i,6721) + rate_constant(i,367)

    ! df_O1D/d(O3)
    !  k_O3_2: O3 -> 1*O1D + 1*O2
    LU(i,6661) = LU(i,6661) + rate_constant(i,417)

    !  k_O1D_O3_1: O1D + O3 -> 1*O2
    LU(i,6661) = LU(i,6661) - rate_constant(i,487) * number_density(i,112)

    ! df_PHENO/d(O3)
    !  k_O3_PHENO_1: O3 + PHENO -> 1*C6H5O2
    LU(i,6716) = LU(i,6716) - rate_constant(i,249) * number_density(i,182)

    ! df_CH3O2/d(O3)
    !  k_C3H6_O3_1: C3H6 + O3 -> 0.5*CH2O + 0.12*HCOOH + 0.12*CH3COOH + 0.5*CH3CHO + 0.56*CO + 0.28*CH3O2 + 0.1*CH4 + 0.2*CO2 + 0.28*HO2 + 0.36*OH
    LU(i,6725) = LU(i,6725) + 0.28*rate_constant(i,170) * number_density(i,120)

    !  k_ISOP_O3_2: ISOP + O3 -> 0.3*MACR + 0.2*MVK + 0.11*HCOOH + 0.62*CO + 0.32*OH + 0.37*HO2 + 0.91*CH2O + 0.08*CH3CO3 + 0.13*C3H6 + 0.05*CH3O2
    LU(i,6725) = LU(i,6725) + 0.05*rate_constant(i,377) * number_density(i,142)

    ! df_BCARY/d(O3)
    !  k_BCARY_O3_1: BCARY + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,6657) = LU(i,6657) - rate_constant(i,229) * number_density(i,102)

    ! df_BIGALD/d(O3)
    !  k_BCARY_O3_1: BCARY + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,6658) = LU(i,6658) + 0.1*rate_constant(i,229) * number_density(i,102)
  end do
  !$acc end parallel

end subroutine dforce_dy122

subroutine dforce_dy123(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    !  k_MTERP_O3_2: MTERP + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,6658) = LU(i,6658) + 0.1*rate_constant(i,307) * number_density(i,31)

    ! df_BIGALK/d(O3)
    !  k_BCARY_O3_1: BCARY + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,6669) = LU(i,6669) + 0.05*rate_constant(i,229) * number_density(i,102)

    !  k_MTERP_O3_2: MTERP + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,6669) = LU(i,6669) + 0.05*rate_constant(i,307) * number_density(i,31)

    ! df_C3H6/d(O3)
    !  k_C3H6_O3_1: C3H6 + O3 -> 0.5*CH2O + 0.12*HCOOH + 0.12*CH3COOH + 0.5*CH3CHO + 0.56*CO + 0.28*CH3O2 + 0.1*CH4 + 0.2*CO2 + 0.28*HO2 + 0.36*OH
    LU(i,6663) = LU(i,6663) - rate_constant(i,170) * number_density(i,120)

    !  k_ISOP_O3_2: ISOP + O3 -> 0.3*MACR + 0.2*MVK + 0.11*HCOOH + 0.62*CO + 0.32*OH + 0.37*HO2 + 0.91*CH2O + 0.08*CH3CO3 + 0.13*C3H6 + 0.05*CH3O2
    LU(i,6663) = LU(i,6663) + 0.13*rate_constant(i,377) * number_density(i,142)

    ! df_CH2O/d(O3)
    !  k_MACR_O3_1: MACR + O3 -> 0.12*CH2O + 0.24*OH + 0.65*CO + 0.1*CH3CO3 + 0.88*CH3COCHO + 0.33*HCOOH + 0.14*HO2
    LU(i,6666) = LU(i,6666) + 0.12*rate_constant(i,101) * number_density(i,157)

    !  k_C3H6_O3_1: C3H6 + O3 -> 0.5*CH2O + 0.12*HCOOH + 0.12*CH3COOH + 0.5*CH3CHO + 0.56*CO + 0.28*CH3O2 + 0.1*CH4 + 0.2*CO2 + 0.28*HO2 + 0.36*OH
    LU(i,6666) = LU(i,6666) + 0.5*rate_constant(i,170) * number_density(i,120)

    !  k_MBO_O3_1: MBO + O3 -> 0.7*HMPROP + 0.64*CO + 0.36*OH + 0.48*HO2 + 0.17*HCOOH + 0.3*CH2O + 0.23*CH3COCH3
    LU(i,6666) = LU(i,6666) + 0.3*rate_constant(i,228) * number_density(i,127)

    !  k_BCARY_O3_1: BCARY + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,6666) = LU(i,6666) + 0.34*rate_constant(i,229) * number_density(i,102)

    !  k_MTERP_O3_2: MTERP + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,6666) = LU(i,6666) + 0.34*rate_constant(i,307) * number_density(i,31)

    !  k_C2H4_O3_1: C2H4 + O3 -> 0.63*CO + 0.13*OH + 0.13*HO2 + 0.37*HCOOH + 1*CH2O
    LU(i,6666) = LU(i,6666) + rate_constant(i,323) * number_density(i,93)

    !  k_ISOP_O3_2: ISOP + O3 -> 0.3*MACR + 0.2*MVK + 0.11*HCOOH + 0.62*CO + 0.32*OH + 0.37*HO2 + 0.91*CH2O + 0.08*CH3CO3 + 0.13*C3H6 + 0.05*CH3O2
    LU(i,6666) = LU(i,6666) + 0.91*rate_constant(i,377) * number_density(i,142)

    !  k_MVK_O3_1: MVK + O3 -> 0.6*CH2O + 0.56*CO + 0.1*CH3CHO + 0.1*CO2 + 0.28*CH3CO3 + 0.5*CH3COCHO + 0.28*HO2 + 0.36*OH + 0.12*HCOOH
    LU(i,6666) = LU(i,6666) + 0.6*rate_constant(i,420) * number_density(i,25)

    ! df_HMPROP/d(O3)
    !  k_MBO_O3_1: MBO + O3 -> 0.7*HMPROP + 0.64*CO + 0.36*OH + 0.48*HO2 + 0.17*HCOOH + 0.3*CH2O + 0.23*CH3COCH3
    LU(i,6671) = LU(i,6671) + 0.7*rate_constant(i,228) * number_density(i,127)

    ! df_HO2/d(O3)
    !  k_MACR_O3_1: MACR + O3 -> 0.12*CH2O + 0.24*OH + 0.65*CO + 0.1*CH3CO3 + 0.88*CH3COCHO + 0.33*HCOOH + 0.14*HO2
    LU(i,6726) = LU(i,6726) + 0.14*rate_constant(i,101) * number_density(i,157)

    !  k_O3_OH_1: O3 + OH -> 1*HO2 + 1*O2
    LU(i,6726) = LU(i,6726) + rate_constant(i,164) * number_density(i,166)

    !  k_C3H6_O3_1: C3H6 + O3 -> 0.5*CH2O + 0.12*HCOOH + 0.12*CH3COOH + 0.5*CH3CHO + 0.56*CO + 0.28*CH3O2 + 0.1*CH4 + 0.2*CO2 + 0.28*HO2 + 0.36*OH
    LU(i,6726) = LU(i,6726) + 0.28*rate_constant(i,170) * number_density(i,120)

    !  k_MBO_O3_1: MBO + O3 -> 0.7*HMPROP + 0.64*CO + 0.36*OH + 0.48*HO2 + 0.17*HCOOH + 0.3*CH2O + 0.23*CH3COCH3
    LU(i,6726) = LU(i,6726) + 0.48*rate_constant(i,228) * number_density(i,127)

    !  k_BCARY_O3_1: BCARY + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,6726) = LU(i,6726) + 0.57*rate_constant(i,229) * number_density(i,102)

    !  k_MTERP_O3_2: MTERP + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,6726) = LU(i,6726) + 0.57*rate_constant(i,307) * number_density(i,31)

    !  k_C2H4_O3_1: C2H4 + O3 -> 0.63*CO + 0.13*OH + 0.13*HO2 + 0.37*HCOOH + 1*CH2O
    LU(i,6726) = LU(i,6726) + 0.13*rate_constant(i,323) * number_density(i,93)

    !  k_HO2_O3_1: HO2 + O3 -> 1*OH + 2*O2
    LU(i,6726) = LU(i,6726) - rate_constant(i,368) * number_density(i,192)

    !  k_ISOP_O3_2: ISOP + O3 -> 0.3*MACR + 0.2*MVK + 0.11*HCOOH + 0.62*CO + 0.32*OH + 0.37*HO2 + 0.91*CH2O + 0.08*CH3CO3 + 0.13*C3H6 + 0.05*CH3O2
    LU(i,6726) = LU(i,6726) + 0.37*rate_constant(i,377) * number_density(i,142)

    !  k_MVK_O3_1: MVK + O3 -> 0.6*CH2O + 0.56*CO + 0.1*CH3CHO + 0.1*CO2 + 0.28*CH3CO3 + 0.5*CH3COCHO + 0.28*HO2 + 0.36*OH + 0.12*HCOOH
    LU(i,6726) = LU(i,6726) + 0.28*rate_constant(i,420) * number_density(i,25)

    ! df_ISOP/d(O3)
    !  k_ISOP_O3_2: ISOP + O3 -> 0.3*MACR + 0.2*MVK + 0.11*HCOOH + 0.62*CO + 0.32*OH + 0.37*HO2 + 0.91*CH2O + 0.08*CH3CO3 + 0.13*C3H6 + 0.05*CH3O2
    LU(i,6676) = LU(i,6676) - rate_constant(i,377) * number_density(i,142)

    ! df_TERPROD2/d(O3)
    !  k_BCARY_O3_1: BCARY + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,6689) = LU(i,6689) + 0.3*rate_constant(i,229) * number_density(i,102)

    !  k_MTERP_O3_2: MTERP + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,6689) = LU(i,6689) + 0.3*rate_constant(i,307) * number_density(i,31)

    ! df_MACR/d(O3)
    !  k_MACR_O3_1: MACR + O3 -> 0.12*CH2O + 0.24*OH + 0.65*CO + 0.1*CH3CO3 + 0.88*CH3COCHO + 0.33*HCOOH + 0.14*HO2
    LU(i,6691) = LU(i,6691) - rate_constant(i,101) * number_density(i,157)

    !  k_ISOP_O3_2: ISOP + O3 -> 0.3*MACR + 0.2*MVK + 0.11*HCOOH + 0.62*CO + 0.32*OH + 0.37*HO2 + 0.91*CH2O + 0.08*CH3CO3 + 0.13*C3H6 + 0.05*CH3O2
    LU(i,6691) = LU(i,6691) + 0.3*rate_constant(i,377) * number_density(i,142)

    ! df_MBO/d(O3)
    !  k_MBO_O3_1: MBO + O3 -> 0.7*HMPROP + 0.64*CO + 0.36*OH + 0.48*HO2 + 0.17*HCOOH + 0.3*CH2O + 0.23*CH3COCH3
    LU(i,6668) = LU(i,6668) - rate_constant(i,228) * number_density(i,127)

    ! df_NO3/d(O3)
    !  k_NO2_O3_1: NO2 + O3 -> 1*NO3 + 1*O2
    LU(i,6699) = LU(i,6699) + rate_constant(i,165) * number_density(i,54)
  end do
  !$acc end parallel

end subroutine dforce_dy123

subroutine dforce_dy124(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! df_OH/d(O3)
    !  k_MACR_O3_1: MACR + O3 -> 0.12*CH2O + 0.24*OH + 0.65*CO + 0.1*CH3CO3 + 0.88*CH3COCHO + 0.33*HCOOH + 0.14*HO2
    LU(i,6700) = LU(i,6700) + 0.24*rate_constant(i,101) * number_density(i,157)

    !  k_H_O3_1: H + O3 -> 1*OH + 1*O2
    LU(i,6700) = LU(i,6700) + rate_constant(i,158) * number_density(i,48)

    !  k_O3_OH_1: O3 + OH -> 1*HO2 + 1*O2
    LU(i,6700) = LU(i,6700) - rate_constant(i,164) * number_density(i,166)

    !  k_C3H6_O3_1: C3H6 + O3 -> 0.5*CH2O + 0.12*HCOOH + 0.12*CH3COOH + 0.5*CH3CHO + 0.56*CO + 0.28*CH3O2 + 0.1*CH4 + 0.2*CO2 + 0.28*HO2 + 0.36*OH
    LU(i,6700) = LU(i,6700) + 0.36*rate_constant(i,170) * number_density(i,120)

    !  k_MBO_O3_1: MBO + O3 -> 0.7*HMPROP + 0.64*CO + 0.36*OH + 0.48*HO2 + 0.17*HCOOH + 0.3*CH2O + 0.23*CH3COCH3
    LU(i,6700) = LU(i,6700) + 0.36*rate_constant(i,228) * number_density(i,127)

    !  k_BCARY_O3_1: BCARY + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,6700) = LU(i,6700) + 0.63*rate_constant(i,229) * number_density(i,102)

    !  k_MTERP_O3_2: MTERP + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,6700) = LU(i,6700) + 0.63*rate_constant(i,307) * number_density(i,31)

    !  k_C2H4_O3_1: C2H4 + O3 -> 0.63*CO + 0.13*OH + 0.13*HO2 + 0.37*HCOOH + 1*CH2O
    LU(i,6700) = LU(i,6700) + 0.13*rate_constant(i,323) * number_density(i,93)

    !  k_HO2_O3_1: HO2 + O3 -> 1*OH + 2*O2
    LU(i,6700) = LU(i,6700) + rate_constant(i,368) * number_density(i,192)

    !  k_ISOP_O3_2: ISOP + O3 -> 0.3*MACR + 0.2*MVK + 0.11*HCOOH + 0.62*CO + 0.32*OH + 0.37*HO2 + 0.91*CH2O + 0.08*CH3CO3 + 0.13*C3H6 + 0.05*CH3O2
    LU(i,6700) = LU(i,6700) + 0.32*rate_constant(i,377) * number_density(i,142)

    !  k_MVK_O3_1: MVK + O3 -> 0.6*CH2O + 0.56*CO + 0.1*CH3CHO + 0.1*CO2 + 0.28*CH3CO3 + 0.5*CH3COCHO + 0.28*HO2 + 0.36*OH + 0.12*HCOOH
    LU(i,6700) = LU(i,6700) + 0.36*rate_constant(i,420) * number_density(i,25)

    ! df_O3/d(O3)
    !  k_MACR_O3_1: MACR + O3 -> 0.12*CH2O + 0.24*OH + 0.65*CO + 0.1*CH3CO3 + 0.88*CH3COCHO + 0.33*HCOOH + 0.14*HO2
    LU(i,6705) = LU(i,6705) - rate_constant(i,101) * number_density(i,157)

    !  k_O3_SO_1: O3 + SO -> 1*SO2 + 1*O2
    LU(i,6705) = LU(i,6705) - rate_constant(i,140) * number_density(i,32)

    !  k_CL_O3_1: CL + O3 -> 1*CLO + 1*O2
    LU(i,6705) = LU(i,6705) - rate_constant(i,150) * number_density(i,100)

    !  k_H_O3_1: H + O3 -> 1*OH + 1*O2
    LU(i,6705) = LU(i,6705) - rate_constant(i,158) * number_density(i,48)

    !  k_O3_OH_1: O3 + OH -> 1*HO2 + 1*O2
    LU(i,6705) = LU(i,6705) - rate_constant(i,164) * number_density(i,166)

    !  k_NO2_O3_1: NO2 + O3 -> 1*NO3 + 1*O2
    LU(i,6705) = LU(i,6705) - rate_constant(i,165) * number_density(i,54)

    !  k_C3H6_O3_1: C3H6 + O3 -> 0.5*CH2O + 0.12*HCOOH + 0.12*CH3COOH + 0.5*CH3CHO + 0.56*CO + 0.28*CH3O2 + 0.1*CH4 + 0.2*CO2 + 0.28*HO2 + 0.36*OH
    LU(i,6705) = LU(i,6705) - rate_constant(i,170) * number_density(i,120)

    !  k_O_O3_1: O + O3 -> 2*O2
    LU(i,6705) = LU(i,6705) - rate_constant(i,187) * number_density(i,187)

    !  k_MBO_O3_1: MBO + O3 -> 0.7*HMPROP + 0.64*CO + 0.36*OH + 0.48*HO2 + 0.17*HCOOH + 0.3*CH2O + 0.23*CH3COCH3
    LU(i,6705) = LU(i,6705) - rate_constant(i,228) * number_density(i,127)

    !  k_BCARY_O3_1: BCARY + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,6705) = LU(i,6705) - rate_constant(i,229) * number_density(i,102)

    !  k_O3_PHENO_1: O3 + PHENO -> 1*C6H5O2
    LU(i,6705) = LU(i,6705) - rate_constant(i,249) * number_density(i,182)

    !  k_MTERP_O3_2: MTERP + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,6705) = LU(i,6705) - rate_constant(i,307) * number_density(i,31)

    !  k_BR_O3_1: BR + O3 -> 1*BRO + 1*O2
    LU(i,6705) = LU(i,6705) - rate_constant(i,317) * number_density(i,90)

    !  k_C2H4_O3_1: C2H4 + O3 -> 0.63*CO + 0.13*OH + 0.13*HO2 + 0.37*HCOOH + 1*CH2O
    LU(i,6705) = LU(i,6705) - rate_constant(i,323) * number_density(i,93)

    !  k_O3_1: O3 -> 1*O + 1*O2
    LU(i,6705) = LU(i,6705) - rate_constant(i,367)

    !  k_HO2_O3_1: HO2 + O3 -> 1*OH + 2*O2
    LU(i,6705) = LU(i,6705) - rate_constant(i,368) * number_density(i,192)

    !  k_ISOP_O3_2: ISOP + O3 -> 0.3*MACR + 0.2*MVK + 0.11*HCOOH + 0.62*CO + 0.32*OH + 0.37*HO2 + 0.91*CH2O + 0.08*CH3CO3 + 0.13*C3H6 + 0.05*CH3O2
    LU(i,6705) = LU(i,6705) - rate_constant(i,377) * number_density(i,142)

    !  k_O3_2: O3 -> 1*O1D + 1*O2
    LU(i,6705) = LU(i,6705) - rate_constant(i,417)

    !  k_MVK_O3_1: MVK + O3 -> 0.6*CH2O + 0.56*CO + 0.1*CH3CHO + 0.1*CO2 + 0.28*CH3CO3 + 0.5*CH3COCHO + 0.28*HO2 + 0.36*OH + 0.12*HCOOH
    LU(i,6705) = LU(i,6705) - rate_constant(i,420) * number_density(i,25)

    !  k_NO_O3_1: NO + O3 -> 1*NO2 + 1*O2
    LU(i,6705) = LU(i,6705) - rate_constant(i,439) * number_density(i,137)

    !  k_O1D_O3_1: O1D + O3 -> 1*O2
    LU(i,6705) = LU(i,6705) - rate_constant(i,487) * number_density(i,112)

    ! df_CO/d(O3)
    !  k_MACR_O3_1: MACR + O3 -> 0.12*CH2O + 0.24*OH + 0.65*CO + 0.1*CH3CO3 + 0.88*CH3COCHO + 0.33*HCOOH + 0.14*HO2
    LU(i,6710) = LU(i,6710) + 0.65*rate_constant(i,101) * number_density(i,157)
  end do
  !$acc end parallel

end subroutine dforce_dy124

subroutine dforce_dy125(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    !  k_C3H6_O3_1: C3H6 + O3 -> 0.5*CH2O + 0.12*HCOOH + 0.12*CH3COOH + 0.5*CH3CHO + 0.56*CO + 0.28*CH3O2 + 0.1*CH4 + 0.2*CO2 + 0.28*HO2 + 0.36*OH
    LU(i,6710) = LU(i,6710) + 0.56*rate_constant(i,170) * number_density(i,120)

    !  k_MBO_O3_1: MBO + O3 -> 0.7*HMPROP + 0.64*CO + 0.36*OH + 0.48*HO2 + 0.17*HCOOH + 0.3*CH2O + 0.23*CH3COCH3
    LU(i,6710) = LU(i,6710) + 0.64*rate_constant(i,228) * number_density(i,127)

    !  k_BCARY_O3_1: BCARY + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,6710) = LU(i,6710) + 0.23*rate_constant(i,229) * number_density(i,102)

    !  k_MTERP_O3_2: MTERP + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    LU(i,6710) = LU(i,6710) + 0.23*rate_constant(i,307) * number_density(i,31)

    !  k_C2H4_O3_1: C2H4 + O3 -> 0.63*CO + 0.13*OH + 0.13*HO2 + 0.37*HCOOH + 1*CH2O
    LU(i,6710) = LU(i,6710) + 0.63*rate_constant(i,323) * number_density(i,93)

    !  k_ISOP_O3_2: ISOP + O3 -> 0.3*MACR + 0.2*MVK + 0.11*HCOOH + 0.62*CO + 0.32*OH + 0.37*HO2 + 0.91*CH2O + 0.08*CH3CO3 + 0.13*C3H6 + 0.05*CH3O2
    LU(i,6710) = LU(i,6710) + 0.62*rate_constant(i,377) * number_density(i,142)

    !  k_MVK_O3_1: MVK + O3 -> 0.6*CH2O + 0.56*CO + 0.1*CH3CHO + 0.1*CO2 + 0.28*CH3CO3 + 0.5*CH3COCHO + 0.28*HO2 + 0.36*OH + 0.12*HCOOH
    LU(i,6710) = LU(i,6710) + 0.56*rate_constant(i,420) * number_density(i,25)

    ! df_CH3COOH/d(O3)
    !  k_C3H6_O3_1: C3H6 + O3 -> 0.5*CH2O + 0.12*HCOOH + 0.12*CH3COOH + 0.5*CH3CHO + 0.56*CO + 0.28*CH3O2 + 0.1*CH4 + 0.2*CO2 + 0.28*HO2 + 0.36*OH
    LU(i,6711) = LU(i,6711) + 0.12*rate_constant(i,170) * number_density(i,120)

    ! df_CH3CHO/d(O3)
    !  k_C3H6_O3_1: C3H6 + O3 -> 0.5*CH2O + 0.12*HCOOH + 0.12*CH3COOH + 0.5*CH3CHO + 0.56*CO + 0.28*CH3O2 + 0.1*CH4 + 0.2*CO2 + 0.28*HO2 + 0.36*OH
    LU(i,6712) = LU(i,6712) + 0.5*rate_constant(i,170) * number_density(i,120)

    !  k_MVK_O3_1: MVK + O3 -> 0.6*CH2O + 0.56*CO + 0.1*CH3CHO + 0.1*CO2 + 0.28*CH3CO3 + 0.5*CH3COCHO + 0.28*HO2 + 0.36*OH + 0.12*HCOOH
    LU(i,6712) = LU(i,6712) + 0.1*rate_constant(i,420) * number_density(i,25)

    ! df_TERPROD1/d(TERPOOH)
    !  k_TERPOOH_1: TERPOOH -> 0.4*CH2O + 0.05*CH3COCH3 + 1*TERPROD1 + 1*HO2 + 1*OH
    LU(i,2635) = LU(i,2635) + rate_constant(i,218)

    ! df_CH3COCH3/d(TERPOOH)
    !  k_TERPOOH_1: TERPOOH -> 0.4*CH2O + 0.05*CH3COCH3 + 1*TERPROD1 + 1*HO2 + 1*OH
    LU(i,2636) = LU(i,2636) + 0.05*rate_constant(i,218)

    ! df_CH2O/d(TERPOOH)
    !  k_TERPOOH_1: TERPOOH -> 0.4*CH2O + 0.05*CH3COCH3 + 1*TERPROD1 + 1*HO2 + 1*OH
    LU(i,2647) = LU(i,2647) + 0.4*rate_constant(i,218)

    ! df_HO2/d(TERPOOH)
    !  k_TERPOOH_1: TERPOOH -> 0.4*CH2O + 0.05*CH3COCH3 + 1*TERPROD1 + 1*HO2 + 1*OH
    LU(i,2695) = LU(i,2695) + rate_constant(i,218)

    ! df_TERPO2/d(TERPOOH)
    !  k_OH_TERPOOH_1: OH + TERPOOH -> 1*TERPO2
    LU(i,2654) = LU(i,2654) + rate_constant(i,314) * number_density(i,166)

    ! df_OH/d(TERPOOH)
    !  k_TERPOOH_1: TERPOOH -> 0.4*CH2O + 0.05*CH3COCH3 + 1*TERPROD1 + 1*HO2 + 1*OH
    LU(i,2669) = LU(i,2669) + rate_constant(i,218)

    !  k_OH_TERPOOH_1: OH + TERPOOH -> 1*TERPO2
    LU(i,2669) = LU(i,2669) - rate_constant(i,314) * number_density(i,166)

    ! df_TERPOOH/d(TERPOOH)
    !  k_TERPOOH_1: TERPOOH -> 0.4*CH2O + 0.05*CH3COCH3 + 1*TERPROD1 + 1*HO2 + 1*OH
    LU(i,2642) = LU(i,2642) - rate_constant(i,218)

    !  k_OH_TERPOOH_1: OH + TERPOOH -> 1*TERPO2
    LU(i,2642) = LU(i,2642) - rate_constant(i,314) * number_density(i,166)

    ! df_CH3COCHO/d(TOLOOH)
