    !  k_BIGALD1_1: BIGALD1 -> 0.6*MALO2 + 1*HO2
    LU(i,890) = LU(i,890) + rate_constant(i,255)

    ! df_BIGALD1/d(BIGALD1)
    !  k_BIGALD1_1: BIGALD1 -> 0.6*MALO2 + 1*HO2
