    LU(i,584) = LU(i,584) + 0.1*rate_constant(i,300)

    ! df_HO2/d(ALKOOH)
    !  k_ALKOOH_1: ALKOOH -> 0.4*CH3CHO + 0.1*CH2O + 0.25*CH3COCH3 + 0.9*HO2 + 0.8*MEK + 1*OH
    LU(i,587) = LU(i,587) + 0.9*rate_constant(i,300)
