    !  k_ALKOOH_1: ALKOOH -> 0.4*CH3CHO + 0.1*CH2O + 0.25*CH3COCH3 + 0.9*HO2 + 0.8*MEK + 1*OH
    LU(i,586) = LU(i,586) + 0.4*rate_constant(i,300)

    ! df_ALKOOH/d(ALKOOH)
    !  k_ALKOOH_OH_1: ALKOOH + OH -> 1*ALKO2
    LU(i,580) = LU(i,580) - rate_constant(i,104) * number_density(i,166)

    !  k_ALKOOH_1: ALKOOH -> 0.4*CH3CHO + 0.1*CH2O + 0.25*CH3COCH3 + 0.9*HO2 + 0.8*MEK + 1*OH
    LU(i,580) = LU(i,580) - rate_constant(i,300)

    ! df_ALKO2/d(ALKOOH)
    !  k_ALKOOH_OH_1: ALKOOH + OH -> 1*ALKO2
    LU(i,581) = LU(i,581) + rate_constant(i,104) * number_density(i,166)

    ! df_NO2/d(DICARBO2)
    !  k_DICARBO2_NO2_1: DICARBO2 + NO2 -> 
    LU(i,7358) = LU(i,7358) - rate_constant(i,316) * number_density(i,54)

    !  k_DICARBO2_NO_1: DICARBO2 + NO -> 1*NO2 + 0.17*HO2 + 0.17*CH3COCHO + 0.17*CO + 0.83*CH3O2
    LU(i,7358) = LU(i,7358) + rate_constant(i,337) * number_density(i,137)

    ! df_NO/d(DICARBO2)
    !  k_DICARBO2_NO_1: DICARBO2 + NO -> 1*NO2 + 0.17*HO2 + 0.17*CH3COCHO + 0.17*CO + 0.83*CH3O2
    LU(i,7380) = LU(i,7380) - rate_constant(i,337) * number_density(i,137)

    ! df_CH3COCHO/d(DICARBO2)
    !  k_DICARBO2_NO_1: DICARBO2 + NO -> 1*NO2 + 0.17*HO2 + 0.17*CH3COCHO + 0.17*CO + 0.83*CH3O2
    LU(i,7372) = LU(i,7372) + 0.17*rate_constant(i,337) * number_density(i,137)

    !  k_DICARBO2_HO2_1: DICARBO2 + HO2 -> 0.4*OH + 0.07*HO2 + 0.07*CH3COCHO + 0.07*CO + 0.33*CH3O2
    LU(i,7372) = LU(i,7372) + 0.07*rate_constant(i,370) * number_density(i,192)

    ! df_CH3O2/d(DICARBO2)
    !  k_DICARBO2_NO_1: DICARBO2 + NO -> 1*NO2 + 0.17*HO2 + 0.17*CH3COCHO + 0.17*CO + 0.83*CH3O2
    LU(i,7430) = LU(i,7430) + 0.83*rate_constant(i,337) * number_density(i,137)

    !  k_DICARBO2_HO2_1: DICARBO2 + HO2 -> 0.4*OH + 0.07*HO2 + 0.07*CH3COCHO + 0.07*CO + 0.33*CH3O2
    LU(i,7430) = LU(i,7430) + 0.33*rate_constant(i,370) * number_density(i,192)

    ! df_HO2/d(DICARBO2)
    !  k_DICARBO2_NO_1: DICARBO2 + NO -> 1*NO2 + 0.17*HO2 + 0.17*CH3COCHO + 0.17*CO + 0.83*CH3O2
    LU(i,7431) = LU(i,7431) + 0.17*rate_constant(i,337) * number_density(i,137)

    !  k_DICARBO2_HO2_1: DICARBO2 + HO2 -> 0.4*OH + 0.07*HO2 + 0.07*CH3COCHO + 0.07*CO + 0.33*CH3O2
    LU(i,7431) = LU(i,7431) - 0.9299999999999999*rate_constant(i,370) * number_density(i,192)

    ! df_OH/d(DICARBO2)
    !  k_DICARBO2_HO2_1: DICARBO2 + HO2 -> 0.4*OH + 0.07*HO2 + 0.07*CH3COCHO + 0.07*CO + 0.33*CH3O2
    LU(i,7405) = LU(i,7405) + 0.4*rate_constant(i,370) * number_density(i,192)

    ! df_CO/d(DICARBO2)
    !  k_DICARBO2_NO_1: DICARBO2 + NO -> 1*NO2 + 0.17*HO2 + 0.17*CH3COCHO + 0.17*CO + 0.83*CH3O2
    LU(i,7415) = LU(i,7415) + 0.17*rate_constant(i,337) * number_density(i,137)

    !  k_DICARBO2_HO2_1: DICARBO2 + HO2 -> 0.4*OH + 0.07*HO2 + 0.07*CH3COCHO + 0.07*CO + 0.33*CH3O2
    LU(i,7415) = LU(i,7415) + 0.07*rate_constant(i,370) * number_density(i,192)

    ! df_DICARBO2/d(DICARBO2)
    !  k_DICARBO2_NO2_1: DICARBO2 + NO2 -> 
    LU(i,7420) = LU(i,7420) - rate_constant(i,316) * number_density(i,54)

    !  k_DICARBO2_NO_1: DICARBO2 + NO -> 1*NO2 + 0.17*HO2 + 0.17*CH3COCHO + 0.17*CO + 0.83*CH3O2
    LU(i,7420) = LU(i,7420) - rate_constant(i,337) * number_density(i,137)

    !  k_DICARBO2_HO2_1: DICARBO2 + HO2 -> 0.4*OH + 0.07*HO2 + 0.07*CH3COCHO + 0.07*CO + 0.33*CH3O2
    LU(i,7420) = LU(i,7420) - rate_constant(i,370) * number_density(i,192)

    ! df_BENZO2/d(BENZOOH)
    !  k_BENZOOH_OH_1: BENZOOH + OH -> 1*BENZO2
    LU(i,1548) = LU(i,1548) + rate_constant(i,382) * number_density(i,166)

    ! df_GLYOXAL/d(BENZOOH)
    !  k_BENZOOH_1: BENZOOH -> 1*OH + 1*GLYOXAL + 0.5*BIGALD1 + 1*HO2
    LU(i,1571) = LU(i,1571) + rate_constant(i,275)

    ! df_HO2/d(BENZOOH)
    !  k_BENZOOH_1: BENZOOH -> 1*OH + 1*GLYOXAL + 0.5*BIGALD1 + 1*HO2
    LU(i,1607) = LU(i,1607) + rate_constant(i,275)

    ! df_OH/d(BENZOOH)
    !  k_BENZOOH_1: BENZOOH -> 1*OH + 1*GLYOXAL + 0.5*BIGALD1 + 1*HO2
    LU(i,1586) = LU(i,1586) + rate_constant(i,275)

    !  k_BENZOOH_OH_1: BENZOOH + OH -> 1*BENZO2
    LU(i,1586) = LU(i,1586) - rate_constant(i,382) * number_density(i,166)

    ! df_BIGALD1/d(BENZOOH)
    !  k_BENZOOH_1: BENZOOH -> 1*OH + 1*GLYOXAL + 0.5*BIGALD1 + 1*HO2
    LU(i,1556) = LU(i,1556) + 0.5*rate_constant(i,275)

    ! df_BENZOOH/d(BENZOOH)
    !  k_BENZOOH_1: BENZOOH -> 1*OH + 1*GLYOXAL + 0.5*BIGALD1 + 1*HO2
    LU(i,1562) = LU(i,1562) - rate_constant(i,275)
  end do
  !$acc end parallel

end subroutine dforce_dy128

subroutine dforce_dy129(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    !  k_BENZOOH_OH_1: BENZOOH + OH -> 1*BENZO2
    LU(i,1562) = LU(i,1562) - rate_constant(i,382) * number_density(i,166)

    ! df_ALKNIT/d(ALKO2)
    !  k_ALKO2_NO_2: ALKO2 + NO -> 1*ALKNIT
    LU(i,1188) = LU(i,1188) + rate_constant(i,194) * number_density(i,137)

    ! df_MEK/d(ALKO2)
    !  k_ALKO2_NO_1: ALKO2 + NO -> 0.4*CH3CHO + 0.1*CH2O + 0.25*CH3COCH3 + 1*HO2 + 0.8*MEK + 1*NO2
    LU(i,1205) = LU(i,1205) + 0.8*rate_constant(i,71) * number_density(i,137)

    ! df_NO2/d(ALKO2)
    !  k_ALKO2_NO_1: ALKO2 + NO -> 0.4*CH3CHO + 0.1*CH2O + 0.25*CH3COCH3 + 1*HO2 + 0.8*MEK + 1*NO2
    LU(i,1189) = LU(i,1189) + rate_constant(i,71) * number_density(i,137)

    ! df_NO/d(ALKO2)
    !  k_ALKO2_NO_1: ALKO2 + NO -> 0.4*CH3CHO + 0.1*CH2O + 0.25*CH3COCH3 + 1*HO2 + 0.8*MEK + 1*NO2
    LU(i,1214) = LU(i,1214) - rate_constant(i,71) * number_density(i,137)

    !  k_ALKO2_NO_2: ALKO2 + NO -> 1*ALKNIT
    LU(i,1214) = LU(i,1214) - rate_constant(i,194) * number_density(i,137)

    ! df_CH3COCH3/d(ALKO2)
    !  k_ALKO2_NO_1: ALKO2 + NO -> 0.4*CH3CHO + 0.1*CH2O + 0.25*CH3COCH3 + 1*HO2 + 0.8*MEK + 1*NO2
    LU(i,1202) = LU(i,1202) + 0.25*rate_constant(i,71) * number_density(i,137)

    ! df_CH2O/d(ALKO2)
    !  k_ALKO2_NO_1: ALKO2 + NO -> 0.4*CH3CHO + 0.1*CH2O + 0.25*CH3COCH3 + 1*HO2 + 0.8*MEK + 1*NO2
    LU(i,1212) = LU(i,1212) + 0.1*rate_constant(i,71) * number_density(i,137)

    ! df_HO2/d(ALKO2)
    !  k_ALKO2_NO_1: ALKO2 + NO -> 0.4*CH3CHO + 0.1*CH2O + 0.25*CH3COCH3 + 1*HO2 + 0.8*MEK + 1*NO2
    LU(i,1248) = LU(i,1248) + rate_constant(i,71) * number_density(i,137)

    !  k_ALKO2_HO2_1: ALKO2 + HO2 -> 1*ALKOOH
    LU(i,1248) = LU(i,1248) - rate_constant(i,426) * number_density(i,192)

    ! df_CH3CHO/d(ALKO2)
    !  k_ALKO2_NO_1: ALKO2 + NO -> 0.4*CH3CHO + 0.1*CH2O + 0.25*CH3COCH3 + 1*HO2 + 0.8*MEK + 1*NO2
    LU(i,1235) = LU(i,1235) + 0.4*rate_constant(i,71) * number_density(i,137)

    ! df_ALKOOH/d(ALKO2)
    !  k_ALKO2_HO2_1: ALKO2 + HO2 -> 1*ALKOOH
    LU(i,1192) = LU(i,1192) + rate_constant(i,426) * number_density(i,192)

    ! df_ALKO2/d(ALKO2)
    !  k_ALKO2_NO_1: ALKO2 + NO -> 0.4*CH3CHO + 0.1*CH2O + 0.25*CH3COCH3 + 1*HO2 + 0.8*MEK + 1*NO2
    LU(i,1199) = LU(i,1199) - rate_constant(i,71) * number_density(i,137)

    !  k_ALKO2_NO_2: ALKO2 + NO -> 1*ALKNIT
    LU(i,1199) = LU(i,1199) - rate_constant(i,194) * number_density(i,137)

    !  k_ALKO2_HO2_1: ALKO2 + HO2 -> 1*ALKOOH
    LU(i,1199) = LU(i,1199) - rate_constant(i,426) * number_density(i,192)

    ! df_O2/d(HO2NO2)
    !  k_HO2NO2_OH_1: HO2NO2 + OH -> 1*H2O + 1*NO2 + 1*O2
    LU(i,186) = LU(i,186) + rate_constant(i,54) * number_density(i,166)

    ! df_H2O/d(HO2NO2)
    !  k_HO2NO2_OH_1: HO2NO2 + OH -> 1*H2O + 1*NO2 + 1*O2
    LU(i,188) = LU(i,188) + rate_constant(i,54) * number_density(i,166)

    ! df_NO2/d(HO2NO2)
    !  k_HO2NO2_OH_1: HO2NO2 + OH -> 1*H2O + 1*NO2 + 1*O2
    LU(i,187) = LU(i,187) + rate_constant(i,54) * number_density(i,166)

    !  k_HO2NO2_1: HO2NO2 -> 1*HO2 + 1*NO2
    LU(i,187) = LU(i,187) + rate_constant(i,159)

    !  k_HO2NO2_2: HO2NO2 -> 1*NO2 + 1*HO2
    LU(i,187) = LU(i,187) + rate_constant(i,359)

    ! df_HO2/d(HO2NO2)
    !  k_HO2NO2_1: HO2NO2 -> 1*HO2 + 1*NO2
    LU(i,191) = LU(i,191) + rate_constant(i,159)

    !  k_HO2NO2_2: HO2NO2 -> 1*NO2 + 1*HO2
    LU(i,191) = LU(i,191) + rate_constant(i,359)

    ! df_NO3/d(HO2NO2)
    !  k_HO2NO2_3: HO2NO2 -> 1*OH + 1*NO3
    LU(i,189) = LU(i,189) + rate_constant(i,400)

    ! df_OH/d(HO2NO2)
    !  k_HO2NO2_OH_1: HO2NO2 + OH -> 1*H2O + 1*NO2 + 1*O2
    LU(i,190) = LU(i,190) - rate_constant(i,54) * number_density(i,166)

    !  k_HO2NO2_3: HO2NO2 -> 1*OH + 1*NO3
    LU(i,190) = LU(i,190) + rate_constant(i,400)

    ! df_HO2NO2/d(HO2NO2)
    !  k_HO2NO2_OH_1: HO2NO2 + OH -> 1*H2O + 1*NO2 + 1*O2
    LU(i,185) = LU(i,185) - rate_constant(i,54) * number_density(i,166)

    !  k_HO2NO2_1: HO2NO2 -> 1*HO2 + 1*NO2
    LU(i,185) = LU(i,185) - rate_constant(i,159)

    !  k_HO2NO2_2: HO2NO2 -> 1*NO2 + 1*HO2
    LU(i,185) = LU(i,185) - rate_constant(i,359)
  end do
  !$acc end parallel

end subroutine dforce_dy129

subroutine dforce_dy130(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    !  k_HO2NO2_3: HO2NO2 -> 1*OH + 1*NO3
    LU(i,185) = LU(i,185) - rate_constant(i,400)

    ! df_H2O/d(C3H7OOH)
    !  k_C3H7OOH_OH_1: C3H7OOH + OH -> 1*H2O + 1*C3H7O2
    LU(i,73) = LU(i,73) + rate_constant(i,4) * number_density(i,166)

    ! df_CH3COCH3/d(C3H7OOH)
    !  k_C3H7OOH_1: C3H7OOH -> 0.82*CH3COCH3 + 1*OH + 1*HO2
    LU(i,74) = LU(i,74) + 0.82*rate_constant(i,115)

    ! df_C3H7O2/d(C3H7OOH)
    !  k_C3H7OOH_OH_1: C3H7OOH + OH -> 1*H2O + 1*C3H7O2
    LU(i,75) = LU(i,75) + rate_constant(i,4) * number_density(i,166)

    ! df_HO2/d(C3H7OOH)
    !  k_C3H7OOH_1: C3H7OOH -> 0.82*CH3COCH3 + 1*OH + 1*HO2
    LU(i,77) = LU(i,77) + rate_constant(i,115)

    ! df_OH/d(C3H7OOH)
    !  k_C3H7OOH_OH_1: C3H7OOH + OH -> 1*H2O + 1*C3H7O2
    LU(i,76) = LU(i,76) - rate_constant(i,4) * number_density(i,166)

    !  k_C3H7OOH_1: C3H7OOH -> 0.82*CH3COCH3 + 1*OH + 1*HO2
    LU(i,76) = LU(i,76) + rate_constant(i,115)

    ! df_C3H7OOH/d(C3H7OOH)
    !  k_C3H7OOH_OH_1: C3H7OOH + OH -> 1*H2O + 1*C3H7O2
    LU(i,72) = LU(i,72) - rate_constant(i,4) * number_density(i,166)

    !  k_C3H7OOH_1: C3H7OOH -> 0.82*CH3COCH3 + 1*OH + 1*HO2
    LU(i,72) = LU(i,72) - rate_constant(i,115)

    ! df_H2O/d(NH3)
    !  k_NH3_OH_1: NH3 + OH -> 1*H2O
    LU(i,14) = LU(i,14) + rate_constant(i,461) * number_density(i,166)

    ! df_OH/d(NH3)
    !  k_NH3_OH_1: NH3 + OH -> 1*H2O
    LU(i,15) = LU(i,15) - rate_constant(i,461) * number_density(i,166)

    ! df_NH3/d(NH3)
    !  k_NH3_OH_1: NH3 + OH -> 1*H2O
    LU(i,13) = LU(i,13) - rate_constant(i,461) * number_density(i,166)

    ! df_CO2/d(TERP2OOH)
    !  k_TERP2OOH_1: TERP2OOH -> 1*OH + 0.375*CH2O + 0.3*CH3COCH3 + 0.25*CO + 1*CO2 + 1*TERPROD2 + 1*HO2 + 0.25*GLYALD
    LU(i,194) = LU(i,194) + rate_constant(i,49)

    ! df_CH3COCH3/d(TERP2OOH)
    !  k_TERP2OOH_1: TERP2OOH -> 1*OH + 0.375*CH2O + 0.3*CH3COCH3 + 0.25*CO + 1*CO2 + 1*TERPROD2 + 1*HO2 + 0.25*GLYALD
    LU(i,195) = LU(i,195) + 0.3*rate_constant(i,49)

    ! df_CH2O/d(TERP2OOH)
    !  k_TERP2OOH_1: TERP2OOH -> 1*OH + 0.375*CH2O + 0.3*CH3COCH3 + 0.25*CO + 1*CO2 + 1*TERPROD2 + 1*HO2 + 0.25*GLYALD
    LU(i,196) = LU(i,196) + 0.375*rate_constant(i,49)

    ! df_GLYALD/d(TERP2OOH)
    !  k_TERP2OOH_1: TERP2OOH -> 1*OH + 0.375*CH2O + 0.3*CH3COCH3 + 0.25*CO + 1*CO2 + 1*TERPROD2 + 1*HO2 + 0.25*GLYALD
    LU(i,199) = LU(i,199) + 0.25*rate_constant(i,49)

    ! df_HO2/d(TERP2OOH)
    !  k_TERP2OOH_1: TERP2OOH -> 1*OH + 0.375*CH2O + 0.3*CH3COCH3 + 0.25*CO + 1*CO2 + 1*TERPROD2 + 1*HO2 + 0.25*GLYALD
    LU(i,202) = LU(i,202) + rate_constant(i,49)

    ! df_TERP2O2/d(TERP2OOH)
    !  k_OH_TERP2OOH_1: OH + TERP2OOH -> 1*TERP2O2
    LU(i,197) = LU(i,197) + rate_constant(i,445) * number_density(i,166)

    ! df_TERPROD2/d(TERP2OOH)
    !  k_TERP2OOH_1: TERP2OOH -> 1*OH + 0.375*CH2O + 0.3*CH3COCH3 + 0.25*CO + 1*CO2 + 1*TERPROD2 + 1*HO2 + 0.25*GLYALD
    LU(i,198) = LU(i,198) + rate_constant(i,49)

    ! df_OH/d(TERP2OOH)
    !  k_TERP2OOH_1: TERP2OOH -> 1*OH + 0.375*CH2O + 0.3*CH3COCH3 + 0.25*CO + 1*CO2 + 1*TERPROD2 + 1*HO2 + 0.25*GLYALD
    LU(i,200) = LU(i,200) + rate_constant(i,49)

    !  k_OH_TERP2OOH_1: OH + TERP2OOH -> 1*TERP2O2
    LU(i,200) = LU(i,200) - rate_constant(i,445) * number_density(i,166)

    ! df_CO/d(TERP2OOH)
    !  k_TERP2OOH_1: TERP2OOH -> 1*OH + 0.375*CH2O + 0.3*CH3COCH3 + 0.25*CO + 1*CO2 + 1*TERPROD2 + 1*HO2 + 0.25*GLYALD
    LU(i,201) = LU(i,201) + 0.25*rate_constant(i,49)

    ! df_TERP2OOH/d(TERP2OOH)
    !  k_TERP2OOH_1: TERP2OOH -> 1*OH + 0.375*CH2O + 0.3*CH3COCH3 + 0.25*CO + 1*CO2 + 1*TERPROD2 + 1*HO2 + 0.25*GLYALD
    LU(i,193) = LU(i,193) - rate_constant(i,49)

    !  k_OH_TERP2OOH_1: OH + TERP2OOH -> 1*TERP2O2
    LU(i,193) = LU(i,193) - rate_constant(i,445) * number_density(i,166)

    ! df_HYAC/d(POOH)
    !  k_OH_POOH_1: OH + POOH -> 0.5*PO2 + 0.5*OH + 0.5*HYAC + 1*H2O
    LU(i,33) = LU(i,33) + 0.5*rate_constant(i,127) * number_density(i,166)

    ! df_H2O/d(POOH)
    !  k_OH_POOH_1: OH + POOH -> 0.5*PO2 + 0.5*OH + 0.5*HYAC + 1*H2O
    LU(i,34) = LU(i,34) + rate_constant(i,127) * number_density(i,166)

    ! df_CH2O/d(POOH)
    !  k_POOH_1: POOH -> 1*CH3CHO + 1*CH2O + 1*HO2 + 1*OH
    LU(i,35) = LU(i,35) + rate_constant(i,162)
  end do
  !$acc end parallel

end subroutine dforce_dy130

subroutine dforce_dy131(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! df_HO2/d(POOH)
    !  k_POOH_1: POOH -> 1*CH3CHO + 1*CH2O + 1*HO2 + 1*OH
    LU(i,39) = LU(i,39) + rate_constant(i,162)

    ! df_PO2/d(POOH)
    !  k_OH_POOH_1: OH + POOH -> 0.5*PO2 + 0.5*OH + 0.5*HYAC + 1*H2O
    LU(i,36) = LU(i,36) + 0.5*rate_constant(i,127) * number_density(i,166)

    ! df_OH/d(POOH)
    !  k_OH_POOH_1: OH + POOH -> 0.5*PO2 + 0.5*OH + 0.5*HYAC + 1*H2O
    LU(i,37) = LU(i,37) - 0.5*rate_constant(i,127) * number_density(i,166)

    !  k_POOH_1: POOH -> 1*CH3CHO + 1*CH2O + 1*HO2 + 1*OH
    LU(i,37) = LU(i,37) + rate_constant(i,162)

    ! df_CH3CHO/d(POOH)
    !  k_POOH_1: POOH -> 1*CH3CHO + 1*CH2O + 1*HO2 + 1*OH
    LU(i,38) = LU(i,38) + rate_constant(i,162)

    ! df_POOH/d(POOH)
    !  k_OH_POOH_1: OH + POOH -> 0.5*PO2 + 0.5*OH + 0.5*HYAC + 1*H2O
    LU(i,32) = LU(i,32) - rate_constant(i,127) * number_density(i,166)

    !  k_POOH_1: POOH -> 1*CH3CHO + 1*CH2O + 1*HO2 + 1*OH
    LU(i,32) = LU(i,32) - rate_constant(i,162)

    ! df_CH3CO3/d(NOA)
    !  k_NOA_1: NOA -> 1*NO2 + 1*CH2O + 1*CH3CO3
    LU(i,113) = LU(i,113) + rate_constant(i,119)

    ! df_NO2/d(NOA)
    !  k_NOA_1: NOA -> 1*NO2 + 1*CH2O + 1*CH3CO3
    LU(i,114) = LU(i,114) + rate_constant(i,119)

    !  k_NOA_OH_1: NOA + OH -> 1*NO2 + 1*CH3COCHO
    LU(i,114) = LU(i,114) + rate_constant(i,311) * number_density(i,166)

    ! df_CH3COCHO/d(NOA)
    !  k_NOA_OH_1: NOA + OH -> 1*NO2 + 1*CH3COCHO
    LU(i,115) = LU(i,115) + rate_constant(i,311) * number_density(i,166)

    ! df_CH2O/d(NOA)
    !  k_NOA_1: NOA -> 1*NO2 + 1*CH2O + 1*CH3CO3
    LU(i,116) = LU(i,116) + rate_constant(i,119)

    ! df_OH/d(NOA)
    !  k_NOA_OH_1: NOA + OH -> 1*NO2 + 1*CH3COCHO
    LU(i,117) = LU(i,117) - rate_constant(i,311) * number_density(i,166)

    ! df_NOA/d(NOA)
    !  k_NOA_1: NOA -> 1*NO2 + 1*CH2O + 1*CH3CO3
    LU(i,112) = LU(i,112) - rate_constant(i,119)

    !  k_NOA_OH_1: NOA + OH -> 1*NO2 + 1*CH3COCHO
    LU(i,112) = LU(i,112) - rate_constant(i,311) * number_density(i,166)

    ! df_NO2/d(NC4CHO)
    !  k_NC4CHO_1: NC4CHO -> 1*BIGALD3 + 1*NO2 + 1*HO2
    LU(i,86) = LU(i,86) + rate_constant(i,169)

    ! df_BIGALD3/d(NC4CHO)
    !  k_NC4CHO_1: NC4CHO -> 1*BIGALD3 + 1*NO2 + 1*HO2
    LU(i,87) = LU(i,87) + rate_constant(i,169)

    ! df_GLYOXAL/d(NC4CHO)
    !  k_NC4CHO_OH_1: NC4CHO + OH -> 1*GLYOXAL + 1*NOA + 1*HO2
    LU(i,88) = LU(i,88) + rate_constant(i,182) * number_density(i,166)

    ! df_HO2/d(NC4CHO)
    !  k_NC4CHO_1: NC4CHO -> 1*BIGALD3 + 1*NO2 + 1*HO2
    LU(i,90) = LU(i,90) + rate_constant(i,169)

    !  k_NC4CHO_OH_1: NC4CHO + OH -> 1*GLYOXAL + 1*NOA + 1*HO2
    LU(i,90) = LU(i,90) + rate_constant(i,182) * number_density(i,166)

    ! df_OH/d(NC4CHO)
    !  k_NC4CHO_OH_1: NC4CHO + OH -> 1*GLYOXAL + 1*NOA + 1*HO2
    LU(i,89) = LU(i,89) - rate_constant(i,182) * number_density(i,166)

    ! df_NOA/d(NC4CHO)
    !  k_NC4CHO_OH_1: NC4CHO + OH -> 1*GLYOXAL + 1*NOA + 1*HO2
    LU(i,85) = LU(i,85) + rate_constant(i,182) * number_density(i,166)

    ! df_NC4CHO/d(NC4CHO)
    !  k_NC4CHO_1: NC4CHO -> 1*BIGALD3 + 1*NO2 + 1*HO2
    LU(i,84) = LU(i,84) - rate_constant(i,169)

    !  k_NC4CHO_OH_1: NC4CHO + OH -> 1*GLYOXAL + 1*NOA + 1*HO2
    LU(i,84) = LU(i,84) - rate_constant(i,182) * number_density(i,166)

    ! df_CH3CO3/d(TEPOMUC)
    !  k_TEPOMUC_1: TEPOMUC -> 0.5*CH3CO3 + 1*HO2 + 1.5*CO
    LU(i,10) = LU(i,10) + 0.5*rate_constant(i,85)

    ! df_HO2/d(TEPOMUC)
    !  k_TEPOMUC_1: TEPOMUC -> 0.5*CH3CO3 + 1*HO2 + 1.5*CO
    LU(i,12) = LU(i,12) + rate_constant(i,85)

    ! df_CO/d(TEPOMUC)
    !  k_TEPOMUC_1: TEPOMUC -> 0.5*CH3CO3 + 1*HO2 + 1.5*CO
    LU(i,11) = LU(i,11) + 1.5*rate_constant(i,85)
  end do
  !$acc end parallel

end subroutine dforce_dy131

subroutine dforce_dy132(LU, rate_constant, number_density, number_density_air)
  ! Compute the derivative of the Forcing w.r.t. each chemical
  ! Also known as the Jacobian
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)

  ! Local variables
  integer :: i, j 


  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! df_TEPOMUC/d(TEPOMUC)
    !  k_TEPOMUC_1: TEPOMUC -> 0.5*CH3CO3 + 1*HO2 + 1.5*CO
    LU(i,9) = LU(i,9) - rate_constant(i,85)

    ! df_O2/d(M)
    !  k_M_O_O2_1: M + O + O2 -> 1*O3 + 1*M
    LU(i,2) = LU(i,2) - rate_constant(i,202) * number_density(i,187) * number_density(i,41)

    !  k_HO2_HO2_M_1: HO2 + HO2 + M -> 1*H2O2 + 1*O2 + 1*M
    LU(i,2) = LU(i,2) + rate_constant(i,210) * number_density(i,192) * number_density(i,192)

    !  k_H2O_HO2_HO2_M_1: H2O + HO2 + HO2 + M -> 1*H2O2 + 1*O2 + 1*M + 1*H2O
    LU(i,2) = LU(i,2) + rate_constant(i,212) * number_density(i,68) * number_density(i,192) * number_density(i,192)

    !  k_M_O_O_1: M + O + O -> 1*O2 + 1*M
    LU(i,2) = LU(i,2) + rate_constant(i,304) * number_density(i,187) * number_density(i,187)

    ! df_CL2O2/d(M)
    !  k_CL2O2_M_1: CL2O2 + M -> 2*CLO + 1*M
    LU(i,3) = LU(i,3) - rate_constant(i,67) * number_density(i,69)

    ! df_CLO/d(M)
    !  k_CL2O2_M_1: CL2O2 + M -> 2*CLO + 1*M
    LU(i,4) = LU(i,4) + 2*rate_constant(i,67) * number_density(i,69)

    ! df_O/d(M)
    !  k_M_O_O2_1: M + O + O2 -> 1*O3 + 1*M
    LU(i,7) = LU(i,7) - rate_constant(i,202) * number_density(i,187) * number_density(i,41)

    !  k_M_O_O_1: M + O + O -> 1*O2 + 1*M
    LU(i,7) = LU(i,7) - rate_constant(i,304) * number_density(i,187) * number_density(i,187)

    !  k_M_O_O_1: M + O + O -> 1*O2 + 1*M
    LU(i,7) = LU(i,7) - rate_constant(i,304) * number_density(i,187) * number_density(i,187)

    ! df_H2O2/d(M)
    !  k_HO2_HO2_M_1: HO2 + HO2 + M -> 1*H2O2 + 1*O2 + 1*M
    LU(i,6) = LU(i,6) + rate_constant(i,210) * number_density(i,192) * number_density(i,192)

    !  k_H2O_HO2_HO2_M_1: H2O + HO2 + HO2 + M -> 1*H2O2 + 1*O2 + 1*M + 1*H2O
    LU(i,6) = LU(i,6) + rate_constant(i,212) * number_density(i,68) * number_density(i,192) * number_density(i,192)

    ! df_HO2/d(M)
    !  k_HO2_HO2_M_1: HO2 + HO2 + M -> 1*H2O2 + 1*O2 + 1*M
    LU(i,8) = LU(i,8) - rate_constant(i,210) * number_density(i,192) * number_density(i,192)

    !  k_HO2_HO2_M_1: HO2 + HO2 + M -> 1*H2O2 + 1*O2 + 1*M
    LU(i,8) = LU(i,8) - rate_constant(i,210) * number_density(i,192) * number_density(i,192)

    !  k_H2O_HO2_HO2_M_1: H2O + HO2 + HO2 + M -> 1*H2O2 + 1*O2 + 1*M + 1*H2O
    LU(i,8) = LU(i,8) - rate_constant(i,212) * number_density(i,68) * number_density(i,192) * number_density(i,192)

    !  k_H2O_HO2_HO2_M_1: H2O + HO2 + HO2 + M -> 1*H2O2 + 1*O2 + 1*M + 1*H2O
    LU(i,8) = LU(i,8) - rate_constant(i,212) * number_density(i,68) * number_density(i,192) * number_density(i,192)

    ! df_O3/d(M)
    !  k_M_O_O2_1: M + O + O2 -> 1*O3 + 1*M
    LU(i,5) = LU(i,5) + rate_constant(i,202) * number_density(i,187) * number_density(i,41)

  end do
  !$acc end parallel

end subroutine dforce_dy132

