subroutine factored_alpha_minus_jac(LU, alpha, dforce_dy)
  ! Compute LU decomposition of [alpha * I - dforce_dy]

  real(r8), intent(in) :: dforce_dy(ncell,number_sparse_factor_elements)
  real(r8), intent(in) :: alpha
  real(r8), intent(out) :: LU(ncell,number_sparse_factor_elements)

  ! Local variables
  integer :: i, j

  ! add alpha to diagonal elements

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector collapse(2)
  do j = 1, number_sparse_factor_elements 
     do i = 1, ncell
        LU(i,j) = -dforce_dy(i,j)
     end do
  end do
  !$acc end parallel

  call factored_alpha_minus_jac1(LU, alpha, dforce_dy)
  call factored_alpha_minus_jac2(LU, alpha, dforce_dy)

end subroutine factored_alpha_minus_jac


subroutine p_force1(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! M
    force(i,1) = 0

    ! TEPOMUC
    force(i,2) = 0

    ! k_OH_XYLENES_1: OH + XYLENES -> 0.15*XYLOL + 0.23*TEPOMUC + 0.06*BZOO + 0.56*XYLENO2 + 0.38*HO2
    force(i,2) = force(i,2) + 0.23*rate_constant(i,7) * number_density(i,166) * number_density(i,140)

    ! k_TEPOMUC_1: TEPOMUC -> 0.5*CH3CO3 + 1*HO2 + 1.5*CO
    force(i,2) = force(i,2) - rate_constant(i,85) * number_density(i,2)

    ! k_OH_TOLUENE_2: OH + TOLUENE -> 0.18*CRESOL + 0.1*TEPOMUC + 0.07*BZOO + 0.65*TOLO2 + 0.28*HO2
    force(i,2) = force(i,2) + 0.1*rate_constant(i,435) * number_density(i,166) * number_density(i,117)

    ! NH3
    force(i,3) = 0

    ! k_NH3_OH_1: NH3 + OH -> 1*H2O
    force(i,3) = force(i,3) - rate_constant(i,461) * number_density(i,3) * number_density(i,166)

    ! COF2
    force(i,4) = 0

    ! k_HCFC142B_OH_1: HCFC142B + OH -> 1*CL + 1*COF2
    force(i,4) = force(i,4) + rate_constant(i,14) * number_density(i,172) * number_density(i,166)

    ! k_CFC114_O1D_1: CFC114 + O1D -> 2*CL + 2*COF2
    force(i,4) = force(i,4) + 2*rate_constant(i,18) * number_density(i,62) * number_density(i,112)

    ! k_HCFC22_O1D_1: HCFC22 + O1D -> 1*CL + 1*COF2
    force(i,4) = force(i,4) + rate_constant(i,64) * number_density(i,83) * number_density(i,112)

    ! k_CF2CLBR_1: CF2CLBR -> 1*BR + 1*CL + 1*COF2
    force(i,4) = force(i,4) + rate_constant(i,74) * number_density(i,98)

    ! k_CF2CLBR_O1D_1: CF2CLBR + O1D -> 1*CL + 1*BR + 1*COF2
    force(i,4) = force(i,4) + rate_constant(i,128) * number_density(i,98) * number_density(i,112)

    ! k_HCFC22_1: HCFC22 -> 1*CL + 1*COF2
    force(i,4) = force(i,4) + rate_constant(i,163) * number_density(i,83)

    ! k_CFC12_O1D_1: CFC12 + O1D -> 2*CL + 1*COF2
    force(i,4) = force(i,4) + rate_constant(i,222) * number_density(i,64) * number_density(i,112)

    ! k_HCFC142B_1: HCFC142B -> 1*CL + 1*COF2
    force(i,4) = force(i,4) + rate_constant(i,230) * number_density(i,172)

    ! k_HCFC22_OH_1: HCFC22 + OH -> 1*H2O + 1*CL + 1*COF2
    force(i,4) = force(i,4) + rate_constant(i,238) * number_density(i,83) * number_density(i,166)

    ! k_CFC115_O1D_1: CFC115 + O1D -> 1*CL + 1*F + 2*COF2
    force(i,4) = force(i,4) + 2*rate_constant(i,253) * number_density(i,63) * number_density(i,112)

    ! k_CFC115_1: CFC115 -> 1*CL + 1*F + 2*COF2
    force(i,4) = force(i,4) + 2*rate_constant(i,280) * number_density(i,63)

    ! k_CF3BR_1: CF3BR -> 1*BR + 1*F + 1*COF2
    force(i,4) = force(i,4) + rate_constant(i,303) * number_density(i,60)

    ! k_H2402_O1D_1: H2402 + O1D -> 2*BR + 2*COF2
    force(i,4) = force(i,4) + 2*rate_constant(i,347) * number_density(i,66) * number_density(i,112)

    ! k_CFC114_1: CFC114 -> 2*CL + 2*COF2
    force(i,4) = force(i,4) + 2*rate_constant(i,355) * number_density(i,62)

    ! k_CFC12_1: CFC12 -> 2*CL + 1*COF2
    force(i,4) = force(i,4) + rate_constant(i,369) * number_density(i,64)

    ! k_CF3BR_O1D_1: CF3BR + O1D -> 1*BR + 1*F + 1*COF2
    force(i,4) = force(i,4) + rate_constant(i,381) * number_density(i,60) * number_density(i,112)

    ! k_H2402_1: H2402 -> 2*BR + 2*COF2
    force(i,4) = force(i,4) + 2*rate_constant(i,441) * number_density(i,66)

    ! k_HCFC142B_O1D_1: HCFC142B + O1D -> 1*CL + 1*COF2
    force(i,4) = force(i,4) + rate_constant(i,466) * number_density(i,172) * number_density(i,112)

    ! ALKNIT
    force(i,5) = 0

    ! k_ALKO2_NO_2: ALKO2 + NO -> 1*ALKNIT
    force(i,5) = force(i,5) + rate_constant(i,194) * number_density(i,85) * number_density(i,137)

    ! k_ALKNIT_OH_1: ALKNIT + OH -> 0.4*CH2O + 0.8*CH3CHO + 0.8*CH3COCH3 + 1*NO2
    force(i,5) = force(i,5) - rate_constant(i,394) * number_density(i,5) * number_density(i,166)

    ! k_ALKNIT_1: ALKNIT -> 1*NO2 + 0.4*CH3CHO + 0.1*CH2O + 0.25*CH3COCH3 + 1*HO2 + 0.8*MEK
    force(i,5) = force(i,5) - rate_constant(i,452) * number_density(i,5)

    ! COFCL
    force(i,6) = 0

    ! k_HCFC141B_O1D_1: HCFC141B + O1D -> 1*CL + 1*COFCL
    force(i,6) = force(i,6) + rate_constant(i,137) * number_density(i,106) * number_density(i,112)

    ! k_HCFC141B_OH_1: HCFC141B + OH -> 1*CL + 1*COFCL
    force(i,6) = force(i,6) + rate_constant(i,360) * number_density(i,106) * number_density(i,166)

    ! F
    force(i,7) = 0
  end do
  !$acc end parallel

end subroutine p_force1

subroutine p_force2(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_CFC115_O1D_1: CFC115 + O1D -> 1*CL + 1*F + 2*COF2
    force(i,7) = force(i,7) + rate_constant(i,253) * number_density(i,63) * number_density(i,112)

    ! k_CFC115_1: CFC115 -> 1*CL + 1*F + 2*COF2
    force(i,7) = force(i,7) + rate_constant(i,280) * number_density(i,63)

    ! k_CF3BR_1: CF3BR -> 1*BR + 1*F + 1*COF2
    force(i,7) = force(i,7) + rate_constant(i,303) * number_density(i,60)

    ! k_CF3BR_O1D_1: CF3BR + O1D -> 1*BR + 1*F + 1*COF2
    force(i,7) = force(i,7) + rate_constant(i,381) * number_density(i,60) * number_density(i,112)

    ! BZOOH
    force(i,8) = 0

    ! k_BZOO_HO2_1: BZOO + HO2 -> 1*BZOOH
    force(i,8) = force(i,8) + rate_constant(i,331) * number_density(i,33) * number_density(i,192)

    ! k_BZOOH_1: BZOOH -> 1*BZALD + 1*OH + 1*HO2
    force(i,8) = force(i,8) - rate_constant(i,437) * number_density(i,8)

    ! k_BZOOH_OH_1: BZOOH + OH -> 1*BZOO
    force(i,8) = force(i,8) - rate_constant(i,485) * number_density(i,8) * number_density(i,166)

    ! POOH
    force(i,9) = 0

    ! k_OH_POOH_1: OH + POOH -> 0.5*PO2 + 0.5*OH + 0.5*HYAC + 1*H2O
    force(i,9) = force(i,9) - rate_constant(i,127) * number_density(i,166) * number_density(i,9)

    ! k_POOH_1: POOH -> 1*CH3CHO + 1*CH2O + 1*HO2 + 1*OH
    force(i,9) = force(i,9) - rate_constant(i,162) * number_density(i,9)

    ! k_HO2_PO2_1: HO2 + PO2 -> 1*POOH + 1*O2
    force(i,9) = force(i,9) + rate_constant(i,265) * number_density(i,192) * number_density(i,151)

    ! C6H5OOH
    force(i,10) = 0

    ! k_C6H5O2_HO2_1: C6H5O2 + HO2 -> 1*C6H5OOH
    force(i,10) = force(i,10) + rate_constant(i,179) * number_density(i,81) * number_density(i,192)

    ! k_C6H5OOH_OH_1: C6H5OOH + OH -> 1*C6H5O2
    force(i,10) = force(i,10) - rate_constant(i,242) * number_density(i,10) * number_density(i,166)

    ! k_C6H5OOH_1: C6H5OOH -> 1*PHENO + 1*OH
    force(i,10) = force(i,10) - rate_constant(i,350) * number_density(i,10)

    ! N2
    force(i,11) = 0

    ! k_N_NO2_1: N + NO2 -> 1*N2 + 1*O2
    force(i,11) = force(i,11) + rate_constant(i,8) * number_density(i,185) * number_density(i,54)

    ! k_N2O_1: N2O -> 1*O1D + 1*N2
    force(i,11) = force(i,11) + rate_constant(i,147) * number_density(i,161)

    ! k_N_NO_1: N + NO -> 1*N2 + 1*O
    force(i,11) = force(i,11) + rate_constant(i,408) * number_density(i,185) * number_density(i,137)

    ! k_N2O_O1D_2: N2O + O1D -> 1*N2 + 1*O2
    force(i,11) = force(i,11) + rate_constant(i,443) * number_density(i,161) * number_density(i,112)

    ! PAN
    force(i,12) = 0

    ! k_PAN_1: PAN -> 1*CH3CO3 + 1*NO2
    force(i,12) = force(i,12) - rate_constant(i,31) * number_density(i,12)

    ! k_OH_PAN_1: OH + PAN -> 1*CH2O + 1*NO3
    force(i,12) = force(i,12) - rate_constant(i,144) * number_density(i,166) * number_density(i,12)

    ! k_PAN_2: PAN -> 0.6*CH3CO3 + 0.6*NO2 + 0.4*CH3O2 + 0.4*NO3 + 0.4*CO2
    force(i,12) = force(i,12) - rate_constant(i,362) * number_density(i,12)

    ! k_CH3CO3_NO2_1: CH3CO3 + NO2 -> 1*PAN
    force(i,12) = force(i,12) + rate_constant(i,383) * number_density(i,49) * number_density(i,54)

    ! BENZO2
    force(i,13) = 0

    ! k_BENZO2_NO_1: BENZO2 + NO -> 1*NO2 + 1*GLYOXAL + 0.5*BIGALD1 + 1*HO2
    force(i,13) = force(i,13) - rate_constant(i,59) * number_density(i,13) * number_density(i,137)

    ! k_BENZENE_OH_1: BENZENE + OH -> 0.53*PHENOL + 0.12*BEPOMUC + 0.65*HO2 + 0.35*BENZO2
    force(i,13) = force(i,13) + 0.35*rate_constant(i,318) * number_density(i,101) * number_density(i,166)

    ! k_BENZOOH_OH_1: BENZOOH + OH -> 1*BENZO2
    force(i,13) = force(i,13) + rate_constant(i,382) * number_density(i,91) * number_density(i,166)

    ! k_BENZO2_HO2_1: BENZO2 + HO2 -> 1*BENZOOH
    force(i,13) = force(i,13) - rate_constant(i,391) * number_density(i,13) * number_density(i,192)

    ! XYLOL
    force(i,14) = 0

    ! k_OH_XYLENES_1: OH + XYLENES -> 0.15*XYLOL + 0.23*TEPOMUC + 0.06*BZOO + 0.56*XYLENO2 + 0.38*HO2
    force(i,14) = force(i,14) + 0.15*rate_constant(i,7) * number_density(i,166) * number_density(i,140)

    ! k_OH_XYLOL_1: OH + XYLOL -> 0.3*XYLOLO2 + 0.63*HO2 + 0.07*PHENO
    force(i,14) = force(i,14) - rate_constant(i,80) * number_density(i,166) * number_density(i,14)
  end do
  !$acc end parallel

end subroutine p_force2

subroutine p_force3(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
