    ! k_ISOP_OH_1: ISOP + OH -> 1*ISOP + 1*OH + 0.0031*SOAG0 + 0.0035*SOAG1 + 0.0003*SOAG2 + 0.0271*SOAG3 + 0.0474*SOAG4
