    ! k_MTERP_OH_2: MTERP + OH -> 1*MTERP + 1*OH + 0.0508*SOAG0 + 0.1149*SOAG1 + 0.0348*SOAG2 + 0.0554*SOAG3 + 0.1278*SOAG4
