subroutine p_force4(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_ISOP_O3_1: ISOP + O3 -> 1*ISOP + 1*O3 + 0.0033*SOAG3
    force(i,18) = force(i,18) + 0.0033*rate_constant(i,42) * number_density(i,142) * number_density(i,171)

    ! k_OH_SVOC_1: OH + SVOC -> 1*OH + 0.5931*SOAG0 + 0.1534*SOAG1 + 0.0459*SOAG2 + 0.0085*SOAG3 + 0.0128*SOAG4
    force(i,18) = force(i,18) + 0.0085*rate_constant(i,51) * number_density(i,166) * number_density(i,30)

    ! k_OH_TOLUENE_1: OH + TOLUENE -> 1*TOLUENE + 1*OH + 0.1364*SOAG0 + 0.0101*SOAG1 + 0.0763*SOAG2 + 0.2157*SOAG3 + 0.0738*SOAG4
    force(i,18) = force(i,18) + 0.2157*rate_constant(i,55) * number_density(i,166) * number_density(i,117)

    ! k_ISOP_OH_1: ISOP + OH -> 1*ISOP + 1*OH + 0.0031*SOAG0 + 0.0035*SOAG1 + 0.0003*SOAG2 + 0.0271*SOAG3 + 0.0474*SOAG4
    force(i,18) = force(i,18) + 0.0271*rate_constant(i,75) * number_density(i,142) * number_density(i,166)

    ! k_MTERP_O3_1: MTERP + O3 -> 1*MTERP + 1*O3 + 0.0508*SOAG0 + 0.1149*SOAG1 + 0.0348*SOAG2 + 0.0554*SOAG3 + 0.1278*SOAG4
    force(i,18) = force(i,18) + 0.0554*rate_constant(i,78) * number_density(i,31) * number_density(i,171)

    ! k_BCARY_OH_1: BCARY + OH -> 1*BCARY + 1*OH + 0.2202*SOAG0 + 0.2067*SOAG1 + 0.0653*SOAG2 + 0.1284*SOAG3 + 0.114*SOAG4
    force(i,18) = force(i,18) + 0.1284*rate_constant(i,168) * number_density(i,102) * number_density(i,166)

    ! k_MTERP_NO3_2: MTERP + NO3 -> 1*MTERP + 1*NO3 + 0.17493*SOAG3 + 0.59019*SOAG4
    force(i,18) = force(i,18) + 0.17493*rate_constant(i,173) * number_density(i,31) * number_density(i,165)

    ! k_IVOC_OH_1: IVOC + OH -> 1*OH + 0.2381*SOAG0 + 0.1308*SOAG1 + 0.0348*SOAG2 + 0.0076*SOAG3 + 0.0113*SOAG4
    force(i,18) = force(i,18) + 0.0076*rate_constant(i,243) * number_density(i,34) * number_density(i,166)

    ! k_MTERP_OH_2: MTERP + OH -> 1*MTERP + 1*OH + 0.0508*SOAG0 + 0.1149*SOAG1 + 0.0348*SOAG2 + 0.0554*SOAG3 + 0.1278*SOAG4
    force(i,18) = force(i,18) + 0.0554*rate_constant(i,254) * number_density(i,31) * number_density(i,166)

    ! k_ISOP_NO3_1: ISOP + NO3 -> 1*ISOP + 1*NO3 + 0.059024*SOAG3 + 0.025024*SOAG4
    force(i,18) = force(i,18) + 0.059024*rate_constant(i,346) * number_density(i,142) * number_density(i,165)

    ! k_BCARY_O3_2: BCARY + O3 -> 1*BCARY + 1*O3 + 0.2202*SOAG0 + 0.2067*SOAG1 + 0.0653*SOAG2 + 0.1284*SOAG3 + 0.114*SOAG4
    force(i,18) = force(i,18) + 0.1284*rate_constant(i,349) * number_density(i,102) * number_density(i,171)

    ! k_BCARY_NO3_2: BCARY + NO3 -> 1*BCARY + 1*NO3 + 0.17493*SOAG3 + 0.59019*SOAG4
    force(i,18) = force(i,18) + 0.17493*rate_constant(i,358) * number_density(i,102) * number_density(i,165)

    ! k_OH_XYLENES_2: OH + XYLENES -> 1*XYLENES + 1*OH + 0.1677*SOAG0 + 0.0174*SOAG1 + 0.086*SOAG2 + 0.0512*SOAG3 + 0.1598*SOAG4
    force(i,18) = force(i,18) + 0.0512*rate_constant(i,411) * number_density(i,166) * number_density(i,140)

    ! k_BENZENE_OH_2: BENZENE + OH -> 1*BENZENE + 1*OH + 0.0023*SOAG0 + 0.0008*SOAG1 + 0.0843*SOAG2 + 0.0443*SOAG3 + 0.1621*SOAG4
    force(i,18) = force(i,18) + 0.0443*rate_constant(i,478) * number_density(i,101) * number_density(i,166)

    ! SOAG4
    force(i,19) = 0

    ! k_OH_SVOC_1: OH + SVOC -> 1*OH + 0.5931*SOAG0 + 0.1534*SOAG1 + 0.0459*SOAG2 + 0.0085*SOAG3 + 0.0128*SOAG4
    force(i,19) = force(i,19) + 0.0128*rate_constant(i,51) * number_density(i,166) * number_density(i,30)

    ! k_OH_TOLUENE_1: OH + TOLUENE -> 1*TOLUENE + 1*OH + 0.1364*SOAG0 + 0.0101*SOAG1 + 0.0763*SOAG2 + 0.2157*SOAG3 + 0.0738*SOAG4
    force(i,19) = force(i,19) + 0.0738*rate_constant(i,55) * number_density(i,166) * number_density(i,117)

    ! k_ISOP_OH_1: ISOP + OH -> 1*ISOP + 1*OH + 0.0031*SOAG0 + 0.0035*SOAG1 + 0.0003*SOAG2 + 0.0271*SOAG3 + 0.0474*SOAG4
    force(i,19) = force(i,19) + 0.0474*rate_constant(i,75) * number_density(i,142) * number_density(i,166)

    ! k_MTERP_O3_1: MTERP + O3 -> 1*MTERP + 1*O3 + 0.0508*SOAG0 + 0.1149*SOAG1 + 0.0348*SOAG2 + 0.0554*SOAG3 + 0.1278*SOAG4
    force(i,19) = force(i,19) + 0.1278*rate_constant(i,78) * number_density(i,31) * number_density(i,171)

    ! k_BCARY_OH_1: BCARY + OH -> 1*BCARY + 1*OH + 0.2202*SOAG0 + 0.2067*SOAG1 + 0.0653*SOAG2 + 0.1284*SOAG3 + 0.114*SOAG4
    force(i,19) = force(i,19) + 0.114*rate_constant(i,168) * number_density(i,102) * number_density(i,166)

    ! k_MTERP_NO3_2: MTERP + NO3 -> 1*MTERP + 1*NO3 + 0.17493*SOAG3 + 0.59019*SOAG4
    force(i,19) = force(i,19) + 0.59019*rate_constant(i,173) * number_density(i,31) * number_density(i,165)

    ! k_IVOC_OH_1: IVOC + OH -> 1*OH + 0.2381*SOAG0 + 0.1308*SOAG1 + 0.0348*SOAG2 + 0.0076*SOAG3 + 0.0113*SOAG4
    force(i,19) = force(i,19) + 0.0113*rate_constant(i,243) * number_density(i,34) * number_density(i,166)

    ! k_MTERP_OH_2: MTERP + OH -> 1*MTERP + 1*OH + 0.0508*SOAG0 + 0.1149*SOAG1 + 0.0348*SOAG2 + 0.0554*SOAG3 + 0.1278*SOAG4
    force(i,19) = force(i,19) + 0.1278*rate_constant(i,254) * number_density(i,31) * number_density(i,166)

    ! k_ISOP_NO3_1: ISOP + NO3 -> 1*ISOP + 1*NO3 + 0.059024*SOAG3 + 0.025024*SOAG4
    force(i,19) = force(i,19) + 0.025024*rate_constant(i,346) * number_density(i,142) * number_density(i,165)

    ! k_BCARY_O3_2: BCARY + O3 -> 1*BCARY + 1*O3 + 0.2202*SOAG0 + 0.2067*SOAG1 + 0.0653*SOAG2 + 0.1284*SOAG3 + 0.114*SOAG4
    force(i,19) = force(i,19) + 0.114*rate_constant(i,349) * number_density(i,102) * number_density(i,171)

    ! k_BCARY_NO3_2: BCARY + NO3 -> 1*BCARY + 1*NO3 + 0.17493*SOAG3 + 0.59019*SOAG4
    force(i,19) = force(i,19) + 0.59019*rate_constant(i,358) * number_density(i,102) * number_density(i,165)

    ! k_OH_XYLENES_2: OH + XYLENES -> 1*XYLENES + 1*OH + 0.1677*SOAG0 + 0.0174*SOAG1 + 0.086*SOAG2 + 0.0512*SOAG3 + 0.1598*SOAG4
    force(i,19) = force(i,19) + 0.1598*rate_constant(i,411) * number_density(i,166) * number_density(i,140)

    ! k_BENZENE_OH_2: BENZENE + OH -> 1*BENZENE + 1*OH + 0.0023*SOAG0 + 0.0008*SOAG1 + 0.0843*SOAG2 + 0.0443*SOAG3 + 0.1621*SOAG4
    force(i,19) = force(i,19) + 0.1621*rate_constant(i,478) * number_density(i,101) * number_density(i,166)

    ! C3H7OOH
    force(i,20) = 0

    ! k_C3H7OOH_OH_1: C3H7OOH + OH -> 1*H2O + 1*C3H7O2
    force(i,20) = force(i,20) - rate_constant(i,4) * number_density(i,20) * number_density(i,166)

    ! k_C3H7OOH_1: C3H7OOH -> 0.82*CH3COCH3 + 1*OH + 1*HO2
    force(i,20) = force(i,20) - rate_constant(i,115) * number_density(i,20)

    ! k_C3H7O2_HO2_1: C3H7O2 + HO2 -> 1*C3H7OOH + 1*O2
    force(i,20) = force(i,20) + rate_constant(i,142) * number_density(i,109) * number_density(i,192)

    ! PHENOL
    force(i,21) = 0

    ! k_OH_PHENOL_1: OH + PHENOL -> 0.14*PHENO2 + 0.8*HO2 + 0.06*PHENO
    force(i,21) = force(i,21) - rate_constant(i,266) * number_density(i,166) * number_density(i,21)
  end do
  !$acc end parallel

end subroutine p_force4

subroutine p_force5(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_BENZENE_OH_1: BENZENE + OH -> 0.53*PHENOL + 0.12*BEPOMUC + 0.65*HO2 + 0.35*BENZO2
    force(i,21) = force(i,21) + 0.53*rate_constant(i,318) * number_density(i,101) * number_density(i,166)

    ! H2SO4
    force(i,22) = 0

    ! k_H2O_SO3_1: H2O + SO3 -> 1*H2SO4 + 1*H2O
    force(i,22) = force(i,22) + rate_constant(i,325) * number_density(i,68) * number_density(i,28)

    ! NC4CHO
    force(i,23) = 0

    ! k_CH3O2_ISOPNO3_1: CH3O2 + ISOPNO3 -> 0.8*NC4CHO + 1.2*HO2 + 0.8*CH2O + 0.2*CH3OH + 0.2*NC4CH2OH
    force(i,23) = force(i,23) + 0.8*rate_constant(i,160) * number_density(i,191) * number_density(i,46)

    ! k_NC4CHO_1: NC4CHO -> 1*BIGALD3 + 1*NO2 + 1*HO2
    force(i,23) = force(i,23) - rate_constant(i,169) * number_density(i,23)

    ! k_NC4CHO_OH_1: NC4CHO + OH -> 1*GLYOXAL + 1*NOA + 1*HO2
    force(i,23) = force(i,23) - rate_constant(i,182) * number_density(i,23) * number_density(i,166)

    ! k_ISOPNO3_NO_1: ISOPNO3 + NO -> 1*NC4CHO + 1*NO2 + 1*HO2
    force(i,23) = force(i,23) + rate_constant(i,302) * number_density(i,46) * number_density(i,137)

    ! k_CH3CO3_ISOPNO3_1: CH3CO3 + ISOPNO3 -> 1*NC4CHO + 1*CH3O2 + 1*HO2
    force(i,23) = force(i,23) + rate_constant(i,413) * number_density(i,49) * number_density(i,46)

    ! k_ISOPNO3_NO3_1: ISOPNO3 + NO3 -> 1*NC4CHO + 1*NO2 + 1*HO2
    force(i,23) = force(i,23) + rate_constant(i,451) * number_density(i,46) * number_density(i,165)

    ! S
    force(i,24) = 0

    ! k_SO_1: SO -> 1*S + 1*O
    force(i,24) = force(i,24) + rate_constant(i,287) * number_density(i,32)

    ! k_OCS_1: OCS -> 1*S + 1*CO
    force(i,24) = force(i,24) + rate_constant(i,345) * number_density(i,29)

    ! MVK
    force(i,25) = 0

    ! k_MVK_1: MVK -> 0.7*C3H6 + 0.7*CO + 0.3*CH3O2 + 0.3*CH3CO3
    force(i,25) = force(i,25) - rate_constant(i,15) * number_density(i,25)

    ! k_CH3CO3_ISOPAO2_1: CH3CO3 + ISOPAO2 -> 1*CH3O2 + 1*HO2 + 1*CH2O + 0.39*MACR + 0.61*MVK + 1*CO2
    force(i,25) = force(i,25) + 0.61*rate_constant(i,65) * number_density(i,49) * number_density(i,189)

    ! k_ISOPOOH_1: ISOPOOH -> 0.402*MVK + 0.288*MACR + 0.69*CH2O + 1*HO2
    force(i,25) = force(i,25) + 0.402*rate_constant(i,233) * number_density(i,138)

    ! k_ISOPAO2_NO3_1: ISOPAO2 + NO3 -> 1*NO2 + 0.4*MACR + 0.6*MVK + 1*CH2O + 1*HO2
    force(i,25) = force(i,25) + 0.6*rate_constant(i,330) * number_density(i,189) * number_density(i,165)

    ! k_MVK_OH_1: MVK + OH -> 1*MACRO2
    force(i,25) = force(i,25) - rate_constant(i,336) * number_density(i,25) * number_density(i,166)

    ! k_ISOP_O3_2: ISOP + O3 -> 0.3*MACR + 0.2*MVK + 0.11*HCOOH + 0.62*CO + 0.32*OH + 0.37*HO2 + 0.91*CH2O + 0.08*CH3CO3 + 0.13*C3H6 + 0.05*CH3O2
    force(i,25) = force(i,25) + 0.2*rate_constant(i,377) * number_density(i,142) * number_density(i,171)

    ! k_MVK_O3_1: MVK + O3 -> 0.6*CH2O + 0.56*CO + 0.1*CH3CHO + 0.1*CO2 + 0.28*CH3CO3 + 0.5*CH3COCHO + 0.28*HO2 + 0.36*OH + 0.12*HCOOH
    force(i,25) = force(i,25) - rate_constant(i,420) * number_density(i,25) * number_density(i,171)

    ! k_CH3O2_ISOPAO2_1: CH3O2 + ISOPAO2 -> 0.25*CH3OH + 1*HO2 + 1.5*CH2O + 0.31*MACR + 0.44*MVK
    force(i,25) = force(i,25) + 0.44*rate_constant(i,434) * number_density(i,191) * number_density(i,189)

    ! k_ISOPAO2_NO_1: ISOPAO2 + NO -> 0.08*ISOPNITA + 0.92*NO2 + 0.36*MACR + 0.56*MVK + 0.92*CH2O + 0.92*HO2
    force(i,25) = force(i,25) + 0.56*rate_constant(i,464) * number_density(i,189) * number_density(i,137)

    ! XYLOLOOH
    force(i,26) = 0

    ! k_XYLOLOOH_1: XYLOLOOH -> 1*OH + 0.17*GLYOXAL + 0.51*CH3COCHO + 1*HO2
    force(i,26) = force(i,26) - rate_constant(i,86) * number_density(i,26)

    ! k_HO2_XYLOLO2_1: HO2 + XYLOLO2 -> 1*XYLOLOOH
    force(i,26) = force(i,26) + rate_constant(i,357) * number_density(i,192) * number_density(i,148)

    ! k_OH_XYLOLOOH_1: OH + XYLOLOOH -> 1*XYLOLO2
    force(i,26) = force(i,26) - rate_constant(i,421) * number_density(i,166) * number_density(i,26)

    ! NOA
    force(i,27) = 0

    ! k_ISOPNITB_OH_1: ISOPNITB + OH -> 0.5*HYAC + 0.5*GLYALD + 0.5*NOA + 1*HO2 + 0.5*HONITR
    force(i,27) = force(i,27) + 0.5*rate_constant(i,79) * number_density(i,73) * number_density(i,166)

    ! k_NOA_1: NOA -> 1*NO2 + 1*CH2O + 1*CH3CO3
    force(i,27) = force(i,27) - rate_constant(i,119) * number_density(i,27)

    ! k_NC4CHO_OH_1: NC4CHO + OH -> 1*GLYOXAL + 1*NOA + 1*HO2
    force(i,27) = force(i,27) + rate_constant(i,182) * number_density(i,23) * number_density(i,166)

    ! k_C3H6_NO3_1: C3H6 + NO3 -> 1*NOA
    force(i,27) = force(i,27) + rate_constant(i,221) * number_density(i,120) * number_density(i,165)

    ! k_ISOPNOOH_OH_1: ISOPNOOH + OH -> 1*NOA + 1*HO2
    force(i,27) = force(i,27) + rate_constant(i,271) * number_density(i,160) * number_density(i,166)

    ! k_NC4CH2OH_OH_1: NC4CH2OH + OH -> 1*GLYALD + 1*NOA + 1*HO2
    force(i,27) = force(i,27) + rate_constant(i,295) * number_density(i,158) * number_density(i,166)
  end do
  !$acc end parallel

end subroutine p_force5

subroutine p_force6(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_NOA_OH_1: NOA + OH -> 1*NO2 + 1*CH3COCHO
    force(i,27) = force(i,27) - rate_constant(i,311) * number_density(i,27) * number_density(i,166)

    ! SO3
    force(i,28) = 0

    ! k_OH_SO2_1: OH + SO2 -> 1*SO3 + 1*HO2
    force(i,28) = force(i,28) + rate_constant(i,22) * number_density(i,166) * number_density(i,55)

    ! k_SO3_1: SO3 -> 1*SO2 + 1*O
    force(i,28) = force(i,28) - rate_constant(i,24) * number_density(i,28)

    ! k_H2O_SO3_1: H2O + SO3 -> 1*H2SO4 + 1*H2O
    force(i,28) = force(i,28) - rate_constant(i,325) * number_density(i,68) * number_density(i,28)

    ! OCS
    force(i,29) = 0

    ! k_OCS_OH_1: OCS + OH -> 1*SO2 + 1*CO + 1*H
    force(i,29) = force(i,29) - rate_constant(i,312) * number_density(i,29) * number_density(i,166)

    ! k_OCS_1: OCS -> 1*S + 1*CO
    force(i,29) = force(i,29) - rate_constant(i,345) * number_density(i,29)

    ! SVOC
    force(i,30) = 0

    ! k_OH_SVOC_1: OH + SVOC -> 1*OH + 0.5931*SOAG0 + 0.1534*SOAG1 + 0.0459*SOAG2 + 0.0085*SOAG3 + 0.0128*SOAG4
    force(i,30) = force(i,30) - rate_constant(i,51) * number_density(i,166) * number_density(i,30)

    ! MTERP
    force(i,31) = 0

    ! k_MTERP_NO3_1: MTERP + NO3 -> 1*NTERPO2
    force(i,31) = force(i,31) - rate_constant(i,111) * number_density(i,31) * number_density(i,165)

    ! k_MTERP_OH_1: MTERP + OH -> 1*TERPO2
    force(i,31) = force(i,31) - rate_constant(i,181) * number_density(i,31) * number_density(i,166)

    ! k_MTERP_O3_2: MTERP + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    force(i,31) = force(i,31) - rate_constant(i,307) * number_density(i,31) * number_density(i,171)

    ! SO
    force(i,32) = 0

    ! k_OCLO_SO_1: OCLO + SO -> 1*SO2 + 1*CLO
    force(i,32) = force(i,32) - rate_constant(i,47) * number_density(i,183) * number_density(i,32)

    ! k_BRO_SO_1: BRO + SO -> 1*SO2 + 1*BR
    force(i,32) = force(i,32) - rate_constant(i,58) * number_density(i,71) * number_density(i,32)

    ! k_SO2_1: SO2 -> 1*SO + 1*O
    force(i,32) = force(i,32) + rate_constant(i,87) * number_density(i,55)

    ! k_CLO_SO_1: CLO + SO -> 1*SO2 + 1*CL
    force(i,32) = force(i,32) - rate_constant(i,118) * number_density(i,86) * number_density(i,32)

    ! k_O3_SO_1: O3 + SO -> 1*SO2 + 1*O2
    force(i,32) = force(i,32) - rate_constant(i,140) * number_density(i,171) * number_density(i,32)

    ! k_O2_SO_1: O2 + SO -> 1*SO2 + 1*O
    force(i,32) = force(i,32) - rate_constant(i,241) * number_density(i,41) * number_density(i,32)

    ! k_NO2_SO_1: NO2 + SO -> 1*SO2 + 1*NO
    force(i,32) = force(i,32) - rate_constant(i,260) * number_density(i,54) * number_density(i,32)

    ! k_SO_1: SO -> 1*S + 1*O
    force(i,32) = force(i,32) - rate_constant(i,287) * number_density(i,32)

    ! k_OH_SO_1: OH + SO -> 1*SO2 + 1*H
    force(i,32) = force(i,32) - rate_constant(i,486) * number_density(i,166) * number_density(i,32)

    ! BZOO
    force(i,33) = 0

    ! k_OH_XYLENES_1: OH + XYLENES -> 0.15*XYLOL + 0.23*TEPOMUC + 0.06*BZOO + 0.56*XYLENO2 + 0.38*HO2
    force(i,33) = force(i,33) + 0.06*rate_constant(i,7) * number_density(i,166) * number_density(i,140)

    ! k_BZOO_NO_1: BZOO + NO -> 1*BZALD + 1*NO2 + 1*HO2
    force(i,33) = force(i,33) - rate_constant(i,195) * number_density(i,33) * number_density(i,137)

    ! k_BZOO_HO2_1: BZOO + HO2 -> 1*BZOOH
    force(i,33) = force(i,33) - rate_constant(i,331) * number_density(i,33) * number_density(i,192)

    ! k_OH_TOLUENE_2: OH + TOLUENE -> 0.18*CRESOL + 0.1*TEPOMUC + 0.07*BZOO + 0.65*TOLO2 + 0.28*HO2
    force(i,33) = force(i,33) + 0.07*rate_constant(i,435) * number_density(i,166) * number_density(i,117)

    ! k_BZOOH_OH_1: BZOOH + OH -> 1*BZOO
    force(i,33) = force(i,33) + rate_constant(i,485) * number_density(i,8) * number_density(i,166)

    ! IVOC
    force(i,34) = 0

    ! k_IVOC_OH_1: IVOC + OH -> 1*OH + 0.2381*SOAG0 + 0.1308*SOAG1 + 0.0348*SOAG2 + 0.0076*SOAG3 + 0.0113*SOAG4
    force(i,34) = force(i,34) - rate_constant(i,243) * number_density(i,34) * number_density(i,166)

    ! HO2NO2
    force(i,35) = 0

    ! k_HO2NO2_OH_1: HO2NO2 + OH -> 1*H2O + 1*NO2 + 1*O2
    force(i,35) = force(i,35) - rate_constant(i,54) * number_density(i,35) * number_density(i,166)
  end do
  !$acc end parallel

end subroutine p_force6

subroutine p_force7(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_HO2_NO2_1: HO2 + NO2 -> 1*HO2NO2
    force(i,35) = force(i,35) + rate_constant(i,73) * number_density(i,192) * number_density(i,54)

    ! k_HO2NO2_1: HO2NO2 -> 1*HO2 + 1*NO2
    force(i,35) = force(i,35) - rate_constant(i,159) * number_density(i,35)

    ! k_HO2NO2_2: HO2NO2 -> 1*NO2 + 1*HO2
    force(i,35) = force(i,35) - rate_constant(i,359) * number_density(i,35)

    ! k_HO2NO2_3: HO2NO2 -> 1*OH + 1*NO3
    force(i,35) = force(i,35) - rate_constant(i,400) * number_density(i,35)

    ! O3S
    force(i,36) = 0

    ! k_NO2_O3S_1: NO2 + O3S -> 1*NO2
    force(i,36) = force(i,36) - rate_constant(i,82) * number_density(i,54) * number_density(i,36)

    ! k_NO_O3S_1: NO + O3S -> 1*NO
    force(i,36) = force(i,36) - rate_constant(i,125) * number_density(i,137) * number_density(i,36)

    ! TERP2OOH
    force(i,37) = 0

    ! k_TERP2OOH_1: TERP2OOH -> 1*OH + 0.375*CH2O + 0.3*CH3COCH3 + 0.25*CO + 1*CO2 + 1*TERPROD2 + 1*HO2 + 0.25*GLYALD
    force(i,37) = force(i,37) - rate_constant(i,49) * number_density(i,37)

    ! k_HO2_TERP2O2_1: HO2 + TERP2O2 -> 1*TERP2OOH
    force(i,37) = force(i,37) + rate_constant(i,341) * number_density(i,192) * number_density(i,145)

    ! k_OH_TERP2OOH_1: OH + TERP2OOH -> 1*TERP2O2
    force(i,37) = force(i,37) - rate_constant(i,445) * number_density(i,166) * number_density(i,37)

    ! PHENO2
    force(i,38) = 0

    ! k_CRESOL_OH_1: CRESOL + OH -> 0.2*PHENO2 + 0.73*HO2 + 0.07*PHENO
    force(i,38) = force(i,38) + 0.2*rate_constant(i,95) * number_density(i,139) * number_density(i,166)

    ! k_NO_PHENO2_1: NO + PHENO2 -> 1*HO2 + 0.7*GLYOXAL + 1*NO2
    force(i,38) = force(i,38) - rate_constant(i,257) * number_density(i,137) * number_density(i,38)

    ! k_OH_PHENOL_1: OH + PHENOL -> 0.14*PHENO2 + 0.8*HO2 + 0.06*PHENO
    force(i,38) = force(i,38) + 0.14*rate_constant(i,266) * number_density(i,166) * number_density(i,21)

    ! k_HO2_PHENO2_1: HO2 + PHENO2 -> 1*PHENOOH
    force(i,38) = force(i,38) - rate_constant(i,267) * number_density(i,192) * number_density(i,38)

    ! k_OH_PHENOOH_1: OH + PHENOOH -> 1*PHENO2
    force(i,38) = force(i,38) + rate_constant(i,412) * number_density(i,166) * number_density(i,115)

    ! TERPNIT
    force(i,39) = 0

    ! k_TERPNIT_1: TERPNIT -> 1*TERPROD1 + 1*NO2 + 1*HO2
    force(i,39) = force(i,39) - rate_constant(i,5) * number_density(i,39)

    ! k_CH3O2_NTERPO2_1: CH3O2 + NTERPO2 -> 0.5*TERPNIT + 0.75*CH2O + 0.25*CH3OH + 0.5*HO2 + 0.5*TERPROD1 + 0.5*NO2
    force(i,39) = force(i,39) + 0.5*rate_constant(i,135) * number_density(i,191) * number_density(i,143)

    ! k_NO_NTERPO2_1: NO + NTERPO2 -> 0.2*TERPNIT + 1.6*NO2 + 0.8*TERPROD1
    force(i,39) = force(i,39) + 0.2*rate_constant(i,306) * number_density(i,137) * number_density(i,143)

    ! k_NO_TERPO2_1: NO + TERPO2 -> 0.2*TERPNIT + 0.8*NO2 + 0.32*CH2O + 0.04*CH3COCH3 + 0.8*TERPROD1 + 0.8*HO2
    force(i,39) = force(i,39) + 0.2*rate_constant(i,392) * number_density(i,137) * number_density(i,147)

    ! k_OH_TERPNIT_1: OH + TERPNIT -> 1*NO2 + 1*TERPROD1
    force(i,39) = force(i,39) - rate_constant(i,428) * number_density(i,166) * number_density(i,39)

    ! RO2
    force(i,40) = 0

    ! k_TERPROD2_1: TERPROD2 -> 0.15*RO2 + 0.68*CH2O + 0.8*CO2 + 0.5*CH3COCH3 + 0.65*CH3CO3 + 1.2*HO2 + 1.7*CO
    force(i,40) = force(i,40) + 0.15*rate_constant(i,35) * number_density(i,155)

    ! k_CH3COCH3_OH_1: CH3COCH3 + OH -> 1*RO2 + 1*H2O
    force(i,40) = force(i,40) + rate_constant(i,68) * number_density(i,89) * number_density(i,166)

    ! k_CH3COCH3_OH_2: CH3COCH3 + OH -> 1*RO2 + 1*H2O
    force(i,40) = force(i,40) + rate_constant(i,69) * number_density(i,89) * number_density(i,166)

    ! k_HO2_RO2_1: HO2 + RO2 -> 0.85*ROOH + 0.15*OH + 0.15*CH2O + 0.15*CH3CO3
    force(i,40) = force(i,40) - rate_constant(i,133) * number_density(i,192) * number_density(i,40)

    ! k_BCARY_O3_1: BCARY + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    force(i,40) = force(i,40) + 0.06*rate_constant(i,229) * number_density(i,102) * number_density(i,171)

    ! k_MTERP_O3_2: MTERP + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    force(i,40) = force(i,40) + 0.06*rate_constant(i,307) * number_density(i,31) * number_density(i,171)

    ! k_CH3O2_RO2_1: CH3O2 + RO2 -> 0.3*CH3CO3 + 0.8*CH2O + 0.3*HO2 + 0.2*HYAC + 0.5*CH3COCHO + 0.5*CH3OH
    force(i,40) = force(i,40) - rate_constant(i,354) * number_density(i,191) * number_density(i,40)

    ! k_OH_ROOH_1: OH + ROOH -> 1*RO2 + 1*H2O
    force(i,40) = force(i,40) + rate_constant(i,371) * number_density(i,166) * number_density(i,121)

    ! k_OH_TERPROD2_1: OH + TERPROD2 -> 0.15*RO2 + 0.68*CH2O + 1.8*CO2 + 0.5*CH3COCH3 + 0.65*CH3CO3 + 0.2*HO2 + 0.7*CO
    force(i,40) = force(i,40) + 0.15*rate_constant(i,397) * number_density(i,166) * number_density(i,155)

    ! k_NO_RO2_1: NO + RO2 -> 1*CH3CO3 + 1*CH2O + 1*NO2
    force(i,40) = force(i,40) - rate_constant(i,484) * number_density(i,137) * number_density(i,40)
  end do
  !$acc end parallel

end subroutine p_force7

subroutine p_force8(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! O2
    force(i,41) = 0

    ! k_N_NO2_1: N + NO2 -> 1*N2 + 1*O2
    force(i,41) = force(i,41) + rate_constant(i,8) * number_density(i,185) * number_density(i,54)

    ! k_O2_1: O2 -> 2*O
    force(i,41) = force(i,41) - rate_constant(i,12) * number_density(i,41)

    ! k_CLO_O_1: CLO + O -> 1*CL + 1*O2
    force(i,41) = force(i,41) + rate_constant(i,21) * number_density(i,86) * number_density(i,187)

    ! k_BR_HO2_1: BR + HO2 -> 1*HBR + 1*O2
    force(i,41) = force(i,41) + rate_constant(i,38) * number_density(i,90) * number_density(i,192)

    ! k_CLO_OH_1: CLO + OH -> 1*HCL + 1*O2
    force(i,41) = force(i,41) + rate_constant(i,43) * number_density(i,86) * number_density(i,166)

    ! k_HO2NO2_OH_1: HO2NO2 + OH -> 1*H2O + 1*NO2 + 1*O2
    force(i,41) = force(i,41) + rate_constant(i,54) * number_density(i,35) * number_density(i,166)

    ! k_CLO_CLO_1: CLO + CLO -> 2*CL + 1*O2
    force(i,41) = force(i,41) + rate_constant(i,103) * number_density(i,86) * number_density(i,86)

    ! k_N_O2_1: N + O2 -> 1*NO + 1*O
    force(i,41) = force(i,41) - rate_constant(i,117) * number_density(i,185) * number_density(i,41)

    ! k_NO3_O_1: NO3 + O -> 1*NO2 + 1*O2
    force(i,41) = force(i,41) + rate_constant(i,129) * number_density(i,165) * number_density(i,187)

    ! k_O3_SO_1: O3 + SO -> 1*SO2 + 1*O2
    force(i,41) = force(i,41) + rate_constant(i,140) * number_density(i,171) * number_density(i,32)

    ! k_C3H7O2_HO2_1: C3H7O2 + HO2 -> 1*C3H7OOH + 1*O2
    force(i,41) = force(i,41) + rate_constant(i,142) * number_density(i,109) * number_density(i,192)

    ! k_CL_O3_1: CL + O3 -> 1*CLO + 1*O2
    force(i,41) = force(i,41) + rate_constant(i,150) * number_density(i,100) * number_density(i,171)

    ! k_H_O3_1: H + O3 -> 1*OH + 1*O2
    force(i,41) = force(i,41) + rate_constant(i,158) * number_density(i,48) * number_density(i,171)

    ! k_O3_OH_1: O3 + OH -> 1*HO2 + 1*O2
    force(i,41) = force(i,41) + rate_constant(i,164) * number_density(i,171) * number_density(i,166)

    ! k_NO2_O3_1: NO2 + O3 -> 1*NO3 + 1*O2
    force(i,41) = force(i,41) + rate_constant(i,165) * number_density(i,54) * number_density(i,171)

    ! k_O_O3_1: O + O3 -> 2*O2
    force(i,41) = force(i,41) + 2*rate_constant(i,187) * number_density(i,187) * number_density(i,171)

    ! k_O_OH_1: O + OH -> 1*H + 1*O2
    force(i,41) = force(i,41) + rate_constant(i,196) * number_density(i,187) * number_density(i,166)

    ! k_M_O_O2_1: M + O + O2 -> 1*O3 + 1*M
    force(i,41) = force(i,41) - rate_constant(i,202) * number_density(i,1) * number_density(i,187) * number_density(i,41)

    ! k_HO2_HO2_1: HO2 + HO2 -> 1*H2O2 + 1*O2
    force(i,41) = force(i,41) + rate_constant(i,209) * number_density(i,192) * number_density(i,192)

    ! k_HO2_HO2_M_1: HO2 + HO2 + M -> 1*H2O2 + 1*O2 + 1*M
    force(i,41) = force(i,41) + rate_constant(i,210) * number_density(i,192) * number_density(i,192) * number_density(i,1)

    ! k_H2O_HO2_HO2_1: H2O + HO2 + HO2 -> 1*H2O2 + 1*O2 + 1*H2O
    force(i,41) = force(i,41) + rate_constant(i,211) * number_density(i,68) * number_density(i,192) * number_density(i,192)

    ! k_H2O_HO2_HO2_M_1: H2O + HO2 + HO2 + M -> 1*H2O2 + 1*O2 + 1*M + 1*H2O
    force(i,41) = force(i,41) + rate_constant(i,212) * number_density(i,68) * number_density(i,192) * number_density(i,192) * number_density(i,1)

    ! k_HO2_O_1: HO2 + O -> 1*OH + 1*O2
    force(i,41) = force(i,41) + rate_constant(i,217) * number_density(i,192) * number_density(i,187)

    ! k_BRO_O_1: BRO + O -> 1*BR + 1*O2
    force(i,41) = force(i,41) + rate_constant(i,223) * number_density(i,71) * number_density(i,187)

    ! k_H_HO2_1: H + HO2 -> 1*H2 + 1*O2
    force(i,41) = force(i,41) + rate_constant(i,224) * number_density(i,48) * number_density(i,192)

    ! k_H_O2_1: H + O2 -> 1*HO2
    force(i,41) = force(i,41) - rate_constant(i,240) * number_density(i,48) * number_density(i,41)

    ! k_O2_SO_1: O2 + SO -> 1*SO2 + 1*O
    force(i,41) = force(i,41) - rate_constant(i,241) * number_density(i,41) * number_density(i,32)

    ! k_CL_HO2_1: CL + HO2 -> 1*HCL + 1*O2
    force(i,41) = force(i,41) + rate_constant(i,264) * number_density(i,100) * number_density(i,192)

    ! k_HO2_PO2_1: HO2 + PO2 -> 1*POOH + 1*O2
    force(i,41) = force(i,41) + rate_constant(i,265) * number_density(i,192) * number_density(i,151)

    ! k_HO2_OH_1: HO2 + OH -> 1*H2O + 1*O2
    force(i,41) = force(i,41) + rate_constant(i,291) * number_density(i,192) * number_density(i,166)

    ! k_BRO_BRO_1: BRO + BRO -> 2*BR + 1*O2
    force(i,41) = force(i,41) + rate_constant(i,294) * number_density(i,71) * number_density(i,71)

    ! k_BRO_HO2_1: BRO + HO2 -> 1*HOBR + 1*O2
    force(i,41) = force(i,41) + rate_constant(i,299) * number_density(i,71) * number_density(i,192)

    ! k_CH3O2_HO2_1: CH3O2 + HO2 -> 1*CH3OOH + 1*O2
    force(i,41) = force(i,41) + rate_constant(i,301) * number_density(i,191) * number_density(i,192)
  end do
  !$acc end parallel

end subroutine p_force8

subroutine p_force9(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_M_O_O_1: M + O + O -> 1*O2 + 1*M
    force(i,41) = force(i,41) + rate_constant(i,304) * number_density(i,1) * number_density(i,187) * number_density(i,187)

    ! k_BR_O3_1: BR + O3 -> 1*BRO + 1*O2
    force(i,41) = force(i,41) + rate_constant(i,317) * number_density(i,90) * number_density(i,171)

    ! k_C2H5O2_HO2_1: C2H5O2 + HO2 -> 1*C2H5OOH + 1*O2
    force(i,41) = force(i,41) + rate_constant(i,343) * number_density(i,87) * number_density(i,192)

    ! k_NO2_O_1: NO2 + O -> 1*NO + 1*O2
    force(i,41) = force(i,41) + rate_constant(i,351) * number_density(i,54) * number_density(i,187)

    ! k_BRO_CLO_1: BRO + CLO -> 1*BR + 1*CL + 1*O2
    force(i,41) = force(i,41) + rate_constant(i,361) * number_density(i,71) * number_density(i,86)

    ! k_O3_1: O3 -> 1*O + 1*O2
    force(i,41) = force(i,41) + rate_constant(i,367) * number_density(i,171)

    ! k_HO2_O3_1: HO2 + O3 -> 1*OH + 2*O2
    force(i,41) = force(i,41) + 2*rate_constant(i,368) * number_density(i,192) * number_density(i,171)

    ! k_NO3_2: NO3 -> 1*NO + 1*O2
    force(i,41) = force(i,41) + rate_constant(i,374) * number_density(i,165)

    ! k_CLO_HO2_1: CLO + HO2 -> 1*O2 + 1*HOCL
    force(i,41) = force(i,41) + rate_constant(i,402) * number_density(i,86) * number_density(i,192)

    ! k_O3_2: O3 -> 1*O1D + 1*O2
    force(i,41) = force(i,41) + rate_constant(i,417) * number_density(i,171)

    ! k_BRO_CLO_2: BRO + CLO -> 1*BRCL + 1*O2
    force(i,41) = force(i,41) + rate_constant(i,432) * number_density(i,71) * number_density(i,86)

    ! k_CLO_CLO_3: CLO + CLO -> 1*CL2 + 1*O2
    force(i,41) = force(i,41) + rate_constant(i,436) * number_density(i,86) * number_density(i,86)

    ! k_NO_O3_1: NO + O3 -> 1*NO2 + 1*O2
    force(i,41) = force(i,41) + rate_constant(i,439) * number_density(i,137) * number_density(i,171)

    ! k_EO_O2_1: EO + O2 -> 1*GLYALD + 1*HO2
    force(i,41) = force(i,41) - rate_constant(i,442) * number_density(i,162) * number_density(i,41)

    ! k_N2O_O1D_2: N2O + O1D -> 1*N2 + 1*O2
    force(i,41) = force(i,41) + rate_constant(i,443) * number_density(i,161) * number_density(i,112)

    ! k_HO2_NO3_1: HO2 + NO3 -> 1*OH + 1*NO2 + 1*O2
    force(i,41) = force(i,41) + rate_constant(i,454) * number_density(i,192) * number_density(i,165)

    ! k_O1D_O3_1: O1D + O3 -> 1*O2
    force(i,41) = force(i,41) + rate_constant(i,487) * number_density(i,112) * number_density(i,171)

    ! HNO3
    force(i,42) = 0

    ! k_CH3CHO_NO3_1: CH3CHO + NO3 -> 1*CH3CO3 + 1*HNO3
    force(i,42) = force(i,42) + rate_constant(i,34) * number_density(i,178) * number_density(i,165)

    ! k_DMS_NO3_1: DMS + NO3 -> 1*SO2 + 1*HNO3
    force(i,42) = force(i,42) + rate_constant(i,197) * number_density(i,99) * number_density(i,165)

    ! k_NO2_OH_1: NO2 + OH -> 1*HNO3
    force(i,42) = force(i,42) + rate_constant(i,207) * number_density(i,54) * number_density(i,166)

    ! k_HNO3_1: HNO3 -> 1*NO2 + 1*OH
    force(i,42) = force(i,42) - rate_constant(i,258) * number_density(i,42)

    ! k_HNO3_OH_1: HNO3 + OH -> 1*NO3 + 1*H2O
    force(i,42) = force(i,42) - rate_constant(i,398) * number_density(i,42) * number_density(i,166)

    ! k_HNO3_OH_2: HNO3 + OH -> 1*NO3 + 1*H2O
    force(i,42) = force(i,42) - rate_constant(i,399) * number_density(i,42) * number_density(i,166)

    ! k_CH3COCHO_NO3_1: CH3COCHO + NO3 -> 1*HNO3 + 1*CO + 1*CH3CO3
    force(i,42) = force(i,42) + rate_constant(i,405) * number_density(i,111) * number_density(i,165)

    ! k_CH2O_NO3_1: CH2O + NO3 -> 1*CO + 1*HO2 + 1*HNO3
    force(i,42) = force(i,42) + rate_constant(i,423) * number_density(i,124) * number_density(i,165)

    ! ACBZO2
    force(i,43) = 0

    ! k_PBZNIT_1: PBZNIT -> 1*ACBZO2 + 1*NO2
    force(i,43) = force(i,43) + rate_constant(i,29) * number_density(i,149)

    ! k_ACBZO2_HO2_1: ACBZO2 + HO2 -> 0.4*C6H5O2 + 0.4*OH
    force(i,43) = force(i,43) - rate_constant(i,52) * number_density(i,43) * number_density(i,192)

    ! k_BZALD_OH_1: BZALD + OH -> 1*ACBZO2
    force(i,43) = force(i,43) + rate_constant(i,57) * number_density(i,107) * number_density(i,166)

    ! k_ACBZO2_NO_1: ACBZO2 + NO -> 1*C6H5O2 + 1*NO2
    force(i,43) = force(i,43) - rate_constant(i,263) * number_density(i,43) * number_density(i,137)

    ! k_ACBZO2_NO2_1: ACBZO2 + NO2 -> 1*PBZNIT
    force(i,43) = force(i,43) - rate_constant(i,388) * number_density(i,43) * number_density(i,54)

    ! MACROOH
    force(i,44) = 0

    ! k_HO2_MACRO2_1: HO2 + MACRO2 -> 1*MACROOH
    force(i,44) = force(i,44) + rate_constant(i,36) * number_density(i,192) * number_density(i,188)
  end do
  !$acc end parallel

end subroutine p_force9

subroutine p_force10(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_MACROOH_OH_1: MACROOH + OH -> 0.5*MCO3 + 0.2*MACRO2 + 0.1*OH + 0.2*HO2
    force(i,44) = force(i,44) - rate_constant(i,136) * number_density(i,44) * number_density(i,166)

    ! CH4
    force(i,45) = 0

    ! k_CH4_CL_1: CH4 + CL -> 1*CH3O2 + 1*HCL
    force(i,45) = force(i,45) - rate_constant(i,23) * number_density(i,45) * number_density(i,100)

    ! k_CH4_1: CH4 -> 1.44*H2 + 0.18*CH2O + 0.18*O + 0.33*OH + 0.33*H + 0.44*CO2 + 0.38*CO + 0.05*H2O
    force(i,45) = force(i,45) - rate_constant(i,37) * number_density(i,45)

    ! k_CH4_O1D_1: CH4 + O1D -> 1*CH2O + 1*H2
    force(i,45) = force(i,45) - rate_constant(i,141) * number_density(i,45) * number_density(i,112)

    ! k_C3H6_O3_1: C3H6 + O3 -> 0.5*CH2O + 0.12*HCOOH + 0.12*CH3COOH + 0.5*CH3CHO + 0.56*CO + 0.28*CH3O2 + 0.1*CH4 + 0.2*CO2 + 0.28*HO2 + 0.36*OH
    force(i,45) = force(i,45) + 0.1*rate_constant(i,170) * number_density(i,120) * number_density(i,171)

    ! k_CH4_2: CH4 -> 1*H + 1*CH3O2
    force(i,45) = force(i,45) - rate_constant(i,183) * number_density(i,45)

    ! k_CH4_O1D_2: CH4 + O1D -> 1*CH2O + 1*H + 1*HO2
    force(i,45) = force(i,45) - rate_constant(i,283) * number_density(i,45) * number_density(i,112)

    ! k_CH4_OH_1: CH4 + OH -> 1*CH3O2 + 1*H2O
    force(i,45) = force(i,45) - rate_constant(i,284) * number_density(i,45) * number_density(i,166)

    ! k_CH4_O1D_3: CH4 + O1D -> 1*CH3O2 + 1*OH
    force(i,45) = force(i,45) - rate_constant(i,386) * number_density(i,45) * number_density(i,112)

    ! ISOPNO3
    force(i,46) = 0

    ! k_CH3O2_ISOPNO3_1: CH3O2 + ISOPNO3 -> 0.8*NC4CHO + 1.2*HO2 + 0.8*CH2O + 0.2*CH3OH + 0.2*NC4CH2OH
    force(i,46) = force(i,46) - rate_constant(i,160) * number_density(i,191) * number_density(i,46)

    ! k_ISOPNO3_NO_1: ISOPNO3 + NO -> 1*NC4CHO + 1*NO2 + 1*HO2
    force(i,46) = force(i,46) - rate_constant(i,302) * number_density(i,46) * number_density(i,137)

    ! k_HO2_ISOPNO3_1: HO2 + ISOPNO3 -> 1*ISOPNOOH
    force(i,46) = force(i,46) - rate_constant(i,335) * number_density(i,192) * number_density(i,46)

    ! k_ISOP_NO3_2: ISOP + NO3 -> 1*ISOPNO3
    force(i,46) = force(i,46) + rate_constant(i,385) * number_density(i,142) * number_density(i,165)

    ! k_CH3CO3_ISOPNO3_1: CH3CO3 + ISOPNO3 -> 1*NC4CHO + 1*CH3O2 + 1*HO2
    force(i,46) = force(i,46) - rate_constant(i,413) * number_density(i,49) * number_density(i,46)

    ! k_ISOPNO3_NO3_1: ISOPNO3 + NO3 -> 1*NC4CHO + 1*NO2 + 1*HO2
    force(i,46) = force(i,46) - rate_constant(i,451) * number_density(i,46) * number_density(i,165)

    ! HCN
    force(i,47) = 0

    ! k_HCN_OH_1: HCN + OH -> 1*HO2
    force(i,47) = force(i,47) - rate_constant(i,234) * number_density(i,47) * number_density(i,166)

    ! k_HCN_O1D_1: HCN + O1D -> 1*OH
    force(i,47) = force(i,47) - rate_constant(i,268) * number_density(i,47) * number_density(i,112)

    ! H
    force(i,48) = 0

    ! k_HBR_O1D_1: HBR + O1D -> 1*BRO + 1*H
    force(i,48) = force(i,48) + rate_constant(i,19) * number_density(i,80) * number_density(i,112)

    ! k_CH4_1: CH4 -> 1.44*H2 + 0.18*CH2O + 0.18*O + 0.33*OH + 0.33*H + 0.44*CO2 + 0.38*CO + 0.05*H2O
    force(i,48) = force(i,48) + 0.33*rate_constant(i,37) * number_density(i,45)

    ! k_H2O_1: H2O -> 2*H + 1*O
    force(i,48) = force(i,48) + 2*rate_constant(i,77) * number_density(i,68)

    ! k_CH2O_2: CH2O -> 1*CO + 2*H
    force(i,48) = force(i,48) + 2*rate_constant(i,149) * number_density(i,124)

    ! k_HBR_1: HBR -> 1*BR + 1*H
    force(i,48) = force(i,48) + rate_constant(i,157) * number_density(i,80)

    ! k_H_O3_1: H + O3 -> 1*OH + 1*O2
    force(i,48) = force(i,48) - rate_constant(i,158) * number_density(i,48) * number_density(i,171)

    ! k_CL_H2_1: CL + H2 -> 1*HCL + 1*H
    force(i,48) = force(i,48) + rate_constant(i,166) * number_density(i,100) * number_density(i,152)

    ! k_CH4_2: CH4 -> 1*H + 1*CH3O2
    force(i,48) = force(i,48) + rate_constant(i,183) * number_density(i,45)

    ! k_H2O_3: H2O -> 1*OH + 1*H
    force(i,48) = force(i,48) + rate_constant(i,192) * number_density(i,68)

    ! k_O_OH_1: O + OH -> 1*H + 1*O2
    force(i,48) = force(i,48) + rate_constant(i,196) * number_density(i,187) * number_density(i,166)

    ! k_H_HO2_1: H + HO2 -> 1*H2 + 1*O2
    force(i,48) = force(i,48) - rate_constant(i,224) * number_density(i,48) * number_density(i,192)

    ! k_H2_O1D_1: H2 + O1D -> 1*H + 1*OH
    force(i,48) = force(i,48) + rate_constant(i,237) * number_density(i,152) * number_density(i,112)

    ! k_H_O2_1: H + O2 -> 1*HO2
    force(i,48) = force(i,48) - rate_constant(i,240) * number_density(i,48) * number_density(i,41)
  end do
  !$acc end parallel

end subroutine p_force10

subroutine p_force11(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_N_OH_1: N + OH -> 1*NO + 1*H
    force(i,48) = force(i,48) + rate_constant(i,250) * number_density(i,185) * number_density(i,166)

    ! k_H2_OH_1: H2 + OH -> 1*H2O + 1*H
    force(i,48) = force(i,48) + rate_constant(i,281) * number_density(i,152) * number_density(i,166)

    ! k_H_HO2_2: H + HO2 -> 1*H2O + 1*O
    force(i,48) = force(i,48) - rate_constant(i,282) * number_density(i,48) * number_density(i,192)

    ! k_CH4_O1D_2: CH4 + O1D -> 1*CH2O + 1*H + 1*HO2
    force(i,48) = force(i,48) + rate_constant(i,283) * number_density(i,45) * number_density(i,112)

    ! k_OCS_OH_1: OCS + OH -> 1*SO2 + 1*CO + 1*H
    force(i,48) = force(i,48) + rate_constant(i,312) * number_density(i,29) * number_density(i,166)

    ! k_HCL_1: HCL -> 1*H + 1*CL
    force(i,48) = force(i,48) + rate_constant(i,321) * number_density(i,180)

    ! k_HCL_O1D_2: HCL + O1D -> 1*CLO + 1*H
    force(i,48) = force(i,48) + rate_constant(i,344) * number_density(i,180) * number_density(i,112)

    ! k_CH3OOH_1: CH3OOH -> 1*CH2O + 1*H + 1*OH
    force(i,48) = force(i,48) + rate_constant(i,379) * number_density(i,135)

    ! k_CH2O_OH_1: CH2O + OH -> 1*CO + 1*H2O + 1*H
    force(i,48) = force(i,48) + rate_constant(i,415) * number_density(i,124) * number_density(i,166)

    ! k_CO_OH_2: CO + OH -> 1*CO2 + 1*H
    force(i,48) = force(i,48) + rate_constant(i,429) * number_density(i,176) * number_density(i,166)

    ! k_H_HO2_3: H + HO2 -> 2*OH
    force(i,48) = force(i,48) - rate_constant(i,457) * number_density(i,48) * number_density(i,192)

    ! k_H2_O_1: H2 + O -> 1*OH + 1*H
    force(i,48) = force(i,48) + rate_constant(i,465) * number_density(i,152) * number_density(i,187)

    ! k_OH_SO_1: OH + SO -> 1*SO2 + 1*H
    force(i,48) = force(i,48) + rate_constant(i,486) * number_density(i,166) * number_density(i,32)

    ! CH3CO3
    force(i,49) = 0

    ! k_MVK_1: MVK -> 0.7*C3H6 + 0.7*CO + 0.3*CH3O2 + 0.3*CH3CO3
    force(i,49) = force(i,49) + 0.3*rate_constant(i,15) * number_density(i,25)

    ! k_CH3COCHO_1: CH3COCHO -> 1*CH3CO3 + 1*CO + 1*HO2
    force(i,49) = force(i,49) + rate_constant(i,17) * number_density(i,111)

    ! k_CH3CO3_NO_1: CH3CO3 + NO -> 1*CH3O2 + 1*CO2 + 1*NO2
    force(i,49) = force(i,49) - rate_constant(i,25) * number_density(i,49) * number_density(i,137)

    ! k_PAN_1: PAN -> 1*CH3CO3 + 1*NO2
    force(i,49) = force(i,49) + rate_constant(i,31) * number_density(i,12)

    ! k_CH3CO3_CH3CO3_1: CH3CO3 + CH3CO3 -> 2*CH3O2 + 2*CO2
    force(i,49) = force(i,49) - rate_constant(i,32) * number_density(i,49) * number_density(i,49)

    ! k_CH3CO3_CH3CO3_1: CH3CO3 + CH3CO3 -> 2*CH3O2 + 2*CO2
    force(i,49) = force(i,49) - rate_constant(i,32) * number_density(i,49) * number_density(i,49)

    ! k_CH3CHO_NO3_1: CH3CHO + NO3 -> 1*CH3CO3 + 1*HNO3
    force(i,49) = force(i,49) + rate_constant(i,34) * number_density(i,178) * number_density(i,165)

    ! k_TERPROD2_1: TERPROD2 -> 0.15*RO2 + 0.68*CH2O + 0.8*CO2 + 0.5*CH3COCH3 + 0.65*CH3CO3 + 1.2*HO2 + 1.7*CO
    force(i,49) = force(i,49) + 0.65*rate_constant(i,35) * number_density(i,155)

    ! k_MACRO2_NO_1: MACRO2 + NO -> 1*NO2 + 0.47*HO2 + 0.25*CH2O + 0.53*GLYALD + 0.25*CH3COCHO + 0.53*CH3CO3 + 0.22*HYAC + 0.22*CO
    force(i,49) = force(i,49) + 0.53*rate_constant(i,40) * number_density(i,188) * number_density(i,137)

    ! k_MEK_1: MEK -> 1*CH3CO3 + 1*C2H5O2
    force(i,49) = force(i,49) + rate_constant(i,45) * number_density(i,104)

    ! k_CH3COCH3_1: CH3COCH3 -> 1*CH3CO3 + 1*CH3O2
    force(i,49) = force(i,49) + rate_constant(i,46) * number_density(i,89)

    ! k_BIGALD4_1: BIGALD4 -> 1*HO2 + 1*CO + 1*CH3COCHO + 1*CH3CO3
    force(i,49) = force(i,49) + rate_constant(i,61) * number_density(i,110)

    ! k_CH3CO3_ISOPAO2_1: CH3CO3 + ISOPAO2 -> 1*CH3O2 + 1*HO2 + 1*CH2O + 0.39*MACR + 0.61*MVK + 1*CO2
    force(i,49) = force(i,49) - rate_constant(i,65) * number_density(i,49) * number_density(i,189)

    ! k_CH3O2_MCO3_1: CH3O2 + MCO3 -> 2*CH2O + 1*HO2 + 1*CO2 + 1*CH3CO3
    force(i,49) = force(i,49) + rate_constant(i,84) * number_density(i,191) * number_density(i,167)

    ! k_TEPOMUC_1: TEPOMUC -> 0.5*CH3CO3 + 1*HO2 + 1.5*CO
    force(i,49) = force(i,49) + 0.5*rate_constant(i,85) * number_density(i,2)

    ! k_MEKOOH_1: MEKOOH -> 1*OH + 1*CH3CO3 + 1*CH3CHO
    force(i,49) = force(i,49) + rate_constant(i,89) * number_density(i,136)

    ! k_CH3CO3_CH3O2_1: CH3CO3 + CH3O2 -> 0.9*CH3O2 + 1*CH2O + 0.9*HO2 + 0.9*CO2 + 0.1*CH3COOH
    force(i,49) = force(i,49) - rate_constant(i,99) * number_density(i,49) * number_density(i,191)

    ! k_MACR_O3_1: MACR + O3 -> 0.12*CH2O + 0.24*OH + 0.65*CO + 0.1*CH3CO3 + 0.88*CH3COCHO + 0.33*HCOOH + 0.14*HO2
    force(i,49) = force(i,49) + 0.1*rate_constant(i,101) * number_density(i,157) * number_density(i,171)

    ! k_CH3CO3_XO2_1: CH3CO3 + XO2 -> 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 1*CH3O2 + 1*HO2 + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD + 1*CO2
    force(i,49) = force(i,49) - rate_constant(i,106) * number_density(i,49) * number_density(i,153)

    ! k_CH3CHO_OH_1: CH3CHO + OH -> 1*CH3CO3 + 1*H2O
    force(i,49) = force(i,49) + rate_constant(i,108) * number_density(i,178) * number_density(i,166)
  end do
  !$acc end parallel

end subroutine p_force11

subroutine p_force12(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_NOA_1: NOA -> 1*NO2 + 1*CH2O + 1*CH3CO3
    force(i,49) = force(i,49) + rate_constant(i,119) * number_density(i,27)

    ! k_CH3COCHO_OH_1: CH3COCHO + OH -> 1*CH3CO3 + 1*CO + 1*H2O
    force(i,49) = force(i,49) + rate_constant(i,122) * number_density(i,111) * number_density(i,166)

    ! k_HO2_RO2_1: HO2 + RO2 -> 0.85*ROOH + 0.15*OH + 0.15*CH2O + 0.15*CH3CO3
    force(i,49) = force(i,49) + 0.15*rate_constant(i,133) * number_density(i,192) * number_density(i,40)

    ! k_MACRO2_NO3_1: MACRO2 + NO3 -> 1*NO2 + 0.47*HO2 + 0.25*CH2O + 0.25*CH3COCHO + 0.22*CO + 0.53*GLYALD + 0.22*HYAC + 0.53*CH3CO3
    force(i,49) = force(i,49) + 0.53*rate_constant(i,134) * number_density(i,188) * number_density(i,165)

    ! k_HO2_MEKO2_1: HO2 + MEKO2 -> 0.8*MEKOOH + 0.2*OH + 0.2*CH3CHO + 0.2*CH3CO3
    force(i,49) = force(i,49) + 0.2*rate_constant(i,139) * number_density(i,192) * number_density(i,128)

    ! k_MCO3_NO3_1: MCO3 + NO3 -> 1*NO2 + 1*CH2O + 1*CH3CO3
    force(i,49) = force(i,49) + rate_constant(i,146) * number_density(i,167) * number_density(i,165)

    ! k_ROOH_1: ROOH -> 1*CH3CO3 + 1*CH2O + 1*OH
    force(i,49) = force(i,49) + rate_constant(i,148) * number_density(i,121)

    ! k_HONITR_1: HONITR -> 1*NO2 + 0.67*HO2 + 0.33*CH3CHO + 0.33*CH2O + 0.33*CO + 0.33*GLYALD + 0.33*CH3CO3 + 0.17*HYAC + 0.17*CH3COCH3
    force(i,49) = force(i,49) + 0.33*rate_constant(i,171) * number_density(i,134)

    ! k_MCO3_MCO3_1: MCO3 + MCO3 -> 2*CO2 + 2*CH2O + 2*CH3CO3
    force(i,49) = force(i,49) + 2*rate_constant(i,198) * number_density(i,167) * number_density(i,167)

    ! k_HYAC_1: HYAC -> 1*CH3CO3 + 1*HO2 + 1*CH2O
    force(i,49) = force(i,49) + rate_constant(i,215) * number_density(i,57)

    ! k_BCARY_O3_1: BCARY + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    force(i,49) = force(i,49) + 0.06*rate_constant(i,229) * number_density(i,102) * number_density(i,171)

    ! k_CH3CO3_MACRO2_1: CH3CO3 + MACRO2 -> 0.25*CH3COCHO + 1*CH3O2 + 0.22*CO + 0.47*HO2 + 0.53*GLYALD + 0.22*HYAC + 0.25*CH2O + 0.53*CH3CO3
    force(i,49) = force(i,49) - 0.47*rate_constant(i,235) * number_density(i,49) * number_density(i,188)

    ! k_CH3CO3_HO2_1: CH3CO3 + HO2 -> 0.4*CH3COOOH + 0.15*CH3COOH + 0.15*O3 + 0.45*OH + 0.45*CH3O2
    force(i,49) = force(i,49) - rate_constant(i,259) * number_density(i,49) * number_density(i,192)

    ! k_HO2_MCO3_1: HO2 + MCO3 -> 0.15*O3 + 0.15*CH3COOH + 0.4*CH3COOOH + 0.45*OH + 0.45*CO2 + 0.45*CH2O + 0.45*CH3CO3
    force(i,49) = force(i,49) + 0.45*rate_constant(i,269) * number_density(i,192) * number_density(i,167)

    ! k_MACR_2: MACR -> 1.34*HO2 + 0.66*MCO3 + 1.34*CH2O + 1.34*CH3CO3
    force(i,49) = force(i,49) + 1.34*rate_constant(i,272) * number_density(i,157)

    ! k_MTERP_O3_2: MTERP + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    force(i,49) = force(i,49) + 0.06*rate_constant(i,307) * number_density(i,31) * number_density(i,171)

    ! k_CH3O2_MACRO2_1: CH3O2 + MACRO2 -> 0.73*HO2 + 0.88*CH2O + 0.11*CO + 0.24*CH3COCHO + 0.26*GLYALD + 0.26*CH3CO3 + 0.25*CH3OH + 0.23*HYAC
    force(i,49) = force(i,49) + 0.26*rate_constant(i,322) * number_density(i,191) * number_density(i,188)

    ! k_MEKO2_NO_1: MEKO2 + NO -> 1*CH3CO3 + 1*CH3CHO + 1*NO2
    force(i,49) = force(i,49) + rate_constant(i,332) * number_density(i,128) * number_density(i,137)

    ! k_CH3CO3_ISOPBO2_1: CH3CO3 + ISOPBO2 -> 1*HYDRALD + 1*CH3O2 + 1*HO2
    force(i,49) = force(i,49) - rate_constant(i,340) * number_density(i,49) * number_density(i,190)

    ! k_MCO3_NO_1: MCO3 + NO -> 1*NO2 + 1*CH2O + 1*CH3CO3
    force(i,49) = force(i,49) + rate_constant(i,353) * number_density(i,167) * number_density(i,137)

    ! k_CH3O2_RO2_1: CH3O2 + RO2 -> 0.3*CH3CO3 + 0.8*CH2O + 0.3*HO2 + 0.2*HYAC + 0.5*CH3COCHO + 0.5*CH3OH
    force(i,49) = force(i,49) + 0.3*rate_constant(i,354) * number_density(i,191) * number_density(i,40)

    ! k_PAN_2: PAN -> 0.6*CH3CO3 + 0.6*NO2 + 0.4*CH3O2 + 0.4*NO3 + 0.4*CO2
    force(i,49) = force(i,49) + 0.6*rate_constant(i,362) * number_density(i,12)

    ! k_ISOP_O3_2: ISOP + O3 -> 0.3*MACR + 0.2*MVK + 0.11*HCOOH + 0.62*CO + 0.32*OH + 0.37*HO2 + 0.91*CH2O + 0.08*CH3CO3 + 0.13*C3H6 + 0.05*CH3O2
    force(i,49) = force(i,49) + 0.08*rate_constant(i,377) * number_density(i,142) * number_density(i,171)

    ! k_CH3CO3_NO2_1: CH3CO3 + NO2 -> 1*PAN
    force(i,49) = force(i,49) - rate_constant(i,383) * number_density(i,49) * number_density(i,54)

    ! k_CH3COOOH_OH_1: CH3COOOH + OH -> 0.5*CH3CO3 + 0.5*CH2O + 0.5*CO2 + 1*H2O
    force(i,49) = force(i,49) + 0.5*rate_constant(i,393) * number_density(i,184) * number_density(i,166)

    ! k_OH_TERPROD2_1: OH + TERPROD2 -> 0.15*RO2 + 0.68*CH2O + 1.8*CO2 + 0.5*CH3COCH3 + 0.65*CH3CO3 + 0.2*HO2 + 0.7*CO
    force(i,49) = force(i,49) + 0.65*rate_constant(i,397) * number_density(i,166) * number_density(i,155)

    ! k_CH3COCHO_NO3_1: CH3COCHO + NO3 -> 1*HNO3 + 1*CO + 1*CH3CO3
    force(i,49) = force(i,49) + rate_constant(i,405) * number_density(i,111) * number_density(i,165)

    ! k_CH3CO3_ISOPNO3_1: CH3CO3 + ISOPNO3 -> 1*NC4CHO + 1*CH3O2 + 1*HO2
    force(i,49) = force(i,49) - rate_constant(i,413) * number_density(i,49) * number_density(i,46)

    ! k_MVK_O3_1: MVK + O3 -> 0.6*CH2O + 0.56*CO + 0.1*CH3CHO + 0.1*CO2 + 0.28*CH3CO3 + 0.5*CH3COCHO + 0.28*HO2 + 0.36*OH + 0.12*HCOOH
    force(i,49) = force(i,49) + 0.28*rate_constant(i,420) * number_density(i,25) * number_density(i,171)

    ! k_BIGALD_1: BIGALD -> 0.45*CO + 0.13*GLYOXAL + 0.56*HO2 + 0.13*CH3CO3 + 0.18*CH3COCHO
    force(i,49) = force(i,49) + 0.13*rate_constant(i,469) * number_density(i,105)

    ! k_NO_RO2_1: NO + RO2 -> 1*CH3CO3 + 1*CH2O + 1*NO2
    force(i,49) = force(i,49) + rate_constant(i,484) * number_density(i,137) * number_density(i,40)

    ! CH3CN
    force(i,50) = 0

    ! k_CH3CN_OH_1: CH3CN + OH -> 1*HO2
    force(i,50) = force(i,50) - rate_constant(i,153) * number_density(i,50) * number_density(i,166)

    ! N2O5
    force(i,51) = 0
  end do
  !$acc end parallel

end subroutine p_force12

subroutine p_force13(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_N2O5_1: N2O5 -> 1*NO2 + 1*NO3
    force(i,51) = force(i,51) - rate_constant(i,236) * number_density(i,51)

    ! k_N2O5_2: N2O5 -> 1*NO + 1*O + 1*NO3
    force(i,51) = force(i,51) - rate_constant(i,278) * number_density(i,51)

    ! k_N2O5_3: N2O5 -> 1*NO2 + 1*NO3
    force(i,51) = force(i,51) - rate_constant(i,427) * number_density(i,51)

    ! k_NO2_NO3_1: NO2 + NO3 -> 1*N2O5
    force(i,51) = force(i,51) + rate_constant(i,481) * number_density(i,54) * number_density(i,165)

    ! CFC113
    force(i,52) = 0

    ! k_CFC113_O1D_1: CFC113 + O1D -> 3*CL
    force(i,52) = force(i,52) - rate_constant(i,13) * number_density(i,52) * number_density(i,112)

    ! k_CFC113_1: CFC113 -> 3*CL
    force(i,52) = force(i,52) - rate_constant(i,384) * number_density(i,52)

    ! CH3CL
    force(i,53) = 0

    ! k_CH3CL_OH_1: CH3CL + OH -> 1*CL + 1*H2O + 1*HO2
    force(i,53) = force(i,53) - rate_constant(i,92) * number_density(i,53) * number_density(i,166)

    ! k_CH3CL_CL_1: CH3CL + CL -> 1*HO2 + 1*CO + 2*HCL
    force(i,53) = force(i,53) - rate_constant(i,102) * number_density(i,53) * number_density(i,100)

    ! k_CH3CL_1: CH3CL -> 1*CL + 1*CH3O2
    force(i,53) = force(i,53) - rate_constant(i,320) * number_density(i,53)

    ! NO2
    force(i,54) = 0

    ! k_TERPNIT_1: TERPNIT -> 1*TERPROD1 + 1*NO2 + 1*HO2
    force(i,54) = force(i,54) + rate_constant(i,5) * number_density(i,39)

    ! k_N_NO2_1: N + NO2 -> 1*N2 + 1*O2
    force(i,54) = force(i,54) - rate_constant(i,8) * number_density(i,185) * number_density(i,54)

    ! k_NO3_OH_1: NO3 + OH -> 1*HO2 + 1*NO2
    force(i,54) = force(i,54) + rate_constant(i,9) * number_density(i,165) * number_density(i,166)

    ! k_EO2_NO_1: EO2 + NO -> 0.5*CH2O + 0.25*HO2 + 0.75*EO + 1*NO2
    force(i,54) = force(i,54) + rate_constant(i,16) * number_density(i,163) * number_density(i,137)

    ! k_CH3CO3_NO_1: CH3CO3 + NO -> 1*CH3O2 + 1*CO2 + 1*NO2
    force(i,54) = force(i,54) + rate_constant(i,25) * number_density(i,49) * number_density(i,137)

    ! k_PBZNIT_1: PBZNIT -> 1*ACBZO2 + 1*NO2
    force(i,54) = force(i,54) + rate_constant(i,29) * number_density(i,149)

    ! k_PAN_1: PAN -> 1*CH3CO3 + 1*NO2
    force(i,54) = force(i,54) + rate_constant(i,31) * number_density(i,12)

    ! k_MACRO2_NO_1: MACRO2 + NO -> 1*NO2 + 0.47*HO2 + 0.25*CH2O + 0.53*GLYALD + 0.25*CH3COCHO + 0.53*CH3CO3 + 0.22*HYAC + 0.22*CO
    force(i,54) = force(i,54) + rate_constant(i,40) * number_density(i,188) * number_density(i,137)

    ! k_NO_NO3_1: NO + NO3 -> 2*NO2
    force(i,54) = force(i,54) + 2*rate_constant(i,41) * number_density(i,137) * number_density(i,165)

    ! k_MBONO3O2_NO3_1: MBONO3O2 + NO3 -> 0.25*HMPROP + 0.25*CH2O + 1.25*NO2 + 0.75*HONITR + 0.75*CH3COCH3 + 0.75*HO2
    force(i,54) = force(i,54) + 1.25*rate_constant(i,44) * number_density(i,123) * number_density(i,165)

    ! k_HO2NO2_OH_1: HO2NO2 + OH -> 1*H2O + 1*NO2 + 1*O2
    force(i,54) = force(i,54) + rate_constant(i,54) * number_density(i,35) * number_density(i,166)

    ! k_BENZO2_NO_1: BENZO2 + NO -> 1*NO2 + 1*GLYOXAL + 0.5*BIGALD1 + 1*HO2
    force(i,54) = force(i,54) + rate_constant(i,59) * number_density(i,13) * number_density(i,137)

    ! k_NO_TOLO2_1: NO + TOLO2 -> 1*NO2 + 0.6*GLYOXAL + 0.4*CH3COCHO + 1*HO2 + 0.2*BIGALD1 + 0.2*BIGALD2 + 0.2*BIGALD3
    force(i,54) = force(i,54) + rate_constant(i,60) * number_density(i,137) * number_density(i,144)

    ! k_NO_O_1: NO + O -> 1*NO2
    force(i,54) = force(i,54) + rate_constant(i,62) * number_density(i,137) * number_density(i,187)

    ! k_ALKO2_NO_1: ALKO2 + NO -> 0.4*CH3CHO + 0.1*CH2O + 0.25*CH3COCH3 + 1*HO2 + 0.8*MEK + 1*NO2
    force(i,54) = force(i,54) + rate_constant(i,71) * number_density(i,85) * number_density(i,137)

    ! k_MCO3_NO2_1: MCO3 + NO2 -> 1*MPAN
    force(i,54) = force(i,54) - rate_constant(i,72) * number_density(i,167) * number_density(i,54)

    ! k_HO2_NO2_1: HO2 + NO2 -> 1*HO2NO2
    force(i,54) = force(i,54) - rate_constant(i,73) * number_density(i,192) * number_density(i,54)

    ! k_MDIALO2_NO2_1: MDIALO2 + NO2 -> 
    force(i,54) = force(i,54) - rate_constant(i,88) * number_density(i,164) * number_density(i,54)

    ! k_BRONO2_2: BRONO2 -> 1*BRO + 1*NO2
    force(i,54) = force(i,54) + rate_constant(i,94) * number_density(i,72)

    ! k_ISOPBO2_NO_1: ISOPBO2 + NO -> 0.87*HYDRALD + 0.08*ISOPNITB + 0.92*NO2 + 0.92*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    force(i,54) = force(i,54) + 0.92*rate_constant(i,96) * number_density(i,190) * number_density(i,137)

    ! k_NO3_XO2_1: NO3 + XO2 -> 1*NO2 + 1*HO2 + 0.5*CO + 0.25*HYAC + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*GLYALD
    force(i,54) = force(i,54) + rate_constant(i,109) * number_density(i,165) * number_density(i,153)

    ! k_NO_TERP2O2_1: NO + TERP2O2 -> 0.1*ONITR + 0.9*NO2 + 0.34*CH2O + 0.27*CH3COCH3 + 0.225*CO + 0.9*CO2 + 0.9*TERPROD2 + 0.9*HO2 + 0.225*GLYALD
    force(i,54) = force(i,54) + 0.9*rate_constant(i,110) * number_density(i,137) * number_density(i,145)
  end do
  !$acc end parallel

end subroutine p_force13

subroutine p_force14(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_HOCH2OO_NO_1: HOCH2OO + NO -> 1*HCOOH + 1*NO2 + 1*HO2
    force(i,54) = force(i,54) + rate_constant(i,113) * number_density(i,154) * number_density(i,137)

    ! k_NOA_1: NOA -> 1*NO2 + 1*CH2O + 1*CH3CO3
    force(i,54) = force(i,54) + rate_constant(i,119) * number_density(i,27)

    ! k_NO2_1: NO2 -> 1*NO + 1*O
    force(i,54) = force(i,54) - rate_constant(i,121) * number_density(i,54)

    ! k_NO3_O_1: NO3 + O -> 1*NO2 + 1*O2
    force(i,54) = force(i,54) + rate_constant(i,129) * number_density(i,165) * number_density(i,187)

    ! k_MACRO2_NO3_1: MACRO2 + NO3 -> 1*NO2 + 0.47*HO2 + 0.25*CH2O + 0.25*CH3COCHO + 0.22*CO + 0.53*GLYALD + 0.22*HYAC + 0.53*CH3CO3
    force(i,54) = force(i,54) + rate_constant(i,134) * number_density(i,188) * number_density(i,165)

    ! k_CH3O2_NTERPO2_1: CH3O2 + NTERPO2 -> 0.5*TERPNIT + 0.75*CH2O + 0.25*CH3OH + 0.5*HO2 + 0.5*TERPROD1 + 0.5*NO2
    force(i,54) = force(i,54) + 0.5*rate_constant(i,135) * number_density(i,191) * number_density(i,143)

    ! k_NTERPOOH_1: NTERPOOH -> 1*TERPROD1 + 1*NO2 + 1*OH
    force(i,54) = force(i,54) + rate_constant(i,143) * number_density(i,114)

    ! k_MCO3_NO3_1: MCO3 + NO3 -> 1*NO2 + 1*CH2O + 1*CH3CO3
    force(i,54) = force(i,54) + rate_constant(i,146) * number_density(i,167) * number_density(i,165)

    ! k_N_NO2_2: N + NO2 -> 2*NO
    force(i,54) = force(i,54) - rate_constant(i,154) * number_density(i,185) * number_density(i,54)

    ! k_HMPROPO2_NO_1: HMPROPO2 + NO -> 1*NO2 + 1*CO2 + 1*HO2 + 1*CH3COCH3
    force(i,54) = force(i,54) + rate_constant(i,156) * number_density(i,77) * number_density(i,137)

    ! k_HO2NO2_1: HO2NO2 -> 1*HO2 + 1*NO2
    force(i,54) = force(i,54) + rate_constant(i,159) * number_density(i,35)

    ! k_NO2_O3_1: NO2 + O3 -> 1*NO3 + 1*O2
    force(i,54) = force(i,54) - rate_constant(i,165) * number_density(i,54) * number_density(i,171)

    ! k_NC4CHO_1: NC4CHO -> 1*BIGALD3 + 1*NO2 + 1*HO2
    force(i,54) = force(i,54) + rate_constant(i,169) * number_density(i,23)

    ! k_HONITR_1: HONITR -> 1*NO2 + 0.67*HO2 + 0.33*CH3CHO + 0.33*CH2O + 0.33*CO + 0.33*GLYALD + 0.33*CH3CO3 + 0.17*HYAC + 0.17*CH3COCH3
    force(i,54) = force(i,54) + rate_constant(i,171) * number_density(i,134)

    ! k_C6H5O2_NO_1: C6H5O2 + NO -> 1*PHENO + 1*NO2
    force(i,54) = force(i,54) + rate_constant(i,175) * number_density(i,81) * number_density(i,137)

    ! k_ISOPBO2_NO3_1: ISOPBO2 + NO3 -> 1*NO2 + 0.95*HYDRALD + 1*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    force(i,54) = force(i,54) + rate_constant(i,178) * number_density(i,190) * number_density(i,165)

    ! k_BRO_NO2_1: BRO + NO2 -> 1*BRONO2
    force(i,54) = force(i,54) - rate_constant(i,184) * number_density(i,71) * number_density(i,54)

    ! k_NO3_1: NO3 -> 1*NO2 + 1*O
    force(i,54) = force(i,54) + rate_constant(i,189) * number_density(i,165)

    ! k_BZOO_NO_1: BZOO + NO -> 1*BZALD + 1*NO2 + 1*HO2
    force(i,54) = force(i,54) + rate_constant(i,195) * number_density(i,33) * number_density(i,137)

    ! k_ENEO2_NO_1: ENEO2 + NO -> 1*CH3CHO + 0.5*CH2O + 0.5*CH3COCH3 + 1*HO2 + 1*NO2
    force(i,54) = force(i,54) + rate_constant(i,201) * number_density(i,133) * number_density(i,137)

    ! k_CLO_NO_1: CLO + NO -> 1*NO2 + 1*CL
    force(i,54) = force(i,54) + rate_constant(i,203) * number_density(i,86) * number_density(i,137)

    ! k_BRO_NO_1: BRO + NO -> 1*BR + 1*NO2
    force(i,54) = force(i,54) + rate_constant(i,206) * number_density(i,71) * number_density(i,137)

    ! k_NO2_OH_1: NO2 + OH -> 1*HNO3
    force(i,54) = force(i,54) - rate_constant(i,207) * number_density(i,54) * number_density(i,166)

    ! k_CLO_NO2_1: CLO + NO2 -> 1*CLONO2
    force(i,54) = force(i,54) - rate_constant(i,214) * number_density(i,86) * number_density(i,54)

    ! k_ONITR_1: ONITR -> 1*NO2
    force(i,54) = force(i,54) + rate_constant(i,216) * number_density(i,129)

    ! k_N2O5_1: N2O5 -> 1*NO2 + 1*NO3
    force(i,54) = force(i,54) + rate_constant(i,236) * number_density(i,51)

    ! k_NO_XO2_1: NO + XO2 -> 1*NO2 + 1*HO2 + 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD
    force(i,54) = force(i,54) + rate_constant(i,252) * number_density(i,137) * number_density(i,153)

    ! k_NO_PHENO2_1: NO + PHENO2 -> 1*HO2 + 0.7*GLYOXAL + 1*NO2
    force(i,54) = force(i,54) + rate_constant(i,257) * number_density(i,137) * number_density(i,38)

    ! k_HNO3_1: HNO3 -> 1*NO2 + 1*OH
    force(i,54) = force(i,54) + rate_constant(i,258) * number_density(i,42)

    ! k_NO2_SO_1: NO2 + SO -> 1*SO2 + 1*NO
    force(i,54) = force(i,54) - rate_constant(i,260) * number_density(i,54) * number_density(i,32)

    ! k_ACBZO2_NO_1: ACBZO2 + NO -> 1*C6H5O2 + 1*NO2
    force(i,54) = force(i,54) + rate_constant(i,263) * number_density(i,43) * number_density(i,137)

    ! k_C2H5O2_NO_1: C2H5O2 + NO -> 1*CH3CHO + 1*HO2 + 1*NO2
    force(i,54) = force(i,54) + rate_constant(i,270) * number_density(i,87) * number_density(i,137)

    ! k_N_NO2_3: N + NO2 -> 1*N2O + 1*O
    force(i,54) = force(i,54) - rate_constant(i,273) * number_density(i,185) * number_density(i,54)

    ! k_MPAN_1: MPAN -> 1*MCO3 + 1*NO2
    force(i,54) = force(i,54) + rate_constant(i,288) * number_density(i,159)
  end do
  !$acc end parallel

end subroutine p_force14

subroutine p_force15(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_NO2_PHENO_1: NO2 + PHENO -> 
    force(i,54) = force(i,54) - rate_constant(i,292) * number_density(i,54) * number_density(i,182)

    ! k_ISOPNOOH_1: ISOPNOOH -> 1*NO2 + 1*HO2 + 1*ISOPOOH
    force(i,54) = force(i,54) + rate_constant(i,297) * number_density(i,160)

    ! k_ISOPNO3_NO_1: ISOPNO3 + NO -> 1*NC4CHO + 1*NO2 + 1*HO2
    force(i,54) = force(i,54) + rate_constant(i,302) * number_density(i,46) * number_density(i,137)

    ! k_NO_NTERPO2_1: NO + NTERPO2 -> 0.2*TERPNIT + 1.6*NO2 + 0.8*TERPROD1
    force(i,54) = force(i,54) + 1.6*rate_constant(i,306) * number_density(i,137) * number_density(i,143)

    ! k_MBOO2_NO_1: MBOO2 + NO -> 1*HO2 + 0.67*GLYALD + 0.67*CH3COCH3 + 0.33*HMPROP + 0.33*CH2O + 1*NO2
    force(i,54) = force(i,54) + rate_constant(i,308) * number_density(i,125) * number_density(i,137)

    ! k_NOA_OH_1: NOA + OH -> 1*NO2 + 1*CH3COCHO
    force(i,54) = force(i,54) + rate_constant(i,311) * number_density(i,27) * number_density(i,166)

    ! k_MBONO3O2_NO_1: MBONO3O2 + NO -> 0.25*HMPROP + 0.25*CH2O + 1.25*NO2 + 0.75*HONITR + 0.75*CH3COCH3 + 0.75*HO2
    force(i,54) = force(i,54) + 1.25*rate_constant(i,313) * number_density(i,123) * number_density(i,137)

    ! k_DICARBO2_NO2_1: DICARBO2 + NO2 -> 
    force(i,54) = force(i,54) - rate_constant(i,316) * number_density(i,181) * number_density(i,54)

    ! k_CH3O2_NO_1: CH3O2 + NO -> 1*CH2O + 1*NO2 + 1*HO2
    force(i,54) = force(i,54) + rate_constant(i,329) * number_density(i,191) * number_density(i,137)

    ! k_ISOPAO2_NO3_1: ISOPAO2 + NO3 -> 1*NO2 + 0.4*MACR + 0.6*MVK + 1*CH2O + 1*HO2
    force(i,54) = force(i,54) + rate_constant(i,330) * number_density(i,189) * number_density(i,165)

    ! k_MEKO2_NO_1: MEKO2 + NO -> 1*CH3CO3 + 1*CH3CHO + 1*NO2
    force(i,54) = force(i,54) + rate_constant(i,332) * number_density(i,128) * number_density(i,137)

    ! k_DICARBO2_NO_1: DICARBO2 + NO -> 1*NO2 + 0.17*HO2 + 0.17*CH3COCHO + 0.17*CO + 0.83*CH3O2
    force(i,54) = force(i,54) + rate_constant(i,337) * number_density(i,181) * number_density(i,137)

    ! k_NO2_O_1: NO2 + O -> 1*NO + 1*O2
    force(i,54) = force(i,54) - rate_constant(i,351) * number_density(i,54) * number_density(i,187)

    ! k_MCO3_NO_1: MCO3 + NO -> 1*NO2 + 1*CH2O + 1*CH3CO3
    force(i,54) = force(i,54) + rate_constant(i,353) * number_density(i,167) * number_density(i,137)

    ! k_MALO2_NO2_1: MALO2 + NO2 -> 
    force(i,54) = force(i,54) - rate_constant(i,356) * number_density(i,170) * number_density(i,54)

    ! k_HO2NO2_2: HO2NO2 -> 1*NO2 + 1*HO2
    force(i,54) = force(i,54) + rate_constant(i,359) * number_density(i,35)

    ! k_PAN_2: PAN -> 0.6*CH3CO3 + 0.6*NO2 + 0.4*CH3O2 + 0.4*NO3 + 0.4*CO2
    force(i,54) = force(i,54) + 0.6*rate_constant(i,362) * number_density(i,12)

    ! k_ISOPNITA_OH_1: ISOPNITA + OH -> 0.7*HYAC + 0.7*GLYALD + 0.7*NO2 + 0.3*CH2O + 0.3*HONITR + 0.3*HO2
    force(i,54) = force(i,54) + 0.7*rate_constant(i,364) * number_density(i,118) * number_density(i,166)

    ! k_NO_PO2_1: NO + PO2 -> 1*CH3CHO + 1*CH2O + 1*HO2 + 1*NO2
    force(i,54) = force(i,54) + rate_constant(i,365) * number_density(i,137) * number_density(i,151)

    ! k_CH3CO3_NO2_1: CH3CO3 + NO2 -> 1*PAN
    force(i,54) = force(i,54) - rate_constant(i,383) * number_density(i,49) * number_density(i,54)

    ! k_BIGENE_NO3_1: BIGENE + NO3 -> 1*NO2 + 1*CH3CHO + 0.5*CH2O + 0.5*CH3COCH3
    force(i,54) = force(i,54) + rate_constant(i,387) * number_density(i,97) * number_density(i,165)

    ! k_ACBZO2_NO2_1: ACBZO2 + NO2 -> 1*PBZNIT
    force(i,54) = force(i,54) - rate_constant(i,388) * number_density(i,43) * number_density(i,54)

    ! k_NO3_NTERPO2_1: NO3 + NTERPO2 -> 2*NO2 + 1*TERPROD1
    force(i,54) = force(i,54) + 2*rate_constant(i,389) * number_density(i,165) * number_density(i,143)

    ! k_NO_TERPO2_1: NO + TERPO2 -> 0.2*TERPNIT + 0.8*NO2 + 0.32*CH2O + 0.04*CH3COCH3 + 0.8*TERPROD1 + 0.8*HO2
    force(i,54) = force(i,54) + 0.8*rate_constant(i,392) * number_density(i,137) * number_density(i,147)

    ! k_ALKNIT_OH_1: ALKNIT + OH -> 0.4*CH2O + 0.8*CH3CHO + 0.8*CH3COCH3 + 1*NO2
    force(i,54) = force(i,54) + rate_constant(i,394) * number_density(i,5) * number_density(i,166)

    ! k_MDIALO2_NO_1: MDIALO2 + NO -> 1*NO2 + 0.83*HO2 + 0.17*CH3COCHO + 0.35*CO + 0.17*CH3O2 + 0.17*GLYOXAL
    force(i,54) = force(i,54) + rate_constant(i,403) * number_density(i,164) * number_density(i,137)

    ! k_NO_XYLOLO2_1: NO + XYLOLO2 -> 1*HO2 + 1*NO2 + 0.17*GLYOXAL + 0.51*CH3COCHO
    force(i,54) = force(i,54) + rate_constant(i,404) * number_density(i,137) * number_density(i,148)

    ! k_CLONO2_2: CLONO2 -> 1*CLO + 1*NO2
    force(i,54) = force(i,54) + rate_constant(i,406) * number_density(i,74)

    ! k_NO_XYLENO2_1: NO + XYLENO2 -> 1*NO2 + 1*HO2 + 0.34*GLYOXAL + 0.54*CH3COCHO + 0.06*BIGALD1 + 0.2*BIGALD2 + 0.15*BIGALD3 + 0.21*BIGALD4
    force(i,54) = force(i,54) + rate_constant(i,419) * number_density(i,137) * number_density(i,146)

    ! k_MALO2_NO_1: MALO2 + NO -> 0.4*GLYOXAL + 0.4*HO2 + 0.4*CO + 1*NO2
    force(i,54) = force(i,54) + rate_constant(i,424) * number_density(i,170) * number_density(i,137)

    ! k_N2O5_3: N2O5 -> 1*NO2 + 1*NO3
    force(i,54) = force(i,54) + rate_constant(i,427) * number_density(i,51)

    ! k_OH_TERPNIT_1: OH + TERPNIT -> 1*NO2 + 1*TERPROD1
    force(i,54) = force(i,54) + rate_constant(i,428) * number_density(i,166) * number_density(i,39)

    ! k_MPAN_2: MPAN -> 1*MCO3 + 1*NO2
    force(i,54) = force(i,54) + rate_constant(i,438) * number_density(i,159)

    ! k_NO_O3_1: NO + O3 -> 1*NO2 + 1*O2
    force(i,54) = force(i,54) + rate_constant(i,439) * number_density(i,137) * number_density(i,171)
  end do
  !$acc end parallel

end subroutine p_force15

subroutine p_force16(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_ISOPNO3_NO3_1: ISOPNO3 + NO3 -> 1*NC4CHO + 1*NO2 + 1*HO2
    force(i,54) = force(i,54) + rate_constant(i,451) * number_density(i,46) * number_density(i,165)

    ! k_ALKNIT_1: ALKNIT -> 1*NO2 + 0.4*CH3CHO + 0.1*CH2O + 0.25*CH3COCH3 + 1*HO2 + 0.8*MEK
    force(i,54) = force(i,54) + rate_constant(i,452) * number_density(i,5)

    ! k_HO2_NO3_1: HO2 + NO3 -> 1*OH + 1*NO2 + 1*O2
    force(i,54) = force(i,54) + rate_constant(i,454) * number_density(i,192) * number_density(i,165)

    ! k_ISOPAO2_NO_1: ISOPAO2 + NO -> 0.08*ISOPNITA + 0.92*NO2 + 0.36*MACR + 0.56*MVK + 0.92*CH2O + 0.92*HO2
    force(i,54) = force(i,54) + 0.92*rate_constant(i,464) * number_density(i,189) * number_density(i,137)

    ! k_C3H7O2_NO_1: C3H7O2 + NO -> 0.82*CH3COCH3 + 1*NO2 + 1*HO2 + 0.27*CH3CHO
    force(i,54) = force(i,54) + rate_constant(i,471) * number_density(i,109) * number_density(i,137)

    ! k_NO2_O_2: NO2 + O -> 1*NO3
    force(i,54) = force(i,54) - rate_constant(i,472) * number_density(i,54) * number_density(i,187)

    ! k_NO2_NO3_1: NO2 + NO3 -> 1*N2O5
    force(i,54) = force(i,54) - rate_constant(i,481) * number_density(i,54) * number_density(i,165)

    ! k_HO2_NO_1: HO2 + NO -> 1*NO2 + 1*OH
    force(i,54) = force(i,54) + rate_constant(i,483) * number_density(i,192) * number_density(i,137)

    ! k_NO_RO2_1: NO + RO2 -> 1*CH3CO3 + 1*CH2O + 1*NO2
    force(i,54) = force(i,54) + rate_constant(i,484) * number_density(i,137) * number_density(i,40)

    ! SO2
    force(i,55) = 0

    ! k_OH_SO2_1: OH + SO2 -> 1*SO3 + 1*HO2
    force(i,55) = force(i,55) - rate_constant(i,22) * number_density(i,166) * number_density(i,55)

    ! k_SO3_1: SO3 -> 1*SO2 + 1*O
    force(i,55) = force(i,55) + rate_constant(i,24) * number_density(i,28)

    ! k_OCLO_SO_1: OCLO + SO -> 1*SO2 + 1*CLO
    force(i,55) = force(i,55) + rate_constant(i,47) * number_density(i,183) * number_density(i,32)

    ! k_BRO_SO_1: BRO + SO -> 1*SO2 + 1*BR
    force(i,55) = force(i,55) + rate_constant(i,58) * number_density(i,71) * number_density(i,32)

    ! k_SO2_1: SO2 -> 1*SO + 1*O
    force(i,55) = force(i,55) - rate_constant(i,87) * number_density(i,55)

    ! k_CLO_SO_1: CLO + SO -> 1*SO2 + 1*CL
    force(i,55) = force(i,55) + rate_constant(i,118) * number_density(i,86) * number_density(i,32)

    ! k_O3_SO_1: O3 + SO -> 1*SO2 + 1*O2
    force(i,55) = force(i,55) + rate_constant(i,140) * number_density(i,171) * number_density(i,32)

    ! k_DMS_NO3_1: DMS + NO3 -> 1*SO2 + 1*HNO3
    force(i,55) = force(i,55) + rate_constant(i,197) * number_density(i,99) * number_density(i,165)

    ! k_DMS_OH_1: DMS + OH -> 0.5*SO2 + 0.5*HO2
    force(i,55) = force(i,55) + 0.5*rate_constant(i,227) * number_density(i,99) * number_density(i,166)

    ! k_O2_SO_1: O2 + SO -> 1*SO2 + 1*O
    force(i,55) = force(i,55) + rate_constant(i,241) * number_density(i,41) * number_density(i,32)

    ! k_NO2_SO_1: NO2 + SO -> 1*SO2 + 1*NO
    force(i,55) = force(i,55) + rate_constant(i,260) * number_density(i,54) * number_density(i,32)

    ! k_OCS_OH_1: OCS + OH -> 1*SO2 + 1*CO + 1*H
    force(i,55) = force(i,55) + rate_constant(i,312) * number_density(i,29) * number_density(i,166)

    ! k_DMS_OH_2: DMS + OH -> 1*SO2
    force(i,55) = force(i,55) + rate_constant(i,476) * number_density(i,99) * number_density(i,166)

    ! k_OH_SO_1: OH + SO -> 1*SO2 + 1*H
    force(i,55) = force(i,55) + rate_constant(i,486) * number_density(i,166) * number_density(i,32)

    ! C3H8
    force(i,56) = 0

    ! k_C3H8_OH_1: C3H8 + OH -> 1*C3H7O2 + 1*H2O
    force(i,56) = force(i,56) - rate_constant(i,251) * number_density(i,56) * number_density(i,166)

    ! HYAC
    force(i,57) = 0

    ! k_MPAN_OH_1: MPAN + OH -> 0.5*HYAC + 0.5*NO3 + 0.5*CH2O + 0.5*HO2 + 0.5*CO2
    force(i,57) = force(i,57) + 0.5*rate_constant(i,28) * number_density(i,159) * number_density(i,166)

    ! k_MACRO2_NO_1: MACRO2 + NO -> 1*NO2 + 0.47*HO2 + 0.25*CH2O + 0.53*GLYALD + 0.25*CH3COCHO + 0.53*CH3CO3 + 0.22*HYAC + 0.22*CO
    force(i,57) = force(i,57) + 0.22*rate_constant(i,40) * number_density(i,188) * number_density(i,137)

    ! k_ISOPNITB_OH_1: ISOPNITB + OH -> 0.5*HYAC + 0.5*GLYALD + 0.5*NOA + 1*HO2 + 0.5*HONITR
    force(i,57) = force(i,57) + 0.5*rate_constant(i,79) * number_density(i,73) * number_density(i,166)

    ! k_ISOPBO2_NO_1: ISOPBO2 + NO -> 0.87*HYDRALD + 0.08*ISOPNITB + 0.92*NO2 + 0.92*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    force(i,57) = force(i,57) + 0.05*rate_constant(i,96) * number_density(i,190) * number_density(i,137)

    ! k_CH3CO3_XO2_1: CH3CO3 + XO2 -> 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 1*CH3O2 + 1*HO2 + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD + 1*CO2
    force(i,57) = force(i,57) + 0.25*rate_constant(i,106) * number_density(i,49) * number_density(i,153)

    ! k_NO3_XO2_1: NO3 + XO2 -> 1*NO2 + 1*HO2 + 0.5*CO + 0.25*HYAC + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*GLYALD
    force(i,57) = force(i,57) + 0.25*rate_constant(i,109) * number_density(i,165) * number_density(i,153)

    ! k_OH_POOH_1: OH + POOH -> 0.5*PO2 + 0.5*OH + 0.5*HYAC + 1*H2O
    force(i,57) = force(i,57) + 0.5*rate_constant(i,127) * number_density(i,166) * number_density(i,9)
  end do
  !$acc end parallel

end subroutine p_force16

subroutine p_force17(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_MACRO2_NO3_1: MACRO2 + NO3 -> 1*NO2 + 0.47*HO2 + 0.25*CH2O + 0.25*CH3COCHO + 0.22*CO + 0.53*GLYALD + 0.22*HYAC + 0.53*CH3CO3
    force(i,57) = force(i,57) + 0.22*rate_constant(i,134) * number_density(i,188) * number_density(i,165)

    ! k_HONITR_1: HONITR -> 1*NO2 + 0.67*HO2 + 0.33*CH3CHO + 0.33*CH2O + 0.33*CO + 0.33*GLYALD + 0.33*CH3CO3 + 0.17*HYAC + 0.17*CH3COCH3
    force(i,57) = force(i,57) + 0.17*rate_constant(i,171) * number_density(i,134)

    ! k_ISOPBO2_NO3_1: ISOPBO2 + NO3 -> 1*NO2 + 0.95*HYDRALD + 1*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    force(i,57) = force(i,57) + 0.05*rate_constant(i,178) * number_density(i,190) * number_density(i,165)

    ! k_HYAC_1: HYAC -> 1*CH3CO3 + 1*HO2 + 1*CH2O
    force(i,57) = force(i,57) - rate_constant(i,215) * number_density(i,57)

    ! k_CH3CO3_MACRO2_1: CH3CO3 + MACRO2 -> 0.25*CH3COCHO + 1*CH3O2 + 0.22*CO + 0.47*HO2 + 0.53*GLYALD + 0.22*HYAC + 0.25*CH2O + 0.53*CH3CO3
    force(i,57) = force(i,57) + 0.22*rate_constant(i,235) * number_density(i,49) * number_density(i,188)

    ! k_NO_XO2_1: NO + XO2 -> 1*NO2 + 1*HO2 + 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD
    force(i,57) = force(i,57) + 0.25*rate_constant(i,252) * number_density(i,137) * number_density(i,153)

    ! k_CH3O2_MACRO2_1: CH3O2 + MACRO2 -> 0.73*HO2 + 0.88*CH2O + 0.11*CO + 0.24*CH3COCHO + 0.26*GLYALD + 0.26*CH3CO3 + 0.25*CH3OH + 0.23*HYAC
    force(i,57) = force(i,57) + 0.23*rate_constant(i,322) * number_density(i,191) * number_density(i,188)

    ! k_CH3O2_RO2_1: CH3O2 + RO2 -> 0.3*CH3CO3 + 0.8*CH2O + 0.3*HO2 + 0.2*HYAC + 0.5*CH3COCHO + 0.5*CH3OH
    force(i,57) = force(i,57) + 0.2*rate_constant(i,354) * number_density(i,191) * number_density(i,40)

    ! k_ISOPNITA_OH_1: ISOPNITA + OH -> 0.7*HYAC + 0.7*GLYALD + 0.7*NO2 + 0.3*CH2O + 0.3*HONITR + 0.3*HO2
    force(i,57) = force(i,57) + 0.7*rate_constant(i,364) * number_density(i,118) * number_density(i,166)

    ! k_CH3O2_XO2_1: CH3O2 + XO2 -> 0.3*CH3OH + 0.8*HO2 + 0.8*CH2O + 0.2*CO + 0.1*GLYOXAL + 0.1*CH3COCHO + 0.1*HYAC + 0.1*GLYALD
    force(i,57) = force(i,57) + 0.1*rate_constant(i,410) * number_density(i,191) * number_density(i,153)

    ! k_HYAC_OH_1: HYAC + OH -> 1*CH3COCHO + 1*HO2
    force(i,57) = force(i,57) - rate_constant(i,422) * number_density(i,57) * number_density(i,166)

    ! TERPROD1
    force(i,58) = 0

    ! k_CH3O2_TERPO2_1: CH3O2 + TERPO2 -> 1*TERPROD1 + 0.95*CH2O + 0.25*CH3OH + 1*HO2 + 0.025*CH3COCH3
    force(i,58) = force(i,58) + rate_constant(i,3) * number_density(i,191) * number_density(i,147)

    ! k_TERPNIT_1: TERPNIT -> 1*TERPROD1 + 1*NO2 + 1*HO2
    force(i,58) = force(i,58) + rate_constant(i,5) * number_density(i,39)

    ! k_CH3O2_NTERPO2_1: CH3O2 + NTERPO2 -> 0.5*TERPNIT + 0.75*CH2O + 0.25*CH3OH + 0.5*HO2 + 0.5*TERPROD1 + 0.5*NO2
    force(i,58) = force(i,58) + 0.5*rate_constant(i,135) * number_density(i,191) * number_density(i,143)

    ! k_NTERPOOH_1: NTERPOOH -> 1*TERPROD1 + 1*NO2 + 1*OH
    force(i,58) = force(i,58) + rate_constant(i,143) * number_density(i,114)

    ! k_OH_TERPROD1_1: OH + TERPROD1 -> 1*TERP2O2
    force(i,58) = force(i,58) - rate_constant(i,151) * number_density(i,166) * number_density(i,58)

    ! k_TERPOOH_1: TERPOOH -> 0.4*CH2O + 0.05*CH3COCH3 + 1*TERPROD1 + 1*HO2 + 1*OH
    force(i,58) = force(i,58) + rate_constant(i,218) * number_density(i,113)

    ! k_BCARY_O3_1: BCARY + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    force(i,58) = force(i,58) + 0.33*rate_constant(i,229) * number_density(i,102) * number_density(i,171)

    ! k_TERPROD1_1: TERPROD1 -> 1*HO2 + 1*CO + 1*TERPROD2
    force(i,58) = force(i,58) - rate_constant(i,286) * number_density(i,58)

    ! k_NO_NTERPO2_1: NO + NTERPO2 -> 0.2*TERPNIT + 1.6*NO2 + 0.8*TERPROD1
    force(i,58) = force(i,58) + 0.8*rate_constant(i,306) * number_density(i,137) * number_density(i,143)

    ! k_MTERP_O3_2: MTERP + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    force(i,58) = force(i,58) + 0.33*rate_constant(i,307) * number_density(i,31) * number_density(i,171)

    ! k_NO3_TERPROD1_1: NO3 + TERPROD1 -> 0.5*TERP2O2 + 0.5*NTERPO2
    force(i,58) = force(i,58) - rate_constant(i,309) * number_density(i,165) * number_density(i,58)

    ! k_NO3_NTERPO2_1: NO3 + NTERPO2 -> 2*NO2 + 1*TERPROD1
    force(i,58) = force(i,58) + rate_constant(i,389) * number_density(i,165) * number_density(i,143)

    ! k_NO_TERPO2_1: NO + TERPO2 -> 0.2*TERPNIT + 0.8*NO2 + 0.32*CH2O + 0.04*CH3COCH3 + 0.8*TERPROD1 + 0.8*HO2
    force(i,58) = force(i,58) + 0.8*rate_constant(i,392) * number_density(i,137) * number_density(i,147)

    ! k_OH_TERPNIT_1: OH + TERPNIT -> 1*NO2 + 1*TERPROD1
    force(i,58) = force(i,58) + rate_constant(i,428) * number_density(i,166) * number_density(i,39)

    ! CCL4
    force(i,59) = 0

    ! k_CCL4_1: CCL4 -> 4*CL
    force(i,59) = force(i,59) - rate_constant(i,116) * number_density(i,59)

    ! k_CCL4_O1D_1: CCL4 + O1D -> 4*CL
    force(i,59) = force(i,59) - rate_constant(i,366) * number_density(i,59) * number_density(i,112)

    ! CF3BR
    force(i,60) = 0

    ! k_CF3BR_1: CF3BR -> 1*BR + 1*F + 1*COF2
    force(i,60) = force(i,60) - rate_constant(i,303) * number_density(i,60)

    ! k_CF3BR_O1D_1: CF3BR + O1D -> 1*BR + 1*F + 1*COF2
    force(i,60) = force(i,60) - rate_constant(i,381) * number_density(i,60) * number_density(i,112)

    ! CFC11
    force(i,61) = 0

    ! k_CFC11_1: CFC11 -> 3*CL
    force(i,61) = force(i,61) - rate_constant(i,285) * number_density(i,61)
  end do
  !$acc end parallel

end subroutine p_force17

subroutine p_force18(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_CFC11_O1D_1: CFC11 + O1D -> 3*CL
    force(i,61) = force(i,61) - rate_constant(i,474) * number_density(i,61) * number_density(i,112)

    ! CFC114
    force(i,62) = 0

    ! k_CFC114_O1D_1: CFC114 + O1D -> 2*CL + 2*COF2
    force(i,62) = force(i,62) - rate_constant(i,18) * number_density(i,62) * number_density(i,112)

    ! k_CFC114_1: CFC114 -> 2*CL + 2*COF2
    force(i,62) = force(i,62) - rate_constant(i,355) * number_density(i,62)

    ! CFC115
    force(i,63) = 0

    ! k_CFC115_O1D_1: CFC115 + O1D -> 1*CL + 1*F + 2*COF2
    force(i,63) = force(i,63) - rate_constant(i,253) * number_density(i,63) * number_density(i,112)

    ! k_CFC115_1: CFC115 -> 1*CL + 1*F + 2*COF2
    force(i,63) = force(i,63) - rate_constant(i,280) * number_density(i,63)

    ! CFC12
    force(i,64) = 0

    ! k_CFC12_O1D_1: CFC12 + O1D -> 2*CL + 1*COF2
    force(i,64) = force(i,64) - rate_constant(i,222) * number_density(i,64) * number_density(i,112)

    ! k_CFC12_1: CFC12 -> 2*CL + 1*COF2
    force(i,64) = force(i,64) - rate_constant(i,369) * number_density(i,64)

    ! ALKOOH
    force(i,65) = 0

    ! k_ALKOOH_OH_1: ALKOOH + OH -> 1*ALKO2
    force(i,65) = force(i,65) - rate_constant(i,104) * number_density(i,65) * number_density(i,166)

    ! k_ALKOOH_1: ALKOOH -> 0.4*CH3CHO + 0.1*CH2O + 0.25*CH3COCH3 + 0.9*HO2 + 0.8*MEK + 1*OH
    force(i,65) = force(i,65) - rate_constant(i,300) * number_density(i,65)

    ! k_ALKO2_HO2_1: ALKO2 + HO2 -> 1*ALKOOH
    force(i,65) = force(i,65) + rate_constant(i,426) * number_density(i,85) * number_density(i,192)

    ! H2402
    force(i,66) = 0

    ! k_H2402_O1D_1: H2402 + O1D -> 2*BR + 2*COF2
    force(i,66) = force(i,66) - rate_constant(i,347) * number_density(i,66) * number_density(i,112)

    ! k_H2402_1: H2402 -> 2*BR + 2*COF2
    force(i,66) = force(i,66) - rate_constant(i,441) * number_density(i,66)

    ! HPALD
    force(i,67) = 0

    ! k_ISOPBO2_1: ISOPBO2 -> 1*HPALD + 1*HO2
    force(i,67) = force(i,67) + rate_constant(i,390) * number_density(i,190)

    ! k_HPALD_1: HPALD -> 1*BIGALD3 + 1*OH + 1*HO2
    force(i,67) = force(i,67) - rate_constant(i,430) * number_density(i,67)

    ! k_HPALD_OH_1: HPALD + OH -> 1*XO2
    force(i,67) = force(i,67) - rate_constant(i,444) * number_density(i,67) * number_density(i,166)

    ! H2O
    force(i,68) = 0

    ! k_C3H7OOH_OH_1: C3H7OOH + OH -> 1*H2O + 1*C3H7O2
    force(i,68) = force(i,68) + rate_constant(i,4) * number_density(i,20) * number_density(i,166)

    ! k_HOCL_OH_1: HOCL + OH -> 1*H2O + 1*CLO
    force(i,68) = force(i,68) + rate_constant(i,30) * number_density(i,88) * number_density(i,166)

    ! k_CH4_1: CH4 -> 1.44*H2 + 0.18*CH2O + 0.18*O + 0.33*OH + 0.33*H + 0.44*CO2 + 0.38*CO + 0.05*H2O
    force(i,68) = force(i,68) + 0.05*rate_constant(i,37) * number_density(i,45)

    ! k_H2O_O1D_1: H2O + O1D -> 2*OH
    force(i,68) = force(i,68) - rate_constant(i,39) * number_density(i,68) * number_density(i,112)

    ! k_HO2NO2_OH_1: HO2NO2 + OH -> 1*H2O + 1*NO2 + 1*O2
    force(i,68) = force(i,68) + rate_constant(i,54) * number_density(i,35) * number_density(i,166)

    ! k_CH3COCH3_OH_1: CH3COCH3 + OH -> 1*RO2 + 1*H2O
    force(i,68) = force(i,68) + rate_constant(i,68) * number_density(i,89) * number_density(i,166)

    ! k_CH3COCH3_OH_2: CH3COCH3 + OH -> 1*RO2 + 1*H2O
    force(i,68) = force(i,68) + rate_constant(i,69) * number_density(i,89) * number_density(i,166)

    ! k_H2O_1: H2O -> 2*H + 1*O
    force(i,68) = force(i,68) - rate_constant(i,77) * number_density(i,68)

    ! k_CH3CL_OH_1: CH3CL + OH -> 1*CL + 1*H2O + 1*HO2
    force(i,68) = force(i,68) + rate_constant(i,92) * number_density(i,53) * number_density(i,166)

    ! k_OH_OH_1: OH + OH -> 1*H2O + 1*O
    force(i,68) = force(i,68) + rate_constant(i,100) * number_density(i,166) * number_density(i,166)

    ! k_CH3COOH_OH_1: CH3COOH + OH -> 1*CH3O2 + 1*CO2 + 1*H2O
    force(i,68) = force(i,68) + rate_constant(i,107) * number_density(i,177) * number_density(i,166)

    ! k_CH3CHO_OH_1: CH3CHO + OH -> 1*CH3CO3 + 1*H2O
    force(i,68) = force(i,68) + rate_constant(i,108) * number_density(i,178) * number_density(i,166)
  end do
  !$acc end parallel

end subroutine p_force18

subroutine p_force19(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_CH3BR_OH_1: CH3BR + OH -> 1*BR + 1*H2O + 1*HO2
    force(i,68) = force(i,68) + rate_constant(i,112) * number_density(i,94) * number_density(i,166)

    ! k_H2O_2: H2O -> 1*H2 + 1*O1D
    force(i,68) = force(i,68) - rate_constant(i,114) * number_density(i,68)

    ! k_CH3COCHO_OH_1: CH3COCHO + OH -> 1*CH3CO3 + 1*CO + 1*H2O
    force(i,68) = force(i,68) + rate_constant(i,122) * number_density(i,111) * number_density(i,166)

    ! k_OH_POOH_1: OH + POOH -> 0.5*PO2 + 0.5*OH + 0.5*HYAC + 1*H2O
    force(i,68) = force(i,68) + rate_constant(i,127) * number_density(i,166) * number_density(i,9)

    ! k_CH3CCL3_OH_1: CH3CCL3 + OH -> 1*H2O + 3*CL
    force(i,68) = force(i,68) + rate_constant(i,130) * number_density(i,79) * number_density(i,166)

    ! k_C2H6_OH_1: C2H6 + OH -> 1*C2H5O2 + 1*H2O
    force(i,68) = force(i,68) + rate_constant(i,174) * number_density(i,174) * number_density(i,166)

    ! k_H2O_3: H2O -> 1*OH + 1*H
    force(i,68) = force(i,68) - rate_constant(i,192) * number_density(i,68)

    ! k_MACR_OH_1: MACR + OH -> 0.5*MACRO2 + 0.5*H2O + 0.5*MCO3
    force(i,68) = force(i,68) + 0.5*rate_constant(i,220) * number_density(i,157) * number_density(i,166)

    ! k_HBR_OH_1: HBR + OH -> 1*BR + 1*H2O
    force(i,68) = force(i,68) + rate_constant(i,226) * number_density(i,80) * number_density(i,166)

    ! k_HCFC22_OH_1: HCFC22 + OH -> 1*H2O + 1*CL + 1*COF2
    force(i,68) = force(i,68) + rate_constant(i,238) * number_density(i,83) * number_density(i,166)

    ! k_C3H8_OH_1: C3H8 + OH -> 1*C3H7O2 + 1*H2O
    force(i,68) = force(i,68) + rate_constant(i,251) * number_density(i,56) * number_density(i,166)

    ! k_H2_OH_1: H2 + OH -> 1*H2O + 1*H
    force(i,68) = force(i,68) + rate_constant(i,281) * number_density(i,152) * number_density(i,166)

    ! k_H_HO2_2: H + HO2 -> 1*H2O + 1*O
    force(i,68) = force(i,68) + rate_constant(i,282) * number_density(i,48) * number_density(i,192)

    ! k_CH4_OH_1: CH4 + OH -> 1*CH3O2 + 1*H2O
    force(i,68) = force(i,68) + rate_constant(i,284) * number_density(i,45) * number_density(i,166)

    ! k_HO2_OH_1: HO2 + OH -> 1*H2O + 1*O2
    force(i,68) = force(i,68) + rate_constant(i,291) * number_density(i,192) * number_density(i,166)

    ! k_HCOOH_OH_1: HCOOH + OH -> 1*HO2 + 1*CO2 + 1*H2O
    force(i,68) = force(i,68) + rate_constant(i,296) * number_density(i,119) * number_density(i,166)

    ! k_CH3OOH_OH_1: CH3OOH + OH -> 0.7*CH3O2 + 0.3*OH + 0.3*CH2O + 1*H2O
    force(i,68) = force(i,68) + rate_constant(i,348) * number_density(i,135) * number_density(i,166)

    ! k_OH_ROOH_1: OH + ROOH -> 1*RO2 + 1*H2O
    force(i,68) = force(i,68) + rate_constant(i,371) * number_density(i,166) * number_density(i,121)

    ! k_CH3COOOH_OH_1: CH3COOOH + OH -> 0.5*CH3CO3 + 0.5*CH2O + 0.5*CO2 + 1*H2O
    force(i,68) = force(i,68) + rate_constant(i,393) * number_density(i,184) * number_density(i,166)

    ! k_HNO3_OH_1: HNO3 + OH -> 1*NO3 + 1*H2O
    force(i,68) = force(i,68) + rate_constant(i,398) * number_density(i,42) * number_density(i,166)

    ! k_HNO3_OH_2: HNO3 + OH -> 1*NO3 + 1*H2O
    force(i,68) = force(i,68) + rate_constant(i,399) * number_density(i,42) * number_density(i,166)

    ! k_CH2O_OH_1: CH2O + OH -> 1*CO + 1*H2O + 1*H
    force(i,68) = force(i,68) + rate_constant(i,415) * number_density(i,124) * number_density(i,166)

    ! k_CH2BR2_OH_1: CH2BR2 + OH -> 2*BR + 1*H2O
    force(i,68) = force(i,68) + rate_constant(i,455) * number_density(i,169) * number_density(i,166)

    ! k_H2O2_OH_1: H2O2 + OH -> 1*H2O + 1*HO2
    force(i,68) = force(i,68) + rate_constant(i,456) * number_density(i,179) * number_density(i,166)

    ! k_HCL_OH_1: HCL + OH -> 1*H2O + 1*CL
    force(i,68) = force(i,68) + rate_constant(i,458) * number_density(i,180) * number_density(i,166)

    ! k_NH3_OH_1: NH3 + OH -> 1*H2O
    force(i,68) = force(i,68) + rate_constant(i,461) * number_density(i,3) * number_density(i,166)

    ! CL2O2
    force(i,69) = 0

    ! k_CL2O2_M_1: CL2O2 + M -> 2*CLO + 1*M
    force(i,69) = force(i,69) - rate_constant(i,67) * number_density(i,69) * number_density(i,1)

    ! k_CLO_CLO_2: CLO + CLO -> 1*CL2O2
    force(i,69) = force(i,69) + rate_constant(i,262) * number_density(i,86) * number_density(i,86)

    ! k_CL2O2_1: CL2O2 -> 2*CL
    force(i,69) = force(i,69) - rate_constant(i,446) * number_density(i,69)

    ! CL2
    force(i,70) = 0

    ! k_CL2_1: CL2 -> 2*CL
    force(i,70) = force(i,70) - rate_constant(i,219) * number_density(i,70)

    ! k_CLO_CLO_3: CLO + CLO -> 1*CL2 + 1*O2
    force(i,70) = force(i,70) + rate_constant(i,436) * number_density(i,86) * number_density(i,86)

    ! k_CL_CLONO2_1: CL + CLONO2 -> 1*CL2 + 1*NO3
    force(i,70) = force(i,70) + rate_constant(i,480) * number_density(i,100) * number_density(i,74)
  end do
  !$acc end parallel

end subroutine p_force19

subroutine p_force20(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! BRO
    force(i,71) = 0

    ! k_HBR_O1D_1: HBR + O1D -> 1*BRO + 1*H
    force(i,71) = force(i,71) + rate_constant(i,19) * number_density(i,80) * number_density(i,112)

    ! k_BRO_SO_1: BRO + SO -> 1*SO2 + 1*BR
    force(i,71) = force(i,71) - rate_constant(i,58) * number_density(i,71) * number_density(i,32)

    ! k_BRO_1: BRO -> 1*BR + 1*O
    force(i,71) = force(i,71) - rate_constant(i,83) * number_density(i,71)

    ! k_BRONO2_2: BRONO2 -> 1*BRO + 1*NO2
    force(i,71) = force(i,71) + rate_constant(i,94) * number_density(i,72)

    ! k_BRO_NO2_1: BRO + NO2 -> 1*BRONO2
    force(i,71) = force(i,71) - rate_constant(i,184) * number_density(i,71) * number_density(i,54)

    ! k_BRO_OH_1: BRO + OH -> 1*BR + 1*HO2
    force(i,71) = force(i,71) - rate_constant(i,204) * number_density(i,71) * number_density(i,166)

    ! k_BRO_NO_1: BRO + NO -> 1*BR + 1*NO2
    force(i,71) = force(i,71) - rate_constant(i,206) * number_density(i,71) * number_density(i,137)

    ! k_BRO_O_1: BRO + O -> 1*BR + 1*O2
    force(i,71) = force(i,71) - rate_constant(i,223) * number_density(i,71) * number_density(i,187)

    ! k_BRO_BRO_1: BRO + BRO -> 2*BR + 1*O2
    force(i,71) = force(i,71) - rate_constant(i,294) * number_density(i,71) * number_density(i,71)

    ! k_BRO_BRO_1: BRO + BRO -> 2*BR + 1*O2
    force(i,71) = force(i,71) - rate_constant(i,294) * number_density(i,71) * number_density(i,71)

    ! k_BRO_HO2_1: BRO + HO2 -> 1*HOBR + 1*O2
    force(i,71) = force(i,71) - rate_constant(i,299) * number_density(i,71) * number_density(i,192)

    ! k_BR_O3_1: BR + O3 -> 1*BRO + 1*O2
    force(i,71) = force(i,71) + rate_constant(i,317) * number_density(i,90) * number_density(i,171)

    ! k_BRO_CLO_1: BRO + CLO -> 1*BR + 1*CL + 1*O2
    force(i,71) = force(i,71) - rate_constant(i,361) * number_density(i,71) * number_density(i,86)

    ! k_BRONO2_O_1: BRONO2 + O -> 1*BRO + 1*NO3
    force(i,71) = force(i,71) + rate_constant(i,418) * number_density(i,72) * number_density(i,187)

    ! k_BRO_CLO_2: BRO + CLO -> 1*BRCL + 1*O2
    force(i,71) = force(i,71) - rate_constant(i,432) * number_density(i,71) * number_density(i,86)

    ! k_HOBR_O_1: HOBR + O -> 1*BRO + 1*OH
    force(i,71) = force(i,71) + rate_constant(i,447) * number_density(i,186) * number_density(i,187)

    ! k_BRO_CLO_3: BRO + CLO -> 1*BR + 1*OCLO
    force(i,71) = force(i,71) - rate_constant(i,448) * number_density(i,71) * number_density(i,86)

    ! BRONO2
    force(i,72) = 0

    ! k_BRONO2_1: BRONO2 -> 1*BR + 1*NO3
    force(i,72) = force(i,72) - rate_constant(i,56) * number_density(i,72)

    ! k_BRONO2_2: BRONO2 -> 1*BRO + 1*NO2
    force(i,72) = force(i,72) - rate_constant(i,94) * number_density(i,72)

    ! k_BRO_NO2_1: BRO + NO2 -> 1*BRONO2
    force(i,72) = force(i,72) + rate_constant(i,184) * number_density(i,71) * number_density(i,54)

    ! k_BRONO2_O_1: BRONO2 + O -> 1*BRO + 1*NO3
    force(i,72) = force(i,72) - rate_constant(i,418) * number_density(i,72) * number_density(i,187)

    ! ISOPNITB
    force(i,73) = 0

    ! k_ISOPNITB_OH_1: ISOPNITB + OH -> 0.5*HYAC + 0.5*GLYALD + 0.5*NOA + 1*HO2 + 0.5*HONITR
    force(i,73) = force(i,73) - rate_constant(i,79) * number_density(i,73) * number_density(i,166)

    ! k_ISOPBO2_NO_1: ISOPBO2 + NO -> 0.87*HYDRALD + 0.08*ISOPNITB + 0.92*NO2 + 0.92*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    force(i,73) = force(i,73) + 0.08*rate_constant(i,96) * number_density(i,190) * number_density(i,137)

    ! CLONO2
    force(i,74) = 0

    ! k_CLO_NO2_1: CLO + NO2 -> 1*CLONO2
    force(i,74) = force(i,74) + rate_constant(i,214) * number_density(i,86) * number_density(i,54)

    ! k_CLONO2_1: CLONO2 -> 1*CL + 1*NO3
    force(i,74) = force(i,74) - rate_constant(i,290) * number_density(i,74)

    ! k_CLONO2_OH_1: CLONO2 + OH -> 1*HOCL + 1*NO3
    force(i,74) = force(i,74) - rate_constant(i,334) * number_density(i,74) * number_density(i,166)

    ! k_CLONO2_2: CLONO2 -> 1*CLO + 1*NO2
    force(i,74) = force(i,74) - rate_constant(i,406) * number_density(i,74)

    ! k_CLONO2_O_1: CLONO2 + O -> 1*CLO + 1*NO3
    force(i,74) = force(i,74) - rate_constant(i,463) * number_density(i,74) * number_density(i,187)

    ! k_CL_CLONO2_1: CL + CLONO2 -> 1*CL2 + 1*NO3
    force(i,74) = force(i,74) - rate_constant(i,480) * number_density(i,100) * number_density(i,74)

    ! BIGALD1
    force(i,75) = 0
  end do
  !$acc end parallel

end subroutine p_force20

subroutine p_force21(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_XYLENOOH_1: XYLENOOH -> 1*OH + 1*HO2 + 0.34*GLYOXAL + 0.54*CH3COCHO + 0.06*BIGALD1 + 0.2*BIGALD2 + 0.15*BIGALD3 + 0.21*BIGALD4
    force(i,75) = force(i,75) + 0.06*rate_constant(i,20) * number_density(i,92)

    ! k_BENZO2_NO_1: BENZO2 + NO -> 1*NO2 + 1*GLYOXAL + 0.5*BIGALD1 + 1*HO2
    force(i,75) = force(i,75) + 0.5*rate_constant(i,59) * number_density(i,13) * number_density(i,137)

    ! k_NO_TOLO2_1: NO + TOLO2 -> 1*NO2 + 0.6*GLYOXAL + 0.4*CH3COCHO + 1*HO2 + 0.2*BIGALD1 + 0.2*BIGALD2 + 0.2*BIGALD3
    force(i,75) = force(i,75) + 0.2*rate_constant(i,60) * number_density(i,137) * number_density(i,144)

    ! k_BEPOMUC_1: BEPOMUC -> 1*BIGALD1 + 1.5*HO2 + 1.5*CO
    force(i,75) = force(i,75) + rate_constant(i,132) * number_density(i,96)

    ! k_BIGALD1_1: BIGALD1 -> 0.6*MALO2 + 1*HO2
    force(i,75) = force(i,75) - rate_constant(i,255) * number_density(i,75)

    ! k_BENZOOH_1: BENZOOH -> 1*OH + 1*GLYOXAL + 0.5*BIGALD1 + 1*HO2
    force(i,75) = force(i,75) + 0.5*rate_constant(i,275) * number_density(i,91)

    ! k_TOLOOH_1: TOLOOH -> 1*OH + 0.6*GLYOXAL + 0.4*CH3COCHO + 1*HO2 + 0.2*BIGALD1 + 0.2*BIGALD2 + 0.2*BIGALD3
    force(i,75) = force(i,75) + 0.2*rate_constant(i,326) * number_density(i,95)

    ! k_NO_XYLENO2_1: NO + XYLENO2 -> 1*NO2 + 1*HO2 + 0.34*GLYOXAL + 0.54*CH3COCHO + 0.06*BIGALD1 + 0.2*BIGALD2 + 0.15*BIGALD3 + 0.21*BIGALD4
    force(i,75) = force(i,75) + 0.06*rate_constant(i,419) * number_density(i,137) * number_density(i,146)

    ! IEPOX
    force(i,76) = 0

    ! k_IEPOX_OH_1: IEPOX + OH -> 1*XO2
    force(i,76) = force(i,76) - rate_constant(i,190) * number_density(i,76) * number_density(i,166)

    ! k_ISOPOOH_OH_1: ISOPOOH + OH -> 0.4*XO2 + 0.6*IEPOX + 0.6*OH
    force(i,76) = force(i,76) + 0.6*rate_constant(i,482) * number_density(i,138) * number_density(i,166)

    ! HMPROPO2
    force(i,77) = 0

    ! k_HMPROPO2_NO_1: HMPROPO2 + NO -> 1*NO2 + 1*CO2 + 1*HO2 + 1*CH3COCH3
    force(i,77) = force(i,77) - rate_constant(i,156) * number_density(i,77) * number_density(i,137)

    ! k_HMPROPO2_HO2_1: HMPROPO2 + HO2 -> 0.4*OH + 0.4*HO2 + 0.4*CH3COCH3 + 0.4*CO2
    force(i,77) = force(i,77) - rate_constant(i,289) * number_density(i,77) * number_density(i,192)

    ! k_HMPROP_OH_1: HMPROP + OH -> 1*HMPROPO2
    force(i,77) = force(i,77) + rate_constant(i,453) * number_density(i,132) * number_density(i,166)

    ! EOOH
    force(i,78) = 0

    ! k_EO2_HO2_1: EO2 + HO2 -> 1*EOOH
    force(i,78) = force(i,78) + rate_constant(i,152) * number_density(i,163) * number_density(i,192)

    ! k_EOOH_1: EOOH -> 1*EO + 1*OH
    force(i,78) = force(i,78) - rate_constant(i,339) * number_density(i,78)

    ! CH3CCL3
    force(i,79) = 0

    ! k_CH3CCL3_OH_1: CH3CCL3 + OH -> 1*H2O + 3*CL
    force(i,79) = force(i,79) - rate_constant(i,130) * number_density(i,79) * number_density(i,166)

    ! k_CH3CCL3_1: CH3CCL3 -> 3*CL
    force(i,79) = force(i,79) - rate_constant(i,327) * number_density(i,79)

    ! HBR
    force(i,80) = 0

    ! k_HBR_O1D_1: HBR + O1D -> 1*BRO + 1*H
    force(i,80) = force(i,80) - rate_constant(i,19) * number_density(i,80) * number_density(i,112)

    ! k_BR_HO2_1: BR + HO2 -> 1*HBR + 1*O2
    force(i,80) = force(i,80) + rate_constant(i,38) * number_density(i,90) * number_density(i,192)

    ! k_HBR_1: HBR -> 1*BR + 1*H
    force(i,80) = force(i,80) - rate_constant(i,157) * number_density(i,80)

    ! k_HBR_OH_1: HBR + OH -> 1*BR + 1*H2O
    force(i,80) = force(i,80) - rate_constant(i,226) * number_density(i,80) * number_density(i,166)

    ! k_HBR_O1D_2: HBR + O1D -> 1*BR + 1*OH
    force(i,80) = force(i,80) - rate_constant(i,276) * number_density(i,80) * number_density(i,112)

    ! k_BR_CH2O_1: BR + CH2O -> 1*HBR + 1*HO2 + 1*CO
    force(i,80) = force(i,80) + rate_constant(i,298) * number_density(i,90) * number_density(i,124)

    ! k_HBR_O_1: HBR + O -> 1*BR + 1*OH
    force(i,80) = force(i,80) - rate_constant(i,473) * number_density(i,80) * number_density(i,187)

    ! C6H5O2
    force(i,81) = 0

    ! k_ACBZO2_HO2_1: ACBZO2 + HO2 -> 0.4*C6H5O2 + 0.4*OH
    force(i,81) = force(i,81) + 0.4*rate_constant(i,52) * number_density(i,43) * number_density(i,192)

    ! k_C6H5O2_NO_1: C6H5O2 + NO -> 1*PHENO + 1*NO2
    force(i,81) = force(i,81) - rate_constant(i,175) * number_density(i,81) * number_density(i,137)

    ! k_C6H5O2_HO2_1: C6H5O2 + HO2 -> 1*C6H5OOH
    force(i,81) = force(i,81) - rate_constant(i,179) * number_density(i,81) * number_density(i,192)

    ! k_C6H5OOH_OH_1: C6H5OOH + OH -> 1*C6H5O2
    force(i,81) = force(i,81) + rate_constant(i,242) * number_density(i,10) * number_density(i,166)
  end do
  !$acc end parallel

end subroutine p_force21

subroutine p_force22(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_O3_PHENO_1: O3 + PHENO -> 1*C6H5O2
    force(i,81) = force(i,81) + rate_constant(i,249) * number_density(i,171) * number_density(i,182)

    ! k_ACBZO2_NO_1: ACBZO2 + NO -> 1*C6H5O2 + 1*NO2
    force(i,81) = force(i,81) + rate_constant(i,263) * number_density(i,43) * number_density(i,137)

    ! CO2
    force(i,82) = 0

    ! k_CH3CO3_NO_1: CH3CO3 + NO -> 1*CH3O2 + 1*CO2 + 1*NO2
    force(i,82) = force(i,82) + rate_constant(i,25) * number_density(i,49) * number_density(i,137)

    ! k_MPAN_OH_1: MPAN + OH -> 0.5*HYAC + 0.5*NO3 + 0.5*CH2O + 0.5*HO2 + 0.5*CO2
    force(i,82) = force(i,82) + 0.5*rate_constant(i,28) * number_density(i,159) * number_density(i,166)

    ! k_CH3CO3_CH3CO3_1: CH3CO3 + CH3CO3 -> 2*CH3O2 + 2*CO2
    force(i,82) = force(i,82) + 2*rate_constant(i,32) * number_density(i,49) * number_density(i,49)

    ! k_TERPROD2_1: TERPROD2 -> 0.15*RO2 + 0.68*CH2O + 0.8*CO2 + 0.5*CH3COCH3 + 0.65*CH3CO3 + 1.2*HO2 + 1.7*CO
    force(i,82) = force(i,82) + 0.8*rate_constant(i,35) * number_density(i,155)

    ! k_CH4_1: CH4 -> 1.44*H2 + 0.18*CH2O + 0.18*O + 0.33*OH + 0.33*H + 0.44*CO2 + 0.38*CO + 0.05*H2O
    force(i,82) = force(i,82) + 0.44*rate_constant(i,37) * number_density(i,45)

    ! k_TERP2OOH_1: TERP2OOH -> 1*OH + 0.375*CH2O + 0.3*CH3COCH3 + 0.25*CO + 1*CO2 + 1*TERPROD2 + 1*HO2 + 0.25*GLYALD
    force(i,82) = force(i,82) + rate_constant(i,49) * number_density(i,37)

    ! k_CH3CO3_ISOPAO2_1: CH3CO3 + ISOPAO2 -> 1*CH3O2 + 1*HO2 + 1*CH2O + 0.39*MACR + 0.61*MVK + 1*CO2
    force(i,82) = force(i,82) + rate_constant(i,65) * number_density(i,49) * number_density(i,189)

    ! k_CH3CO3_MCO3_1: CH3CO3 + MCO3 -> 2*CO2 + 1*CH3O2 + 1*CH2O + 1*CH3CO3
    force(i,82) = force(i,82) + 2*rate_constant(i,81) * number_density(i,49) * number_density(i,167)

    ! k_CH3O2_MCO3_1: CH3O2 + MCO3 -> 2*CH2O + 1*HO2 + 1*CO2 + 1*CH3CO3
    force(i,82) = force(i,82) + rate_constant(i,84) * number_density(i,191) * number_density(i,167)

    ! k_CH3CO3_CH3O2_1: CH3CO3 + CH3O2 -> 0.9*CH3O2 + 1*CH2O + 0.9*HO2 + 0.9*CO2 + 0.1*CH3COOH
    force(i,82) = force(i,82) + 0.9*rate_constant(i,99) * number_density(i,49) * number_density(i,191)

    ! k_CH3CO3_XO2_1: CH3CO3 + XO2 -> 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 1*CH3O2 + 1*HO2 + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD + 1*CO2
    force(i,82) = force(i,82) + rate_constant(i,106) * number_density(i,49) * number_density(i,153)

    ! k_CH3COOH_OH_1: CH3COOH + OH -> 1*CH3O2 + 1*CO2 + 1*H2O
    force(i,82) = force(i,82) + rate_constant(i,107) * number_density(i,177) * number_density(i,166)

    ! k_NO_TERP2O2_1: NO + TERP2O2 -> 0.1*ONITR + 0.9*NO2 + 0.34*CH2O + 0.27*CH3COCH3 + 0.225*CO + 0.9*CO2 + 0.9*TERPROD2 + 0.9*HO2 + 0.225*GLYALD
    force(i,82) = force(i,82) + 0.9*rate_constant(i,110) * number_density(i,137) * number_density(i,145)

    ! k_GLYALD_OH_1: GLYALD + OH -> 1*HO2 + 0.2*GLYOXAL + 0.8*CH2O + 0.8*CO2
    force(i,82) = force(i,82) + 0.8*rate_constant(i,123) * number_density(i,156) * number_density(i,166)

    ! k_HMPROPO2_NO_1: HMPROPO2 + NO -> 1*NO2 + 1*CO2 + 1*HO2 + 1*CH3COCH3
    force(i,82) = force(i,82) + rate_constant(i,156) * number_density(i,77) * number_density(i,137)

    ! k_C3H6_O3_1: C3H6 + O3 -> 0.5*CH2O + 0.12*HCOOH + 0.12*CH3COOH + 0.5*CH3CHO + 0.56*CO + 0.28*CH3O2 + 0.1*CH4 + 0.2*CO2 + 0.28*HO2 + 0.36*OH
    force(i,82) = force(i,82) + 0.2*rate_constant(i,170) * number_density(i,120) * number_density(i,171)

    ! k_GLYOXAL_OH_1: GLYOXAL + OH -> 1*HO2 + 1*CO + 1*CO2
    force(i,82) = force(i,82) + rate_constant(i,176) * number_density(i,131) * number_density(i,166)

    ! k_MCO3_MCO3_1: MCO3 + MCO3 -> 2*CO2 + 2*CH2O + 2*CH3CO3
    force(i,82) = force(i,82) + 2*rate_constant(i,198) * number_density(i,167) * number_density(i,167)

    ! k_CH3COOOH_1: CH3COOOH -> 1*CH3O2 + 1*OH + 1*CO2
    force(i,82) = force(i,82) + rate_constant(i,199) * number_density(i,184)

    ! k_CO_OH_1: CO + OH -> 1*CO2 + 1*HO2
    force(i,82) = force(i,82) + rate_constant(i,208) * number_density(i,176) * number_density(i,166)

    ! k_BCARY_O3_1: BCARY + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    force(i,82) = force(i,82) + 0.27*rate_constant(i,229) * number_density(i,102) * number_density(i,171)

    ! k_HO2_MCO3_1: HO2 + MCO3 -> 0.15*O3 + 0.15*CH3COOH + 0.4*CH3COOOH + 0.45*OH + 0.45*CO2 + 0.45*CH2O + 0.45*CH3CO3
    force(i,82) = force(i,82) + 0.45*rate_constant(i,269) * number_density(i,192) * number_density(i,167)

    ! k_CO2_1: CO2 -> 1*CO + 1*O
    force(i,82) = force(i,82) - rate_constant(i,274) * number_density(i,82)

    ! k_HMPROPO2_HO2_1: HMPROPO2 + HO2 -> 0.4*OH + 0.4*HO2 + 0.4*CH3COCH3 + 0.4*CO2
    force(i,82) = force(i,82) + 0.4*rate_constant(i,289) * number_density(i,77) * number_density(i,192)

    ! k_HCOOH_OH_1: HCOOH + OH -> 1*HO2 + 1*CO2 + 1*H2O
    force(i,82) = force(i,82) + rate_constant(i,296) * number_density(i,119) * number_density(i,166)

    ! k_MTERP_O3_2: MTERP + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    force(i,82) = force(i,82) + 0.27*rate_constant(i,307) * number_density(i,31) * number_density(i,171)

    ! k_PAN_2: PAN -> 0.6*CH3CO3 + 0.6*NO2 + 0.4*CH3O2 + 0.4*NO3 + 0.4*CO2
    force(i,82) = force(i,82) + 0.4*rate_constant(i,362) * number_density(i,12)

    ! k_CH3COOOH_OH_1: CH3COOOH + OH -> 0.5*CH3CO3 + 0.5*CH2O + 0.5*CO2 + 1*H2O
    force(i,82) = force(i,82) + 0.5*rate_constant(i,393) * number_density(i,184) * number_density(i,166)

    ! k_OH_TERPROD2_1: OH + TERPROD2 -> 0.15*RO2 + 0.68*CH2O + 1.8*CO2 + 0.5*CH3COCH3 + 0.65*CH3CO3 + 0.2*HO2 + 0.7*CO
    force(i,82) = force(i,82) + 1.8*rate_constant(i,397) * number_density(i,166) * number_density(i,155)

    ! k_CH3O2_TERP2O2_1: CH3O2 + TERP2O2 -> 1*TERPROD2 + 0.93*CH2O + 0.25*CH3OH + 1*HO2 + 0.5*CO2 + 0.125*CO + 0.125*GLYALD + 0.15*CH3COCH3
    force(i,82) = force(i,82) + 0.5*rate_constant(i,414) * number_density(i,191) * number_density(i,145)

    ! k_MVK_O3_1: MVK + O3 -> 0.6*CH2O + 0.56*CO + 0.1*CH3CHO + 0.1*CO2 + 0.28*CH3CO3 + 0.5*CH3COCHO + 0.28*HO2 + 0.36*OH + 0.12*HCOOH
    force(i,82) = force(i,82) + 0.1*rate_constant(i,420) * number_density(i,25) * number_density(i,171)
  end do
  !$acc end parallel

end subroutine p_force22

subroutine p_force23(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_CO_OH_2: CO + OH -> 1*CO2 + 1*H
    force(i,82) = force(i,82) + rate_constant(i,429) * number_density(i,176) * number_density(i,166)

    ! HCFC22
    force(i,83) = 0

    ! k_HCFC22_O1D_1: HCFC22 + O1D -> 1*CL + 1*COF2
    force(i,83) = force(i,83) - rate_constant(i,64) * number_density(i,83) * number_density(i,112)

    ! k_HCFC22_1: HCFC22 -> 1*CL + 1*COF2
    force(i,83) = force(i,83) - rate_constant(i,163) * number_density(i,83)

    ! k_HCFC22_OH_1: HCFC22 + OH -> 1*H2O + 1*CL + 1*COF2
    force(i,83) = force(i,83) - rate_constant(i,238) * number_density(i,83) * number_density(i,166)

    ! CHBR3
    force(i,84) = 0

    ! k_CHBR3_1: CHBR3 -> 3*BR
    force(i,84) = force(i,84) - rate_constant(i,33) * number_density(i,84)

    ! k_CHBR3_O1D_1: CHBR3 + O1D -> 3*BR
    force(i,84) = force(i,84) - rate_constant(i,373) * number_density(i,84) * number_density(i,112)

    ! k_CHBR3_OH_1: CHBR3 + OH -> 3*BR
    force(i,84) = force(i,84) - rate_constant(i,460) * number_density(i,84) * number_density(i,166)

    ! k_CHBR3_CL_1: CHBR3 + CL -> 3*BR + 1*HCL
    force(i,84) = force(i,84) - rate_constant(i,462) * number_density(i,84) * number_density(i,100)

    ! ALKO2
    force(i,85) = 0

    ! k_ALKO2_NO_1: ALKO2 + NO -> 0.4*CH3CHO + 0.1*CH2O + 0.25*CH3COCH3 + 1*HO2 + 0.8*MEK + 1*NO2
    force(i,85) = force(i,85) - rate_constant(i,71) * number_density(i,85) * number_density(i,137)

    ! k_ALKOOH_OH_1: ALKOOH + OH -> 1*ALKO2
    force(i,85) = force(i,85) + rate_constant(i,104) * number_density(i,65) * number_density(i,166)

    ! k_ALKO2_NO_2: ALKO2 + NO -> 1*ALKNIT
    force(i,85) = force(i,85) - rate_constant(i,194) * number_density(i,85) * number_density(i,137)

    ! k_BIGALK_OH_1: BIGALK + OH -> 1*ALKO2
    force(i,85) = force(i,85) + rate_constant(i,315) * number_density(i,130) * number_density(i,166)

    ! k_ALKO2_HO2_1: ALKO2 + HO2 -> 1*ALKOOH
    force(i,85) = force(i,85) - rate_constant(i,426) * number_density(i,85) * number_density(i,192)

    ! CLO
    force(i,86) = 0

    ! k_CLO_O_1: CLO + O -> 1*CL + 1*O2
    force(i,86) = force(i,86) - rate_constant(i,21) * number_density(i,86) * number_density(i,187)

    ! k_HOCL_OH_1: HOCL + OH -> 1*H2O + 1*CLO
    force(i,86) = force(i,86) + rate_constant(i,30) * number_density(i,88) * number_density(i,166)

    ! k_CLO_OH_1: CLO + OH -> 1*HCL + 1*O2
    force(i,86) = force(i,86) - rate_constant(i,43) * number_density(i,86) * number_density(i,166)

    ! k_OCLO_SO_1: OCLO + SO -> 1*SO2 + 1*CLO
    force(i,86) = force(i,86) + rate_constant(i,47) * number_density(i,183) * number_density(i,32)

    ! k_CL2O2_M_1: CL2O2 + M -> 2*CLO + 1*M
    force(i,86) = force(i,86) + 2*rate_constant(i,67) * number_density(i,69) * number_density(i,1)

    ! k_CL_HOCL_1: CL + HOCL -> 1*HCL + 1*CLO
    force(i,86) = force(i,86) + rate_constant(i,91) * number_density(i,100) * number_density(i,88)

    ! k_CLO_CLO_1: CLO + CLO -> 2*CL + 1*O2
    force(i,86) = force(i,86) - rate_constant(i,103) * number_density(i,86) * number_density(i,86)

    ! k_CLO_CLO_1: CLO + CLO -> 2*CL + 1*O2
    force(i,86) = force(i,86) - rate_constant(i,103) * number_density(i,86) * number_density(i,86)

    ! k_CLO_SO_1: CLO + SO -> 1*SO2 + 1*CL
    force(i,86) = force(i,86) - rate_constant(i,118) * number_density(i,86) * number_density(i,32)

    ! k_CL_O3_1: CL + O3 -> 1*CLO + 1*O2
    force(i,86) = force(i,86) + rate_constant(i,150) * number_density(i,100) * number_density(i,171)

    ! k_CLO_NO_1: CLO + NO -> 1*NO2 + 1*CL
    force(i,86) = force(i,86) - rate_constant(i,203) * number_density(i,86) * number_density(i,137)

    ! k_CLO_NO2_1: CLO + NO2 -> 1*CLONO2
    force(i,86) = force(i,86) - rate_constant(i,214) * number_density(i,86) * number_density(i,54)

    ! k_HOCL_O_1: HOCL + O -> 1*CLO + 1*OH
    force(i,86) = force(i,86) + rate_constant(i,244) * number_density(i,88) * number_density(i,187)

    ! k_OCLO_1: OCLO -> 1*O + 1*CLO
    force(i,86) = force(i,86) + rate_constant(i,256) * number_density(i,183)

    ! k_CLO_CLO_2: CLO + CLO -> 1*CL2O2
    force(i,86) = force(i,86) - rate_constant(i,262) * number_density(i,86) * number_density(i,86)

    ! k_CLO_CLO_2: CLO + CLO -> 1*CL2O2
    force(i,86) = force(i,86) - rate_constant(i,262) * number_density(i,86) * number_density(i,86)

    ! k_CLO_OH_2: CLO + OH -> 1*CL + 1*HO2
    force(i,86) = force(i,86) - rate_constant(i,305) * number_density(i,86) * number_density(i,166)
  end do
  !$acc end parallel

end subroutine p_force23

subroutine p_force24(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_HCL_O1D_2: HCL + O1D -> 1*CLO + 1*H
    force(i,86) = force(i,86) + rate_constant(i,344) * number_density(i,180) * number_density(i,112)

    ! k_BRO_CLO_1: BRO + CLO -> 1*BR + 1*CL + 1*O2
    force(i,86) = force(i,86) - rate_constant(i,361) * number_density(i,71) * number_density(i,86)

    ! k_CLO_1: CLO -> 1*CL + 1*O
    force(i,86) = force(i,86) - rate_constant(i,380) * number_density(i,86)

    ! k_CLO_HO2_1: CLO + HO2 -> 1*O2 + 1*HOCL
    force(i,86) = force(i,86) - rate_constant(i,402) * number_density(i,86) * number_density(i,192)

    ! k_CLONO2_2: CLONO2 -> 1*CLO + 1*NO2
    force(i,86) = force(i,86) + rate_constant(i,406) * number_density(i,74)

    ! k_BRO_CLO_2: BRO + CLO -> 1*BRCL + 1*O2
    force(i,86) = force(i,86) - rate_constant(i,432) * number_density(i,71) * number_density(i,86)

    ! k_CLO_CLO_3: CLO + CLO -> 1*CL2 + 1*O2
    force(i,86) = force(i,86) - rate_constant(i,436) * number_density(i,86) * number_density(i,86)

    ! k_CLO_CLO_3: CLO + CLO -> 1*CL2 + 1*O2
    force(i,86) = force(i,86) - rate_constant(i,436) * number_density(i,86) * number_density(i,86)

    ! k_BRO_CLO_3: BRO + CLO -> 1*BR + 1*OCLO
    force(i,86) = force(i,86) - rate_constant(i,448) * number_density(i,71) * number_density(i,86)

    ! k_CLONO2_O_1: CLONO2 + O -> 1*CLO + 1*NO3
    force(i,86) = force(i,86) + rate_constant(i,463) * number_density(i,74) * number_density(i,187)

    ! k_CH3O2_CLO_1: CH3O2 + CLO -> 1*CL + 1*HO2 + 1*CH2O
    force(i,86) = force(i,86) - rate_constant(i,467) * number_density(i,191) * number_density(i,86)

    ! k_CLO_CLO_4: CLO + CLO -> 1*CL + 1*OCLO
    force(i,86) = force(i,86) - rate_constant(i,468) * number_density(i,86) * number_density(i,86)

    ! k_CLO_CLO_4: CLO + CLO -> 1*CL + 1*OCLO
    force(i,86) = force(i,86) - rate_constant(i,468) * number_density(i,86) * number_density(i,86)

    ! k_CL_HO2_2: CL + HO2 -> 1*OH + 1*CLO
    force(i,86) = force(i,86) + rate_constant(i,470) * number_density(i,100) * number_density(i,192)

    ! C2H5O2
    force(i,87) = 0

    ! k_MEK_1: MEK -> 1*CH3CO3 + 1*C2H5O2
    force(i,87) = force(i,87) + rate_constant(i,45) * number_density(i,104)

    ! k_C2H6_OH_1: C2H6 + OH -> 1*C2H5O2 + 1*H2O
    force(i,87) = force(i,87) + rate_constant(i,174) * number_density(i,174) * number_density(i,166)

    ! k_C2H6_CL_1: C2H6 + CL -> 1*HCL + 1*C2H5O2
    force(i,87) = force(i,87) + rate_constant(i,193) * number_density(i,174) * number_density(i,100)

    ! k_C2H5OOH_OH_1: C2H5OOH + OH -> 0.5*C2H5O2 + 0.5*CH3CHO + 0.5*OH
    force(i,87) = force(i,87) + 0.5*rate_constant(i,246) * number_density(i,175) * number_density(i,166)

    ! k_C2H5O2_C2H5O2_1: C2H5O2 + C2H5O2 -> 1.6*CH3CHO + 1.2*HO2 + 0.4*C2H5OH
    force(i,87) = force(i,87) - rate_constant(i,248) * number_density(i,87) * number_density(i,87)

    ! k_C2H5O2_C2H5O2_1: C2H5O2 + C2H5O2 -> 1.6*CH3CHO + 1.2*HO2 + 0.4*C2H5OH
    force(i,87) = force(i,87) - rate_constant(i,248) * number_density(i,87) * number_density(i,87)

    ! k_C2H5O2_NO_1: C2H5O2 + NO -> 1*CH3CHO + 1*HO2 + 1*NO2
    force(i,87) = force(i,87) - rate_constant(i,270) * number_density(i,87) * number_density(i,137)

    ! k_C2H5O2_CH3O2_1: C2H5O2 + CH3O2 -> 0.7*CH2O + 0.8*CH3CHO + 1*HO2 + 0.3*CH3OH + 0.2*C2H5OH
    force(i,87) = force(i,87) - rate_constant(i,277) * number_density(i,87) * number_density(i,191)

    ! k_C2H5O2_HO2_1: C2H5O2 + HO2 -> 1*C2H5OOH + 1*O2
    force(i,87) = force(i,87) - rate_constant(i,343) * number_density(i,87) * number_density(i,192)

    ! HOCL
    force(i,88) = 0

    ! k_HOCL_OH_1: HOCL + OH -> 1*H2O + 1*CLO
    force(i,88) = force(i,88) - rate_constant(i,30) * number_density(i,88) * number_density(i,166)

    ! k_CL_HOCL_1: CL + HOCL -> 1*HCL + 1*CLO
    force(i,88) = force(i,88) - rate_constant(i,91) * number_density(i,100) * number_density(i,88)

    ! k_HOCL_O_1: HOCL + O -> 1*CLO + 1*OH
    force(i,88) = force(i,88) - rate_constant(i,244) * number_density(i,88) * number_density(i,187)

    ! k_CLONO2_OH_1: CLONO2 + OH -> 1*HOCL + 1*NO3
    force(i,88) = force(i,88) + rate_constant(i,334) * number_density(i,74) * number_density(i,166)

    ! k_HOCL_1: HOCL -> 1*OH + 1*CL
    force(i,88) = force(i,88) - rate_constant(i,363) * number_density(i,88)

    ! k_CLO_HO2_1: CLO + HO2 -> 1*O2 + 1*HOCL
    force(i,88) = force(i,88) + rate_constant(i,402) * number_density(i,86) * number_density(i,192)

    ! CH3COCH3
    force(i,89) = 0

    ! k_CH3O2_TERPO2_1: CH3O2 + TERPO2 -> 1*TERPROD1 + 0.95*CH2O + 0.25*CH3OH + 1*HO2 + 0.025*CH3COCH3
    force(i,89) = force(i,89) + 0.025*rate_constant(i,3) * number_density(i,191) * number_density(i,147)

    ! k_TERPROD2_1: TERPROD2 -> 0.15*RO2 + 0.68*CH2O + 0.8*CO2 + 0.5*CH3COCH3 + 0.65*CH3CO3 + 1.2*HO2 + 1.7*CO
    force(i,89) = force(i,89) + 0.5*rate_constant(i,35) * number_density(i,155)
  end do
  !$acc end parallel

end subroutine p_force24

subroutine p_force25(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_MBONO3O2_NO3_1: MBONO3O2 + NO3 -> 0.25*HMPROP + 0.25*CH2O + 1.25*NO2 + 0.75*HONITR + 0.75*CH3COCH3 + 0.75*HO2
    force(i,89) = force(i,89) + 0.75*rate_constant(i,44) * number_density(i,123) * number_density(i,165)

    ! k_CH3COCH3_1: CH3COCH3 -> 1*CH3CO3 + 1*CH3O2
    force(i,89) = force(i,89) - rate_constant(i,46) * number_density(i,89)

    ! k_TERP2OOH_1: TERP2OOH -> 1*OH + 0.375*CH2O + 0.3*CH3COCH3 + 0.25*CO + 1*CO2 + 1*TERPROD2 + 1*HO2 + 0.25*GLYALD
    force(i,89) = force(i,89) + 0.3*rate_constant(i,49) * number_density(i,37)

    ! k_C3H7O2_CH3O2_1: C3H7O2 + CH3O2 -> 1*CH2O + 1*HO2 + 0.82*CH3COCH3
    force(i,89) = force(i,89) + 0.82*rate_constant(i,63) * number_density(i,109) * number_density(i,191)

    ! k_CH3COCH3_OH_1: CH3COCH3 + OH -> 1*RO2 + 1*H2O
    force(i,89) = force(i,89) - rate_constant(i,68) * number_density(i,89) * number_density(i,166)

    ! k_CH3COCH3_OH_2: CH3COCH3 + OH -> 1*RO2 + 1*H2O
    force(i,89) = force(i,89) - rate_constant(i,69) * number_density(i,89) * number_density(i,166)

    ! k_ALKO2_NO_1: ALKO2 + NO -> 0.4*CH3CHO + 0.1*CH2O + 0.25*CH3COCH3 + 1*HO2 + 0.8*MEK + 1*NO2
    force(i,89) = force(i,89) + 0.25*rate_constant(i,71) * number_density(i,85) * number_density(i,137)

    ! k_NO_TERP2O2_1: NO + TERP2O2 -> 0.1*ONITR + 0.9*NO2 + 0.34*CH2O + 0.27*CH3COCH3 + 0.225*CO + 0.9*CO2 + 0.9*TERPROD2 + 0.9*HO2 + 0.225*GLYALD
    force(i,89) = force(i,89) + 0.27*rate_constant(i,110) * number_density(i,137) * number_density(i,145)

    ! k_C3H7OOH_1: C3H7OOH -> 0.82*CH3COCH3 + 1*OH + 1*HO2
    force(i,89) = force(i,89) + 0.82*rate_constant(i,115) * number_density(i,20)

    ! k_CH3O2_MBOO2_1: CH3O2 + MBOO2 -> 0.917*CH2O + 1*HO2 + 0.25*CH3OH + 0.333*GLYALD + 0.333*CH3COCH3 + 0.167*HMPROP
    force(i,89) = force(i,89) + 0.333*rate_constant(i,155) * number_density(i,191) * number_density(i,125)

    ! k_HMPROPO2_NO_1: HMPROPO2 + NO -> 1*NO2 + 1*CO2 + 1*HO2 + 1*CH3COCH3
    force(i,89) = force(i,89) + rate_constant(i,156) * number_density(i,77) * number_density(i,137)

    ! k_HONITR_1: HONITR -> 1*NO2 + 0.67*HO2 + 0.33*CH3CHO + 0.33*CH2O + 0.33*CO + 0.33*GLYALD + 0.33*CH3CO3 + 0.17*HYAC + 0.17*CH3COCH3
    force(i,89) = force(i,89) + 0.17*rate_constant(i,171) * number_density(i,134)

    ! k_ENEO2_NO_1: ENEO2 + NO -> 1*CH3CHO + 0.5*CH2O + 0.5*CH3COCH3 + 1*HO2 + 1*NO2
    force(i,89) = force(i,89) + 0.5*rate_constant(i,201) * number_density(i,133) * number_density(i,137)

    ! k_TERPOOH_1: TERPOOH -> 0.4*CH2O + 0.05*CH3COCH3 + 1*TERPROD1 + 1*HO2 + 1*OH
    force(i,89) = force(i,89) + 0.05*rate_constant(i,218) * number_density(i,113)

    ! k_MBO_O3_1: MBO + O3 -> 0.7*HMPROP + 0.64*CO + 0.36*OH + 0.48*HO2 + 0.17*HCOOH + 0.3*CH2O + 0.23*CH3COCH3
    force(i,89) = force(i,89) + 0.23*rate_constant(i,228) * number_density(i,127) * number_density(i,171)

    ! k_BCARY_O3_1: BCARY + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    force(i,89) = force(i,89) + 0.52*rate_constant(i,229) * number_density(i,102) * number_density(i,171)

    ! k_HMPROPO2_HO2_1: HMPROPO2 + HO2 -> 0.4*OH + 0.4*HO2 + 0.4*CH3COCH3 + 0.4*CO2
    force(i,89) = force(i,89) + 0.4*rate_constant(i,289) * number_density(i,77) * number_density(i,192)

    ! k_ALKOOH_1: ALKOOH -> 0.4*CH3CHO + 0.1*CH2O + 0.25*CH3COCH3 + 0.9*HO2 + 0.8*MEK + 1*OH
    force(i,89) = force(i,89) + 0.25*rate_constant(i,300) * number_density(i,65)

    ! k_MTERP_O3_2: MTERP + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    force(i,89) = force(i,89) + 0.52*rate_constant(i,307) * number_density(i,31) * number_density(i,171)

    ! k_MBOO2_NO_1: MBOO2 + NO -> 1*HO2 + 0.67*GLYALD + 0.67*CH3COCH3 + 0.33*HMPROP + 0.33*CH2O + 1*NO2
    force(i,89) = force(i,89) + 0.67*rate_constant(i,308) * number_density(i,125) * number_density(i,137)

    ! k_MBONO3O2_NO_1: MBONO3O2 + NO -> 0.25*HMPROP + 0.25*CH2O + 1.25*NO2 + 0.75*HONITR + 0.75*CH3COCH3 + 0.75*HO2
    force(i,89) = force(i,89) + 0.75*rate_constant(i,313) * number_density(i,123) * number_density(i,137)

    ! k_BIGENE_NO3_1: BIGENE + NO3 -> 1*NO2 + 1*CH3CHO + 0.5*CH2O + 0.5*CH3COCH3
    force(i,89) = force(i,89) + 0.5*rate_constant(i,387) * number_density(i,97) * number_density(i,165)

    ! k_NO_TERPO2_1: NO + TERPO2 -> 0.2*TERPNIT + 0.8*NO2 + 0.32*CH2O + 0.04*CH3COCH3 + 0.8*TERPROD1 + 0.8*HO2
    force(i,89) = force(i,89) + 0.04*rate_constant(i,392) * number_density(i,137) * number_density(i,147)

    ! k_ALKNIT_OH_1: ALKNIT + OH -> 0.4*CH2O + 0.8*CH3CHO + 0.8*CH3COCH3 + 1*NO2
    force(i,89) = force(i,89) + 0.8*rate_constant(i,394) * number_density(i,5) * number_density(i,166)

    ! k_OH_TERPROD2_1: OH + TERPROD2 -> 0.15*RO2 + 0.68*CH2O + 1.8*CO2 + 0.5*CH3COCH3 + 0.65*CH3CO3 + 0.2*HO2 + 0.7*CO
    force(i,89) = force(i,89) + 0.5*rate_constant(i,397) * number_density(i,166) * number_density(i,155)

    ! k_CH3O2_TERP2O2_1: CH3O2 + TERP2O2 -> 1*TERPROD2 + 0.93*CH2O + 0.25*CH3OH + 1*HO2 + 0.5*CO2 + 0.125*CO + 0.125*GLYALD + 0.15*CH3COCH3
    force(i,89) = force(i,89) + 0.15*rate_constant(i,414) * number_density(i,191) * number_density(i,145)

    ! k_ALKNIT_1: ALKNIT -> 1*NO2 + 0.4*CH3CHO + 0.1*CH2O + 0.25*CH3COCH3 + 1*HO2 + 0.8*MEK
    force(i,89) = force(i,89) + 0.25*rate_constant(i,452) * number_density(i,5)

    ! k_C3H7O2_NO_1: C3H7O2 + NO -> 0.82*CH3COCH3 + 1*NO2 + 1*HO2 + 0.27*CH3CHO
    force(i,89) = force(i,89) + 0.82*rate_constant(i,471) * number_density(i,109) * number_density(i,137)

    ! BR
    force(i,90) = 0

    ! k_CH2BR2_CL_1: CH2BR2 + CL -> 2*BR + 1*HCL
    force(i,90) = force(i,90) + 2*rate_constant(i,27) * number_density(i,169) * number_density(i,100)

    ! k_CHBR3_1: CHBR3 -> 3*BR
    force(i,90) = force(i,90) + 3*rate_constant(i,33) * number_density(i,84)

    ! k_BR_HO2_1: BR + HO2 -> 1*HBR + 1*O2
    force(i,90) = force(i,90) - rate_constant(i,38) * number_density(i,90) * number_density(i,192)

    ! k_CH3BR_O1D_1: CH3BR + O1D -> 1*BR
    force(i,90) = force(i,90) + rate_constant(i,48) * number_density(i,94) * number_density(i,112)

    ! k_BRONO2_1: BRONO2 -> 1*BR + 1*NO3
    force(i,90) = force(i,90) + rate_constant(i,56) * number_density(i,72)
  end do
  !$acc end parallel

end subroutine p_force25

subroutine p_force26(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_BRO_SO_1: BRO + SO -> 1*SO2 + 1*BR
    force(i,90) = force(i,90) + rate_constant(i,58) * number_density(i,71) * number_density(i,32)

    ! k_CF2CLBR_1: CF2CLBR -> 1*BR + 1*CL + 1*COF2
    force(i,90) = force(i,90) + rate_constant(i,74) * number_density(i,98)

    ! k_BRO_1: BRO -> 1*BR + 1*O
    force(i,90) = force(i,90) + rate_constant(i,83) * number_density(i,71)

    ! k_CH3BR_OH_1: CH3BR + OH -> 1*BR + 1*H2O + 1*HO2
    force(i,90) = force(i,90) + rate_constant(i,112) * number_density(i,94) * number_density(i,166)

    ! k_CH2BR2_O1D_1: CH2BR2 + O1D -> 2*BR
    force(i,90) = force(i,90) + 2*rate_constant(i,120) * number_density(i,169) * number_density(i,112)

    ! k_CF2CLBR_O1D_1: CF2CLBR + O1D -> 1*CL + 1*BR + 1*COF2
    force(i,90) = force(i,90) + rate_constant(i,128) * number_density(i,98) * number_density(i,112)

    ! k_CH2BR2_1: CH2BR2 -> 2*BR
    force(i,90) = force(i,90) + 2*rate_constant(i,131) * number_density(i,169)

    ! k_HBR_1: HBR -> 1*BR + 1*H
    force(i,90) = force(i,90) + rate_constant(i,157) * number_density(i,80)

    ! k_HOBR_1: HOBR -> 1*BR + 1*OH
    force(i,90) = force(i,90) + rate_constant(i,186) * number_density(i,186)

    ! k_BRO_OH_1: BRO + OH -> 1*BR + 1*HO2
    force(i,90) = force(i,90) + rate_constant(i,204) * number_density(i,71) * number_density(i,166)

    ! k_BRO_NO_1: BRO + NO -> 1*BR + 1*NO2
    force(i,90) = force(i,90) + rate_constant(i,206) * number_density(i,71) * number_density(i,137)

    ! k_BRO_O_1: BRO + O -> 1*BR + 1*O2
    force(i,90) = force(i,90) + rate_constant(i,223) * number_density(i,71) * number_density(i,187)

    ! k_HBR_OH_1: HBR + OH -> 1*BR + 1*H2O
    force(i,90) = force(i,90) + rate_constant(i,226) * number_density(i,80) * number_density(i,166)

    ! k_HBR_O1D_2: HBR + O1D -> 1*BR + 1*OH
    force(i,90) = force(i,90) + rate_constant(i,276) * number_density(i,80) * number_density(i,112)

    ! k_BRO_BRO_1: BRO + BRO -> 2*BR + 1*O2
    force(i,90) = force(i,90) + 2*rate_constant(i,294) * number_density(i,71) * number_density(i,71)

    ! k_BR_CH2O_1: BR + CH2O -> 1*HBR + 1*HO2 + 1*CO
    force(i,90) = force(i,90) - rate_constant(i,298) * number_density(i,90) * number_density(i,124)

    ! k_CF3BR_1: CF3BR -> 1*BR + 1*F + 1*COF2
    force(i,90) = force(i,90) + rate_constant(i,303) * number_density(i,60)

    ! k_BR_O3_1: BR + O3 -> 1*BRO + 1*O2
    force(i,90) = force(i,90) - rate_constant(i,317) * number_density(i,90) * number_density(i,171)

    ! k_BRCL_1: BRCL -> 1*BR + 1*CL
    force(i,90) = force(i,90) + rate_constant(i,342) * number_density(i,173)

    ! k_H2402_O1D_1: H2402 + O1D -> 2*BR + 2*COF2
    force(i,90) = force(i,90) + 2*rate_constant(i,347) * number_density(i,66) * number_density(i,112)

    ! k_BRO_CLO_1: BRO + CLO -> 1*BR + 1*CL + 1*O2
    force(i,90) = force(i,90) + rate_constant(i,361) * number_density(i,71) * number_density(i,86)

    ! k_CHBR3_O1D_1: CHBR3 + O1D -> 3*BR
    force(i,90) = force(i,90) + 3*rate_constant(i,373) * number_density(i,84) * number_density(i,112)

    ! k_CF3BR_O1D_1: CF3BR + O1D -> 1*BR + 1*F + 1*COF2
    force(i,90) = force(i,90) + rate_constant(i,381) * number_density(i,60) * number_density(i,112)

    ! k_CH3BR_CL_1: CH3BR + CL -> 1*HCL + 1*HO2 + 1*BR
    force(i,90) = force(i,90) + rate_constant(i,396) * number_density(i,94) * number_density(i,100)

    ! k_CH3BR_1: CH3BR -> 1*BR + 1*CH3O2
    force(i,90) = force(i,90) + rate_constant(i,401) * number_density(i,94)

    ! k_H2402_1: H2402 -> 2*BR + 2*COF2
    force(i,90) = force(i,90) + 2*rate_constant(i,441) * number_density(i,66)

    ! k_BRO_CLO_3: BRO + CLO -> 1*BR + 1*OCLO
    force(i,90) = force(i,90) + rate_constant(i,448) * number_density(i,71) * number_density(i,86)

    ! k_CH2BR2_OH_1: CH2BR2 + OH -> 2*BR + 1*H2O
    force(i,90) = force(i,90) + 2*rate_constant(i,455) * number_density(i,169) * number_density(i,166)

    ! k_CHBR3_OH_1: CHBR3 + OH -> 3*BR
    force(i,90) = force(i,90) + 3*rate_constant(i,460) * number_density(i,84) * number_density(i,166)

    ! k_CHBR3_CL_1: CHBR3 + CL -> 3*BR + 1*HCL
    force(i,90) = force(i,90) + 3*rate_constant(i,462) * number_density(i,84) * number_density(i,100)

    ! k_HBR_O_1: HBR + O -> 1*BR + 1*OH
    force(i,90) = force(i,90) + rate_constant(i,473) * number_density(i,80) * number_density(i,187)

    ! BENZOOH
    force(i,91) = 0

    ! k_BENZOOH_1: BENZOOH -> 1*OH + 1*GLYOXAL + 0.5*BIGALD1 + 1*HO2
    force(i,91) = force(i,91) - rate_constant(i,275) * number_density(i,91)

    ! k_BENZOOH_OH_1: BENZOOH + OH -> 1*BENZO2
    force(i,91) = force(i,91) - rate_constant(i,382) * number_density(i,91) * number_density(i,166)
  end do
  !$acc end parallel

end subroutine p_force26

subroutine p_force27(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_BENZO2_HO2_1: BENZO2 + HO2 -> 1*BENZOOH
    force(i,91) = force(i,91) + rate_constant(i,391) * number_density(i,13) * number_density(i,192)

    ! XYLENOOH
    force(i,92) = 0

    ! k_XYLENOOH_1: XYLENOOH -> 1*OH + 1*HO2 + 0.34*GLYOXAL + 0.54*CH3COCHO + 0.06*BIGALD1 + 0.2*BIGALD2 + 0.15*BIGALD3 + 0.21*BIGALD4
    force(i,92) = force(i,92) - rate_constant(i,20) * number_density(i,92)

    ! k_OH_XYLENOOH_1: OH + XYLENOOH -> 1*XYLENO2
    force(i,92) = force(i,92) - rate_constant(i,50) * number_density(i,166) * number_density(i,92)

    ! k_HO2_XYLENO2_1: HO2 + XYLENO2 -> 1*XYLENOOH
    force(i,92) = force(i,92) + rate_constant(i,333) * number_density(i,192) * number_density(i,146)

    ! C2H4
    force(i,93) = 0

    ! k_C2H4_CL_1: C2H4 + CL -> 1*CL
    force(i,93) = force(i,93) - rate_constant(i,188) * number_density(i,93) * number_density(i,100)

    ! k_C2H4_OH_1: C2H4 + OH -> 1*EO2
    force(i,93) = force(i,93) - rate_constant(i,319) * number_density(i,93) * number_density(i,166)

    ! k_C2H4_O3_1: C2H4 + O3 -> 0.63*CO + 0.13*OH + 0.13*HO2 + 0.37*HCOOH + 1*CH2O
    force(i,93) = force(i,93) - rate_constant(i,323) * number_density(i,93) * number_density(i,171)

    ! CH3BR
    force(i,94) = 0

    ! k_CH3BR_O1D_1: CH3BR + O1D -> 1*BR
    force(i,94) = force(i,94) - rate_constant(i,48) * number_density(i,94) * number_density(i,112)

    ! k_CH3BR_OH_1: CH3BR + OH -> 1*BR + 1*H2O + 1*HO2
    force(i,94) = force(i,94) - rate_constant(i,112) * number_density(i,94) * number_density(i,166)

    ! k_CH3BR_CL_1: CH3BR + CL -> 1*HCL + 1*HO2 + 1*BR
    force(i,94) = force(i,94) - rate_constant(i,396) * number_density(i,94) * number_density(i,100)

    ! k_CH3BR_1: CH3BR -> 1*BR + 1*CH3O2
    force(i,94) = force(i,94) - rate_constant(i,401) * number_density(i,94)

    ! TOLOOH
    force(i,95) = 0

    ! k_OH_TOLOOH_1: OH + TOLOOH -> 1*TOLO2
    force(i,95) = force(i,95) - rate_constant(i,70) * number_density(i,166) * number_density(i,95)

    ! k_TOLOOH_1: TOLOOH -> 1*OH + 0.6*GLYOXAL + 0.4*CH3COCHO + 1*HO2 + 0.2*BIGALD1 + 0.2*BIGALD2 + 0.2*BIGALD3
    force(i,95) = force(i,95) - rate_constant(i,326) * number_density(i,95)

    ! k_HO2_TOLO2_1: HO2 + TOLO2 -> 1*TOLOOH
    force(i,95) = force(i,95) + rate_constant(i,479) * number_density(i,192) * number_density(i,144)

    ! BEPOMUC
    force(i,96) = 0

    ! k_BEPOMUC_1: BEPOMUC -> 1*BIGALD1 + 1.5*HO2 + 1.5*CO
    force(i,96) = force(i,96) - rate_constant(i,132) * number_density(i,96)

    ! k_BENZENE_OH_1: BENZENE + OH -> 0.53*PHENOL + 0.12*BEPOMUC + 0.65*HO2 + 0.35*BENZO2
    force(i,96) = force(i,96) + 0.12*rate_constant(i,318) * number_density(i,101) * number_density(i,166)

    ! BIGENE
    force(i,97) = 0

    ! k_BIGENE_NO3_1: BIGENE + NO3 -> 1*NO2 + 1*CH3CHO + 0.5*CH2O + 0.5*CH3COCH3
    force(i,97) = force(i,97) - rate_constant(i,387) * number_density(i,97) * number_density(i,165)

    ! k_BIGENE_OH_1: BIGENE + OH -> 1*ENEO2
    force(i,97) = force(i,97) - rate_constant(i,475) * number_density(i,97) * number_density(i,166)

    ! CF2CLBR
    force(i,98) = 0

    ! k_CF2CLBR_1: CF2CLBR -> 1*BR + 1*CL + 1*COF2
    force(i,98) = force(i,98) - rate_constant(i,74) * number_density(i,98)

    ! k_CF2CLBR_O1D_1: CF2CLBR + O1D -> 1*CL + 1*BR + 1*COF2
    force(i,98) = force(i,98) - rate_constant(i,128) * number_density(i,98) * number_density(i,112)

    ! DMS
    force(i,99) = 0

    ! k_DMS_NO3_1: DMS + NO3 -> 1*SO2 + 1*HNO3
    force(i,99) = force(i,99) - rate_constant(i,197) * number_density(i,99) * number_density(i,165)

    ! k_DMS_OH_1: DMS + OH -> 0.5*SO2 + 0.5*HO2
    force(i,99) = force(i,99) - rate_constant(i,227) * number_density(i,99) * number_density(i,166)

    ! k_DMS_OH_2: DMS + OH -> 1*SO2
    force(i,99) = force(i,99) - rate_constant(i,476) * number_density(i,99) * number_density(i,166)

    ! CL
    force(i,100) = 0

    ! k_CFC113_O1D_1: CFC113 + O1D -> 3*CL
    force(i,100) = force(i,100) + 3*rate_constant(i,13) * number_density(i,52) * number_density(i,112)

    ! k_HCFC142B_OH_1: HCFC142B + OH -> 1*CL + 1*COF2
    force(i,100) = force(i,100) + rate_constant(i,14) * number_density(i,172) * number_density(i,166)
  end do
  !$acc end parallel

end subroutine p_force27

subroutine p_force28(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_CFC114_O1D_1: CFC114 + O1D -> 2*CL + 2*COF2
    force(i,100) = force(i,100) + 2*rate_constant(i,18) * number_density(i,62) * number_density(i,112)

    ! k_CLO_O_1: CLO + O -> 1*CL + 1*O2
    force(i,100) = force(i,100) + rate_constant(i,21) * number_density(i,86) * number_density(i,187)

    ! k_CH4_CL_1: CH4 + CL -> 1*CH3O2 + 1*HCL
    force(i,100) = force(i,100) - rate_constant(i,23) * number_density(i,45) * number_density(i,100)

    ! k_CH2BR2_CL_1: CH2BR2 + CL -> 2*BR + 1*HCL
    force(i,100) = force(i,100) - rate_constant(i,27) * number_density(i,169) * number_density(i,100)

    ! k_HCL_O1D_1: HCL + O1D -> 1*CL + 1*OH
    force(i,100) = force(i,100) + rate_constant(i,53) * number_density(i,180) * number_density(i,112)

    ! k_HCFC22_O1D_1: HCFC22 + O1D -> 1*CL + 1*COF2
    force(i,100) = force(i,100) + rate_constant(i,64) * number_density(i,83) * number_density(i,112)

    ! k_CF2CLBR_1: CF2CLBR -> 1*BR + 1*CL + 1*COF2
    force(i,100) = force(i,100) + rate_constant(i,74) * number_density(i,98)

    ! k_CL_HOCL_1: CL + HOCL -> 1*HCL + 1*CLO
    force(i,100) = force(i,100) - rate_constant(i,91) * number_density(i,100) * number_density(i,88)

    ! k_CH3CL_OH_1: CH3CL + OH -> 1*CL + 1*H2O + 1*HO2
    force(i,100) = force(i,100) + rate_constant(i,92) * number_density(i,53) * number_density(i,166)

    ! k_CH3CL_CL_1: CH3CL + CL -> 1*HO2 + 1*CO + 2*HCL
    force(i,100) = force(i,100) - rate_constant(i,102) * number_density(i,53) * number_density(i,100)

    ! k_CLO_CLO_1: CLO + CLO -> 2*CL + 1*O2
    force(i,100) = force(i,100) + 2*rate_constant(i,103) * number_density(i,86) * number_density(i,86)

    ! k_CCL4_1: CCL4 -> 4*CL
    force(i,100) = force(i,100) + 4*rate_constant(i,116) * number_density(i,59)

    ! k_CLO_SO_1: CLO + SO -> 1*SO2 + 1*CL
    force(i,100) = force(i,100) + rate_constant(i,118) * number_density(i,86) * number_density(i,32)

    ! k_CF2CLBR_O1D_1: CF2CLBR + O1D -> 1*CL + 1*BR + 1*COF2
    force(i,100) = force(i,100) + rate_constant(i,128) * number_density(i,98) * number_density(i,112)

    ! k_CH3CCL3_OH_1: CH3CCL3 + OH -> 1*H2O + 3*CL
    force(i,100) = force(i,100) + 3*rate_constant(i,130) * number_density(i,79) * number_density(i,166)

    ! k_HCFC141B_O1D_1: HCFC141B + O1D -> 1*CL + 1*COFCL
    force(i,100) = force(i,100) + rate_constant(i,137) * number_density(i,106) * number_density(i,112)

    ! k_CL_O3_1: CL + O3 -> 1*CLO + 1*O2
    force(i,100) = force(i,100) - rate_constant(i,150) * number_density(i,100) * number_density(i,171)

    ! k_HCFC22_1: HCFC22 -> 1*CL + 1*COF2
    force(i,100) = force(i,100) + rate_constant(i,163) * number_density(i,83)

    ! k_CL_H2_1: CL + H2 -> 1*HCL + 1*H
    force(i,100) = force(i,100) - rate_constant(i,166) * number_density(i,100) * number_density(i,152)

    ! k_C2H6_CL_1: C2H6 + CL -> 1*HCL + 1*C2H5O2
    force(i,100) = force(i,100) - rate_constant(i,193) * number_density(i,174) * number_density(i,100)

    ! k_HCFC141B_1: HCFC141B -> 2*CL
    force(i,100) = force(i,100) + 2*rate_constant(i,200) * number_density(i,106)

    ! k_CLO_NO_1: CLO + NO -> 1*NO2 + 1*CL
    force(i,100) = force(i,100) + rate_constant(i,203) * number_density(i,86) * number_density(i,137)

    ! k_CL2_1: CL2 -> 2*CL
    force(i,100) = force(i,100) + 2*rate_constant(i,219) * number_density(i,70)

    ! k_CFC12_O1D_1: CFC12 + O1D -> 2*CL + 1*COF2
    force(i,100) = force(i,100) + 2*rate_constant(i,222) * number_density(i,64) * number_density(i,112)

    ! k_HCFC142B_1: HCFC142B -> 1*CL + 1*COF2
    force(i,100) = force(i,100) + rate_constant(i,230) * number_density(i,172)

    ! k_HCFC22_OH_1: HCFC22 + OH -> 1*H2O + 1*CL + 1*COF2
    force(i,100) = force(i,100) + rate_constant(i,238) * number_density(i,83) * number_density(i,166)

    ! k_CFC115_O1D_1: CFC115 + O1D -> 1*CL + 1*F + 2*COF2
    force(i,100) = force(i,100) + rate_constant(i,253) * number_density(i,63) * number_density(i,112)

    ! k_CL_HO2_1: CL + HO2 -> 1*HCL + 1*O2
    force(i,100) = force(i,100) - rate_constant(i,264) * number_density(i,100) * number_density(i,192)

    ! k_CFC115_1: CFC115 -> 1*CL + 1*F + 2*COF2
    force(i,100) = force(i,100) + rate_constant(i,280) * number_density(i,63)

    ! k_CFC11_1: CFC11 -> 3*CL
    force(i,100) = force(i,100) + 3*rate_constant(i,285) * number_density(i,61)

    ! k_CLONO2_1: CLONO2 -> 1*CL + 1*NO3
    force(i,100) = force(i,100) + rate_constant(i,290) * number_density(i,74)

    ! k_HCL_O_1: HCL + O -> 1*CL + 1*OH
    force(i,100) = force(i,100) + rate_constant(i,293) * number_density(i,180) * number_density(i,187)

    ! k_CLO_OH_2: CLO + OH -> 1*CL + 1*HO2
    force(i,100) = force(i,100) + rate_constant(i,305) * number_density(i,86) * number_density(i,166)

    ! k_CL_H2O2_1: CL + H2O2 -> 1*HCL + 1*HO2
    force(i,100) = force(i,100) - rate_constant(i,310) * number_density(i,100) * number_density(i,179)
  end do
  !$acc end parallel

end subroutine p_force28

subroutine p_force29(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_CH3CL_1: CH3CL -> 1*CL + 1*CH3O2
    force(i,100) = force(i,100) + rate_constant(i,320) * number_density(i,53)

    ! k_HCL_1: HCL -> 1*H + 1*CL
    force(i,100) = force(i,100) + rate_constant(i,321) * number_density(i,180)

    ! k_CH3CCL3_1: CH3CCL3 -> 3*CL
    force(i,100) = force(i,100) + 3*rate_constant(i,327) * number_density(i,79)

    ! k_BRCL_1: BRCL -> 1*BR + 1*CL
    force(i,100) = force(i,100) + rate_constant(i,342) * number_density(i,173)

    ! k_CFC114_1: CFC114 -> 2*CL + 2*COF2
    force(i,100) = force(i,100) + 2*rate_constant(i,355) * number_density(i,62)

    ! k_HCFC141B_OH_1: HCFC141B + OH -> 1*CL + 1*COFCL
    force(i,100) = force(i,100) + rate_constant(i,360) * number_density(i,106) * number_density(i,166)

    ! k_BRO_CLO_1: BRO + CLO -> 1*BR + 1*CL + 1*O2
    force(i,100) = force(i,100) + rate_constant(i,361) * number_density(i,71) * number_density(i,86)

    ! k_HOCL_1: HOCL -> 1*OH + 1*CL
    force(i,100) = force(i,100) + rate_constant(i,363) * number_density(i,88)

    ! k_CCL4_O1D_1: CCL4 + O1D -> 4*CL
    force(i,100) = force(i,100) + 4*rate_constant(i,366) * number_density(i,59) * number_density(i,112)

    ! k_CFC12_1: CFC12 -> 2*CL + 1*COF2
    force(i,100) = force(i,100) + 2*rate_constant(i,369) * number_density(i,64)

    ! k_CLO_1: CLO -> 1*CL + 1*O
    force(i,100) = force(i,100) + rate_constant(i,380) * number_density(i,86)

    ! k_CFC113_1: CFC113 -> 3*CL
    force(i,100) = force(i,100) + 3*rate_constant(i,384) * number_density(i,52)

    ! k_CH3BR_CL_1: CH3BR + CL -> 1*HCL + 1*HO2 + 1*BR
    force(i,100) = force(i,100) - rate_constant(i,396) * number_density(i,94) * number_density(i,100)

    ! k_CH2O_CL_1: CH2O + CL -> 1*HCL + 1*HO2 + 1*CO
    force(i,100) = force(i,100) - rate_constant(i,425) * number_density(i,124) * number_density(i,100)

    ! k_CL2O2_1: CL2O2 -> 2*CL
    force(i,100) = force(i,100) + 2*rate_constant(i,446) * number_density(i,69)

    ! k_HCL_OH_1: HCL + OH -> 1*H2O + 1*CL
    force(i,100) = force(i,100) + rate_constant(i,458) * number_density(i,180) * number_density(i,166)

    ! k_CHBR3_CL_1: CHBR3 + CL -> 3*BR + 1*HCL
    force(i,100) = force(i,100) - rate_constant(i,462) * number_density(i,84) * number_density(i,100)

    ! k_HCFC142B_O1D_1: HCFC142B + O1D -> 1*CL + 1*COF2
    force(i,100) = force(i,100) + rate_constant(i,466) * number_density(i,172) * number_density(i,112)

    ! k_CH3O2_CLO_1: CH3O2 + CLO -> 1*CL + 1*HO2 + 1*CH2O
    force(i,100) = force(i,100) + rate_constant(i,467) * number_density(i,191) * number_density(i,86)

    ! k_CLO_CLO_4: CLO + CLO -> 1*CL + 1*OCLO
    force(i,100) = force(i,100) + rate_constant(i,468) * number_density(i,86) * number_density(i,86)

    ! k_CL_HO2_2: CL + HO2 -> 1*OH + 1*CLO
    force(i,100) = force(i,100) - rate_constant(i,470) * number_density(i,100) * number_density(i,192)

    ! k_CFC11_O1D_1: CFC11 + O1D -> 3*CL
    force(i,100) = force(i,100) + 3*rate_constant(i,474) * number_density(i,61) * number_density(i,112)

    ! k_CL_CLONO2_1: CL + CLONO2 -> 1*CL2 + 1*NO3
    force(i,100) = force(i,100) - rate_constant(i,480) * number_density(i,100) * number_density(i,74)

    ! BENZENE
    force(i,101) = 0

    ! k_BENZENE_OH_1: BENZENE + OH -> 0.53*PHENOL + 0.12*BEPOMUC + 0.65*HO2 + 0.35*BENZO2
    force(i,101) = force(i,101) - rate_constant(i,318) * number_density(i,101) * number_density(i,166)

    ! BCARY
    force(i,102) = 0

    ! k_BCARY_NO3_1: BCARY + NO3 -> 1*NTERPO2
    force(i,102) = force(i,102) - rate_constant(i,225) * number_density(i,102) * number_density(i,165)

    ! k_BCARY_O3_1: BCARY + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    force(i,102) = force(i,102) - rate_constant(i,229) * number_density(i,102) * number_density(i,171)

    ! k_BCARY_OH_2: BCARY + OH -> 1*TERPO2
    force(i,102) = force(i,102) - rate_constant(i,232) * number_density(i,102) * number_density(i,166)

    ! XOOH
    force(i,103) = 0

    ! k_XOOH_1: XOOH -> 1*OH
    force(i,103) = force(i,103) - rate_constant(i,177) * number_density(i,103)

    ! k_OH_XOOH_1: OH + XOOH -> 0.5*XO2 + 0.5*OH
    force(i,103) = force(i,103) - rate_constant(i,185) * number_density(i,166) * number_density(i,103)

    ! k_HO2_XO2_1: HO2 + XO2 -> 1*XOOH
    force(i,103) = force(i,103) + rate_constant(i,205) * number_density(i,192) * number_density(i,153)

    ! MEK
    force(i,104) = 0
  end do
  !$acc end parallel

end subroutine p_force29

subroutine p_force30(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_MEK_1: MEK -> 1*CH3CO3 + 1*C2H5O2
    force(i,104) = force(i,104) - rate_constant(i,45) * number_density(i,104)

    ! k_MEK_OH_1: MEK + OH -> 1*MEKO2
    force(i,104) = force(i,104) - rate_constant(i,66) * number_density(i,104) * number_density(i,166)

    ! k_ALKO2_NO_1: ALKO2 + NO -> 0.4*CH3CHO + 0.1*CH2O + 0.25*CH3COCH3 + 1*HO2 + 0.8*MEK + 1*NO2
    force(i,104) = force(i,104) + 0.8*rate_constant(i,71) * number_density(i,85) * number_density(i,137)

    ! k_ALKOOH_1: ALKOOH -> 0.4*CH3CHO + 0.1*CH2O + 0.25*CH3COCH3 + 0.9*HO2 + 0.8*MEK + 1*OH
    force(i,104) = force(i,104) + 0.8*rate_constant(i,300) * number_density(i,65)

    ! k_ALKNIT_1: ALKNIT -> 1*NO2 + 0.4*CH3CHO + 0.1*CH2O + 0.25*CH3COCH3 + 1*HO2 + 0.8*MEK
    force(i,104) = force(i,104) + 0.8*rate_constant(i,452) * number_density(i,5)

    ! BIGALD
    force(i,105) = 0

    ! k_BCARY_O3_1: BCARY + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    force(i,105) = force(i,105) + 0.1*rate_constant(i,229) * number_density(i,102) * number_density(i,171)

    ! k_MTERP_O3_2: MTERP + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    force(i,105) = force(i,105) + 0.1*rate_constant(i,307) * number_density(i,31) * number_density(i,171)

    ! k_BIGALD_1: BIGALD -> 0.45*CO + 0.13*GLYOXAL + 0.56*HO2 + 0.13*CH3CO3 + 0.18*CH3COCHO
    force(i,105) = force(i,105) - rate_constant(i,469) * number_density(i,105)

    ! HCFC141B
    force(i,106) = 0

    ! k_HCFC141B_O1D_1: HCFC141B + O1D -> 1*CL + 1*COFCL
    force(i,106) = force(i,106) - rate_constant(i,137) * number_density(i,106) * number_density(i,112)

    ! k_HCFC141B_1: HCFC141B -> 2*CL
    force(i,106) = force(i,106) - rate_constant(i,200) * number_density(i,106)

    ! k_HCFC141B_OH_1: HCFC141B + OH -> 1*CL + 1*COFCL
    force(i,106) = force(i,106) - rate_constant(i,360) * number_density(i,106) * number_density(i,166)

    ! BZALD
    force(i,107) = 0

    ! k_BZALD_OH_1: BZALD + OH -> 1*ACBZO2
    force(i,107) = force(i,107) - rate_constant(i,57) * number_density(i,107) * number_density(i,166)

    ! k_BZOO_NO_1: BZOO + NO -> 1*BZALD + 1*NO2 + 1*HO2
    force(i,107) = force(i,107) + rate_constant(i,195) * number_density(i,33) * number_density(i,137)

    ! k_BZOOH_1: BZOOH -> 1*BZALD + 1*OH + 1*HO2
    force(i,107) = force(i,107) + rate_constant(i,437) * number_density(i,8)

    ! BIGALD3
    force(i,108) = 0

    ! k_XYLENOOH_1: XYLENOOH -> 1*OH + 1*HO2 + 0.34*GLYOXAL + 0.54*CH3COCHO + 0.06*BIGALD1 + 0.2*BIGALD2 + 0.15*BIGALD3 + 0.21*BIGALD4
    force(i,108) = force(i,108) + 0.15*rate_constant(i,20) * number_density(i,92)

    ! k_NO_TOLO2_1: NO + TOLO2 -> 1*NO2 + 0.6*GLYOXAL + 0.4*CH3COCHO + 1*HO2 + 0.2*BIGALD1 + 0.2*BIGALD2 + 0.2*BIGALD3
    force(i,108) = force(i,108) + 0.2*rate_constant(i,60) * number_density(i,137) * number_density(i,144)

    ! k_BIGALD3_1: BIGALD3 -> 0.6*HO2 + 0.6*CO + 0.6*MDIALO2
    force(i,108) = force(i,108) - rate_constant(i,126) * number_density(i,108)

    ! k_NC4CHO_1: NC4CHO -> 1*BIGALD3 + 1*NO2 + 1*HO2
    force(i,108) = force(i,108) + rate_constant(i,169) * number_density(i,23)

    ! k_TOLOOH_1: TOLOOH -> 1*OH + 0.6*GLYOXAL + 0.4*CH3COCHO + 1*HO2 + 0.2*BIGALD1 + 0.2*BIGALD2 + 0.2*BIGALD3
    force(i,108) = force(i,108) + 0.2*rate_constant(i,326) * number_density(i,95)

    ! k_NO_XYLENO2_1: NO + XYLENO2 -> 1*NO2 + 1*HO2 + 0.34*GLYOXAL + 0.54*CH3COCHO + 0.06*BIGALD1 + 0.2*BIGALD2 + 0.15*BIGALD3 + 0.21*BIGALD4
    force(i,108) = force(i,108) + 0.15*rate_constant(i,419) * number_density(i,137) * number_density(i,146)

    ! k_HPALD_1: HPALD -> 1*BIGALD3 + 1*OH + 1*HO2
    force(i,108) = force(i,108) + rate_constant(i,430) * number_density(i,67)

    ! C3H7O2
    force(i,109) = 0

    ! k_C3H7OOH_OH_1: C3H7OOH + OH -> 1*H2O + 1*C3H7O2
    force(i,109) = force(i,109) + rate_constant(i,4) * number_density(i,20) * number_density(i,166)

    ! k_C3H7O2_CH3O2_1: C3H7O2 + CH3O2 -> 1*CH2O + 1*HO2 + 0.82*CH3COCH3
    force(i,109) = force(i,109) - rate_constant(i,63) * number_density(i,109) * number_density(i,191)

    ! k_C3H7O2_HO2_1: C3H7O2 + HO2 -> 1*C3H7OOH + 1*O2
    force(i,109) = force(i,109) - rate_constant(i,142) * number_density(i,109) * number_density(i,192)

    ! k_C3H8_OH_1: C3H8 + OH -> 1*C3H7O2 + 1*H2O
    force(i,109) = force(i,109) + rate_constant(i,251) * number_density(i,56) * number_density(i,166)

    ! k_C3H7O2_NO_1: C3H7O2 + NO -> 0.82*CH3COCH3 + 1*NO2 + 1*HO2 + 0.27*CH3CHO
    force(i,109) = force(i,109) - rate_constant(i,471) * number_density(i,109) * number_density(i,137)

    ! BIGALD4
    force(i,110) = 0

    ! k_XYLENOOH_1: XYLENOOH -> 1*OH + 1*HO2 + 0.34*GLYOXAL + 0.54*CH3COCHO + 0.06*BIGALD1 + 0.2*BIGALD2 + 0.15*BIGALD3 + 0.21*BIGALD4
    force(i,110) = force(i,110) + 0.21*rate_constant(i,20) * number_density(i,92)

    ! k_BIGALD4_1: BIGALD4 -> 1*HO2 + 1*CO + 1*CH3COCHO + 1*CH3CO3
    force(i,110) = force(i,110) - rate_constant(i,61) * number_density(i,110)
  end do
  !$acc end parallel

end subroutine p_force30

subroutine p_force31(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_NO_XYLENO2_1: NO + XYLENO2 -> 1*NO2 + 1*HO2 + 0.34*GLYOXAL + 0.54*CH3COCHO + 0.06*BIGALD1 + 0.2*BIGALD2 + 0.15*BIGALD3 + 0.21*BIGALD4
    force(i,110) = force(i,110) + 0.21*rate_constant(i,419) * number_density(i,137) * number_density(i,146)

    ! CH3COCHO
    force(i,111) = 0

    ! k_CH3COCHO_1: CH3COCHO -> 1*CH3CO3 + 1*CO + 1*HO2
    force(i,111) = force(i,111) - rate_constant(i,17) * number_density(i,111)

    ! k_XYLENOOH_1: XYLENOOH -> 1*OH + 1*HO2 + 0.34*GLYOXAL + 0.54*CH3COCHO + 0.06*BIGALD1 + 0.2*BIGALD2 + 0.15*BIGALD3 + 0.21*BIGALD4
    force(i,111) = force(i,111) + 0.54*rate_constant(i,20) * number_density(i,92)

    ! k_MACRO2_NO_1: MACRO2 + NO -> 1*NO2 + 0.47*HO2 + 0.25*CH2O + 0.53*GLYALD + 0.25*CH3COCHO + 0.53*CH3CO3 + 0.22*HYAC + 0.22*CO
    force(i,111) = force(i,111) + 0.25*rate_constant(i,40) * number_density(i,188) * number_density(i,137)

    ! k_NO_TOLO2_1: NO + TOLO2 -> 1*NO2 + 0.6*GLYOXAL + 0.4*CH3COCHO + 1*HO2 + 0.2*BIGALD1 + 0.2*BIGALD2 + 0.2*BIGALD3
    force(i,111) = force(i,111) + 0.4*rate_constant(i,60) * number_density(i,137) * number_density(i,144)

    ! k_BIGALD4_1: BIGALD4 -> 1*HO2 + 1*CO + 1*CH3COCHO + 1*CH3CO3
    force(i,111) = force(i,111) + rate_constant(i,61) * number_density(i,110)

    ! k_XYLOLOOH_1: XYLOLOOH -> 1*OH + 0.17*GLYOXAL + 0.51*CH3COCHO + 1*HO2
    force(i,111) = force(i,111) + 0.51*rate_constant(i,86) * number_density(i,26)

    ! k_ISOPBO2_NO_1: ISOPBO2 + NO -> 0.87*HYDRALD + 0.08*ISOPNITB + 0.92*NO2 + 0.92*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    force(i,111) = force(i,111) + 0.05*rate_constant(i,96) * number_density(i,190) * number_density(i,137)

    ! k_MACR_O3_1: MACR + O3 -> 0.12*CH2O + 0.24*OH + 0.65*CO + 0.1*CH3CO3 + 0.88*CH3COCHO + 0.33*HCOOH + 0.14*HO2
    force(i,111) = force(i,111) + 0.88*rate_constant(i,101) * number_density(i,157) * number_density(i,171)

    ! k_CH3CO3_XO2_1: CH3CO3 + XO2 -> 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 1*CH3O2 + 1*HO2 + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD + 1*CO2
    force(i,111) = force(i,111) + 0.25*rate_constant(i,106) * number_density(i,49) * number_density(i,153)

    ! k_NO3_XO2_1: NO3 + XO2 -> 1*NO2 + 1*HO2 + 0.5*CO + 0.25*HYAC + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*GLYALD
    force(i,111) = force(i,111) + 0.25*rate_constant(i,109) * number_density(i,165) * number_density(i,153)

    ! k_CH3COCHO_OH_1: CH3COCHO + OH -> 1*CH3CO3 + 1*CO + 1*H2O
    force(i,111) = force(i,111) - rate_constant(i,122) * number_density(i,111) * number_density(i,166)

    ! k_MACRO2_NO3_1: MACRO2 + NO3 -> 1*NO2 + 0.47*HO2 + 0.25*CH2O + 0.25*CH3COCHO + 0.22*CO + 0.53*GLYALD + 0.22*HYAC + 0.53*CH3CO3
    force(i,111) = force(i,111) + 0.25*rate_constant(i,134) * number_density(i,188) * number_density(i,165)

    ! k_HO2_MDIALO2_1: HO2 + MDIALO2 -> 0.4*OH + 0.33*HO2 + 0.07*CH3COCHO + 0.14*CO + 0.07*CH3O2 + 0.07*GLYOXAL
    force(i,111) = force(i,111) + 0.07*rate_constant(i,161) * number_density(i,192) * number_density(i,164)

    ! k_ISOPBO2_NO3_1: ISOPBO2 + NO3 -> 1*NO2 + 0.95*HYDRALD + 1*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    force(i,111) = force(i,111) + 0.05*rate_constant(i,178) * number_density(i,190) * number_density(i,165)

    ! k_CH3CO3_MACRO2_1: CH3CO3 + MACRO2 -> 0.25*CH3COCHO + 1*CH3O2 + 0.22*CO + 0.47*HO2 + 0.53*GLYALD + 0.22*HYAC + 0.25*CH2O + 0.53*CH3CO3
    force(i,111) = force(i,111) + 0.25*rate_constant(i,235) * number_density(i,49) * number_density(i,188)

    ! k_NO_XO2_1: NO + XO2 -> 1*NO2 + 1*HO2 + 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD
    force(i,111) = force(i,111) + 0.25*rate_constant(i,252) * number_density(i,137) * number_density(i,153)

    ! k_NOA_OH_1: NOA + OH -> 1*NO2 + 1*CH3COCHO
    force(i,111) = force(i,111) + rate_constant(i,311) * number_density(i,27) * number_density(i,166)

    ! k_CH3O2_MACRO2_1: CH3O2 + MACRO2 -> 0.73*HO2 + 0.88*CH2O + 0.11*CO + 0.24*CH3COCHO + 0.26*GLYALD + 0.26*CH3CO3 + 0.25*CH3OH + 0.23*HYAC
    force(i,111) = force(i,111) + 0.24*rate_constant(i,322) * number_density(i,191) * number_density(i,188)

    ! k_TOLOOH_1: TOLOOH -> 1*OH + 0.6*GLYOXAL + 0.4*CH3COCHO + 1*HO2 + 0.2*BIGALD1 + 0.2*BIGALD2 + 0.2*BIGALD3
    force(i,111) = force(i,111) + 0.4*rate_constant(i,326) * number_density(i,95)

    ! k_DICARBO2_NO_1: DICARBO2 + NO -> 1*NO2 + 0.17*HO2 + 0.17*CH3COCHO + 0.17*CO + 0.83*CH3O2
    force(i,111) = force(i,111) + 0.17*rate_constant(i,337) * number_density(i,181) * number_density(i,137)

    ! k_CH3O2_RO2_1: CH3O2 + RO2 -> 0.3*CH3CO3 + 0.8*CH2O + 0.3*HO2 + 0.2*HYAC + 0.5*CH3COCHO + 0.5*CH3OH
    force(i,111) = force(i,111) + 0.5*rate_constant(i,354) * number_density(i,191) * number_density(i,40)

    ! k_DICARBO2_HO2_1: DICARBO2 + HO2 -> 0.4*OH + 0.07*HO2 + 0.07*CH3COCHO + 0.07*CO + 0.33*CH3O2
    force(i,111) = force(i,111) + 0.07*rate_constant(i,370) * number_density(i,181) * number_density(i,192)

    ! k_MDIALO2_NO_1: MDIALO2 + NO -> 1*NO2 + 0.83*HO2 + 0.17*CH3COCHO + 0.35*CO + 0.17*CH3O2 + 0.17*GLYOXAL
    force(i,111) = force(i,111) + 0.17*rate_constant(i,403) * number_density(i,164) * number_density(i,137)

    ! k_NO_XYLOLO2_1: NO + XYLOLO2 -> 1*HO2 + 1*NO2 + 0.17*GLYOXAL + 0.51*CH3COCHO
    force(i,111) = force(i,111) + 0.51*rate_constant(i,404) * number_density(i,137) * number_density(i,148)

    ! k_CH3COCHO_NO3_1: CH3COCHO + NO3 -> 1*HNO3 + 1*CO + 1*CH3CO3
    force(i,111) = force(i,111) - rate_constant(i,405) * number_density(i,111) * number_density(i,165)

    ! k_CH3O2_XO2_1: CH3O2 + XO2 -> 0.3*CH3OH + 0.8*HO2 + 0.8*CH2O + 0.2*CO + 0.1*GLYOXAL + 0.1*CH3COCHO + 0.1*HYAC + 0.1*GLYALD
    force(i,111) = force(i,111) + 0.1*rate_constant(i,410) * number_density(i,191) * number_density(i,153)

    ! k_NO_XYLENO2_1: NO + XYLENO2 -> 1*NO2 + 1*HO2 + 0.34*GLYOXAL + 0.54*CH3COCHO + 0.06*BIGALD1 + 0.2*BIGALD2 + 0.15*BIGALD3 + 0.21*BIGALD4
    force(i,111) = force(i,111) + 0.54*rate_constant(i,419) * number_density(i,137) * number_density(i,146)

    ! k_MVK_O3_1: MVK + O3 -> 0.6*CH2O + 0.56*CO + 0.1*CH3CHO + 0.1*CO2 + 0.28*CH3CO3 + 0.5*CH3COCHO + 0.28*HO2 + 0.36*OH + 0.12*HCOOH
    force(i,111) = force(i,111) + 0.5*rate_constant(i,420) * number_density(i,25) * number_density(i,171)

    ! k_HYAC_OH_1: HYAC + OH -> 1*CH3COCHO + 1*HO2
    force(i,111) = force(i,111) + rate_constant(i,422) * number_density(i,57) * number_density(i,166)

    ! k_BIGALD_1: BIGALD -> 0.45*CO + 0.13*GLYOXAL + 0.56*HO2 + 0.13*CH3CO3 + 0.18*CH3COCHO
    force(i,111) = force(i,111) + 0.18*rate_constant(i,469) * number_density(i,105)

    ! O1D
    force(i,112) = 0

    ! k_N2_O1D_1: N2 + O1D -> 1*O + 1*N2
    force(i,112) = force(i,112) - rate_constant(i,6) * number_density(i,11) * number_density(i,112)
  end do
  !$acc end parallel

end subroutine p_force31

subroutine p_force32(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_CFC113_O1D_1: CFC113 + O1D -> 3*CL
    force(i,112) = force(i,112) - rate_constant(i,13) * number_density(i,52) * number_density(i,112)

    ! k_CFC114_O1D_1: CFC114 + O1D -> 2*CL + 2*COF2
    force(i,112) = force(i,112) - rate_constant(i,18) * number_density(i,62) * number_density(i,112)

    ! k_HBR_O1D_1: HBR + O1D -> 1*BRO + 1*H
    force(i,112) = force(i,112) - rate_constant(i,19) * number_density(i,80) * number_density(i,112)

    ! k_H2O_O1D_1: H2O + O1D -> 2*OH
    force(i,112) = force(i,112) - rate_constant(i,39) * number_density(i,68) * number_density(i,112)

    ! k_CH3BR_O1D_1: CH3BR + O1D -> 1*BR
    force(i,112) = force(i,112) - rate_constant(i,48) * number_density(i,94) * number_density(i,112)

    ! k_HCL_O1D_1: HCL + O1D -> 1*CL + 1*OH
    force(i,112) = force(i,112) - rate_constant(i,53) * number_density(i,180) * number_density(i,112)

    ! k_HCFC22_O1D_1: HCFC22 + O1D -> 1*CL + 1*COF2
    force(i,112) = force(i,112) - rate_constant(i,64) * number_density(i,83) * number_density(i,112)

    ! k_H2O_2: H2O -> 1*H2 + 1*O1D
    force(i,112) = force(i,112) + rate_constant(i,114) * number_density(i,68)

    ! k_CH2BR2_O1D_1: CH2BR2 + O1D -> 2*BR
    force(i,112) = force(i,112) - rate_constant(i,120) * number_density(i,169) * number_density(i,112)

    ! k_CF2CLBR_O1D_1: CF2CLBR + O1D -> 1*CL + 1*BR + 1*COF2
    force(i,112) = force(i,112) - rate_constant(i,128) * number_density(i,98) * number_density(i,112)

    ! k_HCFC141B_O1D_1: HCFC141B + O1D -> 1*CL + 1*COFCL
    force(i,112) = force(i,112) - rate_constant(i,137) * number_density(i,106) * number_density(i,112)

    ! k_CH4_O1D_1: CH4 + O1D -> 1*CH2O + 1*H2
    force(i,112) = force(i,112) - rate_constant(i,141) * number_density(i,45) * number_density(i,112)

    ! k_N2O_1: N2O -> 1*O1D + 1*N2
    force(i,112) = force(i,112) + rate_constant(i,147) * number_density(i,161)

    ! k_N2O_O1D_1: N2O + O1D -> 2*NO
    force(i,112) = force(i,112) - rate_constant(i,180) * number_density(i,161) * number_density(i,112)

    ! k_CFC12_O1D_1: CFC12 + O1D -> 2*CL + 1*COF2
    force(i,112) = force(i,112) - rate_constant(i,222) * number_density(i,64) * number_density(i,112)

    ! k_H2_O1D_1: H2 + O1D -> 1*H + 1*OH
    force(i,112) = force(i,112) - rate_constant(i,237) * number_density(i,152) * number_density(i,112)

    ! k_CFC115_O1D_1: CFC115 + O1D -> 1*CL + 1*F + 2*COF2
    force(i,112) = force(i,112) - rate_constant(i,253) * number_density(i,63) * number_density(i,112)

    ! k_HCN_O1D_1: HCN + O1D -> 1*OH
    force(i,112) = force(i,112) - rate_constant(i,268) * number_density(i,47) * number_density(i,112)

    ! k_HBR_O1D_2: HBR + O1D -> 1*BR + 1*OH
    force(i,112) = force(i,112) - rate_constant(i,276) * number_density(i,80) * number_density(i,112)

    ! k_CH4_O1D_2: CH4 + O1D -> 1*CH2O + 1*H + 1*HO2
    force(i,112) = force(i,112) - rate_constant(i,283) * number_density(i,45) * number_density(i,112)

    ! k_HCL_O1D_2: HCL + O1D -> 1*CLO + 1*H
    force(i,112) = force(i,112) - rate_constant(i,344) * number_density(i,180) * number_density(i,112)

    ! k_H2402_O1D_1: H2402 + O1D -> 2*BR + 2*COF2
    force(i,112) = force(i,112) - rate_constant(i,347) * number_density(i,66) * number_density(i,112)

    ! k_CCL4_O1D_1: CCL4 + O1D -> 4*CL
    force(i,112) = force(i,112) - rate_constant(i,366) * number_density(i,59) * number_density(i,112)

    ! k_CHBR3_O1D_1: CHBR3 + O1D -> 3*BR
    force(i,112) = force(i,112) - rate_constant(i,373) * number_density(i,84) * number_density(i,112)

    ! k_CF3BR_O1D_1: CF3BR + O1D -> 1*BR + 1*F + 1*COF2
    force(i,112) = force(i,112) - rate_constant(i,381) * number_density(i,60) * number_density(i,112)

    ! k_CH4_O1D_3: CH4 + O1D -> 1*CH3O2 + 1*OH
    force(i,112) = force(i,112) - rate_constant(i,386) * number_density(i,45) * number_density(i,112)

    ! k_O1D_O2_1: O1D + O2 -> 1*O + 1*O2
    force(i,112) = force(i,112) - rate_constant(i,395) * number_density(i,112) * number_density(i,41)

    ! k_O3_2: O3 -> 1*O1D + 1*O2
    force(i,112) = force(i,112) + rate_constant(i,417) * number_density(i,171)

    ! k_N2O_O1D_2: N2O + O1D -> 1*N2 + 1*O2
    force(i,112) = force(i,112) - rate_constant(i,443) * number_density(i,161) * number_density(i,112)

    ! k_HCFC142B_O1D_1: HCFC142B + O1D -> 1*CL + 1*COF2
    force(i,112) = force(i,112) - rate_constant(i,466) * number_density(i,172) * number_density(i,112)

    ! k_CFC11_O1D_1: CFC11 + O1D -> 3*CL
    force(i,112) = force(i,112) - rate_constant(i,474) * number_density(i,61) * number_density(i,112)

    ! k_O1D_O3_1: O1D + O3 -> 1*O2
    force(i,112) = force(i,112) - rate_constant(i,487) * number_density(i,112) * number_density(i,171)

    ! TERPOOH
    force(i,113) = 0

    ! k_HO2_TERPO2_1: HO2 + TERPO2 -> 1*TERPOOH
    force(i,113) = force(i,113) + rate_constant(i,145) * number_density(i,192) * number_density(i,147)
  end do
  !$acc end parallel

end subroutine p_force32

subroutine p_force33(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_TERPOOH_1: TERPOOH -> 0.4*CH2O + 0.05*CH3COCH3 + 1*TERPROD1 + 1*HO2 + 1*OH
    force(i,113) = force(i,113) - rate_constant(i,218) * number_density(i,113)

    ! k_OH_TERPOOH_1: OH + TERPOOH -> 1*TERPO2
    force(i,113) = force(i,113) - rate_constant(i,314) * number_density(i,166) * number_density(i,113)

    ! NTERPOOH
    force(i,114) = 0

    ! k_HO2_NTERPO2_1: HO2 + NTERPO2 -> 1*NTERPOOH
    force(i,114) = force(i,114) + rate_constant(i,124) * number_density(i,192) * number_density(i,143)

    ! k_NTERPOOH_1: NTERPOOH -> 1*TERPROD1 + 1*NO2 + 1*OH
    force(i,114) = force(i,114) - rate_constant(i,143) * number_density(i,114)

    ! k_NTERPOOH_OH_1: NTERPOOH + OH -> 1*NTERPO2
    force(i,114) = force(i,114) - rate_constant(i,328) * number_density(i,114) * number_density(i,166)

    ! PHENOOH
    force(i,115) = 0

    ! k_PHENOOH_1: PHENOOH -> 1*OH + 1*HO2 + 0.7*GLYOXAL
    force(i,115) = force(i,115) - rate_constant(i,98) * number_density(i,115)

    ! k_HO2_PHENO2_1: HO2 + PHENO2 -> 1*PHENOOH
    force(i,115) = force(i,115) + rate_constant(i,267) * number_density(i,192) * number_density(i,38)

    ! k_OH_PHENOOH_1: OH + PHENOOH -> 1*PHENO2
    force(i,115) = force(i,115) - rate_constant(i,412) * number_density(i,166) * number_density(i,115)

    ! BIGALD2
    force(i,116) = 0

    ! k_XYLENOOH_1: XYLENOOH -> 1*OH + 1*HO2 + 0.34*GLYOXAL + 0.54*CH3COCHO + 0.06*BIGALD1 + 0.2*BIGALD2 + 0.15*BIGALD3 + 0.21*BIGALD4
    force(i,116) = force(i,116) + 0.2*rate_constant(i,20) * number_density(i,92)

    ! k_NO_TOLO2_1: NO + TOLO2 -> 1*NO2 + 0.6*GLYOXAL + 0.4*CH3COCHO + 1*HO2 + 0.2*BIGALD1 + 0.2*BIGALD2 + 0.2*BIGALD3
    force(i,116) = force(i,116) + 0.2*rate_constant(i,60) * number_density(i,137) * number_density(i,144)

    ! k_TOLOOH_1: TOLOOH -> 1*OH + 0.6*GLYOXAL + 0.4*CH3COCHO + 1*HO2 + 0.2*BIGALD1 + 0.2*BIGALD2 + 0.2*BIGALD3
    force(i,116) = force(i,116) + 0.2*rate_constant(i,326) * number_density(i,95)

    ! k_BIGALD2_1: BIGALD2 -> 0.6*HO2 + 0.6*DICARBO2
    force(i,116) = force(i,116) - rate_constant(i,375) * number_density(i,116)

    ! k_NO_XYLENO2_1: NO + XYLENO2 -> 1*NO2 + 1*HO2 + 0.34*GLYOXAL + 0.54*CH3COCHO + 0.06*BIGALD1 + 0.2*BIGALD2 + 0.15*BIGALD3 + 0.21*BIGALD4
    force(i,116) = force(i,116) + 0.2*rate_constant(i,419) * number_density(i,137) * number_density(i,146)

    ! TOLUENE
    force(i,117) = 0

    ! k_OH_TOLUENE_2: OH + TOLUENE -> 0.18*CRESOL + 0.1*TEPOMUC + 0.07*BZOO + 0.65*TOLO2 + 0.28*HO2
    force(i,117) = force(i,117) - rate_constant(i,435) * number_density(i,166) * number_density(i,117)

    ! ISOPNITA
    force(i,118) = 0

    ! k_ISOPNITA_OH_1: ISOPNITA + OH -> 0.7*HYAC + 0.7*GLYALD + 0.7*NO2 + 0.3*CH2O + 0.3*HONITR + 0.3*HO2
    force(i,118) = force(i,118) - rate_constant(i,364) * number_density(i,118) * number_density(i,166)

    ! k_ISOPAO2_NO_1: ISOPAO2 + NO -> 0.08*ISOPNITA + 0.92*NO2 + 0.36*MACR + 0.56*MVK + 0.92*CH2O + 0.92*HO2
    force(i,118) = force(i,118) + 0.08*rate_constant(i,464) * number_density(i,189) * number_density(i,137)

    ! HCOOH
    force(i,119) = 0

    ! k_C2H2_OH_1: C2H2 + OH -> 0.65*GLYOXAL + 0.65*OH + 0.35*HCOOH + 0.35*HO2 + 0.35*CO
    force(i,119) = force(i,119) + 0.35*rate_constant(i,2) * number_density(i,168) * number_density(i,166)

    ! k_MACR_O3_1: MACR + O3 -> 0.12*CH2O + 0.24*OH + 0.65*CO + 0.1*CH3CO3 + 0.88*CH3COCHO + 0.33*HCOOH + 0.14*HO2
    force(i,119) = force(i,119) + 0.33*rate_constant(i,101) * number_density(i,157) * number_density(i,171)

    ! k_HOCH2OO_NO_1: HOCH2OO + NO -> 1*HCOOH + 1*NO2 + 1*HO2
    force(i,119) = force(i,119) + rate_constant(i,113) * number_density(i,154) * number_density(i,137)

    ! k_C3H6_O3_1: C3H6 + O3 -> 0.5*CH2O + 0.12*HCOOH + 0.12*CH3COOH + 0.5*CH3CHO + 0.56*CO + 0.28*CH3O2 + 0.1*CH4 + 0.2*CO2 + 0.28*HO2 + 0.36*OH
    force(i,119) = force(i,119) + 0.12*rate_constant(i,170) * number_density(i,120) * number_density(i,171)

    ! k_HO2_HOCH2OO_1: HO2 + HOCH2OO -> 1*HCOOH
    force(i,119) = force(i,119) + rate_constant(i,172) * number_density(i,192) * number_density(i,154)

    ! k_MBO_O3_1: MBO + O3 -> 0.7*HMPROP + 0.64*CO + 0.36*OH + 0.48*HO2 + 0.17*HCOOH + 0.3*CH2O + 0.23*CH3COCH3
    force(i,119) = force(i,119) + 0.17*rate_constant(i,228) * number_density(i,127) * number_density(i,171)

    ! k_BCARY_O3_1: BCARY + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    force(i,119) = force(i,119) + 0.05*rate_constant(i,229) * number_density(i,102) * number_density(i,171)

    ! k_HCOOH_OH_1: HCOOH + OH -> 1*HO2 + 1*CO2 + 1*H2O
    force(i,119) = force(i,119) - rate_constant(i,296) * number_density(i,119) * number_density(i,166)

    ! k_MTERP_O3_2: MTERP + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    force(i,119) = force(i,119) + 0.05*rate_constant(i,307) * number_density(i,31) * number_density(i,171)

    ! k_C2H4_O3_1: C2H4 + O3 -> 0.63*CO + 0.13*OH + 0.13*HO2 + 0.37*HCOOH + 1*CH2O
    force(i,119) = force(i,119) + 0.37*rate_constant(i,323) * number_density(i,93) * number_density(i,171)

    ! k_ISOP_O3_2: ISOP + O3 -> 0.3*MACR + 0.2*MVK + 0.11*HCOOH + 0.62*CO + 0.32*OH + 0.37*HO2 + 0.91*CH2O + 0.08*CH3CO3 + 0.13*C3H6 + 0.05*CH3O2
    force(i,119) = force(i,119) + 0.11*rate_constant(i,377) * number_density(i,142) * number_density(i,171)

    ! k_MVK_O3_1: MVK + O3 -> 0.6*CH2O + 0.56*CO + 0.1*CH3CHO + 0.1*CO2 + 0.28*CH3CO3 + 0.5*CH3COCHO + 0.28*HO2 + 0.36*OH + 0.12*HCOOH
    force(i,119) = force(i,119) + 0.12*rate_constant(i,420) * number_density(i,25) * number_density(i,171)
  end do
  !$acc end parallel

end subroutine p_force33

subroutine p_force34(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! C3H6
    force(i,120) = 0

    ! k_MVK_1: MVK -> 0.7*C3H6 + 0.7*CO + 0.3*CH3O2 + 0.3*CH3CO3
    force(i,120) = force(i,120) + 0.7*rate_constant(i,15) * number_density(i,25)

    ! k_C3H6_O3_1: C3H6 + O3 -> 0.5*CH2O + 0.12*HCOOH + 0.12*CH3COOH + 0.5*CH3CHO + 0.56*CO + 0.28*CH3O2 + 0.1*CH4 + 0.2*CO2 + 0.28*HO2 + 0.36*OH
    force(i,120) = force(i,120) - rate_constant(i,170) * number_density(i,120) * number_density(i,171)

    ! k_C3H6_NO3_1: C3H6 + NO3 -> 1*NOA
    force(i,120) = force(i,120) - rate_constant(i,221) * number_density(i,120) * number_density(i,165)

    ! k_C3H6_OH_1: C3H6 + OH -> 1*PO2
    force(i,120) = force(i,120) - rate_constant(i,231) * number_density(i,120) * number_density(i,166)

    ! k_ISOP_O3_2: ISOP + O3 -> 0.3*MACR + 0.2*MVK + 0.11*HCOOH + 0.62*CO + 0.32*OH + 0.37*HO2 + 0.91*CH2O + 0.08*CH3CO3 + 0.13*C3H6 + 0.05*CH3O2
    force(i,120) = force(i,120) + 0.13*rate_constant(i,377) * number_density(i,142) * number_density(i,171)

    ! ROOH
    force(i,121) = 0

    ! k_HO2_RO2_1: HO2 + RO2 -> 0.85*ROOH + 0.15*OH + 0.15*CH2O + 0.15*CH3CO3
    force(i,121) = force(i,121) + 0.85*rate_constant(i,133) * number_density(i,192) * number_density(i,40)

    ! k_ROOH_1: ROOH -> 1*CH3CO3 + 1*CH2O + 1*OH
    force(i,121) = force(i,121) - rate_constant(i,148) * number_density(i,121)

    ! k_OH_ROOH_1: OH + ROOH -> 1*RO2 + 1*H2O
    force(i,121) = force(i,121) - rate_constant(i,371) * number_density(i,166) * number_density(i,121)

    ! CH3OH
    force(i,122) = 0

    ! k_CH3O2_TERPO2_1: CH3O2 + TERPO2 -> 1*TERPROD1 + 0.95*CH2O + 0.25*CH3OH + 1*HO2 + 0.025*CH3COCH3
    force(i,122) = force(i,122) + 0.25*rate_constant(i,3) * number_density(i,191) * number_density(i,147)

    ! k_CH3O2_NTERPO2_1: CH3O2 + NTERPO2 -> 0.5*TERPNIT + 0.75*CH2O + 0.25*CH3OH + 0.5*HO2 + 0.5*TERPROD1 + 0.5*NO2
    force(i,122) = force(i,122) + 0.25*rate_constant(i,135) * number_density(i,191) * number_density(i,143)

    ! k_CH3O2_MBOO2_1: CH3O2 + MBOO2 -> 0.917*CH2O + 1*HO2 + 0.25*CH3OH + 0.333*GLYALD + 0.333*CH3COCH3 + 0.167*HMPROP
    force(i,122) = force(i,122) + 0.25*rate_constant(i,155) * number_density(i,191) * number_density(i,125)

    ! k_CH3O2_ISOPNO3_1: CH3O2 + ISOPNO3 -> 0.8*NC4CHO + 1.2*HO2 + 0.8*CH2O + 0.2*CH3OH + 0.2*NC4CH2OH
    force(i,122) = force(i,122) + 0.2*rate_constant(i,160) * number_density(i,191) * number_density(i,46)

    ! k_CH3O2_ISOPBO2_1: CH3O2 + ISOPBO2 -> 0.25*CH3OH + 1*HO2 + 0.75*CH2O + 0.75*HYDRALD
    force(i,122) = force(i,122) + 0.25*rate_constant(i,167) * number_density(i,191) * number_density(i,190)

    ! k_C2H5O2_CH3O2_1: C2H5O2 + CH3O2 -> 0.7*CH2O + 0.8*CH3CHO + 1*HO2 + 0.3*CH3OH + 0.2*C2H5OH
    force(i,122) = force(i,122) + 0.3*rate_constant(i,277) * number_density(i,87) * number_density(i,191)

    ! k_CH3O2_MACRO2_1: CH3O2 + MACRO2 -> 0.73*HO2 + 0.88*CH2O + 0.11*CO + 0.24*CH3COCHO + 0.26*GLYALD + 0.26*CH3CO3 + 0.25*CH3OH + 0.23*HYAC
    force(i,122) = force(i,122) + 0.25*rate_constant(i,322) * number_density(i,191) * number_density(i,188)

    ! k_CH3O2_RO2_1: CH3O2 + RO2 -> 0.3*CH3CO3 + 0.8*CH2O + 0.3*HO2 + 0.2*HYAC + 0.5*CH3COCHO + 0.5*CH3OH
    force(i,122) = force(i,122) + 0.5*rate_constant(i,354) * number_density(i,191) * number_density(i,40)

    ! k_CH3OH_OH_1: CH3OH + OH -> 1*HO2 + 1*CH2O
    force(i,122) = force(i,122) - rate_constant(i,409) * number_density(i,122) * number_density(i,166)

    ! k_CH3O2_XO2_1: CH3O2 + XO2 -> 0.3*CH3OH + 0.8*HO2 + 0.8*CH2O + 0.2*CO + 0.1*GLYOXAL + 0.1*CH3COCHO + 0.1*HYAC + 0.1*GLYALD
    force(i,122) = force(i,122) + 0.3*rate_constant(i,410) * number_density(i,191) * number_density(i,153)

    ! k_CH3O2_TERP2O2_1: CH3O2 + TERP2O2 -> 1*TERPROD2 + 0.93*CH2O + 0.25*CH3OH + 1*HO2 + 0.5*CO2 + 0.125*CO + 0.125*GLYALD + 0.15*CH3COCH3
    force(i,122) = force(i,122) + 0.25*rate_constant(i,414) * number_density(i,191) * number_density(i,145)

    ! k_CH3O2_ISOPAO2_1: CH3O2 + ISOPAO2 -> 0.25*CH3OH + 1*HO2 + 1.5*CH2O + 0.31*MACR + 0.44*MVK
    force(i,122) = force(i,122) + 0.25*rate_constant(i,434) * number_density(i,191) * number_density(i,189)

    ! k_CH3O2_CH3O2_2: CH3O2 + CH3O2 -> 1*CH2O + 1*CH3OH
    force(i,122) = force(i,122) + rate_constant(i,459) * number_density(i,191) * number_density(i,191)

    ! MBONO3O2
    force(i,123) = 0

    ! k_MBO_NO3_1: MBO + NO3 -> 1*MBONO3O2
    force(i,123) = force(i,123) + rate_constant(i,11) * number_density(i,127) * number_density(i,165)

    ! k_MBONO3O2_NO3_1: MBONO3O2 + NO3 -> 0.25*HMPROP + 0.25*CH2O + 1.25*NO2 + 0.75*HONITR + 0.75*CH3COCH3 + 0.75*HO2
    force(i,123) = force(i,123) - rate_constant(i,44) * number_density(i,123) * number_density(i,165)

    ! k_HO2_MBONO3O2_1: HO2 + MBONO3O2 -> 
    force(i,123) = force(i,123) - rate_constant(i,90) * number_density(i,192) * number_density(i,123)

    ! k_MBONO3O2_NO_1: MBONO3O2 + NO -> 0.25*HMPROP + 0.25*CH2O + 1.25*NO2 + 0.75*HONITR + 0.75*CH3COCH3 + 0.75*HO2
    force(i,123) = force(i,123) - rate_constant(i,313) * number_density(i,123) * number_density(i,137)

    ! CH2O
    force(i,124) = 0

    ! k_CH3O2_TERPO2_1: CH3O2 + TERPO2 -> 1*TERPROD1 + 0.95*CH2O + 0.25*CH3OH + 1*HO2 + 0.025*CH3COCH3
    force(i,124) = force(i,124) + 0.95*rate_constant(i,3) * number_density(i,191) * number_density(i,147)

    ! k_CH2O_O_1: CH2O + O -> 1*HO2 + 1*OH + 1*CO
    force(i,124) = force(i,124) - rate_constant(i,10) * number_density(i,124) * number_density(i,187)

    ! k_EO2_NO_1: EO2 + NO -> 0.5*CH2O + 0.25*HO2 + 0.75*EO + 1*NO2
    force(i,124) = force(i,124) + 0.5*rate_constant(i,16) * number_density(i,163) * number_density(i,137)

    ! k_MPAN_OH_1: MPAN + OH -> 0.5*HYAC + 0.5*NO3 + 0.5*CH2O + 0.5*HO2 + 0.5*CO2
    force(i,124) = force(i,124) + 0.5*rate_constant(i,28) * number_density(i,159) * number_density(i,166)
  end do
  !$acc end parallel

end subroutine p_force34

subroutine p_force35(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_TERPROD2_1: TERPROD2 -> 0.15*RO2 + 0.68*CH2O + 0.8*CO2 + 0.5*CH3COCH3 + 0.65*CH3CO3 + 1.2*HO2 + 1.7*CO
    force(i,124) = force(i,124) + 0.68*rate_constant(i,35) * number_density(i,155)

    ! k_CH4_1: CH4 -> 1.44*H2 + 0.18*CH2O + 0.18*O + 0.33*OH + 0.33*H + 0.44*CO2 + 0.38*CO + 0.05*H2O
    force(i,124) = force(i,124) + 0.18*rate_constant(i,37) * number_density(i,45)

    ! k_MACRO2_NO_1: MACRO2 + NO -> 1*NO2 + 0.47*HO2 + 0.25*CH2O + 0.53*GLYALD + 0.25*CH3COCHO + 0.53*CH3CO3 + 0.22*HYAC + 0.22*CO
    force(i,124) = force(i,124) + 0.25*rate_constant(i,40) * number_density(i,188) * number_density(i,137)

    ! k_MBONO3O2_NO3_1: MBONO3O2 + NO3 -> 0.25*HMPROP + 0.25*CH2O + 1.25*NO2 + 0.75*HONITR + 0.75*CH3COCH3 + 0.75*HO2
    force(i,124) = force(i,124) + 0.25*rate_constant(i,44) * number_density(i,123) * number_density(i,165)

    ! k_TERP2OOH_1: TERP2OOH -> 1*OH + 0.375*CH2O + 0.3*CH3COCH3 + 0.25*CO + 1*CO2 + 1*TERPROD2 + 1*HO2 + 0.25*GLYALD
    force(i,124) = force(i,124) + 0.375*rate_constant(i,49) * number_density(i,37)

    ! k_C3H7O2_CH3O2_1: C3H7O2 + CH3O2 -> 1*CH2O + 1*HO2 + 0.82*CH3COCH3
    force(i,124) = force(i,124) + rate_constant(i,63) * number_density(i,109) * number_density(i,191)

    ! k_CH3CO3_ISOPAO2_1: CH3CO3 + ISOPAO2 -> 1*CH3O2 + 1*HO2 + 1*CH2O + 0.39*MACR + 0.61*MVK + 1*CO2
    force(i,124) = force(i,124) + rate_constant(i,65) * number_density(i,49) * number_density(i,189)

    ! k_ALKO2_NO_1: ALKO2 + NO -> 0.4*CH3CHO + 0.1*CH2O + 0.25*CH3COCH3 + 1*HO2 + 0.8*MEK + 1*NO2
    force(i,124) = force(i,124) + 0.1*rate_constant(i,71) * number_density(i,85) * number_density(i,137)

    ! k_CH3CO3_MCO3_1: CH3CO3 + MCO3 -> 2*CO2 + 1*CH3O2 + 1*CH2O + 1*CH3CO3
    force(i,124) = force(i,124) + rate_constant(i,81) * number_density(i,49) * number_density(i,167)

    ! k_CH3O2_MCO3_1: CH3O2 + MCO3 -> 2*CH2O + 1*HO2 + 1*CO2 + 1*CH3CO3
    force(i,124) = force(i,124) + 2*rate_constant(i,84) * number_density(i,191) * number_density(i,167)

    ! k_CH2O_1: CH2O -> 1*CO + 1*H2
    force(i,124) = force(i,124) - rate_constant(i,93) * number_density(i,124)

    ! k_CH3CO3_CH3O2_1: CH3CO3 + CH3O2 -> 0.9*CH3O2 + 1*CH2O + 0.9*HO2 + 0.9*CO2 + 0.1*CH3COOH
    force(i,124) = force(i,124) + rate_constant(i,99) * number_density(i,49) * number_density(i,191)

    ! k_MACR_O3_1: MACR + O3 -> 0.12*CH2O + 0.24*OH + 0.65*CO + 0.1*CH3CO3 + 0.88*CH3COCHO + 0.33*HCOOH + 0.14*HO2
    force(i,124) = force(i,124) + 0.12*rate_constant(i,101) * number_density(i,157) * number_density(i,171)

    ! k_CH3CO3_XO2_1: CH3CO3 + XO2 -> 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 1*CH3O2 + 1*HO2 + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD + 1*CO2
    force(i,124) = force(i,124) + 0.25*rate_constant(i,106) * number_density(i,49) * number_density(i,153)

    ! k_NO_TERP2O2_1: NO + TERP2O2 -> 0.1*ONITR + 0.9*NO2 + 0.34*CH2O + 0.27*CH3COCH3 + 0.225*CO + 0.9*CO2 + 0.9*TERPROD2 + 0.9*HO2 + 0.225*GLYALD
    force(i,124) = force(i,124) + 0.34*rate_constant(i,110) * number_density(i,137) * number_density(i,145)

    ! k_NOA_1: NOA -> 1*NO2 + 1*CH2O + 1*CH3CO3
    force(i,124) = force(i,124) + rate_constant(i,119) * number_density(i,27)

    ! k_GLYALD_OH_1: GLYALD + OH -> 1*HO2 + 0.2*GLYOXAL + 0.8*CH2O + 0.8*CO2
    force(i,124) = force(i,124) + 0.8*rate_constant(i,123) * number_density(i,156) * number_density(i,166)

    ! k_HO2_RO2_1: HO2 + RO2 -> 0.85*ROOH + 0.15*OH + 0.15*CH2O + 0.15*CH3CO3
    force(i,124) = force(i,124) + 0.15*rate_constant(i,133) * number_density(i,192) * number_density(i,40)

    ! k_MACRO2_NO3_1: MACRO2 + NO3 -> 1*NO2 + 0.47*HO2 + 0.25*CH2O + 0.25*CH3COCHO + 0.22*CO + 0.53*GLYALD + 0.22*HYAC + 0.53*CH3CO3
    force(i,124) = force(i,124) + 0.25*rate_constant(i,134) * number_density(i,188) * number_density(i,165)

    ! k_CH3O2_NTERPO2_1: CH3O2 + NTERPO2 -> 0.5*TERPNIT + 0.75*CH2O + 0.25*CH3OH + 0.5*HO2 + 0.5*TERPROD1 + 0.5*NO2
    force(i,124) = force(i,124) + 0.75*rate_constant(i,135) * number_density(i,191) * number_density(i,143)

    ! k_CH4_O1D_1: CH4 + O1D -> 1*CH2O + 1*H2
    force(i,124) = force(i,124) + rate_constant(i,141) * number_density(i,45) * number_density(i,112)

    ! k_OH_PAN_1: OH + PAN -> 1*CH2O + 1*NO3
    force(i,124) = force(i,124) + rate_constant(i,144) * number_density(i,166) * number_density(i,12)

    ! k_MCO3_NO3_1: MCO3 + NO3 -> 1*NO2 + 1*CH2O + 1*CH3CO3
    force(i,124) = force(i,124) + rate_constant(i,146) * number_density(i,167) * number_density(i,165)

    ! k_ROOH_1: ROOH -> 1*CH3CO3 + 1*CH2O + 1*OH
    force(i,124) = force(i,124) + rate_constant(i,148) * number_density(i,121)

    ! k_CH2O_2: CH2O -> 1*CO + 2*H
    force(i,124) = force(i,124) - rate_constant(i,149) * number_density(i,124)

    ! k_CH3O2_MBOO2_1: CH3O2 + MBOO2 -> 0.917*CH2O + 1*HO2 + 0.25*CH3OH + 0.333*GLYALD + 0.333*CH3COCH3 + 0.167*HMPROP
    force(i,124) = force(i,124) + 0.917*rate_constant(i,155) * number_density(i,191) * number_density(i,125)

    ! k_CH3O2_ISOPNO3_1: CH3O2 + ISOPNO3 -> 0.8*NC4CHO + 1.2*HO2 + 0.8*CH2O + 0.2*CH3OH + 0.2*NC4CH2OH
    force(i,124) = force(i,124) + 0.8*rate_constant(i,160) * number_density(i,191) * number_density(i,46)

    ! k_POOH_1: POOH -> 1*CH3CHO + 1*CH2O + 1*HO2 + 1*OH
    force(i,124) = force(i,124) + rate_constant(i,162) * number_density(i,9)

    ! k_CH3O2_ISOPBO2_1: CH3O2 + ISOPBO2 -> 0.25*CH3OH + 1*HO2 + 0.75*CH2O + 0.75*HYDRALD
    force(i,124) = force(i,124) + 0.75*rate_constant(i,167) * number_density(i,191) * number_density(i,190)

    ! k_C3H6_O3_1: C3H6 + O3 -> 0.5*CH2O + 0.12*HCOOH + 0.12*CH3COOH + 0.5*CH3CHO + 0.56*CO + 0.28*CH3O2 + 0.1*CH4 + 0.2*CO2 + 0.28*HO2 + 0.36*OH
    force(i,124) = force(i,124) + 0.5*rate_constant(i,170) * number_density(i,120) * number_density(i,171)

    ! k_HONITR_1: HONITR -> 1*NO2 + 0.67*HO2 + 0.33*CH3CHO + 0.33*CH2O + 0.33*CO + 0.33*GLYALD + 0.33*CH3CO3 + 0.17*HYAC + 0.17*CH3COCH3
    force(i,124) = force(i,124) + 0.33*rate_constant(i,171) * number_density(i,134)

    ! k_MCO3_MCO3_1: MCO3 + MCO3 -> 2*CO2 + 2*CH2O + 2*CH3CO3
    force(i,124) = force(i,124) + 2*rate_constant(i,198) * number_density(i,167) * number_density(i,167)

    ! k_ENEO2_NO_1: ENEO2 + NO -> 1*CH3CHO + 0.5*CH2O + 0.5*CH3COCH3 + 1*HO2 + 1*NO2
    force(i,124) = force(i,124) + 0.5*rate_constant(i,201) * number_density(i,133) * number_density(i,137)

    ! k_HYAC_1: HYAC -> 1*CH3CO3 + 1*HO2 + 1*CH2O
    force(i,124) = force(i,124) + rate_constant(i,215) * number_density(i,57)
  end do
  !$acc end parallel

end subroutine p_force35

subroutine p_force36(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_TERPOOH_1: TERPOOH -> 0.4*CH2O + 0.05*CH3COCH3 + 1*TERPROD1 + 1*HO2 + 1*OH
    force(i,124) = force(i,124) + 0.4*rate_constant(i,218) * number_density(i,113)

    ! k_MBO_O3_1: MBO + O3 -> 0.7*HMPROP + 0.64*CO + 0.36*OH + 0.48*HO2 + 0.17*HCOOH + 0.3*CH2O + 0.23*CH3COCH3
    force(i,124) = force(i,124) + 0.3*rate_constant(i,228) * number_density(i,127) * number_density(i,171)

    ! k_BCARY_O3_1: BCARY + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    force(i,124) = force(i,124) + 0.34*rate_constant(i,229) * number_density(i,102) * number_density(i,171)

    ! k_ISOPOOH_1: ISOPOOH -> 0.402*MVK + 0.288*MACR + 0.69*CH2O + 1*HO2
    force(i,124) = force(i,124) + 0.69*rate_constant(i,233) * number_density(i,138)

    ! k_CH3CO3_MACRO2_1: CH3CO3 + MACRO2 -> 0.25*CH3COCHO + 1*CH3O2 + 0.22*CO + 0.47*HO2 + 0.53*GLYALD + 0.22*HYAC + 0.25*CH2O + 0.53*CH3CO3
    force(i,124) = force(i,124) + 0.25*rate_constant(i,235) * number_density(i,49) * number_density(i,188)

    ! k_NO_XO2_1: NO + XO2 -> 1*NO2 + 1*HO2 + 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD
    force(i,124) = force(i,124) + 0.25*rate_constant(i,252) * number_density(i,137) * number_density(i,153)

    ! k_HO2_MCO3_1: HO2 + MCO3 -> 0.15*O3 + 0.15*CH3COOH + 0.4*CH3COOOH + 0.45*OH + 0.45*CO2 + 0.45*CH2O + 0.45*CH3CO3
    force(i,124) = force(i,124) + 0.45*rate_constant(i,269) * number_density(i,192) * number_density(i,167)

    ! k_MACR_2: MACR -> 1.34*HO2 + 0.66*MCO3 + 1.34*CH2O + 1.34*CH3CO3
    force(i,124) = force(i,124) + 1.34*rate_constant(i,272) * number_density(i,157)

    ! k_C2H5O2_CH3O2_1: C2H5O2 + CH3O2 -> 0.7*CH2O + 0.8*CH3CHO + 1*HO2 + 0.3*CH3OH + 0.2*C2H5OH
    force(i,124) = force(i,124) + 0.7*rate_constant(i,277) * number_density(i,87) * number_density(i,191)

    ! k_CH4_O1D_2: CH4 + O1D -> 1*CH2O + 1*H + 1*HO2
    force(i,124) = force(i,124) + rate_constant(i,283) * number_density(i,45) * number_density(i,112)

    ! k_BR_CH2O_1: BR + CH2O -> 1*HBR + 1*HO2 + 1*CO
    force(i,124) = force(i,124) - rate_constant(i,298) * number_density(i,90) * number_density(i,124)

    ! k_ALKOOH_1: ALKOOH -> 0.4*CH3CHO + 0.1*CH2O + 0.25*CH3COCH3 + 0.9*HO2 + 0.8*MEK + 1*OH
    force(i,124) = force(i,124) + 0.1*rate_constant(i,300) * number_density(i,65)

    ! k_MTERP_O3_2: MTERP + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    force(i,124) = force(i,124) + 0.34*rate_constant(i,307) * number_density(i,31) * number_density(i,171)

    ! k_MBOO2_NO_1: MBOO2 + NO -> 1*HO2 + 0.67*GLYALD + 0.67*CH3COCH3 + 0.33*HMPROP + 0.33*CH2O + 1*NO2
    force(i,124) = force(i,124) + 0.33*rate_constant(i,308) * number_density(i,125) * number_density(i,137)

    ! k_MBONO3O2_NO_1: MBONO3O2 + NO -> 0.25*HMPROP + 0.25*CH2O + 1.25*NO2 + 0.75*HONITR + 0.75*CH3COCH3 + 0.75*HO2
    force(i,124) = force(i,124) + 0.25*rate_constant(i,313) * number_density(i,123) * number_density(i,137)

    ! k_CH3O2_MACRO2_1: CH3O2 + MACRO2 -> 0.73*HO2 + 0.88*CH2O + 0.11*CO + 0.24*CH3COCHO + 0.26*GLYALD + 0.26*CH3CO3 + 0.25*CH3OH + 0.23*HYAC
    force(i,124) = force(i,124) + 0.88*rate_constant(i,322) * number_density(i,191) * number_density(i,188)

    ! k_C2H4_O3_1: C2H4 + O3 -> 0.63*CO + 0.13*OH + 0.13*HO2 + 0.37*HCOOH + 1*CH2O
    force(i,124) = force(i,124) + rate_constant(i,323) * number_density(i,93) * number_density(i,171)

    ! k_CH3O2_NO_1: CH3O2 + NO -> 1*CH2O + 1*NO2 + 1*HO2
    force(i,124) = force(i,124) + rate_constant(i,329) * number_density(i,191) * number_density(i,137)

    ! k_ISOPAO2_NO3_1: ISOPAO2 + NO3 -> 1*NO2 + 0.4*MACR + 0.6*MVK + 1*CH2O + 1*HO2
    force(i,124) = force(i,124) + rate_constant(i,330) * number_density(i,189) * number_density(i,165)

    ! k_GLYALD_1: GLYALD -> 2*HO2 + 1*CO + 1*CH2O
    force(i,124) = force(i,124) + rate_constant(i,338) * number_density(i,156)

    ! k_CH3OOH_OH_1: CH3OOH + OH -> 0.7*CH3O2 + 0.3*OH + 0.3*CH2O + 1*H2O
    force(i,124) = force(i,124) + 0.3*rate_constant(i,348) * number_density(i,135) * number_density(i,166)

    ! k_MCO3_NO_1: MCO3 + NO -> 1*NO2 + 1*CH2O + 1*CH3CO3
    force(i,124) = force(i,124) + rate_constant(i,353) * number_density(i,167) * number_density(i,137)

    ! k_CH3O2_RO2_1: CH3O2 + RO2 -> 0.3*CH3CO3 + 0.8*CH2O + 0.3*HO2 + 0.2*HYAC + 0.5*CH3COCHO + 0.5*CH3OH
    force(i,124) = force(i,124) + 0.8*rate_constant(i,354) * number_density(i,191) * number_density(i,40)

    ! k_ISOPNITA_OH_1: ISOPNITA + OH -> 0.7*HYAC + 0.7*GLYALD + 0.7*NO2 + 0.3*CH2O + 0.3*HONITR + 0.3*HO2
    force(i,124) = force(i,124) + 0.3*rate_constant(i,364) * number_density(i,118) * number_density(i,166)

    ! k_NO_PO2_1: NO + PO2 -> 1*CH3CHO + 1*CH2O + 1*HO2 + 1*NO2
    force(i,124) = force(i,124) + rate_constant(i,365) * number_density(i,137) * number_density(i,151)

    ! k_EO_1: EO -> 2*CH2O + 1*HO2
    force(i,124) = force(i,124) + 2*rate_constant(i,372) * number_density(i,162)

    ! k_ISOP_O3_2: ISOP + O3 -> 0.3*MACR + 0.2*MVK + 0.11*HCOOH + 0.62*CO + 0.32*OH + 0.37*HO2 + 0.91*CH2O + 0.08*CH3CO3 + 0.13*C3H6 + 0.05*CH3O2
    force(i,124) = force(i,124) + 0.91*rate_constant(i,377) * number_density(i,142) * number_density(i,171)

    ! k_CH3OOH_1: CH3OOH -> 1*CH2O + 1*H + 1*OH
    force(i,124) = force(i,124) + rate_constant(i,379) * number_density(i,135)

    ! k_BIGENE_NO3_1: BIGENE + NO3 -> 1*NO2 + 1*CH3CHO + 0.5*CH2O + 0.5*CH3COCH3
    force(i,124) = force(i,124) + 0.5*rate_constant(i,387) * number_density(i,97) * number_density(i,165)

    ! k_NO_TERPO2_1: NO + TERPO2 -> 0.2*TERPNIT + 0.8*NO2 + 0.32*CH2O + 0.04*CH3COCH3 + 0.8*TERPROD1 + 0.8*HO2
    force(i,124) = force(i,124) + 0.32*rate_constant(i,392) * number_density(i,137) * number_density(i,147)

    ! k_CH3COOOH_OH_1: CH3COOOH + OH -> 0.5*CH3CO3 + 0.5*CH2O + 0.5*CO2 + 1*H2O
    force(i,124) = force(i,124) + 0.5*rate_constant(i,393) * number_density(i,184) * number_density(i,166)

    ! k_ALKNIT_OH_1: ALKNIT + OH -> 0.4*CH2O + 0.8*CH3CHO + 0.8*CH3COCH3 + 1*NO2
    force(i,124) = force(i,124) + 0.4*rate_constant(i,394) * number_density(i,5) * number_density(i,166)

    ! k_OH_TERPROD2_1: OH + TERPROD2 -> 0.15*RO2 + 0.68*CH2O + 1.8*CO2 + 0.5*CH3COCH3 + 0.65*CH3CO3 + 0.2*HO2 + 0.7*CO
    force(i,124) = force(i,124) + 0.68*rate_constant(i,397) * number_density(i,166) * number_density(i,155)

    ! k_CH3OH_OH_1: CH3OH + OH -> 1*HO2 + 1*CH2O
    force(i,124) = force(i,124) + rate_constant(i,409) * number_density(i,122) * number_density(i,166)
  end do
  !$acc end parallel

end subroutine p_force36

subroutine p_force37(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_CH3O2_XO2_1: CH3O2 + XO2 -> 0.3*CH3OH + 0.8*HO2 + 0.8*CH2O + 0.2*CO + 0.1*GLYOXAL + 0.1*CH3COCHO + 0.1*HYAC + 0.1*GLYALD
    force(i,124) = force(i,124) + 0.8*rate_constant(i,410) * number_density(i,191) * number_density(i,153)

    ! k_CH3O2_TERP2O2_1: CH3O2 + TERP2O2 -> 1*TERPROD2 + 0.93*CH2O + 0.25*CH3OH + 1*HO2 + 0.5*CO2 + 0.125*CO + 0.125*GLYALD + 0.15*CH3COCH3
    force(i,124) = force(i,124) + 0.93*rate_constant(i,414) * number_density(i,191) * number_density(i,145)

    ! k_CH2O_OH_1: CH2O + OH -> 1*CO + 1*H2O + 1*H
    force(i,124) = force(i,124) - rate_constant(i,415) * number_density(i,124) * number_density(i,166)

    ! k_MVK_O3_1: MVK + O3 -> 0.6*CH2O + 0.56*CO + 0.1*CH3CHO + 0.1*CO2 + 0.28*CH3CO3 + 0.5*CH3COCHO + 0.28*HO2 + 0.36*OH + 0.12*HCOOH
    force(i,124) = force(i,124) + 0.6*rate_constant(i,420) * number_density(i,25) * number_density(i,171)

    ! k_CH2O_NO3_1: CH2O + NO3 -> 1*CO + 1*HO2 + 1*HNO3
    force(i,124) = force(i,124) - rate_constant(i,423) * number_density(i,124) * number_density(i,165)

    ! k_CH2O_CL_1: CH2O + CL -> 1*HCL + 1*HO2 + 1*CO
    force(i,124) = force(i,124) - rate_constant(i,425) * number_density(i,124) * number_density(i,100)

    ! k_HOCH2OO_1: HOCH2OO -> 1*CH2O + 1*HO2
    force(i,124) = force(i,124) + rate_constant(i,431) * number_density(i,154)

    ! k_CH3O2_CH3O2_1: CH3O2 + CH3O2 -> 2*CH2O + 2*HO2
    force(i,124) = force(i,124) + 2*rate_constant(i,433) * number_density(i,191) * number_density(i,191)

    ! k_CH3O2_ISOPAO2_1: CH3O2 + ISOPAO2 -> 0.25*CH3OH + 1*HO2 + 1.5*CH2O + 0.31*MACR + 0.44*MVK
    force(i,124) = force(i,124) + 1.5*rate_constant(i,434) * number_density(i,191) * number_density(i,189)

    ! k_CH2O_HO2_1: CH2O + HO2 -> 1*HOCH2OO
    force(i,124) = force(i,124) - rate_constant(i,449) * number_density(i,124) * number_density(i,192)

    ! k_ALKNIT_1: ALKNIT -> 1*NO2 + 0.4*CH3CHO + 0.1*CH2O + 0.25*CH3COCH3 + 1*HO2 + 0.8*MEK
    force(i,124) = force(i,124) + 0.1*rate_constant(i,452) * number_density(i,5)

    ! k_CH3O2_CH3O2_2: CH3O2 + CH3O2 -> 1*CH2O + 1*CH3OH
    force(i,124) = force(i,124) + rate_constant(i,459) * number_density(i,191) * number_density(i,191)

    ! k_ISOPAO2_NO_1: ISOPAO2 + NO -> 0.08*ISOPNITA + 0.92*NO2 + 0.36*MACR + 0.56*MVK + 0.92*CH2O + 0.92*HO2
    force(i,124) = force(i,124) + 0.92*rate_constant(i,464) * number_density(i,189) * number_density(i,137)

    ! k_CH3O2_CLO_1: CH3O2 + CLO -> 1*CL + 1*HO2 + 1*CH2O
    force(i,124) = force(i,124) + rate_constant(i,467) * number_density(i,191) * number_density(i,86)

    ! k_NO_RO2_1: NO + RO2 -> 1*CH3CO3 + 1*CH2O + 1*NO2
    force(i,124) = force(i,124) + rate_constant(i,484) * number_density(i,137) * number_density(i,40)

    ! MBOO2
    force(i,125) = 0

    ! k_MBOOOH_OH_1: MBOOOH + OH -> 0.5*MBOO2 + 0.5*OH
    force(i,125) = force(i,125) + 0.5*rate_constant(i,105) * number_density(i,150) * number_density(i,166)

    ! k_CH3O2_MBOO2_1: CH3O2 + MBOO2 -> 0.917*CH2O + 1*HO2 + 0.25*CH3OH + 0.333*GLYALD + 0.333*CH3COCH3 + 0.167*HMPROP
    force(i,125) = force(i,125) - rate_constant(i,155) * number_density(i,191) * number_density(i,125)

    ! k_MBO_OH_1: MBO + OH -> 1*MBOO2
    force(i,125) = force(i,125) + rate_constant(i,191) * number_density(i,127) * number_density(i,166)

    ! k_HO2_MBOO2_1: HO2 + MBOO2 -> 1*MBOOOH
    force(i,125) = force(i,125) - rate_constant(i,247) * number_density(i,192) * number_density(i,125)

    ! k_MBOO2_NO_1: MBOO2 + NO -> 1*HO2 + 0.67*GLYALD + 0.67*CH3COCH3 + 0.33*HMPROP + 0.33*CH2O + 1*NO2
    force(i,125) = force(i,125) - rate_constant(i,308) * number_density(i,125) * number_density(i,137)

    ! C2H5OH
    force(i,126) = 0

    ! k_C2H5O2_C2H5O2_1: C2H5O2 + C2H5O2 -> 1.6*CH3CHO + 1.2*HO2 + 0.4*C2H5OH
    force(i,126) = force(i,126) + 0.4*rate_constant(i,248) * number_density(i,87) * number_density(i,87)

    ! k_C2H5O2_CH3O2_1: C2H5O2 + CH3O2 -> 0.7*CH2O + 0.8*CH3CHO + 1*HO2 + 0.3*CH3OH + 0.2*C2H5OH
    force(i,126) = force(i,126) + 0.2*rate_constant(i,277) * number_density(i,87) * number_density(i,191)

    ! k_C2H5OH_OH_1: C2H5OH + OH -> 1*HO2 + 1*CH3CHO
    force(i,126) = force(i,126) - rate_constant(i,477) * number_density(i,126) * number_density(i,166)

    ! MBO
    force(i,127) = 0

    ! k_MBO_NO3_1: MBO + NO3 -> 1*MBONO3O2
    force(i,127) = force(i,127) - rate_constant(i,11) * number_density(i,127) * number_density(i,165)

    ! k_MBO_OH_1: MBO + OH -> 1*MBOO2
    force(i,127) = force(i,127) - rate_constant(i,191) * number_density(i,127) * number_density(i,166)

    ! k_MBO_O3_1: MBO + O3 -> 0.7*HMPROP + 0.64*CO + 0.36*OH + 0.48*HO2 + 0.17*HCOOH + 0.3*CH2O + 0.23*CH3COCH3
    force(i,127) = force(i,127) - rate_constant(i,228) * number_density(i,127) * number_density(i,171)

    ! MEKO2
    force(i,128) = 0

    ! k_MEK_OH_1: MEK + OH -> 1*MEKO2
    force(i,128) = force(i,128) + rate_constant(i,66) * number_density(i,104) * number_density(i,166)

    ! k_HO2_MEKO2_1: HO2 + MEKO2 -> 0.8*MEKOOH + 0.2*OH + 0.2*CH3CHO + 0.2*CH3CO3
    force(i,128) = force(i,128) - rate_constant(i,139) * number_density(i,192) * number_density(i,128)

    ! k_MEKO2_NO_1: MEKO2 + NO -> 1*CH3CO3 + 1*CH3CHO + 1*NO2
    force(i,128) = force(i,128) - rate_constant(i,332) * number_density(i,128) * number_density(i,137)

    ! k_MEKOOH_OH_1: MEKOOH + OH -> 1*MEKO2
    force(i,128) = force(i,128) + rate_constant(i,352) * number_density(i,136) * number_density(i,166)
  end do
  !$acc end parallel

end subroutine p_force37

subroutine p_force38(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! ONITR
    force(i,129) = 0

    ! k_HONITR_OH_1: HONITR + OH -> 1*ONITR + 1*HO2
    force(i,129) = force(i,129) + rate_constant(i,26) * number_density(i,134) * number_density(i,166)

    ! k_NO_TERP2O2_1: NO + TERP2O2 -> 0.1*ONITR + 0.9*NO2 + 0.34*CH2O + 0.27*CH3COCH3 + 0.225*CO + 0.9*CO2 + 0.9*TERPROD2 + 0.9*HO2 + 0.225*GLYALD
    force(i,129) = force(i,129) + 0.1*rate_constant(i,110) * number_density(i,137) * number_density(i,145)

    ! k_ONITR_1: ONITR -> 1*NO2
    force(i,129) = force(i,129) - rate_constant(i,216) * number_density(i,129)

    ! BIGALK
    force(i,130) = 0

    ! k_BCARY_O3_1: BCARY + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    force(i,130) = force(i,130) + 0.05*rate_constant(i,229) * number_density(i,102) * number_density(i,171)

    ! k_MTERP_O3_2: MTERP + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    force(i,130) = force(i,130) + 0.05*rate_constant(i,307) * number_density(i,31) * number_density(i,171)

    ! k_BIGALK_OH_1: BIGALK + OH -> 1*ALKO2
    force(i,130) = force(i,130) - rate_constant(i,315) * number_density(i,130) * number_density(i,166)

    ! GLYOXAL
    force(i,131) = 0

    ! k_HO2_MALO2_1: HO2 + MALO2 -> 0.16*GLYOXAL + 0.16*HO2 + 0.16*CO
    force(i,131) = force(i,131) + 0.16*rate_constant(i,1) * number_density(i,192) * number_density(i,170)

    ! k_C2H2_OH_1: C2H2 + OH -> 0.65*GLYOXAL + 0.65*OH + 0.35*HCOOH + 0.35*HO2 + 0.35*CO
    force(i,131) = force(i,131) + 0.65*rate_constant(i,2) * number_density(i,168) * number_density(i,166)

    ! k_XYLENOOH_1: XYLENOOH -> 1*OH + 1*HO2 + 0.34*GLYOXAL + 0.54*CH3COCHO + 0.06*BIGALD1 + 0.2*BIGALD2 + 0.15*BIGALD3 + 0.21*BIGALD4
    force(i,131) = force(i,131) + 0.34*rate_constant(i,20) * number_density(i,92)

    ! k_BENZO2_NO_1: BENZO2 + NO -> 1*NO2 + 1*GLYOXAL + 0.5*BIGALD1 + 1*HO2
    force(i,131) = force(i,131) + rate_constant(i,59) * number_density(i,13) * number_density(i,137)

    ! k_NO_TOLO2_1: NO + TOLO2 -> 1*NO2 + 0.6*GLYOXAL + 0.4*CH3COCHO + 1*HO2 + 0.2*BIGALD1 + 0.2*BIGALD2 + 0.2*BIGALD3
    force(i,131) = force(i,131) + 0.6*rate_constant(i,60) * number_density(i,137) * number_density(i,144)

    ! k_XYLOLOOH_1: XYLOLOOH -> 1*OH + 0.17*GLYOXAL + 0.51*CH3COCHO + 1*HO2
    force(i,131) = force(i,131) + 0.17*rate_constant(i,86) * number_density(i,26)

    ! k_ISOPBO2_NO_1: ISOPBO2 + NO -> 0.87*HYDRALD + 0.08*ISOPNITB + 0.92*NO2 + 0.92*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    force(i,131) = force(i,131) + 0.05*rate_constant(i,96) * number_density(i,190) * number_density(i,137)

    ! k_PHENOOH_1: PHENOOH -> 1*OH + 1*HO2 + 0.7*GLYOXAL
    force(i,131) = force(i,131) + 0.7*rate_constant(i,98) * number_density(i,115)

    ! k_CH3CO3_XO2_1: CH3CO3 + XO2 -> 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 1*CH3O2 + 1*HO2 + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD + 1*CO2
    force(i,131) = force(i,131) + 0.25*rate_constant(i,106) * number_density(i,49) * number_density(i,153)

    ! k_NO3_XO2_1: NO3 + XO2 -> 1*NO2 + 1*HO2 + 0.5*CO + 0.25*HYAC + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*GLYALD
    force(i,131) = force(i,131) + 0.25*rate_constant(i,109) * number_density(i,165) * number_density(i,153)

    ! k_GLYALD_OH_1: GLYALD + OH -> 1*HO2 + 0.2*GLYOXAL + 0.8*CH2O + 0.8*CO2
    force(i,131) = force(i,131) + 0.2*rate_constant(i,123) * number_density(i,156) * number_density(i,166)

    ! k_HO2_MDIALO2_1: HO2 + MDIALO2 -> 0.4*OH + 0.33*HO2 + 0.07*CH3COCHO + 0.14*CO + 0.07*CH3O2 + 0.07*GLYOXAL
    force(i,131) = force(i,131) + 0.07*rate_constant(i,161) * number_density(i,192) * number_density(i,164)

    ! k_GLYOXAL_OH_1: GLYOXAL + OH -> 1*HO2 + 1*CO + 1*CO2
    force(i,131) = force(i,131) - rate_constant(i,176) * number_density(i,131) * number_density(i,166)

    ! k_ISOPBO2_NO3_1: ISOPBO2 + NO3 -> 1*NO2 + 0.95*HYDRALD + 1*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    force(i,131) = force(i,131) + 0.05*rate_constant(i,178) * number_density(i,190) * number_density(i,165)

    ! k_NC4CHO_OH_1: NC4CHO + OH -> 1*GLYOXAL + 1*NOA + 1*HO2
    force(i,131) = force(i,131) + rate_constant(i,182) * number_density(i,23) * number_density(i,166)

    ! k_NO_XO2_1: NO + XO2 -> 1*NO2 + 1*HO2 + 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD
    force(i,131) = force(i,131) + 0.25*rate_constant(i,252) * number_density(i,137) * number_density(i,153)

    ! k_NO_PHENO2_1: NO + PHENO2 -> 1*HO2 + 0.7*GLYOXAL + 1*NO2
    force(i,131) = force(i,131) + 0.7*rate_constant(i,257) * number_density(i,137) * number_density(i,38)

    ! k_BENZOOH_1: BENZOOH -> 1*OH + 1*GLYOXAL + 0.5*BIGALD1 + 1*HO2
    force(i,131) = force(i,131) + rate_constant(i,275) * number_density(i,91)

    ! k_TOLOOH_1: TOLOOH -> 1*OH + 0.6*GLYOXAL + 0.4*CH3COCHO + 1*HO2 + 0.2*BIGALD1 + 0.2*BIGALD2 + 0.2*BIGALD3
    force(i,131) = force(i,131) + 0.6*rate_constant(i,326) * number_density(i,95)

    ! k_MDIALO2_NO_1: MDIALO2 + NO -> 1*NO2 + 0.83*HO2 + 0.17*CH3COCHO + 0.35*CO + 0.17*CH3O2 + 0.17*GLYOXAL
    force(i,131) = force(i,131) + 0.17*rate_constant(i,403) * number_density(i,164) * number_density(i,137)

    ! k_NO_XYLOLO2_1: NO + XYLOLO2 -> 1*HO2 + 1*NO2 + 0.17*GLYOXAL + 0.51*CH3COCHO
    force(i,131) = force(i,131) + 0.17*rate_constant(i,404) * number_density(i,137) * number_density(i,148)

    ! k_CH3O2_XO2_1: CH3O2 + XO2 -> 0.3*CH3OH + 0.8*HO2 + 0.8*CH2O + 0.2*CO + 0.1*GLYOXAL + 0.1*CH3COCHO + 0.1*HYAC + 0.1*GLYALD
    force(i,131) = force(i,131) + 0.1*rate_constant(i,410) * number_density(i,191) * number_density(i,153)

    ! k_GLYOXAL_1: GLYOXAL -> 2*CO + 2*HO2
    force(i,131) = force(i,131) - rate_constant(i,416) * number_density(i,131)

    ! k_NO_XYLENO2_1: NO + XYLENO2 -> 1*NO2 + 1*HO2 + 0.34*GLYOXAL + 0.54*CH3COCHO + 0.06*BIGALD1 + 0.2*BIGALD2 + 0.15*BIGALD3 + 0.21*BIGALD4
    force(i,131) = force(i,131) + 0.34*rate_constant(i,419) * number_density(i,137) * number_density(i,146)

    ! k_MALO2_NO_1: MALO2 + NO -> 0.4*GLYOXAL + 0.4*HO2 + 0.4*CO + 1*NO2
    force(i,131) = force(i,131) + 0.4*rate_constant(i,424) * number_density(i,170) * number_density(i,137)
  end do
  !$acc end parallel

end subroutine p_force38

subroutine p_force39(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_BIGALD_1: BIGALD -> 0.45*CO + 0.13*GLYOXAL + 0.56*HO2 + 0.13*CH3CO3 + 0.18*CH3COCHO
    force(i,131) = force(i,131) + 0.13*rate_constant(i,469) * number_density(i,105)

    ! HMPROP
    force(i,132) = 0

    ! k_MBONO3O2_NO3_1: MBONO3O2 + NO3 -> 0.25*HMPROP + 0.25*CH2O + 1.25*NO2 + 0.75*HONITR + 0.75*CH3COCH3 + 0.75*HO2
    force(i,132) = force(i,132) + 0.25*rate_constant(i,44) * number_density(i,123) * number_density(i,165)

    ! k_CH3O2_MBOO2_1: CH3O2 + MBOO2 -> 0.917*CH2O + 1*HO2 + 0.25*CH3OH + 0.333*GLYALD + 0.333*CH3COCH3 + 0.167*HMPROP
    force(i,132) = force(i,132) + 0.167*rate_constant(i,155) * number_density(i,191) * number_density(i,125)

    ! k_MBO_O3_1: MBO + O3 -> 0.7*HMPROP + 0.64*CO + 0.36*OH + 0.48*HO2 + 0.17*HCOOH + 0.3*CH2O + 0.23*CH3COCH3
    force(i,132) = force(i,132) + 0.7*rate_constant(i,228) * number_density(i,127) * number_density(i,171)

    ! k_MBOO2_NO_1: MBOO2 + NO -> 1*HO2 + 0.67*GLYALD + 0.67*CH3COCH3 + 0.33*HMPROP + 0.33*CH2O + 1*NO2
    force(i,132) = force(i,132) + 0.33*rate_constant(i,308) * number_density(i,125) * number_density(i,137)

    ! k_MBONO3O2_NO_1: MBONO3O2 + NO -> 0.25*HMPROP + 0.25*CH2O + 1.25*NO2 + 0.75*HONITR + 0.75*CH3COCH3 + 0.75*HO2
    force(i,132) = force(i,132) + 0.25*rate_constant(i,313) * number_density(i,123) * number_density(i,137)

    ! k_HMPROP_OH_1: HMPROP + OH -> 1*HMPROPO2
    force(i,132) = force(i,132) - rate_constant(i,453) * number_density(i,132) * number_density(i,166)

    ! ENEO2
    force(i,133) = 0

    ! k_ENEO2_NO_1: ENEO2 + NO -> 1*CH3CHO + 0.5*CH2O + 0.5*CH3COCH3 + 1*HO2 + 1*NO2
    force(i,133) = force(i,133) - rate_constant(i,201) * number_density(i,133) * number_density(i,137)

    ! k_ENEO2_NO_2: ENEO2 + NO -> 1*HONITR
    force(i,133) = force(i,133) - rate_constant(i,378) * number_density(i,133) * number_density(i,137)

    ! k_BIGENE_OH_1: BIGENE + OH -> 1*ENEO2
    force(i,133) = force(i,133) + rate_constant(i,475) * number_density(i,97) * number_density(i,166)

    ! HONITR
    force(i,134) = 0

    ! k_HONITR_OH_1: HONITR + OH -> 1*ONITR + 1*HO2
    force(i,134) = force(i,134) - rate_constant(i,26) * number_density(i,134) * number_density(i,166)

    ! k_MBONO3O2_NO3_1: MBONO3O2 + NO3 -> 0.25*HMPROP + 0.25*CH2O + 1.25*NO2 + 0.75*HONITR + 0.75*CH3COCH3 + 0.75*HO2
    force(i,134) = force(i,134) + 0.75*rate_constant(i,44) * number_density(i,123) * number_density(i,165)

    ! k_ISOPNITB_OH_1: ISOPNITB + OH -> 0.5*HYAC + 0.5*GLYALD + 0.5*NOA + 1*HO2 + 0.5*HONITR
    force(i,134) = force(i,134) + 0.5*rate_constant(i,79) * number_density(i,73) * number_density(i,166)

    ! k_HONITR_1: HONITR -> 1*NO2 + 0.67*HO2 + 0.33*CH3CHO + 0.33*CH2O + 0.33*CO + 0.33*GLYALD + 0.33*CH3CO3 + 0.17*HYAC + 0.17*CH3COCH3
    force(i,134) = force(i,134) - rate_constant(i,171) * number_density(i,134)

    ! k_MBONO3O2_NO_1: MBONO3O2 + NO -> 0.25*HMPROP + 0.25*CH2O + 1.25*NO2 + 0.75*HONITR + 0.75*CH3COCH3 + 0.75*HO2
    force(i,134) = force(i,134) + 0.75*rate_constant(i,313) * number_density(i,123) * number_density(i,137)

    ! k_ISOPNITA_OH_1: ISOPNITA + OH -> 0.7*HYAC + 0.7*GLYALD + 0.7*NO2 + 0.3*CH2O + 0.3*HONITR + 0.3*HO2
    force(i,134) = force(i,134) + 0.3*rate_constant(i,364) * number_density(i,118) * number_density(i,166)

    ! k_MACRO2_NO_2: MACRO2 + NO -> 1*HONITR
    force(i,134) = force(i,134) + rate_constant(i,376) * number_density(i,188) * number_density(i,137)

    ! k_ENEO2_NO_2: ENEO2 + NO -> 1*HONITR
    force(i,134) = force(i,134) + rate_constant(i,378) * number_density(i,133) * number_density(i,137)

    ! CH3OOH
    force(i,135) = 0

    ! k_CH3O2_HO2_1: CH3O2 + HO2 -> 1*CH3OOH + 1*O2
    force(i,135) = force(i,135) + rate_constant(i,301) * number_density(i,191) * number_density(i,192)

    ! k_CH3OOH_OH_1: CH3OOH + OH -> 0.7*CH3O2 + 0.3*OH + 0.3*CH2O + 1*H2O
    force(i,135) = force(i,135) - rate_constant(i,348) * number_density(i,135) * number_density(i,166)

    ! k_CH3OOH_1: CH3OOH -> 1*CH2O + 1*H + 1*OH
    force(i,135) = force(i,135) - rate_constant(i,379) * number_density(i,135)

    ! MEKOOH
    force(i,136) = 0

    ! k_MEKOOH_1: MEKOOH -> 1*OH + 1*CH3CO3 + 1*CH3CHO
    force(i,136) = force(i,136) - rate_constant(i,89) * number_density(i,136)

    ! k_HO2_MEKO2_1: HO2 + MEKO2 -> 0.8*MEKOOH + 0.2*OH + 0.2*CH3CHO + 0.2*CH3CO3
    force(i,136) = force(i,136) + 0.8*rate_constant(i,139) * number_density(i,192) * number_density(i,128)

    ! k_MEKOOH_OH_1: MEKOOH + OH -> 1*MEKO2
    force(i,136) = force(i,136) - rate_constant(i,352) * number_density(i,136) * number_density(i,166)

    ! NO
    force(i,137) = 0

    ! k_EO2_NO_1: EO2 + NO -> 0.5*CH2O + 0.25*HO2 + 0.75*EO + 1*NO2
    force(i,137) = force(i,137) - rate_constant(i,16) * number_density(i,163) * number_density(i,137)

    ! k_CH3CO3_NO_1: CH3CO3 + NO -> 1*CH3O2 + 1*CO2 + 1*NO2
    force(i,137) = force(i,137) - rate_constant(i,25) * number_density(i,49) * number_density(i,137)

    ! k_MACRO2_NO_1: MACRO2 + NO -> 1*NO2 + 0.47*HO2 + 0.25*CH2O + 0.53*GLYALD + 0.25*CH3COCHO + 0.53*CH3CO3 + 0.22*HYAC + 0.22*CO
    force(i,137) = force(i,137) - rate_constant(i,40) * number_density(i,188) * number_density(i,137)

    ! k_NO_NO3_1: NO + NO3 -> 2*NO2
    force(i,137) = force(i,137) - rate_constant(i,41) * number_density(i,137) * number_density(i,165)
  end do
  !$acc end parallel

end subroutine p_force39

subroutine p_force40(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_BENZO2_NO_1: BENZO2 + NO -> 1*NO2 + 1*GLYOXAL + 0.5*BIGALD1 + 1*HO2
    force(i,137) = force(i,137) - rate_constant(i,59) * number_density(i,13) * number_density(i,137)

    ! k_NO_TOLO2_1: NO + TOLO2 -> 1*NO2 + 0.6*GLYOXAL + 0.4*CH3COCHO + 1*HO2 + 0.2*BIGALD1 + 0.2*BIGALD2 + 0.2*BIGALD3
    force(i,137) = force(i,137) - rate_constant(i,60) * number_density(i,137) * number_density(i,144)

    ! k_NO_O_1: NO + O -> 1*NO2
    force(i,137) = force(i,137) - rate_constant(i,62) * number_density(i,137) * number_density(i,187)

    ! k_ALKO2_NO_1: ALKO2 + NO -> 0.4*CH3CHO + 0.1*CH2O + 0.25*CH3COCH3 + 1*HO2 + 0.8*MEK + 1*NO2
    force(i,137) = force(i,137) - rate_constant(i,71) * number_density(i,85) * number_density(i,137)

    ! k_ISOPBO2_NO_1: ISOPBO2 + NO -> 0.87*HYDRALD + 0.08*ISOPNITB + 0.92*NO2 + 0.92*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    force(i,137) = force(i,137) - rate_constant(i,96) * number_density(i,190) * number_density(i,137)

    ! k_NO_1: NO -> 1*N + 1*O
    force(i,137) = force(i,137) - rate_constant(i,97) * number_density(i,137)

    ! k_NO_TERP2O2_1: NO + TERP2O2 -> 0.1*ONITR + 0.9*NO2 + 0.34*CH2O + 0.27*CH3COCH3 + 0.225*CO + 0.9*CO2 + 0.9*TERPROD2 + 0.9*HO2 + 0.225*GLYALD
    force(i,137) = force(i,137) - rate_constant(i,110) * number_density(i,137) * number_density(i,145)

    ! k_HOCH2OO_NO_1: HOCH2OO + NO -> 1*HCOOH + 1*NO2 + 1*HO2
    force(i,137) = force(i,137) - rate_constant(i,113) * number_density(i,154) * number_density(i,137)

    ! k_N_O2_1: N + O2 -> 1*NO + 1*O
    force(i,137) = force(i,137) + rate_constant(i,117) * number_density(i,185) * number_density(i,41)

    ! k_NO2_1: NO2 -> 1*NO + 1*O
    force(i,137) = force(i,137) + rate_constant(i,121) * number_density(i,54)

    ! k_N_NO2_2: N + NO2 -> 2*NO
    force(i,137) = force(i,137) + 2*rate_constant(i,154) * number_density(i,185) * number_density(i,54)

    ! k_HMPROPO2_NO_1: HMPROPO2 + NO -> 1*NO2 + 1*CO2 + 1*HO2 + 1*CH3COCH3
    force(i,137) = force(i,137) - rate_constant(i,156) * number_density(i,77) * number_density(i,137)

    ! k_C6H5O2_NO_1: C6H5O2 + NO -> 1*PHENO + 1*NO2
    force(i,137) = force(i,137) - rate_constant(i,175) * number_density(i,81) * number_density(i,137)

    ! k_N2O_O1D_1: N2O + O1D -> 2*NO
    force(i,137) = force(i,137) + 2*rate_constant(i,180) * number_density(i,161) * number_density(i,112)

    ! k_ALKO2_NO_2: ALKO2 + NO -> 1*ALKNIT
    force(i,137) = force(i,137) - rate_constant(i,194) * number_density(i,85) * number_density(i,137)

    ! k_BZOO_NO_1: BZOO + NO -> 1*BZALD + 1*NO2 + 1*HO2
    force(i,137) = force(i,137) - rate_constant(i,195) * number_density(i,33) * number_density(i,137)

    ! k_ENEO2_NO_1: ENEO2 + NO -> 1*CH3CHO + 0.5*CH2O + 0.5*CH3COCH3 + 1*HO2 + 1*NO2
    force(i,137) = force(i,137) - rate_constant(i,201) * number_density(i,133) * number_density(i,137)

    ! k_CLO_NO_1: CLO + NO -> 1*NO2 + 1*CL
    force(i,137) = force(i,137) - rate_constant(i,203) * number_density(i,86) * number_density(i,137)

    ! k_BRO_NO_1: BRO + NO -> 1*BR + 1*NO2
    force(i,137) = force(i,137) - rate_constant(i,206) * number_density(i,71) * number_density(i,137)

    ! k_N_OH_1: N + OH -> 1*NO + 1*H
    force(i,137) = force(i,137) + rate_constant(i,250) * number_density(i,185) * number_density(i,166)

    ! k_NO_XO2_1: NO + XO2 -> 1*NO2 + 1*HO2 + 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD
    force(i,137) = force(i,137) - rate_constant(i,252) * number_density(i,137) * number_density(i,153)

    ! k_NO_PHENO2_1: NO + PHENO2 -> 1*HO2 + 0.7*GLYOXAL + 1*NO2
    force(i,137) = force(i,137) - rate_constant(i,257) * number_density(i,137) * number_density(i,38)

    ! k_NO2_SO_1: NO2 + SO -> 1*SO2 + 1*NO
    force(i,137) = force(i,137) + rate_constant(i,260) * number_density(i,54) * number_density(i,32)

    ! k_ACBZO2_NO_1: ACBZO2 + NO -> 1*C6H5O2 + 1*NO2
    force(i,137) = force(i,137) - rate_constant(i,263) * number_density(i,43) * number_density(i,137)

    ! k_C2H5O2_NO_1: C2H5O2 + NO -> 1*CH3CHO + 1*HO2 + 1*NO2
    force(i,137) = force(i,137) - rate_constant(i,270) * number_density(i,87) * number_density(i,137)

    ! k_N2O5_2: N2O5 -> 1*NO + 1*O + 1*NO3
    force(i,137) = force(i,137) + rate_constant(i,278) * number_density(i,51)

    ! k_ISOPNO3_NO_1: ISOPNO3 + NO -> 1*NC4CHO + 1*NO2 + 1*HO2
    force(i,137) = force(i,137) - rate_constant(i,302) * number_density(i,46) * number_density(i,137)

    ! k_NO_NTERPO2_1: NO + NTERPO2 -> 0.2*TERPNIT + 1.6*NO2 + 0.8*TERPROD1
    force(i,137) = force(i,137) - rate_constant(i,306) * number_density(i,137) * number_density(i,143)

    ! k_MBOO2_NO_1: MBOO2 + NO -> 1*HO2 + 0.67*GLYALD + 0.67*CH3COCH3 + 0.33*HMPROP + 0.33*CH2O + 1*NO2
    force(i,137) = force(i,137) - rate_constant(i,308) * number_density(i,125) * number_density(i,137)

    ! k_MBONO3O2_NO_1: MBONO3O2 + NO -> 0.25*HMPROP + 0.25*CH2O + 1.25*NO2 + 0.75*HONITR + 0.75*CH3COCH3 + 0.75*HO2
    force(i,137) = force(i,137) - rate_constant(i,313) * number_density(i,123) * number_density(i,137)

    ! k_CH3O2_NO_1: CH3O2 + NO -> 1*CH2O + 1*NO2 + 1*HO2
    force(i,137) = force(i,137) - rate_constant(i,329) * number_density(i,191) * number_density(i,137)

    ! k_MEKO2_NO_1: MEKO2 + NO -> 1*CH3CO3 + 1*CH3CHO + 1*NO2
    force(i,137) = force(i,137) - rate_constant(i,332) * number_density(i,128) * number_density(i,137)

    ! k_DICARBO2_NO_1: DICARBO2 + NO -> 1*NO2 + 0.17*HO2 + 0.17*CH3COCHO + 0.17*CO + 0.83*CH3O2
    force(i,137) = force(i,137) - rate_constant(i,337) * number_density(i,181) * number_density(i,137)

    ! k_NO2_O_1: NO2 + O -> 1*NO + 1*O2
    force(i,137) = force(i,137) + rate_constant(i,351) * number_density(i,54) * number_density(i,187)
  end do
  !$acc end parallel

end subroutine p_force40

subroutine p_force41(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_MCO3_NO_1: MCO3 + NO -> 1*NO2 + 1*CH2O + 1*CH3CO3
    force(i,137) = force(i,137) - rate_constant(i,353) * number_density(i,167) * number_density(i,137)

    ! k_NO_PO2_1: NO + PO2 -> 1*CH3CHO + 1*CH2O + 1*HO2 + 1*NO2
    force(i,137) = force(i,137) - rate_constant(i,365) * number_density(i,137) * number_density(i,151)

    ! k_NO3_2: NO3 -> 1*NO + 1*O2
    force(i,137) = force(i,137) + rate_constant(i,374) * number_density(i,165)

    ! k_MACRO2_NO_2: MACRO2 + NO -> 1*HONITR
    force(i,137) = force(i,137) - rate_constant(i,376) * number_density(i,188) * number_density(i,137)

    ! k_ENEO2_NO_2: ENEO2 + NO -> 1*HONITR
    force(i,137) = force(i,137) - rate_constant(i,378) * number_density(i,133) * number_density(i,137)

    ! k_NO_TERPO2_1: NO + TERPO2 -> 0.2*TERPNIT + 0.8*NO2 + 0.32*CH2O + 0.04*CH3COCH3 + 0.8*TERPROD1 + 0.8*HO2
    force(i,137) = force(i,137) - rate_constant(i,392) * number_density(i,137) * number_density(i,147)

    ! k_MDIALO2_NO_1: MDIALO2 + NO -> 1*NO2 + 0.83*HO2 + 0.17*CH3COCHO + 0.35*CO + 0.17*CH3O2 + 0.17*GLYOXAL
    force(i,137) = force(i,137) - rate_constant(i,403) * number_density(i,164) * number_density(i,137)

    ! k_NO_XYLOLO2_1: NO + XYLOLO2 -> 1*HO2 + 1*NO2 + 0.17*GLYOXAL + 0.51*CH3COCHO
    force(i,137) = force(i,137) - rate_constant(i,404) * number_density(i,137) * number_density(i,148)

    ! k_N_NO_1: N + NO -> 1*N2 + 1*O
    force(i,137) = force(i,137) - rate_constant(i,408) * number_density(i,185) * number_density(i,137)

    ! k_NO_XYLENO2_1: NO + XYLENO2 -> 1*NO2 + 1*HO2 + 0.34*GLYOXAL + 0.54*CH3COCHO + 0.06*BIGALD1 + 0.2*BIGALD2 + 0.15*BIGALD3 + 0.21*BIGALD4
    force(i,137) = force(i,137) - rate_constant(i,419) * number_density(i,137) * number_density(i,146)

    ! k_MALO2_NO_1: MALO2 + NO -> 0.4*GLYOXAL + 0.4*HO2 + 0.4*CO + 1*NO2
    force(i,137) = force(i,137) - rate_constant(i,424) * number_density(i,170) * number_density(i,137)

    ! k_NO_O3_1: NO + O3 -> 1*NO2 + 1*O2
    force(i,137) = force(i,137) - rate_constant(i,439) * number_density(i,137) * number_density(i,171)

    ! k_ISOPAO2_NO_1: ISOPAO2 + NO -> 0.08*ISOPNITA + 0.92*NO2 + 0.36*MACR + 0.56*MVK + 0.92*CH2O + 0.92*HO2
    force(i,137) = force(i,137) - rate_constant(i,464) * number_density(i,189) * number_density(i,137)

    ! k_C3H7O2_NO_1: C3H7O2 + NO -> 0.82*CH3COCH3 + 1*NO2 + 1*HO2 + 0.27*CH3CHO
    force(i,137) = force(i,137) - rate_constant(i,471) * number_density(i,109) * number_density(i,137)

    ! k_HO2_NO_1: HO2 + NO -> 1*NO2 + 1*OH
    force(i,137) = force(i,137) - rate_constant(i,483) * number_density(i,192) * number_density(i,137)

    ! k_NO_RO2_1: NO + RO2 -> 1*CH3CO3 + 1*CH2O + 1*NO2
    force(i,137) = force(i,137) - rate_constant(i,484) * number_density(i,137) * number_density(i,40)

    ! ISOPOOH
    force(i,138) = 0

    ! k_ISOPOOH_1: ISOPOOH -> 0.402*MVK + 0.288*MACR + 0.69*CH2O + 1*HO2
    force(i,138) = force(i,138) - rate_constant(i,233) * number_density(i,138)

    ! k_HO2_ISOPBO2_1: HO2 + ISOPBO2 -> 1*ISOPOOH
    force(i,138) = force(i,138) + rate_constant(i,279) * number_density(i,192) * number_density(i,190)

    ! k_ISOPNOOH_1: ISOPNOOH -> 1*NO2 + 1*HO2 + 1*ISOPOOH
    force(i,138) = force(i,138) + rate_constant(i,297) * number_density(i,160)

    ! k_HO2_ISOPAO2_1: HO2 + ISOPAO2 -> 1*ISOPOOH
    force(i,138) = force(i,138) + rate_constant(i,324) * number_density(i,192) * number_density(i,189)

    ! k_ISOPOOH_OH_1: ISOPOOH + OH -> 0.4*XO2 + 0.6*IEPOX + 0.6*OH
    force(i,138) = force(i,138) - rate_constant(i,482) * number_density(i,138) * number_density(i,166)

    ! CRESOL
    force(i,139) = 0

    ! k_CRESOL_OH_1: CRESOL + OH -> 0.2*PHENO2 + 0.73*HO2 + 0.07*PHENO
    force(i,139) = force(i,139) - rate_constant(i,95) * number_density(i,139) * number_density(i,166)

    ! k_OH_TOLUENE_2: OH + TOLUENE -> 0.18*CRESOL + 0.1*TEPOMUC + 0.07*BZOO + 0.65*TOLO2 + 0.28*HO2
    force(i,139) = force(i,139) + 0.18*rate_constant(i,435) * number_density(i,166) * number_density(i,117)

    ! XYLENES
    force(i,140) = 0

    ! k_OH_XYLENES_1: OH + XYLENES -> 0.15*XYLOL + 0.23*TEPOMUC + 0.06*BZOO + 0.56*XYLENO2 + 0.38*HO2
    force(i,140) = force(i,140) - rate_constant(i,7) * number_density(i,166) * number_density(i,140)

    ! HYDRALD
    force(i,141) = 0

    ! k_ISOPBO2_NO_1: ISOPBO2 + NO -> 0.87*HYDRALD + 0.08*ISOPNITB + 0.92*NO2 + 0.92*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    force(i,141) = force(i,141) + 0.87*rate_constant(i,96) * number_density(i,190) * number_density(i,137)

    ! k_CH3O2_ISOPBO2_1: CH3O2 + ISOPBO2 -> 0.25*CH3OH + 1*HO2 + 0.75*CH2O + 0.75*HYDRALD
    force(i,141) = force(i,141) + 0.75*rate_constant(i,167) * number_density(i,191) * number_density(i,190)

    ! k_ISOPBO2_NO3_1: ISOPBO2 + NO3 -> 1*NO2 + 0.95*HYDRALD + 1*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    force(i,141) = force(i,141) + 0.95*rate_constant(i,178) * number_density(i,190) * number_density(i,165)

    ! k_CH3CO3_ISOPBO2_1: CH3CO3 + ISOPBO2 -> 1*HYDRALD + 1*CH3O2 + 1*HO2
    force(i,141) = force(i,141) + rate_constant(i,340) * number_density(i,49) * number_density(i,190)

    ! k_HYDRALD_OH_1: HYDRALD + OH -> 1*XO2
    force(i,141) = force(i,141) - rate_constant(i,407) * number_density(i,141) * number_density(i,166)

    ! ISOP
    force(i,142) = 0
  end do
  !$acc end parallel

end subroutine p_force41

subroutine p_force42(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_ISOP_OH_2: ISOP + OH -> 0.6*ISOPAO2 + 0.4*ISOPBO2
    force(i,142) = force(i,142) - rate_constant(i,76) * number_density(i,142) * number_density(i,166)

    ! k_ISOP_O3_2: ISOP + O3 -> 0.3*MACR + 0.2*MVK + 0.11*HCOOH + 0.62*CO + 0.32*OH + 0.37*HO2 + 0.91*CH2O + 0.08*CH3CO3 + 0.13*C3H6 + 0.05*CH3O2
    force(i,142) = force(i,142) - rate_constant(i,377) * number_density(i,142) * number_density(i,171)

    ! k_ISOP_NO3_2: ISOP + NO3 -> 1*ISOPNO3
    force(i,142) = force(i,142) - rate_constant(i,385) * number_density(i,142) * number_density(i,165)

    ! NTERPO2
    force(i,143) = 0

    ! k_MTERP_NO3_1: MTERP + NO3 -> 1*NTERPO2
    force(i,143) = force(i,143) + rate_constant(i,111) * number_density(i,31) * number_density(i,165)

    ! k_HO2_NTERPO2_1: HO2 + NTERPO2 -> 1*NTERPOOH
    force(i,143) = force(i,143) - rate_constant(i,124) * number_density(i,192) * number_density(i,143)

    ! k_CH3O2_NTERPO2_1: CH3O2 + NTERPO2 -> 0.5*TERPNIT + 0.75*CH2O + 0.25*CH3OH + 0.5*HO2 + 0.5*TERPROD1 + 0.5*NO2
    force(i,143) = force(i,143) - rate_constant(i,135) * number_density(i,191) * number_density(i,143)

    ! k_BCARY_NO3_1: BCARY + NO3 -> 1*NTERPO2
    force(i,143) = force(i,143) + rate_constant(i,225) * number_density(i,102) * number_density(i,165)

    ! k_NO_NTERPO2_1: NO + NTERPO2 -> 0.2*TERPNIT + 1.6*NO2 + 0.8*TERPROD1
    force(i,143) = force(i,143) - rate_constant(i,306) * number_density(i,137) * number_density(i,143)

    ! k_NO3_TERPROD1_1: NO3 + TERPROD1 -> 0.5*TERP2O2 + 0.5*NTERPO2
    force(i,143) = force(i,143) + 0.5*rate_constant(i,309) * number_density(i,165) * number_density(i,58)

    ! k_NTERPOOH_OH_1: NTERPOOH + OH -> 1*NTERPO2
    force(i,143) = force(i,143) + rate_constant(i,328) * number_density(i,114) * number_density(i,166)

    ! k_NO3_NTERPO2_1: NO3 + NTERPO2 -> 2*NO2 + 1*TERPROD1
    force(i,143) = force(i,143) - rate_constant(i,389) * number_density(i,165) * number_density(i,143)

    ! TOLO2
    force(i,144) = 0

    ! k_NO_TOLO2_1: NO + TOLO2 -> 1*NO2 + 0.6*GLYOXAL + 0.4*CH3COCHO + 1*HO2 + 0.2*BIGALD1 + 0.2*BIGALD2 + 0.2*BIGALD3
    force(i,144) = force(i,144) - rate_constant(i,60) * number_density(i,137) * number_density(i,144)

    ! k_OH_TOLOOH_1: OH + TOLOOH -> 1*TOLO2
    force(i,144) = force(i,144) + rate_constant(i,70) * number_density(i,166) * number_density(i,95)

    ! k_OH_TOLUENE_2: OH + TOLUENE -> 0.18*CRESOL + 0.1*TEPOMUC + 0.07*BZOO + 0.65*TOLO2 + 0.28*HO2
    force(i,144) = force(i,144) + 0.65*rate_constant(i,435) * number_density(i,166) * number_density(i,117)

    ! k_HO2_TOLO2_1: HO2 + TOLO2 -> 1*TOLOOH
    force(i,144) = force(i,144) - rate_constant(i,479) * number_density(i,192) * number_density(i,144)

    ! TERP2O2
    force(i,145) = 0

    ! k_NO_TERP2O2_1: NO + TERP2O2 -> 0.1*ONITR + 0.9*NO2 + 0.34*CH2O + 0.27*CH3COCH3 + 0.225*CO + 0.9*CO2 + 0.9*TERPROD2 + 0.9*HO2 + 0.225*GLYALD
    force(i,145) = force(i,145) - rate_constant(i,110) * number_density(i,137) * number_density(i,145)

    ! k_OH_TERPROD1_1: OH + TERPROD1 -> 1*TERP2O2
    force(i,145) = force(i,145) + rate_constant(i,151) * number_density(i,166) * number_density(i,58)

    ! k_NO3_TERPROD1_1: NO3 + TERPROD1 -> 0.5*TERP2O2 + 0.5*NTERPO2
    force(i,145) = force(i,145) + 0.5*rate_constant(i,309) * number_density(i,165) * number_density(i,58)

    ! k_HO2_TERP2O2_1: HO2 + TERP2O2 -> 1*TERP2OOH
    force(i,145) = force(i,145) - rate_constant(i,341) * number_density(i,192) * number_density(i,145)

    ! k_CH3O2_TERP2O2_1: CH3O2 + TERP2O2 -> 1*TERPROD2 + 0.93*CH2O + 0.25*CH3OH + 1*HO2 + 0.5*CO2 + 0.125*CO + 0.125*GLYALD + 0.15*CH3COCH3
    force(i,145) = force(i,145) - rate_constant(i,414) * number_density(i,191) * number_density(i,145)

    ! k_OH_TERP2OOH_1: OH + TERP2OOH -> 1*TERP2O2
    force(i,145) = force(i,145) + rate_constant(i,445) * number_density(i,166) * number_density(i,37)

    ! XYLENO2
    force(i,146) = 0

    ! k_OH_XYLENES_1: OH + XYLENES -> 0.15*XYLOL + 0.23*TEPOMUC + 0.06*BZOO + 0.56*XYLENO2 + 0.38*HO2
    force(i,146) = force(i,146) + 0.56*rate_constant(i,7) * number_density(i,166) * number_density(i,140)

    ! k_OH_XYLENOOH_1: OH + XYLENOOH -> 1*XYLENO2
    force(i,146) = force(i,146) + rate_constant(i,50) * number_density(i,166) * number_density(i,92)

    ! k_HO2_XYLENO2_1: HO2 + XYLENO2 -> 1*XYLENOOH
    force(i,146) = force(i,146) - rate_constant(i,333) * number_density(i,192) * number_density(i,146)

    ! k_NO_XYLENO2_1: NO + XYLENO2 -> 1*NO2 + 1*HO2 + 0.34*GLYOXAL + 0.54*CH3COCHO + 0.06*BIGALD1 + 0.2*BIGALD2 + 0.15*BIGALD3 + 0.21*BIGALD4
    force(i,146) = force(i,146) - rate_constant(i,419) * number_density(i,137) * number_density(i,146)

    ! TERPO2
    force(i,147) = 0

    ! k_CH3O2_TERPO2_1: CH3O2 + TERPO2 -> 1*TERPROD1 + 0.95*CH2O + 0.25*CH3OH + 1*HO2 + 0.025*CH3COCH3
    force(i,147) = force(i,147) - rate_constant(i,3) * number_density(i,191) * number_density(i,147)

    ! k_HO2_TERPO2_1: HO2 + TERPO2 -> 1*TERPOOH
    force(i,147) = force(i,147) - rate_constant(i,145) * number_density(i,192) * number_density(i,147)

    ! k_MTERP_OH_1: MTERP + OH -> 1*TERPO2
    force(i,147) = force(i,147) + rate_constant(i,181) * number_density(i,31) * number_density(i,166)

    ! k_BCARY_OH_2: BCARY + OH -> 1*TERPO2
    force(i,147) = force(i,147) + rate_constant(i,232) * number_density(i,102) * number_density(i,166)
  end do
  !$acc end parallel

end subroutine p_force42

subroutine p_force43(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_OH_TERPOOH_1: OH + TERPOOH -> 1*TERPO2
    force(i,147) = force(i,147) + rate_constant(i,314) * number_density(i,166) * number_density(i,113)

    ! k_NO_TERPO2_1: NO + TERPO2 -> 0.2*TERPNIT + 0.8*NO2 + 0.32*CH2O + 0.04*CH3COCH3 + 0.8*TERPROD1 + 0.8*HO2
    force(i,147) = force(i,147) - rate_constant(i,392) * number_density(i,137) * number_density(i,147)

    ! XYLOLO2
    force(i,148) = 0

    ! k_OH_XYLOL_1: OH + XYLOL -> 0.3*XYLOLO2 + 0.63*HO2 + 0.07*PHENO
    force(i,148) = force(i,148) + 0.3*rate_constant(i,80) * number_density(i,166) * number_density(i,14)

    ! k_HO2_XYLOLO2_1: HO2 + XYLOLO2 -> 1*XYLOLOOH
    force(i,148) = force(i,148) - rate_constant(i,357) * number_density(i,192) * number_density(i,148)

    ! k_NO_XYLOLO2_1: NO + XYLOLO2 -> 1*HO2 + 1*NO2 + 0.17*GLYOXAL + 0.51*CH3COCHO
    force(i,148) = force(i,148) - rate_constant(i,404) * number_density(i,137) * number_density(i,148)

    ! k_OH_XYLOLOOH_1: OH + XYLOLOOH -> 1*XYLOLO2
    force(i,148) = force(i,148) + rate_constant(i,421) * number_density(i,166) * number_density(i,26)

    ! PBZNIT
    force(i,149) = 0

    ! k_PBZNIT_1: PBZNIT -> 1*ACBZO2 + 1*NO2
    force(i,149) = force(i,149) - rate_constant(i,29) * number_density(i,149)

    ! k_ACBZO2_NO2_1: ACBZO2 + NO2 -> 1*PBZNIT
    force(i,149) = force(i,149) + rate_constant(i,388) * number_density(i,43) * number_density(i,54)

    ! MBOOOH
    force(i,150) = 0

    ! k_MBOOOH_OH_1: MBOOOH + OH -> 0.5*MBOO2 + 0.5*OH
    force(i,150) = force(i,150) - rate_constant(i,105) * number_density(i,150) * number_density(i,166)

    ! k_HO2_MBOO2_1: HO2 + MBOO2 -> 1*MBOOOH
    force(i,150) = force(i,150) + rate_constant(i,247) * number_density(i,192) * number_density(i,125)

    ! PO2
    force(i,151) = 0

    ! k_OH_POOH_1: OH + POOH -> 0.5*PO2 + 0.5*OH + 0.5*HYAC + 1*H2O
    force(i,151) = force(i,151) + 0.5*rate_constant(i,127) * number_density(i,166) * number_density(i,9)

    ! k_C3H6_OH_1: C3H6 + OH -> 1*PO2
    force(i,151) = force(i,151) + rate_constant(i,231) * number_density(i,120) * number_density(i,166)

    ! k_HO2_PO2_1: HO2 + PO2 -> 1*POOH + 1*O2
    force(i,151) = force(i,151) - rate_constant(i,265) * number_density(i,192) * number_density(i,151)

    ! k_NO_PO2_1: NO + PO2 -> 1*CH3CHO + 1*CH2O + 1*HO2 + 1*NO2
    force(i,151) = force(i,151) - rate_constant(i,365) * number_density(i,137) * number_density(i,151)

    ! H2
    force(i,152) = 0

    ! k_CH4_1: CH4 -> 1.44*H2 + 0.18*CH2O + 0.18*O + 0.33*OH + 0.33*H + 0.44*CO2 + 0.38*CO + 0.05*H2O
    force(i,152) = force(i,152) + 1.44*rate_constant(i,37) * number_density(i,45)

    ! k_CH2O_1: CH2O -> 1*CO + 1*H2
    force(i,152) = force(i,152) + rate_constant(i,93) * number_density(i,124)

    ! k_H2O_2: H2O -> 1*H2 + 1*O1D
    force(i,152) = force(i,152) + rate_constant(i,114) * number_density(i,68)

    ! k_CH4_O1D_1: CH4 + O1D -> 1*CH2O + 1*H2
    force(i,152) = force(i,152) + rate_constant(i,141) * number_density(i,45) * number_density(i,112)

    ! k_CL_H2_1: CL + H2 -> 1*HCL + 1*H
    force(i,152) = force(i,152) - rate_constant(i,166) * number_density(i,100) * number_density(i,152)

    ! k_H_HO2_1: H + HO2 -> 1*H2 + 1*O2
    force(i,152) = force(i,152) + rate_constant(i,224) * number_density(i,48) * number_density(i,192)

    ! k_H2_O1D_1: H2 + O1D -> 1*H + 1*OH
    force(i,152) = force(i,152) - rate_constant(i,237) * number_density(i,152) * number_density(i,112)

    ! k_H2_OH_1: H2 + OH -> 1*H2O + 1*H
    force(i,152) = force(i,152) - rate_constant(i,281) * number_density(i,152) * number_density(i,166)

    ! k_H2_O_1: H2 + O -> 1*OH + 1*H
    force(i,152) = force(i,152) - rate_constant(i,465) * number_density(i,152) * number_density(i,187)

    ! XO2
    force(i,153) = 0

    ! k_CH3CO3_XO2_1: CH3CO3 + XO2 -> 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 1*CH3O2 + 1*HO2 + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD + 1*CO2
    force(i,153) = force(i,153) - rate_constant(i,106) * number_density(i,49) * number_density(i,153)

    ! k_NO3_XO2_1: NO3 + XO2 -> 1*NO2 + 1*HO2 + 0.5*CO + 0.25*HYAC + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*GLYALD
    force(i,153) = force(i,153) - rate_constant(i,109) * number_density(i,165) * number_density(i,153)

    ! k_OH_XOOH_1: OH + XOOH -> 0.5*XO2 + 0.5*OH
    force(i,153) = force(i,153) + 0.5*rate_constant(i,185) * number_density(i,166) * number_density(i,103)

    ! k_IEPOX_OH_1: IEPOX + OH -> 1*XO2
    force(i,153) = force(i,153) + rate_constant(i,190) * number_density(i,76) * number_density(i,166)

    ! k_HO2_XO2_1: HO2 + XO2 -> 1*XOOH
    force(i,153) = force(i,153) - rate_constant(i,205) * number_density(i,192) * number_density(i,153)
  end do
  !$acc end parallel

end subroutine p_force43

subroutine p_force44(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_NO_XO2_1: NO + XO2 -> 1*NO2 + 1*HO2 + 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD
    force(i,153) = force(i,153) - rate_constant(i,252) * number_density(i,137) * number_density(i,153)

    ! k_HYDRALD_OH_1: HYDRALD + OH -> 1*XO2
    force(i,153) = force(i,153) + rate_constant(i,407) * number_density(i,141) * number_density(i,166)

    ! k_CH3O2_XO2_1: CH3O2 + XO2 -> 0.3*CH3OH + 0.8*HO2 + 0.8*CH2O + 0.2*CO + 0.1*GLYOXAL + 0.1*CH3COCHO + 0.1*HYAC + 0.1*GLYALD
    force(i,153) = force(i,153) - rate_constant(i,410) * number_density(i,191) * number_density(i,153)

    ! k_HPALD_OH_1: HPALD + OH -> 1*XO2
    force(i,153) = force(i,153) + rate_constant(i,444) * number_density(i,67) * number_density(i,166)

    ! k_ISOPOOH_OH_1: ISOPOOH + OH -> 0.4*XO2 + 0.6*IEPOX + 0.6*OH
    force(i,153) = force(i,153) + 0.4*rate_constant(i,482) * number_density(i,138) * number_density(i,166)

    ! HOCH2OO
    force(i,154) = 0

    ! k_HOCH2OO_NO_1: HOCH2OO + NO -> 1*HCOOH + 1*NO2 + 1*HO2
    force(i,154) = force(i,154) - rate_constant(i,113) * number_density(i,154) * number_density(i,137)

    ! k_HO2_HOCH2OO_1: HO2 + HOCH2OO -> 1*HCOOH
    force(i,154) = force(i,154) - rate_constant(i,172) * number_density(i,192) * number_density(i,154)

    ! k_HOCH2OO_1: HOCH2OO -> 1*CH2O + 1*HO2
    force(i,154) = force(i,154) - rate_constant(i,431) * number_density(i,154)

    ! k_CH2O_HO2_1: CH2O + HO2 -> 1*HOCH2OO
    force(i,154) = force(i,154) + rate_constant(i,449) * number_density(i,124) * number_density(i,192)

    ! TERPROD2
    force(i,155) = 0

    ! k_TERPROD2_1: TERPROD2 -> 0.15*RO2 + 0.68*CH2O + 0.8*CO2 + 0.5*CH3COCH3 + 0.65*CH3CO3 + 1.2*HO2 + 1.7*CO
    force(i,155) = force(i,155) - rate_constant(i,35) * number_density(i,155)

    ! k_TERP2OOH_1: TERP2OOH -> 1*OH + 0.375*CH2O + 0.3*CH3COCH3 + 0.25*CO + 1*CO2 + 1*TERPROD2 + 1*HO2 + 0.25*GLYALD
    force(i,155) = force(i,155) + rate_constant(i,49) * number_density(i,37)

    ! k_NO_TERP2O2_1: NO + TERP2O2 -> 0.1*ONITR + 0.9*NO2 + 0.34*CH2O + 0.27*CH3COCH3 + 0.225*CO + 0.9*CO2 + 0.9*TERPROD2 + 0.9*HO2 + 0.225*GLYALD
    force(i,155) = force(i,155) + 0.9*rate_constant(i,110) * number_density(i,137) * number_density(i,145)

    ! k_BCARY_O3_1: BCARY + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    force(i,155) = force(i,155) + 0.3*rate_constant(i,229) * number_density(i,102) * number_density(i,171)

    ! k_TERPROD1_1: TERPROD1 -> 1*HO2 + 1*CO + 1*TERPROD2
    force(i,155) = force(i,155) + rate_constant(i,286) * number_density(i,58)

    ! k_MTERP_O3_2: MTERP + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    force(i,155) = force(i,155) + 0.3*rate_constant(i,307) * number_density(i,31) * number_density(i,171)

    ! k_OH_TERPROD2_1: OH + TERPROD2 -> 0.15*RO2 + 0.68*CH2O + 1.8*CO2 + 0.5*CH3COCH3 + 0.65*CH3CO3 + 0.2*HO2 + 0.7*CO
    force(i,155) = force(i,155) - rate_constant(i,397) * number_density(i,166) * number_density(i,155)

    ! k_CH3O2_TERP2O2_1: CH3O2 + TERP2O2 -> 1*TERPROD2 + 0.93*CH2O + 0.25*CH3OH + 1*HO2 + 0.5*CO2 + 0.125*CO + 0.125*GLYALD + 0.15*CH3COCH3
    force(i,155) = force(i,155) + rate_constant(i,414) * number_density(i,191) * number_density(i,145)

    ! GLYALD
    force(i,156) = 0

    ! k_MACRO2_NO_1: MACRO2 + NO -> 1*NO2 + 0.47*HO2 + 0.25*CH2O + 0.53*GLYALD + 0.25*CH3COCHO + 0.53*CH3CO3 + 0.22*HYAC + 0.22*CO
    force(i,156) = force(i,156) + 0.53*rate_constant(i,40) * number_density(i,188) * number_density(i,137)

    ! k_TERP2OOH_1: TERP2OOH -> 1*OH + 0.375*CH2O + 0.3*CH3COCH3 + 0.25*CO + 1*CO2 + 1*TERPROD2 + 1*HO2 + 0.25*GLYALD
    force(i,156) = force(i,156) + 0.25*rate_constant(i,49) * number_density(i,37)

    ! k_ISOPNITB_OH_1: ISOPNITB + OH -> 0.5*HYAC + 0.5*GLYALD + 0.5*NOA + 1*HO2 + 0.5*HONITR
    force(i,156) = force(i,156) + 0.5*rate_constant(i,79) * number_density(i,73) * number_density(i,166)

    ! k_ISOPBO2_NO_1: ISOPBO2 + NO -> 0.87*HYDRALD + 0.08*ISOPNITB + 0.92*NO2 + 0.92*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    force(i,156) = force(i,156) + 0.05*rate_constant(i,96) * number_density(i,190) * number_density(i,137)

    ! k_CH3CO3_XO2_1: CH3CO3 + XO2 -> 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 1*CH3O2 + 1*HO2 + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD + 1*CO2
    force(i,156) = force(i,156) + 0.25*rate_constant(i,106) * number_density(i,49) * number_density(i,153)

    ! k_NO3_XO2_1: NO3 + XO2 -> 1*NO2 + 1*HO2 + 0.5*CO + 0.25*HYAC + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*GLYALD
    force(i,156) = force(i,156) + 0.25*rate_constant(i,109) * number_density(i,165) * number_density(i,153)

    ! k_NO_TERP2O2_1: NO + TERP2O2 -> 0.1*ONITR + 0.9*NO2 + 0.34*CH2O + 0.27*CH3COCH3 + 0.225*CO + 0.9*CO2 + 0.9*TERPROD2 + 0.9*HO2 + 0.225*GLYALD
    force(i,156) = force(i,156) + 0.225*rate_constant(i,110) * number_density(i,137) * number_density(i,145)

    ! k_GLYALD_OH_1: GLYALD + OH -> 1*HO2 + 0.2*GLYOXAL + 0.8*CH2O + 0.8*CO2
    force(i,156) = force(i,156) - rate_constant(i,123) * number_density(i,156) * number_density(i,166)

    ! k_MACRO2_NO3_1: MACRO2 + NO3 -> 1*NO2 + 0.47*HO2 + 0.25*CH2O + 0.25*CH3COCHO + 0.22*CO + 0.53*GLYALD + 0.22*HYAC + 0.53*CH3CO3
    force(i,156) = force(i,156) + 0.53*rate_constant(i,134) * number_density(i,188) * number_density(i,165)

    ! k_CH3O2_MBOO2_1: CH3O2 + MBOO2 -> 0.917*CH2O + 1*HO2 + 0.25*CH3OH + 0.333*GLYALD + 0.333*CH3COCH3 + 0.167*HMPROP
    force(i,156) = force(i,156) + 0.333*rate_constant(i,155) * number_density(i,191) * number_density(i,125)

    ! k_HONITR_1: HONITR -> 1*NO2 + 0.67*HO2 + 0.33*CH3CHO + 0.33*CH2O + 0.33*CO + 0.33*GLYALD + 0.33*CH3CO3 + 0.17*HYAC + 0.17*CH3COCH3
    force(i,156) = force(i,156) + 0.33*rate_constant(i,171) * number_density(i,134)

    ! k_ISOPBO2_NO3_1: ISOPBO2 + NO3 -> 1*NO2 + 0.95*HYDRALD + 1*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    force(i,156) = force(i,156) + 0.05*rate_constant(i,178) * number_density(i,190) * number_density(i,165)

    ! k_CH3CO3_MACRO2_1: CH3CO3 + MACRO2 -> 0.25*CH3COCHO + 1*CH3O2 + 0.22*CO + 0.47*HO2 + 0.53*GLYALD + 0.22*HYAC + 0.25*CH2O + 0.53*CH3CO3
    force(i,156) = force(i,156) + 0.53*rate_constant(i,235) * number_density(i,49) * number_density(i,188)

    ! k_NO_XO2_1: NO + XO2 -> 1*NO2 + 1*HO2 + 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD
    force(i,156) = force(i,156) + 0.25*rate_constant(i,252) * number_density(i,137) * number_density(i,153)
  end do
  !$acc end parallel

end subroutine p_force44

subroutine p_force45(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_NC4CH2OH_OH_1: NC4CH2OH + OH -> 1*GLYALD + 1*NOA + 1*HO2
    force(i,156) = force(i,156) + rate_constant(i,295) * number_density(i,158) * number_density(i,166)

    ! k_MBOO2_NO_1: MBOO2 + NO -> 1*HO2 + 0.67*GLYALD + 0.67*CH3COCH3 + 0.33*HMPROP + 0.33*CH2O + 1*NO2
    force(i,156) = force(i,156) + 0.67*rate_constant(i,308) * number_density(i,125) * number_density(i,137)

    ! k_CH3O2_MACRO2_1: CH3O2 + MACRO2 -> 0.73*HO2 + 0.88*CH2O + 0.11*CO + 0.24*CH3COCHO + 0.26*GLYALD + 0.26*CH3CO3 + 0.25*CH3OH + 0.23*HYAC
    force(i,156) = force(i,156) + 0.26*rate_constant(i,322) * number_density(i,191) * number_density(i,188)

    ! k_GLYALD_1: GLYALD -> 2*HO2 + 1*CO + 1*CH2O
    force(i,156) = force(i,156) - rate_constant(i,338) * number_density(i,156)

    ! k_ISOPNITA_OH_1: ISOPNITA + OH -> 0.7*HYAC + 0.7*GLYALD + 0.7*NO2 + 0.3*CH2O + 0.3*HONITR + 0.3*HO2
    force(i,156) = force(i,156) + 0.7*rate_constant(i,364) * number_density(i,118) * number_density(i,166)

    ! k_CH3O2_XO2_1: CH3O2 + XO2 -> 0.3*CH3OH + 0.8*HO2 + 0.8*CH2O + 0.2*CO + 0.1*GLYOXAL + 0.1*CH3COCHO + 0.1*HYAC + 0.1*GLYALD
    force(i,156) = force(i,156) + 0.1*rate_constant(i,410) * number_density(i,191) * number_density(i,153)

    ! k_CH3O2_TERP2O2_1: CH3O2 + TERP2O2 -> 1*TERPROD2 + 0.93*CH2O + 0.25*CH3OH + 1*HO2 + 0.5*CO2 + 0.125*CO + 0.125*GLYALD + 0.15*CH3COCH3
    force(i,156) = force(i,156) + 0.125*rate_constant(i,414) * number_density(i,191) * number_density(i,145)

    ! k_EO_O2_1: EO + O2 -> 1*GLYALD + 1*HO2
    force(i,156) = force(i,156) + rate_constant(i,442) * number_density(i,162) * number_density(i,41)

    ! MACR
    force(i,157) = 0

    ! k_CH3CO3_ISOPAO2_1: CH3CO3 + ISOPAO2 -> 1*CH3O2 + 1*HO2 + 1*CH2O + 0.39*MACR + 0.61*MVK + 1*CO2
    force(i,157) = force(i,157) + 0.39*rate_constant(i,65) * number_density(i,49) * number_density(i,189)

    ! k_MACR_O3_1: MACR + O3 -> 0.12*CH2O + 0.24*OH + 0.65*CO + 0.1*CH3CO3 + 0.88*CH3COCHO + 0.33*HCOOH + 0.14*HO2
    force(i,157) = force(i,157) - rate_constant(i,101) * number_density(i,157) * number_density(i,171)

    ! k_MACR_1: MACR -> 0.66*HO2 + 1.34*CO
    force(i,157) = force(i,157) - rate_constant(i,138) * number_density(i,157)

    ! k_MACR_OH_1: MACR + OH -> 0.5*MACRO2 + 0.5*H2O + 0.5*MCO3
    force(i,157) = force(i,157) - rate_constant(i,220) * number_density(i,157) * number_density(i,166)

    ! k_ISOPOOH_1: ISOPOOH -> 0.402*MVK + 0.288*MACR + 0.69*CH2O + 1*HO2
    force(i,157) = force(i,157) + 0.288*rate_constant(i,233) * number_density(i,138)

    ! k_MACR_2: MACR -> 1.34*HO2 + 0.66*MCO3 + 1.34*CH2O + 1.34*CH3CO3
    force(i,157) = force(i,157) - rate_constant(i,272) * number_density(i,157)

    ! k_ISOPAO2_NO3_1: ISOPAO2 + NO3 -> 1*NO2 + 0.4*MACR + 0.6*MVK + 1*CH2O + 1*HO2
    force(i,157) = force(i,157) + 0.4*rate_constant(i,330) * number_density(i,189) * number_density(i,165)

    ! k_ISOP_O3_2: ISOP + O3 -> 0.3*MACR + 0.2*MVK + 0.11*HCOOH + 0.62*CO + 0.32*OH + 0.37*HO2 + 0.91*CH2O + 0.08*CH3CO3 + 0.13*C3H6 + 0.05*CH3O2
    force(i,157) = force(i,157) + 0.3*rate_constant(i,377) * number_density(i,142) * number_density(i,171)

    ! k_CH3O2_ISOPAO2_1: CH3O2 + ISOPAO2 -> 0.25*CH3OH + 1*HO2 + 1.5*CH2O + 0.31*MACR + 0.44*MVK
    force(i,157) = force(i,157) + 0.31*rate_constant(i,434) * number_density(i,191) * number_density(i,189)

    ! k_ISOPAO2_NO_1: ISOPAO2 + NO -> 0.08*ISOPNITA + 0.92*NO2 + 0.36*MACR + 0.56*MVK + 0.92*CH2O + 0.92*HO2
    force(i,157) = force(i,157) + 0.36*rate_constant(i,464) * number_density(i,189) * number_density(i,137)

    ! NC4CH2OH
    force(i,158) = 0

    ! k_CH3O2_ISOPNO3_1: CH3O2 + ISOPNO3 -> 0.8*NC4CHO + 1.2*HO2 + 0.8*CH2O + 0.2*CH3OH + 0.2*NC4CH2OH
    force(i,158) = force(i,158) + 0.2*rate_constant(i,160) * number_density(i,191) * number_density(i,46)

    ! k_NC4CH2OH_OH_1: NC4CH2OH + OH -> 1*GLYALD + 1*NOA + 1*HO2
    force(i,158) = force(i,158) - rate_constant(i,295) * number_density(i,158) * number_density(i,166)

    ! MPAN
    force(i,159) = 0

    ! k_MPAN_OH_1: MPAN + OH -> 0.5*HYAC + 0.5*NO3 + 0.5*CH2O + 0.5*HO2 + 0.5*CO2
    force(i,159) = force(i,159) - rate_constant(i,28) * number_density(i,159) * number_density(i,166)

    ! k_MCO3_NO2_1: MCO3 + NO2 -> 1*MPAN
    force(i,159) = force(i,159) + rate_constant(i,72) * number_density(i,167) * number_density(i,54)

    ! k_MPAN_1: MPAN -> 1*MCO3 + 1*NO2
    force(i,159) = force(i,159) - rate_constant(i,288) * number_density(i,159)

    ! k_MPAN_2: MPAN -> 1*MCO3 + 1*NO2
    force(i,159) = force(i,159) - rate_constant(i,438) * number_density(i,159)

    ! ISOPNOOH
    force(i,160) = 0

    ! k_ISOPNOOH_OH_1: ISOPNOOH + OH -> 1*NOA + 1*HO2
    force(i,160) = force(i,160) - rate_constant(i,271) * number_density(i,160) * number_density(i,166)

    ! k_ISOPNOOH_1: ISOPNOOH -> 1*NO2 + 1*HO2 + 1*ISOPOOH
    force(i,160) = force(i,160) - rate_constant(i,297) * number_density(i,160)

    ! k_HO2_ISOPNO3_1: HO2 + ISOPNO3 -> 1*ISOPNOOH
    force(i,160) = force(i,160) + rate_constant(i,335) * number_density(i,192) * number_density(i,46)

    ! N2O
    force(i,161) = 0

    ! k_N2O_1: N2O -> 1*O1D + 1*N2
    force(i,161) = force(i,161) - rate_constant(i,147) * number_density(i,161)

    ! k_N2O_O1D_1: N2O + O1D -> 2*NO
    force(i,161) = force(i,161) - rate_constant(i,180) * number_density(i,161) * number_density(i,112)
  end do
  !$acc end parallel

end subroutine p_force45

subroutine p_force46(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_N_NO2_3: N + NO2 -> 1*N2O + 1*O
    force(i,161) = force(i,161) + rate_constant(i,273) * number_density(i,185) * number_density(i,54)

    ! k_N2O_O1D_2: N2O + O1D -> 1*N2 + 1*O2
    force(i,161) = force(i,161) - rate_constant(i,443) * number_density(i,161) * number_density(i,112)

    ! EO
    force(i,162) = 0

    ! k_EO2_NO_1: EO2 + NO -> 0.5*CH2O + 0.25*HO2 + 0.75*EO + 1*NO2
    force(i,162) = force(i,162) + 0.75*rate_constant(i,16) * number_density(i,163) * number_density(i,137)

    ! k_EOOH_1: EOOH -> 1*EO + 1*OH
    force(i,162) = force(i,162) + rate_constant(i,339) * number_density(i,78)

    ! k_EO_1: EO -> 2*CH2O + 1*HO2
    force(i,162) = force(i,162) - rate_constant(i,372) * number_density(i,162)

    ! k_EO_O2_1: EO + O2 -> 1*GLYALD + 1*HO2
    force(i,162) = force(i,162) - rate_constant(i,442) * number_density(i,162) * number_density(i,41)

    ! EO2
    force(i,163) = 0

    ! k_EO2_NO_1: EO2 + NO -> 0.5*CH2O + 0.25*HO2 + 0.75*EO + 1*NO2
    force(i,163) = force(i,163) - rate_constant(i,16) * number_density(i,163) * number_density(i,137)

    ! k_EO2_HO2_1: EO2 + HO2 -> 1*EOOH
    force(i,163) = force(i,163) - rate_constant(i,152) * number_density(i,163) * number_density(i,192)

    ! k_C2H4_OH_1: C2H4 + OH -> 1*EO2
    force(i,163) = force(i,163) + rate_constant(i,319) * number_density(i,93) * number_density(i,166)

    ! MDIALO2
    force(i,164) = 0

    ! k_MDIALO2_NO2_1: MDIALO2 + NO2 -> 
    force(i,164) = force(i,164) - rate_constant(i,88) * number_density(i,164) * number_density(i,54)

    ! k_BIGALD3_1: BIGALD3 -> 0.6*HO2 + 0.6*CO + 0.6*MDIALO2
    force(i,164) = force(i,164) + 0.6*rate_constant(i,126) * number_density(i,108)

    ! k_HO2_MDIALO2_1: HO2 + MDIALO2 -> 0.4*OH + 0.33*HO2 + 0.07*CH3COCHO + 0.14*CO + 0.07*CH3O2 + 0.07*GLYOXAL
    force(i,164) = force(i,164) - rate_constant(i,161) * number_density(i,192) * number_density(i,164)

    ! k_MDIALO2_NO_1: MDIALO2 + NO -> 1*NO2 + 0.83*HO2 + 0.17*CH3COCHO + 0.35*CO + 0.17*CH3O2 + 0.17*GLYOXAL
    force(i,164) = force(i,164) - rate_constant(i,403) * number_density(i,164) * number_density(i,137)

    ! NO3
    force(i,165) = 0

    ! k_NO3_OH_1: NO3 + OH -> 1*HO2 + 1*NO2
    force(i,165) = force(i,165) - rate_constant(i,9) * number_density(i,165) * number_density(i,166)

    ! k_MBO_NO3_1: MBO + NO3 -> 1*MBONO3O2
    force(i,165) = force(i,165) - rate_constant(i,11) * number_density(i,127) * number_density(i,165)

    ! k_MPAN_OH_1: MPAN + OH -> 0.5*HYAC + 0.5*NO3 + 0.5*CH2O + 0.5*HO2 + 0.5*CO2
    force(i,165) = force(i,165) + 0.5*rate_constant(i,28) * number_density(i,159) * number_density(i,166)

    ! k_CH3CHO_NO3_1: CH3CHO + NO3 -> 1*CH3CO3 + 1*HNO3
    force(i,165) = force(i,165) - rate_constant(i,34) * number_density(i,178) * number_density(i,165)

    ! k_NO_NO3_1: NO + NO3 -> 2*NO2
    force(i,165) = force(i,165) - rate_constant(i,41) * number_density(i,137) * number_density(i,165)

    ! k_MBONO3O2_NO3_1: MBONO3O2 + NO3 -> 0.25*HMPROP + 0.25*CH2O + 1.25*NO2 + 0.75*HONITR + 0.75*CH3COCH3 + 0.75*HO2
    force(i,165) = force(i,165) - rate_constant(i,44) * number_density(i,123) * number_density(i,165)

    ! k_BRONO2_1: BRONO2 -> 1*BR + 1*NO3
    force(i,165) = force(i,165) + rate_constant(i,56) * number_density(i,72)

    ! k_NO3_XO2_1: NO3 + XO2 -> 1*NO2 + 1*HO2 + 0.5*CO + 0.25*HYAC + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*GLYALD
    force(i,165) = force(i,165) - rate_constant(i,109) * number_density(i,165) * number_density(i,153)

    ! k_MTERP_NO3_1: MTERP + NO3 -> 1*NTERPO2
    force(i,165) = force(i,165) - rate_constant(i,111) * number_density(i,31) * number_density(i,165)

    ! k_NO3_O_1: NO3 + O -> 1*NO2 + 1*O2
    force(i,165) = force(i,165) - rate_constant(i,129) * number_density(i,165) * number_density(i,187)

    ! k_MACRO2_NO3_1: MACRO2 + NO3 -> 1*NO2 + 0.47*HO2 + 0.25*CH2O + 0.25*CH3COCHO + 0.22*CO + 0.53*GLYALD + 0.22*HYAC + 0.53*CH3CO3
    force(i,165) = force(i,165) - rate_constant(i,134) * number_density(i,188) * number_density(i,165)

    ! k_OH_PAN_1: OH + PAN -> 1*CH2O + 1*NO3
    force(i,165) = force(i,165) + rate_constant(i,144) * number_density(i,166) * number_density(i,12)

    ! k_MCO3_NO3_1: MCO3 + NO3 -> 1*NO2 + 1*CH2O + 1*CH3CO3
    force(i,165) = force(i,165) - rate_constant(i,146) * number_density(i,167) * number_density(i,165)

    ! k_NO2_O3_1: NO2 + O3 -> 1*NO3 + 1*O2
    force(i,165) = force(i,165) + rate_constant(i,165) * number_density(i,54) * number_density(i,171)

    ! k_ISOPBO2_NO3_1: ISOPBO2 + NO3 -> 1*NO2 + 0.95*HYDRALD + 1*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    force(i,165) = force(i,165) - rate_constant(i,178) * number_density(i,190) * number_density(i,165)

    ! k_NO3_1: NO3 -> 1*NO2 + 1*O
    force(i,165) = force(i,165) - rate_constant(i,189) * number_density(i,165)

    ! k_DMS_NO3_1: DMS + NO3 -> 1*SO2 + 1*HNO3
    force(i,165) = force(i,165) - rate_constant(i,197) * number_density(i,99) * number_density(i,165)
  end do
  !$acc end parallel

end subroutine p_force46

subroutine p_force47(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_C3H6_NO3_1: C3H6 + NO3 -> 1*NOA
    force(i,165) = force(i,165) - rate_constant(i,221) * number_density(i,120) * number_density(i,165)

    ! k_BCARY_NO3_1: BCARY + NO3 -> 1*NTERPO2
    force(i,165) = force(i,165) - rate_constant(i,225) * number_density(i,102) * number_density(i,165)

    ! k_N2O5_1: N2O5 -> 1*NO2 + 1*NO3
    force(i,165) = force(i,165) + rate_constant(i,236) * number_density(i,51)

    ! k_N2O5_2: N2O5 -> 1*NO + 1*O + 1*NO3
    force(i,165) = force(i,165) + rate_constant(i,278) * number_density(i,51)

    ! k_CLONO2_1: CLONO2 -> 1*CL + 1*NO3
    force(i,165) = force(i,165) + rate_constant(i,290) * number_density(i,74)

    ! k_NO3_TERPROD1_1: NO3 + TERPROD1 -> 0.5*TERP2O2 + 0.5*NTERPO2
    force(i,165) = force(i,165) - rate_constant(i,309) * number_density(i,165) * number_density(i,58)

    ! k_ISOPAO2_NO3_1: ISOPAO2 + NO3 -> 1*NO2 + 0.4*MACR + 0.6*MVK + 1*CH2O + 1*HO2
    force(i,165) = force(i,165) - rate_constant(i,330) * number_density(i,189) * number_density(i,165)

    ! k_CLONO2_OH_1: CLONO2 + OH -> 1*HOCL + 1*NO3
    force(i,165) = force(i,165) + rate_constant(i,334) * number_density(i,74) * number_density(i,166)

    ! k_PAN_2: PAN -> 0.6*CH3CO3 + 0.6*NO2 + 0.4*CH3O2 + 0.4*NO3 + 0.4*CO2
    force(i,165) = force(i,165) + 0.4*rate_constant(i,362) * number_density(i,12)

    ! k_NO3_2: NO3 -> 1*NO + 1*O2
    force(i,165) = force(i,165) - rate_constant(i,374) * number_density(i,165)

    ! k_ISOP_NO3_2: ISOP + NO3 -> 1*ISOPNO3
    force(i,165) = force(i,165) - rate_constant(i,385) * number_density(i,142) * number_density(i,165)

    ! k_BIGENE_NO3_1: BIGENE + NO3 -> 1*NO2 + 1*CH3CHO + 0.5*CH2O + 0.5*CH3COCH3
    force(i,165) = force(i,165) - rate_constant(i,387) * number_density(i,97) * number_density(i,165)

    ! k_NO3_NTERPO2_1: NO3 + NTERPO2 -> 2*NO2 + 1*TERPROD1
    force(i,165) = force(i,165) - rate_constant(i,389) * number_density(i,165) * number_density(i,143)

    ! k_HNO3_OH_1: HNO3 + OH -> 1*NO3 + 1*H2O
    force(i,165) = force(i,165) + rate_constant(i,398) * number_density(i,42) * number_density(i,166)

    ! k_HNO3_OH_2: HNO3 + OH -> 1*NO3 + 1*H2O
    force(i,165) = force(i,165) + rate_constant(i,399) * number_density(i,42) * number_density(i,166)

    ! k_HO2NO2_3: HO2NO2 -> 1*OH + 1*NO3
    force(i,165) = force(i,165) + rate_constant(i,400) * number_density(i,35)

    ! k_CH3COCHO_NO3_1: CH3COCHO + NO3 -> 1*HNO3 + 1*CO + 1*CH3CO3
    force(i,165) = force(i,165) - rate_constant(i,405) * number_density(i,111) * number_density(i,165)

    ! k_BRONO2_O_1: BRONO2 + O -> 1*BRO + 1*NO3
    force(i,165) = force(i,165) + rate_constant(i,418) * number_density(i,72) * number_density(i,187)

    ! k_CH2O_NO3_1: CH2O + NO3 -> 1*CO + 1*HO2 + 1*HNO3
    force(i,165) = force(i,165) - rate_constant(i,423) * number_density(i,124) * number_density(i,165)

    ! k_N2O5_3: N2O5 -> 1*NO2 + 1*NO3
    force(i,165) = force(i,165) + rate_constant(i,427) * number_density(i,51)

    ! k_ISOPNO3_NO3_1: ISOPNO3 + NO3 -> 1*NC4CHO + 1*NO2 + 1*HO2
    force(i,165) = force(i,165) - rate_constant(i,451) * number_density(i,46) * number_density(i,165)

    ! k_HO2_NO3_1: HO2 + NO3 -> 1*OH + 1*NO2 + 1*O2
    force(i,165) = force(i,165) - rate_constant(i,454) * number_density(i,192) * number_density(i,165)

    ! k_CLONO2_O_1: CLONO2 + O -> 1*CLO + 1*NO3
    force(i,165) = force(i,165) + rate_constant(i,463) * number_density(i,74) * number_density(i,187)

    ! k_NO2_O_2: NO2 + O -> 1*NO3
    force(i,165) = force(i,165) + rate_constant(i,472) * number_density(i,54) * number_density(i,187)

    ! k_CL_CLONO2_1: CL + CLONO2 -> 1*CL2 + 1*NO3
    force(i,165) = force(i,165) + rate_constant(i,480) * number_density(i,100) * number_density(i,74)

    ! k_NO2_NO3_1: NO2 + NO3 -> 1*N2O5
    force(i,165) = force(i,165) - rate_constant(i,481) * number_density(i,54) * number_density(i,165)

    ! OH
    force(i,166) = 0

    ! k_C2H2_OH_1: C2H2 + OH -> 0.65*GLYOXAL + 0.65*OH + 0.35*HCOOH + 0.35*HO2 + 0.35*CO
    force(i,166) = force(i,166) - 0.35*rate_constant(i,2) * number_density(i,168) * number_density(i,166)

    ! k_C3H7OOH_OH_1: C3H7OOH + OH -> 1*H2O + 1*C3H7O2
    force(i,166) = force(i,166) - rate_constant(i,4) * number_density(i,20) * number_density(i,166)

    ! k_OH_XYLENES_1: OH + XYLENES -> 0.15*XYLOL + 0.23*TEPOMUC + 0.06*BZOO + 0.56*XYLENO2 + 0.38*HO2
    force(i,166) = force(i,166) - rate_constant(i,7) * number_density(i,166) * number_density(i,140)

    ! k_NO3_OH_1: NO3 + OH -> 1*HO2 + 1*NO2
    force(i,166) = force(i,166) - rate_constant(i,9) * number_density(i,165) * number_density(i,166)

    ! k_CH2O_O_1: CH2O + O -> 1*HO2 + 1*OH + 1*CO
    force(i,166) = force(i,166) + rate_constant(i,10) * number_density(i,124) * number_density(i,187)

    ! k_HCFC142B_OH_1: HCFC142B + OH -> 1*CL + 1*COF2
    force(i,166) = force(i,166) - rate_constant(i,14) * number_density(i,172) * number_density(i,166)

    ! k_XYLENOOH_1: XYLENOOH -> 1*OH + 1*HO2 + 0.34*GLYOXAL + 0.54*CH3COCHO + 0.06*BIGALD1 + 0.2*BIGALD2 + 0.15*BIGALD3 + 0.21*BIGALD4
    force(i,166) = force(i,166) + rate_constant(i,20) * number_density(i,92)
  end do
  !$acc end parallel

end subroutine p_force47

subroutine p_force48(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_OH_SO2_1: OH + SO2 -> 1*SO3 + 1*HO2
    force(i,166) = force(i,166) - rate_constant(i,22) * number_density(i,166) * number_density(i,55)

    ! k_HONITR_OH_1: HONITR + OH -> 1*ONITR + 1*HO2
    force(i,166) = force(i,166) - rate_constant(i,26) * number_density(i,134) * number_density(i,166)

    ! k_MPAN_OH_1: MPAN + OH -> 0.5*HYAC + 0.5*NO3 + 0.5*CH2O + 0.5*HO2 + 0.5*CO2
    force(i,166) = force(i,166) - rate_constant(i,28) * number_density(i,159) * number_density(i,166)

    ! k_HOCL_OH_1: HOCL + OH -> 1*H2O + 1*CLO
    force(i,166) = force(i,166) - rate_constant(i,30) * number_density(i,88) * number_density(i,166)

    ! k_CH4_1: CH4 -> 1.44*H2 + 0.18*CH2O + 0.18*O + 0.33*OH + 0.33*H + 0.44*CO2 + 0.38*CO + 0.05*H2O
    force(i,166) = force(i,166) + 0.33*rate_constant(i,37) * number_density(i,45)

    ! k_H2O_O1D_1: H2O + O1D -> 2*OH
    force(i,166) = force(i,166) + 2*rate_constant(i,39) * number_density(i,68) * number_density(i,112)

    ! k_CLO_OH_1: CLO + OH -> 1*HCL + 1*O2
    force(i,166) = force(i,166) - rate_constant(i,43) * number_density(i,86) * number_density(i,166)

    ! k_TERP2OOH_1: TERP2OOH -> 1*OH + 0.375*CH2O + 0.3*CH3COCH3 + 0.25*CO + 1*CO2 + 1*TERPROD2 + 1*HO2 + 0.25*GLYALD
    force(i,166) = force(i,166) + rate_constant(i,49) * number_density(i,37)

    ! k_OH_XYLENOOH_1: OH + XYLENOOH -> 1*XYLENO2
    force(i,166) = force(i,166) - rate_constant(i,50) * number_density(i,166) * number_density(i,92)

    ! k_ACBZO2_HO2_1: ACBZO2 + HO2 -> 0.4*C6H5O2 + 0.4*OH
    force(i,166) = force(i,166) + 0.4*rate_constant(i,52) * number_density(i,43) * number_density(i,192)

    ! k_HCL_O1D_1: HCL + O1D -> 1*CL + 1*OH
    force(i,166) = force(i,166) + rate_constant(i,53) * number_density(i,180) * number_density(i,112)

    ! k_HO2NO2_OH_1: HO2NO2 + OH -> 1*H2O + 1*NO2 + 1*O2
    force(i,166) = force(i,166) - rate_constant(i,54) * number_density(i,35) * number_density(i,166)

    ! k_BZALD_OH_1: BZALD + OH -> 1*ACBZO2
    force(i,166) = force(i,166) - rate_constant(i,57) * number_density(i,107) * number_density(i,166)

    ! k_MEK_OH_1: MEK + OH -> 1*MEKO2
    force(i,166) = force(i,166) - rate_constant(i,66) * number_density(i,104) * number_density(i,166)

    ! k_CH3COCH3_OH_1: CH3COCH3 + OH -> 1*RO2 + 1*H2O
    force(i,166) = force(i,166) - rate_constant(i,68) * number_density(i,89) * number_density(i,166)

    ! k_CH3COCH3_OH_2: CH3COCH3 + OH -> 1*RO2 + 1*H2O
    force(i,166) = force(i,166) - rate_constant(i,69) * number_density(i,89) * number_density(i,166)

    ! k_OH_TOLOOH_1: OH + TOLOOH -> 1*TOLO2
    force(i,166) = force(i,166) - rate_constant(i,70) * number_density(i,166) * number_density(i,95)

    ! k_ISOP_OH_2: ISOP + OH -> 0.6*ISOPAO2 + 0.4*ISOPBO2
    force(i,166) = force(i,166) - rate_constant(i,76) * number_density(i,142) * number_density(i,166)

    ! k_ISOPNITB_OH_1: ISOPNITB + OH -> 0.5*HYAC + 0.5*GLYALD + 0.5*NOA + 1*HO2 + 0.5*HONITR
    force(i,166) = force(i,166) - rate_constant(i,79) * number_density(i,73) * number_density(i,166)

    ! k_OH_XYLOL_1: OH + XYLOL -> 0.3*XYLOLO2 + 0.63*HO2 + 0.07*PHENO
    force(i,166) = force(i,166) - rate_constant(i,80) * number_density(i,166) * number_density(i,14)

    ! k_XYLOLOOH_1: XYLOLOOH -> 1*OH + 0.17*GLYOXAL + 0.51*CH3COCHO + 1*HO2
    force(i,166) = force(i,166) + rate_constant(i,86) * number_density(i,26)

    ! k_MEKOOH_1: MEKOOH -> 1*OH + 1*CH3CO3 + 1*CH3CHO
    force(i,166) = force(i,166) + rate_constant(i,89) * number_density(i,136)

    ! k_CH3CL_OH_1: CH3CL + OH -> 1*CL + 1*H2O + 1*HO2
    force(i,166) = force(i,166) - rate_constant(i,92) * number_density(i,53) * number_density(i,166)

    ! k_CRESOL_OH_1: CRESOL + OH -> 0.2*PHENO2 + 0.73*HO2 + 0.07*PHENO
    force(i,166) = force(i,166) - rate_constant(i,95) * number_density(i,139) * number_density(i,166)

    ! k_PHENOOH_1: PHENOOH -> 1*OH + 1*HO2 + 0.7*GLYOXAL
    force(i,166) = force(i,166) + rate_constant(i,98) * number_density(i,115)

    ! k_OH_OH_1: OH + OH -> 1*H2O + 1*O
    force(i,166) = force(i,166) - rate_constant(i,100) * number_density(i,166) * number_density(i,166)

    ! k_OH_OH_1: OH + OH -> 1*H2O + 1*O
    force(i,166) = force(i,166) - rate_constant(i,100) * number_density(i,166) * number_density(i,166)

    ! k_MACR_O3_1: MACR + O3 -> 0.12*CH2O + 0.24*OH + 0.65*CO + 0.1*CH3CO3 + 0.88*CH3COCHO + 0.33*HCOOH + 0.14*HO2
    force(i,166) = force(i,166) + 0.24*rate_constant(i,101) * number_density(i,157) * number_density(i,171)

    ! k_ALKOOH_OH_1: ALKOOH + OH -> 1*ALKO2
    force(i,166) = force(i,166) - rate_constant(i,104) * number_density(i,65) * number_density(i,166)

    ! k_MBOOOH_OH_1: MBOOOH + OH -> 0.5*MBOO2 + 0.5*OH
    force(i,166) = force(i,166) - 0.5*rate_constant(i,105) * number_density(i,150) * number_density(i,166)

    ! k_CH3COOH_OH_1: CH3COOH + OH -> 1*CH3O2 + 1*CO2 + 1*H2O
    force(i,166) = force(i,166) - rate_constant(i,107) * number_density(i,177) * number_density(i,166)

    ! k_CH3CHO_OH_1: CH3CHO + OH -> 1*CH3CO3 + 1*H2O
    force(i,166) = force(i,166) - rate_constant(i,108) * number_density(i,178) * number_density(i,166)

    ! k_CH3BR_OH_1: CH3BR + OH -> 1*BR + 1*H2O + 1*HO2
    force(i,166) = force(i,166) - rate_constant(i,112) * number_density(i,94) * number_density(i,166)

    ! k_C3H7OOH_1: C3H7OOH -> 0.82*CH3COCH3 + 1*OH + 1*HO2
    force(i,166) = force(i,166) + rate_constant(i,115) * number_density(i,20)
  end do
  !$acc end parallel

end subroutine p_force48

subroutine p_force49(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_CH3COCHO_OH_1: CH3COCHO + OH -> 1*CH3CO3 + 1*CO + 1*H2O
    force(i,166) = force(i,166) - rate_constant(i,122) * number_density(i,111) * number_density(i,166)

    ! k_GLYALD_OH_1: GLYALD + OH -> 1*HO2 + 0.2*GLYOXAL + 0.8*CH2O + 0.8*CO2
    force(i,166) = force(i,166) - rate_constant(i,123) * number_density(i,156) * number_density(i,166)

    ! k_OH_POOH_1: OH + POOH -> 0.5*PO2 + 0.5*OH + 0.5*HYAC + 1*H2O
    force(i,166) = force(i,166) - 0.5*rate_constant(i,127) * number_density(i,166) * number_density(i,9)

    ! k_CH3CCL3_OH_1: CH3CCL3 + OH -> 1*H2O + 3*CL
    force(i,166) = force(i,166) - rate_constant(i,130) * number_density(i,79) * number_density(i,166)

    ! k_HO2_RO2_1: HO2 + RO2 -> 0.85*ROOH + 0.15*OH + 0.15*CH2O + 0.15*CH3CO3
    force(i,166) = force(i,166) + 0.15*rate_constant(i,133) * number_density(i,192) * number_density(i,40)

    ! k_MACROOH_OH_1: MACROOH + OH -> 0.5*MCO3 + 0.2*MACRO2 + 0.1*OH + 0.2*HO2
    force(i,166) = force(i,166) - 0.9*rate_constant(i,136) * number_density(i,44) * number_density(i,166)

    ! k_HO2_MEKO2_1: HO2 + MEKO2 -> 0.8*MEKOOH + 0.2*OH + 0.2*CH3CHO + 0.2*CH3CO3
    force(i,166) = force(i,166) + 0.2*rate_constant(i,139) * number_density(i,192) * number_density(i,128)

    ! k_NTERPOOH_1: NTERPOOH -> 1*TERPROD1 + 1*NO2 + 1*OH
    force(i,166) = force(i,166) + rate_constant(i,143) * number_density(i,114)

    ! k_OH_PAN_1: OH + PAN -> 1*CH2O + 1*NO3
    force(i,166) = force(i,166) - rate_constant(i,144) * number_density(i,166) * number_density(i,12)

    ! k_ROOH_1: ROOH -> 1*CH3CO3 + 1*CH2O + 1*OH
    force(i,166) = force(i,166) + rate_constant(i,148) * number_density(i,121)

    ! k_OH_TERPROD1_1: OH + TERPROD1 -> 1*TERP2O2
    force(i,166) = force(i,166) - rate_constant(i,151) * number_density(i,166) * number_density(i,58)

    ! k_CH3CN_OH_1: CH3CN + OH -> 1*HO2
    force(i,166) = force(i,166) - rate_constant(i,153) * number_density(i,50) * number_density(i,166)

    ! k_H_O3_1: H + O3 -> 1*OH + 1*O2
    force(i,166) = force(i,166) + rate_constant(i,158) * number_density(i,48) * number_density(i,171)

    ! k_HO2_MDIALO2_1: HO2 + MDIALO2 -> 0.4*OH + 0.33*HO2 + 0.07*CH3COCHO + 0.14*CO + 0.07*CH3O2 + 0.07*GLYOXAL
    force(i,166) = force(i,166) + 0.4*rate_constant(i,161) * number_density(i,192) * number_density(i,164)

    ! k_POOH_1: POOH -> 1*CH3CHO + 1*CH2O + 1*HO2 + 1*OH
    force(i,166) = force(i,166) + rate_constant(i,162) * number_density(i,9)

