    force(i,166) = force(i,166) - rate_constant(i,220) * number_density(i,157) * number_density(i,166)

    ! k_HBR_OH_1: HBR + OH -> 1*BR + 1*H2O
    force(i,166) = force(i,166) - rate_constant(i,226) * number_density(i,80) * number_density(i,166)

    ! k_DMS_OH_1: DMS + OH -> 0.5*SO2 + 0.5*HO2
    force(i,166) = force(i,166) - rate_constant(i,227) * number_density(i,99) * number_density(i,166)

    ! k_MBO_O3_1: MBO + O3 -> 0.7*HMPROP + 0.64*CO + 0.36*OH + 0.48*HO2 + 0.17*HCOOH + 0.3*CH2O + 0.23*CH3COCH3
    force(i,166) = force(i,166) + 0.36*rate_constant(i,228) * number_density(i,127) * number_density(i,171)

    ! k_BCARY_O3_1: BCARY + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    force(i,166) = force(i,166) + 0.63*rate_constant(i,229) * number_density(i,102) * number_density(i,171)

    ! k_C3H6_OH_1: C3H6 + OH -> 1*PO2
    force(i,166) = force(i,166) - rate_constant(i,231) * number_density(i,120) * number_density(i,166)

    ! k_BCARY_OH_2: BCARY + OH -> 1*TERPO2
    force(i,166) = force(i,166) - rate_constant(i,232) * number_density(i,102) * number_density(i,166)

    ! k_HCN_OH_1: HCN + OH -> 1*HO2
    force(i,166) = force(i,166) - rate_constant(i,234) * number_density(i,47) * number_density(i,166)

    ! k_H2_O1D_1: H2 + O1D -> 1*H + 1*OH
    force(i,166) = force(i,166) + rate_constant(i,237) * number_density(i,152) * number_density(i,112)

    ! k_HCFC22_OH_1: HCFC22 + OH -> 1*H2O + 1*CL + 1*COF2
    force(i,166) = force(i,166) - rate_constant(i,238) * number_density(i,83) * number_density(i,166)

    ! k_H2O2_1: H2O2 -> 2*OH
    force(i,166) = force(i,166) + 2*rate_constant(i,239) * number_density(i,179)

    ! k_C6H5OOH_OH_1: C6H5OOH + OH -> 1*C6H5O2
    force(i,166) = force(i,166) - rate_constant(i,242) * number_density(i,10) * number_density(i,166)

    ! k_HOCL_O_1: HOCL + O -> 1*CLO + 1*OH
    force(i,166) = force(i,166) + rate_constant(i,244) * number_density(i,88) * number_density(i,187)

    ! k_C2H5OOH_OH_1: C2H5OOH + OH -> 0.5*C2H5O2 + 0.5*CH3CHO + 0.5*OH
    force(i,166) = force(i,166) - 0.5*rate_constant(i,246) * number_density(i,175) * number_density(i,166)

    ! k_N_OH_1: N + OH -> 1*NO + 1*H
    force(i,166) = force(i,166) - rate_constant(i,250) * number_density(i,185) * number_density(i,166)

    ! k_C3H8_OH_1: C3H8 + OH -> 1*C3H7O2 + 1*H2O
    force(i,166) = force(i,166) - rate_constant(i,251) * number_density(i,56) * number_density(i,166)

    ! k_HNO3_1: HNO3 -> 1*NO2 + 1*OH
    force(i,166) = force(i,166) + rate_constant(i,258) * number_density(i,42)

    ! k_CH3CO3_HO2_1: CH3CO3 + HO2 -> 0.4*CH3COOOH + 0.15*CH3COOH + 0.15*O3 + 0.45*OH + 0.45*CH3O2
    force(i,166) = force(i,166) + 0.45*rate_constant(i,259) * number_density(i,49) * number_density(i,192)

    ! k_C2H5OOH_1: C2H5OOH -> 1*CH3CHO + 1*HO2 + 1*OH
    force(i,166) = force(i,166) + rate_constant(i,261) * number_density(i,175)

    ! k_OH_PHENOL_1: OH + PHENOL -> 0.14*PHENO2 + 0.8*HO2 + 0.06*PHENO
    force(i,166) = force(i,166) - rate_constant(i,266) * number_density(i,166) * number_density(i,21)

    ! k_HCN_O1D_1: HCN + O1D -> 1*OH
    force(i,166) = force(i,166) + rate_constant(i,268) * number_density(i,47) * number_density(i,112)

    ! k_HO2_MCO3_1: HO2 + MCO3 -> 0.15*O3 + 0.15*CH3COOH + 0.4*CH3COOOH + 0.45*OH + 0.45*CO2 + 0.45*CH2O + 0.45*CH3CO3
    force(i,166) = force(i,166) + 0.45*rate_constant(i,269) * number_density(i,192) * number_density(i,167)

    ! k_ISOPNOOH_OH_1: ISOPNOOH + OH -> 1*NOA + 1*HO2
    force(i,166) = force(i,166) - rate_constant(i,271) * number_density(i,160) * number_density(i,166)

    ! k_BENZOOH_1: BENZOOH -> 1*OH + 1*GLYOXAL + 0.5*BIGALD1 + 1*HO2
    force(i,166) = force(i,166) + rate_constant(i,275) * number_density(i,91)

    ! k_HBR_O1D_2: HBR + O1D -> 1*BR + 1*OH
    force(i,166) = force(i,166) + rate_constant(i,276) * number_density(i,80) * number_density(i,112)

    ! k_H2_OH_1: H2 + OH -> 1*H2O + 1*H
    force(i,166) = force(i,166) - rate_constant(i,281) * number_density(i,152) * number_density(i,166)

    ! k_CH4_OH_1: CH4 + OH -> 1*CH3O2 + 1*H2O
    force(i,166) = force(i,166) - rate_constant(i,284) * number_density(i,45) * number_density(i,166)

    ! k_HMPROPO2_HO2_1: HMPROPO2 + HO2 -> 0.4*OH + 0.4*HO2 + 0.4*CH3COCH3 + 0.4*CO2
    force(i,166) = force(i,166) + 0.4*rate_constant(i,289) * number_density(i,77) * number_density(i,192)

    ! k_HO2_OH_1: HO2 + OH -> 1*H2O + 1*O2
    force(i,166) = force(i,166) - rate_constant(i,291) * number_density(i,192) * number_density(i,166)

    ! k_HCL_O_1: HCL + O -> 1*CL + 1*OH
    force(i,166) = force(i,166) + rate_constant(i,293) * number_density(i,180) * number_density(i,187)

    ! k_NC4CH2OH_OH_1: NC4CH2OH + OH -> 1*GLYALD + 1*NOA + 1*HO2
    force(i,166) = force(i,166) - rate_constant(i,295) * number_density(i,158) * number_density(i,166)

    ! k_HCOOH_OH_1: HCOOH + OH -> 1*HO2 + 1*CO2 + 1*H2O
    force(i,166) = force(i,166) - rate_constant(i,296) * number_density(i,119) * number_density(i,166)
  end do
  !$acc end parallel

end subroutine p_force50

subroutine p_force51(rate_constant, number_density, number_density_air, force)
