subroutine p_force52(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_HYDRALD_OH_1: HYDRALD + OH -> 1*XO2
    force(i,166) = force(i,166) - rate_constant(i,407) * number_density(i,141) * number_density(i,166)

    ! k_CH3OH_OH_1: CH3OH + OH -> 1*HO2 + 1*CH2O
    force(i,166) = force(i,166) - rate_constant(i,409) * number_density(i,122) * number_density(i,166)

    ! k_OH_PHENOOH_1: OH + PHENOOH -> 1*PHENO2
    force(i,166) = force(i,166) - rate_constant(i,412) * number_density(i,166) * number_density(i,115)

    ! k_CH2O_OH_1: CH2O + OH -> 1*CO + 1*H2O + 1*H
    force(i,166) = force(i,166) - rate_constant(i,415) * number_density(i,124) * number_density(i,166)

    ! k_MVK_O3_1: MVK + O3 -> 0.6*CH2O + 0.56*CO + 0.1*CH3CHO + 0.1*CO2 + 0.28*CH3CO3 + 0.5*CH3COCHO + 0.28*HO2 + 0.36*OH + 0.12*HCOOH
    force(i,166) = force(i,166) + 0.36*rate_constant(i,420) * number_density(i,25) * number_density(i,171)

    ! k_OH_XYLOLOOH_1: OH + XYLOLOOH -> 1*XYLOLO2
    force(i,166) = force(i,166) - rate_constant(i,421) * number_density(i,166) * number_density(i,26)

    ! k_HYAC_OH_1: HYAC + OH -> 1*CH3COCHO + 1*HO2
    force(i,166) = force(i,166) - rate_constant(i,422) * number_density(i,57) * number_density(i,166)

    ! k_OH_TERPNIT_1: OH + TERPNIT -> 1*NO2 + 1*TERPROD1
    force(i,166) = force(i,166) - rate_constant(i,428) * number_density(i,166) * number_density(i,39)

    ! k_CO_OH_2: CO + OH -> 1*CO2 + 1*H
    force(i,166) = force(i,166) - rate_constant(i,429) * number_density(i,176) * number_density(i,166)

    ! k_HPALD_1: HPALD -> 1*BIGALD3 + 1*OH + 1*HO2
    force(i,166) = force(i,166) + rate_constant(i,430) * number_density(i,67)

    ! k_OH_TOLUENE_2: OH + TOLUENE -> 0.18*CRESOL + 0.1*TEPOMUC + 0.07*BZOO + 0.65*TOLO2 + 0.28*HO2
    force(i,166) = force(i,166) - rate_constant(i,435) * number_density(i,166) * number_density(i,117)

    ! k_BZOOH_1: BZOOH -> 1*BZALD + 1*OH + 1*HO2
    force(i,166) = force(i,166) + rate_constant(i,437) * number_density(i,8)

    ! k_H2O2_O_1: H2O2 + O -> 1*OH + 1*HO2
    force(i,166) = force(i,166) + rate_constant(i,440) * number_density(i,179) * number_density(i,187)

    ! k_HPALD_OH_1: HPALD + OH -> 1*XO2
    force(i,166) = force(i,166) - rate_constant(i,444) * number_density(i,67) * number_density(i,166)

    ! k_OH_TERP2OOH_1: OH + TERP2OOH -> 1*TERP2O2
    force(i,166) = force(i,166) - rate_constant(i,445) * number_density(i,166) * number_density(i,37)

    ! k_HOBR_O_1: HOBR + O -> 1*BRO + 1*OH
    force(i,166) = force(i,166) + rate_constant(i,447) * number_density(i,186) * number_density(i,187)

    ! k_HMPROP_OH_1: HMPROP + OH -> 1*HMPROPO2
    force(i,166) = force(i,166) - rate_constant(i,453) * number_density(i,132) * number_density(i,166)

    ! k_HO2_NO3_1: HO2 + NO3 -> 1*OH + 1*NO2 + 1*O2
    force(i,166) = force(i,166) + rate_constant(i,454) * number_density(i,192) * number_density(i,165)

    ! k_CH2BR2_OH_1: CH2BR2 + OH -> 2*BR + 1*H2O
    force(i,166) = force(i,166) - rate_constant(i,455) * number_density(i,169) * number_density(i,166)

    ! k_H2O2_OH_1: H2O2 + OH -> 1*H2O + 1*HO2
    force(i,166) = force(i,166) - rate_constant(i,456) * number_density(i,179) * number_density(i,166)

    ! k_H_HO2_3: H + HO2 -> 2*OH
    force(i,166) = force(i,166) + 2*rate_constant(i,457) * number_density(i,48) * number_density(i,192)

    ! k_HCL_OH_1: HCL + OH -> 1*H2O + 1*CL
    force(i,166) = force(i,166) - rate_constant(i,458) * number_density(i,180) * number_density(i,166)

    ! k_CHBR3_OH_1: CHBR3 + OH -> 3*BR
    force(i,166) = force(i,166) - rate_constant(i,460) * number_density(i,84) * number_density(i,166)

    ! k_NH3_OH_1: NH3 + OH -> 1*H2O
    force(i,166) = force(i,166) - rate_constant(i,461) * number_density(i,3) * number_density(i,166)

    ! k_H2_O_1: H2 + O -> 1*OH + 1*H
    force(i,166) = force(i,166) + rate_constant(i,465) * number_density(i,152) * number_density(i,187)

    ! k_CL_HO2_2: CL + HO2 -> 1*OH + 1*CLO
    force(i,166) = force(i,166) + rate_constant(i,470) * number_density(i,100) * number_density(i,192)

    ! k_HBR_O_1: HBR + O -> 1*BR + 1*OH
    force(i,166) = force(i,166) + rate_constant(i,473) * number_density(i,80) * number_density(i,187)

    ! k_BIGENE_OH_1: BIGENE + OH -> 1*ENEO2
    force(i,166) = force(i,166) - rate_constant(i,475) * number_density(i,97) * number_density(i,166)

    ! k_DMS_OH_2: DMS + OH -> 1*SO2
    force(i,166) = force(i,166) - rate_constant(i,476) * number_density(i,99) * number_density(i,166)

    ! k_C2H5OH_OH_1: C2H5OH + OH -> 1*HO2 + 1*CH3CHO
    force(i,166) = force(i,166) - rate_constant(i,477) * number_density(i,126) * number_density(i,166)

    ! k_ISOPOOH_OH_1: ISOPOOH + OH -> 0.4*XO2 + 0.6*IEPOX + 0.6*OH
    force(i,166) = force(i,166) - 0.4*rate_constant(i,482) * number_density(i,138) * number_density(i,166)

    ! k_HO2_NO_1: HO2 + NO -> 1*NO2 + 1*OH
    force(i,166) = force(i,166) + rate_constant(i,483) * number_density(i,192) * number_density(i,137)

    ! k_BZOOH_OH_1: BZOOH + OH -> 1*BZOO
    force(i,166) = force(i,166) - rate_constant(i,485) * number_density(i,8) * number_density(i,166)

    ! k_OH_SO_1: OH + SO -> 1*SO2 + 1*H
    force(i,166) = force(i,166) - rate_constant(i,486) * number_density(i,166) * number_density(i,32)
  end do
  !$acc end parallel

end subroutine p_force52

subroutine p_force53(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! MCO3
    force(i,167) = 0

    ! k_MCO3_NO2_1: MCO3 + NO2 -> 1*MPAN
    force(i,167) = force(i,167) - rate_constant(i,72) * number_density(i,167) * number_density(i,54)

    ! k_CH3CO3_MCO3_1: CH3CO3 + MCO3 -> 2*CO2 + 1*CH3O2 + 1*CH2O + 1*CH3CO3
    force(i,167) = force(i,167) - rate_constant(i,81) * number_density(i,49) * number_density(i,167)

    ! k_CH3O2_MCO3_1: CH3O2 + MCO3 -> 2*CH2O + 1*HO2 + 1*CO2 + 1*CH3CO3
    force(i,167) = force(i,167) - rate_constant(i,84) * number_density(i,191) * number_density(i,167)

    ! k_MACROOH_OH_1: MACROOH + OH -> 0.5*MCO3 + 0.2*MACRO2 + 0.1*OH + 0.2*HO2
    force(i,167) = force(i,167) + 0.5*rate_constant(i,136) * number_density(i,44) * number_density(i,166)

    ! k_MCO3_NO3_1: MCO3 + NO3 -> 1*NO2 + 1*CH2O + 1*CH3CO3
    force(i,167) = force(i,167) - rate_constant(i,146) * number_density(i,167) * number_density(i,165)

    ! k_MCO3_MCO3_1: MCO3 + MCO3 -> 2*CO2 + 2*CH2O + 2*CH3CO3
    force(i,167) = force(i,167) - rate_constant(i,198) * number_density(i,167) * number_density(i,167)

    ! k_MCO3_MCO3_1: MCO3 + MCO3 -> 2*CO2 + 2*CH2O + 2*CH3CO3
    force(i,167) = force(i,167) - rate_constant(i,198) * number_density(i,167) * number_density(i,167)

    ! k_MACR_OH_1: MACR + OH -> 0.5*MACRO2 + 0.5*H2O + 0.5*MCO3
    force(i,167) = force(i,167) + 0.5*rate_constant(i,220) * number_density(i,157) * number_density(i,166)

    ! k_HO2_MCO3_1: HO2 + MCO3 -> 0.15*O3 + 0.15*CH3COOH + 0.4*CH3COOOH + 0.45*OH + 0.45*CO2 + 0.45*CH2O + 0.45*CH3CO3
    force(i,167) = force(i,167) - rate_constant(i,269) * number_density(i,192) * number_density(i,167)

    ! k_MACR_2: MACR -> 1.34*HO2 + 0.66*MCO3 + 1.34*CH2O + 1.34*CH3CO3
    force(i,167) = force(i,167) + 0.66*rate_constant(i,272) * number_density(i,157)

    ! k_MPAN_1: MPAN -> 1*MCO3 + 1*NO2
    force(i,167) = force(i,167) + rate_constant(i,288) * number_density(i,159)

    ! k_MCO3_NO_1: MCO3 + NO -> 1*NO2 + 1*CH2O + 1*CH3CO3
    force(i,167) = force(i,167) - rate_constant(i,353) * number_density(i,167) * number_density(i,137)

    ! k_MPAN_2: MPAN -> 1*MCO3 + 1*NO2
    force(i,167) = force(i,167) + rate_constant(i,438) * number_density(i,159)

    ! C2H2
    force(i,168) = 0

    ! k_C2H2_OH_1: C2H2 + OH -> 0.65*GLYOXAL + 0.65*OH + 0.35*HCOOH + 0.35*HO2 + 0.35*CO
    force(i,168) = force(i,168) - rate_constant(i,2) * number_density(i,168) * number_density(i,166)

    ! k_C2H2_CL_1: C2H2 + CL -> 1*CL
    force(i,168) = force(i,168) - rate_constant(i,450) * number_density(i,168) * number_density(i,100)

    ! CH2BR2
    force(i,169) = 0

    ! k_CH2BR2_CL_1: CH2BR2 + CL -> 2*BR + 1*HCL
    force(i,169) = force(i,169) - rate_constant(i,27) * number_density(i,169) * number_density(i,100)

    ! k_CH2BR2_O1D_1: CH2BR2 + O1D -> 2*BR
    force(i,169) = force(i,169) - rate_constant(i,120) * number_density(i,169) * number_density(i,112)

    ! k_CH2BR2_1: CH2BR2 -> 2*BR
    force(i,169) = force(i,169) - rate_constant(i,131) * number_density(i,169)

    ! k_CH2BR2_OH_1: CH2BR2 + OH -> 2*BR + 1*H2O
    force(i,169) = force(i,169) - rate_constant(i,455) * number_density(i,169) * number_density(i,166)

    ! MALO2
    force(i,170) = 0

    ! k_HO2_MALO2_1: HO2 + MALO2 -> 0.16*GLYOXAL + 0.16*HO2 + 0.16*CO
    force(i,170) = force(i,170) - rate_constant(i,1) * number_density(i,192) * number_density(i,170)

    ! k_BIGALD1_1: BIGALD1 -> 0.6*MALO2 + 1*HO2
    force(i,170) = force(i,170) + 0.6*rate_constant(i,255) * number_density(i,75)

    ! k_MALO2_NO2_1: MALO2 + NO2 -> 
    force(i,170) = force(i,170) - rate_constant(i,356) * number_density(i,170) * number_density(i,54)

    ! k_MALO2_NO_1: MALO2 + NO -> 0.4*GLYOXAL + 0.4*HO2 + 0.4*CO + 1*NO2
    force(i,170) = force(i,170) - rate_constant(i,424) * number_density(i,170) * number_density(i,137)

    ! O3
    force(i,171) = 0

    ! k_MACR_O3_1: MACR + O3 -> 0.12*CH2O + 0.24*OH + 0.65*CO + 0.1*CH3CO3 + 0.88*CH3COCHO + 0.33*HCOOH + 0.14*HO2
    force(i,171) = force(i,171) - rate_constant(i,101) * number_density(i,157) * number_density(i,171)

    ! k_O3_SO_1: O3 + SO -> 1*SO2 + 1*O2
    force(i,171) = force(i,171) - rate_constant(i,140) * number_density(i,171) * number_density(i,32)

    ! k_CL_O3_1: CL + O3 -> 1*CLO + 1*O2
    force(i,171) = force(i,171) - rate_constant(i,150) * number_density(i,100) * number_density(i,171)

    ! k_H_O3_1: H + O3 -> 1*OH + 1*O2
    force(i,171) = force(i,171) - rate_constant(i,158) * number_density(i,48) * number_density(i,171)

    ! k_O3_OH_1: O3 + OH -> 1*HO2 + 1*O2
    force(i,171) = force(i,171) - rate_constant(i,164) * number_density(i,171) * number_density(i,166)

    ! k_NO2_O3_1: NO2 + O3 -> 1*NO3 + 1*O2
    force(i,171) = force(i,171) - rate_constant(i,165) * number_density(i,54) * number_density(i,171)
  end do
  !$acc end parallel

end subroutine p_force53

subroutine p_force54(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_C3H6_O3_1: C3H6 + O3 -> 0.5*CH2O + 0.12*HCOOH + 0.12*CH3COOH + 0.5*CH3CHO + 0.56*CO + 0.28*CH3O2 + 0.1*CH4 + 0.2*CO2 + 0.28*HO2 + 0.36*OH
    force(i,171) = force(i,171) - rate_constant(i,170) * number_density(i,120) * number_density(i,171)

    ! k_O_O3_1: O + O3 -> 2*O2
    force(i,171) = force(i,171) - rate_constant(i,187) * number_density(i,187) * number_density(i,171)

    ! k_M_O_O2_1: M + O + O2 -> 1*O3 + 1*M
    force(i,171) = force(i,171) + rate_constant(i,202) * number_density(i,1) * number_density(i,187) * number_density(i,41)

    ! k_MBO_O3_1: MBO + O3 -> 0.7*HMPROP + 0.64*CO + 0.36*OH + 0.48*HO2 + 0.17*HCOOH + 0.3*CH2O + 0.23*CH3COCH3
    force(i,171) = force(i,171) - rate_constant(i,228) * number_density(i,127) * number_density(i,171)

    ! k_BCARY_O3_1: BCARY + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    force(i,171) = force(i,171) - rate_constant(i,229) * number_density(i,102) * number_density(i,171)

    ! k_O3_PHENO_1: O3 + PHENO -> 1*C6H5O2
    force(i,171) = force(i,171) - rate_constant(i,249) * number_density(i,171) * number_density(i,182)

    ! k_CH3CO3_HO2_1: CH3CO3 + HO2 -> 0.4*CH3COOOH + 0.15*CH3COOH + 0.15*O3 + 0.45*OH + 0.45*CH3O2
    force(i,171) = force(i,171) + 0.15*rate_constant(i,259) * number_density(i,49) * number_density(i,192)

    ! k_HO2_MCO3_1: HO2 + MCO3 -> 0.15*O3 + 0.15*CH3COOH + 0.4*CH3COOOH + 0.45*OH + 0.45*CO2 + 0.45*CH2O + 0.45*CH3CO3
    force(i,171) = force(i,171) + 0.15*rate_constant(i,269) * number_density(i,192) * number_density(i,167)

    ! k_MTERP_O3_2: MTERP + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    force(i,171) = force(i,171) - rate_constant(i,307) * number_density(i,31) * number_density(i,171)

    ! k_BR_O3_1: BR + O3 -> 1*BRO + 1*O2
    force(i,171) = force(i,171) - rate_constant(i,317) * number_density(i,90) * number_density(i,171)

    ! k_C2H4_O3_1: C2H4 + O3 -> 0.63*CO + 0.13*OH + 0.13*HO2 + 0.37*HCOOH + 1*CH2O
    force(i,171) = force(i,171) - rate_constant(i,323) * number_density(i,93) * number_density(i,171)

    ! k_O3_1: O3 -> 1*O + 1*O2
    force(i,171) = force(i,171) - rate_constant(i,367) * number_density(i,171)

    ! k_HO2_O3_1: HO2 + O3 -> 1*OH + 2*O2
    force(i,171) = force(i,171) - rate_constant(i,368) * number_density(i,192) * number_density(i,171)

    ! k_ISOP_O3_2: ISOP + O3 -> 0.3*MACR + 0.2*MVK + 0.11*HCOOH + 0.62*CO + 0.32*OH + 0.37*HO2 + 0.91*CH2O + 0.08*CH3CO3 + 0.13*C3H6 + 0.05*CH3O2
    force(i,171) = force(i,171) - rate_constant(i,377) * number_density(i,142) * number_density(i,171)

    ! k_O3_2: O3 -> 1*O1D + 1*O2
    force(i,171) = force(i,171) - rate_constant(i,417) * number_density(i,171)

    ! k_MVK_O3_1: MVK + O3 -> 0.6*CH2O + 0.56*CO + 0.1*CH3CHO + 0.1*CO2 + 0.28*CH3CO3 + 0.5*CH3COCHO + 0.28*HO2 + 0.36*OH + 0.12*HCOOH
    force(i,171) = force(i,171) - rate_constant(i,420) * number_density(i,25) * number_density(i,171)

    ! k_NO_O3_1: NO + O3 -> 1*NO2 + 1*O2
    force(i,171) = force(i,171) - rate_constant(i,439) * number_density(i,137) * number_density(i,171)

    ! k_O1D_O3_1: O1D + O3 -> 1*O2
    force(i,171) = force(i,171) - rate_constant(i,487) * number_density(i,112) * number_density(i,171)

    ! HCFC142B
    force(i,172) = 0

    ! k_HCFC142B_OH_1: HCFC142B + OH -> 1*CL + 1*COF2
    force(i,172) = force(i,172) - rate_constant(i,14) * number_density(i,172) * number_density(i,166)

    ! k_HCFC142B_1: HCFC142B -> 1*CL + 1*COF2
    force(i,172) = force(i,172) - rate_constant(i,230) * number_density(i,172)

    ! k_HCFC142B_O1D_1: HCFC142B + O1D -> 1*CL + 1*COF2
    force(i,172) = force(i,172) - rate_constant(i,466) * number_density(i,172) * number_density(i,112)

    ! BRCL
    force(i,173) = 0

    ! k_BRCL_1: BRCL -> 1*BR + 1*CL
    force(i,173) = force(i,173) - rate_constant(i,342) * number_density(i,173)

    ! k_BRO_CLO_2: BRO + CLO -> 1*BRCL + 1*O2
    force(i,173) = force(i,173) + rate_constant(i,432) * number_density(i,71) * number_density(i,86)

    ! C2H6
    force(i,174) = 0

    ! k_C2H6_OH_1: C2H6 + OH -> 1*C2H5O2 + 1*H2O
    force(i,174) = force(i,174) - rate_constant(i,174) * number_density(i,174) * number_density(i,166)

    ! k_C2H6_CL_1: C2H6 + CL -> 1*HCL + 1*C2H5O2
    force(i,174) = force(i,174) - rate_constant(i,193) * number_density(i,174) * number_density(i,100)

    ! C2H5OOH
    force(i,175) = 0

    ! k_C2H5OOH_OH_1: C2H5OOH + OH -> 0.5*C2H5O2 + 0.5*CH3CHO + 0.5*OH
    force(i,175) = force(i,175) - rate_constant(i,246) * number_density(i,175) * number_density(i,166)

    ! k_C2H5OOH_1: C2H5OOH -> 1*CH3CHO + 1*HO2 + 1*OH
    force(i,175) = force(i,175) - rate_constant(i,261) * number_density(i,175)

    ! k_C2H5O2_HO2_1: C2H5O2 + HO2 -> 1*C2H5OOH + 1*O2
    force(i,175) = force(i,175) + rate_constant(i,343) * number_density(i,87) * number_density(i,192)

    ! CO
    force(i,176) = 0

    ! k_HO2_MALO2_1: HO2 + MALO2 -> 0.16*GLYOXAL + 0.16*HO2 + 0.16*CO
    force(i,176) = force(i,176) + 0.16*rate_constant(i,1) * number_density(i,192) * number_density(i,170)
  end do
  !$acc end parallel

end subroutine p_force54

subroutine p_force55(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_C2H2_OH_1: C2H2 + OH -> 0.65*GLYOXAL + 0.65*OH + 0.35*HCOOH + 0.35*HO2 + 0.35*CO
    force(i,176) = force(i,176) + 0.35*rate_constant(i,2) * number_density(i,168) * number_density(i,166)

    ! k_CH2O_O_1: CH2O + O -> 1*HO2 + 1*OH + 1*CO
    force(i,176) = force(i,176) + rate_constant(i,10) * number_density(i,124) * number_density(i,187)

    ! k_MVK_1: MVK -> 0.7*C3H6 + 0.7*CO + 0.3*CH3O2 + 0.3*CH3CO3
    force(i,176) = force(i,176) + 0.7*rate_constant(i,15) * number_density(i,25)

    ! k_CH3COCHO_1: CH3COCHO -> 1*CH3CO3 + 1*CO + 1*HO2
    force(i,176) = force(i,176) + rate_constant(i,17) * number_density(i,111)

    ! k_TERPROD2_1: TERPROD2 -> 0.15*RO2 + 0.68*CH2O + 0.8*CO2 + 0.5*CH3COCH3 + 0.65*CH3CO3 + 1.2*HO2 + 1.7*CO
    force(i,176) = force(i,176) + 1.7*rate_constant(i,35) * number_density(i,155)

    ! k_CH4_1: CH4 -> 1.44*H2 + 0.18*CH2O + 0.18*O + 0.33*OH + 0.33*H + 0.44*CO2 + 0.38*CO + 0.05*H2O
    force(i,176) = force(i,176) + 0.38*rate_constant(i,37) * number_density(i,45)

    ! k_MACRO2_NO_1: MACRO2 + NO -> 1*NO2 + 0.47*HO2 + 0.25*CH2O + 0.53*GLYALD + 0.25*CH3COCHO + 0.53*CH3CO3 + 0.22*HYAC + 0.22*CO
    force(i,176) = force(i,176) + 0.22*rate_constant(i,40) * number_density(i,188) * number_density(i,137)

    ! k_TERP2OOH_1: TERP2OOH -> 1*OH + 0.375*CH2O + 0.3*CH3COCH3 + 0.25*CO + 1*CO2 + 1*TERPROD2 + 1*HO2 + 0.25*GLYALD
    force(i,176) = force(i,176) + 0.25*rate_constant(i,49) * number_density(i,37)

    ! k_BIGALD4_1: BIGALD4 -> 1*HO2 + 1*CO + 1*CH3COCHO + 1*CH3CO3
    force(i,176) = force(i,176) + rate_constant(i,61) * number_density(i,110)

    ! k_TEPOMUC_1: TEPOMUC -> 0.5*CH3CO3 + 1*HO2 + 1.5*CO
    force(i,176) = force(i,176) + 1.5*rate_constant(i,85) * number_density(i,2)

    ! k_CH2O_1: CH2O -> 1*CO + 1*H2
    force(i,176) = force(i,176) + rate_constant(i,93) * number_density(i,124)

    ! k_MACR_O3_1: MACR + O3 -> 0.12*CH2O + 0.24*OH + 0.65*CO + 0.1*CH3CO3 + 0.88*CH3COCHO + 0.33*HCOOH + 0.14*HO2
    force(i,176) = force(i,176) + 0.65*rate_constant(i,101) * number_density(i,157) * number_density(i,171)

    ! k_CH3CL_CL_1: CH3CL + CL -> 1*HO2 + 1*CO + 2*HCL
    force(i,176) = force(i,176) + rate_constant(i,102) * number_density(i,53) * number_density(i,100)

    ! k_CH3CO3_XO2_1: CH3CO3 + XO2 -> 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 1*CH3O2 + 1*HO2 + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD + 1*CO2
    force(i,176) = force(i,176) + 0.25*rate_constant(i,106) * number_density(i,49) * number_density(i,153)

    ! k_NO3_XO2_1: NO3 + XO2 -> 1*NO2 + 1*HO2 + 0.5*CO + 0.25*HYAC + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*GLYALD
    force(i,176) = force(i,176) + 0.5*rate_constant(i,109) * number_density(i,165) * number_density(i,153)

    ! k_NO_TERP2O2_1: NO + TERP2O2 -> 0.1*ONITR + 0.9*NO2 + 0.34*CH2O + 0.27*CH3COCH3 + 0.225*CO + 0.9*CO2 + 0.9*TERPROD2 + 0.9*HO2 + 0.225*GLYALD
    force(i,176) = force(i,176) + 0.225*rate_constant(i,110) * number_density(i,137) * number_density(i,145)

    ! k_CH3COCHO_OH_1: CH3COCHO + OH -> 1*CH3CO3 + 1*CO + 1*H2O
    force(i,176) = force(i,176) + rate_constant(i,122) * number_density(i,111) * number_density(i,166)

    ! k_BIGALD3_1: BIGALD3 -> 0.6*HO2 + 0.6*CO + 0.6*MDIALO2
    force(i,176) = force(i,176) + 0.6*rate_constant(i,126) * number_density(i,108)

    ! k_BEPOMUC_1: BEPOMUC -> 1*BIGALD1 + 1.5*HO2 + 1.5*CO
    force(i,176) = force(i,176) + 1.5*rate_constant(i,132) * number_density(i,96)

    ! k_MACRO2_NO3_1: MACRO2 + NO3 -> 1*NO2 + 0.47*HO2 + 0.25*CH2O + 0.25*CH3COCHO + 0.22*CO + 0.53*GLYALD + 0.22*HYAC + 0.53*CH3CO3
    force(i,176) = force(i,176) + 0.22*rate_constant(i,134) * number_density(i,188) * number_density(i,165)

    ! k_MACR_1: MACR -> 0.66*HO2 + 1.34*CO
    force(i,176) = force(i,176) + 1.34*rate_constant(i,138) * number_density(i,157)

    ! k_CH2O_2: CH2O -> 1*CO + 2*H
    force(i,176) = force(i,176) + rate_constant(i,149) * number_density(i,124)

    ! k_HO2_MDIALO2_1: HO2 + MDIALO2 -> 0.4*OH + 0.33*HO2 + 0.07*CH3COCHO + 0.14*CO + 0.07*CH3O2 + 0.07*GLYOXAL
    force(i,176) = force(i,176) + 0.14*rate_constant(i,161) * number_density(i,192) * number_density(i,164)

    ! k_C3H6_O3_1: C3H6 + O3 -> 0.5*CH2O + 0.12*HCOOH + 0.12*CH3COOH + 0.5*CH3CHO + 0.56*CO + 0.28*CH3O2 + 0.1*CH4 + 0.2*CO2 + 0.28*HO2 + 0.36*OH
    force(i,176) = force(i,176) + 0.56*rate_constant(i,170) * number_density(i,120) * number_density(i,171)

    ! k_HONITR_1: HONITR -> 1*NO2 + 0.67*HO2 + 0.33*CH3CHO + 0.33*CH2O + 0.33*CO + 0.33*GLYALD + 0.33*CH3CO3 + 0.17*HYAC + 0.17*CH3COCH3
    force(i,176) = force(i,176) + 0.33*rate_constant(i,171) * number_density(i,134)

    ! k_GLYOXAL_OH_1: GLYOXAL + OH -> 1*HO2 + 1*CO + 1*CO2
    force(i,176) = force(i,176) + rate_constant(i,176) * number_density(i,131) * number_density(i,166)

    ! k_CO_OH_1: CO + OH -> 1*CO2 + 1*HO2
    force(i,176) = force(i,176) - rate_constant(i,208) * number_density(i,176) * number_density(i,166)

    ! k_MBO_O3_1: MBO + O3 -> 0.7*HMPROP + 0.64*CO + 0.36*OH + 0.48*HO2 + 0.17*HCOOH + 0.3*CH2O + 0.23*CH3COCH3
    force(i,176) = force(i,176) + 0.64*rate_constant(i,228) * number_density(i,127) * number_density(i,171)

    ! k_BCARY_O3_1: BCARY + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    force(i,176) = force(i,176) + 0.23*rate_constant(i,229) * number_density(i,102) * number_density(i,171)

    ! k_CH3CO3_MACRO2_1: CH3CO3 + MACRO2 -> 0.25*CH3COCHO + 1*CH3O2 + 0.22*CO + 0.47*HO2 + 0.53*GLYALD + 0.22*HYAC + 0.25*CH2O + 0.53*CH3CO3
    force(i,176) = force(i,176) + 0.22*rate_constant(i,235) * number_density(i,49) * number_density(i,188)

    ! k_CH3CHO_1: CH3CHO -> 1*CH3O2 + 1*CO + 1*HO2
    force(i,176) = force(i,176) + rate_constant(i,245) * number_density(i,178)

    ! k_NO_XO2_1: NO + XO2 -> 1*NO2 + 1*HO2 + 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD
    force(i,176) = force(i,176) + 0.25*rate_constant(i,252) * number_density(i,137) * number_density(i,153)

    ! k_CO2_1: CO2 -> 1*CO + 1*O
    force(i,176) = force(i,176) + rate_constant(i,274) * number_density(i,82)

    ! k_TERPROD1_1: TERPROD1 -> 1*HO2 + 1*CO + 1*TERPROD2
    force(i,176) = force(i,176) + rate_constant(i,286) * number_density(i,58)
  end do
  !$acc end parallel

end subroutine p_force55

subroutine p_force56(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_BR_CH2O_1: BR + CH2O -> 1*HBR + 1*HO2 + 1*CO
    force(i,176) = force(i,176) + rate_constant(i,298) * number_density(i,90) * number_density(i,124)

    ! k_MTERP_O3_2: MTERP + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    force(i,176) = force(i,176) + 0.23*rate_constant(i,307) * number_density(i,31) * number_density(i,171)

    ! k_OCS_OH_1: OCS + OH -> 1*SO2 + 1*CO + 1*H
    force(i,176) = force(i,176) + rate_constant(i,312) * number_density(i,29) * number_density(i,166)

    ! k_CH3O2_MACRO2_1: CH3O2 + MACRO2 -> 0.73*HO2 + 0.88*CH2O + 0.11*CO + 0.24*CH3COCHO + 0.26*GLYALD + 0.26*CH3CO3 + 0.25*CH3OH + 0.23*HYAC
    force(i,176) = force(i,176) + 0.11*rate_constant(i,322) * number_density(i,191) * number_density(i,188)

    ! k_C2H4_O3_1: C2H4 + O3 -> 0.63*CO + 0.13*OH + 0.13*HO2 + 0.37*HCOOH + 1*CH2O
    force(i,176) = force(i,176) + 0.63*rate_constant(i,323) * number_density(i,93) * number_density(i,171)

    ! k_DICARBO2_NO_1: DICARBO2 + NO -> 1*NO2 + 0.17*HO2 + 0.17*CH3COCHO + 0.17*CO + 0.83*CH3O2
    force(i,176) = force(i,176) + 0.17*rate_constant(i,337) * number_density(i,181) * number_density(i,137)

    ! k_GLYALD_1: GLYALD -> 2*HO2 + 1*CO + 1*CH2O
    force(i,176) = force(i,176) + rate_constant(i,338) * number_density(i,156)

    ! k_OCS_1: OCS -> 1*S + 1*CO
    force(i,176) = force(i,176) + rate_constant(i,345) * number_density(i,29)

    ! k_DICARBO2_HO2_1: DICARBO2 + HO2 -> 0.4*OH + 0.07*HO2 + 0.07*CH3COCHO + 0.07*CO + 0.33*CH3O2
    force(i,176) = force(i,176) + 0.07*rate_constant(i,370) * number_density(i,181) * number_density(i,192)

    ! k_ISOP_O3_2: ISOP + O3 -> 0.3*MACR + 0.2*MVK + 0.11*HCOOH + 0.62*CO + 0.32*OH + 0.37*HO2 + 0.91*CH2O + 0.08*CH3CO3 + 0.13*C3H6 + 0.05*CH3O2
    force(i,176) = force(i,176) + 0.62*rate_constant(i,377) * number_density(i,142) * number_density(i,171)

    ! k_OH_TERPROD2_1: OH + TERPROD2 -> 0.15*RO2 + 0.68*CH2O + 1.8*CO2 + 0.5*CH3COCH3 + 0.65*CH3CO3 + 0.2*HO2 + 0.7*CO
    force(i,176) = force(i,176) + 0.7*rate_constant(i,397) * number_density(i,166) * number_density(i,155)

    ! k_MDIALO2_NO_1: MDIALO2 + NO -> 1*NO2 + 0.83*HO2 + 0.17*CH3COCHO + 0.35*CO + 0.17*CH3O2 + 0.17*GLYOXAL
    force(i,176) = force(i,176) + 0.35*rate_constant(i,403) * number_density(i,164) * number_density(i,137)

    ! k_CH3COCHO_NO3_1: CH3COCHO + NO3 -> 1*HNO3 + 1*CO + 1*CH3CO3
    force(i,176) = force(i,176) + rate_constant(i,405) * number_density(i,111) * number_density(i,165)

    ! k_CH3O2_XO2_1: CH3O2 + XO2 -> 0.3*CH3OH + 0.8*HO2 + 0.8*CH2O + 0.2*CO + 0.1*GLYOXAL + 0.1*CH3COCHO + 0.1*HYAC + 0.1*GLYALD
    force(i,176) = force(i,176) + 0.2*rate_constant(i,410) * number_density(i,191) * number_density(i,153)

    ! k_CH3O2_TERP2O2_1: CH3O2 + TERP2O2 -> 1*TERPROD2 + 0.93*CH2O + 0.25*CH3OH + 1*HO2 + 0.5*CO2 + 0.125*CO + 0.125*GLYALD + 0.15*CH3COCH3
    force(i,176) = force(i,176) + 0.125*rate_constant(i,414) * number_density(i,191) * number_density(i,145)

    ! k_CH2O_OH_1: CH2O + OH -> 1*CO + 1*H2O + 1*H
    force(i,176) = force(i,176) + rate_constant(i,415) * number_density(i,124) * number_density(i,166)

    ! k_GLYOXAL_1: GLYOXAL -> 2*CO + 2*HO2
    force(i,176) = force(i,176) + 2*rate_constant(i,416) * number_density(i,131)

    ! k_MVK_O3_1: MVK + O3 -> 0.6*CH2O + 0.56*CO + 0.1*CH3CHO + 0.1*CO2 + 0.28*CH3CO3 + 0.5*CH3COCHO + 0.28*HO2 + 0.36*OH + 0.12*HCOOH
    force(i,176) = force(i,176) + 0.56*rate_constant(i,420) * number_density(i,25) * number_density(i,171)

    ! k_CH2O_NO3_1: CH2O + NO3 -> 1*CO + 1*HO2 + 1*HNO3
    force(i,176) = force(i,176) + rate_constant(i,423) * number_density(i,124) * number_density(i,165)

    ! k_MALO2_NO_1: MALO2 + NO -> 0.4*GLYOXAL + 0.4*HO2 + 0.4*CO + 1*NO2
    force(i,176) = force(i,176) + 0.4*rate_constant(i,424) * number_density(i,170) * number_density(i,137)

    ! k_CH2O_CL_1: CH2O + CL -> 1*HCL + 1*HO2 + 1*CO
    force(i,176) = force(i,176) + rate_constant(i,425) * number_density(i,124) * number_density(i,100)

    ! k_CO_OH_2: CO + OH -> 1*CO2 + 1*H
    force(i,176) = force(i,176) - rate_constant(i,429) * number_density(i,176) * number_density(i,166)

    ! k_BIGALD_1: BIGALD -> 0.45*CO + 0.13*GLYOXAL + 0.56*HO2 + 0.13*CH3CO3 + 0.18*CH3COCHO
    force(i,176) = force(i,176) + 0.45*rate_constant(i,469) * number_density(i,105)

    ! CH3COOH
    force(i,177) = 0

    ! k_CH3CO3_CH3O2_1: CH3CO3 + CH3O2 -> 0.9*CH3O2 + 1*CH2O + 0.9*HO2 + 0.9*CO2 + 0.1*CH3COOH
    force(i,177) = force(i,177) + 0.1*rate_constant(i,99) * number_density(i,49) * number_density(i,191)

    ! k_CH3COOH_OH_1: CH3COOH + OH -> 1*CH3O2 + 1*CO2 + 1*H2O
    force(i,177) = force(i,177) - rate_constant(i,107) * number_density(i,177) * number_density(i,166)

    ! k_C3H6_O3_1: C3H6 + O3 -> 0.5*CH2O + 0.12*HCOOH + 0.12*CH3COOH + 0.5*CH3CHO + 0.56*CO + 0.28*CH3O2 + 0.1*CH4 + 0.2*CO2 + 0.28*HO2 + 0.36*OH
    force(i,177) = force(i,177) + 0.12*rate_constant(i,170) * number_density(i,120) * number_density(i,171)

    ! k_CH3CO3_HO2_1: CH3CO3 + HO2 -> 0.4*CH3COOOH + 0.15*CH3COOH + 0.15*O3 + 0.45*OH + 0.45*CH3O2
    force(i,177) = force(i,177) + 0.15*rate_constant(i,259) * number_density(i,49) * number_density(i,192)

    ! k_HO2_MCO3_1: HO2 + MCO3 -> 0.15*O3 + 0.15*CH3COOH + 0.4*CH3COOOH + 0.45*OH + 0.45*CO2 + 0.45*CH2O + 0.45*CH3CO3
    force(i,177) = force(i,177) + 0.15*rate_constant(i,269) * number_density(i,192) * number_density(i,167)

    ! CH3CHO
    force(i,178) = 0

    ! k_CH3CHO_NO3_1: CH3CHO + NO3 -> 1*CH3CO3 + 1*HNO3
    force(i,178) = force(i,178) - rate_constant(i,34) * number_density(i,178) * number_density(i,165)

    ! k_ALKO2_NO_1: ALKO2 + NO -> 0.4*CH3CHO + 0.1*CH2O + 0.25*CH3COCH3 + 1*HO2 + 0.8*MEK + 1*NO2
    force(i,178) = force(i,178) + 0.4*rate_constant(i,71) * number_density(i,85) * number_density(i,137)

    ! k_MEKOOH_1: MEKOOH -> 1*OH + 1*CH3CO3 + 1*CH3CHO
    force(i,178) = force(i,178) + rate_constant(i,89) * number_density(i,136)

    ! k_CH3CHO_OH_1: CH3CHO + OH -> 1*CH3CO3 + 1*H2O
    force(i,178) = force(i,178) - rate_constant(i,108) * number_density(i,178) * number_density(i,166)
  end do
  !$acc end parallel

end subroutine p_force56

subroutine p_force57(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_HO2_MEKO2_1: HO2 + MEKO2 -> 0.8*MEKOOH + 0.2*OH + 0.2*CH3CHO + 0.2*CH3CO3
    force(i,178) = force(i,178) + 0.2*rate_constant(i,139) * number_density(i,192) * number_density(i,128)

    ! k_POOH_1: POOH -> 1*CH3CHO + 1*CH2O + 1*HO2 + 1*OH
    force(i,178) = force(i,178) + rate_constant(i,162) * number_density(i,9)

    ! k_C3H6_O3_1: C3H6 + O3 -> 0.5*CH2O + 0.12*HCOOH + 0.12*CH3COOH + 0.5*CH3CHO + 0.56*CO + 0.28*CH3O2 + 0.1*CH4 + 0.2*CO2 + 0.28*HO2 + 0.36*OH
    force(i,178) = force(i,178) + 0.5*rate_constant(i,170) * number_density(i,120) * number_density(i,171)

    ! k_HONITR_1: HONITR -> 1*NO2 + 0.67*HO2 + 0.33*CH3CHO + 0.33*CH2O + 0.33*CO + 0.33*GLYALD + 0.33*CH3CO3 + 0.17*HYAC + 0.17*CH3COCH3
    force(i,178) = force(i,178) + 0.33*rate_constant(i,171) * number_density(i,134)

    ! k_ENEO2_NO_1: ENEO2 + NO -> 1*CH3CHO + 0.5*CH2O + 0.5*CH3COCH3 + 1*HO2 + 1*NO2
    force(i,178) = force(i,178) + rate_constant(i,201) * number_density(i,133) * number_density(i,137)

    ! k_CH3CHO_1: CH3CHO -> 1*CH3O2 + 1*CO + 1*HO2
    force(i,178) = force(i,178) - rate_constant(i,245) * number_density(i,178)

    ! k_C2H5OOH_OH_1: C2H5OOH + OH -> 0.5*C2H5O2 + 0.5*CH3CHO + 0.5*OH
    force(i,178) = force(i,178) + 0.5*rate_constant(i,246) * number_density(i,175) * number_density(i,166)

    ! k_C2H5O2_C2H5O2_1: C2H5O2 + C2H5O2 -> 1.6*CH3CHO + 1.2*HO2 + 0.4*C2H5OH
    force(i,178) = force(i,178) + 1.6*rate_constant(i,248) * number_density(i,87) * number_density(i,87)

    ! k_C2H5OOH_1: C2H5OOH -> 1*CH3CHO + 1*HO2 + 1*OH
    force(i,178) = force(i,178) + rate_constant(i,261) * number_density(i,175)

    ! k_C2H5O2_NO_1: C2H5O2 + NO -> 1*CH3CHO + 1*HO2 + 1*NO2
    force(i,178) = force(i,178) + rate_constant(i,270) * number_density(i,87) * number_density(i,137)

    ! k_C2H5O2_CH3O2_1: C2H5O2 + CH3O2 -> 0.7*CH2O + 0.8*CH3CHO + 1*HO2 + 0.3*CH3OH + 0.2*C2H5OH
    force(i,178) = force(i,178) + 0.8*rate_constant(i,277) * number_density(i,87) * number_density(i,191)

    ! k_ALKOOH_1: ALKOOH -> 0.4*CH3CHO + 0.1*CH2O + 0.25*CH3COCH3 + 0.9*HO2 + 0.8*MEK + 1*OH
    force(i,178) = force(i,178) + 0.4*rate_constant(i,300) * number_density(i,65)

    ! k_MEKO2_NO_1: MEKO2 + NO -> 1*CH3CO3 + 1*CH3CHO + 1*NO2
    force(i,178) = force(i,178) + rate_constant(i,332) * number_density(i,128) * number_density(i,137)

    ! k_NO_PO2_1: NO + PO2 -> 1*CH3CHO + 1*CH2O + 1*HO2 + 1*NO2
    force(i,178) = force(i,178) + rate_constant(i,365) * number_density(i,137) * number_density(i,151)

    ! k_BIGENE_NO3_1: BIGENE + NO3 -> 1*NO2 + 1*CH3CHO + 0.5*CH2O + 0.5*CH3COCH3
    force(i,178) = force(i,178) + rate_constant(i,387) * number_density(i,97) * number_density(i,165)

    ! k_ALKNIT_OH_1: ALKNIT + OH -> 0.4*CH2O + 0.8*CH3CHO + 0.8*CH3COCH3 + 1*NO2
    force(i,178) = force(i,178) + 0.8*rate_constant(i,394) * number_density(i,5) * number_density(i,166)

    ! k_MVK_O3_1: MVK + O3 -> 0.6*CH2O + 0.56*CO + 0.1*CH3CHO + 0.1*CO2 + 0.28*CH3CO3 + 0.5*CH3COCHO + 0.28*HO2 + 0.36*OH + 0.12*HCOOH
    force(i,178) = force(i,178) + 0.1*rate_constant(i,420) * number_density(i,25) * number_density(i,171)

    ! k_ALKNIT_1: ALKNIT -> 1*NO2 + 0.4*CH3CHO + 0.1*CH2O + 0.25*CH3COCH3 + 1*HO2 + 0.8*MEK
    force(i,178) = force(i,178) + 0.4*rate_constant(i,452) * number_density(i,5)

    ! k_C3H7O2_NO_1: C3H7O2 + NO -> 0.82*CH3COCH3 + 1*NO2 + 1*HO2 + 0.27*CH3CHO
    force(i,178) = force(i,178) + 0.27*rate_constant(i,471) * number_density(i,109) * number_density(i,137)

    ! k_C2H5OH_OH_1: C2H5OH + OH -> 1*HO2 + 1*CH3CHO
    force(i,178) = force(i,178) + rate_constant(i,477) * number_density(i,126) * number_density(i,166)

    ! H2O2
    force(i,179) = 0

    ! k_HO2_HO2_1: HO2 + HO2 -> 1*H2O2 + 1*O2
    force(i,179) = force(i,179) + rate_constant(i,209) * number_density(i,192) * number_density(i,192)

    ! k_HO2_HO2_M_1: HO2 + HO2 + M -> 1*H2O2 + 1*O2 + 1*M
    force(i,179) = force(i,179) + rate_constant(i,210) * number_density(i,192) * number_density(i,192) * number_density(i,1)

    ! k_H2O_HO2_HO2_1: H2O + HO2 + HO2 -> 1*H2O2 + 1*O2 + 1*H2O
    force(i,179) = force(i,179) + rate_constant(i,211) * number_density(i,68) * number_density(i,192) * number_density(i,192)

    ! k_H2O_HO2_HO2_M_1: H2O + HO2 + HO2 + M -> 1*H2O2 + 1*O2 + 1*M + 1*H2O
    force(i,179) = force(i,179) + rate_constant(i,212) * number_density(i,68) * number_density(i,192) * number_density(i,192) * number_density(i,1)

    ! k_OH_OH_2: OH + OH -> 1*H2O2
    force(i,179) = force(i,179) + rate_constant(i,213) * number_density(i,166) * number_density(i,166)

    ! k_H2O2_1: H2O2 -> 2*OH
    force(i,179) = force(i,179) - rate_constant(i,239) * number_density(i,179)

    ! k_CL_H2O2_1: CL + H2O2 -> 1*HCL + 1*HO2
    force(i,179) = force(i,179) - rate_constant(i,310) * number_density(i,100) * number_density(i,179)

    ! k_H2O2_O_1: H2O2 + O -> 1*OH + 1*HO2
    force(i,179) = force(i,179) - rate_constant(i,440) * number_density(i,179) * number_density(i,187)

    ! k_H2O2_OH_1: H2O2 + OH -> 1*H2O + 1*HO2
    force(i,179) = force(i,179) - rate_constant(i,456) * number_density(i,179) * number_density(i,166)

    ! HCL
    force(i,180) = 0

    ! k_CH4_CL_1: CH4 + CL -> 1*CH3O2 + 1*HCL
    force(i,180) = force(i,180) + rate_constant(i,23) * number_density(i,45) * number_density(i,100)

    ! k_CH2BR2_CL_1: CH2BR2 + CL -> 2*BR + 1*HCL
    force(i,180) = force(i,180) + rate_constant(i,27) * number_density(i,169) * number_density(i,100)

    ! k_CLO_OH_1: CLO + OH -> 1*HCL + 1*O2
    force(i,180) = force(i,180) + rate_constant(i,43) * number_density(i,86) * number_density(i,166)
  end do
  !$acc end parallel

end subroutine p_force57

subroutine p_force58(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_HCL_O1D_1: HCL + O1D -> 1*CL + 1*OH
    force(i,180) = force(i,180) - rate_constant(i,53) * number_density(i,180) * number_density(i,112)

    ! k_CL_HOCL_1: CL + HOCL -> 1*HCL + 1*CLO
    force(i,180) = force(i,180) + rate_constant(i,91) * number_density(i,100) * number_density(i,88)

    ! k_CH3CL_CL_1: CH3CL + CL -> 1*HO2 + 1*CO + 2*HCL
    force(i,180) = force(i,180) + 2*rate_constant(i,102) * number_density(i,53) * number_density(i,100)

    ! k_CL_H2_1: CL + H2 -> 1*HCL + 1*H
    force(i,180) = force(i,180) + rate_constant(i,166) * number_density(i,100) * number_density(i,152)

    ! k_C2H6_CL_1: C2H6 + CL -> 1*HCL + 1*C2H5O2
    force(i,180) = force(i,180) + rate_constant(i,193) * number_density(i,174) * number_density(i,100)

    ! k_CL_HO2_1: CL + HO2 -> 1*HCL + 1*O2
    force(i,180) = force(i,180) + rate_constant(i,264) * number_density(i,100) * number_density(i,192)

    ! k_HCL_O_1: HCL + O -> 1*CL + 1*OH
    force(i,180) = force(i,180) - rate_constant(i,293) * number_density(i,180) * number_density(i,187)

    ! k_CL_H2O2_1: CL + H2O2 -> 1*HCL + 1*HO2
    force(i,180) = force(i,180) + rate_constant(i,310) * number_density(i,100) * number_density(i,179)

    ! k_HCL_1: HCL -> 1*H + 1*CL
    force(i,180) = force(i,180) - rate_constant(i,321) * number_density(i,180)

    ! k_HCL_O1D_2: HCL + O1D -> 1*CLO + 1*H
    force(i,180) = force(i,180) - rate_constant(i,344) * number_density(i,180) * number_density(i,112)

    ! k_CH3BR_CL_1: CH3BR + CL -> 1*HCL + 1*HO2 + 1*BR
    force(i,180) = force(i,180) + rate_constant(i,396) * number_density(i,94) * number_density(i,100)

    ! k_CH2O_CL_1: CH2O + CL -> 1*HCL + 1*HO2 + 1*CO
    force(i,180) = force(i,180) + rate_constant(i,425) * number_density(i,124) * number_density(i,100)

    ! k_HCL_OH_1: HCL + OH -> 1*H2O + 1*CL
    force(i,180) = force(i,180) - rate_constant(i,458) * number_density(i,180) * number_density(i,166)

    ! k_CHBR3_CL_1: CHBR3 + CL -> 3*BR + 1*HCL
    force(i,180) = force(i,180) + rate_constant(i,462) * number_density(i,84) * number_density(i,100)

    ! DICARBO2
    force(i,181) = 0

    ! k_DICARBO2_NO2_1: DICARBO2 + NO2 -> 
    force(i,181) = force(i,181) - rate_constant(i,316) * number_density(i,181) * number_density(i,54)

    ! k_DICARBO2_NO_1: DICARBO2 + NO -> 1*NO2 + 0.17*HO2 + 0.17*CH3COCHO + 0.17*CO + 0.83*CH3O2
    force(i,181) = force(i,181) - rate_constant(i,337) * number_density(i,181) * number_density(i,137)

    ! k_DICARBO2_HO2_1: DICARBO2 + HO2 -> 0.4*OH + 0.07*HO2 + 0.07*CH3COCHO + 0.07*CO + 0.33*CH3O2
    force(i,181) = force(i,181) - rate_constant(i,370) * number_density(i,181) * number_density(i,192)

    ! k_BIGALD2_1: BIGALD2 -> 0.6*HO2 + 0.6*DICARBO2
    force(i,181) = force(i,181) + 0.6*rate_constant(i,375) * number_density(i,116)

    ! PHENO
    force(i,182) = 0

    ! k_OH_XYLOL_1: OH + XYLOL -> 0.3*XYLOLO2 + 0.63*HO2 + 0.07*PHENO
    force(i,182) = force(i,182) + 0.07*rate_constant(i,80) * number_density(i,166) * number_density(i,14)

    ! k_CRESOL_OH_1: CRESOL + OH -> 0.2*PHENO2 + 0.73*HO2 + 0.07*PHENO
    force(i,182) = force(i,182) + 0.07*rate_constant(i,95) * number_density(i,139) * number_density(i,166)

    ! k_C6H5O2_NO_1: C6H5O2 + NO -> 1*PHENO + 1*NO2
    force(i,182) = force(i,182) + rate_constant(i,175) * number_density(i,81) * number_density(i,137)

    ! k_O3_PHENO_1: O3 + PHENO -> 1*C6H5O2
    force(i,182) = force(i,182) - rate_constant(i,249) * number_density(i,171) * number_density(i,182)

    ! k_OH_PHENOL_1: OH + PHENOL -> 0.14*PHENO2 + 0.8*HO2 + 0.06*PHENO
    force(i,182) = force(i,182) + 0.06*rate_constant(i,266) * number_density(i,166) * number_density(i,21)

    ! k_NO2_PHENO_1: NO2 + PHENO -> 
    force(i,182) = force(i,182) - rate_constant(i,292) * number_density(i,54) * number_density(i,182)

    ! k_C6H5OOH_1: C6H5OOH -> 1*PHENO + 1*OH
    force(i,182) = force(i,182) + rate_constant(i,350) * number_density(i,10)

    ! OCLO
    force(i,183) = 0

    ! k_OCLO_SO_1: OCLO + SO -> 1*SO2 + 1*CLO
    force(i,183) = force(i,183) - rate_constant(i,47) * number_density(i,183) * number_density(i,32)

    ! k_OCLO_1: OCLO -> 1*O + 1*CLO
    force(i,183) = force(i,183) - rate_constant(i,256) * number_density(i,183)

    ! k_BRO_CLO_3: BRO + CLO -> 1*BR + 1*OCLO
    force(i,183) = force(i,183) + rate_constant(i,448) * number_density(i,71) * number_density(i,86)

    ! k_CLO_CLO_4: CLO + CLO -> 1*CL + 1*OCLO
    force(i,183) = force(i,183) + rate_constant(i,468) * number_density(i,86) * number_density(i,86)

    ! CH3COOOH
    force(i,184) = 0

    ! k_CH3COOOH_1: CH3COOOH -> 1*CH3O2 + 1*OH + 1*CO2
    force(i,184) = force(i,184) - rate_constant(i,199) * number_density(i,184)
  end do
  !$acc end parallel

end subroutine p_force58

subroutine p_force59(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_CH3CO3_HO2_1: CH3CO3 + HO2 -> 0.4*CH3COOOH + 0.15*CH3COOH + 0.15*O3 + 0.45*OH + 0.45*CH3O2
    force(i,184) = force(i,184) + 0.4*rate_constant(i,259) * number_density(i,49) * number_density(i,192)

    ! k_HO2_MCO3_1: HO2 + MCO3 -> 0.15*O3 + 0.15*CH3COOH + 0.4*CH3COOOH + 0.45*OH + 0.45*CO2 + 0.45*CH2O + 0.45*CH3CO3
    force(i,184) = force(i,184) + 0.4*rate_constant(i,269) * number_density(i,192) * number_density(i,167)

    ! k_CH3COOOH_OH_1: CH3COOOH + OH -> 0.5*CH3CO3 + 0.5*CH2O + 0.5*CO2 + 1*H2O
    force(i,184) = force(i,184) - rate_constant(i,393) * number_density(i,184) * number_density(i,166)

    ! N
    force(i,185) = 0

    ! k_N_NO2_1: N + NO2 -> 1*N2 + 1*O2
    force(i,185) = force(i,185) - rate_constant(i,8) * number_density(i,185) * number_density(i,54)

    ! k_NO_1: NO -> 1*N + 1*O
    force(i,185) = force(i,185) + rate_constant(i,97) * number_density(i,137)

    ! k_N_O2_1: N + O2 -> 1*NO + 1*O
    force(i,185) = force(i,185) - rate_constant(i,117) * number_density(i,185) * number_density(i,41)

    ! k_N_NO2_2: N + NO2 -> 2*NO
    force(i,185) = force(i,185) - rate_constant(i,154) * number_density(i,185) * number_density(i,54)

    ! k_N_OH_1: N + OH -> 1*NO + 1*H
    force(i,185) = force(i,185) - rate_constant(i,250) * number_density(i,185) * number_density(i,166)

    ! k_N_NO2_3: N + NO2 -> 1*N2O + 1*O
    force(i,185) = force(i,185) - rate_constant(i,273) * number_density(i,185) * number_density(i,54)

    ! k_N_NO_1: N + NO -> 1*N2 + 1*O
    force(i,185) = force(i,185) - rate_constant(i,408) * number_density(i,185) * number_density(i,137)

    ! HOBR
    force(i,186) = 0

    ! k_HOBR_1: HOBR -> 1*BR + 1*OH
    force(i,186) = force(i,186) - rate_constant(i,186) * number_density(i,186)

    ! k_BRO_HO2_1: BRO + HO2 -> 1*HOBR + 1*O2
    force(i,186) = force(i,186) + rate_constant(i,299) * number_density(i,71) * number_density(i,192)

    ! k_HOBR_O_1: HOBR + O -> 1*BRO + 1*OH
    force(i,186) = force(i,186) - rate_constant(i,447) * number_density(i,186) * number_density(i,187)

    ! O
    force(i,187) = 0

    ! k_N2_O1D_1: N2 + O1D -> 1*O + 1*N2
    force(i,187) = force(i,187) + rate_constant(i,6) * number_density(i,11) * number_density(i,112)

    ! k_CH2O_O_1: CH2O + O -> 1*HO2 + 1*OH + 1*CO
    force(i,187) = force(i,187) - rate_constant(i,10) * number_density(i,124) * number_density(i,187)

    ! k_O2_1: O2 -> 2*O
    force(i,187) = force(i,187) + 2*rate_constant(i,12) * number_density(i,41)

    ! k_CLO_O_1: CLO + O -> 1*CL + 1*O2
    force(i,187) = force(i,187) - rate_constant(i,21) * number_density(i,86) * number_density(i,187)

    ! k_SO3_1: SO3 -> 1*SO2 + 1*O
    force(i,187) = force(i,187) + rate_constant(i,24) * number_density(i,28)

    ! k_CH4_1: CH4 -> 1.44*H2 + 0.18*CH2O + 0.18*O + 0.33*OH + 0.33*H + 0.44*CO2 + 0.38*CO + 0.05*H2O
    force(i,187) = force(i,187) + 0.18*rate_constant(i,37) * number_density(i,45)

    ! k_NO_O_1: NO + O -> 1*NO2
    force(i,187) = force(i,187) - rate_constant(i,62) * number_density(i,137) * number_density(i,187)

    ! k_H2O_1: H2O -> 2*H + 1*O
    force(i,187) = force(i,187) + rate_constant(i,77) * number_density(i,68)

    ! k_BRO_1: BRO -> 1*BR + 1*O
    force(i,187) = force(i,187) + rate_constant(i,83) * number_density(i,71)

    ! k_SO2_1: SO2 -> 1*SO + 1*O
    force(i,187) = force(i,187) + rate_constant(i,87) * number_density(i,55)

    ! k_NO_1: NO -> 1*N + 1*O
    force(i,187) = force(i,187) + rate_constant(i,97) * number_density(i,137)

    ! k_OH_OH_1: OH + OH -> 1*H2O + 1*O
    force(i,187) = force(i,187) + rate_constant(i,100) * number_density(i,166) * number_density(i,166)

    ! k_N_O2_1: N + O2 -> 1*NO + 1*O
    force(i,187) = force(i,187) + rate_constant(i,117) * number_density(i,185) * number_density(i,41)

    ! k_NO2_1: NO2 -> 1*NO + 1*O
    force(i,187) = force(i,187) + rate_constant(i,121) * number_density(i,54)

    ! k_NO3_O_1: NO3 + O -> 1*NO2 + 1*O2
    force(i,187) = force(i,187) - rate_constant(i,129) * number_density(i,165) * number_density(i,187)

    ! k_O_O3_1: O + O3 -> 2*O2
    force(i,187) = force(i,187) - rate_constant(i,187) * number_density(i,187) * number_density(i,171)

    ! k_NO3_1: NO3 -> 1*NO2 + 1*O
    force(i,187) = force(i,187) + rate_constant(i,189) * number_density(i,165)

    ! k_O_OH_1: O + OH -> 1*H + 1*O2
    force(i,187) = force(i,187) - rate_constant(i,196) * number_density(i,187) * number_density(i,166)
  end do
  !$acc end parallel

end subroutine p_force59

subroutine p_force60(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_M_O_O2_1: M + O + O2 -> 1*O3 + 1*M
    force(i,187) = force(i,187) - rate_constant(i,202) * number_density(i,1) * number_density(i,187) * number_density(i,41)

    ! k_HO2_O_1: HO2 + O -> 1*OH + 1*O2
    force(i,187) = force(i,187) - rate_constant(i,217) * number_density(i,192) * number_density(i,187)

    ! k_BRO_O_1: BRO + O -> 1*BR + 1*O2
    force(i,187) = force(i,187) - rate_constant(i,223) * number_density(i,71) * number_density(i,187)

    ! k_O2_SO_1: O2 + SO -> 1*SO2 + 1*O
    force(i,187) = force(i,187) + rate_constant(i,241) * number_density(i,41) * number_density(i,32)

    ! k_HOCL_O_1: HOCL + O -> 1*CLO + 1*OH
    force(i,187) = force(i,187) - rate_constant(i,244) * number_density(i,88) * number_density(i,187)

    ! k_OCLO_1: OCLO -> 1*O + 1*CLO
    force(i,187) = force(i,187) + rate_constant(i,256) * number_density(i,183)

    ! k_N_NO2_3: N + NO2 -> 1*N2O + 1*O
    force(i,187) = force(i,187) + rate_constant(i,273) * number_density(i,185) * number_density(i,54)

    ! k_CO2_1: CO2 -> 1*CO + 1*O
    force(i,187) = force(i,187) + rate_constant(i,274) * number_density(i,82)

    ! k_N2O5_2: N2O5 -> 1*NO + 1*O + 1*NO3
    force(i,187) = force(i,187) + rate_constant(i,278) * number_density(i,51)

    ! k_H_HO2_2: H + HO2 -> 1*H2O + 1*O
    force(i,187) = force(i,187) + rate_constant(i,282) * number_density(i,48) * number_density(i,192)

    ! k_SO_1: SO -> 1*S + 1*O
    force(i,187) = force(i,187) + rate_constant(i,287) * number_density(i,32)

    ! k_HCL_O_1: HCL + O -> 1*CL + 1*OH
    force(i,187) = force(i,187) - rate_constant(i,293) * number_density(i,180) * number_density(i,187)

    ! k_M_O_O_1: M + O + O -> 1*O2 + 1*M
    force(i,187) = force(i,187) - rate_constant(i,304) * number_density(i,1) * number_density(i,187) * number_density(i,187)

    ! k_M_O_O_1: M + O + O -> 1*O2 + 1*M
    force(i,187) = force(i,187) - rate_constant(i,304) * number_density(i,1) * number_density(i,187) * number_density(i,187)

    ! k_NO2_O_1: NO2 + O -> 1*NO + 1*O2
    force(i,187) = force(i,187) - rate_constant(i,351) * number_density(i,54) * number_density(i,187)

    ! k_O3_1: O3 -> 1*O + 1*O2
    force(i,187) = force(i,187) + rate_constant(i,367) * number_density(i,171)

    ! k_CLO_1: CLO -> 1*CL + 1*O
    force(i,187) = force(i,187) + rate_constant(i,380) * number_density(i,86)

    ! k_O1D_O2_1: O1D + O2 -> 1*O + 1*O2
    force(i,187) = force(i,187) + rate_constant(i,395) * number_density(i,112) * number_density(i,41)

    ! k_N_NO_1: N + NO -> 1*N2 + 1*O
    force(i,187) = force(i,187) + rate_constant(i,408) * number_density(i,185) * number_density(i,137)

    ! k_BRONO2_O_1: BRONO2 + O -> 1*BRO + 1*NO3
    force(i,187) = force(i,187) - rate_constant(i,418) * number_density(i,72) * number_density(i,187)

    ! k_H2O2_O_1: H2O2 + O -> 1*OH + 1*HO2
    force(i,187) = force(i,187) - rate_constant(i,440) * number_density(i,179) * number_density(i,187)

    ! k_HOBR_O_1: HOBR + O -> 1*BRO + 1*OH
    force(i,187) = force(i,187) - rate_constant(i,447) * number_density(i,186) * number_density(i,187)

    ! k_CLONO2_O_1: CLONO2 + O -> 1*CLO + 1*NO3
    force(i,187) = force(i,187) - rate_constant(i,463) * number_density(i,74) * number_density(i,187)

    ! k_H2_O_1: H2 + O -> 1*OH + 1*H
    force(i,187) = force(i,187) - rate_constant(i,465) * number_density(i,152) * number_density(i,187)

    ! k_NO2_O_2: NO2 + O -> 1*NO3
    force(i,187) = force(i,187) - rate_constant(i,472) * number_density(i,54) * number_density(i,187)

    ! k_HBR_O_1: HBR + O -> 1*BR + 1*OH
    force(i,187) = force(i,187) - rate_constant(i,473) * number_density(i,80) * number_density(i,187)

    ! MACRO2
    force(i,188) = 0

    ! k_HO2_MACRO2_1: HO2 + MACRO2 -> 1*MACROOH
    force(i,188) = force(i,188) - rate_constant(i,36) * number_density(i,192) * number_density(i,188)

    ! k_MACRO2_NO_1: MACRO2 + NO -> 1*NO2 + 0.47*HO2 + 0.25*CH2O + 0.53*GLYALD + 0.25*CH3COCHO + 0.53*CH3CO3 + 0.22*HYAC + 0.22*CO
    force(i,188) = force(i,188) - rate_constant(i,40) * number_density(i,188) * number_density(i,137)

    ! k_MACRO2_NO3_1: MACRO2 + NO3 -> 1*NO2 + 0.47*HO2 + 0.25*CH2O + 0.25*CH3COCHO + 0.22*CO + 0.53*GLYALD + 0.22*HYAC + 0.53*CH3CO3
    force(i,188) = force(i,188) - rate_constant(i,134) * number_density(i,188) * number_density(i,165)

    ! k_MACROOH_OH_1: MACROOH + OH -> 0.5*MCO3 + 0.2*MACRO2 + 0.1*OH + 0.2*HO2
    force(i,188) = force(i,188) + 0.2*rate_constant(i,136) * number_density(i,44) * number_density(i,166)

    ! k_MACR_OH_1: MACR + OH -> 0.5*MACRO2 + 0.5*H2O + 0.5*MCO3
    force(i,188) = force(i,188) + 0.5*rate_constant(i,220) * number_density(i,157) * number_density(i,166)

    ! k_CH3CO3_MACRO2_1: CH3CO3 + MACRO2 -> 0.25*CH3COCHO + 1*CH3O2 + 0.22*CO + 0.47*HO2 + 0.53*GLYALD + 0.22*HYAC + 0.25*CH2O + 0.53*CH3CO3
    force(i,188) = force(i,188) - rate_constant(i,235) * number_density(i,49) * number_density(i,188)

    ! k_CH3O2_MACRO2_1: CH3O2 + MACRO2 -> 0.73*HO2 + 0.88*CH2O + 0.11*CO + 0.24*CH3COCHO + 0.26*GLYALD + 0.26*CH3CO3 + 0.25*CH3OH + 0.23*HYAC
    force(i,188) = force(i,188) - rate_constant(i,322) * number_density(i,191) * number_density(i,188)
  end do
  !$acc end parallel

end subroutine p_force60

subroutine p_force61(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_MVK_OH_1: MVK + OH -> 1*MACRO2
    force(i,188) = force(i,188) + rate_constant(i,336) * number_density(i,25) * number_density(i,166)

    ! k_MACRO2_NO_2: MACRO2 + NO -> 1*HONITR
    force(i,188) = force(i,188) - rate_constant(i,376) * number_density(i,188) * number_density(i,137)

    ! ISOPAO2
    force(i,189) = 0

    ! k_CH3CO3_ISOPAO2_1: CH3CO3 + ISOPAO2 -> 1*CH3O2 + 1*HO2 + 1*CH2O + 0.39*MACR + 0.61*MVK + 1*CO2
    force(i,189) = force(i,189) - rate_constant(i,65) * number_density(i,49) * number_density(i,189)

    ! k_ISOP_OH_2: ISOP + OH -> 0.6*ISOPAO2 + 0.4*ISOPBO2
    force(i,189) = force(i,189) + 0.6*rate_constant(i,76) * number_density(i,142) * number_density(i,166)

    ! k_HO2_ISOPAO2_1: HO2 + ISOPAO2 -> 1*ISOPOOH
    force(i,189) = force(i,189) - rate_constant(i,324) * number_density(i,192) * number_density(i,189)

    ! k_ISOPAO2_NO3_1: ISOPAO2 + NO3 -> 1*NO2 + 0.4*MACR + 0.6*MVK + 1*CH2O + 1*HO2
    force(i,189) = force(i,189) - rate_constant(i,330) * number_density(i,189) * number_density(i,165)

    ! k_CH3O2_ISOPAO2_1: CH3O2 + ISOPAO2 -> 0.25*CH3OH + 1*HO2 + 1.5*CH2O + 0.31*MACR + 0.44*MVK
    force(i,189) = force(i,189) - rate_constant(i,434) * number_density(i,191) * number_density(i,189)

    ! k_ISOPAO2_NO_1: ISOPAO2 + NO -> 0.08*ISOPNITA + 0.92*NO2 + 0.36*MACR + 0.56*MVK + 0.92*CH2O + 0.92*HO2
    force(i,189) = force(i,189) - rate_constant(i,464) * number_density(i,189) * number_density(i,137)

    ! ISOPBO2
    force(i,190) = 0

    ! k_ISOP_OH_2: ISOP + OH -> 0.6*ISOPAO2 + 0.4*ISOPBO2
    force(i,190) = force(i,190) + 0.4*rate_constant(i,76) * number_density(i,142) * number_density(i,166)

    ! k_ISOPBO2_NO_1: ISOPBO2 + NO -> 0.87*HYDRALD + 0.08*ISOPNITB + 0.92*NO2 + 0.92*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    force(i,190) = force(i,190) - rate_constant(i,96) * number_density(i,190) * number_density(i,137)

    ! k_CH3O2_ISOPBO2_1: CH3O2 + ISOPBO2 -> 0.25*CH3OH + 1*HO2 + 0.75*CH2O + 0.75*HYDRALD
    force(i,190) = force(i,190) - rate_constant(i,167) * number_density(i,191) * number_density(i,190)

    ! k_ISOPBO2_NO3_1: ISOPBO2 + NO3 -> 1*NO2 + 0.95*HYDRALD + 1*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    force(i,190) = force(i,190) - rate_constant(i,178) * number_density(i,190) * number_density(i,165)

    ! k_HO2_ISOPBO2_1: HO2 + ISOPBO2 -> 1*ISOPOOH
    force(i,190) = force(i,190) - rate_constant(i,279) * number_density(i,192) * number_density(i,190)

    ! k_CH3CO3_ISOPBO2_1: CH3CO3 + ISOPBO2 -> 1*HYDRALD + 1*CH3O2 + 1*HO2
    force(i,190) = force(i,190) - rate_constant(i,340) * number_density(i,49) * number_density(i,190)

    ! k_ISOPBO2_1: ISOPBO2 -> 1*HPALD + 1*HO2
    force(i,190) = force(i,190) - rate_constant(i,390) * number_density(i,190)

    ! CH3O2
    force(i,191) = 0

    ! k_CH3O2_TERPO2_1: CH3O2 + TERPO2 -> 1*TERPROD1 + 0.95*CH2O + 0.25*CH3OH + 1*HO2 + 0.025*CH3COCH3
    force(i,191) = force(i,191) - rate_constant(i,3) * number_density(i,191) * number_density(i,147)

    ! k_MVK_1: MVK -> 0.7*C3H6 + 0.7*CO + 0.3*CH3O2 + 0.3*CH3CO3
    force(i,191) = force(i,191) + 0.3*rate_constant(i,15) * number_density(i,25)

    ! k_CH4_CL_1: CH4 + CL -> 1*CH3O2 + 1*HCL
    force(i,191) = force(i,191) + rate_constant(i,23) * number_density(i,45) * number_density(i,100)

    ! k_CH3CO3_NO_1: CH3CO3 + NO -> 1*CH3O2 + 1*CO2 + 1*NO2
    force(i,191) = force(i,191) + rate_constant(i,25) * number_density(i,49) * number_density(i,137)

    ! k_CH3CO3_CH3CO3_1: CH3CO3 + CH3CO3 -> 2*CH3O2 + 2*CO2
    force(i,191) = force(i,191) + 2*rate_constant(i,32) * number_density(i,49) * number_density(i,49)

    ! k_CH3COCH3_1: CH3COCH3 -> 1*CH3CO3 + 1*CH3O2
    force(i,191) = force(i,191) + rate_constant(i,46) * number_density(i,89)

    ! k_C3H7O2_CH3O2_1: C3H7O2 + CH3O2 -> 1*CH2O + 1*HO2 + 0.82*CH3COCH3
    force(i,191) = force(i,191) - rate_constant(i,63) * number_density(i,109) * number_density(i,191)

    ! k_CH3CO3_ISOPAO2_1: CH3CO3 + ISOPAO2 -> 1*CH3O2 + 1*HO2 + 1*CH2O + 0.39*MACR + 0.61*MVK + 1*CO2
    force(i,191) = force(i,191) + rate_constant(i,65) * number_density(i,49) * number_density(i,189)

    ! k_CH3CO3_MCO3_1: CH3CO3 + MCO3 -> 2*CO2 + 1*CH3O2 + 1*CH2O + 1*CH3CO3
    force(i,191) = force(i,191) + rate_constant(i,81) * number_density(i,49) * number_density(i,167)

    ! k_CH3O2_MCO3_1: CH3O2 + MCO3 -> 2*CH2O + 1*HO2 + 1*CO2 + 1*CH3CO3
    force(i,191) = force(i,191) - rate_constant(i,84) * number_density(i,191) * number_density(i,167)

    ! k_CH3CO3_CH3O2_1: CH3CO3 + CH3O2 -> 0.9*CH3O2 + 1*CH2O + 0.9*HO2 + 0.9*CO2 + 0.1*CH3COOH
    force(i,191) = force(i,191) - 0.09999999999999998*rate_constant(i,99) * number_density(i,49) * number_density(i,191)

    ! k_CH3CO3_XO2_1: CH3CO3 + XO2 -> 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 1*CH3O2 + 1*HO2 + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD + 1*CO2
    force(i,191) = force(i,191) + rate_constant(i,106) * number_density(i,49) * number_density(i,153)

    ! k_CH3COOH_OH_1: CH3COOH + OH -> 1*CH3O2 + 1*CO2 + 1*H2O
    force(i,191) = force(i,191) + rate_constant(i,107) * number_density(i,177) * number_density(i,166)

    ! k_CH3O2_NTERPO2_1: CH3O2 + NTERPO2 -> 0.5*TERPNIT + 0.75*CH2O + 0.25*CH3OH + 0.5*HO2 + 0.5*TERPROD1 + 0.5*NO2
    force(i,191) = force(i,191) - rate_constant(i,135) * number_density(i,191) * number_density(i,143)

    ! k_CH3O2_MBOO2_1: CH3O2 + MBOO2 -> 0.917*CH2O + 1*HO2 + 0.25*CH3OH + 0.333*GLYALD + 0.333*CH3COCH3 + 0.167*HMPROP
    force(i,191) = force(i,191) - rate_constant(i,155) * number_density(i,191) * number_density(i,125)

    ! k_CH3O2_ISOPNO3_1: CH3O2 + ISOPNO3 -> 0.8*NC4CHO + 1.2*HO2 + 0.8*CH2O + 0.2*CH3OH + 0.2*NC4CH2OH
    force(i,191) = force(i,191) - rate_constant(i,160) * number_density(i,191) * number_density(i,46)
  end do
  !$acc end parallel

end subroutine p_force61

subroutine p_force62(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_HO2_MDIALO2_1: HO2 + MDIALO2 -> 0.4*OH + 0.33*HO2 + 0.07*CH3COCHO + 0.14*CO + 0.07*CH3O2 + 0.07*GLYOXAL
    force(i,191) = force(i,191) + 0.07*rate_constant(i,161) * number_density(i,192) * number_density(i,164)

    ! k_CH3O2_ISOPBO2_1: CH3O2 + ISOPBO2 -> 0.25*CH3OH + 1*HO2 + 0.75*CH2O + 0.75*HYDRALD
    force(i,191) = force(i,191) - rate_constant(i,167) * number_density(i,191) * number_density(i,190)

    ! k_C3H6_O3_1: C3H6 + O3 -> 0.5*CH2O + 0.12*HCOOH + 0.12*CH3COOH + 0.5*CH3CHO + 0.56*CO + 0.28*CH3O2 + 0.1*CH4 + 0.2*CO2 + 0.28*HO2 + 0.36*OH
    force(i,191) = force(i,191) + 0.28*rate_constant(i,170) * number_density(i,120) * number_density(i,171)

    ! k_CH4_2: CH4 -> 1*H + 1*CH3O2
    force(i,191) = force(i,191) + rate_constant(i,183) * number_density(i,45)

    ! k_CH3COOOH_1: CH3COOOH -> 1*CH3O2 + 1*OH + 1*CO2
    force(i,191) = force(i,191) + rate_constant(i,199) * number_density(i,184)

    ! k_CH3CO3_MACRO2_1: CH3CO3 + MACRO2 -> 0.25*CH3COCHO + 1*CH3O2 + 0.22*CO + 0.47*HO2 + 0.53*GLYALD + 0.22*HYAC + 0.25*CH2O + 0.53*CH3CO3
    force(i,191) = force(i,191) + rate_constant(i,235) * number_density(i,49) * number_density(i,188)

    ! k_CH3CHO_1: CH3CHO -> 1*CH3O2 + 1*CO + 1*HO2
    force(i,191) = force(i,191) + rate_constant(i,245) * number_density(i,178)

    ! k_CH3CO3_HO2_1: CH3CO3 + HO2 -> 0.4*CH3COOOH + 0.15*CH3COOH + 0.15*O3 + 0.45*OH + 0.45*CH3O2
    force(i,191) = force(i,191) + 0.45*rate_constant(i,259) * number_density(i,49) * number_density(i,192)

    ! k_C2H5O2_CH3O2_1: C2H5O2 + CH3O2 -> 0.7*CH2O + 0.8*CH3CHO + 1*HO2 + 0.3*CH3OH + 0.2*C2H5OH
    force(i,191) = force(i,191) - rate_constant(i,277) * number_density(i,87) * number_density(i,191)

    ! k_CH4_OH_1: CH4 + OH -> 1*CH3O2 + 1*H2O
    force(i,191) = force(i,191) + rate_constant(i,284) * number_density(i,45) * number_density(i,166)

    ! k_CH3O2_HO2_1: CH3O2 + HO2 -> 1*CH3OOH + 1*O2
    force(i,191) = force(i,191) - rate_constant(i,301) * number_density(i,191) * number_density(i,192)

    ! k_CH3CL_1: CH3CL -> 1*CL + 1*CH3O2
    force(i,191) = force(i,191) + rate_constant(i,320) * number_density(i,53)

    ! k_CH3O2_MACRO2_1: CH3O2 + MACRO2 -> 0.73*HO2 + 0.88*CH2O + 0.11*CO + 0.24*CH3COCHO + 0.26*GLYALD + 0.26*CH3CO3 + 0.25*CH3OH + 0.23*HYAC
    force(i,191) = force(i,191) - rate_constant(i,322) * number_density(i,191) * number_density(i,188)

    ! k_CH3O2_NO_1: CH3O2 + NO -> 1*CH2O + 1*NO2 + 1*HO2
    force(i,191) = force(i,191) - rate_constant(i,329) * number_density(i,191) * number_density(i,137)

    ! k_DICARBO2_NO_1: DICARBO2 + NO -> 1*NO2 + 0.17*HO2 + 0.17*CH3COCHO + 0.17*CO + 0.83*CH3O2
    force(i,191) = force(i,191) + 0.83*rate_constant(i,337) * number_density(i,181) * number_density(i,137)

    ! k_CH3CO3_ISOPBO2_1: CH3CO3 + ISOPBO2 -> 1*HYDRALD + 1*CH3O2 + 1*HO2
    force(i,191) = force(i,191) + rate_constant(i,340) * number_density(i,49) * number_density(i,190)

    ! k_CH3OOH_OH_1: CH3OOH + OH -> 0.7*CH3O2 + 0.3*OH + 0.3*CH2O + 1*H2O
    force(i,191) = force(i,191) + 0.7*rate_constant(i,348) * number_density(i,135) * number_density(i,166)

    ! k_CH3O2_RO2_1: CH3O2 + RO2 -> 0.3*CH3CO3 + 0.8*CH2O + 0.3*HO2 + 0.2*HYAC + 0.5*CH3COCHO + 0.5*CH3OH
    force(i,191) = force(i,191) - rate_constant(i,354) * number_density(i,191) * number_density(i,40)

    ! k_PAN_2: PAN -> 0.6*CH3CO3 + 0.6*NO2 + 0.4*CH3O2 + 0.4*NO3 + 0.4*CO2
    force(i,191) = force(i,191) + 0.4*rate_constant(i,362) * number_density(i,12)

    ! k_DICARBO2_HO2_1: DICARBO2 + HO2 -> 0.4*OH + 0.07*HO2 + 0.07*CH3COCHO + 0.07*CO + 0.33*CH3O2
    force(i,191) = force(i,191) + 0.33*rate_constant(i,370) * number_density(i,181) * number_density(i,192)

    ! k_ISOP_O3_2: ISOP + O3 -> 0.3*MACR + 0.2*MVK + 0.11*HCOOH + 0.62*CO + 0.32*OH + 0.37*HO2 + 0.91*CH2O + 0.08*CH3CO3 + 0.13*C3H6 + 0.05*CH3O2
    force(i,191) = force(i,191) + 0.05*rate_constant(i,377) * number_density(i,142) * number_density(i,171)

    ! k_CH4_O1D_3: CH4 + O1D -> 1*CH3O2 + 1*OH
    force(i,191) = force(i,191) + rate_constant(i,386) * number_density(i,45) * number_density(i,112)

    ! k_CH3BR_1: CH3BR -> 1*BR + 1*CH3O2
    force(i,191) = force(i,191) + rate_constant(i,401) * number_density(i,94)

    ! k_MDIALO2_NO_1: MDIALO2 + NO -> 1*NO2 + 0.83*HO2 + 0.17*CH3COCHO + 0.35*CO + 0.17*CH3O2 + 0.17*GLYOXAL
    force(i,191) = force(i,191) + 0.17*rate_constant(i,403) * number_density(i,164) * number_density(i,137)

    ! k_CH3O2_XO2_1: CH3O2 + XO2 -> 0.3*CH3OH + 0.8*HO2 + 0.8*CH2O + 0.2*CO + 0.1*GLYOXAL + 0.1*CH3COCHO + 0.1*HYAC + 0.1*GLYALD
    force(i,191) = force(i,191) - rate_constant(i,410) * number_density(i,191) * number_density(i,153)

    ! k_CH3CO3_ISOPNO3_1: CH3CO3 + ISOPNO3 -> 1*NC4CHO + 1*CH3O2 + 1*HO2
    force(i,191) = force(i,191) + rate_constant(i,413) * number_density(i,49) * number_density(i,46)

    ! k_CH3O2_TERP2O2_1: CH3O2 + TERP2O2 -> 1*TERPROD2 + 0.93*CH2O + 0.25*CH3OH + 1*HO2 + 0.5*CO2 + 0.125*CO + 0.125*GLYALD + 0.15*CH3COCH3
    force(i,191) = force(i,191) - rate_constant(i,414) * number_density(i,191) * number_density(i,145)

    ! k_CH3O2_CH3O2_1: CH3O2 + CH3O2 -> 2*CH2O + 2*HO2
    force(i,191) = force(i,191) - rate_constant(i,433) * number_density(i,191) * number_density(i,191)

    ! k_CH3O2_CH3O2_1: CH3O2 + CH3O2 -> 2*CH2O + 2*HO2
    force(i,191) = force(i,191) - rate_constant(i,433) * number_density(i,191) * number_density(i,191)

    ! k_CH3O2_ISOPAO2_1: CH3O2 + ISOPAO2 -> 0.25*CH3OH + 1*HO2 + 1.5*CH2O + 0.31*MACR + 0.44*MVK
    force(i,191) = force(i,191) - rate_constant(i,434) * number_density(i,191) * number_density(i,189)

    ! k_CH3O2_CH3O2_2: CH3O2 + CH3O2 -> 1*CH2O + 1*CH3OH
    force(i,191) = force(i,191) - rate_constant(i,459) * number_density(i,191) * number_density(i,191)

    ! k_CH3O2_CH3O2_2: CH3O2 + CH3O2 -> 1*CH2O + 1*CH3OH
    force(i,191) = force(i,191) - rate_constant(i,459) * number_density(i,191) * number_density(i,191)

    ! k_CH3O2_CLO_1: CH3O2 + CLO -> 1*CL + 1*HO2 + 1*CH2O
    force(i,191) = force(i,191) - rate_constant(i,467) * number_density(i,191) * number_density(i,86)

    ! HO2
    force(i,192) = 0
  end do
  !$acc end parallel

end subroutine p_force62

subroutine p_force63(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_HO2_MALO2_1: HO2 + MALO2 -> 0.16*GLYOXAL + 0.16*HO2 + 0.16*CO
    force(i,192) = force(i,192) - 0.84*rate_constant(i,1) * number_density(i,192) * number_density(i,170)

    ! k_C2H2_OH_1: C2H2 + OH -> 0.65*GLYOXAL + 0.65*OH + 0.35*HCOOH + 0.35*HO2 + 0.35*CO
    force(i,192) = force(i,192) + 0.35*rate_constant(i,2) * number_density(i,168) * number_density(i,166)

    ! k_CH3O2_TERPO2_1: CH3O2 + TERPO2 -> 1*TERPROD1 + 0.95*CH2O + 0.25*CH3OH + 1*HO2 + 0.025*CH3COCH3
    force(i,192) = force(i,192) + rate_constant(i,3) * number_density(i,191) * number_density(i,147)

    ! k_TERPNIT_1: TERPNIT -> 1*TERPROD1 + 1*NO2 + 1*HO2
    force(i,192) = force(i,192) + rate_constant(i,5) * number_density(i,39)

    ! k_OH_XYLENES_1: OH + XYLENES -> 0.15*XYLOL + 0.23*TEPOMUC + 0.06*BZOO + 0.56*XYLENO2 + 0.38*HO2
    force(i,192) = force(i,192) + 0.38*rate_constant(i,7) * number_density(i,166) * number_density(i,140)

    ! k_NO3_OH_1: NO3 + OH -> 1*HO2 + 1*NO2
    force(i,192) = force(i,192) + rate_constant(i,9) * number_density(i,165) * number_density(i,166)

    ! k_CH2O_O_1: CH2O + O -> 1*HO2 + 1*OH + 1*CO
    force(i,192) = force(i,192) + rate_constant(i,10) * number_density(i,124) * number_density(i,187)

    ! k_EO2_NO_1: EO2 + NO -> 0.5*CH2O + 0.25*HO2 + 0.75*EO + 1*NO2
    force(i,192) = force(i,192) + 0.25*rate_constant(i,16) * number_density(i,163) * number_density(i,137)

    ! k_CH3COCHO_1: CH3COCHO -> 1*CH3CO3 + 1*CO + 1*HO2
    force(i,192) = force(i,192) + rate_constant(i,17) * number_density(i,111)

    ! k_XYLENOOH_1: XYLENOOH -> 1*OH + 1*HO2 + 0.34*GLYOXAL + 0.54*CH3COCHO + 0.06*BIGALD1 + 0.2*BIGALD2 + 0.15*BIGALD3 + 0.21*BIGALD4
    force(i,192) = force(i,192) + rate_constant(i,20) * number_density(i,92)

    ! k_OH_SO2_1: OH + SO2 -> 1*SO3 + 1*HO2
    force(i,192) = force(i,192) + rate_constant(i,22) * number_density(i,166) * number_density(i,55)

    ! k_HONITR_OH_1: HONITR + OH -> 1*ONITR + 1*HO2
    force(i,192) = force(i,192) + rate_constant(i,26) * number_density(i,134) * number_density(i,166)

    ! k_MPAN_OH_1: MPAN + OH -> 0.5*HYAC + 0.5*NO3 + 0.5*CH2O + 0.5*HO2 + 0.5*CO2
    force(i,192) = force(i,192) + 0.5*rate_constant(i,28) * number_density(i,159) * number_density(i,166)

    ! k_TERPROD2_1: TERPROD2 -> 0.15*RO2 + 0.68*CH2O + 0.8*CO2 + 0.5*CH3COCH3 + 0.65*CH3CO3 + 1.2*HO2 + 1.7*CO
    force(i,192) = force(i,192) + 1.2*rate_constant(i,35) * number_density(i,155)

    ! k_HO2_MACRO2_1: HO2 + MACRO2 -> 1*MACROOH
    force(i,192) = force(i,192) - rate_constant(i,36) * number_density(i,192) * number_density(i,188)

    ! k_BR_HO2_1: BR + HO2 -> 1*HBR + 1*O2
    force(i,192) = force(i,192) - rate_constant(i,38) * number_density(i,90) * number_density(i,192)

    ! k_MACRO2_NO_1: MACRO2 + NO -> 1*NO2 + 0.47*HO2 + 0.25*CH2O + 0.53*GLYALD + 0.25*CH3COCHO + 0.53*CH3CO3 + 0.22*HYAC + 0.22*CO
    force(i,192) = force(i,192) + 0.47*rate_constant(i,40) * number_density(i,188) * number_density(i,137)

    ! k_MBONO3O2_NO3_1: MBONO3O2 + NO3 -> 0.25*HMPROP + 0.25*CH2O + 1.25*NO2 + 0.75*HONITR + 0.75*CH3COCH3 + 0.75*HO2
    force(i,192) = force(i,192) + 0.75*rate_constant(i,44) * number_density(i,123) * number_density(i,165)

    ! k_TERP2OOH_1: TERP2OOH -> 1*OH + 0.375*CH2O + 0.3*CH3COCH3 + 0.25*CO + 1*CO2 + 1*TERPROD2 + 1*HO2 + 0.25*GLYALD
    force(i,192) = force(i,192) + rate_constant(i,49) * number_density(i,37)

    ! k_ACBZO2_HO2_1: ACBZO2 + HO2 -> 0.4*C6H5O2 + 0.4*OH
    force(i,192) = force(i,192) - rate_constant(i,52) * number_density(i,43) * number_density(i,192)

    ! k_BENZO2_NO_1: BENZO2 + NO -> 1*NO2 + 1*GLYOXAL + 0.5*BIGALD1 + 1*HO2
    force(i,192) = force(i,192) + rate_constant(i,59) * number_density(i,13) * number_density(i,137)

    ! k_NO_TOLO2_1: NO + TOLO2 -> 1*NO2 + 0.6*GLYOXAL + 0.4*CH3COCHO + 1*HO2 + 0.2*BIGALD1 + 0.2*BIGALD2 + 0.2*BIGALD3
    force(i,192) = force(i,192) + rate_constant(i,60) * number_density(i,137) * number_density(i,144)

    ! k_BIGALD4_1: BIGALD4 -> 1*HO2 + 1*CO + 1*CH3COCHO + 1*CH3CO3
    force(i,192) = force(i,192) + rate_constant(i,61) * number_density(i,110)

    ! k_C3H7O2_CH3O2_1: C3H7O2 + CH3O2 -> 1*CH2O + 1*HO2 + 0.82*CH3COCH3
    force(i,192) = force(i,192) + rate_constant(i,63) * number_density(i,109) * number_density(i,191)

    ! k_CH3CO3_ISOPAO2_1: CH3CO3 + ISOPAO2 -> 1*CH3O2 + 1*HO2 + 1*CH2O + 0.39*MACR + 0.61*MVK + 1*CO2
    force(i,192) = force(i,192) + rate_constant(i,65) * number_density(i,49) * number_density(i,189)

    ! k_ALKO2_NO_1: ALKO2 + NO -> 0.4*CH3CHO + 0.1*CH2O + 0.25*CH3COCH3 + 1*HO2 + 0.8*MEK + 1*NO2
    force(i,192) = force(i,192) + rate_constant(i,71) * number_density(i,85) * number_density(i,137)

    ! k_HO2_NO2_1: HO2 + NO2 -> 1*HO2NO2
    force(i,192) = force(i,192) - rate_constant(i,73) * number_density(i,192) * number_density(i,54)

    ! k_ISOPNITB_OH_1: ISOPNITB + OH -> 0.5*HYAC + 0.5*GLYALD + 0.5*NOA + 1*HO2 + 0.5*HONITR
    force(i,192) = force(i,192) + rate_constant(i,79) * number_density(i,73) * number_density(i,166)

    ! k_OH_XYLOL_1: OH + XYLOL -> 0.3*XYLOLO2 + 0.63*HO2 + 0.07*PHENO
    force(i,192) = force(i,192) + 0.63*rate_constant(i,80) * number_density(i,166) * number_density(i,14)

    ! k_CH3O2_MCO3_1: CH3O2 + MCO3 -> 2*CH2O + 1*HO2 + 1*CO2 + 1*CH3CO3
    force(i,192) = force(i,192) + rate_constant(i,84) * number_density(i,191) * number_density(i,167)

    ! k_TEPOMUC_1: TEPOMUC -> 0.5*CH3CO3 + 1*HO2 + 1.5*CO
    force(i,192) = force(i,192) + rate_constant(i,85) * number_density(i,2)

    ! k_XYLOLOOH_1: XYLOLOOH -> 1*OH + 0.17*GLYOXAL + 0.51*CH3COCHO + 1*HO2
    force(i,192) = force(i,192) + rate_constant(i,86) * number_density(i,26)

    ! k_HO2_MBONO3O2_1: HO2 + MBONO3O2 -> 
    force(i,192) = force(i,192) - rate_constant(i,90) * number_density(i,192) * number_density(i,123)

    ! k_CH3CL_OH_1: CH3CL + OH -> 1*CL + 1*H2O + 1*HO2
    force(i,192) = force(i,192) + rate_constant(i,92) * number_density(i,53) * number_density(i,166)
  end do
  !$acc end parallel

end subroutine p_force63

subroutine p_force64(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_CRESOL_OH_1: CRESOL + OH -> 0.2*PHENO2 + 0.73*HO2 + 0.07*PHENO
    force(i,192) = force(i,192) + 0.73*rate_constant(i,95) * number_density(i,139) * number_density(i,166)

    ! k_ISOPBO2_NO_1: ISOPBO2 + NO -> 0.87*HYDRALD + 0.08*ISOPNITB + 0.92*NO2 + 0.92*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    force(i,192) = force(i,192) + 0.92*rate_constant(i,96) * number_density(i,190) * number_density(i,137)

    ! k_PHENOOH_1: PHENOOH -> 1*OH + 1*HO2 + 0.7*GLYOXAL
    force(i,192) = force(i,192) + rate_constant(i,98) * number_density(i,115)

    ! k_CH3CO3_CH3O2_1: CH3CO3 + CH3O2 -> 0.9*CH3O2 + 1*CH2O + 0.9*HO2 + 0.9*CO2 + 0.1*CH3COOH
    force(i,192) = force(i,192) + 0.9*rate_constant(i,99) * number_density(i,49) * number_density(i,191)

    ! k_MACR_O3_1: MACR + O3 -> 0.12*CH2O + 0.24*OH + 0.65*CO + 0.1*CH3CO3 + 0.88*CH3COCHO + 0.33*HCOOH + 0.14*HO2
    force(i,192) = force(i,192) + 0.14*rate_constant(i,101) * number_density(i,157) * number_density(i,171)

    ! k_CH3CL_CL_1: CH3CL + CL -> 1*HO2 + 1*CO + 2*HCL
    force(i,192) = force(i,192) + rate_constant(i,102) * number_density(i,53) * number_density(i,100)

    ! k_CH3CO3_XO2_1: CH3CO3 + XO2 -> 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 1*CH3O2 + 1*HO2 + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD + 1*CO2
    force(i,192) = force(i,192) + rate_constant(i,106) * number_density(i,49) * number_density(i,153)

    ! k_NO3_XO2_1: NO3 + XO2 -> 1*NO2 + 1*HO2 + 0.5*CO + 0.25*HYAC + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*GLYALD
    force(i,192) = force(i,192) + rate_constant(i,109) * number_density(i,165) * number_density(i,153)

    ! k_NO_TERP2O2_1: NO + TERP2O2 -> 0.1*ONITR + 0.9*NO2 + 0.34*CH2O + 0.27*CH3COCH3 + 0.225*CO + 0.9*CO2 + 0.9*TERPROD2 + 0.9*HO2 + 0.225*GLYALD
    force(i,192) = force(i,192) + 0.9*rate_constant(i,110) * number_density(i,137) * number_density(i,145)

    ! k_CH3BR_OH_1: CH3BR + OH -> 1*BR + 1*H2O + 1*HO2
    force(i,192) = force(i,192) + rate_constant(i,112) * number_density(i,94) * number_density(i,166)

    ! k_HOCH2OO_NO_1: HOCH2OO + NO -> 1*HCOOH + 1*NO2 + 1*HO2
    force(i,192) = force(i,192) + rate_constant(i,113) * number_density(i,154) * number_density(i,137)

    ! k_C3H7OOH_1: C3H7OOH -> 0.82*CH3COCH3 + 1*OH + 1*HO2
    force(i,192) = force(i,192) + rate_constant(i,115) * number_density(i,20)

    ! k_GLYALD_OH_1: GLYALD + OH -> 1*HO2 + 0.2*GLYOXAL + 0.8*CH2O + 0.8*CO2
    force(i,192) = force(i,192) + rate_constant(i,123) * number_density(i,156) * number_density(i,166)

    ! k_HO2_NTERPO2_1: HO2 + NTERPO2 -> 1*NTERPOOH
    force(i,192) = force(i,192) - rate_constant(i,124) * number_density(i,192) * number_density(i,143)

    ! k_BIGALD3_1: BIGALD3 -> 0.6*HO2 + 0.6*CO + 0.6*MDIALO2
    force(i,192) = force(i,192) + 0.6*rate_constant(i,126) * number_density(i,108)

    ! k_BEPOMUC_1: BEPOMUC -> 1*BIGALD1 + 1.5*HO2 + 1.5*CO
    force(i,192) = force(i,192) + 1.5*rate_constant(i,132) * number_density(i,96)

    ! k_HO2_RO2_1: HO2 + RO2 -> 0.85*ROOH + 0.15*OH + 0.15*CH2O + 0.15*CH3CO3
    force(i,192) = force(i,192) - rate_constant(i,133) * number_density(i,192) * number_density(i,40)

    ! k_MACRO2_NO3_1: MACRO2 + NO3 -> 1*NO2 + 0.47*HO2 + 0.25*CH2O + 0.25*CH3COCHO + 0.22*CO + 0.53*GLYALD + 0.22*HYAC + 0.53*CH3CO3
    force(i,192) = force(i,192) + 0.47*rate_constant(i,134) * number_density(i,188) * number_density(i,165)

    ! k_CH3O2_NTERPO2_1: CH3O2 + NTERPO2 -> 0.5*TERPNIT + 0.75*CH2O + 0.25*CH3OH + 0.5*HO2 + 0.5*TERPROD1 + 0.5*NO2
    force(i,192) = force(i,192) + 0.5*rate_constant(i,135) * number_density(i,191) * number_density(i,143)

    ! k_MACROOH_OH_1: MACROOH + OH -> 0.5*MCO3 + 0.2*MACRO2 + 0.1*OH + 0.2*HO2
    force(i,192) = force(i,192) + 0.2*rate_constant(i,136) * number_density(i,44) * number_density(i,166)

    ! k_MACR_1: MACR -> 0.66*HO2 + 1.34*CO
    force(i,192) = force(i,192) + 0.66*rate_constant(i,138) * number_density(i,157)

    ! k_HO2_MEKO2_1: HO2 + MEKO2 -> 0.8*MEKOOH + 0.2*OH + 0.2*CH3CHO + 0.2*CH3CO3
    force(i,192) = force(i,192) - rate_constant(i,139) * number_density(i,192) * number_density(i,128)

    ! k_C3H7O2_HO2_1: C3H7O2 + HO2 -> 1*C3H7OOH + 1*O2
    force(i,192) = force(i,192) - rate_constant(i,142) * number_density(i,109) * number_density(i,192)

    ! k_HO2_TERPO2_1: HO2 + TERPO2 -> 1*TERPOOH
    force(i,192) = force(i,192) - rate_constant(i,145) * number_density(i,192) * number_density(i,147)

    ! k_EO2_HO2_1: EO2 + HO2 -> 1*EOOH
    force(i,192) = force(i,192) - rate_constant(i,152) * number_density(i,163) * number_density(i,192)

    ! k_CH3CN_OH_1: CH3CN + OH -> 1*HO2
    force(i,192) = force(i,192) + rate_constant(i,153) * number_density(i,50) * number_density(i,166)

    ! k_CH3O2_MBOO2_1: CH3O2 + MBOO2 -> 0.917*CH2O + 1*HO2 + 0.25*CH3OH + 0.333*GLYALD + 0.333*CH3COCH3 + 0.167*HMPROP
    force(i,192) = force(i,192) + rate_constant(i,155) * number_density(i,191) * number_density(i,125)

    ! k_HMPROPO2_NO_1: HMPROPO2 + NO -> 1*NO2 + 1*CO2 + 1*HO2 + 1*CH3COCH3
    force(i,192) = force(i,192) + rate_constant(i,156) * number_density(i,77) * number_density(i,137)

    ! k_HO2NO2_1: HO2NO2 -> 1*HO2 + 1*NO2
    force(i,192) = force(i,192) + rate_constant(i,159) * number_density(i,35)

    ! k_CH3O2_ISOPNO3_1: CH3O2 + ISOPNO3 -> 0.8*NC4CHO + 1.2*HO2 + 0.8*CH2O + 0.2*CH3OH + 0.2*NC4CH2OH
    force(i,192) = force(i,192) + 1.2*rate_constant(i,160) * number_density(i,191) * number_density(i,46)

    ! k_HO2_MDIALO2_1: HO2 + MDIALO2 -> 0.4*OH + 0.33*HO2 + 0.07*CH3COCHO + 0.14*CO + 0.07*CH3O2 + 0.07*GLYOXAL
    force(i,192) = force(i,192) - 0.6699999999999999*rate_constant(i,161) * number_density(i,192) * number_density(i,164)

    ! k_POOH_1: POOH -> 1*CH3CHO + 1*CH2O + 1*HO2 + 1*OH
    force(i,192) = force(i,192) + rate_constant(i,162) * number_density(i,9)

    ! k_O3_OH_1: O3 + OH -> 1*HO2 + 1*O2
    force(i,192) = force(i,192) + rate_constant(i,164) * number_density(i,171) * number_density(i,166)

    ! k_CH3O2_ISOPBO2_1: CH3O2 + ISOPBO2 -> 0.25*CH3OH + 1*HO2 + 0.75*CH2O + 0.75*HYDRALD
    force(i,192) = force(i,192) + rate_constant(i,167) * number_density(i,191) * number_density(i,190)
  end do
  !$acc end parallel

end subroutine p_force64

subroutine p_force65(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_NC4CHO_1: NC4CHO -> 1*BIGALD3 + 1*NO2 + 1*HO2
    force(i,192) = force(i,192) + rate_constant(i,169) * number_density(i,23)

    ! k_C3H6_O3_1: C3H6 + O3 -> 0.5*CH2O + 0.12*HCOOH + 0.12*CH3COOH + 0.5*CH3CHO + 0.56*CO + 0.28*CH3O2 + 0.1*CH4 + 0.2*CO2 + 0.28*HO2 + 0.36*OH
    force(i,192) = force(i,192) + 0.28*rate_constant(i,170) * number_density(i,120) * number_density(i,171)

    ! k_HONITR_1: HONITR -> 1*NO2 + 0.67*HO2 + 0.33*CH3CHO + 0.33*CH2O + 0.33*CO + 0.33*GLYALD + 0.33*CH3CO3 + 0.17*HYAC + 0.17*CH3COCH3
    force(i,192) = force(i,192) + 0.67*rate_constant(i,171) * number_density(i,134)

    ! k_HO2_HOCH2OO_1: HO2 + HOCH2OO -> 1*HCOOH
    force(i,192) = force(i,192) - rate_constant(i,172) * number_density(i,192) * number_density(i,154)

    ! k_GLYOXAL_OH_1: GLYOXAL + OH -> 1*HO2 + 1*CO + 1*CO2
    force(i,192) = force(i,192) + rate_constant(i,176) * number_density(i,131) * number_density(i,166)

    ! k_ISOPBO2_NO3_1: ISOPBO2 + NO3 -> 1*NO2 + 0.95*HYDRALD + 1*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    force(i,192) = force(i,192) + rate_constant(i,178) * number_density(i,190) * number_density(i,165)

    ! k_C6H5O2_HO2_1: C6H5O2 + HO2 -> 1*C6H5OOH
    force(i,192) = force(i,192) - rate_constant(i,179) * number_density(i,81) * number_density(i,192)

    ! k_NC4CHO_OH_1: NC4CHO + OH -> 1*GLYOXAL + 1*NOA + 1*HO2
    force(i,192) = force(i,192) + rate_constant(i,182) * number_density(i,23) * number_density(i,166)

    ! k_BZOO_NO_1: BZOO + NO -> 1*BZALD + 1*NO2 + 1*HO2
    force(i,192) = force(i,192) + rate_constant(i,195) * number_density(i,33) * number_density(i,137)

    ! k_ENEO2_NO_1: ENEO2 + NO -> 1*CH3CHO + 0.5*CH2O + 0.5*CH3COCH3 + 1*HO2 + 1*NO2
    force(i,192) = force(i,192) + rate_constant(i,201) * number_density(i,133) * number_density(i,137)

    ! k_BRO_OH_1: BRO + OH -> 1*BR + 1*HO2
    force(i,192) = force(i,192) + rate_constant(i,204) * number_density(i,71) * number_density(i,166)

    ! k_HO2_XO2_1: HO2 + XO2 -> 1*XOOH
    force(i,192) = force(i,192) - rate_constant(i,205) * number_density(i,192) * number_density(i,153)

    ! k_CO_OH_1: CO + OH -> 1*CO2 + 1*HO2
    force(i,192) = force(i,192) + rate_constant(i,208) * number_density(i,176) * number_density(i,166)

    ! k_HO2_HO2_1: HO2 + HO2 -> 1*H2O2 + 1*O2
    force(i,192) = force(i,192) - rate_constant(i,209) * number_density(i,192) * number_density(i,192)

    ! k_HO2_HO2_1: HO2 + HO2 -> 1*H2O2 + 1*O2
    force(i,192) = force(i,192) - rate_constant(i,209) * number_density(i,192) * number_density(i,192)

    ! k_HO2_HO2_M_1: HO2 + HO2 + M -> 1*H2O2 + 1*O2 + 1*M
    force(i,192) = force(i,192) - rate_constant(i,210) * number_density(i,192) * number_density(i,192) * number_density(i,1)

    ! k_HO2_HO2_M_1: HO2 + HO2 + M -> 1*H2O2 + 1*O2 + 1*M
    force(i,192) = force(i,192) - rate_constant(i,210) * number_density(i,192) * number_density(i,192) * number_density(i,1)

    ! k_H2O_HO2_HO2_1: H2O + HO2 + HO2 -> 1*H2O2 + 1*O2 + 1*H2O
    force(i,192) = force(i,192) - rate_constant(i,211) * number_density(i,68) * number_density(i,192) * number_density(i,192)

    ! k_H2O_HO2_HO2_1: H2O + HO2 + HO2 -> 1*H2O2 + 1*O2 + 1*H2O
    force(i,192) = force(i,192) - rate_constant(i,211) * number_density(i,68) * number_density(i,192) * number_density(i,192)

    ! k_H2O_HO2_HO2_M_1: H2O + HO2 + HO2 + M -> 1*H2O2 + 1*O2 + 1*M + 1*H2O
    force(i,192) = force(i,192) - rate_constant(i,212) * number_density(i,68) * number_density(i,192) * number_density(i,192) * number_density(i,1)

    ! k_H2O_HO2_HO2_M_1: H2O + HO2 + HO2 + M -> 1*H2O2 + 1*O2 + 1*M + 1*H2O
    force(i,192) = force(i,192) - rate_constant(i,212) * number_density(i,68) * number_density(i,192) * number_density(i,192) * number_density(i,1)

    ! k_HYAC_1: HYAC -> 1*CH3CO3 + 1*HO2 + 1*CH2O
    force(i,192) = force(i,192) + rate_constant(i,215) * number_density(i,57)

    ! k_HO2_O_1: HO2 + O -> 1*OH + 1*O2
    force(i,192) = force(i,192) - rate_constant(i,217) * number_density(i,192) * number_density(i,187)

    ! k_TERPOOH_1: TERPOOH -> 0.4*CH2O + 0.05*CH3COCH3 + 1*TERPROD1 + 1*HO2 + 1*OH
    force(i,192) = force(i,192) + rate_constant(i,218) * number_density(i,113)

    ! k_H_HO2_1: H + HO2 -> 1*H2 + 1*O2
    force(i,192) = force(i,192) - rate_constant(i,224) * number_density(i,48) * number_density(i,192)

    ! k_DMS_OH_1: DMS + OH -> 0.5*SO2 + 0.5*HO2
    force(i,192) = force(i,192) + 0.5*rate_constant(i,227) * number_density(i,99) * number_density(i,166)

    ! k_MBO_O3_1: MBO + O3 -> 0.7*HMPROP + 0.64*CO + 0.36*OH + 0.48*HO2 + 0.17*HCOOH + 0.3*CH2O + 0.23*CH3COCH3
    force(i,192) = force(i,192) + 0.48*rate_constant(i,228) * number_density(i,127) * number_density(i,171)

    ! k_BCARY_O3_1: BCARY + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    force(i,192) = force(i,192) + 0.57*rate_constant(i,229) * number_density(i,102) * number_density(i,171)

    ! k_ISOPOOH_1: ISOPOOH -> 0.402*MVK + 0.288*MACR + 0.69*CH2O + 1*HO2
    force(i,192) = force(i,192) + rate_constant(i,233) * number_density(i,138)

    ! k_HCN_OH_1: HCN + OH -> 1*HO2
    force(i,192) = force(i,192) + rate_constant(i,234) * number_density(i,47) * number_density(i,166)

    ! k_CH3CO3_MACRO2_1: CH3CO3 + MACRO2 -> 0.25*CH3COCHO + 1*CH3O2 + 0.22*CO + 0.47*HO2 + 0.53*GLYALD + 0.22*HYAC + 0.25*CH2O + 0.53*CH3CO3
    force(i,192) = force(i,192) + 0.47*rate_constant(i,235) * number_density(i,49) * number_density(i,188)

    ! k_H_O2_1: H + O2 -> 1*HO2
    force(i,192) = force(i,192) + rate_constant(i,240) * number_density(i,48) * number_density(i,41)

    ! k_CH3CHO_1: CH3CHO -> 1*CH3O2 + 1*CO + 1*HO2
    force(i,192) = force(i,192) + rate_constant(i,245) * number_density(i,178)

    ! k_HO2_MBOO2_1: HO2 + MBOO2 -> 1*MBOOOH
    force(i,192) = force(i,192) - rate_constant(i,247) * number_density(i,192) * number_density(i,125)
  end do
  !$acc end parallel

end subroutine p_force65

subroutine p_force66(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_C2H5O2_C2H5O2_1: C2H5O2 + C2H5O2 -> 1.6*CH3CHO + 1.2*HO2 + 0.4*C2H5OH
    force(i,192) = force(i,192) + 1.2*rate_constant(i,248) * number_density(i,87) * number_density(i,87)

    ! k_NO_XO2_1: NO + XO2 -> 1*NO2 + 1*HO2 + 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD
    force(i,192) = force(i,192) + rate_constant(i,252) * number_density(i,137) * number_density(i,153)

    ! k_BIGALD1_1: BIGALD1 -> 0.6*MALO2 + 1*HO2
    force(i,192) = force(i,192) + rate_constant(i,255) * number_density(i,75)

    ! k_NO_PHENO2_1: NO + PHENO2 -> 1*HO2 + 0.7*GLYOXAL + 1*NO2
    force(i,192) = force(i,192) + rate_constant(i,257) * number_density(i,137) * number_density(i,38)

    ! k_CH3CO3_HO2_1: CH3CO3 + HO2 -> 0.4*CH3COOOH + 0.15*CH3COOH + 0.15*O3 + 0.45*OH + 0.45*CH3O2
    force(i,192) = force(i,192) - rate_constant(i,259) * number_density(i,49) * number_density(i,192)

    ! k_C2H5OOH_1: C2H5OOH -> 1*CH3CHO + 1*HO2 + 1*OH
    force(i,192) = force(i,192) + rate_constant(i,261) * number_density(i,175)

    ! k_CL_HO2_1: CL + HO2 -> 1*HCL + 1*O2
    force(i,192) = force(i,192) - rate_constant(i,264) * number_density(i,100) * number_density(i,192)

    ! k_HO2_PO2_1: HO2 + PO2 -> 1*POOH + 1*O2
    force(i,192) = force(i,192) - rate_constant(i,265) * number_density(i,192) * number_density(i,151)

    ! k_OH_PHENOL_1: OH + PHENOL -> 0.14*PHENO2 + 0.8*HO2 + 0.06*PHENO
    force(i,192) = force(i,192) + 0.8*rate_constant(i,266) * number_density(i,166) * number_density(i,21)

    ! k_HO2_PHENO2_1: HO2 + PHENO2 -> 1*PHENOOH
    force(i,192) = force(i,192) - rate_constant(i,267) * number_density(i,192) * number_density(i,38)

    ! k_HO2_MCO3_1: HO2 + MCO3 -> 0.15*O3 + 0.15*CH3COOH + 0.4*CH3COOOH + 0.45*OH + 0.45*CO2 + 0.45*CH2O + 0.45*CH3CO3
    force(i,192) = force(i,192) - rate_constant(i,269) * number_density(i,192) * number_density(i,167)

    ! k_C2H5O2_NO_1: C2H5O2 + NO -> 1*CH3CHO + 1*HO2 + 1*NO2
    force(i,192) = force(i,192) + rate_constant(i,270) * number_density(i,87) * number_density(i,137)

    ! k_ISOPNOOH_OH_1: ISOPNOOH + OH -> 1*NOA + 1*HO2
    force(i,192) = force(i,192) + rate_constant(i,271) * number_density(i,160) * number_density(i,166)

    ! k_MACR_2: MACR -> 1.34*HO2 + 0.66*MCO3 + 1.34*CH2O + 1.34*CH3CO3
    force(i,192) = force(i,192) + 1.34*rate_constant(i,272) * number_density(i,157)

    ! k_BENZOOH_1: BENZOOH -> 1*OH + 1*GLYOXAL + 0.5*BIGALD1 + 1*HO2
    force(i,192) = force(i,192) + rate_constant(i,275) * number_density(i,91)

    ! k_C2H5O2_CH3O2_1: C2H5O2 + CH3O2 -> 0.7*CH2O + 0.8*CH3CHO + 1*HO2 + 0.3*CH3OH + 0.2*C2H5OH
    force(i,192) = force(i,192) + rate_constant(i,277) * number_density(i,87) * number_density(i,191)

    ! k_HO2_ISOPBO2_1: HO2 + ISOPBO2 -> 1*ISOPOOH
    force(i,192) = force(i,192) - rate_constant(i,279) * number_density(i,192) * number_density(i,190)

    ! k_H_HO2_2: H + HO2 -> 1*H2O + 1*O
    force(i,192) = force(i,192) - rate_constant(i,282) * number_density(i,48) * number_density(i,192)

    ! k_CH4_O1D_2: CH4 + O1D -> 1*CH2O + 1*H + 1*HO2
    force(i,192) = force(i,192) + rate_constant(i,283) * number_density(i,45) * number_density(i,112)

    ! k_TERPROD1_1: TERPROD1 -> 1*HO2 + 1*CO + 1*TERPROD2
    force(i,192) = force(i,192) + rate_constant(i,286) * number_density(i,58)

    ! k_HMPROPO2_HO2_1: HMPROPO2 + HO2 -> 0.4*OH + 0.4*HO2 + 0.4*CH3COCH3 + 0.4*CO2
    force(i,192) = force(i,192) - 0.6*rate_constant(i,289) * number_density(i,77) * number_density(i,192)

    ! k_HO2_OH_1: HO2 + OH -> 1*H2O + 1*O2
    force(i,192) = force(i,192) - rate_constant(i,291) * number_density(i,192) * number_density(i,166)

    ! k_NC4CH2OH_OH_1: NC4CH2OH + OH -> 1*GLYALD + 1*NOA + 1*HO2
    force(i,192) = force(i,192) + rate_constant(i,295) * number_density(i,158) * number_density(i,166)

    ! k_HCOOH_OH_1: HCOOH + OH -> 1*HO2 + 1*CO2 + 1*H2O
    force(i,192) = force(i,192) + rate_constant(i,296) * number_density(i,119) * number_density(i,166)

    ! k_ISOPNOOH_1: ISOPNOOH -> 1*NO2 + 1*HO2 + 1*ISOPOOH
    force(i,192) = force(i,192) + rate_constant(i,297) * number_density(i,160)

    ! k_BR_CH2O_1: BR + CH2O -> 1*HBR + 1*HO2 + 1*CO
    force(i,192) = force(i,192) + rate_constant(i,298) * number_density(i,90) * number_density(i,124)

    ! k_BRO_HO2_1: BRO + HO2 -> 1*HOBR + 1*O2
    force(i,192) = force(i,192) - rate_constant(i,299) * number_density(i,71) * number_density(i,192)

    ! k_ALKOOH_1: ALKOOH -> 0.4*CH3CHO + 0.1*CH2O + 0.25*CH3COCH3 + 0.9*HO2 + 0.8*MEK + 1*OH
    force(i,192) = force(i,192) + 0.9*rate_constant(i,300) * number_density(i,65)

    ! k_CH3O2_HO2_1: CH3O2 + HO2 -> 1*CH3OOH + 1*O2
    force(i,192) = force(i,192) - rate_constant(i,301) * number_density(i,191) * number_density(i,192)

    ! k_ISOPNO3_NO_1: ISOPNO3 + NO -> 1*NC4CHO + 1*NO2 + 1*HO2
    force(i,192) = force(i,192) + rate_constant(i,302) * number_density(i,46) * number_density(i,137)

    ! k_CLO_OH_2: CLO + OH -> 1*CL + 1*HO2
    force(i,192) = force(i,192) + rate_constant(i,305) * number_density(i,86) * number_density(i,166)

    ! k_MTERP_O3_2: MTERP + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    force(i,192) = force(i,192) + 0.57*rate_constant(i,307) * number_density(i,31) * number_density(i,171)

    ! k_MBOO2_NO_1: MBOO2 + NO -> 1*HO2 + 0.67*GLYALD + 0.67*CH3COCH3 + 0.33*HMPROP + 0.33*CH2O + 1*NO2
    force(i,192) = force(i,192) + rate_constant(i,308) * number_density(i,125) * number_density(i,137)

    ! k_CL_H2O2_1: CL + H2O2 -> 1*HCL + 1*HO2
    force(i,192) = force(i,192) + rate_constant(i,310) * number_density(i,100) * number_density(i,179)
  end do
  !$acc end parallel

end subroutine p_force66

subroutine p_force67(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_MBONO3O2_NO_1: MBONO3O2 + NO -> 0.25*HMPROP + 0.25*CH2O + 1.25*NO2 + 0.75*HONITR + 0.75*CH3COCH3 + 0.75*HO2
    force(i,192) = force(i,192) + 0.75*rate_constant(i,313) * number_density(i,123) * number_density(i,137)

    ! k_BENZENE_OH_1: BENZENE + OH -> 0.53*PHENOL + 0.12*BEPOMUC + 0.65*HO2 + 0.35*BENZO2
    force(i,192) = force(i,192) + 0.65*rate_constant(i,318) * number_density(i,101) * number_density(i,166)

    ! k_CH3O2_MACRO2_1: CH3O2 + MACRO2 -> 0.73*HO2 + 0.88*CH2O + 0.11*CO + 0.24*CH3COCHO + 0.26*GLYALD + 0.26*CH3CO3 + 0.25*CH3OH + 0.23*HYAC
    force(i,192) = force(i,192) + 0.73*rate_constant(i,322) * number_density(i,191) * number_density(i,188)

    ! k_C2H4_O3_1: C2H4 + O3 -> 0.63*CO + 0.13*OH + 0.13*HO2 + 0.37*HCOOH + 1*CH2O
    force(i,192) = force(i,192) + 0.13*rate_constant(i,323) * number_density(i,93) * number_density(i,171)

    ! k_HO2_ISOPAO2_1: HO2 + ISOPAO2 -> 1*ISOPOOH
    force(i,192) = force(i,192) - rate_constant(i,324) * number_density(i,192) * number_density(i,189)

    ! k_TOLOOH_1: TOLOOH -> 1*OH + 0.6*GLYOXAL + 0.4*CH3COCHO + 1*HO2 + 0.2*BIGALD1 + 0.2*BIGALD2 + 0.2*BIGALD3
    force(i,192) = force(i,192) + rate_constant(i,326) * number_density(i,95)

    ! k_CH3O2_NO_1: CH3O2 + NO -> 1*CH2O + 1*NO2 + 1*HO2
    force(i,192) = force(i,192) + rate_constant(i,329) * number_density(i,191) * number_density(i,137)

    ! k_ISOPAO2_NO3_1: ISOPAO2 + NO3 -> 1*NO2 + 0.4*MACR + 0.6*MVK + 1*CH2O + 1*HO2
    force(i,192) = force(i,192) + rate_constant(i,330) * number_density(i,189) * number_density(i,165)

    ! k_BZOO_HO2_1: BZOO + HO2 -> 1*BZOOH
    force(i,192) = force(i,192) - rate_constant(i,331) * number_density(i,33) * number_density(i,192)

    ! k_HO2_XYLENO2_1: HO2 + XYLENO2 -> 1*XYLENOOH
    force(i,192) = force(i,192) - rate_constant(i,333) * number_density(i,192) * number_density(i,146)

    ! k_HO2_ISOPNO3_1: HO2 + ISOPNO3 -> 1*ISOPNOOH
    force(i,192) = force(i,192) - rate_constant(i,335) * number_density(i,192) * number_density(i,46)

    ! k_DICARBO2_NO_1: DICARBO2 + NO -> 1*NO2 + 0.17*HO2 + 0.17*CH3COCHO + 0.17*CO + 0.83*CH3O2
    force(i,192) = force(i,192) + 0.17*rate_constant(i,337) * number_density(i,181) * number_density(i,137)

    ! k_GLYALD_1: GLYALD -> 2*HO2 + 1*CO + 1*CH2O
    force(i,192) = force(i,192) + 2*rate_constant(i,338) * number_density(i,156)

    ! k_CH3CO3_ISOPBO2_1: CH3CO3 + ISOPBO2 -> 1*HYDRALD + 1*CH3O2 + 1*HO2
    force(i,192) = force(i,192) + rate_constant(i,340) * number_density(i,49) * number_density(i,190)

    ! k_HO2_TERP2O2_1: HO2 + TERP2O2 -> 1*TERP2OOH
    force(i,192) = force(i,192) - rate_constant(i,341) * number_density(i,192) * number_density(i,145)

    ! k_C2H5O2_HO2_1: C2H5O2 + HO2 -> 1*C2H5OOH + 1*O2
    force(i,192) = force(i,192) - rate_constant(i,343) * number_density(i,87) * number_density(i,192)

    ! k_CH3O2_RO2_1: CH3O2 + RO2 -> 0.3*CH3CO3 + 0.8*CH2O + 0.3*HO2 + 0.2*HYAC + 0.5*CH3COCHO + 0.5*CH3OH
    force(i,192) = force(i,192) + 0.3*rate_constant(i,354) * number_density(i,191) * number_density(i,40)

    ! k_HO2_XYLOLO2_1: HO2 + XYLOLO2 -> 1*XYLOLOOH
    force(i,192) = force(i,192) - rate_constant(i,357) * number_density(i,192) * number_density(i,148)

    ! k_HO2NO2_2: HO2NO2 -> 1*NO2 + 1*HO2
    force(i,192) = force(i,192) + rate_constant(i,359) * number_density(i,35)

    ! k_ISOPNITA_OH_1: ISOPNITA + OH -> 0.7*HYAC + 0.7*GLYALD + 0.7*NO2 + 0.3*CH2O + 0.3*HONITR + 0.3*HO2
    force(i,192) = force(i,192) + 0.3*rate_constant(i,364) * number_density(i,118) * number_density(i,166)

    ! k_NO_PO2_1: NO + PO2 -> 1*CH3CHO + 1*CH2O + 1*HO2 + 1*NO2
    force(i,192) = force(i,192) + rate_constant(i,365) * number_density(i,137) * number_density(i,151)

    ! k_HO2_O3_1: HO2 + O3 -> 1*OH + 2*O2
    force(i,192) = force(i,192) - rate_constant(i,368) * number_density(i,192) * number_density(i,171)

    ! k_DICARBO2_HO2_1: DICARBO2 + HO2 -> 0.4*OH + 0.07*HO2 + 0.07*CH3COCHO + 0.07*CO + 0.33*CH3O2
    force(i,192) = force(i,192) - 0.9299999999999999*rate_constant(i,370) * number_density(i,181) * number_density(i,192)

    ! k_EO_1: EO -> 2*CH2O + 1*HO2
    force(i,192) = force(i,192) + rate_constant(i,372) * number_density(i,162)

    ! k_BIGALD2_1: BIGALD2 -> 0.6*HO2 + 0.6*DICARBO2
    force(i,192) = force(i,192) + 0.6*rate_constant(i,375) * number_density(i,116)

    ! k_ISOP_O3_2: ISOP + O3 -> 0.3*MACR + 0.2*MVK + 0.11*HCOOH + 0.62*CO + 0.32*OH + 0.37*HO2 + 0.91*CH2O + 0.08*CH3CO3 + 0.13*C3H6 + 0.05*CH3O2
    force(i,192) = force(i,192) + 0.37*rate_constant(i,377) * number_density(i,142) * number_density(i,171)

    ! k_ISOPBO2_1: ISOPBO2 -> 1*HPALD + 1*HO2
    force(i,192) = force(i,192) + rate_constant(i,390) * number_density(i,190)

    ! k_BENZO2_HO2_1: BENZO2 + HO2 -> 1*BENZOOH
    force(i,192) = force(i,192) - rate_constant(i,391) * number_density(i,13) * number_density(i,192)

    ! k_NO_TERPO2_1: NO + TERPO2 -> 0.2*TERPNIT + 0.8*NO2 + 0.32*CH2O + 0.04*CH3COCH3 + 0.8*TERPROD1 + 0.8*HO2
    force(i,192) = force(i,192) + 0.8*rate_constant(i,392) * number_density(i,137) * number_density(i,147)

    ! k_CH3BR_CL_1: CH3BR + CL -> 1*HCL + 1*HO2 + 1*BR
    force(i,192) = force(i,192) + rate_constant(i,396) * number_density(i,94) * number_density(i,100)

    ! k_OH_TERPROD2_1: OH + TERPROD2 -> 0.15*RO2 + 0.68*CH2O + 1.8*CO2 + 0.5*CH3COCH3 + 0.65*CH3CO3 + 0.2*HO2 + 0.7*CO
    force(i,192) = force(i,192) + 0.2*rate_constant(i,397) * number_density(i,166) * number_density(i,155)

    ! k_CLO_HO2_1: CLO + HO2 -> 1*O2 + 1*HOCL
    force(i,192) = force(i,192) - rate_constant(i,402) * number_density(i,86) * number_density(i,192)

    ! k_MDIALO2_NO_1: MDIALO2 + NO -> 1*NO2 + 0.83*HO2 + 0.17*CH3COCHO + 0.35*CO + 0.17*CH3O2 + 0.17*GLYOXAL
    force(i,192) = force(i,192) + 0.83*rate_constant(i,403) * number_density(i,164) * number_density(i,137)

    ! k_NO_XYLOLO2_1: NO + XYLOLO2 -> 1*HO2 + 1*NO2 + 0.17*GLYOXAL + 0.51*CH3COCHO
    force(i,192) = force(i,192) + rate_constant(i,404) * number_density(i,137) * number_density(i,148)
  end do
  !$acc end parallel

end subroutine p_force67

subroutine p_force68(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in) :: number_density(ncell,number_of_species)
  real(r8), intent(in) :: number_density_air(ncell)
  real(r8), intent(out) :: force(ncell,number_of_species)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN) async(STREAM0)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_CH3OH_OH_1: CH3OH + OH -> 1*HO2 + 1*CH2O
    force(i,192) = force(i,192) + rate_constant(i,409) * number_density(i,122) * number_density(i,166)

    ! k_CH3O2_XO2_1: CH3O2 + XO2 -> 0.3*CH3OH + 0.8*HO2 + 0.8*CH2O + 0.2*CO + 0.1*GLYOXAL + 0.1*CH3COCHO + 0.1*HYAC + 0.1*GLYALD
    force(i,192) = force(i,192) + 0.8*rate_constant(i,410) * number_density(i,191) * number_density(i,153)

    ! k_CH3CO3_ISOPNO3_1: CH3CO3 + ISOPNO3 -> 1*NC4CHO + 1*CH3O2 + 1*HO2
    force(i,192) = force(i,192) + rate_constant(i,413) * number_density(i,49) * number_density(i,46)

    ! k_CH3O2_TERP2O2_1: CH3O2 + TERP2O2 -> 1*TERPROD2 + 0.93*CH2O + 0.25*CH3OH + 1*HO2 + 0.5*CO2 + 0.125*CO + 0.125*GLYALD + 0.15*CH3COCH3
    force(i,192) = force(i,192) + rate_constant(i,414) * number_density(i,191) * number_density(i,145)

    ! k_GLYOXAL_1: GLYOXAL -> 2*CO + 2*HO2
    force(i,192) = force(i,192) + 2*rate_constant(i,416) * number_density(i,131)

    ! k_NO_XYLENO2_1: NO + XYLENO2 -> 1*NO2 + 1*HO2 + 0.34*GLYOXAL + 0.54*CH3COCHO + 0.06*BIGALD1 + 0.2*BIGALD2 + 0.15*BIGALD3 + 0.21*BIGALD4
    force(i,192) = force(i,192) + rate_constant(i,419) * number_density(i,137) * number_density(i,146)

    ! k_MVK_O3_1: MVK + O3 -> 0.6*CH2O + 0.56*CO + 0.1*CH3CHO + 0.1*CO2 + 0.28*CH3CO3 + 0.5*CH3COCHO + 0.28*HO2 + 0.36*OH + 0.12*HCOOH
    force(i,192) = force(i,192) + 0.28*rate_constant(i,420) * number_density(i,25) * number_density(i,171)

    ! k_HYAC_OH_1: HYAC + OH -> 1*CH3COCHO + 1*HO2
    force(i,192) = force(i,192) + rate_constant(i,422) * number_density(i,57) * number_density(i,166)

    ! k_CH2O_NO3_1: CH2O + NO3 -> 1*CO + 1*HO2 + 1*HNO3
    force(i,192) = force(i,192) + rate_constant(i,423) * number_density(i,124) * number_density(i,165)

    ! k_MALO2_NO_1: MALO2 + NO -> 0.4*GLYOXAL + 0.4*HO2 + 0.4*CO + 1*NO2
    force(i,192) = force(i,192) + 0.4*rate_constant(i,424) * number_density(i,170) * number_density(i,137)

    ! k_CH2O_CL_1: CH2O + CL -> 1*HCL + 1*HO2 + 1*CO
    force(i,192) = force(i,192) + rate_constant(i,425) * number_density(i,124) * number_density(i,100)

    ! k_ALKO2_HO2_1: ALKO2 + HO2 -> 1*ALKOOH
    force(i,192) = force(i,192) - rate_constant(i,426) * number_density(i,85) * number_density(i,192)

    ! k_HPALD_1: HPALD -> 1*BIGALD3 + 1*OH + 1*HO2
    force(i,192) = force(i,192) + rate_constant(i,430) * number_density(i,67)

    ! k_HOCH2OO_1: HOCH2OO -> 1*CH2O + 1*HO2
    force(i,192) = force(i,192) + rate_constant(i,431) * number_density(i,154)

    ! k_CH3O2_CH3O2_1: CH3O2 + CH3O2 -> 2*CH2O + 2*HO2
    force(i,192) = force(i,192) + 2*rate_constant(i,433) * number_density(i,191) * number_density(i,191)

    ! k_CH3O2_ISOPAO2_1: CH3O2 + ISOPAO2 -> 0.25*CH3OH + 1*HO2 + 1.5*CH2O + 0.31*MACR + 0.44*MVK
    force(i,192) = force(i,192) + rate_constant(i,434) * number_density(i,191) * number_density(i,189)

    ! k_OH_TOLUENE_2: OH + TOLUENE -> 0.18*CRESOL + 0.1*TEPOMUC + 0.07*BZOO + 0.65*TOLO2 + 0.28*HO2
    force(i,192) = force(i,192) + 0.28*rate_constant(i,435) * number_density(i,166) * number_density(i,117)

    ! k_BZOOH_1: BZOOH -> 1*BZALD + 1*OH + 1*HO2
    force(i,192) = force(i,192) + rate_constant(i,437) * number_density(i,8)

    ! k_H2O2_O_1: H2O2 + O -> 1*OH + 1*HO2
    force(i,192) = force(i,192) + rate_constant(i,440) * number_density(i,179) * number_density(i,187)

    ! k_EO_O2_1: EO + O2 -> 1*GLYALD + 1*HO2
    force(i,192) = force(i,192) + rate_constant(i,442) * number_density(i,162) * number_density(i,41)

    ! k_CH2O_HO2_1: CH2O + HO2 -> 1*HOCH2OO
    force(i,192) = force(i,192) - rate_constant(i,449) * number_density(i,124) * number_density(i,192)

    ! k_ISOPNO3_NO3_1: ISOPNO3 + NO3 -> 1*NC4CHO + 1*NO2 + 1*HO2
    force(i,192) = force(i,192) + rate_constant(i,451) * number_density(i,46) * number_density(i,165)

    ! k_ALKNIT_1: ALKNIT -> 1*NO2 + 0.4*CH3CHO + 0.1*CH2O + 0.25*CH3COCH3 + 1*HO2 + 0.8*MEK
    force(i,192) = force(i,192) + rate_constant(i,452) * number_density(i,5)

    ! k_HO2_NO3_1: HO2 + NO3 -> 1*OH + 1*NO2 + 1*O2
    force(i,192) = force(i,192) - rate_constant(i,454) * number_density(i,192) * number_density(i,165)

    ! k_H2O2_OH_1: H2O2 + OH -> 1*H2O + 1*HO2
    force(i,192) = force(i,192) + rate_constant(i,456) * number_density(i,179) * number_density(i,166)

    ! k_H_HO2_3: H + HO2 -> 2*OH
    force(i,192) = force(i,192) - rate_constant(i,457) * number_density(i,48) * number_density(i,192)

    ! k_ISOPAO2_NO_1: ISOPAO2 + NO -> 0.08*ISOPNITA + 0.92*NO2 + 0.36*MACR + 0.56*MVK + 0.92*CH2O + 0.92*HO2
    force(i,192) = force(i,192) + 0.92*rate_constant(i,464) * number_density(i,189) * number_density(i,137)

    ! k_CH3O2_CLO_1: CH3O2 + CLO -> 1*CL + 1*HO2 + 1*CH2O
    force(i,192) = force(i,192) + rate_constant(i,467) * number_density(i,191) * number_density(i,86)

    ! k_BIGALD_1: BIGALD -> 0.45*CO + 0.13*GLYOXAL + 0.56*HO2 + 0.13*CH3CO3 + 0.18*CH3COCHO
    force(i,192) = force(i,192) + 0.56*rate_constant(i,469) * number_density(i,105)

    ! k_CL_HO2_2: CL + HO2 -> 1*OH + 1*CLO
    force(i,192) = force(i,192) - rate_constant(i,470) * number_density(i,100) * number_density(i,192)

    ! k_C3H7O2_NO_1: C3H7O2 + NO -> 0.82*CH3COCH3 + 1*NO2 + 1*HO2 + 0.27*CH3CHO
    force(i,192) = force(i,192) + rate_constant(i,471) * number_density(i,109) * number_density(i,137)

    ! k_C2H5OH_OH_1: C2H5OH + OH -> 1*HO2 + 1*CH3CHO
    force(i,192) = force(i,192) + rate_constant(i,477) * number_density(i,126) * number_density(i,166)

    ! k_HO2_TOLO2_1: HO2 + TOLO2 -> 1*TOLOOH
    force(i,192) = force(i,192) - rate_constant(i,479) * number_density(i,192) * number_density(i,144)

    ! k_HO2_NO_1: HO2 + NO -> 1*NO2 + 1*OH
    force(i,192) = force(i,192) - rate_constant(i,483) * number_density(i,192) * number_density(i,137)
  end do
  !$acc end parallel

end subroutine p_force68

