subroutine calc_reaction_rates1(rate_constant, number_density, number_density_air, reaction_rates)
  ! Compute reaction rates

  real(r8), intent(in)  :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in)  :: number_density(ncell,number_of_species)
  real(r8), intent(in)  :: number_density_air(ncell)
  real(r8), intent(out) :: reaction_rates(ncell,number_of_reactions)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_HO2_MALO2_1: HO2 + MALO2 -> 0.16*GLYOXAL + 0.16*HO2 + 0.16*CO
    reaction_rates(i,1) = rate_constant(i,1) * number_density(i,192) * number_density(i,170)

    ! k_C2H2_OH_1: C2H2 + OH -> 0.65*GLYOXAL + 0.65*OH + 0.35*HCOOH + 0.35*HO2 + 0.35*CO
    reaction_rates(i,2) = rate_constant(i,2) * number_density(i,168) * number_density(i,166)

    ! k_CH3O2_TERPO2_1: CH3O2 + TERPO2 -> 1*TERPROD1 + 0.95*CH2O + 0.25*CH3OH + 1*HO2 + 0.025*CH3COCH3
    reaction_rates(i,3) = rate_constant(i,3) * number_density(i,191) * number_density(i,147)

    ! k_C3H7OOH_OH_1: C3H7OOH + OH -> 1*H2O + 1*C3H7O2
    reaction_rates(i,4) = rate_constant(i,4) * number_density(i,20) * number_density(i,166)

    ! k_TERPNIT_1: TERPNIT -> 1*TERPROD1 + 1*NO2 + 1*HO2
    reaction_rates(i,5) = rate_constant(i,5) * number_density(i,39)

    ! k_N2_O1D_1: N2 + O1D -> 1*O + 1*N2
    reaction_rates(i,6) = rate_constant(i,6) * number_density(i,11) * number_density(i,112)

    ! k_OH_XYLENES_1: OH + XYLENES -> 0.15*XYLOL + 0.23*TEPOMUC + 0.06*BZOO + 0.56*XYLENO2 + 0.38*HO2
    reaction_rates(i,7) = rate_constant(i,7) * number_density(i,166) * number_density(i,140)

    ! k_N_NO2_1: N + NO2 -> 1*N2 + 1*O2
    reaction_rates(i,8) = rate_constant(i,8) * number_density(i,185) * number_density(i,54)

    ! k_NO3_OH_1: NO3 + OH -> 1*HO2 + 1*NO2
    reaction_rates(i,9) = rate_constant(i,9) * number_density(i,165) * number_density(i,166)

    ! k_CH2O_O_1: CH2O + O -> 1*HO2 + 1*OH + 1*CO
    reaction_rates(i,10) = rate_constant(i,10) * number_density(i,124) * number_density(i,187)

    ! k_MBO_NO3_1: MBO + NO3 -> 1*MBONO3O2
    reaction_rates(i,11) = rate_constant(i,11) * number_density(i,127) * number_density(i,165)

    ! k_O2_1: O2 -> 2*O
    reaction_rates(i,12) = rate_constant(i,12) * number_density(i,41)

    ! k_CFC113_O1D_1: CFC113 + O1D -> 3*CL
    reaction_rates(i,13) = rate_constant(i,13) * number_density(i,52) * number_density(i,112)

    ! k_HCFC142B_OH_1: HCFC142B + OH -> 1*CL + 1*COF2
    reaction_rates(i,14) = rate_constant(i,14) * number_density(i,172) * number_density(i,166)

    ! k_MVK_1: MVK -> 0.7*C3H6 + 0.7*CO + 0.3*CH3O2 + 0.3*CH3CO3
    reaction_rates(i,15) = rate_constant(i,15) * number_density(i,25)

    ! k_EO2_NO_1: EO2 + NO -> 0.5*CH2O + 0.25*HO2 + 0.75*EO + 1*NO2
    reaction_rates(i,16) = rate_constant(i,16) * number_density(i,163) * number_density(i,137)

    ! k_CH3COCHO_1: CH3COCHO -> 1*CH3CO3 + 1*CO + 1*HO2
    reaction_rates(i,17) = rate_constant(i,17) * number_density(i,111)

    ! k_CFC114_O1D_1: CFC114 + O1D -> 2*CL + 2*COF2
    reaction_rates(i,18) = rate_constant(i,18) * number_density(i,62) * number_density(i,112)

    ! k_HBR_O1D_1: HBR + O1D -> 1*BRO + 1*H
    reaction_rates(i,19) = rate_constant(i,19) * number_density(i,80) * number_density(i,112)

    ! k_XYLENOOH_1: XYLENOOH -> 1*OH + 1*HO2 + 0.34*GLYOXAL + 0.54*CH3COCHO + 0.06*BIGALD1 + 0.2*BIGALD2 + 0.15*BIGALD3 + 0.21*BIGALD4
    reaction_rates(i,20) = rate_constant(i,20) * number_density(i,92)

    ! k_CLO_O_1: CLO + O -> 1*CL + 1*O2
    reaction_rates(i,21) = rate_constant(i,21) * number_density(i,86) * number_density(i,187)

    ! k_OH_SO2_1: OH + SO2 -> 1*SO3 + 1*HO2
    reaction_rates(i,22) = rate_constant(i,22) * number_density(i,166) * number_density(i,55)

    ! k_CH4_CL_1: CH4 + CL -> 1*CH3O2 + 1*HCL
    reaction_rates(i,23) = rate_constant(i,23) * number_density(i,45) * number_density(i,100)

    ! k_SO3_1: SO3 -> 1*SO2 + 1*O
    reaction_rates(i,24) = rate_constant(i,24) * number_density(i,28)

    ! k_CH3CO3_NO_1: CH3CO3 + NO -> 1*CH3O2 + 1*CO2 + 1*NO2
    reaction_rates(i,25) = rate_constant(i,25) * number_density(i,49) * number_density(i,137)

    ! k_HONITR_OH_1: HONITR + OH -> 1*ONITR + 1*HO2
    reaction_rates(i,26) = rate_constant(i,26) * number_density(i,134) * number_density(i,166)

    ! k_CH2BR2_CL_1: CH2BR2 + CL -> 2*BR + 1*HCL
    reaction_rates(i,27) = rate_constant(i,27) * number_density(i,169) * number_density(i,100)

    ! k_MPAN_OH_1: MPAN + OH -> 0.5*HYAC + 0.5*NO3 + 0.5*CH2O + 0.5*HO2 + 0.5*CO2
    reaction_rates(i,28) = rate_constant(i,28) * number_density(i,159) * number_density(i,166)

    ! k_PBZNIT_1: PBZNIT -> 1*ACBZO2 + 1*NO2
    reaction_rates(i,29) = rate_constant(i,29) * number_density(i,149)

    ! k_HOCL_OH_1: HOCL + OH -> 1*H2O + 1*CLO
    reaction_rates(i,30) = rate_constant(i,30) * number_density(i,88) * number_density(i,166)

    ! k_PAN_1: PAN -> 1*CH3CO3 + 1*NO2
    reaction_rates(i,31) = rate_constant(i,31) * number_density(i,12)

    ! k_CH3CO3_CH3CO3_1: CH3CO3 + CH3CO3 -> 2*CH3O2 + 2*CO2
    reaction_rates(i,32) = rate_constant(i,32) * number_density(i,49) * number_density(i,49)

    ! k_CHBR3_1: CHBR3 -> 3*BR
    reaction_rates(i,33) = rate_constant(i,33) * number_density(i,84)

    ! k_CH3CHO_NO3_1: CH3CHO + NO3 -> 1*CH3CO3 + 1*HNO3
    reaction_rates(i,34) = rate_constant(i,34) * number_density(i,178) * number_density(i,165)
  end do
  !$acc end parallel

end subroutine calc_reaction_rates1

subroutine calc_reaction_rates2(rate_constant, number_density, number_density_air, reaction_rates)
  ! Compute reaction rates

  real(r8), intent(in)  :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in)  :: number_density(ncell,number_of_species)
  real(r8), intent(in)  :: number_density_air(ncell)
  real(r8), intent(out) :: reaction_rates(ncell,number_of_reactions)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_TERPROD2_1: TERPROD2 -> 0.15*RO2 + 0.68*CH2O + 0.8*CO2 + 0.5*CH3COCH3 + 0.65*CH3CO3 + 1.2*HO2 + 1.7*CO
    reaction_rates(i,35) = rate_constant(i,35) * number_density(i,155)

    ! k_HO2_MACRO2_1: HO2 + MACRO2 -> 1*MACROOH
    reaction_rates(i,36) = rate_constant(i,36) * number_density(i,192) * number_density(i,188)

    ! k_CH4_1: CH4 -> 1.44*H2 + 0.18*CH2O + 0.18*O + 0.33*OH + 0.33*H + 0.44*CO2 + 0.38*CO + 0.05*H2O
    reaction_rates(i,37) = rate_constant(i,37) * number_density(i,45)

    ! k_BR_HO2_1: BR + HO2 -> 1*HBR + 1*O2
    reaction_rates(i,38) = rate_constant(i,38) * number_density(i,90) * number_density(i,192)

    ! k_H2O_O1D_1: H2O + O1D -> 2*OH
    reaction_rates(i,39) = rate_constant(i,39) * number_density(i,68) * number_density(i,112)

    ! k_MACRO2_NO_1: MACRO2 + NO -> 1*NO2 + 0.47*HO2 + 0.25*CH2O + 0.53*GLYALD + 0.25*CH3COCHO + 0.53*CH3CO3 + 0.22*HYAC + 0.22*CO
    reaction_rates(i,40) = rate_constant(i,40) * number_density(i,188) * number_density(i,137)

