subroutine calc_reaction_rates4(rate_constant, number_density, number_density_air, reaction_rates)
  ! Compute reaction rates

  real(r8), intent(in)  :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in)  :: number_density(ncell,number_of_species)
  real(r8), intent(in)  :: number_density_air(ncell)
  real(r8), intent(out) :: reaction_rates(ncell,number_of_reactions)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_CLO_CLO_1: CLO + CLO -> 2*CL + 1*O2
    reaction_rates(i,103) = rate_constant(i,103) * number_density(i,86) * number_density(i,86)

    ! k_ALKOOH_OH_1: ALKOOH + OH -> 1*ALKO2
    reaction_rates(i,104) = rate_constant(i,104) * number_density(i,65) * number_density(i,166)

    ! k_MBOOOH_OH_1: MBOOOH + OH -> 0.5*MBOO2 + 0.5*OH
    reaction_rates(i,105) = rate_constant(i,105) * number_density(i,150) * number_density(i,166)

    ! k_CH3CO3_XO2_1: CH3CO3 + XO2 -> 0.25*CO + 0.25*CH2O + 0.25*GLYOXAL + 1*CH3O2 + 1*HO2 + 0.25*CH3COCHO + 0.25*HYAC + 0.25*GLYALD + 1*CO2
    reaction_rates(i,106) = rate_constant(i,106) * number_density(i,49) * number_density(i,153)

    ! k_CH3COOH_OH_1: CH3COOH + OH -> 1*CH3O2 + 1*CO2 + 1*H2O
    reaction_rates(i,107) = rate_constant(i,107) * number_density(i,177) * number_density(i,166)

    ! k_CH3CHO_OH_1: CH3CHO + OH -> 1*CH3CO3 + 1*H2O
    reaction_rates(i,108) = rate_constant(i,108) * number_density(i,178) * number_density(i,166)

    ! k_NO3_XO2_1: NO3 + XO2 -> 1*NO2 + 1*HO2 + 0.5*CO + 0.25*HYAC + 0.25*GLYOXAL + 0.25*CH3COCHO + 0.25*GLYALD
    reaction_rates(i,109) = rate_constant(i,109) * number_density(i,165) * number_density(i,153)

    ! k_NO_TERP2O2_1: NO + TERP2O2 -> 0.1*ONITR + 0.9*NO2 + 0.34*CH2O + 0.27*CH3COCH3 + 0.225*CO + 0.9*CO2 + 0.9*TERPROD2 + 0.9*HO2 + 0.225*GLYALD
    reaction_rates(i,110) = rate_constant(i,110) * number_density(i,137) * number_density(i,145)

    ! k_MTERP_NO3_1: MTERP + NO3 -> 1*NTERPO2
    reaction_rates(i,111) = rate_constant(i,111) * number_density(i,31) * number_density(i,165)

    ! k_CH3BR_OH_1: CH3BR + OH -> 1*BR + 1*H2O + 1*HO2
    reaction_rates(i,112) = rate_constant(i,112) * number_density(i,94) * number_density(i,166)

    ! k_HOCH2OO_NO_1: HOCH2OO + NO -> 1*HCOOH + 1*NO2 + 1*HO2
    reaction_rates(i,113) = rate_constant(i,113) * number_density(i,154) * number_density(i,137)

    ! k_H2O_2: H2O -> 1*H2 + 1*O1D
    reaction_rates(i,114) = rate_constant(i,114) * number_density(i,68)

    ! k_C3H7OOH_1: C3H7OOH -> 0.82*CH3COCH3 + 1*OH + 1*HO2
    reaction_rates(i,115) = rate_constant(i,115) * number_density(i,20)

    ! k_CCL4_1: CCL4 -> 4*CL
    reaction_rates(i,116) = rate_constant(i,116) * number_density(i,59)

    ! k_N_O2_1: N + O2 -> 1*NO + 1*O
    reaction_rates(i,117) = rate_constant(i,117) * number_density(i,185) * number_density(i,41)

    ! k_CLO_SO_1: CLO + SO -> 1*SO2 + 1*CL
    reaction_rates(i,118) = rate_constant(i,118) * number_density(i,86) * number_density(i,32)

    ! k_NOA_1: NOA -> 1*NO2 + 1*CH2O + 1*CH3CO3
    reaction_rates(i,119) = rate_constant(i,119) * number_density(i,27)

    ! k_CH2BR2_O1D_1: CH2BR2 + O1D -> 2*BR
    reaction_rates(i,120) = rate_constant(i,120) * number_density(i,169) * number_density(i,112)

    ! k_NO2_1: NO2 -> 1*NO + 1*O
    reaction_rates(i,121) = rate_constant(i,121) * number_density(i,54)

    ! k_CH3COCHO_OH_1: CH3COCHO + OH -> 1*CH3CO3 + 1*CO + 1*H2O
    reaction_rates(i,122) = rate_constant(i,122) * number_density(i,111) * number_density(i,166)

    ! k_GLYALD_OH_1: GLYALD + OH -> 1*HO2 + 0.2*GLYOXAL + 0.8*CH2O + 0.8*CO2
    reaction_rates(i,123) = rate_constant(i,123) * number_density(i,156) * number_density(i,166)

    ! k_HO2_NTERPO2_1: HO2 + NTERPO2 -> 1*NTERPOOH
    reaction_rates(i,124) = rate_constant(i,124) * number_density(i,192) * number_density(i,143)

    ! k_NO_O3S_1: NO + O3S -> 1*NO
    reaction_rates(i,125) = rate_constant(i,125) * number_density(i,137) * number_density(i,36)

    ! k_BIGALD3_1: BIGALD3 -> 0.6*HO2 + 0.6*CO + 0.6*MDIALO2
    reaction_rates(i,126) = rate_constant(i,126) * number_density(i,108)

    ! k_OH_POOH_1: OH + POOH -> 0.5*PO2 + 0.5*OH + 0.5*HYAC + 1*H2O
    reaction_rates(i,127) = rate_constant(i,127) * number_density(i,166) * number_density(i,9)

    ! k_CF2CLBR_O1D_1: CF2CLBR + O1D -> 1*CL + 1*BR + 1*COF2
    reaction_rates(i,128) = rate_constant(i,128) * number_density(i,98) * number_density(i,112)

    ! k_NO3_O_1: NO3 + O -> 1*NO2 + 1*O2
    reaction_rates(i,129) = rate_constant(i,129) * number_density(i,165) * number_density(i,187)

    ! k_CH3CCL3_OH_1: CH3CCL3 + OH -> 1*H2O + 3*CL
    reaction_rates(i,130) = rate_constant(i,130) * number_density(i,79) * number_density(i,166)

    ! k_CH2BR2_1: CH2BR2 -> 2*BR
    reaction_rates(i,131) = rate_constant(i,131) * number_density(i,169)

    ! k_BEPOMUC_1: BEPOMUC -> 1*BIGALD1 + 1.5*HO2 + 1.5*CO
    reaction_rates(i,132) = rate_constant(i,132) * number_density(i,96)

    ! k_HO2_RO2_1: HO2 + RO2 -> 0.85*ROOH + 0.15*OH + 0.15*CH2O + 0.15*CH3CO3
    reaction_rates(i,133) = rate_constant(i,133) * number_density(i,192) * number_density(i,40)

    ! k_MACRO2_NO3_1: MACRO2 + NO3 -> 1*NO2 + 0.47*HO2 + 0.25*CH2O + 0.25*CH3COCHO + 0.22*CO + 0.53*GLYALD + 0.22*HYAC + 0.53*CH3CO3
    reaction_rates(i,134) = rate_constant(i,134) * number_density(i,188) * number_density(i,165)

    ! k_CH3O2_NTERPO2_1: CH3O2 + NTERPO2 -> 0.5*TERPNIT + 0.75*CH2O + 0.25*CH3OH + 0.5*HO2 + 0.5*TERPROD1 + 0.5*NO2
    reaction_rates(i,135) = rate_constant(i,135) * number_density(i,191) * number_density(i,143)

    ! k_MACROOH_OH_1: MACROOH + OH -> 0.5*MCO3 + 0.2*MACRO2 + 0.1*OH + 0.2*HO2
    reaction_rates(i,136) = rate_constant(i,136) * number_density(i,44) * number_density(i,166)
  end do
  !$acc end parallel

end subroutine calc_reaction_rates4

