    ! k_HMPROPO2_NO_1: HMPROPO2 + NO -> 1*NO2 + 1*CO2 + 1*HO2 + 1*CH3COCH3
    reaction_rates(i,156) = rate_constant(i,156) * number_density(i,77) * number_density(i,137)

    ! k_HBR_1: HBR -> 1*BR + 1*H
