    reaction_rates(i,172) = rate_constant(i,172) * number_density(i,192) * number_density(i,154)

    ! k_MTERP_NO3_2: MTERP + NO3 -> 1*MTERP + 1*NO3 + 0.17493*SOAG3 + 0.59019*SOAG4
    reaction_rates(i,173) = rate_constant(i,173) * number_density(i,31) * number_density(i,165)

    ! k_C2H6_OH_1: C2H6 + OH -> 1*C2H5O2 + 1*H2O
    reaction_rates(i,174) = rate_constant(i,174) * number_density(i,174) * number_density(i,166)

    ! k_C6H5O2_NO_1: C6H5O2 + NO -> 1*PHENO + 1*NO2
    reaction_rates(i,175) = rate_constant(i,175) * number_density(i,81) * number_density(i,137)

    ! k_GLYOXAL_OH_1: GLYOXAL + OH -> 1*HO2 + 1*CO + 1*CO2
    reaction_rates(i,176) = rate_constant(i,176) * number_density(i,131) * number_density(i,166)

    ! k_XOOH_1: XOOH -> 1*OH
    reaction_rates(i,177) = rate_constant(i,177) * number_density(i,103)

    ! k_ISOPBO2_NO3_1: ISOPBO2 + NO3 -> 1*NO2 + 0.95*HYDRALD + 1*HO2 + 0.05*GLYOXAL + 0.05*GLYALD + 0.05*CH3COCHO + 0.05*HYAC
    reaction_rates(i,178) = rate_constant(i,178) * number_density(i,190) * number_density(i,165)

    ! k_C6H5O2_HO2_1: C6H5O2 + HO2 -> 1*C6H5OOH
    reaction_rates(i,179) = rate_constant(i,179) * number_density(i,81) * number_density(i,192)

    ! k_N2O_O1D_1: N2O + O1D -> 2*NO
    reaction_rates(i,180) = rate_constant(i,180) * number_density(i,161) * number_density(i,112)

    ! k_MTERP_OH_1: MTERP + OH -> 1*TERPO2
    reaction_rates(i,181) = rate_constant(i,181) * number_density(i,31) * number_density(i,166)

    ! k_NC4CHO_OH_1: NC4CHO + OH -> 1*GLYOXAL + 1*NOA + 1*HO2
    reaction_rates(i,182) = rate_constant(i,182) * number_density(i,23) * number_density(i,166)

    ! k_CH4_2: CH4 -> 1*H + 1*CH3O2
    reaction_rates(i,183) = rate_constant(i,183) * number_density(i,45)

    ! k_BRO_NO2_1: BRO + NO2 -> 1*BRONO2
    reaction_rates(i,184) = rate_constant(i,184) * number_density(i,71) * number_density(i,54)

    ! k_OH_XOOH_1: OH + XOOH -> 0.5*XO2 + 0.5*OH
    reaction_rates(i,185) = rate_constant(i,185) * number_density(i,166) * number_density(i,103)

    ! k_HOBR_1: HOBR -> 1*BR + 1*OH
    reaction_rates(i,186) = rate_constant(i,186) * number_density(i,186)

    ! k_O_O3_1: O + O3 -> 2*O2
    reaction_rates(i,187) = rate_constant(i,187) * number_density(i,187) * number_density(i,171)

    ! k_C2H4_CL_1: C2H4 + CL -> 1*CL
    reaction_rates(i,188) = rate_constant(i,188) * number_density(i,93) * number_density(i,100)

    ! k_NO3_1: NO3 -> 1*NO2 + 1*O
    reaction_rates(i,189) = rate_constant(i,189) * number_density(i,165)

    ! k_IEPOX_OH_1: IEPOX + OH -> 1*XO2
    reaction_rates(i,190) = rate_constant(i,190) * number_density(i,76) * number_density(i,166)

    ! k_MBO_OH_1: MBO + OH -> 1*MBOO2
    reaction_rates(i,191) = rate_constant(i,191) * number_density(i,127) * number_density(i,166)

    ! k_H2O_3: H2O -> 1*OH + 1*H
    reaction_rates(i,192) = rate_constant(i,192) * number_density(i,68)

    ! k_C2H6_CL_1: C2H6 + CL -> 1*HCL + 1*C2H5O2
    reaction_rates(i,193) = rate_constant(i,193) * number_density(i,174) * number_density(i,100)

    ! k_ALKO2_NO_2: ALKO2 + NO -> 1*ALKNIT
    reaction_rates(i,194) = rate_constant(i,194) * number_density(i,85) * number_density(i,137)

    ! k_BZOO_NO_1: BZOO + NO -> 1*BZALD + 1*NO2 + 1*HO2
    reaction_rates(i,195) = rate_constant(i,195) * number_density(i,33) * number_density(i,137)

    ! k_O_OH_1: O + OH -> 1*H + 1*O2
    reaction_rates(i,196) = rate_constant(i,196) * number_density(i,187) * number_density(i,166)

    ! k_DMS_NO3_1: DMS + NO3 -> 1*SO2 + 1*HNO3
    reaction_rates(i,197) = rate_constant(i,197) * number_density(i,99) * number_density(i,165)

    ! k_MCO3_MCO3_1: MCO3 + MCO3 -> 2*CO2 + 2*CH2O + 2*CH3CO3
    reaction_rates(i,198) = rate_constant(i,198) * number_density(i,167) * number_density(i,167)

