    reaction_rates(i,199) = rate_constant(i,199) * number_density(i,184)

    ! k_HCFC141B_1: HCFC141B -> 2*CL
    reaction_rates(i,200) = rate_constant(i,200) * number_density(i,106)

    ! k_ENEO2_NO_1: ENEO2 + NO -> 1*CH3CHO + 0.5*CH2O + 0.5*CH3COCH3 + 1*HO2 + 1*NO2
    reaction_rates(i,201) = rate_constant(i,201) * number_density(i,133) * number_density(i,137)

    ! k_M_O_O2_1: M + O + O2 -> 1*O3 + 1*M
    reaction_rates(i,202) = rate_constant(i,202) * number_density(i,1) * number_density(i,187) * number_density(i,41)

    ! k_CLO_NO_1: CLO + NO -> 1*NO2 + 1*CL
    reaction_rates(i,203) = rate_constant(i,203) * number_density(i,86) * number_density(i,137)

    ! k_BRO_OH_1: BRO + OH -> 1*BR + 1*HO2
    reaction_rates(i,204) = rate_constant(i,204) * number_density(i,71) * number_density(i,166)
  end do
  !$acc end parallel

end subroutine calc_reaction_rates6

subroutine calc_reaction_rates7(rate_constant, number_density, number_density_air, reaction_rates)
  ! Compute reaction rates

  real(r8), intent(in)  :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in)  :: number_density(ncell,number_of_species)
  real(r8), intent(in)  :: number_density_air(ncell)
  real(r8), intent(out) :: reaction_rates(ncell,number_of_reactions)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_HO2_XO2_1: HO2 + XO2 -> 1*XOOH
    reaction_rates(i,205) = rate_constant(i,205) * number_density(i,192) * number_density(i,153)

    ! k_BRO_NO_1: BRO + NO -> 1*BR + 1*NO2
    reaction_rates(i,206) = rate_constant(i,206) * number_density(i,71) * number_density(i,137)

    ! k_NO2_OH_1: NO2 + OH -> 1*HNO3
    reaction_rates(i,207) = rate_constant(i,207) * number_density(i,54) * number_density(i,166)

    ! k_CO_OH_1: CO + OH -> 1*CO2 + 1*HO2
    reaction_rates(i,208) = rate_constant(i,208) * number_density(i,176) * number_density(i,166)

    ! k_HO2_HO2_1: HO2 + HO2 -> 1*H2O2 + 1*O2
    reaction_rates(i,209) = rate_constant(i,209) * number_density(i,192) * number_density(i,192)

    ! k_HO2_HO2_M_1: HO2 + HO2 + M -> 1*H2O2 + 1*O2 + 1*M
    reaction_rates(i,210) = rate_constant(i,210) * number_density(i,192) * number_density(i,192) * number_density(i,1)

    ! k_H2O_HO2_HO2_1: H2O + HO2 + HO2 -> 1*H2O2 + 1*O2 + 1*H2O
    reaction_rates(i,211) = rate_constant(i,211) * number_density(i,68) * number_density(i,192) * number_density(i,192)

    ! k_H2O_HO2_HO2_M_1: H2O + HO2 + HO2 + M -> 1*H2O2 + 1*O2 + 1*M + 1*H2O
    reaction_rates(i,212) = rate_constant(i,212) * number_density(i,68) * number_density(i,192) * number_density(i,192) * number_density(i,1)

    ! k_OH_OH_2: OH + OH -> 1*H2O2
    reaction_rates(i,213) = rate_constant(i,213) * number_density(i,166) * number_density(i,166)

    ! k_CLO_NO2_1: CLO + NO2 -> 1*CLONO2
    reaction_rates(i,214) = rate_constant(i,214) * number_density(i,86) * number_density(i,54)

    ! k_HYAC_1: HYAC -> 1*CH3CO3 + 1*HO2 + 1*CH2O
    reaction_rates(i,215) = rate_constant(i,215) * number_density(i,57)

    ! k_ONITR_1: ONITR -> 1*NO2
    reaction_rates(i,216) = rate_constant(i,216) * number_density(i,129)

    ! k_HO2_O_1: HO2 + O -> 1*OH + 1*O2
    reaction_rates(i,217) = rate_constant(i,217) * number_density(i,192) * number_density(i,187)

    ! k_TERPOOH_1: TERPOOH -> 0.4*CH2O + 0.05*CH3COCH3 + 1*TERPROD1 + 1*HO2 + 1*OH
    reaction_rates(i,218) = rate_constant(i,218) * number_density(i,113)

    ! k_CL2_1: CL2 -> 2*CL
    reaction_rates(i,219) = rate_constant(i,219) * number_density(i,70)

    ! k_MACR_OH_1: MACR + OH -> 0.5*MACRO2 + 0.5*H2O + 0.5*MCO3
    reaction_rates(i,220) = rate_constant(i,220) * number_density(i,157) * number_density(i,166)

    ! k_C3H6_NO3_1: C3H6 + NO3 -> 1*NOA
    reaction_rates(i,221) = rate_constant(i,221) * number_density(i,120) * number_density(i,165)

    ! k_CFC12_O1D_1: CFC12 + O1D -> 2*CL + 1*COF2
    reaction_rates(i,222) = rate_constant(i,222) * number_density(i,64) * number_density(i,112)

    ! k_BRO_O_1: BRO + O -> 1*BR + 1*O2
    reaction_rates(i,223) = rate_constant(i,223) * number_density(i,71) * number_density(i,187)

    ! k_H_HO2_1: H + HO2 -> 1*H2 + 1*O2
    reaction_rates(i,224) = rate_constant(i,224) * number_density(i,48) * number_density(i,192)

    ! k_BCARY_NO3_1: BCARY + NO3 -> 1*NTERPO2
    reaction_rates(i,225) = rate_constant(i,225) * number_density(i,102) * number_density(i,165)

    ! k_HBR_OH_1: HBR + OH -> 1*BR + 1*H2O
    reaction_rates(i,226) = rate_constant(i,226) * number_density(i,80) * number_density(i,166)

    ! k_DMS_OH_1: DMS + OH -> 0.5*SO2 + 0.5*HO2
    reaction_rates(i,227) = rate_constant(i,227) * number_density(i,99) * number_density(i,166)

    ! k_MBO_O3_1: MBO + O3 -> 0.7*HMPROP + 0.64*CO + 0.36*OH + 0.48*HO2 + 0.17*HCOOH + 0.3*CH2O + 0.23*CH3COCH3
    reaction_rates(i,228) = rate_constant(i,228) * number_density(i,127) * number_density(i,171)

    ! k_BCARY_O3_1: BCARY + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
    reaction_rates(i,229) = rate_constant(i,229) * number_density(i,102) * number_density(i,171)

    ! k_HCFC142B_1: HCFC142B -> 1*CL + 1*COF2
    reaction_rates(i,230) = rate_constant(i,230) * number_density(i,172)

    ! k_C3H6_OH_1: C3H6 + OH -> 1*PO2
    reaction_rates(i,231) = rate_constant(i,231) * number_density(i,120) * number_density(i,166)

    ! k_BCARY_OH_2: BCARY + OH -> 1*TERPO2
    reaction_rates(i,232) = rate_constant(i,232) * number_density(i,102) * number_density(i,166)

    ! k_ISOPOOH_1: ISOPOOH -> 0.402*MVK + 0.288*MACR + 0.69*CH2O + 1*HO2
    reaction_rates(i,233) = rate_constant(i,233) * number_density(i,138)

    ! k_HCN_OH_1: HCN + OH -> 1*HO2
    reaction_rates(i,234) = rate_constant(i,234) * number_density(i,47) * number_density(i,166)

    ! k_CH3CO3_MACRO2_1: CH3CO3 + MACRO2 -> 0.25*CH3COCHO + 1*CH3O2 + 0.22*CO + 0.47*HO2 + 0.53*GLYALD + 0.22*HYAC + 0.25*CH2O + 0.53*CH3CO3
    reaction_rates(i,235) = rate_constant(i,235) * number_density(i,49) * number_density(i,188)

    ! k_N2O5_1: N2O5 -> 1*NO2 + 1*NO3
    reaction_rates(i,236) = rate_constant(i,236) * number_density(i,51)

    ! k_H2_O1D_1: H2 + O1D -> 1*H + 1*OH
    reaction_rates(i,237) = rate_constant(i,237) * number_density(i,152) * number_density(i,112)

    ! k_HCFC22_OH_1: HCFC22 + OH -> 1*H2O + 1*CL + 1*COF2
    reaction_rates(i,238) = rate_constant(i,238) * number_density(i,83) * number_density(i,166)
  end do
  !$acc end parallel

end subroutine calc_reaction_rates7

subroutine calc_reaction_rates8(rate_constant, number_density, number_density_air, reaction_rates)
  ! Compute reaction rates

  real(r8), intent(in)  :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in)  :: number_density(ncell,number_of_species)
  real(r8), intent(in)  :: number_density_air(ncell)
  real(r8), intent(out) :: reaction_rates(ncell,number_of_reactions)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_H2O2_1: H2O2 -> 2*OH
    reaction_rates(i,239) = rate_constant(i,239) * number_density(i,179)

    ! k_H_O2_1: H + O2 -> 1*HO2
    reaction_rates(i,240) = rate_constant(i,240) * number_density(i,48) * number_density(i,41)

    ! k_O2_SO_1: O2 + SO -> 1*SO2 + 1*O
    reaction_rates(i,241) = rate_constant(i,241) * number_density(i,41) * number_density(i,32)

