    reaction_rates(i,446) = rate_constant(i,446) * number_density(i,69)

    ! k_HOBR_O_1: HOBR + O -> 1*BRO + 1*OH
    reaction_rates(i,447) = rate_constant(i,447) * number_density(i,186) * number_density(i,187)

    ! k_BRO_CLO_3: BRO + CLO -> 1*BR + 1*OCLO
    reaction_rates(i,448) = rate_constant(i,448) * number_density(i,71) * number_density(i,86)

    ! k_CH2O_HO2_1: CH2O + HO2 -> 1*HOCH2OO
    reaction_rates(i,449) = rate_constant(i,449) * number_density(i,124) * number_density(i,192)

    ! k_C2H2_CL_1: C2H2 + CL -> 1*CL
    reaction_rates(i,450) = rate_constant(i,450) * number_density(i,168) * number_density(i,100)

    ! k_ISOPNO3_NO3_1: ISOPNO3 + NO3 -> 1*NC4CHO + 1*NO2 + 1*HO2
    reaction_rates(i,451) = rate_constant(i,451) * number_density(i,46) * number_density(i,165)

    ! k_ALKNIT_1: ALKNIT -> 1*NO2 + 0.4*CH3CHO + 0.1*CH2O + 0.25*CH3COCH3 + 1*HO2 + 0.8*MEK
    reaction_rates(i,452) = rate_constant(i,452) * number_density(i,5)

    ! k_HMPROP_OH_1: HMPROP + OH -> 1*HMPROPO2
    reaction_rates(i,453) = rate_constant(i,453) * number_density(i,132) * number_density(i,166)

    ! k_HO2_NO3_1: HO2 + NO3 -> 1*OH + 1*NO2 + 1*O2
    reaction_rates(i,454) = rate_constant(i,454) * number_density(i,192) * number_density(i,165)

    ! k_CH2BR2_OH_1: CH2BR2 + OH -> 2*BR + 1*H2O
    reaction_rates(i,455) = rate_constant(i,455) * number_density(i,169) * number_density(i,166)

    ! k_H2O2_OH_1: H2O2 + OH -> 1*H2O + 1*HO2
    reaction_rates(i,456) = rate_constant(i,456) * number_density(i,179) * number_density(i,166)

    ! k_H_HO2_3: H + HO2 -> 2*OH
    reaction_rates(i,457) = rate_constant(i,457) * number_density(i,48) * number_density(i,192)

    ! k_HCL_OH_1: HCL + OH -> 1*H2O + 1*CL
    reaction_rates(i,458) = rate_constant(i,458) * number_density(i,180) * number_density(i,166)

    ! k_CH3O2_CH3O2_2: CH3O2 + CH3O2 -> 1*CH2O + 1*CH3OH
    reaction_rates(i,459) = rate_constant(i,459) * number_density(i,191) * number_density(i,191)

    ! k_CHBR3_OH_1: CHBR3 + OH -> 3*BR
    reaction_rates(i,460) = rate_constant(i,460) * number_density(i,84) * number_density(i,166)

    ! k_NH3_OH_1: NH3 + OH -> 1*H2O
    reaction_rates(i,461) = rate_constant(i,461) * number_density(i,3) * number_density(i,166)

    ! k_CHBR3_CL_1: CHBR3 + CL -> 3*BR + 1*HCL
    reaction_rates(i,462) = rate_constant(i,462) * number_density(i,84) * number_density(i,100)

    ! k_CLONO2_O_1: CLONO2 + O -> 1*CLO + 1*NO3
    reaction_rates(i,463) = rate_constant(i,463) * number_density(i,74) * number_density(i,187)

    ! k_ISOPAO2_NO_1: ISOPAO2 + NO -> 0.08*ISOPNITA + 0.92*NO2 + 0.36*MACR + 0.56*MVK + 0.92*CH2O + 0.92*HO2
    reaction_rates(i,464) = rate_constant(i,464) * number_density(i,189) * number_density(i,137)

    ! k_H2_O_1: H2 + O -> 1*OH + 1*H
    reaction_rates(i,465) = rate_constant(i,465) * number_density(i,152) * number_density(i,187)

    ! k_HCFC142B_O1D_1: HCFC142B + O1D -> 1*CL + 1*COF2
    reaction_rates(i,466) = rate_constant(i,466) * number_density(i,172) * number_density(i,112)

    ! k_CH3O2_CLO_1: CH3O2 + CLO -> 1*CL + 1*HO2 + 1*CH2O
    reaction_rates(i,467) = rate_constant(i,467) * number_density(i,191) * number_density(i,86)

    ! k_CLO_CLO_4: CLO + CLO -> 1*CL + 1*OCLO
    reaction_rates(i,468) = rate_constant(i,468) * number_density(i,86) * number_density(i,86)

    ! k_BIGALD_1: BIGALD -> 0.45*CO + 0.13*GLYOXAL + 0.56*HO2 + 0.13*CH3CO3 + 0.18*CH3COCHO
    reaction_rates(i,469) = rate_constant(i,469) * number_density(i,105)

    ! k_CL_HO2_2: CL + HO2 -> 1*OH + 1*CLO
    reaction_rates(i,470) = rate_constant(i,470) * number_density(i,100) * number_density(i,192)

    ! k_C3H7O2_NO_1: C3H7O2 + NO -> 0.82*CH3COCH3 + 1*NO2 + 1*HO2 + 0.27*CH3CHO
    reaction_rates(i,471) = rate_constant(i,471) * number_density(i,109) * number_density(i,137)

    ! k_NO2_O_2: NO2 + O -> 1*NO3
    reaction_rates(i,472) = rate_constant(i,472) * number_density(i,54) * number_density(i,187)

    ! k_HBR_O_1: HBR + O -> 1*BR + 1*OH
    reaction_rates(i,473) = rate_constant(i,473) * number_density(i,80) * number_density(i,187)

    ! k_CFC11_O1D_1: CFC11 + O1D -> 3*CL
    reaction_rates(i,474) = rate_constant(i,474) * number_density(i,61) * number_density(i,112)

    ! k_BIGENE_OH_1: BIGENE + OH -> 1*ENEO2
    reaction_rates(i,475) = rate_constant(i,475) * number_density(i,97) * number_density(i,166)

    ! k_DMS_OH_2: DMS + OH -> 1*SO2
    reaction_rates(i,476) = rate_constant(i,476) * number_density(i,99) * number_density(i,166)
  end do
  !$acc end parallel

end subroutine calc_reaction_rates14

subroutine calc_reaction_rates15(rate_constant, number_density, number_density_air, reaction_rates)
  ! Compute reaction rates

  real(r8), intent(in)  :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in)  :: number_density(ncell,number_of_species)
  real(r8), intent(in)  :: number_density_air(ncell)
  real(r8), intent(out) :: reaction_rates(ncell,number_of_reactions)

  ! Local variables
  integer :: i

  !$acc parallel default(present) vector_length(VLEN)
  !$acc loop gang vector
  do i = 1, ncell

    ! k_C2H5OH_OH_1: C2H5OH + OH -> 1*HO2 + 1*CH3CHO
    reaction_rates(i,477) = rate_constant(i,477) * number_density(i,126) * number_density(i,166)

    ! k_BENZENE_OH_2: BENZENE + OH -> 1*BENZENE + 1*OH + 0.0023*SOAG0 + 0.0008*SOAG1 + 0.0843*SOAG2 + 0.0443*SOAG3 + 0.1621*SOAG4
    reaction_rates(i,478) = rate_constant(i,478) * number_density(i,101) * number_density(i,166)

    ! k_HO2_TOLO2_1: HO2 + TOLO2 -> 1*TOLOOH
    reaction_rates(i,479) = rate_constant(i,479) * number_density(i,192) * number_density(i,144)

    ! k_CL_CLONO2_1: CL + CLONO2 -> 1*CL2 + 1*NO3
    reaction_rates(i,480) = rate_constant(i,480) * number_density(i,100) * number_density(i,74)

    ! k_NO2_NO3_1: NO2 + NO3 -> 1*N2O5
    reaction_rates(i,481) = rate_constant(i,481) * number_density(i,54) * number_density(i,165)

    ! k_ISOPOOH_OH_1: ISOPOOH + OH -> 0.4*XO2 + 0.6*IEPOX + 0.6*OH
    reaction_rates(i,482) = rate_constant(i,482) * number_density(i,138) * number_density(i,166)

    ! k_HO2_NO_1: HO2 + NO -> 1*NO2 + 1*OH
    reaction_rates(i,483) = rate_constant(i,483) * number_density(i,192) * number_density(i,137)

    ! k_NO_RO2_1: NO + RO2 -> 1*CH3CO3 + 1*CH2O + 1*NO2
    reaction_rates(i,484) = rate_constant(i,484) * number_density(i,137) * number_density(i,40)

    ! k_BZOOH_OH_1: BZOOH + OH -> 1*BZOO
    reaction_rates(i,485) = rate_constant(i,485) * number_density(i,8) * number_density(i,166)

    ! k_OH_SO_1: OH + SO -> 1*SO2 + 1*H
    reaction_rates(i,486) = rate_constant(i,486) * number_density(i,166) * number_density(i,32)

    ! k_O1D_O3_1: O1D + O3 -> 1*O2
    reaction_rates(i,487) = rate_constant(i,487) * number_density(i,112) * number_density(i,171)

  end do
  !$acc end parallel

end subroutine calc_reaction_rates15

subroutine calc_reaction_rates(rate_constant, number_density, number_density_air, reaction_rates)
  ! Compute reaction rates

  real(r8), intent(in)  :: rate_constant(ncell,number_of_reactions)
  real(r8), intent(in)  :: number_density(ncell,number_of_species)
  real(r8), intent(in)  :: number_density_air(ncell)
  real(r8), intent(out) :: reaction_rates(ncell,number_of_reactions)

  ! Local variables
  integer :: i

  call calc_reaction_rates1(rate_constant, number_density, number_density_air, reaction_rates)
  call calc_reaction_rates2(rate_constant, number_density, number_density_air, reaction_rates)
  call calc_reaction_rates3(rate_constant, number_density, number_density_air, reaction_rates)
  call calc_reaction_rates4(rate_constant, number_density, number_density_air, reaction_rates)
  call calc_reaction_rates5(rate_constant, number_density, number_density_air, reaction_rates)
