subroutine dforce_dy_times_vector1(dforce_dy, vector, cummulative_product)
  !  Compute product of [ dforce_dy * vector ]
  !  Commonly used to compute time-truncation errors [dforce_dy * force ]

  real(r8), intent(in) :: dforce_dy(ncell,number_sparse_factor_elements) ! Jacobian of forcing
  real(r8), intent(in) :: vector(ncell,number_of_species)    ! Vector ordered as the order of number density in dy
  real(r8), intent(out) :: cummulative_product(ncell,number_of_species)  ! Product of jacobian with vector

  ! Local variables
  integer :: i, j

  !$acc parallel default(present) vector_length(VLEN)
  !$acc loop gang vector
  do i = 1, ncell

    ! df_ALKNIT/d(ALKNIT) * ALKNIT_temporary
    cummulative_product(i,5) = cummulative_product(i,5) + dforce_dy(i,17) * vector(i,5)

    ! df_MEK/d(ALKNIT) * ALKNIT_temporary
    cummulative_product(i,104) = cummulative_product(i,104) + dforce_dy(i,20) * vector(i,5)

    ! df_NO2/d(ALKNIT) * ALKNIT_temporary
    cummulative_product(i,54) = cummulative_product(i,54) + dforce_dy(i,18) * vector(i,5)

    ! df_CH3COCH3/d(ALKNIT) * ALKNIT_temporary
    cummulative_product(i,89) = cummulative_product(i,89) + dforce_dy(i,19) * vector(i,5)

    ! df_CH2O/d(ALKNIT) * ALKNIT_temporary
    cummulative_product(i,124) = cummulative_product(i,124) + dforce_dy(i,21) * vector(i,5)

    ! df_HO2/d(ALKNIT) * ALKNIT_temporary
    cummulative_product(i,192) = cummulative_product(i,192) + dforce_dy(i,24) * vector(i,5)

    ! df_OH/d(ALKNIT) * ALKNIT_temporary
    cummulative_product(i,166) = cummulative_product(i,166) + dforce_dy(i,22) * vector(i,5)

    ! df_CH3CHO/d(ALKNIT) * ALKNIT_temporary
    cummulative_product(i,178) = cummulative_product(i,178) + dforce_dy(i,23) * vector(i,5)

    ! df_BZOOH/d(BZOOH) * BZOOH_temporary
    cummulative_product(i,8) = cummulative_product(i,8) + dforce_dy(i,27) * vector(i,8)

    ! df_BZOO/d(BZOOH) * BZOOH_temporary
    cummulative_product(i,33) = cummulative_product(i,33) + dforce_dy(i,28) * vector(i,8)

    ! df_BZALD/d(BZOOH) * BZOOH_temporary
    cummulative_product(i,107) = cummulative_product(i,107) + dforce_dy(i,29) * vector(i,8)

    ! df_HO2/d(BZOOH) * BZOOH_temporary
    cummulative_product(i,192) = cummulative_product(i,192) + dforce_dy(i,31) * vector(i,8)

    ! df_OH/d(BZOOH) * BZOOH_temporary
    cummulative_product(i,166) = cummulative_product(i,166) + dforce_dy(i,30) * vector(i,8)

    ! df_C6H5OOH/d(C6H5OOH) * C6H5OOH_temporary
    cummulative_product(i,10) = cummulative_product(i,10) + dforce_dy(i,40) * vector(i,10)

    ! df_C6H5O2/d(C6H5OOH) * C6H5OOH_temporary
    cummulative_product(i,81) = cummulative_product(i,81) + dforce_dy(i,41) * vector(i,10)

    ! df_PHENO/d(C6H5OOH) * C6H5OOH_temporary
    cummulative_product(i,182) = cummulative_product(i,182) + dforce_dy(i,43) * vector(i,10)

    ! df_OH/d(C6H5OOH) * C6H5OOH_temporary
    cummulative_product(i,166) = cummulative_product(i,166) + dforce_dy(i,42) * vector(i,10)

    ! df_O2/d(O2) * O2_temporary
    cummulative_product(i,41) = cummulative_product(i,41) + dforce_dy(i,227) * vector(i,41)

    ! df_SO/d(O2) * O2_temporary
    cummulative_product(i,32) = cummulative_product(i,32) + dforce_dy(i,226) * vector(i,41)

    ! df_H/d(O2) * O2_temporary
    cummulative_product(i,48) = cummulative_product(i,48) + dforce_dy(i,228) * vector(i,41)

    ! df_SO2/d(O2) * O2_temporary
    cummulative_product(i,55) = cummulative_product(i,55) + dforce_dy(i,230) * vector(i,41)

    ! df_NO/d(O2) * O2_temporary
    cummulative_product(i,137) = cummulative_product(i,137) + dforce_dy(i,236) * vector(i,41)

    ! df_N/d(O2) * O2_temporary
    cummulative_product(i,185) = cummulative_product(i,185) + dforce_dy(i,242) * vector(i,41)

    ! df_O/d(O2) * O2_temporary
    cummulative_product(i,187) = cummulative_product(i,187) + dforce_dy(i,243) * vector(i,41)

    ! df_O1D/d(O2) * O2_temporary
    cummulative_product(i,112) = cummulative_product(i,112) + dforce_dy(i,235) * vector(i,41)

    ! df_EO/d(O2) * O2_temporary
    cummulative_product(i,162) = cummulative_product(i,162) + dforce_dy(i,238) * vector(i,41)

    ! df_GLYALD/d(O2) * O2_temporary
    cummulative_product(i,156) = cummulative_product(i,156) + dforce_dy(i,237) * vector(i,41)

    ! df_HO2/d(O2) * O2_temporary
    cummulative_product(i,192) = cummulative_product(i,192) + dforce_dy(i,244) * vector(i,41)

    ! df_O3/d(O2) * O2_temporary
    cummulative_product(i,171) = cummulative_product(i,171) + dforce_dy(i,240) * vector(i,41)

    ! df_BENZO2/d(BENZO2) * BENZO2_temporary
    cummulative_product(i,13) = cummulative_product(i,13) + dforce_dy(i,55) * vector(i,13)

    ! df_NO2/d(BENZO2) * BENZO2_temporary
    cummulative_product(i,54) = cummulative_product(i,54) + dforce_dy(i,56) * vector(i,13)

    ! df_NO/d(BENZO2) * BENZO2_temporary
    cummulative_product(i,137) = cummulative_product(i,137) + dforce_dy(i,60) * vector(i,13)

    ! df_GLYOXAL/d(BENZO2) * BENZO2_temporary
    cummulative_product(i,131) = cummulative_product(i,131) + dforce_dy(i,59) * vector(i,13)

    ! df_HO2/d(BENZO2) * BENZO2_temporary
  end do
  !$acc end parallel

end subroutine dforce_dy_times_vector1

